INSERT INTO `documento` VALUES (1,'DESARROLLO DE UNA APLICACIÃ“N WEB QUE PERMITE DETECTAR SIMILITUDES ENTRE DOCUMENTOS DIGITALES.','{}','2008-11-03','Similitud, originalidad, copia, plagio, comparaciÃ³n, semejanza, cotejo, documentos, tÃ©cnica Check.',2,1,1,1,1,'2013-09-17 08:20:51','2013-09-17 08:20:51','Documento_1.pdf','application/pdf',2945441,'2013-09-17 08:20:51',20,0,107,'COMPLETO'),(2,'ESTUDIO DE LA BIODEGRADACIÃ“N DEL CRUDO GUAFITA 1X EN DOS SUELOS DE DIFERENTE TEXTURA Y COMPOSICIÃ“N MINERALÃ“GICA','Se estudiÃ³ la biodegradaciÃ³n de un crudo liviano, durante 90 dÃ­as, en dos suelos de diferente textura y composiciÃ³n mineralÃ³gica. El proceso se evaluÃ³ en base a: la disminuciÃ³n de la cantidad de crudo extraÃ­do en intervalos de tiempo establecidos, los cambios en la composiciÃ³n SARA y la variaciÃ³n de los biomarcadores presentes en la fracciÃ³n de hidrocarburos saturados del crudo durante el tiempo de estudio. Para ello se tomaron dos suelos de diferente textura y composiciÃ³n mineralÃ³gica: un suelo arenoso compuesto por cuarzo e ilita, y un suelo franco- arcillo- arenoso, compuesto por cuarzo y caolinita. Ambos suelos fueron estudiados con y sin un agente estructurante constituido por hojarasca (hojas secas de diferentes Ã¡rboles caÃ­das en el suelo). Las muestras se dividieron en cuatro grupos de la siguiente manera:- GRUPO 1: Suelo arenoso- GRUPO 2: Suelo franco-arcillo-arenoso- GRUPO 3: Suelo arenoso con agente estructurante- GRUPO 4: Suelo franco-arcillo-arenoso con agente estructuranteEn cada uno de los grupos se tomo el suelo determinado y se contaminÃ³ con un crudo liviano (Guafita 1X) a una concentraciÃ³n de aproximadamente 5%, seguidamente se aÃ±adiÃ³ fertilizantes, y de manera periÃ³dica se ajustÃ³ la humedad y el nivel de oxÃ­geno, mediante aireaciÃ³n, mezclando la muestra con un rastrillo. A los 1 y 30 dÃ­as de avance de la biodegradaciÃ³n se realizÃ³ una extracciÃ³n sohxlet del crudo presente en el suelo a una muestra de 3g de cada uno de los grupos, empleando como solvente diclorometano. Seguidamente se realizÃ³ la separaciÃ³n de asfaltenos, mediante la adiciÃ³n de n- heptano en una proporciÃ³n 40:1 (n-heptano: extracto), la determinaciÃ³n de la composiciÃ³n SAR (saturados, aromÃ¡ticos y resinas) mediante cromatografÃ­a de adsorciÃ³n en columna y por Ãºltimo la determinaciÃ³n de los biomarcadores presentes en la fracciÃ³n de hidrocarburos saturados mediante cromatografÃ­a de gases acoplada a espectrometrÃ­a de masas. Las variaciones mas significativas se observaron en el suelo con predominio de grano fino y en presencia de un agente estructurante; lo cual permitiÃ³ concluir que en este tipo de suelos el proceso de biodegradaciÃ³n se lleva a cabo de manera mas efectiva que en suelos compuestos por mayores tamaÃ±os de grano y que la presencia de un agente estructurante favorece el proceso de biodegradaciÃ³n.','2008-09-17','Suelo',4,1,1,1,1,'2013-09-17 08:20:52','2013-09-17 08:20:52','Documento_2.pdf','application/pdf',2381589,'2013-09-17 08:20:52',20,0,94,'COMPLETO'),(3,'CARACTERIZACIÃ“N DE LOS BIOMARCADORES PRESENTES EN EL NÃšCLEO 26D-2X (GRUPO COGOLLO-PARTE BASAL DE LA Fm. LA LUNA), PROVENIENTE DE LA REGIÃ“N NOROCCIDENTAL DE LA CUENCA DEL LAGO DE MARACAIBO, VENEZUELA','Se estudiaron los biomarcadores y marcadores presentes en las fracciones dehidrocarburos saturados y aromÃ¡ticos, asociados al bitumen proveniente del nÃºcleo26D-2X, con la finalidad de ampliar la informaciÃ³n geoquÃ­mica asociada a las distintasformaciones del Grupo Cogollo y la parte basal de la FormaciÃ³n La Luna. Para tal fin, seanalizaron 10 muestras del nÃºcleo 26D-2X (Campo La Villa, NW Cuenca Lago deMaracaibo) que corresponden a las formaciones La Luna, Maraca, Lisure y ApÃ³n, yabarcan profundidades entre 9957 pies (3034,89 m) y 11940 pies (3639,31 m). Losmaltenos provenientes de tales muestras, fueron separados mediante cromatografÃ­a deadsorciÃ³n por columna, para obtener los hidrocarburos saturados y aromÃ¡ticos, loscuales fueron analizados utilizando CG/EM con el fin de identificar tanto losbiomarcadores como los marcadores asociados a ambas fracciones.A partir de los resultados obtenidos considerando los biomarcadores analizados(n-alcanos, Pristano, Fitano, terpanos tricÃ­clicos, esteranos regulares), se pudoestablecer aporte de materia orgÃ¡nica tanto marina como continental, con intensidadvariable en aporte de materia orgÃ¡nica continental. Tal variaciÃ³n en el tipo de materiaorgÃ¡nica sedimentada en la cuenca, condujo a la formaciÃ³n de querÃ³genos tipo II-III ytipo III. Adicionalmente, las condiciones redox desarrolladas durante la sedimentaciÃ³nde las formaciones estudiadas, fueron inferidas a partir de los marcadores (DBT/P) y delos biomarcadores (P/F, Ts/Ts+Tm, Ã­ndice hopanos) presentes en las fraccionesanalizadas. En este sentido, se pudo observar una variaciÃ³n cÃ­clica de las condiciones,dÃ¡ndose una alternancia de ambientes oxidantes y reductores, como consecuencia delas fluctuaciones en el nivel del mar, durante el perÃ­odo de sedimentaciÃ³n, que a su vezafectÃ³ el aporte de materia orgÃ¡nica en la cuenca. Por Ãºltimo, se determinÃ³ que lasmuestras analizadas se encuentran en una etapa de madurez tÃ©rmica que va detemprana a intermedia (entrando a \"ventana de petrÃ³leo\") de acuerdo a laisomerizaciÃ³n de los hopanos y esteranos y a la relaciÃ³n de terpanos triaromÃ¡ticos. Deacuerdo a estos parÃ¡metros, se desprende que las muestras correspondientes a laFormaciÃ³n La Luna, poseen una menor evoluciÃ³n tÃ©rmica que aquellas asociadas a laFormaciÃ³n ApÃ³n.Para finalizar, de acuerdo a los resultados obtenidos se concluye que elpotencial generador de hidrocarburos asociado a la FormaciÃ³n La Luna, es mayor queel correspondiente al Grupo Cogollo, debido a las caracterÃ­sticas de la materia orgÃ¡nicaacumulada en ambas formaciones, las condiciones paleoambientales desarrolladasdurante su sedimentaciÃ³n y la madurez tÃ©rmica alcanzada por ambas dentro de lasecuencia estudiada.','2008-09-16','Grupo Cogollo, FormaciÃ³n La Luna, Biomarcadores, Cuenca Lago de Maracaibo.',4,1,1,1,1,'2013-09-17 08:20:54','2013-09-17 08:20:54','Documento_3.pdf','application/pdf',3641357,'2013-09-17 08:20:54',20,0,98,'COMPLETO'),(4,'POLARIZABILIDAD E HIPERPOLARIZABILIDADES ESTÃTICAS DE ALGUNOS COMPUESTOS HETEROCÃCLICOS DE CUATROS MIEMBROS:EFECTO DE LOS SUSTITUYENTES Y DEL PLANO MOLECULAR.','En este Trabajo Especial de Grado (TEG) se realizaron cÃ¡lculos quÃ­micocuÃ¡nticos de la polarizabilidad e hiperpolarizabilidades elÃ©ctricas estÃ¡ticas de unaserie de molÃ©culas heterocÃ­clicas de cuatro miembros, con diferentes gruposdonantes y aceptores de electrones enlazados directamente al anillo. Inicialmente, seconsiderÃ³ la conformaciÃ³n plana del anillo y, posteriormente, se tomaron en cuentadiferentes conformaciones caracterizadas por tener distintos valores del Ã¡ngulorespecto al plano molecular. Esto Ãºltimo, con la finalidad de establecer el efecto delas variaciones del Ã¡ngulo del plano molecular en la polarizabilidad ehiperpolarizabilidades calculadas. Para calcular los valores promedio de <m>, <a>,<b> y <g> se emplearon mÃ©todos ab initio y semiempÃ­ricos. Los cÃ¡lculos ab initio serealizaron a nivel Hartree-Fock empleando los conjuntos base 6-31G, 6-31G(d,p) y 6-31+G(p, d), para lo cual se uso el paquete computacional GAUSSIAN 03 y GAMESS07. A nivel semiempÃ­rico, los cÃ¡lculos se realizaron con los mÃ©todos PM3 y PM6utilizando la versiÃ³n reciente MOPAC 07.Nuestros resultados HF y semiempÃ­ricos, aunque en muchos casos sondiferentes cuantivamente y cualitativamente, indican que dependen fuertemente delÃ¡ngulo f, especialmente las hiperpolarizabilidades (b) y (g). Por otra parte,encontramos que las cantidades <m>, <a>, <b> y <g> son sensibles a la naturalezaquÃ­mica de los heterociclos caracterizada por los sustituyentes X y Y, observÃ¡ndoselos mayores efectos para las hiperpolarizabilidades (b) y (g).','2008-10-31','Initio',6,1,1,1,1,'2013-09-17 08:20:55','2013-09-17 08:20:55','Documento_4.pdf','application/pdf',1391723,'2013-09-17 08:20:55',20,0,165,'COMPLETO'),(5,'DETERMINACIÃ“N DE As, Ba, Cd, Hg, La, Mo y V EN TEJIDOS BLANDOS Y CONCHAS DE MOLUSCOS BIVALVOS EN EL ESTADO NUEVA ESPARTA','El presente estudio abarca la determinaciÃ³n de As, Ba, Cd, Hg, La, Mo y V en tejidos blandos y conchasde moluscos bivalvos colectados en el estado Nueva Esparta. Los bivalvos analizados fueron Atrinaseminuda, Arca zebra, Brachiodontes modiolus, Crassostrea rhizophorae, Modiolus sp., Pinctadaimbricata, Perna perna y Perna viridis, recolectados en La Laguna de La Restinga, La Laguna de LasMarites, Isla de Coche, Isla de Cubagua, Punta de Piedras, Bella Vista y la bahÃ­a de La Galera. Lasmuestras, tanto conchas como tejidos blandos, fueron secadas a 50ÂºC, pulverizadas y sometidas atratamiento quÃ­mico mediante una extracciÃ³n secuencial con HCl 4M y luego con Agua Regia. En cadaextracto fue realizada la determinaciÃ³n de los elementos, a travÃ©s de ICP-OES para As, Ba, Cd, La, Mo yV. El Hg fue determinado por espectrometrÃ­a de absorciÃ³n atÃ³mica.La concentraciÃ³n de As, Ba, Cd, Hg, La y Mo en los tejidos blandos de bivalvos fueron: 4,7-28 g/g; 1,5-3 g/g; 0,2-38 g/g; 0,002-0,28 g/g; 1,3-8,1 g/g; 0,7- 6,3 g/g respectivamente. La concentraciÃ³n de Vestuvo por debajo del lÃ­mite de detecciÃ³n de la tÃ©cnica analÃ­tica utilizada. Las concentraciones de Ba, Mo,Hg y V en los tejidos blandos de bivalvos no presentan diferencias notables entre las especies analizadasni entre las localidades muestreadas. Los bivalvos colectados en la localidad de Coche presentaronconcentraciones de As y Cd en sus tejidos blandos significativamente mayores al resto de las localidadesestudiadas. Las concentraciones de Cd diferencian entre especies de los bivalvos analizados, siendo lasque presentan las menores concentraciones las C. rhizophorae, P. perna y P. viridis, concentracionesintermedias las A. zebra y las mayores concentraciones son encontradas en P. imbricata. La mayorconcentraciÃ³n de La fue encontrada en los mejillones P. viridis, Atrina s. y Modiolus sp. La concentraciÃ³nde Ba, Cd, La, Mo y V en las conchas de bivalvos colectados en el estado Nueva Esparta fueron: 9-15 g/g; 0,04- 0,3 g/g; 6,7-16 g/g; 0,9-2,6 g/g; 3,3-5 g/ g respectivamente. La concentraciÃ³n de As y Hgestuvieron por debajo del lÃ­mite de detecciÃ³n de la tÃ©cnica analÃ­tica utilizada. La concentraciÃ³n de As, Ba,Cd, Mo y V en las conchas de bivalvos no permite diferenciar ni entre especies ni entre localidades. Lasconchas de las diferentes especies de bivalvos analizados contienen entre el 26% y el 41% de CO2, lo queimplica que las conchas de los bivalvos estÃ¡n compuestas CaCO3 entre 59 y 93%.. El peso seco promediode los bivalvos analizados presentÃ³ el siguiente orden: Atrina seminuda (3,9 g) > Arca zebra (2,4 g) > P.perna (1,5 g) > P. viridis (1,1 g), P. imbricata (1,0 g) > C. rhizophorae (0,5 g), Modiolus sp. (0,6 g) > B.modiolus (0,2 g).','2008-09-19','S/I',4,1,1,1,1,'2013-09-17 08:20:56','2013-09-17 08:20:56','Documento_5.pdf','application/pdf',4646966,'2013-09-17 08:20:56',19,0,115,'COMPLETO'),(6,'ACTIVIDAD DE NANOCATALIZADORES DE W Y CoW SOPORTADOS SOBRE SiO2 Y y-Al2O3 MODIFICADOS EN LA REACCIÃ“N DE HDT DE HVGO.','La modificaciÃ³n del soporte es una de las principales estrategias utilizadas,para obtener catalizadores mÃ¡s activos y selectivos en la rama del HDT, es por elloque esta investigaciÃ³n se enfocÃ³ en la modificaciÃ³n de SiO2 y g-Al2O3, con g-aminopropiltrietoxisilano (GAPS) y la obtenciÃ³n de nanocatalizadores de sulfuros deCoW y W, por un mÃ©todo de preparaciÃ³n que incluyÃ³ la formaciÃ³n de un complejodel Co2+ con los grupos aminos presentes en el soporte modificado, la formaciÃ³n declorohidratos y el intercambio iÃ³nico de los iones cloruros con la especie de W6+utilizada y por Ãºltimo la sulfuraciÃ³n con H2S. Se sintetizaron dos series decatalizadores de diferente composiciÃ³n de metales para cada soporte, utilizando dossales de W el (NH4)2WS4 y el Na2WO4. La obtenciÃ³n de una superficie carbonÃ¡cea esposible utilizando este mÃ©todo de preparaciÃ³n; esta superficie carbonÃ¡cea actÃºocomo soporte de los metales, mejorando la dispersiÃ³n de los mismos y evitÃ³ a suvez la interacciÃ³n directa con el SiO2 y la g-Al2O3. La modificaciÃ³n con GAPS de lossoportes hace posible soportar hasta un 4% de carga metÃ¡lica, siendo este valormenor al valor de carga metÃ¡lica que poseen los catalizadores comercialesexistentes actualmente. La caracterizaciÃ³n de los catalizadores sintetizados serealizÃ³ mediante las tÃ©cnicas: AnÃ¡lisis Textural, IR-TF, AnÃ¡lisis TermogravimÃ©trico yReflectancia Difusa.La actividad de los catalizadores sintetizados se determinÃ³ por la reacciÃ³n deHDS en la fracciÃ³n de HVGO de un crudo pesado, los resultados obtenidos en lasactividades establecieron que: el soporte utilizado no afecta la actividad de loscatalizadores, mientras que la sal de W utilizada si afecta la actividad. Loscatalizadores sintetizados no mostraron actividad en la reacciÃ³n de HDN del HVGO.','2008-09-17','S/I',6,1,1,1,1,'2013-09-17 08:20:57','2013-09-17 08:20:57','Documento_6.pdf','application/pdf',2302992,'2013-09-17 08:20:57',19,0,1,'COMPLETO'),(7,'SÃNTESIS DE DERIVADOS DE ERGOSTEROL COMO POSIBLES DROGAS CON ACTIVIDAD ANTIPROTOZOARIOS (Trypanosoma cruzi))','El objetivo principal de esta tesis es sintetizar derivados de ergosterol comoposibles drogas con actividad antiprotozoarios, especÃ­ficamente contra Trypanosomacruzi, agente etiolÃ³gico de la enfermedad de Chagas. BasÃ¡ndose en el hecho que elergosterol forma parte de la membrana celular de estos protorozoarios, la modificaciÃ³nde ergosterol realizando su oxidaciÃ³n y utilizando reactivos de Girard nos genera unavÃ­a para introducir a estos microorganismos compuestos tipo azoles, los cuales seconsideran como un tipo de drogas de uso terapÃ©utico que han presentado actividadcontra Trypanosoma cruzi tanto in vitro como in vivo en distintos modelos de laenfermedad de Chagas.Para lograr esto se siguiÃ³ la siguiente metodologÃ­a: se realizo la oxidaciÃ³n deergosterol utilizando el reactivo de Jones, resultando como producto, ergosta-7,22-dieno-5Ã´Â€Â„Â®-ol-3,6-diona (ergosterona) con un rendimiento del 54%. Se sintetizarondiferentes reactivos del tipo Girard (GX): GI (58%), GTr (67%) y GTc (68%) y luego seobtuvieron las hidrazonas respectivas a partir de ergosterona y los distintos reactivos deGirard. TambiÃ©n se utilizÃ³ Girard-P y Girard-T, los cuales son de procedencia comercial. Las hidrazonas obtenidas a partir de ergosterona y los distintos reactivos deGirard fueron: ergosterona- GT2 (84%), ergosterona-GP (91%), ergosterona-GP2 (84%),ergosterona-GI (85%), ergosterona-GTc (83%), ergosterona-GTr (91%).','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:20:58','2013-09-17 08:20:58','Documento_7.pdf','application/pdf',1236531,'2013-09-17 08:20:58',20,0,140,'COMPLETO'),(8,'OPTIMIZACIÃ“N DE UN MÃ‰TODO DE PRECONCENTRACIÃ“N DE PLOMO CON EXTRACCIÃ“N EN FASE SÃ“LIDA (SPE) Y DETECCIÃ“N POR ESPECTROMETRÃA DE ABSORCIÃ“N ATÃ“MICA EN LLAMA (F- AAS).','El presente trabajo, evalÃºa el mÃ©todo de extracciÃ³n en fase sÃ³lida para la preconcentraciÃ³n de Pb y su detecciÃ³n por espectrometrÃ­a de absorciÃ³n atÃ³mica en llama, para ello se estudiÃ³ la capacidad de retenciÃ³n y eluciÃ³n del plomo de los sÃ³lidos sorbentes otadecilsilano (C18) y teflon (PTFE) y con la ayuda de los solventes etanol y metil isobutil cetona (MIBK).Se encuentra que con el cartucho de C18 se produce una fuerte retenciÃ³n del complejo de plomo, lo que no permite su eluciÃ³n con bajos volÃºmenes de etanol, entre 6 y 10 mLEn el caso del PTFE se logra su eluciÃ³n con volÃºmenes de MIBK entre 5 y 7 obteniendo asi un factor de preconcentraciÃ³n de 5, para una masa de sorbente de 0.6 g. El lÃ­mite de detecciÃ³n obtenido es de 19.3 mg/L y una RSD de 7 %.Estos resultados perfilan al mÃ©todo de SPE con la sensibilidad y RSD adecuada para el anÃ¡lisis de Pb en muestras biolÃ³gicas y medioambientales.','2008-11-10','S/I',6,1,1,1,1,'2013-09-17 08:20:59','2013-09-17 08:20:59','Documento_8.pdf','application/pdf',1525719,'2013-09-17 08:20:59',17,0,85,'COMPLETO'),(9,'DETERMINACIÃ“N DE MINERALES Y ÃCIDO FÃTICO POR HPLC-RI EN CEREALES INFANTILES','El Ã¡cido fÃ­tico se encuentra en las semillas de cereales, leguminosas,oleaginosas y frutos secos. Desde el punto de vista nutricional, es necesario manteneruna dieta equilibrada, variada y completa para garantizar el desarrollo saludable de laspersonas, especialmente en los niÃ±os. De esta manera, los cereales son esenciales enla alimentaciÃ³n infantil ya que proporcionan al infante proteÃ­nas, minerales, vitaminas,etc, sin embargo, el Ã¡cido fÃ­tico presente en los mismos inhibe la absorciÃ³n del hierro,calcio y zinc al formar complejos insolubles, lo que hace necesario el consumomoderado de los cereales en la alimentaciÃ³n infantil.Por otra parte, algunos investigadores han planteado que los bajos porcentajesde recuperaciÃ³n en el anÃ¡lisis de Ã¡cido fÃ­tico en cereales infantiles por la tÃ©cnica deHPLC-RI estÃ¡n atribuidos al alto contenido de metales en los mismos, a diferencia delos cereales sin procesar, sin embargo, tambiÃ©n se ha presentado bajos porcentaje derecuperaciÃ³n para esta tÃ©cnica con el uso de metodologÃ­as deficientes en el tratamientode muestras.El propÃ³sito de esta investigaciÃ³n fue determinar si los problemas en lacuantificaciÃ³n del Ã¡cido fÃ­tico en cereales infantiles por la tÃ©cnica HPLC-RI estÃ¡nasociados a las etapas de pretratamiento de muestras o a la presencia de altocontenido de metales tÃ­picos de estas muestras, para ello se realizÃ³ el estudio de Ã¡cidofÃ­tico en algunos cereales de bebe por HPLC-RI empleando la metodologÃ­a planteadapor HernÃ¡ndez. AdemÃ¡s se determinÃ³ las concentraciones de hierro, calcio y zinc de loscereales seleccionados por EAA, para realizar la correlaciÃ³n de metal-fitato conrespecto a sus efectos en el % recuperaciÃ³n del fitato.Se encontrÃ³ que los % de recuperaciÃ³n para el anÃ¡lisis de IP6 en cerealesinfantiles por el mÃ©todo propuesto son muy bajos (47- 57) %, y que estos valores nosolo estÃ¡n relacionados con un alto contenido mineral en el cereal, sino que paramuestras como el trigo partido # 1 donde el contenido de metales es bajo, tambiÃ©n seencuentra un bajo % de recuperaciÃ³n (70%). La diferencia de este ultimo trigo con elestudiado por HernÃ¡ndez, el cual obtuvo % de recuperaciÃ³n entre 90-92%, fue sumenor contenido de IP6 y su tamaÃ±o de grano partido mucho mÃ¡s pequeÃ±o, lo querequiere el uso de un paso adicional de filtraciÃ³n tanto en esta muestra como en la delos cereales infantiles.Estos resultados demuestran que el mÃ©todo HPLC-RI no puede ser utilizado parael anÃ¡lisis de Ã¡cido fÃ­tico en cereales infantiles, aÃºn cuando algunos autores lo siguenusando libremente.','2008-10-31','S/I',6,1,1,1,1,'2013-09-17 08:21:01','2013-09-17 08:21:01','Documento_9.pdf','application/pdf',2933932,'2013-09-17 08:21:01',20,0,124,'COMPLETO'),(10,'IMPLICACIONES DEL GRADO DE CONTAMINACIÃ“N POR CRUDO EN LA MINERALIZACIÃ“N POTENCIAL DE NITRÃ“GENO EN SUELOS DE DIFERENTES TEXTURAS, COLECTADOS EN EL SUR DEL ESTADO ANZOÃTEGUI','Los HC y sus derivados son sustancias de alto peso molecular, mayormente insolubles en agua, que resultan muy tÃ³xicas para los organismos vivos. La mayorÃ­a de los microorganismos del suelo no pueden crecer en presencia de hidrocarburos y mueren. Entre estos microorganismos afectados estÃ¡n varios de importancia ecolÃ³gica, como las bacterias fijadoras de N (AchÃ¡ y FontÃºrbel, 2000). La magnitud de afectaciÃ³n por petrÃ³leo en la actividad biolÃ³gica del suelo, va a depender de la concentraciÃ³n del contaminante y de las caracterÃ­sticas fÃ­sico-quÃ­micas del suelo, por tanto al estudiar el impacto de este contaminante en la actividad biolÃ³gica del suelo, se debe evaluar la textura.Dentro del marco del proyecto Orinoco-Magna Reserva, la industria petrolera tiene planificado realizar actividades de explotaciÃ³n al sur del estado AnzoÃ¡tegui. En esa zona se encuentran ecosistemas de altÃ­sima fragilidad como morichales y bosques ribereÃ±os, los cuales se encuentran ocupando suelos de textura variada (ChacÃ³n et al., 2007). Tomando en cuenta este aspecto el objetivo principal de este estudio fue evaluar los cambios en la mineralizaciÃ³n de N cuando suelos de diferentes texturas estÃ¡n siendo impactados con concentraciones basales de crudo. La informaciÃ³n aquÃ­ obtenida se espera que contribuya a diseÃ±ar estrategias de recuperaciÃ³n de Ã¡reas degradadas por actividades de la industria petrolera.En este trabajo se determinÃ³ que independientemente del tipo de textura de suelo la adiciÃ³n de niveles basales de crudo condujo a un decrecimiento en la mineralizaciÃ³n neta de N en el suelo, pero no en el No. En el suelo arcilloso la k tambiÃ©n decreciÃ³ a consecuencia de la adiciÃ³n de crudo. En la zona de estudio los morichales se encuentran sobre suelos de textura arcillosa, por lo que el ciclaje de N en el suelo en este tipo de ecosistema se verÃ­a altamente afectado ante una posible contingencia de un derrame de crudo; por otro lado se obtuvo que el Nm disminuyÃ³ al aumentar la proporciÃ³n de crudo empleado, y se determinaron altas y positivas correlaciones en parÃ¡metros determinados como Nm y %CT.','2008-09-18','mineralizaciÃ³n, nitrÃ³geno, crudo, suelo, textura.',4,1,1,1,1,'2013-09-17 08:21:03','2013-09-17 08:21:03','Documento_10.pdf','application/pdf',829747,'2013-09-17 08:21:03',18,0,63,'COMPLETO'),(11,'ESPECTROSCOPÃA DE RESONANCIA MAGNÃ‰TICA NUCLEAR PARA ESTUDIAR EL USO DE EMULSIONES ASFÃLTICAS COMO ENMIENDAS MEJORADAS DE SUELOS ÃCIDOS DE SABANA.','La baja presencia de materia orgÃ¡nica y el alto contenido de elementosparamagnÃ©ticos en suelos Ã¡cidos de sabana, dificultan su estudio por RMN yprovoca que sean sistemas de baja fertilidad. Con el objeto de identificar lanaturaleza de los componentes de la materia orgÃ¡nica de estos suelos, asÃ­ comotambiÃ©n reconocer la naturaleza de las emulsiones asfÃ¡lticas e interpretar el efectode estas emulsiones en el suelo, se realizaron estudios de RMN de 1H y 13C en lasemulsiones, en el suelo sin tratamiento (S) y en suelos tratados con diferentes dosisde emulsiÃ³n catiÃ³nica (SEC) y aniÃ³nica (SEA). A la muestra SEA tambiÃ©n se le tomÃ³un espectro de 31P. Para lograr la obtenciÃ³n de dichos espectros fue necesariorealizar la extracciÃ³n de la materia orgÃ¡nica del suelo y la eliminaciÃ³n de loselementos paramagnÃ©ticos como el Fe, a travÃ©s de una modificaciÃ³n delprocedimiento utilizado por BriceÃ±o et al en el 2006. Este nuevo procedimientopermitiÃ³ obtener espectros de RMN 1H y 13C de alta resoluciÃ³n y, por primera vez, unespectro RMN de 31P.El anÃ¡lisis de los espectros de RMN para las emulsionesmuestra presencia de CH3 terminales, cadenas largas de CH2 y carbonosaromÃ¡ticos. Una nueva seÃ±al en 3,63 ppm correspondiente a protones se asignÃ³ auna estructura de tipo CH3 - N- y es lo que diferencia la emulsiÃ³n catiÃ³nica de laaniÃ³nica. Los protones integrables del espectro se usaron para determinar larelaciÃ³n H-Ar/H-Ali = 0,07, la cual indica mayor contenido de protones alifÃ¡ticos quede protones en anillos aromÃ¡ticos, lo que puede estar indicando la presencia decarbonos aromÃ¡ticos sustituidos o estructuras de anillos policÃ­clicos.El anÃ¡lisis de los espectros de RMN de la materia orgÃ¡nica del suelo permiteproponer un fuerte carÃ¡cter aromÃ¡tico y una mezcla de estructuras complejas.LosanÃ¡lisis realizados para los tratamientos de suelo y su posterior interpretaciÃ³npermiten observar una mayor interacciÃ³n entre el suelo y la emulsiÃ³n catiÃ³nica(SEC), que contribuye a un aumento en las formas orgÃ¡nicas del suelo, mientraspara el caso del suelo con emulsiÃ³n aniÃ³nica (SEA) no se observa una interacciÃ³ndirecta sino un posible aumento en el tamaÃ±o de los agregados del suelo.','2008-10-28','s/i',6,1,1,1,1,'2013-09-17 08:21:04','2013-09-17 08:21:04','Documento_11.pdf','application/pdf',13782367,'2013-09-17 08:21:04',20,0,141,'COMPLETO'),(12,'MODIFICACIÃ“N ESTRUCTURAL DE HESPERIDINA Y NARINGINA (FLAVONOIDES) Y ESTUDIO DE SU ACTIVIDAD BIOLÃ“GICA SOBRE LA ENZIMA GLUCOSA-6-FOSFATASA','Se realizÃ³ la transformaciÃ³n estructural de dos flavanonas (hesperidina y naringina) para la obtenciÃ³n de otros tipos de flavonoides.Mediante la hidrÃ³lisis Ã¡cida de la hesperidina se obtuvo el hesperetin-7-glucosa; al tratar ambas flavanonas en medio bÃ¡sico se lograron obtener las respectivas chalconas; a partir de dichas chalconas, usando NBS y siguiendo un tratamiento posterior se lograron obtener las flavonas tanto de la naringina como de la hesperidina. Otras reacciones que se intentaron pero no se logrÃ³ el producto deseado fueron la hidrogenaciÃ³n catalÃ­tica de la chalcona y la oxidaciÃ³n con perÃ³xido de hidrÃ³geno de las flavanonas.A todos los compuestos obtenidos se determinÃ³ su actividad biolÃ³gica sobre la enzima glucosa-6-fosfatasa. Los resultados indican que estos flavonoides inhiben la enzima y que actÃºan de manera mÃ¡s efectiva sobre el transportador T1 que sobre la subunidad catalÃ­tica.','2008-10-29','S/I',6,1,1,1,1,'2013-09-17 08:21:06','2013-09-17 08:21:06','Documento_12.pdf','application/pdf',840840,'2013-09-17 08:21:06',17,0,72,'COMPLETO'),(13,'ESTUDIO DE LA REACTIVIDAD EN HIDRODESCLORINACIÃ“N CATALÃTICA DE BIFENILOS POLICLORADOS (Aroclor 1260) EMPLEANDO FASES MIXTAS DE CARBUROS Y NITRUROS DE M- Mo (M=Co, Ni).','La hidrodesclorinaciÃ³n catalÃ­tica (HDCl) es un proceso econÃ³mico, eficiente yambientalmente seguro, para la eliminaciÃ³n de compuestos organoclorados, entreellos los bifenilos policlorados (BPCs); los cuales son compuestos altamente tÃ³xicosy persistentes en el medio ambiente. En el presente trabajo de grado, realizoSÃ­ntesis, caracterizaciÃ³n y estudio de la reactividad de catalizadores mÃ¡sicos de Co-Mo y Ni-Mo es sus fases: carburada y nitrada, empleados en la reacciÃ³n dehidrodesclorinaciÃ³n de bifenilos policlorados (Aroclor 1260).Esta reaccion fue estudiada en un reactor de flujo continuo a presiÃ³natmosfÃ©rica y a una temperatura de 200 ÂºC, donde se tratÃ³ una soluciÃ³n de 500ppmen cloro. Los catalizadores mÃ¡sicos de nÃ­quel-molibdeno y cobalto- molibdeno, ensus estados carburado y nitrurado, fueron sintetizados por el mÃ©todo de reducciÃ³n atemperatura programada con relaciones metÃ¡licas de: 0.25, 0.33, 0.50 y 0.75 (Ã¡tomoNi/Ã¡tomos totales). Todos estos catalizadores fueron presulfurados empleando CS2 yseguidamente, se realizÃ³ la reacciÃ³n de hidrodesclorinaciÃ³n de BPCs, en flujo deHidrogeno.Los resultados indican que los nitruros son mÃ¡s activos que los carburos y losÃ³xidos correspondientes, los carburos de metales de transiciÃ³n, asÃ­ como los nitrurospresentan diferencias superficiales entre ellos. Mientras el carbono se difunde a altastemperaturas para formar el carburo, el nitrÃ³geno puede permanecer en la superficie[39]. Este nitrÃ³geno superficial podrÃ­a ser responsable de la disminuciÃ³n aun masimportante de Ã¡rea de los nitruros bimetÃ¡licos estudiados. Los sÃ³lidos fueroncomparados con un catalizador comercial (AERO HDS-3A) dando como resultadoque los nitruros son mas activos que el catalizador comercial.','2008-10-29','s/i',6,1,1,1,1,'2013-09-17 08:21:08','2013-09-17 08:21:08','Documento_13.pdf','application/pdf',5732003,'2013-09-17 08:21:08',18,0,67,'COMPLETO'),(14,'CARACTERÃSTICAS GEOLÃ“GICAS Y GEOQUÃMICAS DE LAS DOLOMÃAS PRESENTES EN LOS NÃšCLEOS MPN- 1X Y OBl- 3X DEL MIEMBRO O DE LA FORMACIÃ“N ESCANDALOSA, CUENCA BARINAS - APURE, VENEZUELA.','En este trabajo, se llevÃ³ a cabo el estudio mineralÃ³gico y geoquÃ­mico de lasdolomÃ­as presentes en los nÃºcleos MPN - 1X y OBI - 3X, pertenecientes alMiembro O de la FormaciÃ³n Escandalosa, en la Cuenca de Barinas - Apure, conel fin de determinar el posible ambiente de dolomitizaciÃ³n de los minerales deCaCO3 y los posibles cambios de facies, laterales y verticales, entre los dosnÃºcleos. Se escogiÃ³ doce muestras por cada nÃºcleo. Se eligiÃ³ seis muestras decada nÃºcleo para su anÃ¡lisis mineralÃ³gico por DifracciÃ³n de Rayos - X; se verificÃ³la presencia de los minerales dolomita y cuarzo en todas las muestras y el mineralcalcita en zonas intermedias de ambos nÃºcleos. El anÃ¡lisis geoquÃ­mico consistiÃ³en determinar la concentraciÃ³n de los elementos mayoritarios, Ca y Mg y losminoritarios y traza, Ba, Fe, K, Mn, Na, Sr y Zn, mediante la tÃ©cnica deEspectrometrÃ­a de EmisiÃ³n Ã“ptica Inductivamente Acoplado a Plasma (ICP),aplicada a la totalidad de las muestras. Los resultados quÃ­micos proporcionaroninformaciÃ³n en cuanto al grado de dolomitizaciÃ³n sufrido por los minerales deCaCO3 y revelaron la influencia de fluidos ricos en Fe y Mn que actuaron ensoterramiento, en una etapa de diagÃ©nesis tardÃ­a, posiblemente produciendo lasalida de los elementos Ba, K, Na, Sr y Zn. De acuerdo a la estequiometrÃ­a de lasdolomitas promedio de cada nÃºcleo, se dedujo que el proceso de dolomitizaciÃ³nfue mÃ¡s avanzado en la zona correspondiente al nÃºcleo OBI - 3X que en la zonadel nÃºcleo MPN - 1X, debido posiblemente a un rÃ©gimen menos Ã¡rido en esteÃºltimo, evidenciado por un alto contenido de clÃ¡sticos terrÃ­genos presentes en estazona.','2008-09-17','s/i',4,1,1,1,1,'2013-09-17 08:21:10','2013-09-17 08:21:10','Documento_14.pdf','application/pdf',5400780,'2013-09-17 08:21:10',18,0,99,'COMPLETO'),(15,'EFECTO DE DIFERENTES TIPOS DE EMULSIONES ASFÃLTICAS (aniÃ³nica y catiÃ³nica) DE ROMPIMIENTO LENTO SOBRE LA ADSORCIÃ“N DE FÃ“SFORO EN CAOLINITA','Con anterioridad se han realizado investigaciones con el objetivo de encontraralternativas de manejo agroecolÃ³gico viables desde la perspectiva ecolÃ³gica yeconÃ³mica, mediante el incremento de la fracciÃ³n de fÃ³sforo biodisponible, lo cual es deespecial prioridad en los suelos altamente meteorizados de las regiones tropicales,particularmente en las sabanas de Los Llanos de Venezuela. En el presente trabajo seevaluaron los efectos de diferentes tipos de emulsiones asfÃ¡lticas (aniÃ³nica y catiÃ³nica)sobre la adsorciÃ³n de fÃ³sforo en un mineral de carga permanente, la caolinita, siendo unmineral secundario ampliamente extendido en los suelos de sabanas. Durante laexperimentaciÃ³n, se evaluÃ³ la competencia iÃ³nica que se establece entre el iÃ³n fosfato ylas emulsiones asfÃ¡lticas, para lo cual se establecieron cuatro variantes experimentales.La primera, corresponde a la introducciÃ³n del iÃ³n fosfato al sistema despuÃ©s de laadsorciÃ³n de la emulsiÃ³n por la caolinita (IE- P), la segunda, la introducciÃ³n del fosfatoantes de la adsorciÃ³n de la emulsiÃ³n (IP-E), la tercera, la introducciÃ³n de fosfato alsistema luego de haber agregado la emulsiÃ³n y dejarla interactuando con el mineraldurante un periodo de incubaciÃ³n de 10 dÃ­as (IEIn-P) y la Ãºltima, la introducciÃ³nsimultanea del fosfato y la emulsiÃ³n (IPE). Adicionalmente, fue determinado el pH encada caso luego de alcanzarse el equilibrio de adsorciÃ³n. Los resultados fueroninterpretados empleando isotermas de adsorciÃ³n, siendo comparadas con una\"isoterma control\" en la que fue representada la cantidad de fÃ³sforo adsorbido por lacaolinita en ausencia de emulsiÃ³n asfÃ¡ltica, observÃ¡ndose una disminuciÃ³n apreciablede la adsorciÃ³n de P bajo las diferentes condiciones de trabajo con excepciÃ³n de lacorrespondiente (IP-E), lo cual pudo ser validado aplicando los modelos teÃ³ricomatemÃ¡ticosde Langmuir y Freundlich. Las determinaciones de pH hechas a lassoluciones permitieron plantear los posibles mecanismos de intercambio iÃ³nicoinvolucrados en estas reacciones.','2008-10-09','S/I',6,1,1,1,1,'2013-09-17 08:21:11','2013-09-17 08:21:11','Documento_15.pdf','application/pdf',4828699,'2013-09-17 08:21:11',19,0,155,'COMPLETO'),(16,'SÃNTESIS YCARACTERIZACIÃ“N DEL 2,3,4,5-TETRAMETOXITOLUENO COMO PRECURSOR EN LA SÃNTESIS DE LA COENZIMA Q10','En el siguiente Trabajo Especial de Grado se presenta una nueva metodologÃ­a sintÃ©tica que permitiÃ³ obtener el 2,3,4,5-tetrametoxitolueno. Este compuesto es una molÃ©cula muy sencilla y a la vez muy importante, ya que es el precursor en la sÃ­ntesis total de la Coenzima Q10, compuesto que actualmente posee un gran nÃºmero de aplicaciones clÃ­nicas, como por ejemplo, su utilizaciÃ³n como suplemento alimenticio y su recomendaciÃ³n para el tratamiento de personas con enfermedades cardÃ­acas. Por estas razones se convierte en una de las sustancias mÃ¡s comercializadas a nivel mundial.La sÃ­ntesis del 2,3,4,5-tetrametoxitolueno consta de cuatro pasos sintÃ©ticos. Se utilizÃ³ como materia prima el 2,3,4- trimetoxibenzaldehÃ­do, el cual estÃ¡ disponible comercialmente. A travÃ©s de una reacciÃ³n de Dakin, una formilaciÃ³n, hidrogenaciÃ³n catalÃ­tica y por Ãºltimo una metilaciÃ³n se logrÃ³ obtener el compuesto deseado con un rendimiento moderado.','2008-10-22','s/i',6,1,1,1,1,'2013-09-17 08:21:12','2013-09-17 08:21:12','Documento_16.pdf','application/pdf',352521,'2013-09-17 08:21:12',18,0,56,'COMPLETO'),(17,'CARACTERÃSTICAS GEOLÃ“GICAS Y GEOQUÃMICAS DE DOLOMITAS, DOLOMIAS Y OTRAS FACIES CALCÃREAS DEL CRETACICO Y HOLOCENO EN VENEZUELA','En este trabajo de investigaciÃ³n se realizÃ³ el estudio de diversas facies de sedimentoscalcÃ¡reos recientes del archipiÃ©lago Los Roques con el propÃ³sito de determinar la posibleformaciÃ³n de una facies denominada protodolomita o facies de sedimento calcÃ¡reoenriquecido en magnesio por procesos diagenÃ©ticos superficiales en ambientes de sabkha ylagunas hipersalinas localizados al nor- este del archipiÃ©lago. Igualmente, se determinÃ³ elorigen y ambiente sedimentario de unas facies de dolomÃ­as del Grupo Cogollo pertenecientesa los miembros Machiques y PichÃ© de la FormaciÃ³n ApÃ³n y se realizÃ³ una comparaciÃ³n entrelas facies estudiadas pertenecientes al Holoceno y al CretÃ¡cico con el propÃ³sito de determinarlas diferencias en la composiciÃ³n quÃ­mica entre facies calcÃ¡reas de distintas edades y susposibles modelos de origen y sedimentaciÃ³n.Para el cumplimiento de los objetivos planteados se estudiaron muestras de sedimentos delarchipiÃ©lago Los Roques, pertenecientes a ambientes hipersalinos supramareales, sabkhas,lÃ­neas de playa y planos arrecifales, asÃ­ como muestras de facies de dolomÃ­as de los nÃºcleosALPUF 6 y VLA 711 ubicados en la cuenca de Maracaibo. Se realizÃ³, tanto para las muestrasde sedimento como de nÃºcleo, la determinaciÃ³n de la composiciÃ³n mineralÃ³gica por medio dedifracciÃ³n de rayos X, y la determinaciÃ³n de la concentraciÃ³n de los elementos Ca, Mg, Sr,Ba, Na, K, Fe, Mn y Zn por medio de espectrometrÃ­a de emisiÃ³n atÃ³mica inductivamenteacoplado a plasma (ICP).El anÃ¡lisis de los resultados obtenidos permite afirmar que en los ambientes de lagunashipersalinas y sabkha del archipiÃ©lago Los Roques, actualmente hay formaciÃ³n por procesosdiagenÃ©ticos de una facies enriquecida en magnesio a partir de una mineralogÃ­a inicial dearagonito y calcita magnesiana, originando un estado previo a la dolomita que se hadenominado protodolomita. Este enriquecimiento estÃ¡ relacionado con una alta evaporaciÃ³nen los fluidos y la formaciÃ³n temprana de minerales de evaporitas, permitiendo el aumento dela relaciÃ³n Mg/Ca. Para las dolomÃ­as del Grupo Cogollo, mediante la comparaciÃ³n entre lasconcentraciones de los elementos determinados en las muestras obtenidas de los nÃºcleos, asÃ­como su posiciÃ³n estratigrÃ¡fica a lo largo de la cuenca, se concluye que son facies formadasen ambientes superficiales de lagunas hipersalinas y sabkhas locales a partir de sedimentoscalcÃ¡reos no litificados, con procesos muy similares a los analizados en los sedimentos de LosRoques. Posteriormente por procesos diagenÃ©ticos durante el soterramiento, han continuadoexperimentando cambios que han modificado parcialmente la concentraciÃ³n tanto de loselementos mayoritarios, minoritarios y traza.','2008-09-17','Sin informacion',4,1,1,1,1,'2013-09-17 08:21:13','2013-09-17 08:21:13','Documento_17.pdf','application/pdf',3969901,'2013-09-17 08:21:13',20,0,155,'COMPLETO'),(18,'SÃNTESIS Y CARACTERIZACIÃ“N DE DIFOSFINAS QUIRALES ANÃLOGAS AL DIOP, CON Si, Ge Y Sn','La sÃ­ntesis de difosfinas quirales ha experimentado un gran auge en los Ãºltimos aÃ±os debido a las diversas aplicaciones que se han encontrado, entre las cuales se puede mencionar la hidrogenaciÃ³n catalÃ­tica de olefinas proquirales, que ha permitido la elaboraciÃ³n de fÃ¡rmacos, agroquÃ­micos, saborizantes y fragancias enantiomÃ©ricamente puras, entre otras no menos importantes.En este trabajo se realizÃ³ la sÃ­ntesis de difosfinas quirales anÃ¡logas al DIOP, a partir de la hidrÃ³lisis del anillo 1,3 - dioxolano del (DIOP) para obtener el (-) - 2,3- dihidroxi- 1,4-bis(difenilfosfino) butano. Este compuesto se hizo reaccionar posteriormente con dimetildiclorosilano, dimetildiclorogermano y dimetildicloroestaÃ±o para obtener los compuestos:(a)(-) -1,3 - O - dimetilsilil - 1,4-bis(difenilfosfino)butano(b)(-) -1,3 - O - dimetigermil- 1,4-bis (difenilfosfino)butano(c)(-) -1,3 - O - dimetilestannil - 1,4 -bis (difenilfosfino)butanoDe las sÃ­ntesis realizadas, sÃ³lo se obtuvieron con Ã©xito las difosfinas quirales anÃ¡logas del DIOP con Si y Sn, estos compuestos se caracterizaron empleando las tÃ©cnicas espectroscÃ³picas de RMN de 1H, 13C, y 31P; IRTF y masas.','2008-10-31','S/I',6,1,1,1,1,'2013-09-17 08:21:14','2013-09-17 08:21:14','Documento_18.pdf','application/pdf',2245407,'2013-09-17 08:21:14',19,0,149,'COMPLETO'),(19,'DETERMINACIÃ“N DE Mn, Fe, Cr, Ni, Co, V y Pt EN SEDIMENTOS DE LA CUENCA DEL RÃO CUIRA.','En la cuenca del rÃ­o Cuira fueron recolectadas 26 muestras de sedimentos en dos salidas de campo, dichas muestras fueron tamizadas a travÃ©s de 10, 18, 35 y 60 mallas en campo y a travÃ©s de 120, 230 y 325 mallas en el laboratorio. De las fracciones tamizadas en campo, fueron tomadas muestras a las cuales les fue medida la humedad para recalcular el peso seco de las fracciones en cada punto. Los datos obtenidos permitieron determinar la distribuciÃ³n granulomÃ©trica, obteniÃ©ndose que la zona de estudio estÃ¡ dominada por las arenas muy gruesas y gruesas. La fracciÃ³n mayor a diez mallas no fue considerada para este proyecto. A las siete fracciones granulomÃ©tricas de nueve de los puntos les fue determinada la concentraciÃ³n de Co, Cr, Mn, Ni, Mg y V y Pt con la finalidad de identificar la fracciÃ³n mÃ¡s adecuada para el estudio de esos elementos en la zona. Los resultados indican que para el Ã¡rea no existe una fracciÃ³n de tamaÃ±o de grano en la cual los elementos estÃ©n siendo concentrados significativamente. Los 26 puntos de muestreo fueron analizados empleando la fracciÃ³n < 325 mallas con el objeto de establecer la relaciÃ³n espacial de Mn, Fe, Cr, Ni, Co, y V los resultados obtenidos muestran que las mayores concentraciones de Fe, Cr, Ni, Co, y V estÃ¡n relacionadas con sedimentos provenientes del Complejo UltramÃ¡fico de Apa, mientras que el Mn no presenta diferencias significativas de concentraciÃ³n en la zona. No obstante el, Cr es, del grupo de los elementos estudiados, el que permite hacer mejor diferenciaciÃ³n entre el Complejo de UltramÃ¡fico de Apa y el resto de las litologÃ­as presentes. El elemento Pt estÃ¡ por debajo del lÃ­mite de detecciÃ³n del mÃ©todo empleado, su concentraciÃ³n en las muestras analizadas es menor a 20 ng/g.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:21:15','2013-09-17 08:21:15','Documento_19.pdf','application/pdf',3567536,'2013-09-17 08:21:15',18,0,76,'COMPLETO'),(20,'COMPLEJOS DE VANADIO (V). SISTEMA VO2+- ACETILACETONA(KCl 3.0 M, 25Â°C)','Los bifenilos policlorados (BPCs) son compuestos quÃ­micos altamente tÃ³xicos queposeen la capacidad de bioacumularse, ser inertes quÃ­micamente, ser persitentes,pirorresistentes y mutagÃ©nicos. Debido a sus mÃºltiples aplicaciones, los BPCs seencuentran altamente dispersos en el ambiente, por lo que el desecho de losmismos representa un grave problema ambiental. Entre los diversos mÃ©todosaplicados para la eliminaciÃ³n definitiva de los bifenilos policlorados, se encuentra laHidrodesclorinaciÃ³n CatalÃ­tica, la cual emplea catalizadores y corrientes dehidrÃ³geno para lograr la desclorinaciÃ³n sucesiva de los compuestos organocloradosy degradarlos en compuestos menos tÃ³xicos, ademÃ¡s de tener la ventaja de nogenerar residuos tÃ³xicos. El mecanismo a travÃ©s del cual se produce lahidrodesclorinaciÃ³n, aÃºn no estÃ¡ bien definido, por lo que el interÃ©s de este trabajoestuvo enfocado hacia el estudio de dicho mecanismo.Para el estudio se empleÃ³ catalizadores de Ni, Mo y NiMo soportados sobre g-alÃºmina los cuales fueron caracterizados por XPS, DRX y se les realizÃ³ anÃ¡lisis deÃ¡rea especÃ­fica por el mÃ©todo BET. Se utilizÃ³ el clorobenceno por su estructurasencilla y con los resultados obtenidos de su hidrodesclorinaciÃ³n, se tratÃ³ depredecir el comportamiento del decaclorobifenilo en la reacciÃ³n. Se obtuvo comoproductos de la reacciÃ³n del clorobenceno; el benceno y bifenilo; mientras que parael caso de la reacciÃ³n del decaclorobifenilo se obtuvieron el ciclohexilbenceno,bifenilo, isÃ³meros de terfenilos e isÃ³meros de cuaterfenilos. La formaciÃ³n delbenceno pudo haberse dado por un mecanismo iÃ³nico donde el iÃ³n hidruro ( - H )ataca a la molÃ©cula de clorobenceno adsorbida, generando un aniÃ³n fenÃ­lico queacepta luego un protÃ³n; o a travÃ©s de un mecanismo vÃ­a radicales libres, donde segeneran radicales fenilos que bien pueden interactuar con radicales de hidrÃ³genoadsorbidos en la superficie del catalizador y formar el benceno o reagruparse entreellos y formar el bifenilo, los isÃ³meros de terfenilo y de cuaterfenilo. Se propuso Ã©steultimo mecanismo como el mecanismo factible para la formaciÃ³n de las especiespoliaromÃ¡ticas que se obtuvieron como resultado.','2008-06-06','S/I',6,1,1,1,1,'2013-09-17 08:21:18','2013-09-17 08:21:18','Documento_20.pdf','application/pdf',1365218,'2013-09-17 08:21:18',20,0,112,'COMPLETO'),(21,'GEOLOGÃA Y GEOQUÃMICA DE LAS DOLOMÃAS DEL MIEMBRO O DE LA FORMACIÃ“N ESCANDALOSA DE LA CUENCA DE BARINAS, VENEZUELA. NÃšCLEO DEL POZO BOR 12X','En el siguiente trabajo de investigaciÃ³n se llevÃ³ a cabo un estudio sobre la geologÃ­a y geoquÃ­mica de las dolomÃ­as del Miembro O de la FormaciÃ³n Escandalosa. Estas dolomÃ­as son provenientes de un nÃºcleo extraÃ­do por el pozo BOR 12X de la cuenca de Barinas, Venezuela. A travÃ©s de este estudio, se determino el origen de formaciÃ³n de estas rocas, ya sea en superficie o soterramiento. Para cumplir con los objetivos planteados se seleccionaron 21 muestras de dolomÃ­as. A estas muestras se le realizÃ³ la descripciÃ³n macroscÃ³pica de algunas secciones del nÃºcleo, anÃ¡lisis de DifracciÃ³n de Rayos X para la muestra total y residuos, y por Ãºltimo, el anÃ¡lisis quÃ­mico para determinar la concentraciÃ³n de los elementos Ca, Mg, Fe, Mn, K, Na, Ba, Sr y Zn. Para el anÃ¡lisis quÃ­mico previamente se efectuÃ³ el tratamiento con Ã¡cido clorhÃ­drico para obtener la fase carbonÃ¡tica en soluciÃ³n y el residuo insoluble (fase siliciclÃ¡stica); a esta Ãºltima fase no se le llevÃ³ a cabo ninguna determinaciÃ³n elemental, sÃ³lo se analizÃ³ la mineralogÃ­a presente.Las dolomÃ­as del Miembro O son del tipo magnesianas, con un valor promedio en sus relaciones estequiomÃ©tricas Ca 0.98 Mg 1.02 (CO3)2. Las concentraciones de Fe y Mn indican un aumento durante los eventos en la diagÃ©nesis tardÃ­a, donde ocurren procesos de purificaciÃ³n y recristalizaciÃ³n de las dolomÃ­as. Las concentraciones de K, Na, Ba y Sr indican que posiblemente las dolomÃ­as se formaron durante la diagÃ©nesis temprana y que luego de los eventos durante el soterramiento profundo, ocurriÃ³ una disminuciÃ³n en las concentraciones originales de estos elementos, sin embargo, aÃºn se conservan las relaciones que tuvieron originalmente cuando se formaron, durante la diagÃ©nesis temprana.Para la formaciÃ³n de las dolomÃ­as del Miembro O, existen 6 modelos generales de dolomitizaciÃ³n que pudieron haber interactuado durante la diagÃ©nesis temprana y la diagÃ©nesis tardÃ­a. Estos modelos son: 1. Lagunas hipersalinas o sabkha, 2. Modelo de flujo y reflujo de aguas enriquecidas en magnesio, 3. DolomitizaciÃ³n por capilaridad, 4. DolomitizaciÃ³n por la reacciÃ³n entre las aguas intersticiales y las calizas a elevadas temperaturas y presiones, 5. DolomitizaciÃ³n en profundidad por compactaciÃ³n de arcillas y expulsiÃ³n de fluidos ricos en magnesio, 6. DolomitizaciÃ³n por bacterias sulfato reductoras. Estos modelos fueron propuestos en base a los resultados obtenidos.','2008-09-17','s/i',4,1,1,1,1,'2013-09-17 08:21:19','2013-09-17 08:21:19','Documento_21.pdf','application/pdf',3872249,'2013-09-17 08:21:19',19,0,98,'COMPLETO'),(22,'AISLAMIENTO DE LOS METABOLITOS SECUNDARIOS PRESENTES EN LA Bauhinia variegata L..BIODIRIGIDO POR ENSAYOS DE INHIBICIÃ“N SOBRE LA ENZIMA GLUCOSA-6-FOSFATASA\".','En actualidad continÃºan siendo numerosos los aportes de compuestosaislados de fuentes naturales para ensayar su actividad sobre enzimas quecontrolen alguna funciÃ³n en el organismo, por ejemplo la regulaciÃ³n de la liberaciÃ³nde glucosa es importante en el control de la diabetes.En este trabajo se realizÃ³ un estudio fitoquimÃ­co y biolÃ³gico que permitieraseparar fracciones y/o compuestos de la especie Bauhinia variegata L, paraposteriormente ensayar su actividad en la inhibiciÃ³n de la enzima glucosa-6-fosfatasa, que es la enzima catalizadora del paso final en los mecanismos deglucogenolisis y gluconeogenesis, que se conocen son los responsables de laliberaciÃ³n de glucosa al torrente sanguÃ­neo, en perÃ­odos de ayuna.Para ello se realizÃ³ el tratamiento del material vegetal de la Bauhinia variegataL. directamente con metanol, y luego Ã©ste extracto resultante se sometiÃ³ a particiÃ³ncon una mezcla metanol-agua 1:1, seguidamente de particiÃ³n con acetona, tantopara la fracciÃ³n soluble e insoluble correspondientes a la mezcla de solventes. Deesta doble particiÃ³n se obtienen cuatro fracciones, A-D (A: i metanol-agua i acetona,B: i metanol-agua s acetona, C: s metanol-agua i acetona, D: s metanol-agua sacetona) a las que se les evaluÃ³ la actividad inhibitoria sobre la enzima Glucosa-6-fosfatasa. La fracciÃ³n que presentÃ³ mayor actividad inhibitoria sobre el transportadorT1 fue la D (79,4 %), por esta razÃ³n fue seleccionada para la separaciÃ³n con losmÃ©todos cromatogrÃ¡ficos disponibles (cromatografÃ­a en contracorriente, seguida porTLC, y cromatografÃ­a en columna). A las fracciones obtenidas de la separaciÃ³n porcromatografÃ­a en mayor cantidad se les realizÃ³ el anÃ¡lisis quÃ­mico de suscomponentes con las tÃ©cnicas espectroscÃ³picas de RMN 1H, y RMN 13C, con esto sepudo definir la estructura de dos compuestos puros aislados no reportados hasta lafecha en la planta: un flavonoide 1, isoquercetina y una ionona 2, ([(+)-(6S,9R)-9-O- -D-glucosido-6-hidroxi-3-oxo- - ionol].Adicionalmente, se obtuvieron diversas fracciones cuya composiciÃ³n no selogro definir en su totalidad por la poca separaciÃ³n de sus componentes que sealcanzÃ³, sin embargo se logrÃ³ detectar la presencia de un compuesto que pudieraser una estructura tipo flavonoidal, y no se logrÃ³ la elucidaciÃ³n de la estructura de elporque pertenecÃ­a a una mezcla y por la poca cantidad que se obtuvo para realizarotros experimentos adicionales, que permitieran su caracterizaciÃ³n.Es interesante resaltar el hecho de que la mayorÃ­a de los compuestosreportados en el genero Bauhinia con actividad hipoglicemiante, correspondan aestructuras de tipo flavonoidal, y en este trabajo se logrÃ³ aislar de la BauhiniaVariegata una ionona 2 que presentÃ³ mayor actividad inhibitoria sobre la enzima G-6-Pasa, que el otro compuesto aislado de estructura flavonoidal 1.','2008-10-22','s/i',6,1,1,1,1,'2013-09-17 08:21:21','2013-09-17 08:21:21','Documento_22.pdf','application/pdf',6477272,'2013-09-17 08:21:21',18,0,100,'COMPLETO'),(23,'FRACCIONAMIENTO DE FÃ“SFORO EN UN SUELO ÃCIDO DE SABANA INCUBADO CON EMULSIÃ“N ASFÃLTICA','el este del paÃ­s, poseen caracterÃ­sticas muy particulares tales como rÃ¡pido drenajeinterno, pH acido, moderada precipitaciÃ³n y con ello un lavado constante de lossuelos, lo que trae como consecuencia la pÃ©rdida de macronutrientes esencialespara el crecimiento y desarrollo de los cultivos. Uno de los elementos esenciales quese pierden es el fosforo (P), lo que produce una limitante en la fertilidad de estossuelos. Aunque se ha demostrado que las enmiendas orgÃ¡nicas, asÃ­ como las rocasfosfÃ³ricas mejoran las condiciones de los mismos, nuevas enmiendas se quierenincorporar al sistema de mejoramiento de la fertilidad del suelo.En este trabajo se pretende investigar las llamadas emulsiones asfÃ¡lticas y suinfluencia sobre el suelo, que si bien, aÃºn no se conoce su estructura quÃ­mica(debido a su complejidad), se sabe que son de fÃ¡cil obtenciÃ³n, (provienen delpetrÃ³leo); y que da resultados favorables en cuanto a fenÃ³menos fÃ­sico-quÃ­micos y almejoramiento de las propiedades fÃ­sicas del suelo.Tomando en cuenta las abundantes interrogantes que se tienen acerca delefecto de las emulsiones sobre el suelo, se presenta este trabajo; en el cual serealiza un fraccionamiento secuencial de P a un suelo de sabana del estadoAnzoÃ¡tegui, proveniente del Hato Rancho Grande, que permite obtener resultadosacerca del comportamiento del P sobre las distintas fracciones existentes en elsuelo. Esto se evaluÃ³ para dos experimentos: uno, en el que se indaga el efecto delas emulsiones sobre las cantidades de P en el suelo (incubaciÃ³n 60 dÃ­as) y otro,que permite conocer el mismo efecto, pero empleando como variante, la RocaFosfÃ³rica (RF) (incubaciÃ³n 15 dÃ­as).Los resultados para el primer experimento, indican que la emulsiÃ³n no tuvoefecto sobre las fracciones de P; mientras que en el segundo, si se observamovilidad de P en el suelo, inducido por la adiciÃ³n de la RF y de las emulsiones enconjunto. Por otra parte la fracciÃ³n de PNaoH fue la que mÃ¡s contribuyÃ³ al reservorioIVde P orgÃ¡nico total. Este Ãºltimo (POT) fue estimado por dos metodologÃ­as: Saundersand Williams y por Hedley et al. El primer mÃ©todo, aunque provocÃ³ unasobreestimaciÃ³n del PO no presentÃ³ diferencias con respecto al segundo.AdemÃ¡s, los valores de MO para este suelo Ultisol fueron bajos y no huboefecto alguno de las emulsiones sobre la misma. Cuando el valor de C fuerelacionado con el valor de PO se obtuvieron valores C/PO<= 200, lo que indicÃ³procesos de mineralizaciÃ³n en ambos experimentos, incrementÃ¡ndose la velocidadde los mismos, sÃ³lo cuando las emulsiones son aÃ±adidas a suelos con roca. PorÃºltimo, se realizÃ³ el anÃ¡lisis de varianza ANOVA en el que se compararon lostratamientos de ambos experimentos y las diferentes metodologÃ­as empleadas.','2008-11-07','S/I',6,1,1,1,1,'2013-09-17 08:21:22','2013-09-17 08:21:22','Documento_23.pdf','application/pdf',1193842,'2013-09-17 08:21:22',20,0,113,'COMPLETO'),(24,'ESTUDIO TEÃ“RICO DE LA PARTICIPACIÃ“N DEL DOBLE ENLACE OLEFÃNICO COMO GRUPO VECINO EN LA ELIMINACIÃ“N UNIMOLECULAR Y HOMOGÃ‰NEA DE ALGUNOS CLORUROS DE ALQUENILO EN FASE GAS','Se realizÃ³ un estudio teÃ³rico de la pirÃ³lisis en fase gas de una serie de cloruros dealquenilo; CH2=CH(CH2)nCH2Cl, donde n=1, 2 y 3; con el fin de obtener informaciÃ³nacerca de la participaciÃ³n del doble enlace olefÃ­nico en el mecanismo de eliminaciÃ³n deestos compuestos.Los cÃ¡lculos se llevaron a cabo utilizando mÃ©todos ab initio: RHF y MP2; y teorÃ­afuncional de densidad (DFT): B3PW91, PBEPBE Y MPW1PW91, y empleando losconjuntos base 6-31G(d), 6-31G(d,p) y 6-31+G(d,p).Los resultados de esta investigaciÃ³n arrojaron que las eliminaciones en fase gas del4-cloro-1-buteno, 5-cloro-1-penteno y 6-cloro-1- hexeno, proceden a travÃ©s demecanismos concertados, no sincrÃ³nicos, con un carÃ¡cter polar del estado detransiciÃ³n. AdemÃ¡s se determinÃ³, que el sustituyente vinÃ­lico no participaanquimericamente en el mecanismo de estas reacciones.Los resultados que mejor se ajustaron a los parÃ¡metros obtenidos anteriormente enestudios experimentales, correspondieron a los derivados de los funcionales B3PW91 yPBEPBE, utilizando como conjuntos base: 6-31G(d,p) y 6-31+G (d,p)','2008-11-03','S/I',6,1,1,1,1,'2013-09-17 08:21:23','2013-09-17 08:21:23','Documento_24.pdf','application/pdf',3995041,'2013-09-17 08:21:23',20,0,124,'COMPLETO'),(25,'EVALUACIÃ“N DE LA PRESIÃ“N Y LA TEMPERATURA SOBRE LA DESPOLIMERIZACIÃ“N DE CARBONES BITUMINOSOS VENEZOLANOS EN SISTEMAS DE SALES FUNDIDAS','Fue evaluado el efecto de la presiÃ³n y la temperatura sobre la despolimerizaciÃ³n demuestras de carbones de Guasare, pertenecientes a la FormaciÃ³n Marcelina(Paleoceno) en diferentes sistemas de sales de composiciÃ³n eutÃ©ctica. Para tal finse realizÃ³ un diseÃ±o experimental empleando dos temperaturas (220 y 300 0C)durante cuatro horas a condiciones de presiÃ³n atmosfÃ©rica asÃ­ como tambiÃ©n acondiciones de mayor presiÃ³n generada en un reactor. De igual manera, con el finde estudiar la composiciÃ³n del material obtenido, Ã©ste fue fraccionado utilizandocomo solvente piridina por medio del empleo de ultrasonido. Los rendimientos dedespolimerizaciÃ³n obtenidos oscilan en un rango de 3% hasta 65%, dependiendo delconjunto de sales y las condiciones de trabajo. Los rendimientos mÃ¡s bajos fueronobtenidos a condiciones de presiÃ³n elevada para la mezcla de sales FeCl3-KCl-LiCl(7-3%) con conversiones de solubles en piridina menores de 50%; en contraste losmayores rendimientos fueron exhibidos por los sistemas AlCl3-KCl-LiCl (61-65%)bajo condiciones de mayor presiÃ³n con conversiones de solubles en piridinamayores del 50%. De acuerdo a los resultados no fue posible establecer unatendencia general sobre la influencia de la presiÃ³n y la temperatura sobre el proceso,ya que cada sistema ensayado fue afectado de manera diferente. El rendimiento,composiciÃ³n de los extractos y efecto generado por presiÃ³n y temperatura dependendirectamente no sÃ³lo de la naturaleza e identidad de sales sino tambiÃ©n de lacombinaciÃ³n que se realice de las mismas, destacando sus caracterÃ­sticas comoÃ¡cidos de Lewis y posibles catalizadores de la reacciÃ³n','2008-07-25','S/I',6,1,1,1,1,'2013-09-17 08:21:24','2013-09-17 08:21:24','Documento_25.pdf','application/pdf',1922748,'2013-09-17 08:21:24',20,0,93,'COMPLETO'),(26,'ESTUDIO DEL CONTENIDO DE METALES PESADOS EN AGUAS Y PECES DEL EMBALSE SUATA- EDO. ARAGUA','En este trabajo se determinÃ³ la concentraciÃ³n de metales pesados en muestras de agua, tejido e hÃ­gado de peces, dichas muestras fueron recolectadas en el embalse Suata, con el objeto de aportar informaciÃ³n sobre el estado ambiental de este embalse.El muestreo fue realizado mensualmente, durante los meses de noviembre 2007 y abril 2008, por el Laboratorio del LimnologÃ­a del Instituto de BiologÃ­a Experimental de la Fac. de Ciencias, UCV. Las muestras de agua fueron recolectadas en dos estaciones del embalse, donde adicionalmente, se midieron los parÃ¡metros temperatura, pH, conductividad y oxÃ­geno disuelto. Una vez recolectadas, fueron llevadas a pH<2 con Ã¡cido nÃ­trico y refrigeradas hasta su anÃ¡lisis. Las muestras de tejido e hÃ­gado se obtuvieron de peces capturados durante el muestreo por pescadores de la zona. Estas muestras fueron extraÃ­das mediante la disecciÃ³n de los peces, manteniÃ©ndose congeladas hasta su liofilizaciÃ³n y posterior digestiÃ³n Ã¡cida asistida con horno microondas. En total se analizaron 24 muestras de agua y 17 muestras de tejido y de hÃ­gado de peces. La determinaciÃ³n de los elementos Cd, Cu, Cr, Ni y Pb se realizÃ³ mediante espectrometrÃ­a de absorciÃ³n atÃ³mica con atomizaciÃ³n electrotÃ©rmica (ETAAS), mientras que el Hg fue determinado mediante espectrometrÃ­a de absorciÃ³n atÃ³mica con generaciÃ³n de vapor frio (CV AAS). Las metodologÃ­as de anÃ¡lisis empleadas fueron validadas empleando muestras certificadas apropiadas: muestra de agua TM-26, muestra de agua NIST 1441d, tejido de ostra NIST-1566b e hÃ­gado de bovino BCR-185R. Los datos obtenidos fueron tratados empleando el paquete Statgraphic version 5.0 para Windows.El anÃ¡lisis de los datos mostrÃ³ que la temperatura del embalse presentÃ³ cambios durante el muestreo de acuerdo a la estaciÃ³n climÃ¡tica, estaciÃ³n y profundidad del muestreo. La estaciÃ³n E1 presentÃ³ las menores temperaturas atribuibles a fuentes cercanas de entrada de agua del canal aductor y de laquebrada El MamÃ³n. Asimismo se observÃ³ el mezclado de las aguas y la consiguiente homogeneidad de la temperatura para el mes de febrero. El pH de las aguas y su aumento durante el muestreo indicaron que el embalse se encuentra sometido a un proceso de eutrofizaciÃ³n como consecuencia de la concentraciÃ³n de nutrientes, proveniente de la actividad humana en la zona y de la disminuciÃ³n del volumen del cuerpo de agua producto de la Ã©poca de sequÃ­a.Los resultados obtenidos indicaron que la concentraciÃ³n de los metales en el agua no exceden los valores mÃ¡ximos permitidos por el Decreto 883 y por la norma EPA para aguas dulces (fresh water) por lo que no representan un riesgo para el destino que tienen dichas aguas (riego y recreaciÃ³n). Igualmente, las concentraciones de los metales en las muestras de tejido de peces no alcanzaron los valores lÃ­mites permitidos segÃºn las normas COVENIN 1776:1995 y 1087:1998 para atÃºn y sardinas, respectivamente, y el Codex Alimentarius (2007) para Cd y Hgorg. En las muestras de hÃ­gado, las concentraciones de los metales fueron superiores a las obtenidas en el tejido de los mismos peces, mientras que la concentraciÃ³n de Cu fue superior que el nivel mÃ¡ximo permitido en tejido, segÃºn las mismas normas COVENIN. Por otra parte, se encontraron correlaciones significativas entre la concentraciÃ³n de Cu con la talla y peso de los peces, asÃ­ como entre la concentraciÃ³n de los elementos Hg y Ni con la talla de los mismos, lo cual apunta a un proceso de bioacumulaciÃ³n.Estos resultados concuerdan con los obtenidos en un anÃ¡lisis ambiental realizado recientemente en sedimentos provenientes del mismo embalse, recolectados durante la misma fecha, los cuales indicaron que dichos sedimentos no representan un riesgo ambiental para el cuerpo de aguas, ya que las condiciones fisicoquÃ­micas no favorecen la liberaciÃ³n de los elementos intercambiables-extraÃ­bles de los mismos.','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:21:25','2013-09-17 08:21:25','Documento_26.pdf','application/pdf',1429599,'2013-09-17 08:21:25',20,0,89,'COMPLETO'),(27,'MODELADO GEOQUÃMICO 2D EN EL SUR DE LA CUENCA DE MARACAIBO','El objetivo del presente trabajo es la realizaciÃ³n de un modelado 2D en el surde la Cuenca de Maracaibo, con la utilizaciÃ³n de los datos de 21 pozos y 6pozos virtuales. Estos datos fueron obtenidos por Llanos en el aÃ±o 2000. Elmodelado fue realizado haciendo uno de un programa denominado Basinmod2D proporcionado por la Platte Rivers Associates, y a su vez para larealizaciÃ³n de mapas fue usado Basinview.La estratigrafÃ­a fue reconstruida con la finalidad de poder establecer la secciÃ³ntransversal a modelar, con base a los pozos que poseen la mayor cantidad deinformaciÃ³n: litolÃ³gica (% de lutitas, limolitas, areniscas, caliza, dolomita),geoquÃ­mica (% Madurez (%Ro), carbono orgÃ¡nico total (%COT)) e historiageolÃ³gica de la zona. A travÃ©s del proceso de calibraciÃ³n utilizando los datosde madurez, se estableciÃ³ el flujo de calor para la zona de estudio 30 mW/m2A partir de la integraciÃ³n de los resultados obtenidos por el modelo y lainterpretaciÃ³n geolÃ³gica de la zona, fue determinada la madurez de la rocamadre, comparando resultados obtenidos de pozos ubicados a una baja y altaprofundidad, asÃ­ como tambiÃ©n la etapa de mayor generaciÃ³n de hidrocarburosy la edad de expulsiÃ³n.Las tendencias de las diferentes vÃ­as de migraciÃ³n de los hidrocarburos fueronestablecidas a diferentes profundidades, para las distintas facies del petrÃ³leo.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:21:28','2013-09-17 08:21:28','Documento_27.pdf','application/pdf',8630211,'2013-09-17 08:21:28',19,0,149,'COMPLETO'),(28,'EFECTO DEL MÃ‰TODO DE LAVADO EN LA DETERMINACIÃ“N DE METALES EN MUESTRAS DE CABELLO POR ICP OES','Primero se validÃ³ de la metodologÃ­a utilizada para la determinaciÃ³n de elementos trazas en muestras cabello por espectrometrÃ­a de emisiÃ³n Ã³ptica con plasma inductivamente acoplado. Luego se determinÃ³ la cantidad de metal adsorbida por el cabello para ello se impregnÃ³ el cabello con sudor artificial y posteriormente, se realizÃ³ el estudio de remociÃ³n con los diferentes agentes de lavado estudiados, para determinar la cantidad de metal que es removido por los diferentes agentes de lavado. Los agentes de lavado estudiados fueron el EDTA (1-7%), acetona, agua, etanol, Ã©ter, y hexano.Se encontrÃ³ que, el EDTA a concentraciones mayores al 5% ataca el contenido endÃ³geno del cabello. Para los lavados de cabello, utilizando solventes orgÃ¡nicos se hallÃ³ que solo algunos de los metales estudiados son removidos, y se obtuvo una capacidad de remociÃ³n similar, el solvente orgÃ¡nico con que se encontrÃ³ una capacidad de remociÃ³n ligeramente mejor fue con la mezcla hexano-etanol. AdemÃ¡s se estudiaron, lavados de cabello utilizando la combinaciÃ³n EDTA / Solventes orgÃ¡nicos / Agua, con la cual se obtuvo mejores resultados (mayor poder de remociÃ³n) que al utilizar cualquier solvente, por lo que se puede concluir que la formar mÃ¡s eficiente para remover el contenido exÃ³geno del cabello es utilizando cualquiera de las combinaciones propuestas.Finalmente se determinÃ³ el contenido de elementos trazas en muestras de cabello para habitantes de la ciudad de Los Teques, son similares con los niveles normales reportados en otros estudios.','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:21:29','2013-09-17 08:21:29','Documento_28.pdf','application/pdf',1016090,'2013-09-17 08:21:29',17,0,86,'COMPLETO'),(29,'ESTUDIO GEOQUÃMICO DE METALES PESADOS EN SEDIMENTOS DE FONDO DEL GOLFETE DE CUARE, ESTADO FALCÃ“N.','Este trabajo consistiÃ³ en estudiar geoquÃ­micamente los sedimentos de fondo del Golfete de Cuare, estado FalcÃ³n, para determinar la concentraciÃ³n y distribuciÃ³n de Fe, Mn, Ca, Mg, Zn, Cu, Ni, Pb, Cr, Cd y Hg, en el sedimento. Los resultados obtenidos indicaron que las concentraciones de los elementos mayoritarios como Fe, Ca, Mg, y algunos trazas como Mn, estÃ¡n controladas por diversos factores, entre los cuales se puede mencionar: la litologÃ­a (lutitas calcÃ¡reas, areniscas y calizas preferentemente) que se encuentra alrededor de la zona de estudio, por donde drenan diversos afluentes (rÃ­o Tocuyo, el caÃ±o El Estero y Dieguito), procesos de erosiÃ³n, cambios en el patrÃ³n de sedimentaciÃ³n, influencia del agua de mar y relieve. Para el resto de los elementos los factores antes mencionados pueden estar operando sin embargo otro factor no menos importante como lo es el antrÃ³pico puede estar controlando la presencia de elementos como Cu, Cd Pb, Ni, Cr Zn y Hg en la zona.Por otra parte fue establecida la distribuciÃ³n de los elementos en las distintas fases (iones dÃ©bilmente adsorbidos, carbonatos, oxihidrÃ³xidos y solubles en Ã¡cidos fuertes) que componen la fracciÃ³n lodo de los sedimentos de fondo, mediante un proceso de extracciÃ³n parcial. Los resultados indican que los elementos Ca y Mg, presentaron una buena afinidad en el extractÃ³ de HCl, lo cual sugiriÃ³ que parte de estos elementos estÃ¡n siendo aportados al sistema por actividad biolÃ³gica y procesos de erosiÃ³n.La distribuciÃ³n espacial de las arenas y la fracciÃ³n mÃ¡s fina de los sedimentos (lodo), en el sector estudiado del Golfete de Cuare, indican que las arenas gruesas fueron las mÃ¡s abundantes en los primeros centÃ­metros (0-5) cm de profundidad de los sedimentos estudiados. Luego dicha fracciÃ³n diminuye en los siguientes 10 cm restantes, aumentando a su vez los porcentajes de arena fina y muy fina. Posiblemente por un cambio en el patrÃ³n de sedimentaciÃ³n de los Ãºltimos aÃ±os.','2008-10-28','S/I',6,1,1,1,1,'2013-09-17 08:21:32','2013-09-17 08:21:32','Documento_29.pdf','application/pdf',5545127,'2013-09-17 08:21:32',17,0,148,'COMPLETO'),(30,'SÃNTESIS Y USO DE CATALIZADORES NO CONVENCIONALES EN REACCIONES DE HIDROTRATAMIENTO.','La generaciÃ³n de nuevos catalizadores para hidrotratamiento ha tomado mayorauge debido a las restricciones ambientales cada vez mÃ¡s exigentes que inducen a ladisminuciÃ³n de contaminantes, como heteroÃ¡tomos y metales pesados, quegeneralmente se encuentran asociados a crudos y cortes de petrÃ³leo. Para Venezuela,como paÃ­s productor de petrÃ³leo con una de las mayores reservas de crudos pesados yextrapesados a nivel mundial, es de vital importancia el desarrollo de catalizadorescapaces de procesar altos contenidos de macromolÃ©culas con presencia de azufre, lascuales estÃ¡n presentes en dichos crudos.Los sÃ³lidos tipo hidrotalcita (HTLCÂ´s) constituyen materiales con propiedadesmuy interesantes que los hacen atractivos para la formulaciÃ³n de nuevos catalizadorescon mejores desempeÃ±os catalÃ­ticos. El fenÃ³meno de intercambio iÃ³nico exhibido porestos sÃ³lidos ofrece la posibilidad de incorporar a dichas estructuras especies de Mo yNiMo que luego puedan generar catalizadores con elevadas cargas metÃ¡licas (mayoresque las alcanzadas por los catalizadores convencionales) y altamente dispersos.En la presente investigaciÃ³n se hizo un estudio de la preparaciÃ³n decatalizadores sulfurados monometÃ¡licos (NiS y MoS2) y bimetÃ¡licos (NiMoS) partiendode polioxometalatos intercalados en los HTLCÂ´s, y fueron evaluados en lahidrodesulfuraciÃ³n de tiofeno. Los resultados obtenidos muestran que, aparentemente,se lograron altas dispersiones y que al colapsar el arreglo laminar de los precursorespor efecto de la temperatura se obtuvieron fases metÃ¡licas recubiertas que mostraronbajas actividades catalÃ­ticas.','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:21:42','2013-09-17 08:21:42','Documento_30.pdf','application/pdf',3933600,'2013-09-17 08:21:42',20,0,177,'COMPLETO'),(31,'ADSORCIÃ“N DE FÃ“SFORO EN SUELOS DE DIFERENTES TEXTURAS: EFECTO DEL GRADO DE CONTAMINACIÃ“N POR CRUDO','El principal objetivo de este estudio fue determinar la influencia de diferentestexturas del suelo y el grado de contaminaciÃ³n por crudo en la adsorciÃ³n de fÃ³sforo (P)sobre suelos colectados al sur del estado AnzoÃ¡tegui. Con este estudio se pretendeentonces generar informaciÃ³n que permita diseÃ±ar estrategias de recuperaciÃ³n de Ã¡reasafectadas por la actividad de la industria petrolera. El estudio de adsorciÃ³n de P fuerealizado siguiendo la metodologÃ­a de Walbridge et al. (1991), aplicado a cuatro suelosde diferente textura y contaminados a dos proporciones 3% y 6% de crudo pesado. LasrÃ©plicas fueron equilibradas con una soluciÃ³n de KH2PO4/CaCl2 con un rango deconcentraciÃ³n de 0; 10; 50; 80; 100 mg/L P suelo arenoso y areno-francoso, 0; 10; 50;100; 200 mg/L P suelo franco-arenoso y 0; 10; 50; 100, 200; 300 mg/L P suelo arcilloso.Los datos de adsorciÃ³n de P se ajustaron satisfactoriamente al modelo lineal deLangmuir. En los suelos con alta proporciÃ³n de arena como el franco- arenoso, arenofrancosoy arenoso fue observada una tendencia a disminuir la capacidad de adsorciÃ³nde PO43- al incrementar la proporciÃ³n de crudo aÃ±adido, lo que sugiere que el crudo muyprobablemente estÃ¡ compitiendo con los iones fosfatos por los sitios de adsorciÃ³n en elsuelo; mientras que en el suelo arcilloso el mÃ¡ximo de adsorciÃ³n no variÃ³significativamente entre tratamientos (SC, MSC3% y MSC6%) por lo que sugiere que laalta proporciÃ³n de arcilla en este suelo no conduce a que exista competencia por lossitios de adsorciÃ³n entre el crudo y los iones PO43-. La clase textural del suelo influyeen la capacidad de adsorciÃ³n de P en presencia de crudo, obteniÃ©ndose que la texturafina obedece a los mayores mÃ¡ximos de adsorciÃ³n y las texturas gruesas mostraron losmenores valores.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:21:44','2013-09-17 08:21:44','Documento_31.pdf','application/pdf',3100155,'2013-09-17 08:21:44',20,0,109,'COMPLETO'),(32,'CATALIZADORES NANOESTRUCTURADOS EN BASE A Ni, Ca Y Co PARA LA REFORMACIÃ“N DE METANO CON VAPOR','En el presente trabajo se estudiÃ³ el comportamiento catalÃ­tico de una serie de catalizadores de nÃ­quel soportados para la reacciÃ³n de reformaciÃ³n de metano con vapor de agua. Se sintetizaron dos catalizadores de referencia de nÃ­quel (10% p/p) soportados sobre alÃºmina y sÃ­lice por el mÃ©todo de impregnaciÃ³n incipiente. Asimismo, se sintetizaron dos catalizadores de nÃ­quel soportados sobre alÃºmina, utilizando un complejo de nÃ­quel- etilendiamina, por dos mÃ©todos diferentes: impregnaciÃ³n por humedad incipiente del complejo y sÃ­ntesis y deposiciÃ³n de este en presencia del soporte. Finalmente se prepararon catalizadores bimetÃ¡licos, promovidos con calcio y cobalto, partiendo del catalizador de nÃ­quel preparado por sÃ­ntesis y deposiciÃ³n del complejo nÃ­quel- etilendiamina en presencia del soporte. Los sÃ³lidos precursores fueron caracterizados mediante anÃ¡lisis quÃ­mico, DRX, RTP, Ãrea B.E.T., ATG-ATD y Microscopia ElectrÃ³nica de TransmisiÃ³n MET. La actividad catalÃ­tica fue evaluada con la reacciÃ³n de ReformaciÃ³n de metano con vapor de agua.Los resultados indicaron que de los catalizadores de referencia, el catalizador soportado sobre sÃ­lice no mostrÃ³ actividad hacia la reacciÃ³n de reformaciÃ³n de metano, mientras que el catalizador soportado sobre alÃºmina fue el que mostrÃ³ el mejor comportamiento catalÃ­tico bajo las condiciones de estudio; el hecho de que la especie predominante en este catalizador sea el NiAl2O4, podrÃ­a implicar que este sea el precursor de la fase activa. Los resultados obtenidos con los catalizadores preparados a partir del complejo Ni-etilendiamina sugieren que la utilizaciÃ³n de sales precursoras de gran tamaÃ±o conduce a la obtenciÃ³n de partÃ­culas pequeÃ±as; de los dos catalizadores preparados, el que dio mayor conversiÃ³n de metano y mayor estabilidad, fue el preparado formando el complejo Ni-en in-situ, debido posiblemente a la mejor dispersiÃ³n de las partÃ­culas metÃ¡licas sobre el soporte y a la menor relaciÃ³n NiO/NiAl2O4 que este presenta. Por otra parte, de los catalizadores promovidos con calcio, el catalizador preparado por impregnaciones sucesivas dio como resultado una mayor conversiÃ³n y estabilidad en la reacciÃ³n de reformaciÃ³n con vapor, mientras que el catalizador preparado por co-impregnaciÃ³n no mostrÃ³ variaciones en la conversiÃ³n, resultado que se puede justificar partiendo de que la relaciÃ³n NiO/ NiAl2O4 en este Ãºltimo es mayor. El catalizador promovido con cobalto produjo un ligero aumento en la conversiÃ³n de metano; igualmente, este resultado puede ser vinculado con la relaciÃ³n NiO/NiAl2O4 que en este sÃ³lido es menor que en el catalizador Ni(en), sin embargo, no puede descartarse que la incorporaciÃ³n de un segundo metal catalÃ­ticamente activo hacia la misma reacciÃ³n, da lugar, en general, a la formaciÃ³n de una cantidad mayor de sitios activos.','2008-11-03','S/I',6,1,1,1,1,'2013-09-17 08:21:45','2013-09-17 08:21:45','Documento_32.pdf','application/pdf',2050692,'2013-09-17 08:21:45',20,0,146,'COMPLETO'),(33,'TRANSFORMACIÃ“N DE LIMONENO SOBRE SBA-15 Y MCM-41 CONTENIENDO ALUMINIO:EFECTO DEL SOLVENTE.','El limoneno en un terpeno que se obtiene de la extracciÃ³n de las conchas denaranjas y limones; es utilizado ampliamente en las industrias farmacÃ©uticas y deperfumes como materia prima para la obtenciÃ³n de productos como el terpinol.Actualmente la transformaciÃ³n del limoneno se lleva a cabo por medio de lacatÃ¡lisis homogÃ©nea con la utilizaciÃ³n de Ã¡cidos minerales como el acido sulfÃºrico comocatalizador, estas reacciones presentan serios problemas ambientales ya que producensubproductos nocivos que son difÃ­ciles de separar y tratar. Es por ello que se vienenestudiando alternativas para esta reacciÃ³n. Una manera viable de eliminar estosproblemas es la implementaciÃ³n de catalizadores heterogÃ©neos que son reutilizables yno presentan subproductos contaminantes.En este estudio se utilizaron para la transformaciÃ³n del limoneno dos sÃ³lidosmeso porosos: MCM-41 y SBA-15, incorporÃ¡ndoles Al tanto por sÃ­ntesis directa comoindirecta y con dos relaciones molar Si/Al (15 y 30). Los sÃ³lidos se caracterizaron pordifracciÃ³n de rayos X (DRX), fisisorciÃ³n de nitrÃ³geno, microscopia electrÃ³nica de barrido(MEB) e ICP para comprobar las propiedades texturales de los mismos asÃ­ comotambiÃ©n la incorporaciÃ³n del Al en sus estructuras. Las pruebas cataliticas se realizaronen un reactor por carga de vidrio provisto de reflujo y agitaciÃ³n mecÃ¡nica. Se fijaron lassiguientes condiciones: agua/terpeno = 74 molar, agua/co-solvente = 3,2 molar, 1 gramode catalizador y 6 gramos de Limoneno; se utilizÃ³ dos co-solventes (acetona y 2- propanol), para cada sistema se trabajÃ³ a la temperatura de ebulliciÃ³n de los cosolventes(55 ÂºC para la acetona y 95 ÂºC para el 2-propanol). Se tomaron muestras a las48 horas de reacciÃ³n y se analizaron por cromatografÃ­a de gases.Los sÃ³lidos que presentaron mejores conversiones y rendimiento hacia laformaciÃ³n del terpinol fueron el Al-MCM-41 (30) que fue sintetizado de forma directa y elAl/SBA-15 (30) que fue sintetizado de forma indirecta (impregnaciÃ³n humeda). Con loque se puede inferir que el menor contenido de Aluminio en los sÃ³lidos de alta Ã¡reaespecifica favorece la dispersiÃ³n del mismo y mejora las propiedades Ã¡cidas.El Al/SBA-15 (30) mostrÃ³ niveles de conversiÃ³n del Limoneno y selectividad haciala formaciÃ³n del terpinol mÃ¡s altas que el Al-MCM-41 (30) lo que puede atribuirse a queel sÃ³lido impregnado posee sitios Ã¡cidos de tipo BrÃ¶nsted que estÃ¡n en mayor nÃºmero yson de mayor fuerza que en el material Al- MCM-41 (30).Se realizÃ³ una experiencia con una zeolita Mordenita (Si/Al 30) bajo las mismascondiciones de reacciÃ³n de nuestros mejores sÃ³lidos (Al-MCM-41 30 y Al/SBA-15 30),presentando resultados de casi el doble de conversiÃ³n del Limoneno y mas del doble deporcentaje de rendimiento hacia el terpinol. Esto se explica en tÃ©rminos de la acidez, yaque la Mordenita presenta un valor de acidez total mucho mayor que el de nuestrossÃ³lidos.Se realizÃ³ una experiencia reduciendo la cantidad de agua en la mezcla dereacciÃ³n sobre los catalizadores Al-MCM-41 (30) y Al/SBA-15 (30). Los resultadosindicaron que la presencia del agua no cera problemas difusionales ni compromete lamayorÃ­a de los sitios activos de nuestros sÃ³lidos.Se realizÃ³ una experiencia con los sÃ³lidos antes mencionados sin el uso de cosolventesobteniendo como resultado que la conversiÃ³n del Limoneno aumentÃ³significativamente. AdemÃ¡s, el porcentaje de rendimiento hacia el terpinol para el Al-MCM-41 (30) y Al/SBA-15 (30) se incremento en mÃ¡s del 300 % respecto a los sistemassin co-solvente, por lo que el uso de un co-solvente no fue necesario para llevar a cabola reacciÃ³n de hidrataciÃ³n del Limoneno sobre tamices moleculares meso porosos conaluminio, mientras que para la Mordenita si bien se incrementÃ³ considerablemente laconversiÃ³n del Limoneno el porcentaje de rendimiento hacia el terpinol disminuyÃ³ por loque la presencia del co-solvente para este tipo de sÃ³lidos seria necesaria para facilitar elcontacto con los demÃ¡s reactivos (agua y Limoneno) para llevar a cabo la hidrataciÃ³n.','2008-07-14','S/I',6,1,1,1,1,'2013-09-17 08:21:47','2013-09-17 08:21:47','Documento_33.pdf','application/pdf',3437938,'2013-09-17 08:21:47',19,0,87,'COMPLETO'),(34,'ESTUDIO DE LA INTERACCIÃ“N ENTRE SURFACTANTES CATIÃ“NICOS PRESENTES EN EMULSIONES ASFÃLTICAS Y ROCAS DE DIFERENTES REGIONES DEL TERRITORIO VENEZOLANO','A nivel mundial muchos paÃ­ses han implementado la tÃ©cnica de Emulsiones AsfÃ¡lticasdebido a su evoluciÃ³n, desarrollo y aplicaciÃ³n en obras de pavimentaciÃ³n. Estasrepresentan una alternativa con bajos costos de fabricaciÃ³n, aplicaciÃ³n y consumo deenergÃ­a; asÃ­ como la ventaja de ser amigable al medio ambiente por tratarse demezclas a base agua, aplicadas totalmente en frÃ­o. A pesar que Venezuela cuenta consuficiente materia prima para la aplicaciÃ³n de las tÃ©cnicas de asfaltado tradicionales, noha tenido suficiente experiencia en la aplicaciÃ³n de Emulsiones AsfÃ¡lticas.Una EmulsiÃ³n AsfÃ¡ltica, contiene una molÃ©cula quÃ­mica (surfactante catiÃ³nico), quepermite mantener estable una dispersiÃ³n de finas gotas de asfalto en agua a travÃ©s deun equilibrio electroquÃ­mico. Estas son obtenidas a partir de un proceso de cizallamientoque ocurre dentro de un molino coloidal, donde el emulsificante puede ocasionar unadisminuciÃ³n o incremento en las propiedades de adherencia y cohesiÃ³n, ademÃ¡s de lacapacidad de cubrir los minerales presentes en las rocas, caracterÃ­sticas de granimportancia en la aplicaciÃ³n de tratamiento superficial o Slurry Seal.Debido a lo antes expuesto, surge el presente trabajo con el propÃ³sito de desarrollar yevaluar el comportamiento de emulsiones asfÃ¡lticas utilizando varios SurfactantesCatiÃ³nicos de la LÃ­nea EmulsivÂ® de Clariant. Mediante la fabricaciÃ³n de mezclasasfÃ¡lticas en frÃ­o con seis tipos de rocas (silicios - calcÃ¡reos) en cinco zonas deVenezuela.De acuerdo a los resultados obtenidos en este trabajo de investigaciÃ³n, puedeseÃ±alarse que existe un alto grado de confiabilidad al surfactante EmulsivÂ® M1785 derompimiento lento, ya que presentÃ³ excelente interacciÃ³n con los distintos tipos derocas en las mezclas asfÃ¡lticas. Fue observado que la roca Cal. - Emp., de la zona delestado Aragua, presentÃ³ el mejor comportamiento de cubrimiento, cohesiÃ³n yadhesiÃ³n. Mientras que la roca Aren. - FalcÃ³n de la zona del estado FalcÃ³n, presentÃ³una baja interacciÃ³n con los distintos surfactantes evaluados. En conclusiÃ³n losresultados obtenidos, ayudaran a contribuir con el Ã©xito en la aplicaciÃ³n de la tÃ©cnicade Emu','2008-07-23','S/I',4,1,1,1,1,'2013-09-17 08:21:50','2013-09-17 08:21:50','Documento_34.pdf','application/pdf',7892773,'2013-09-17 08:21:50',20,0,156,'COMPLETO'),(35,'EVALUACIÃ“N DEL EFECTO DE LOS IONES MAYORITARIOS PRESENTES EN EL AGUA DE FORMACIÃ“N SOBRE EL DESEMPEÃ‘O DE UN SISTEMA GELIFICANTE DE BAJA CONSISTENCIA (MULTIGELÂ®) DENTRO DEL MEDIO POROSO.','El empleo de sistemas gelificantes polimÃ©ricos para el control de la excesiva producciÃ³nde agua y/o gas, constituye uno de los mÃ©todos mÃ¡s aplicados en los yacimientospetroleros. Sin embargo, aun se tiene un conocimiento limitado en relaciÃ³n alcomportamiento de estos sistemas dentro del medio poroso, cuando son expuestos adiferentes condiciones de salinidad. En este sentido se evaluÃ³ el comportamiento delsistema gelificante MultigelÃ’ ULT, mediante la realizaciÃ³n de pruebas fuera (de botella)y dentro del medio poroso (de desplazamiento) a 60 Â°C y 200 psi, cuando entra encontacto con soluciones de los iones sodio y calcio, a concentraciones de 100 y 10.000ppm. En las pruebas fuera del medio poroso tambiÃ©n se evaluÃ³ la influencia del el iÃ³nHCO3-. Otro aspecto evaluado en las pruebas fuera del medio poroso, fue la influenciadel pH en los tiempos de gelificaciÃ³n, encontrÃ¡ndose que a medida que el pH de lasoluciÃ³n gelificante aumenta, se produce un incremento en los tiempos de gelificaciÃ³n.AdemÃ¡s se evaluÃ³ el grado de hinchamiento del gel, encontrÃ¡ndose que la mayorabsorciÃ³n de agua es producida por los iones HCO3-, mientras que la menor absorciÃ³nde agua es generada por los iones Ca+2. Las pruebas realizadas dentro del medioporoso sugieren que el sistema MultigelÃ’ ULT causa una disminuciÃ³n considerable de lapermeabilidad efectiva al agua en mayor o menor medida, dependiendo de laconcentraciÃ³n y del iÃ³n implÃ­cito. Los diferenciales de presiÃ³n mÃ¡s altos fueronobtenidos para el caso de la inyecciÃ³n de agua de Intequim, la cual es el agua base depreparaciÃ³n de los geles.','2008-11-03','S/i',6,1,1,1,1,'2013-09-17 08:21:54','2013-09-17 08:21:54','Documento_35.pdf','application/pdf',1374158,'2013-09-17 08:21:54',18,0,167,'COMPLETO'),(36,'ALCOHOLES SUPERIORES A PARTIR DE GAS DE SÃNTESIS:CATALIZADORES NANOESTRUTURADOS EN BASE A RUTENIO Y MOLIBDENO SOPORTADOS.','El enfoque de este trabajo ha sido la producciÃ³n selectiva de alcoholes superiores, utilizando la reacciÃ³n de hidrogenaciÃ³n de monÃ³xido de carbono conocida como SÃ­ntesis Fischer Tropsch (SFT) con presiones de 750 psi y temperaturas entre 275- 300Â°C. Empleando catalizadores de rutenio nanoestruturados y rutenio promovidos con molibdeno soportados sobre sÃ­lice y alÃºmina (Ru/Mo). Se utilizaron tres mÃ©todos en la preparaciÃ³n de los mencionados catalizadores; 1) impregnaciÃ³n por humedad incipiente para obtener los catalizadores de referencia (RuCl3), 2) mÃ©todo (n1) que consistiÃ³ en la descomposiciÃ³n suave de complejos organometÃ¡licos, 3) mÃ©todo (n2), que consistiÃ³ en la impregnaciÃ³n de complejos organometÃ¡licos de Ru de tipo Ru(COD) (COT) [(COD= e4-cicloota-1,5-dieno; COT= e6-cicloota-1,3,5,trieno)] \"RuCODCOT n2\" y Ru(acac)3 (acac = acetilacetonato). Los catalizadores de Ru y Ru/Mo fueron caracterizados por diferentes tÃ©cnicas entre las cuales destacan difracciÃ³n de rayos x (DRX) el cual mostrÃ³ que la fase metÃ¡lica presente fue la del cristal del oxido de rutenio. Los resultados de Ã¡rea especÃ­fica arrojaron que los catalizadores preparados sobre alumina obtuvieron mayor Ã¡rea que los preparados sobre sÃ­lice. Los resultados obtenidos por reducciÃ³n a temperatura programada (RTP) mostraron en el caso de los catalizadores convencionales una disminuciÃ³n de la temperatura de reducciÃ³n empleando el pretratamiento con N2 y en los catalizadores nanoestructurados un aumento de esta temperatura debido a la mayor interacciÃ³n de las partÃ­culas metÃ¡licas con el soporte. AnÃ¡lisis termogravimÃ©trico (TGA) mostro en el caso de los catalizadores convencionales la descomposiciÃ³n completa de la sal precursora. Ambos mÃ©todos tanto n1 como n2 generaron catalizadores nanoestructurados, evidenciado por los resultados de MET obteniÃ©ndose un tamaÃ±o de particula promedio entre 8-10 nm. TambiÃ©n mostraron actividad hacia la SFT produciendo en su mayorÃ­a hidrocarburos entre C2-C5. Al incorporar el molibdeno al catalizador de \"RuCODCOT n1\", el cual resultÃ³ ser el mÃ¡s activo con respecto a la conversiÃ³n del CO/H2, se observÃ³ una mejorÃ­a de laselectividad hacia la formaciÃ³n de alcoholes superiores debido a la interacciÃ³n entre el rutenio y el molibdeno que generÃ³ sitios activos capaces de aumentar el rendimiento de los alcoholes superiores (C2OH+) en comparaciÃ³n a los catalizadores sin promover con Mo. Sin embargo, el metanol y el etanol fueron los alcoholes que se produjeron en mayor proporciÃ³n.','2008-10-30','S/I',6,1,1,1,1,'2013-09-17 08:21:55','2013-09-17 08:21:55','Documento_36.pdf','application/pdf',1482146,'2013-09-17 08:21:55',20,0,116,'COMPLETO'),(37,'SEMISÃNTESIS DE DERIVADOS DE CLERODANOS COMO POSIBLES AGENTES ANTIBACTERIALES.','En este Trabajo Especial de Grado se aislÃ³ de las fracciones FM y FD delextracto metanÃ³lico de la esponja Agelas clathrodes, el metabolito principal AgelasinaB, y se realizÃ³ la caracterizaciÃ³n de este compuesto mediante tÃ©cnicasespectroscÃ³picas de RMN 1H y 13C.Se ensayaron una serie de modificaciones sintÃ©ticas sobre la unidad declerodano de Agelasina B, especÃ­ficamente sobre los carbonos olefÃ­nicos, a fin degenerar una serie de dervados semisinteticos de este metabolito con la finalidad deevaluar sus actividades antivirales contra la fiebre amarilla.Se utilizÃ³ al colesterol como modelo a fin de estudiar las condiciones dereacciones que posteriormente se realizaron sobre Agelasina B.Las modificaciones consistieron bÃ¡sicamente en bromaciÃ³n al doble enlace,hidroxilaciÃ³n alÃ­lica y epoxidaciÃ³n. En algunos casos se variaron las condiciones dereacciÃ³n, como, reactivos, solventes, tiempo, etc., a fin de obtener el mejor rendimiento.Todos los productos fueron caracterizados espectroscÃ³picamente por RMN 1H,13C y espectrometrÃ­a de masa mediante la tÃ©cnica de IonizaciÃ³n por Electrospray (ESI).','2008-10-31','S/I',6,1,1,1,1,'2013-09-17 08:21:58','2013-09-17 08:21:58','Documento_37.pdf','application/pdf',5302511,'2013-09-17 08:21:58',19,0,91,'COMPLETO'),(38,'SÃNTESIS Y CARACTERIZACIÃ“N DE NUEVOS AGREGADOS CARBONÃLICOS DE RENIO Y OSMIO CON LIGANDOS POLIPIRIDÃNICOS.','En este trabajo se estudiÃ³ la reactividad de los agregados lÃ¡biles de renio, Re2(CO)8(CH3CN)2 y de Osmio [Os3(CO)10(CH3CN)2] con los ligandos polipiridÃ­nicos, 3,5,6-tris(2-piridil)-1,2,4-triazina (2TPT); 3-(3-piridil)- 5,6-bis(2-piridil)-1,2,4-triazina (3TPT), 3-(4-piridil)-5,6,-bis(2-piridil)- 1,2,4-triazina (4TPT) y 2,3,5,6-tetra-(2-piridil)-1,2-pirazina (TPP), con la finalidad de obtener sistemas de alta nuclearidad y evaluar nuevas formas de coordinaciÃ³n. Con el ligando 3,5,6-tris(2-piridil)-1,2,4-triazina se obtuvieron dos complejos dinucleares de renio identificados como a1 y a2 los cuales tienen formula molecular [Re2(CO)8(2:2-C18H12N6)] y [{Re(CO)3OH}{Re(CO)4}{Re(CO)3}(1: 2: 2:2:2:2:2-C18H12N6O)] respectivamente. Los mismos fueron caracterizados por las tÃ©cnicas espectroscÃ³picas de RMN 1H, IRTF y anÃ¡lisis de difracciÃ³n de rayos X para ambos complejos. Con el ligando 3-(3-piridil)-5,6-bis(2-piridil)-1,2,4- triazina se obtiene los complejos de renio etiquetados como b1, b2 y b3, de fÃ³rmulas moleculares [Re2(CO)8(2:2:2-C18H12N6)Re(CO)4]2, [Re2(CO)8(2- C18H12N6)2] y [Re2(CO)8(2:2-C18H12N6)] respectivamente, y los complejos de osmio identificados como b4 y b5, ambos con fÃ³rmula [Os3(m:H)(CO)10(1:2- C18H11N6)] y que fueron caracterizados por las tÃ©cnicas espectroscÃ³picas de IRTF y RMN 1H.El ligando 3-(4-piridil)-5,6,-bis(2-piridil)-1,2,4-triazina da lugar a tres complejos de renio g1, [Re2(CO)8(2:2:2-C18H12N6)Re(CO)4]2; g2, [Re2(CO)8(2-C18H12N6)2] y g3 [Re2(CO)8(2:2-C18H12N6)] ademÃ¡s de otro complejo de osmio g4 [Os3(m:H)(CO)10(1:2-C18H11N6)] los cuales fueron caracterizados por espectroscopÃ­a de IRTF y RMN1H. El ligando 2,3,5,6-tetra-(2-piridil)-1,2- pirazina da lugar al complejo d1 de fÃ³rmula molecular [Re2(CO)8(e2:e2- C24H20N6)] el cual fue caracterizado por espectroscopia de IRTF, RMN 1H y por difracciÃ³n rayos X. Los complejos presentanprincipalmente coordinaciÃ³n tipo quelato, formando de esta manera metalociclos de cinco miembros aunque tambiÃ©n se obtuvieron complejos con coordinaciones monodentadas.','2008-10-28','S/I',6,1,1,1,1,'2013-09-17 08:22:00','2013-09-17 08:22:00','Documento_38.pdf','application/pdf',3398108,'2013-09-17 08:22:00',20,0,143,'COMPLETO'),(39,'EFECTO DE LA MADURACIÃ“N DE LA TURBA SOBRE SU CAPACIDAD DE ADSORCIÃ“N DE METALES PESADOS','Este trabajo tiene como objetivo principal la evaluaciÃ³n de la capacidad de adsorciÃ³n de laturba de manglar (turbas de Morrocoy, estado FalcÃ³n) a medida que es madurada artificialmentecon la tÃ©cnica de hidropirÃ³lisis, utilizando como adsorbato soluciones de Cd2+, Zn2+ y Cu2+.Se comparÃ³ la capacidad de adsorciÃ³n de dos sustratos carbonÃ¡ceos denominados turbaoriginal y turba madurada (producto madurado) para los cationes anteriormente mencionados, ensistemas simples de agitaciÃ³n de las soluciones con el adsorbente en un rango de pH entre 5 y 6 ya una temperatura de 25 ÂºC.Los datos de adsorciÃ³n de la turba se ajustaron al modelo de Langmuir y de Freundlich,logrÃ¡ndose una mejor correlaciÃ³n con el primer modelo (mejores coeficientes de regresiÃ³n). Laisoterma de Langmuir resultÃ³ bastante apropiada para ajustar los datos de adsorciÃ³n del productomadurado (adsorciÃ³n en monocapa).El orden de afinidad de los cationes a ambos materiales carbonÃ¡ceos fue de Cu2+ > Zn2+>Cd2+. El primero de los cationes presenta una configuraciÃ³n d9 convirtiÃ©ndolo en una especiebastante reactiva frente a los otros cationes que presentan una configuraciÃ³n d10, ademÃ¡s formacomplejos estables con la materia orgÃ¡nica lo cual explica su mayor afinidad por el adsorbente.Los resultados arrojaron que la turba posee 12, 14 y 29 veces mayor capacidad deadsorciÃ³n para Cu2+, Zn2+ y Cd2+, respectivamente que el material madurado. Este fenÃ³meno seatribuyÃ³ a la pÃ©rdida de grupos funcionales (reducciÃ³n de la polaridad) y a la compactaciÃ³ndurante la maduraciÃ³n de la materia orgÃ¡nica, disminuyendo los sitos activos disponibles para queocurra la adsorciÃ³n.Los principales mecanismos que se proponen para explicar la adsorciÃ³n de los cationes alos sustratos usados, son la quelataciÃ³n (especialmente para el Cu2+) y el intercambio iÃ³nico, yaque a los valores de pH trabajados, los Ã¡cidos carboxÃ­licos - principales responsables de laadsorciÃ³n- se encuentran desprotonados, constituyendo la especie mÃ¡s activa para la remociÃ³n delos cationes en soluciÃ³n.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:22:03','2013-09-17 08:22:03','Documento_39.pdf','application/pdf',2708796,'2013-09-17 08:22:03',20,0,94,'COMPLETO'),(40,'DESARROLLO DE UNA HERRAMIENTA PARA EL MONITOREO DE EVENTOS Y ACTIVIDADES DE USUARIOS EN APLICACIONES Web.','La finalidad del presente Trabajo Especial de Grado consiste en el desarrollode una herramienta con la capacidad de: realizar el monitoreo de eventos yacciones de usuarios, durante su interacciÃ³n con aplicaciones y sitios Web, ygenerar informaciÃ³n que pueda ser utilizada posteriormente, con mÃºltiplespropÃ³sitos. Para ello, se aplicÃ³ una adaptaciÃ³n del modelo de desarrollo en cascada,bajo una metodologÃ­a Ad hoc, la cual se realizÃ³ en cinco fases: descripciÃ³n derequerimientos, anÃ¡lisis, diseÃ±o, implementaciÃ³n y, finalmente, la fase de pruebasde la herramienta desarrollada. Como resultado final se obtuvo una herramienta defÃ¡cil integraciÃ³n, con la capacidad de realizar el proceso de grabaciÃ³n de eventos yacciones relevantes de los usuarios, llevar a cabo reproducciones automÃ¡ticas dedichas grabaciones y generar reportes con informaciÃ³n de utilidad acerca de lasactividades registradas por los usuarios de cualquier aplicaciÃ³n Web.','2008-10-30','Monitoreo de usuarios, reproducciÃ³n automÃ¡tica, eventos, grabaciÃ³n, JavaScript,Page Tagging, Document Object Model (DOM).',2,1,1,1,1,'2013-09-17 08:22:04','2013-09-17 08:22:04','Documento_40.pdf','application/pdf',1536249,'2013-09-17 08:22:04',20,0,101,'COMPLETO'),(41,'IMPLEMENTACIÃ“N DEL PROTOCOLO SECURE NEIGHBOR DISCOVERY (SEND).','El protocolo IPv6 define la interacciÃ³n entre los nodos que residen en un mismoenlace a travÃ©s del proceso de descubrimiento de vecinos (Neighbor Discovery). Losmensajes intercambiados durante este descubrimiento incluyen informaciÃ³nimportante acerca de la red y pueden dar lugar a diversos ataques quecomprometen el correcto funcionamiento de los nodos del enlace.En este Trabajo Especial de Grado se desarrollÃ³ una aplicaciÃ³n que permiteasegurar los mensajes enviados por los nodos durante el proceso dedescubrimiento de vecinos al utilizar el protocolo SEND. AdemÃ¡s, se desarrollÃ³ unaherramienta que permite generar y verificar direcciones CGA (CryptographicallyGenerated Addresses).El trabajo se realizÃ³ en base a las teorÃ­as sobre los protocolos y mecanismos deseguridad que garantizan la protecciÃ³n de los mensajes de Neighbor Discovery.Durante la implementaciÃ³n de la aplicaciÃ³n, se utilizÃ³ la metodologÃ­a de desarrollode software llamada enfoque en cascada que contempla las fases de: anÃ¡lisis,desarrollo, implementaciÃ³n y pruebas necesarias para comprobar el funcionamientode la aplicaciÃ³n SEND desarrollada.Es de hacer notar que el alcance de esta implementaciÃ³n de SEND sÃ³lo abarcÃ³ elintercambio de mensajes entre los hosts del enlace, es decir que no involucra eldescubrimiento de los routers que puedan estar presentes. Sin embargo, podrÃ¡servir como referente teÃ³rico a futuros trabajos en el Ã¡rea, en la cual puedan incluirel proceso de Router Discovery y otras funcionalidades que vayan surgiendo.Como producto final se incluyeron el cÃ³digo fuente, la documentaciÃ³n de laaplicaciÃ³n y el manual de usuario, necesarios para comprender el correctofuncionamiento de la aplicaciÃ³n SEND, asÃ­ como un virtual appliance que facilita laejecuciÃ³n de pruebas para un posterior anÃ¡lisis.','2008-11-05','IPv6, Neighbor Discovery, CriptografÃ­a, Firma Digital, Seguridad,CGA.',2,1,1,1,1,'2013-09-17 08:22:05','2013-09-17 08:22:05','Documento_41.pdf','application/pdf',6801724,'2013-09-17 08:22:05',19,0,105,'COMPLETO'),(42,'SISTEMA DE INFORMACIÃ“N PARA LA PLANIFICACIÃ“N DE PROYECTOS.','Este Trabajo Especial de Grado contempla el desarrollo de un Sistema de InformaciÃ³npara la PlanificaciÃ³n de Proyectos siguiendo el estÃ¡ndar de la guÃ­a del PMBOK (ProjectManagemet Body of Knowledge, GuÃ­a de Fundamentos de la DirecciÃ³n de Proyectos). Para llevar a cabo este desarrollo se utilizÃ³ el mÃ©todo de investigaciÃ³n de proyectofactible, el cual, en una de sus etapas, permite analizar y seleccionar las herramientas quese encuentran en el Ã¡rea de conocimiento de Alcance de la guÃ­a del PMBOK. El mÃ©todo dedesarrollo utilizado consiste en entrega por etapas, el cual facilita el anÃ¡lisis, diseÃ±o eimplementaciÃ³n del sistema propuesto. Se propuso un mÃ©todo de programaciÃ³n queconsiste en un estÃ¡ndar para organizar la estructura del cÃ³digo del sistema. Se analizan las herramientas y tÃ©cnicas correspondientes al Ã¡rea de Alcance paraseleccionar aquellas que se implementarÃ¡n en el sistema mencionado. Una vezseleccionadas se lleva a cabo la implementaciÃ³n de las mismas y las pruebas necesariaspara comprobar su correcto funcionamiento.','2008-10-17','PMBOK (ProjectManagemet Body of Knowledge, GuÃ­a de Fundamentos de la DirecciÃ³n de Proyectos).',2,1,1,1,1,'2013-09-17 08:22:08','2013-09-17 08:22:08','Documento_42.pdf','application/pdf',32079286,'2013-09-17 08:22:08',20,0,189,'COMPLETO'),(43,'Soporte DidÃ¡ctico para la enseÃ±anzadel uso del Navegador y el Correo ElectrÃ³nico','El objetivo general del Trabajo Especial de Grado fue diseÃ±ar ydesarrollar un Soporte DidÃ¡ctico para la enseÃ±anza del uso del Navegador y elCorreo ElectrÃ³nico (NaVEcO), que permitiera de una manera sencilla ydinÃ¡mica lograr que usuarios con pocos conocimientos de computaciÃ³naprendan la utilizaciÃ³n de estas herramientas informÃ¡ticas.NaVEcO en un principio surge como un proyecto cuyo dominio deaplicaciÃ³n es enseÃ±ar el uso del Navegador; sin embargo, se pudo agregar eltema del Correo ElectrÃ³nico, siendo asÃ­ una aplicaciÃ³n que impartaconocimientos de dos temas importantes para usuarios no expertos en el usode las de las tecnologÃ­as Internet.Para la implantaciÃ³n de NaVEcO, se utilizÃ³ el lenguaje de programaciÃ³nVisual Basic 6 para la elaboraciÃ³n de sistemas stand-alone (independientes,autÃ³nomos) y elaboraciÃ³n de instaladores (Wizards de instalaciÃ³n). TambiÃ©n seutilizÃ³ Macromedia Flash Mx 2004 para la creaciÃ³n de animaciones. En general,la conjunciÃ³n de herramientas de software permitiÃ³ desarrollar un soportedidÃ¡ctico con un alto grado de interactividad, permitiendo al usuario hacerpeticiones y que Ã©stas sean respondidas mediante interfaces amigables y defÃ¡cil uso.Se incorporÃ³ al Ciclo de Desarrollo de Software la definiciÃ³n de Patronesde InteracciÃ³n con el fin de obtener soluciones en el diseÃ±o de las interfaces deusuario de NaVEcO. Esto constituye un valioso aporte para otrosdesarrolladores que pudieran encontrarse en la necesidad de resolverproblemas similares.La soluciÃ³n que provee NaVEcO presenta ciertas limitaciones en cuantola lecciÃ³n prÃ¡ctica del Correo ElectrÃ³nico, ya que actualmente el Soporte paraesta lecciÃ³n es un enlace vÃ­a Web a un proveedor de cuentas de CorreoElectrÃ³nico; por lo tanto, se podrÃ­a pensar en incorporar una soluciÃ³n similar ala lecciÃ³n prÃ¡ctica del Navegador, simulando en una versiÃ³n un poco mÃ¡s bÃ¡sica, una interfaz con funcionalidades propias del Correo ElectrÃ³nico,dejÃ¡ndose Ã©sta como posible recomendaciÃ³n para actualizaciones futuras delSoporte DidÃ¡ctico.','2008-06-04','Soporte DidÃ¡ctico para la enseÃ±anzadel uso del Navegador y el Correo ElectrÃ³nico NaVEcO',2,1,1,1,1,'2013-09-17 08:22:10','2013-09-17 08:22:10','Documento_43.pdf','application/pdf',1540229,'2013-09-17 08:22:10',15,0,86,'COMPLETO'),(44,'SISTEMA DE AUTENTICACIÃ“N SIGILOSA CON TERMINAL DE ADMINISTRACIÃ“N.','El propÃ³sito de este trabajo es implementar un sistema de autenticaciÃ³nsigilosa basÃ¡ndose en la premisa de seguridad en profundidad (tambiÃ©n conocidacomo seguridad en capas). Dicha soluciÃ³n se basarÃ¡ en agregar una capa deautenticaciÃ³n sigilosa a los esquemas existentes, ya que de esta manera se puedereducir drÃ¡sticamente los riesgos a los cuales estÃ¡n expuestos los servidores.','2008-09-24','Seguridad, Capas',2,1,1,1,1,'2013-09-17 08:22:10','2013-09-17 08:22:10','Documento_44.pdf','application/pdf',1235412,'2013-09-17 08:22:10',20,0,83,'COMPLETO'),(45,'DESARROLLO DE UNA HERRAMIENTA PARA LA INTERPRETACIÃ“N SIMBÃ“LICA DE MÃQUINAS DE SOPORTE VECTORIAL ENTRENADAS.','Las mÃ¡quinas de soporte vectorial (SVM) son sistemas de aprendizaje diseÃ±adas sobre la teorÃ­a del aprendizaje estadÃ­stico (Vapnik, 1998), las cuales han demostrado poseer una buena capacidad de generalizaciÃ³n sobre datos reales. Sin embargo, ellas generan modelos caja negra, es decir, el conocimiento que adquieren durante el aprendizaje es difÃ­cil de interpretar desde el punto de vista del usuario. En este trabajo se presenta una herramienta para la interpretaciÃ³n simbÃ³lica de mÃ¡quinas de soporte vectorial entrenadas basada en al algoritmo TREPAN, el cual permite la extracciÃ³n de Ã¡rboles de decisiÃ³n a partir de estas mÃ¡quinas de aprendizaje. Las pruebas realizadas muestran que los Ã¡rboles de decisiÃ³n generados por la herramienta, poseen un alto grado de fidelidad con el modelo aprendido por la mÃ¡quina de soporte vectorial.','2008-10-28','mÃ¡quinas de soporte vectorial, extracciÃ³n de reglas, Ã¡rboles de decisiÃ³n, TREPAN.',2,1,1,1,1,'2013-09-17 08:22:11','2013-09-17 08:22:11','Documento_45.pdf','application/pdf',1184713,'2013-09-17 08:22:11',20,0,66,'COMPLETO'),(46,'HERRAMIENTA PARA LA EXTRACCIÃ“N AUTOMÃTICA DE CARACTERÃSTICAS MORFOLÃ“GICAS DE ESPERMATOZOIDES HUMANOS A PARTIR DE IMÃGENES.','El AnÃ¡lisis de LÃ­quido Seminal (ALS) o Espermograma es un procedimiento diagnÃ³stico importante para la salud ya que se constituye en un medio de evaluaciÃ³n de la fertilidad masculina. Por otra parte, permite estimar el funcionamiento de diferentes estructuras del aparato reproductivo, lo que resulta conveniente para dar seguimiento a intervenciones mÃ©dicas como la vasectomÃ­a, asÃ­ como otros chequeos pre y post operatorios.En el ALS se realizan dos grupos de pruebas (macroscÃ³picas y microscÃ³picas). La evaluaciÃ³n morfolÃ³gica es una subprueba microscÃ³pica que demanda altos costes en tÃ©rminos de pericia, tiempo y esfuerzo, ademÃ¡s de ser un procedimiento vulnerable a varias fuentes de error.A partir de la vigencia, utilidad e importancia de la evaluaciÃ³n morfolÃ³gica asÃ­ como de las dificultades asociadas a este examen, el propÃ³sito de esta investigaciÃ³n fue construir una herramienta que apoye al experto en la prueba. Para tal fin, se definiÃ³ un modelo de procesamiento de imÃ¡genes digitales microscÃ³picas del lÃ­quido seminal, que identifica y extrae las caracterÃ­sticas a los espermatozoides presentes en la escena.Luego del desarrollo y definiciÃ³n del modelo, se realizaron pruebas con una muestra de 89 imÃ¡genes tomadas en condiciones similares al ambiente de trabajo del experto. Los resultados indican una tasa de error de segmentaciÃ³n de 7,69% confundiendo elementos de las imÃ¡genes con espermatozoides, 6,69% de omisiones de espermatozoides presentes y 7,53% de error en la extracciÃ³n de caracterÃ­sticas producto de la identificaciÃ³n errÃ³nea de las estructuras del espermatozoide.El desarrollo del proyecto constituye un aporte que demuestra la factibilidad de desarrollar este tipo de tecnologÃ­as en el paÃ­s. Sin embargo, mostrÃ³ ser una actividad compleja, que debe ser llevada a cabo con precauciÃ³n, controlando las fuentes de error. Requiere de creatividad e innovaciÃ³n asÃ­ como del dominio de los aspectos tÃ©cnicos relacionados a la eficiencia en la ejecuciÃ³n de programas en el computador.','2008-10-29','MorfologÃ­a EspermÃ¡tica, Inteligencia Artificial, Procesamiento Digital de ImÃ¡genes.',2,1,1,1,1,'2013-09-17 08:22:13','2013-09-17 08:22:13','Documento_46.pdf','application/pdf',1516487,'2013-09-17 08:22:13',20,0,61,'COMPLETO'),(47,'EASY EXTRACTOR: UN SISTEMA DE CLASIFICACIÃ“N DE INFORMACIÃ“N DE LA WEB UTILIZANDO TÃ‰CNICAS DE EXTRACCIÃ“N DE DATOS.','La informaciÃ³n en la Web se encuentra en cambio constante y sujeta ala volatilidad de la red, por lo que una pÃ¡gina puede existir hoy pero nomaÃ±ana o encontrarla con un contenido distinto. De esta manera surge lanecesidad de extraer, almacenar y clasificar informaciÃ³n que el usuarioconsidere importante en la Web. En la actualidad existen algunasherramientas que han solucionado dicha problemÃ¡tica, entre las cualesmencionamos Solvent y Google Bloc de notas. Sin embargo pueden nosatisfacer las necesidades de algunos usuarios. El sistema Easy Extractor, se crea como una herramienta distinta queno sÃ³lo engloba funcionalidades de otras aplicaciones, sino que ofrece nuevasposibilidades a los usuarios. En el proceso de desarrollo de esta aplicaciÃ³n serealizÃ³ una adaptaciÃ³n de la metodologÃ­a eXtreme Programming (XP). Dentrode las cualidades con las que cuenta este sistema son: compartir informaciÃ³ncon otros usuarios, exportar la informaciÃ³n a formato PDF para sualmacenaje local, intercambiar comentarios e ideas con otros usuarios,demarcado y almacenaje de informaciÃ³n e imÃ¡genes para su posteriorrecuperaciÃ³n, entre otras.','2008-10-23','Mozilla, XUL, WEB, AplicaciÃ³n, Servicios Web.',2,1,1,1,1,'2013-09-17 08:22:14','2013-09-17 08:22:14','Documento_47.pdf','application/pdf',0,'2013-09-17 08:22:14',20,0,0,'INCOMPLETO'),(48,'INSTANCIACIÃ“N DE UNA SOLUCIÃ“N ERP CÃ“DIGO ABIERTO PARA EL SECTOR SALUD- AMBULATORIO.','En este trabajo se presenta para el sector salud ambulatorio la adaptaciÃ³n de un sistema Enterprise Resource Planning (ERP) porque se crea una plataforma integrada de toda la organizaciÃ³n para coordinar los procesos internos clave de la empresa. Se decidiÃ³ adaptar un ERP para integrar los procesos del ambulatorio en un solo sistema de software y que esa informaciÃ³n pueda fluir a travÃ©s de la organizaciÃ³n mejorando la coordinaciÃ³n, eficiencia y toma de decisiones. Los ERP pueden ayudar a crear una organizaciÃ³n mÃ¡s uniforme en la que todo el mundo utilice procesos e informaciÃ³n similares y evalÃºe su trabajo en tÃ©rminos de estÃ¡ndares de desempeÃ±o de toda la organizaciÃ³n. Los ERP son muy difÃ­ciles de implementar con Ã©xito. Requieren un cambio organizacional extenso, el uso de tecnologÃ­as complicadas precisa altos costos iniciales para obtener beneficios a largo plazo difÃ­ciles de cuantificar pero una vez implementados, es muy difÃ­cil cambiar los sistemas empresariales. (Laudon y Laudon, 2001).La digitalizaciÃ³n de la historia clÃ­nica (HC) se ha convertido durante los Ãºltimos aÃ±os en el objetivo de la mayor parte de los trabajos de la InformÃ¡tica MÃ©dica. La sustituciÃ³n de la HC tradicional en soporte de papel, por una historia clÃ­nica digital (HCD), responde a las necesidades de resolver los dos problemas clÃ¡sicos de los archivos de HC, como lo son en primer lugar el crecimiento continuo del volumen almacenado, que llega a crear graves problemas de espacio fÃ­sico, y el inevitable trasiego de documentos originales, con riesgo de pÃ©rdida y de su deterioro, y en segundo lugar permitir la transferencia rÃ¡pida de la informaciÃ³n clÃ­nica existente de un paciente a puntos lejanos, unificando asÃ­ de hecho la HC por encima de los lÃ­mites de las instituciones asistenciales. AdemÃ¡s este trabajo sirve para poner a disposiciÃ³n de los investigadores y de los planificadores sanitarios esta informaciÃ³n clÃ­nica, de forma fÃ¡cilmente accesible y tratable.','2008-10-28','Historia ClÃ­nica Digital, ERP (Enterprise Resource Planning), Software Libre.',2,1,1,1,1,'2013-09-17 08:22:15','2013-09-17 08:22:15','Documento_48.pdf','application/pdf',2302726,'2013-09-17 08:22:15',17,0,105,'COMPLETO'),(49,'DISEÃ‘O Y DESARROLLO DE UNA NUEVA APLICACIÃ“N WEB PARA LA ESCUELA DE COMPUTACIÃ“N DE LA UNIVERSIDAD CENTRAL DE VENEZUELA CON TECNOLOGÃA RUBY ON RAILS.','Este trabajo de la Facultad de Ciencias de la Universidad Central de Venezuela tiene como objetivo eldesarrollo de una aplicaciÃ³n Web para la Escuela de ComputaciÃ³n que sirva como medio de difusiÃ³n deinformaciÃ³n institucional, acadÃ©mica y de investigaciÃ³n, accesible y de fÃ¡cil navegaciÃ³n, usandoestÃ¡ndares de diseÃ±o Web actuales y que cuente con funcionalidades que faciliten la actualizaciÃ³n de sucontenido. Debido a la naturaleza de la aplicaciÃ³n, donde unas funcionalidades deben ser del dominiopÃºblico y otras sÃ³lo disponibles para usuarios autorizados, se sugierieron dos subsistemas denominados:subsistema pÃºblico y subsistema administrativo.Para llevar a cabo este objetivo se aplicaron herramientas y tecnologÃ­as de desarrollo Web tal como Rubyon Rails, Hojas de estilo en cascada, Lenguaje Extensible de Marcado de Hipertexto, en el caso de lasfuncionalidades se uso la metodologÃ­a de desarrollo Proceso Unificado Ãgil adaptada a las necesidadesde la aplicaciÃ³n, y para el diseÃ±o se siguieron aquellos estÃ¡ndares actuales de diseÃ±o Web, lineamientosde usabilidad y patrones de interacciÃ³n, considerados mÃ¡s importantes.','2008-10-17','UCV, Escuela de ComputaciÃ³n, AplicaciÃ³n Web, tecnologÃ­as de desarrollo Web, Rubyon Rails, Modelado Ã¡gil. MetodologÃ­a de desarrollo AUP, estÃ¡ndares de diseÃ±o Web, usabilidad, patronesde interacciÃ