una forma integrada, a fin de: Mejorar la productividad de los usuarios de laorganizaciÃ³n, controlar y monitorizar los procesos de servicio, optimizar el uso delos recursos disponibles, reducir el impacto de las incidencias sobre laorganizaciÃ³n, detectar las condiciones de la red organizativa de datos, detectarproblemas de flujo y conectividad de datos por malos diseÃ±os de la red, entreotros.Los resultados obtenidos al realizar las pruebas del Sistema muestran el impactofavorable sobre la organizaciÃ³n, basado en la reducciÃ³n de los tiempos derespuesta en la soluciÃ³n de las incidencias, en un 34,55%, el aumento en laproductividad del personal del departamento de atenciÃ³n de usuarios y eficienciaen la gestiÃ³n de activos.Con este Trabajo Especial de Grado se deja ver la manera en que es posibleintegrar un conjunto de herramientas basadas en Software Libre, enfocadas enautomatizar la gestiÃ³n de solicitudes en tecnologÃ­as de informaciÃ³n, permitiendouna adecuada gestiÃ³n de incidencias e inventario de activos y dispositivosconectados a la red. AdemÃ¡s, es novedoso, orientado al Web, seguro y robusto,gracias a que ofrece un diseÃ±o completamente modular, si la operaciÃ³n de unmÃ³dulo falla el Sistema no deja de funcionar. EstÃ¡ pensado para ser escalable yfÃ¡cil de adaptar, pese a ser una soluciÃ³n pensada para la empresa Ingedigit C.A.,puede correr bajo cualquier ambiente, sin importar las dimensiones de la red, lacantidad de dispositivos conectados a ella y la dinÃ¡mica de la organizacÃ³n.','2008-10-23','SISTEMA AUTOMATIZADO PARA LA GESTIÃ“N DE SOLICITUDES EN TECNOLOGIAS DE INFORMACIÃ“N',2,1,1,1,1,'2013-09-17 08:22:35','2013-09-17 08:22:35','Documento_61.pdf','application/pdf',0,'2013-09-17 08:22:35',20,0,0,'INCOMPLETO'),(62,'DISEÃ‘O Y DESARROLLO DE PLATAFORMA INTEGRADA GSM-SMPP PARA LA ADMINISTRACIÃ“N DE MENSAJES DE TEXTO SMS Y PUBLICACIÃ“N Web.','El objetivo del presente Trabajo Especial de Grado consiste en la implementaciÃ³nde una plataforma capaz de proveer, a empresas que prestan servicios de valor agregadomediante la mensajerÃ­a corta de texto, el control de todos sus envÃ­os, asÃ­ como lasrespectivas respuestas de los mismos, ademÃ¡s de ser configurable para cualquier tipo deoperadora, no sÃ³lo a nivel nacional sino tambiÃ©n internacional. Este desarrollo fuemotivado por la necesidad de la empresa ALS Comunicaciones, quiÃ©n presta este tipo deservicios, con el fin de ampliar su plataforma y poder brindar un mejorar servicio a susclientes; haciendo uso de las especificaciones del protocolo estÃ¡ndar de clase mundialSMPP (Short Message Peer-to-Peer), la implementaciÃ³n fue llevada a cabo en lenguajeJava y como manejador de base de datos MySQL.','2008-10-21','SMPP, Short Message Peer to Peer, SMS, Short Messaging System, MensajerÃ­a de texto.',2,1,1,1,1,'2013-09-17 08:22:36','2013-09-17 08:22:36','Documento_62.pdf','application/pdf',2671616,'2013-09-17 08:22:36',19,0,0,'INCOMPLETO'),(63,'CÃ¡lculo de la CohomologÃ­a de De Rham de los Espacios Proyectivos por medio de la SucesiÃ³n de Gysin','El objetivo central del trabajo es calcular la CohomologÃ­a de De Rham de los Espacios Proyectivos Complejos a travÃ©s de una herramienta de la topologÃ­a algebrÃ¡ica conocida como la SucesiÃ³n de Gysin. En la primera parte se introducen los conceptos bÃ¡sicos previos como: variedades diferenciables, aplicaciones diferenciables, particiones de la unidad diferenciables, fibrados, fibrado tangente, fibrado de formas, k-formas diferenciables, integraciÃ³n de formas.Luego se define la CohomologÃ­a de De Rham y los principales resultados algebrÃ¡icos conocidos de esta teorÃ­a como: el lema de los cinco, lema de la serpiente, sucesiÃ³n de Mayer-Vietoris, cohomologÃ­a de De Rham de la Esfera Unitaria. Finalmente se construye la SucesiÃ³n de Gysin, estudiando en detalle sus operadores y se aplica a los espacios proyectivos complejos para calcular su cohomologÃ­a.','2009-04-28','CohomologÃ­a de De Rham. SucesiÃ³n de Gysin. Espacio Proyectivo Complejo.',5,1,1,1,1,'2013-09-17 08:22:37','2013-09-17 08:22:37','Documento_63.pdf','application/pdf',5380428,'2013-09-17 08:22:37',20,0,156,'COMPLETO'),(64,'EVALUACIÃ“N DE FRAMEWORKS WEB USANDO TÃ‰CNICAS DE MEDICIÃ“N DE RENDIMIENTO Y MÃ‰TRICAS DE SOFTWARE APLICADAS SOBRE COMPONENTES DEL MÃ“DULO DE ADMINISTRACIÃ“N DEL SERVICIO COMUNITARIO. CASO DE ESTUDIO: JAVA SERVER FACES Y STRUTS 2','Este trabajo abarca los siguientes tÃ³picos: frameworks, mÃ©tricas de software y de rendimiento, y asÃ­ como los pasos o estrategias llevadas a cabo para implementar un conjunto de herramientas que permitan evaluar componentes de software. Los componentes evaluados forman parte del MÃ³dulo de AdministraciÃ³n de InformaciÃ³n del Servicio Comunitario de la Facultad de Ciencias, la cual se desarrollÃ³, en el mismo tenor, en los frameworks Java estudiados en Ã©ste trabajo: Java Server Faces (JSF) y Struts 2. Se tomÃ³ especial consideraciÃ³n que incluyeran las mismas funcionalidades y se desarrollaran usando la misma lÃ³gica de programaciÃ³n. Todo esto con la finalidad de dar respuesta a las siguientes preguntas Â¿quÃ© framework es mÃ¡s eficaz o ventajoso, cuando se implementa una aplicaciÃ³n relacionadas con entornos Web de Java? En nuestro trabajo se tomÃ³ en cuenta el framework Struts 2, el cual posee un controlador que viene inserto como un Servlet interno de Struts 2, este Ãºltimo se usÃ³ para dirigir la relaciÃ³n existente entre las acciones, la interfaz y los Beans con la finalidad de trabajar la lÃ³gica de negocio; simultÃ¡neamente las etiquetas de Struts ayudaron a construir la vista y las interfaces en conjunciÃ³n con la tecnologÃ­a Ajax. Otro framework considerado es Java Server Faces, el cual se usÃ³ de manera anÃ¡loga al anterior, para ejecutar la lÃ³gica de negocio o acciones del mismo modelo y en el que se contemplaron la interfaz grÃ¡fica de usuario, los eventos y sus componentes como si fuesen una aplicaciÃ³n web estÃ¡ndar para diseÃ±ar las diferentes interfaces o vistas que luego son mostradas al usuario. Luego se describe en detalle el subconjunto de mÃ©tricas seleccionadas, el ambiente y estrategias para realizar la mediciÃ³n y las pruebas de rendimiento y el analisis, diseÃ±o e implementaciÃ³n de los componentes de la herramienta Web, de nuestra propia autorÃ­a, para el Servicio Comunitario La evaluaciÃ³n se realizÃ³ de dos maneras. Las mÃ©tricas de software se calcularon por medio de un agregado de software instalado sobre el entorno de desarrollo Eclipse, Metrics 1.3.6, que permitiÃ³ al usuario exportar los datos obtenidos en un archivo de texto para su posterior procesamiento y visualizaciÃ³n. Las mÃ©tricas de rendimiento fueron obtenidas mediante la herramienta Httperf v9, para plataformas Linux, la cual sometiÃ³ a stress a los componentes seleccionados como caso de estudio y arrojÃ³ una serie de resultados sobre el rendimiento. Finalmente los resultados capturados son mostrados en una herramienta, llamada Visor, que permite visualizar de manera grÃ¡fica los valores de las mÃ©tricas previamente obtenidas.','2009-04-27','MÃ‰TRICAS STRUTS2 JAVA SERVER FACES SERVICIO COMUNITARIO',2,1,1,1,1,'2013-09-17 08:22:41','2013-09-17 08:22:41','Documento_64.pdf','application/pdf',3095908,'2013-09-17 08:22:41',20,0,110,'COMPLETO'),(65,'TetraedrizaciÃ³n de Intervalos de Volumen mediante modificaciÃ³n de Cubos Marchantes.','Los dos mÃ©todos principales para la visualizaciÃ³n de datos volumÃ©tricos consisten en la visualizaciÃ³n directa de volÃºmenes y la extracciÃ³n de isosuperficies. El primer mÃ©todo ofrece la ventaja de mostrar todo el volumen en contexto, mientras que el segundo mÃ©todo sÃ³lo muestra una parte del volumen fuera de contexto. Sin embargo, la extracciÃ³n de isosuperficies requiere menos poder de cÃ³mputo en comparaciÃ³n con la visualizaciÃ³n directa de volumen. Otro mÃ©todo para la visualizaciÃ³n de datos volumÃ©tricos consiste en un hÃ­brido entre ambas tÃ©cnicas, el cual reconstruye y muestra subvolÃºmenes del volumen mediante el uso de mallados tetraÃ©dricos y tÃ©cnicas de visualizaciÃ³n directa de volÃºmenes para el despliegue. Adicionalmente, se puede almacenar el isovalor en cada vÃ©rtice del mallado obtenido, lo que permite el uso de dichos mallados para realizar simulaciones mediante el uso de elementos finitos. En la actualidad, los algoritmos existentes para la extracciÃ³n de intervalos de volumen son complicados o generan una alta cantidad de primitivas. En este trabajo se propone un algoritmo basado en la adaptaciÃ³n de cubos marchantes para extraer intervalos de volumen en lugar de isosuperficies, el cual tiene un tiempo de respuesta inferior a los algoritmos existentes y genera un mallado final con una menor cantidad de primitivas sin necesidad de recurrir a algoritmos complejos durante la extracciÃ³n del intervalo de cada celda del volumen.','2009-04-27','Datos VolumÃƒÂ©tricos, Isosuperficies, Intervalos de Volumen',2,1,1,1,1,'2013-09-17 08:22:42','2013-09-17 08:22:42','Documento_65.pdf','application/pdf',0,'2013-09-17 08:22:42',20,0,0,'INCOMPLETO'),(66,'PreparaciÃ³n y caracterizaciÃ³n preliminar de una muestra compuesta representativa de la Cuenca de FalcÃ³n, Venezuela','En la mayorÃ­a de los anÃ¡lisis geoquÃ­micos y geolÃ³gicos, es necesaria la presencia de una muestra que sirva de referencia y validaciÃ³n para los estudios realizados. En GeoquÃ­mica estas muestras son conocidas como materiales de referencia, siendo los mÃ¡s comunes: \"North American Shale Composite\" y \"Post Arquean Australian Shale\"((Asiedu,, 22000000)). A pesar que estas muestras han dado buenos resultados, como en todo anÃ¡lisis quÃ­mico lo que se busca es la mayor cercanÃ­a entre la muestra de referencia a utilizar y el objeto de estudio, por lo que no constituyen una comparaciÃ³n idÃ³nea, pues corresponden a Ã¡mbitos geolÃ³gicos y geoquÃ­micos, diferentes al venezolano ((Gromet,, L..,,11998844)). Por tanto serÃ­a mejor si se contara con un material de referencias con caracterÃ­sticas geolÃ³gica y geoquÃ­micas venezolanas, problema a travÃ©s del cual surge el objetivo principal de este trabajo y que se encuentra delimitado como la elaboraciÃ³n y caracterizaciÃ³n preliminar de un material de referencia, hasta ahora intralaboratorio, a partir de muestras de arcillitas de la Cuenca Central de FalcÃ³n, para su uso en futuros anÃ¡lisis geoquÃ­micos en Venezuela, con una connotaciÃ³n geolÃ³gica que la favorece.Para ello, fueron colectadas las rocas arcillitas de las unidades sedimentarias oligo-miocÃ©nicas, de la Cuenca de FalcÃ³n y fueron pulverizadas, tamizadas (malla 220 (65Âµm)); y homogenizadas por un proceso de cuarteo para llegar a lo que serÃ¡ la Muestra Compuesta de Arcillitas de FalcÃ³n (MCAF), con aproximadamente 22 kilos de material disponible para su anÃ¡lisis.Dicho anÃ¡lisis fue realizado segÃºn los criterios establecidos por institutos especializados en la certificaciÃ³n de materiales de referencia ((Kane,, 11999977)): Homogeneidad y Trazabilidad, especÃ­ficamente homogeneidad para este estudio, separada en homogeneidad fÃ­sica y quÃ­mica ((Bernal et al.. 22000044)) y cuyos valores propuestos son los que siguen a continuaciÃ³n: para la homogeneidad fÃ­sica fue determinada la distribuciÃ³n granulomÃ©trica de la muestra mediante el mÃ©todo del pipeteo (Galehouse,, 11997711en Carver,, 11997711), para lo cual se obtiene que 89 %Â±20% en peso de la muestra se encuentra entre 62,5-7,8 Âµm (limo grueso a limo fino). La homogeneidad quÃ­mica esta representada en funciÃ³n de cada uno de los anÃ¡lisis realizados a la muestra, para esta ocasiÃ³n: Humedad (H2O+) (Potts,, 22000055) con un valor del 3,05%Â±0,08%, pÃ©rdida al rojo con un 10,3 Â±0,2% y fÃ³sforo en base seca (P2O5) de 0,16% Â± 0,01%.Todos los valores reportados han sido evaluados mediante las pruebas estadÃ­sticas Shapiro-Wilks, F de una cola y Kolmogorov-Smirnov ((Davis,, 11997733)), para un intervalo de confianza del 99%, lo que permite decir que la muestra MCAF es fÃ­sicamente homogÃ©nea y quÃ­micamente homogenea para los atributos analizados, y por tanto puede ser utilizado como un material de referencia intralaboratorio para anÃ¡lisis geoquÃ­micos futuros.','2009-02-17','muestra compuesta, cuenca de falcÃ³n, material de referencia, arcillitas',4,1,1,1,1,'2013-09-17 08:22:43','2013-09-17 08:22:43','Documento_66.pdf','application/pdf',1984896,'2013-09-17 08:22:43',20,0,127,'COMPLETO'),(67,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((IV)) Y METIONINA POR MEDIO DE MEDIDAS DE EMF((H)) ((KCl 33..00M,, 2255 Â°Â°C))','Se estudiÃ³ el sistema H+ - V(IV) - metionina (HC) por medio de medidas de emf(H) en KCl 3.0 M a 25 Â°C. El anÃ¡lisis de los datos empleando el programa computacional de mÃ­nimos cuadrados generalizados LETAGROP indica la formaciÃ³n de las especies [HVOC]2+, [VOC]+, [H2VOC2]2+ y VOC2, cuyas constantes de estabilidad fueron determinadas.','2009-04-15','FormaciÃ³n de complejos, metionina, Vanadio (IV), medidas de emf(H), quÃ­mica de coordinaciÃ³n',6,1,1,1,1,'2013-09-17 08:22:46','2013-09-17 08:22:46','Documento_67.pdf','application/pdf',7296088,'2013-09-17 08:22:46',20,0,137,'COMPLETO'),(68,'Estudio de los complejos de Vanadio ((V)) con la Valina,, empleando medidas de fuerzas electromotrices ((2255 Â°Â°C,, KCl 33..00 M))','En el presente trabajo se estudiaron los sistemas:H+ - valina (HC) H+ - VO2+ - HCmediante medidas de fuerzas electromotrices emf(H) a 25ÂºC y en KCl 3.0 M como medio iÃ³nico inerte.El anÃ¡lisis de los datos experimentales de cada sistema se realizÃ³ mediante el programa de mÃ­nimos cuadrados LETAGROP, obteniÃ©ndose los siguientes valores de pKa para la valina y las constantes de estabilidad bPqrde los complejos (P, q, r), segÃºn las siguientes reacciones generales: Sistema H++ -- valina ReacciÃ³Ã³nnlogbp00rHC + H+ DH2C+2.71(4)HCD C- + H+-9.97(5)s (thc)0.042ReacciÃ³Ã³nnpKaHC + H+ DH2C+2.71(4)HCD C- + H+9.97(5) Sistema H++ -- VO22++ -- valinapH+ + q VO2++ r C- D Hp ( VO2)q (C)rq-r+p Especiebp,,q,,rLog bp,,q,,r [HVO2C] +1,1,111.7(3)11.8(2)11.8(2)11.8(3)VO2C0,1,110.23(3)10.26(4)10.30 (4)10.31(4)thB 0.036 thC 0.019 thBf 0.054 thCf 0.11','2009-04-23','VanadioAminoacidoComplejosValina',6,1,1,1,1,'2013-09-17 08:22:49','2013-09-17 08:22:49','Documento_68.pdf','application/pdf',0,'2013-09-17 08:22:49',18,0,0,'INCOMPLETO'),(69,'AnÃ¡Ã¡lisis de biomarcadores en intervalos lutÃ­Ã­ticos del nÃºÃºccleo QG--2299S de edad Terciaria,, DE LA Cuenca Oriental de Venezuela','RESUMENEl presente estudio correspondiÃ³ al anÃ¡lisis de biomarcadores en muestras pertenecientes a la Cuenca Oriental de Venezuela, especÃ­ficamente el pozo QG-29S, entre las profundidades 3761,9 a 3794,5 metros (12343 a 12449 pies), ya que Ã©stas poseÃ­an la concentraciÃ³n de carbono orgÃ¡nico total (COT) necesario para ser consideradas como posibles rocas fuente (>2%). Por lo tanto se realizÃ³ este estudio para determinar otros factores necesarios para que una roca pueda generar hidrocarburos, como lo son el tipo de materia orgÃ¡nica y la etapa de madurez que ha alcanzado dicha roca. De esta manera se realizÃ³ la extracciÃ³n del bitumen; posteriormente se separaron las distintas fracciones por el mÃ©todo de separaciÃ³n SARA y por Ãºltimo se llevÃ³ a cabo el anÃ¡lisis de biomarcadores y marcadores aromÃ¡ticos por medio del anÃ¡lisis de CG-EM. Las muestras estudiadas pueden ser divididas en dos grupos, en funciÃ³n de su litologÃ­a; teniendo asÃ­ 4 lutitas (7,21,22,23,27) y 2 areniscas intercalas con lutitas (13 y 17). Los resultados obtenidos indican que el tipo de materia orgÃ¡nica presente en todas las muestras es del tipo transicional con mayor aporte marino, por lo que se tiene un querÃ³geno tipo II en Ã©stas. Mientras que la materia orgÃ¡nica presente en las areniscas intercalas con lutitas es el producto tanto del bitumen presente en las fracciones lutÃ­ticas como, de la materia orgÃ¡nica soluble (MOS) acumulada en las fracciones arenosas, producto de la migraciÃ³n del bitumen. En cuanto a las condiciones paleoambientales de sedimentaciÃ³n en la mayoria de las muestras analizadas se infiere que fueron entre subÃ³xicas a disÃ³xicas, excepto por una muestra donde las condiciones fueron mÃ¡s reductoras (21). Por Ãºltimo el grado de madurez en que se encuentran las muestras corresponde a etapas temprana de catagÃ©nesis, donde hay generaciÃ³n de hidrocarburos pero en muy baja proporciÃ³n (Ro 0,7-0.8%). En funciÃ³n de lo mencionado se concluye que los intervalos lutÃ­ticos estudiados poseen tanto la cantidad necesaria de carbono orgÃ¡nico, como el tipo de materia orgÃ¡nica y la madurez necesaria para ser considerados como rocas fuente del petrÃ³leo que se encuentra activas. Mientras que las areniscas tienen la capacidad de acumular los hidrocarburos generados por los intervalos lutÃ­ticos.','2009-02-17','Biomarcadores, Rocas fuente, Rocas madre, terciario, Cuenca Oriental',4,1,1,1,1,'2013-09-17 08:22:50','2013-09-17 08:22:50','Documento_69.pdf','application/pdf',2962074,'2013-09-17 08:22:50',17,0,136,'COMPLETO'),(70,'Estudio del contenido de elementos traza en cabello y orina de niÃ±os con SÃ­ndrome de Espectro Autista.','Se determinÃ³ la concentraciÃ³n de elementos traza (Zn, Cu, Cr, Se, Pb, Cd y Hg) en muestras de cabello y orina de niÃ±os con SÃ­ndrome de Espectro Autista, con edades comprendidas entre 2 y 15 aÃ±os, pertenecientes al Centro Integral para la EstimulaciÃ³n Cognitiva y Comunicativa (CIPECC). Previo al anÃ¡lisis de las muestras, se optimizÃ³ la concentraciÃ³n del agente reductor (NaBH4) y la influencia de diferentes Ã¡cidos transportadores (HNO3 Ã³ HCl), para la determinaciÃ³n de Hg total por CV-AAS. Los resultados obtenidos arrojaron que la concentraciÃ³n Ã³ptima de reductor fue 0,2% p/v de NaBH4 y que el empleo de HCl como Ã¡cido transportador produce un aumento en la sensibilidad de la tÃ©cnica. TambiÃ©n se optimizaron los tiempos de lavado de las muestras de cabello con acetona y EDTA para la determinaciÃ³n de Cd y Hg, obteniÃ©ndose finalmente, porcentajes de remociÃ³n de aproximadamente 76% y 82% para Cd y Hg, respectivamente. Por tal motivo, los datos que deriven del anÃ¡lisis de estos elementos en cabello, incluirÃ¡n un error adicional que dependerÃ¡n de la exposiciÃ³n del individuo a estos metales. Asimismo, se estudiaron posibles problemas de adsorciÃ³n de Hg al utilizar material de plÃ¡stico para el anÃ¡lisis de cabello, encontrÃ¡ndose que Ã©stos no adsorben mercurio y pueden ser utilizados de manera confiable. En total se analizaron 29 muestras de orina y 31 muestras de cabello de niÃ±os autistas. La determinaciÃ³n de los elementos Zn, Cu, Cr, Se, Pb y Cd, se realizÃ³ mediante espectrometrÃ­a de emisiÃ³n atÃ³mica con plasma inductivamente acoplado (ICP-OES) y la concentraciÃ³n de Hg total fue determinada por espectrometrÃ­a de absorciÃ³n atÃ³mica con generaciÃ³n de vapor frÃ­o (CV-AAS). Las metodologÃ­as de anÃ¡lisis empleadas fueron validadas empleando para algunos elementos el factor de recuperaciÃ³n, partiendo de estÃ¡ndares puros de cada elemento, y para otros se utilizÃ³ material certificado apropiado. Los datos obtenidos fueron tratados empleando el paquete Statgraphic version 5.0 para Windows. Para las muestras de orina, las concentraciones de Zn y Cr en niÃ±os de Espectro Autista mostraron niveles de normales a bajos, para Cu y Se, las medianas presentaron niveles normales. Metales tÃ³xicos como Pb, Cd y Hg, se mantuvieron siempre por debajo de los valores umbrales. Se comparÃ³ la carga metÃ¡lica, liberadas por vÃ­a urinaria, del grupo autista con la poblaciÃ³n control, encontrÃ¡ndose que existe cierta tendencia por parte de los primeros a excretar cantidades menores de Zn, Cr y Se. En el caso del Hg, la tendencia es inversa, los niÃ±os sanos lo liberan en mayores proporciones, ademÃ¡s, en niÃ±os autistas se observÃ³ que la liberaciÃ³n de Hg aumenta a medida que disminuye la severidad del SÃ­ndrome. Se hallaron ademÃ¡s, correlaciones positivas para la excreciÃ³n de metales en orina, entre ellas: Pb-Se, Pb-Zn, Hg-Zn, Cu-Zn, Cu-Se y Cu-Pb; que pueden estar indicando la existencia de procesos metabÃ³licos o enzimÃ¡ticos afectados en el organismo de niÃ±os con autismo, capaces de generar dÃ©ficits de Zn y retenciÃ³n de Hg. AsÃ­ como tambiÃ©n, indicios de que el Se presenta una funciÃ³n protectora hacia elementos como Cu y Pb que puede estar favoreciendo la formaciÃ³n de complejos Se-Pb y Se-Cu que no son excretados por el cuerpo, generando asÃ­ una menor liberaciÃ³n de Pb por parte de niÃ±os de Espectro Autista. Los resultados obtenidos por el anÃ¡lisis de orina, concuerdan con teorÃ­as propuestas en estudios previos, que asocian la menor excreciÃ³n de Hg y Pb en niÃ±os de Espectro autista a dos posibles causas, afecciones en proteÃ­nas encargadas de la detoxificaciÃ³n del organismo y la capacidad del Se para formar complejos con Cu, Pb y/o Hg. En el caso del cabello, la informaciÃ³n adquirida fue muy limitada, observÃ¡ndose niveles relativamente normales para todos los elementos analizados.','2009-04-22','Autismo, metales, cabello, orina',6,1,1,1,1,'2013-09-17 08:22:51','2013-09-17 08:22:51','Documento_70.pdf','application/pdf',0,'2013-09-17 08:22:51',20,0,0,'INCOMPLETO'),(71,'AnÃ¡lisis y algoritmos para el tratamiento de datos de olas.','{}','2009-04-28','MATLAB, WAFO, OLAS, ALGORITMOS, CDIP.',5,1,1,1,1,'2013-09-17 08:22:53','2013-09-17 08:22:53','Documento_71.pdf','application/pdf',2278169,'2013-09-17 08:22:53',20,0,118,'COMPLETO'),(72,'DeterminaciÃ³n de torio y uranio por espectrometrÃ­a gamma en minerales pesados de sedimentos del rÃ­o Arizo, estado BolÃ­var, Venezuela','{}','2009-04-28','{}',4,1,1,1,1,'2013-09-17 08:22:55','2013-09-17 08:22:55','Documento_72.pdf','application/pdf',0,'2013-09-17 08:22:55',20,0,0,'INCOMPLETO'),(73,'ESTUDIO DE LA GENERACIÃ“Ã“NN DE COLOR CARAMELO EN SISTEMAS GLUCOSA--FRUCTOSA Y AMONÃÃAACO','El color caramelo es un colorante aplicable en bebidas malteadas. El objetivo de este proyecto es el estudio de los factores que afectan la formaciÃ³n de color tales como