ara 15ÂºC aumentados a condiciones de pH 10,65Â±0,07 se obtuvo una intensidad de color 3 veces mayor y para condiciones de pH 7,06Â±0,08 y 5,06Â±0,05 se obtuvo una intensidad de color 4 veces mayor. Una mayor temperatura bajo las condiciones de estudio conlleva a una Vawm entre 2 y 3 veces mayor. A condiciones de pH 7,06Â±0,08 y 5,06Â±0,05 el consumo de nitrÃ³geno es incompleto. La formaciÃ³n de HMF se favorece a pHs bajos. La formaciÃ³n de 4-metilImidazol se favorece a condiciones de pH bÃ¡sico. El compuesto 4-metilimidazol se produce en las primeras horas de reacciÃ³n hasta llegar a un mÃ¡ximo luego del cual comienza a consumirse y disminuye en el tiempo. Los pesos moleculares tienen un rango de 10.000 y 75.000Da, el compuesto furfural es mayoritario a pHs menores, mientras que compuesto como Ã¡c. acÃ©tico, 1-hidroxi-acetona y el 2-acetil furano, aumentan con el pH, el 2-metil-benzofurano disminuye.','2009-04-21','Color caramelo, reacciÃ³n de Maillard, caramelizaciÃ³n',6,1,1,1,1,'2013-09-17 08:22:56','2013-09-17 08:22:56','Documento_73.pdf','application/pdf',933863,'2013-09-17 08:22:56',19,0,90,'COMPLETO'),(74,'DISEÃ‘Ã‘OO DE UNA METODOLOGÃÃAA DE DETERMINACIÃ“Ã“NN DE LA CLOROFILA ``AÂ´Â´Â´Â´ EN MUESTRAS DE AGUA,, MEDIANTE LA TÃ‰Ã‰CCNICA DE EXTRACCIÃ“Ã“NN EN FASE SÃ“Ã“LLIDA Y FLUORESCENCIA MOLECULAR','En el siguiente estudio, se realizÃ³ una evaluaciÃ³n preliminar en la aplicaciÃ³n de la tÃ©cnica de extracciÃ³n en fase sÃ³lida (SPE) y la fluorescencia molecular para la determinaciÃ³n de clorofila ``aÂ´Â´ en muestras de agua, en la bÃºsqueda de una metodologÃ­a alterna a la empleada rutinariamente. En una primera fase del estudio, se ensamblÃ³ un prototipo de analizador de fluorescencia molecular con los siguientes componentes: un diodo de emisiÃ³n de luz (LED) de longitud de onda de 410 nm, como fuente de excitaciÃ³n, un espejo cÃ³ncavo, una cubeta rectangular de vidrio de 1 cm de camino Ã³ptico, como contenedor de muestra y un fibra Ã³ptica multimodo para colecta