yuden de manera versÃ¡til y eficaz en la construcciÃ³n de esta aplicaciÃ³n. Adicionalmente, se quiere que esta aplicaciÃ³n tenga una interacciÃ³n con el usuario de la forma mas fluida posible, para ello se utilizaron elementos de Aplicaciones Web Enriquecidas mÃ¡s especÃ­ficamente el enfoque AJAX y todas las bondades que este ofrece.','2009-04-27','AJAX, Sistema, Web, GestiÃ³n Escolar, CEAPUCV',2,1,1,1,1,'2013-09-17 08:22:58','2013-09-17 08:22:58','Documento_75.pdf','application/pdf',437309,'2013-09-17 08:22:58',18,0,75,'COMPLETO'),(76,'Estudio de la transferencia de energÃ­a entre nanopartÃ­culas de oro generadas por ablaciÃ³n lÃ¡ser y molÃ©culas fluorÃ³foras','Las nanopartÃ­culas de oro poseen propiedades Ãºnicas que han motivado el desarrollo de numerosos estudios que buscan implementar su uso para lograr mejoras en la detecciÃ³n de un gran nÃºmero de enfermedades, cÃ©lulas cancerÃ­genas, proteÃ­nas y una amplia gama de biomolÃ©culas. Gracias a que presentan resonancia de plasmÃ³n superficial, son capaces de incrementar o disminuir la fluorescencia de molÃ©culas fluorÃ³foras que puedan estar en contacto con ellas. Esta caracterÃ­stica tiene potenciales aplicaciones en la detecciÃ³n de anticuerpos y antÃ­genos. La generaciÃ³n de nanopartÃ­culas de oro por ablaciÃ³n lÃ¡ser es un mÃ©todo fÃ­sico que permite obtener muestras de partÃ­culas en prÃ¡cticamente cualquier solvente, sin modificar el entorno quÃ­mico del medio donde se estÃ¡n generando, evitando asÃ­ poner en peligro la estructura o actividad biolÃ³gica de las biomolÃ©culas que se deseen acoplar a ellas. En el presente trabajo se sintetizaron nanopartÃ­culas de oro utilizando la tÃ©cnica de generaciÃ³n por ablaciÃ³n lÃ¡ser en un medio estabilizante de SDS. Se variÃ³ la concentraciÃ³n de estabilizante, la irradiancia utilizada y el tiempo de ablaciÃ³n para estudiar su efecto sobre el diÃ¡metro, morfologÃ­a y el nÃºmero de partÃ­culas. Se tomaron diferentes muestras de nanopartÃ­culas de oro y se pusieron en contacto con soluciones de fluoresceÃ­na de diferentes concentraciones, observÃ¡ndose un fuerte quenching en la fluorescencia de dicha molÃ©cula. Se estudiÃ³ la posibilidad de transferencia de energÃ­a nanopartÃ­cula-fluorÃ³foro y se estableciÃ³ que el quenching observado es debido a la gran cercanÃ­a entre las molÃ©culas de fluorÃ³foro y los nÃºcleos metÃ¡licos de las nanopartÃ­culas de oro.','2009-04-24','NanopartÃ­culas de oro, ablaciÃ³n lÃ¡ser, fluorescencia, quenching, fluoresceÃ­na',6,1,1,1,1,'2013-09-17 08:22:59','2013-09-17 08:22:59','Documento_76.pdf','application/pdf',2078832,'2013-09-17 08:22:59',20,0,101,'COMPLETO'),(77,'DESARROLLO DE UNA METODOLOGÃA PARA LA DETERMINACIÃ“N DE ELEMENTOS MINORITARIOS EN MUESTRAS GEOLÃ“GICAS POR ABLACIÃ“N LÃSER-ESPECTROMETRÃA DE MASAS CON PLASMA INDUCTIVAMENTE ACOPLADO.','La quimioestratigrafÃ­a es una herramienta que tiene como finalidad la definiciÃ³n y caracterizaciÃ³n geoquÃ­mica de unidades estratigrÃ¡ficas, la cual requiere el anÃ¡lisis elemental de una gran volumen de muestra y analitos que abarcan concentraciones que van desde mayoritarios a ultra-trazas en una gran diversidad de matrices inorgÃ¡nicas. Entre estas matrices nos encontramos con las rocas silicatadas, las cuales requieren de rigurosos tratamientos de muestras para su anÃ¡lisis por los sistemas ICP. La ablaciÃ³n lÃ¡ser con espectrometrÃ­a de masas con plasma inductivamente acoplado (LA-ICP-MS), es una tÃ©cnica analÃ­tica que se ha empleado para dar respuestas al anÃ¡lisis de muestras de compleja disoluciÃ³n, capaz de analizar una gran cantidad de ellas generando resultados confiables con tratamientos mÃ­nimos, disminuyendo los costos y los tiempos de respuesta, por ello en este trabajo experimental fue desarrollada una metodologÃ­a que permite determinar metales a niveles de ppm en este tipo de rocas utilizando LA como sistema de introducciÃ³n de muestra al ICP-MS. Para este desarrollo se utilizÃ³ un lÃ¡ser ND:YAG con longitud de onda de 266 nm, y tiempo de pulso de 6 ns, usando como Ãºnico tratamiento de muestra la formaciÃ³n de vidrios por fusiÃ³n. Se estudiaron distintas mezclas de fundentes para la obtenciÃ³n del vidrio mÃ¡s homogÃ©neo y se concluyÃ³ que la mezcla tetraborato-metaborato de litio (90-10%), con una diluciÃ³n de muestra de 10 veces, es la que proporciona los mejores resultados. Se obtuvieron seÃ±ales mÃ¡s intensas cuando se trabajaron con energÃ­as de lÃ¡ser de 2,7 mJ, diÃ¡metros de crÃ¡ter de 400 mm, y flujos de gas de arrastre de 1,2 L min-1. Se observÃ³ la formaciÃ³n de un plasma en expansiÃ³n a densidades de potencia mayores a los 0,5 GW cm-1, lo que originÃ³ caÃ­das en las seÃ±ales. Se midieron 4 elementos: Cu63, Zn66, Y89 y Zr90 realizando curvas de calibraciÃ³n con estÃ¡ndares de referencia logrÃ¡ndose lÃ­mites de detecciÃ³n en un rango de 0,03 - 0,08 mg Kg-1. El mÃ©todo fue validado con patrones certificados de referencia de rocas silicatadas. No se encontraron diferencias estadÃ­sticamente significativas entre los valores medidos con las curvas y los propuestos por los patrones demostrando la exactitud de los resultados. Se tomaron 3 rÃ©plicas por muestra y se obtuvieron desviaciones estÃ¡ndares relativas (DER) por debajo a 5%, ademÃ¡s de errores absolutos menores a un 7%. Se realizaron estudios de repetibilidad y reproducibilidad obteniÃ©ndose desviaciones estÃ¡ndares relativas de 2 y 5% respectivamente.','2009-04-27','AblaciÃ³n lÃ¡serEspectrometrÃ­a de masas Muestras geolÃ³gicas LA-ICP-MS',6,1,1,1,1,'2013-09-17 08:23:00','2013-09-17 08:23:00','Documento_77.pdf','application/pdf',5079876,'2013-09-17 08:23:00',20,0,114,'COMPLETO'),(78,'SÃNTESIS DE COMPUESTOS CON POTENCIAL ACTIVIDAD ANTICHAGÃSICA.','Se hizo un estudio sobre la sÃ­ntesis de un grupo de compuestos los cuales presentan en comÃºn un nÃºcleo naftalÃ©nico sustituido en las posiciones 2 y 4 por el grupo etoxicarbonil Ã³ carboxilo y metoxi, respectivamente, y cuya diferencia radica en el sustituyente localizado en la posiciÃ³n 8. Dichas caracterÃ­sticas le podrÃ­an conferir actividad de inhibiciÃ³n selectiva sobre enzimas presentes en el parÃ¡sito Trypanosoma Cruzi pues estudios previos asÃ­ lo sugieren. La vÃ­a sintÃ©tica escogida consistiÃ³ en hacer reaccionar el o-metilbenzaldehido (o-tolualdehido) con el reactivo de Wittig, 1-etoxicarbonil-2-t-Butoxicarboniletilentrifenilfosforano para dar el diÃ©ster olefÃ­nico derivado que por posterior hidrÃ³lisis selectiva del Ã©ster terbutÃ­lico llevÃ³ al Ã¡cido-Ã©ster correspondiente. Ã‰ste, mediante una ciclaciÃ³n, aparentemente a travÃ©s de un ceteno conjugado, provee el 2-etoxicarbonil-4- acetoxi-8-metilnaftaleno, el cual por hidrÃ³lisis Ã¡cida selectiva del acetilo y metilaciÃ³n del hidroxilo fenÃ³lico derivado condujo al 2-etoxicarbonil-4- metoxi-8-metilnaftaleno; Ã©ste por bromaciÃ³n con N- bromosuccinimida (NBS) dio el 2-etoxicarbonil-4-metoxi-8-bromometilnaftaleno, obteniÃ©ndose asÃ­ uno de los compuestos objetivo. Los subsiguientes compuestos se sintetizaron a partir del anterior por desplazamiento nucleofÃ­lico del bromo con tiourea y posterior hidrÃ³lisis con NaHCO3 para obtener el tiol derivado y el dÃ­mero disulfuro por hidrÃ³lisis controlada con NaOH y oxidaciÃ³n con O2contenido en el aire partiendo de la misma sal.','2009-04-15','SÃNTESIS DE NAFTALENOS, ENFERMEDAD DE CHAGAS',6,1,1,1,2,'2013-09-17 08:23:03','2013-09-17 08:23:03','Documento_78.pdf','application/pdf',3296913,'2013-09-17 08:23:03',20,0,85,'COMPLETO'),(79,'Desarrollo y evaluaciÃ³n de un mÃ©todo alternativo para la determinaciÃ³n de resistencia genotÃ­pica a drogas antirretrovirales en pacientes venezolanos VIH- 1 positivos','El VIH-1 es el agente etiolÃ³gico causante del SÃ­ndrome de Inmunodeficiencia Adquirida (SIDA); veinticinco aÃ±os despuÃ©s de su aislamiento se considera que la infecciÃ³n por este virus ha pasado de una condiciÃ³n fatal a una enfermedad crÃ³nica clÃ­nicamente manejable. Sin embargo, la apariciÃ³n y transmisiÃ³n de cepas resistentes a los diferentes esquemas de tratamientos antirretrovirales (TAR) representa un problema en la consecuciÃ³n de terapias asertivas que mejoren la calidad de vida de los pacientes. La aplicaciÃ³n de mÃ©todos de genotipificaciÃ³n basados en estuches comerciales eleva aÃºn mÃ¡s el costoso tratamiento para VIH-1, por lo que es necesario contar con un mÃ©todo alternativo que sea mÃ¡s asequible al mÃ©dico tratante y al paciente para detectar mutaciones que confieran resistencia en las etapas iniciales del TAR, e inclusive antes de su aplicaciÃ³n, pudiendo prevenir asÃ­ las fallas terapÃ©uticas. El objetivo del presente estudio fue desarrollar, normalizar y evaluar un mÃ©todo para la determinaciÃ³n de resistencia genotÃ­pica a drogas antirretrovirales (DARV) en pacientes venezolanos VIH-1+. La tÃ©cnica PCR MedPol permitiÃ³ detectar la presencia de mutaciones que causan tanto resistencia primaria, como resistencia secundaria a las principales DARV suministradas en el paÃ­s, de manera relativamente rÃ¡pida y sencilla, simplificando el diagnÃ³stico a travÃ©s de una sola PCR, por lo que representa una alternativa mÃ¡s econÃ³mica que los mÃ©todos comerciales. La evaluaciÃ³n del mÃ©todo normalizado se llevÃ³ a cabo en una poblaciÃ³n de 171 pacientes venezolanos VIH-1+, principalmente de la regiÃ³n del Distrito Capital. 63 de ellos nunca habÃ­an recibido TAR (pacientes no tratados) y 108 habÃ­an recibido o estaban bajo algÃºn esquema de TAR al menos una vez desde el diagnÃ³stico inicial de la infecciÃ³n (pacientes tratados). La poblaciÃ³n fue principalmente de sexo masculino, con una edad promedio de 36 aÃ±os y el entorno de transmisiÃ³n predominante fue hombres que tienen sexo con otros hombres (HSH). El 38 % (24/63) de la poblaciÃ³n no tratada presentÃ³ mutaciones relacionadas a DARV, el 11 % (7/63) mutaciones que confieren resistencia primaria al menos a una DARV y el 16 % (10/63) mutaciones secundarias a Inhibidores de la Proteasa (IP). De los 7 pacientes que exhibieron mutaciones que confieren resistencia primaria, 3 las presentaron a Inhibidores NucleÃ³sidos de la Transcriptasa Reversa (INTR), 3 a Inhibidores No NucleÃ³sidos de la TR (INNTR) y 1 a IP. La prevalencia de mutaciones que confieren resistencia primaria a DARV de los pacientes no tratados sugiriÃ³ la transmisiÃ³n de cepas resistentes en la epidemia local. Futuros estudios permitirÃ­an establecer el costo-beneficio de implantar un programa de vigilancia y determinaciÃ³n de resistencia genotÃ­pica en este tipo de pacientes, para lograr la detecciÃ³n temprana de mutaciones que confieren resistencia primaria y establecer TAR asertivos en las etapas iniciales de la infecciÃ³n. La distribuciÃ³n de mutaciones relacionadas a DARV en la poblaciÃ³n de pacientes tratados fue: 76 % (82/108) mutaciones que confieren algÃºn tipo de resistencia, 50 % (54/108) mutaciones primarias que confieren resistencia a IP, 65 % (70/108) a INTR y 39 % (42/108) a INNTR. El 69 % (75/108) presentÃ³ mutaciones secundarias a IP. El 33 % (36/108) mostrÃ³ mutaciones que confieren resistencia a INTR e INNTR y el 18 % (19/108) mutaciones que confieren resistencia a los tres tipos de inhibidores. Estos datos enfatizaron la importancia del uso racional de las DARV y sugirieron la necesidad de una adecuada informaciÃ³n e instrucciÃ³n al paciente para el seguimiento del TAR. El anÃ¡lisis filogenÃ©tico confirmÃ³ que el subtipo del VIH- 1 circulante en aislados de poblaciones venezolanas fue el B (100%, 171/171), indicando la presencia de una epidemia local estable que permitirÃ­a realizar estudios mÃ¡s amplios de subtipificaciÃ³n viral y prevalencia de resistencia genotÃ­pica a DARV, a fin de obtener un mejor conocimiento de las caracterÃ­sticas especÃ­ficas de la infecciÃ³n por VIH en nuestro entorno.','2009-01-14','VIH-1, resistencia genotÃƒÂ­pica, antirretrovirales',1,1,1,1,1,'2013-09-17 08:23:04','2013-09-17 08:23:04','Documento_79.pdf','application/pdf',1664763,'2013-09-17 08:23:04',20,0,135,'COMPLETO'),(80,'AnÃ¡Ã¡lisis geoquÃ­Ã­mico de sismoturbiditas holocenas en sedimentos lacustres del paleolago Los Zerpa,, Estado MÃ©Ã©rida','Una de las regiones de los Andes de MÃ©rida donde se evidencia, de manera significativa el desplazamiento dextral de las trazas activas del sistema de fallas de BoconÃ³, asÃ­ como la influencia de procesos climÃ¡ticos, se ubica en la zona central, en el valle morrÃ©nico Los Zerpa, donde por efecto de la deglaciaciÃ³n se dieron las condiciones para la formaciÃ³n de un lago intramorrÃ©nico, que posteriormente fue drenado por el desplazamiento lateral de la falla lo que permitiÃ³ que los sedimentos lacustres sirvieran como registro paleosÃ­smico de la regiÃ³n. Las sismoturbiditas son identificadas por varios criterios que involucran propiedades fÃ­sicas; una de las caracterÃ­sticas distintivas es la presencia de un nivel arcilloso homogÃ©neo desarrollado anormalmente, denominado homogenita. Estudios realizados identificaron la presencia de dichas sismoturbiditas asÃ­ como otros efectos de los sismos, en secuencias deltaicas y fluviales. En el presente estudio se realizÃ³ la caracterizaciÃ³n geoquÃ­mica de dos sismoturbiditas identificadas en los sedimentos lacustres del paleolago Los Zerpa y se comparÃ³ con facies turbidÃ­ticas producto de otros procesos (factores climÃ¡ticos). A travÃ©s de la quimioestratigrafÃ­a se estableciÃ³ una huella quÃ­mica propia de las sismoturbiditas, de esta manera se pudo comprender los procesos geoquÃ­micos involucrados en su sedimentaciÃ³n. Para esto se tomÃ³ un nÃºcleo de pared o \"canaleta\" de un afloramiento de sedimentos lacustres, de donde las turbiditas fueron extraÃ­das y luego disectadas cada 2 mm en continuo. Los atributos quÃ­micos entre mayoritarios y trazas (Al2O3, SiO2, TiO2, Fe2O3, MnO, CaO, MgO, K2O, Na2O, Ba, Cu, Cr, Sr, Zn y Zr), fueron determinados por medio de espectroscopia de emisiÃ³n con fuente de plasma Ã³ptico inductivamente acoplado (ICP-OES). Las asociaciones elementales fueron establecidas a travÃ©s de la estadÃ­stica multivariada, asÃ­ se identificaron dos grupos representativos de facies de clÃ¡sticos limo-arcillosos y facies de clÃ¡sticos arenosos, indicativo de la energÃ­a de sedimentaciÃ³n bajo la cual se depositaron las subfacies constituyentes, definidas para efectos de este estudio como facies; para cada sismoturbidita y turbidita climÃ¡tica. Los perfiles de concentraciÃ³n en conjunto con las curvas de acumulaciÃ³n porcentual marcaron cambios producto de la delimitaciÃ³n de las facies, asÃ­ como cambios drÃ¡sticos intrafacies, lo cual se relaciona con el mecanismo de depositaciÃ³n que involucran tracciÃ³n y decantaciÃ³n de partÃ­culas mÃ¡s finas por aumento de la densidad, bajo la influencia de factores externos. El registro de concentraciones relativamente altas de elementos como Zr y Ti en conjunto con el Cu, permitieron dilucidar que durante la sedimentaciÃ³n de la facies homogÃ©nea ocurre la depositaciÃ³n de fases minerales por efecto de la equivalencia hidrÃ¡ulica lo que constata que la homogeneidad fÃ­sica observada en perfiles de distribuciÃ³n de tamaÃ±o de grano (facies homogÃ©nea granulometrÃ­a promedio < 3,6 Âµm), donde predomina la fracciÃ³n de las arcillas, no es discriminante de la composiciÃ³n mineralÃ³gica. AsÃ­ mismo el anÃ¡lisis de agrupamiento restringido estableciÃ³ quimiofacies y subquimiofacies que correlacionan a las sismoturbiditas entre sÃ­, sin embargo cada una presentÃ³ particularidades. Por otra parte su comparaciÃ³n con la turbidita climÃ¡tica, constatÃ³ que efectivamente hay diferencias entre ambos procesos de sedimentaciÃ³n, lo que permitiÃ³ concretar que las sismoturbiditas son depÃ³sitos vinculados con la actividad sismotectÃ³nica y su origen no corresponde a procesos climÃ¡ticos.','2009-04-20','QuimioestratigrafÃ­a, sismoturbiditas, homogenita, turbidita climÃ¡tica, paleolago Los Zerpa.',4,1,1,1,1,'2013-09-17 08:23:11','2013-09-17 08:23:11','Documento_80.pdf','application/pdf',1319165,'2013-09-17 08:23:11',20,0,83,'COMPLETO'),(81,'RepresentaciÃ³Ã³nn de operadores que entrelazan al operador de traslaciÃ³Ã³nn..','El conmutante de un operador lineal (o de un conjunto de operadores lineales) es el conjunto formado por los operadores que conmutan con el operador dado (o con cada uno de los operadores en el conjunto dado).El poder determinar el conmutante de un operador es parte importante de su estudio.En algunos casos es posible caracterizar de manera muy precisa el conmutante de un operador, entre estos casos destaca el conmutantedel operador de traslaciÃ³n (shift) S de L 2 (m) en L2(m), donde m es una medida no negativa definida en la circunferencia unitaria T. El conmutante de este operador es el conjunto de los operadores de multiplicaciÃ³n.Si H1 y H2 son espacios de Hilbert, Sk : Hk -> Hk (k=1,2), y A: H1 -> H2 son operadores lineales acotados, se dice que A entrelaza a S1 y S2si A S1 = S2 A.Este Ãºltimo concepto generaliza la nociÃ³n de conmutaciÃ³n, ya que la contiene como caso particular cuando H1 = H2 y S1 = S2.El caracterizar operadores que entrelazan determinados operadores es una tÃ©cnica muy usada y que tiene diversas aplicaciones enanÃ¡lisis funcional, teorÃ­a de operadores y anÃ¡lisis armÃ³nico.Sean m1y m2 dos medidas no negativas en la circunferencia unitaria y sean Sk: L2(mk) -> L2(mk) (k=1,2) los correspondientes operadores de traslaciÃ³n. Mischa Cotlar y Alejandra Maestripieri en su libro \"Representaciones de Fourier,, factorizaciÃ³Ã³nn de operadores triangulares y operadores diferenciales canÃ³Ã³nnicos\", caracterizan a los operadores que entrelazan a S1 y S2.La idea fundamental del Trabajo Especial de Grado es el estudio deeste resultado de caracterizaciÃ³n.','2009-01-28','Operadores que entrelazan, Conmutante de un operador, Operador traslaciÃ³n, Operador multiplicaciÃ³n por una funciÃ³n',5,1,1,1,1,'2013-09-17 08:23:18','2013-09-17 08:23:18','Documento_81.pdf','application/pdf',5375401,'2013-09-17 08:23:18',20,0,97,'COMPLETO'),(82,'AceleraciÃ³n del mÃ©todo de Cimm