©s de AnÃ¡lisis TermogravimÃ©trico, asÃ­ como una estructura con mayor tendencia cristalina segÃºn los resultados del anÃ¡lisis por CalorimetrÃ­a diferencial de barrido y espectroscopÃ­a de Infrarrojo. Por otra parte, se determinÃ³ por medio de anÃ¡lisis de Resonancia MagnÃ©tica nuclear de portones estructura atÃ¡ctica del PMMA obtenido en fase homogÃ©nea, quien a su vez presentÃ³ una degradaciÃ³n tÃ©rmica mÃ¡s lenta que la del PMMA obtenido con el catalizador soportado, segÃºn el anÃ¡lisis TermogravimÃ©trico, sin embargo, el Ã­ndice de inflamabilidad de este Ãºltimo, resultÃ³ mucho menor, determinado mediante pruebas a la llama de lÃ¡minas del polÃ­mero. El copolÃ­mero etileno-MMA, resultÃ³ con una estructura diversa entre fracciones estadÃ­sticas (por las inserciones de PMMA) y otras cristalinas, lo que se derivÃ³ del anÃ¡lisis DSC. Se logrÃ³ la homopolimerizaciÃ³n de poliestireno sindiotÃ¡ctico con el complejo semimetaloceno sintetizado (pentametil)- ciclopentadienil Titanio (IV) tricloruro; donde la tacticidad fue determinada por los anÃ¡lisis de CalormetrÃ­a diferencial de barrido y Resonancia magnÃ©tica nuclear de protones y carbono 13. AdemÃ¡s fue posible, la obtenciÃ³n del copolÃ­mero estireno-metilmetacrilato mediante el uso del catalizador hÃ­brido \"diimina de Fe (II)- semimetaloceno Ti (IV)\" previamente sintetizados, estudiÃ¡ndose la influencia de la temperatura en la actividad del catalizador hÃ­brido, resultando una desactivaciÃ³n del complejo diimina de Fe a 50Â°C, obteniendo menos MMA en el copolÃ­mero. El copolÃ­mero S-MMA que fue separado en dos fracciones, soluble e insoluble en hexano, en la fracciÃ³n insoluble se determinÃ³ mayor inserciÃ³n de MMA en su estructura, segÃºn lo determinado por Resonancia magnÃ©tica nuclear de protones y carbono 13, ademÃ¡s empleando como tÃ©cnica de anÃ¡lisis CalorimetrÃ­a diferencial de barrido se determinaron fragmentos de PS sindiotÃ¡ctico, mientras que para la fracciÃ³n soluble solo se determinÃ³ PS atÃ¡ctico.','2009-04-30','PolÃ­meros nanocompositos, polimetilmetacrilato, polietileno, arcilla montmorillonita cÃ¡lcica, catalizadores tipo diimina, catalizadores semimetalocenos, catalizadores hÃ­bridos, copolÃ­mero estireno-metilmetacrilato.',6,1,1,1,1,'2013-09-17 08:23:21','2013-09-17 08:23:21','Documento_84.pdf','application/pdf',0,'2013-09-17 08:23:21',19,0,0,'INCOMPLETO'),(85,'GeneralizaciÃ³n del mÃ©todo de proyecciones alternantes oblicuas al caso de una variedad lineal.','El mÃ©todo de proyecciones alternantes oblicuas fue propuesto por L.Hernandez (2000) para hallar la soluciÃ³n aproximada de problemas de punto de ensilladura en el cual la parte g del vector del lado derecho del sistema conformado por dos vectores ( f g ) Tera igual a cero. En este trabajo se generaliza este estudio para el caso g distinto de cero y se reformula el mÃ©todo PAO adaptado a este caso. Se realizaron experimentos con los mÃ©todos Uzawa, Barzilai Borwein y una versiÃ³n adaptada al gradiente conjugado del mÃ©todo de Uzawa precondicionados y sin precondicionar utilizando problemas reales de aplicaciÃ³n para comprobar la efectividad de este mÃ©todo en la prÃ¡ctica.','2009-05-05','MÃ©todo de proyecciones alternantes, Problemas de punto de ensilladura, Proyecciones oblicuas alternantes.',5,1,1,1,1,'2013-09-17 08:23:22','2013-09-17 08:23:22','Documento_85.pdf','application/pdf',1953108,'2013-09-17 08:23:22',20,0,148,'COMPLETO'),(86,'Estudio de la respuesta de geles polimÃ©ricos a la radiaciÃ³n ionizante mediente simulaciÃ³n de la alteraciÃ³n de su estructura con modelos de gases reticulares','{}','2009-04-28','{}',3,1,1,1,2,'2013-09-17 08:23:29','2013-09-17 08:23:29','Documento_86.pdf','application/pdf',3025759,'2013-09-17 08:23:29',18,0,128,'COMPLETO'),(87,'\"\"Efecto del TamaÃ±Ã±oo de PartÃ­Ã­cula en las Propiedades Ã“Ã“ppticas y ElÃ©Ã©ctricas de Sistemas FotoelectroquÃ­Ã­micos\"\"','En el trabajo especial de grado se realizÃ³ un estudio fotoelectroquÃ­mico bajo condiciones controladas superficialmente. La formaciÃ³n electroquÃ­mica de partÃ­culas de CuO a partir de a electrodeposiciÃ³n del elemento metÃ¡lico permite controlar el proceso de nucleaciÃ³n y crecimiento del mismo, modificando parÃ¡metros como la densidad de numero de nÃºcleos y el radio. El anÃ¡lisis porcentual de la relaciÃ³n de carga de oxidaciÃ³n - electrodeposiciÃ³n al variar el radio y la densidad de numero de nÃºcleos arrojÃ³ que la oxidaciÃ³n electroquÃ­mica bajo las condiciones de doble pulso en medio acido y 0,6 V en medio bÃ¡sico, es un proceso de oxidaciÃ³n superficial, el cual viene limitado por la pasivaciÃ³n de los nÃºcleos de cobre metÃ¡lico. Los semiconductores poseen la capacidad de convertir la radiaciÃ³n incidente sobre su superficie en electricidad. Una sensitizaciÃ³n de estos dispositivos permiten un aumento en la capacidad de recepciÃ³n lumÃ­nica, y mayor eficiencia de conversiÃ³n. El Fast Green, sensitizador, presenta una posiciÃ³n relativa de energÃ­a de los orbitales HOMO-LUMO adecuada con respecto a la energÃ­a de la banda de valencia y conducciÃ³n del CuO. A travÃ©s, de un estudio de la constante de equilibrio de adsorciÃ³n - desorciÃ³n para el sistema Fast Green-CuO y Fast Green-Carbono vÃ­treo se encontrÃ³ que KCuO/KCV = 6,5 x 103, reflejando una mayor adsorciÃ³n del CuO con respecto a la superficie de carbono vÃ­treo. El semiconductor p-CuO en condiciÃ³n de oscuridad presenta corrientes anÃ³dicas que aumentan exponencialmente al modificar el potencial del sistema, estas corrientes presentan una tendencia al incremento con el tamaÃ±o de las partÃ­culas; mientras que el EFB, potencial de banda plana, es independiente de dichas variaciones. Se obtuvo EFB = 0,769 V vs. ESC. Bajo condiciones de iluminaciÃ³n son observados dos fenÃ³menos: el origen de corrientes catÃ³dicas y presencia de oscilaciones al reducirse fotoquimicamente el CuO superficial.','2009-04-27','SemicondutorCeldas FotoelectroquimicasNucleaciÃ³nAdsorcion',6,1,1,1,1,'2013-09-17 08:23:30','2013-09-17 