erminÃ³ humedad, sÃ³lidos solubles, pH y acidez total titulable y evaluaciÃ³n sensorial, para luego seleccionar la formulaciÃ³n final. A dicha formulaciÃ³n se le determinÃ³ la curva de secado a 45 y 60 0C con un contenido de 20 y 40 0Brix. Las lÃ¡minas se elaboraron deshidratÃ¡ndolas a 45 y 60 0C hasta obtener una humedad entre 10 y 11%. Se le determinaron sÃ³lidos solubles, pH, acidez total titulable, humedad, azÃºcares, cenizas, calcio, compuestos fenÃ³licos totales, pectina, aw, color y textura. Se realizÃ³, ademÃ¡s, evaluaciÃ³n sensorial con consumidores no entrenados. En los cuatro tratamientos finales la humedad fluctuÃ³ entre 10,7 y 10,95%; los sÃ³lidos solubles entre 32,7 y 38,5 0Brix para lÃ¡minas de 20 0Brix, y 59,8 y 67,3 0Brix para lÃ¡minas de 40 0Brix; la acidez entre 0,11 y 0,12% para lÃ¡minas de 20 0Brix, y 0,03 y 0,04% para lÃ¡minas de 40 0Brix; pH entre 3,26 y 3,87; azÃºcares reductores entre 9,04 y 16,61% para lÃ¡minas de 20 0Brix, y 9,88 y 17,45% para lÃ¡minas de 40 0Brix; azÃºcares no reductores entre 19,17 y 19,68% para lÃ¡minas de 20 0Brix, y 31,03 y 59,06% para lÃ¡minas de 40 0Brix; el contenido de calcio entre 331,62 y 495,63 ppm; una baja aw entre 0,533 y 0,556 para lÃ¡minas de 20 0Brix, y 0,625 y 0,667 para lÃ¡minas de 40 0Brix, y ademÃ¡s, ausencia en el recuento microbiolÃ³gico. Sensorialmente, los tratamientos con alto contenido de azÃºcar tuvieron una mejor aceptabilidad, con una aceptaciÃ³n promedio de 3 en una escala hedÃ³nica de 3 puntos. Es posible elaborar lÃ¡minas flexibles de parchita, nutritivas y de excelente calidad microbiolÃ³gica, con agradables caracterÃ­sticas sensoriales, destacÃ¡ndose el aporte del calcio como ingrediente funcional.','2009-02-17','Laminas de parchita,,Passiflora edulisf..flavicarpa Degener,,Calcio..',1,1,1,1,1,'2013-09-17 08:23:33','2013-09-17 08:23:33','Documento_89.pdf','application/pdf',10495517,'2013-09-17 08:23:33',18,0,110,'COMPLETO'),(90,'Aprenda Token Ring: Sistema Didactico para la enseÃ±anza de 