da cuantificaciÃ³n de los analitos debido a las diferencias de ablaciÃ³n y excitaciÃ³n de patrones y muestra (efecto matriz). Mientras que por AdiciÃ³n EstÃ¡ndar se encuentran lÃ­neas de alta intensidad de emisiÃ³n y gran reproducibilidad, lo que permitiÃ³ la cuantificaciÃ³n. Se obtuvo una concentraciÃ³n de Vanadio de (555 Â± 72) ppm, la cual fue comparada con la tÃ©cnica convencional de Espectroscopia de AbsorciÃ³n AtÃ³mica de llamas (EAA), obteniÃ©ndose una concentraciÃ³n de (477 Â± 2) ppm. El NÃ­quel no pudo ser cuantificado, por la irreproducibilidad de sus lÃ­neas en todas las regiones espectrales, tomando en cuenta ciertas variaciones propias del lÃ¡ser (energÃ­a, posiciÃ³n de observaciÃ³n de la fibra Ã³ptica entre otros) y de detecciÃ³n.','2009-04-16','Ablacion Laser',6,1,1,1,1,'2013-09-17 08:23:39','2013-09-17 08:23:39','Documento_93.pdf','application/pdf',35531450,'2013-09-17 08:23:39',20,0,180,'COMPLETO'),(94,'\"SINTESIS DE LA P-DIOXANONA UTILIZANDO CATALIZADORES DE CROMO Y COBRE SOPORTADOS SOBRE ZEOLITA Y POLIMERIZACION DE ESTE MONOMERO\"','{}','2009-04-29','p-Dioxanona, Zeolita. Faujasita, Cromita de Cobre, Catalizadores Cobre, Catlizadores Cromo',6,1,1,1,1,'2013-09-17 08:24:11','2013-09-17 08:24:11','Documento_94.pdf','application/pdf',319747,'2013-09-17 08:24:11',20,0,38,'COMPLETO'),(95,'HERRAMIENTA DE APOYO PARA LA FORMULACIÃ“N DE PROYECTOS SOCIO-PRODUCTIVOS COMUNALES','A travÃ©s de este Trabajo Especial de Grado se construye un producto de software ue apoya la formulaciÃ³n de proyectos socio-productivos comunales. Esta erramienta permite a las usuarias y usuarios, luego de la fase de estudio y iagnÃ³stico de la realidad comunal, poder convertir sus Ideas-Proyectos, elacionadas con actividades productivas, en un proyecto socio-productivo en sÃ­. sto a travÃ©s de la aplicaciÃ³n de una metodologÃ­a para la formulaciÃ³n de royectos y la generaciÃ³n del mismo en formato digital.Se tomÃ³ como propuesta piloto la metodologÃ­a diseÃ±ada por el Banco de esarr