tionina, FormaciÃ³n de Complejos, Medidas de emf(H), QuÃ­mica de CoordinaciÃ³n, Equilibrios en SoluciÃ³n',6,1,1,1,1,'2013-09-17 08:24:15','2013-09-17 08:24:15','Documento_97.pdf','application/pdf',3791707,'2013-09-17 08:24:15',19,0,205,'COMPLETO'),(98,'BencilaciÃ³n de compuestos aromÃ¡ticos con cloruro de bencilo sobre sÃ³lidos mesoporosos CoSBA-15','En este Trabajo Espacial de Grado se sintetizaron tres sÃ³lidos mesoporosos CoSBA-15, dos de ellos mediante la tÃ©cnica de impregnaciÃ³n por humedad incipiente con 15 y 25% p/p de Co en el soporte y el otro a travÃ©s de sÃ­ntesis directa con un 25% en peso del metal. Estos sÃ³lidos se caracterizaron mediante tÃ©cnicas fisicoquÃ­micas tales como FisisorciÃ³n de N2 e Isotermas de AdsorciÃ³n (Ã¡rea BET), EspectroscopÃ­a de AbsorciÃ³n en el Infrarrojo, DifracciÃ³n de Rayos X, ReducciÃ³n a Temperatura Programada y AnÃ¡lisis QuÃ­mico Elemental, obteniÃ©ndose valores de propiedades texturales y estructurales tÃ­picas para este tipo de sÃ³lidos segÃºn datos de investigaciones previas.El Ã¡rea superficial especÃ­fica del soporte SBA-15 sintetizado exhibiÃ³ un valor de 594 m2/g, el cual disminuye a medida que aumenta la carga del metal incorporado, una distribuciÃ³n de tamaÃ±o de poros estrecha centrada en 44 Ã… y un volumen de poro de 0,52 cm3/ g; caracterÃ­sticas estas que lo hacen un buen material para la adsorciÃ³n en catÃ¡lisis, y un espesor de pared de 55 Ã… que lo hace resistente a tratamientos tÃ©rmicos e hidrotÃ©rmicos fuertes. Los perfiles de Rayos X seÃ±alan una estructura morfolÃ³gicamente ordenada tanto para el soporte como para los sÃ³lidos CoSBA-15, observÃ¡ndose la fase a-espinela de Co3O4 para los sÃ³lidos con Co preparados mediante impregnaciÃ³n.Las pruebas catalÃ­ticas para estos sÃ³lidos se llevaron a cabo mediante la alquilaciÃ³n Friedel-Crafts de benceno, tolueno, anisol, nitrobenceno, naftaleno y 8-hidroxiquinolina, empleando cloruro de bencilo como agente alquilante. Se realizÃ³ una reacciÃ³n patrÃ³n con la sÃ­lice SBA-15 para determinar su posible actividad determinÃ¡ndose que este sÃ³lido no posee actividad catalÃ­tica hacÃ­a la reacciÃ³n. Al emplear los sÃ³lidos CoSBA-15 se pudo constatar actividad catalÃ­tica, lo que indica que el Co es el responsable de la apariciÃ³n de productos, es decir, es el sitio activo en la reacciÃ³n.En lÃ­neas generales, no se observÃ³ mucha diferencia entre el desempeÃ±o catalÃ­tico de los tres sÃ³lidos, puesto que los rendimientos de la reacciÃ³n fueron similares. Sin embargo, en algunos casos el rendimiento aumentÃ³ ligeramente mientras mayor era la carga de Co en el catalizador.Los compuestos aromÃ¡ticos activados hacia la alquilaciÃ³n (anisol, tolueno) fueron los que presentaron mayores rendimientos de reacciÃ³n (hasta 57% para la reacciÃ³n con anisol), mientras que los de mediana activaciÃ³n (benceno, naftaleno) fueron inferiores al 1%, y el sustrato desactivado (nitrobenceno) no reaccionÃ³. El compuesto 8-hidroxiquinolina tampoco presentÃ³ rendimiento alguno inclusive despuÃ©s de 18 horas de reacciÃ³n.Un resultado muy interesante se puede destacar al utilizar los sÃ³lidos CoSBA-15 en algunas de estas reacciones, es en relaciÃ³n a los productos obtenidos, los cuales fueron todos monoalquilados. Este hecho es de gran ventaja ya que como se sabe la polialquilaciÃ³n es una de las grandes limitaciones prÃ¡cticas que sufren las alquilaciones Friedel-Crafts. Este comportamiento seÃ±ala a los catalizadores CoSBA-15 como altamente selectivos en determinadas alquilaciones.Finalmente se llevaron a cabo las seis alquilaciones antes mencionadas sobre el sÃ³lido AlCl3, el cual es conocido en la literatura como elcatalizador por excelencia para estas reacciones. Si bien es cierto que los rendimientos en este caso fueron superiores a los obtenidos con los sÃ³lidos CoSBA-15, el trabajo prÃ¡ctico involucrado en las reacciones en fase heterogÃ©nea es mucho menos engorroso que para el caso de la catÃ¡lisis en fase homogÃ©nea. Ejemplo de ello lo tenemos en la manipulaciÃ³n, aislamiento del los productos de reacciÃ³n, re-uso de los catalizadores, desechos de reacciÃ³n y cantidad de catalizador utilizado, todo ello hace de la catÃ¡lisis heterogÃ©nea una posibilidad mÃ¡s atractiva.','2009-05-04','Co, SBA-15, CoSBA-15, Tamices Moleculares Mesoporosos, SustituciÃ³n ElectrofÃ­lica AromÃ¡tica, AlquilaciÃ³n Friedel-Crafts.',6,1,1,1,1,'2013-09-17 08:24:16','2013-09-17 08:24:16','Documento_98.pdf','application/pdf',475725,'2013-09-17 08:24:16',20,0,70,'COMPLETO'),(99,'ESTUDIO BIOGEOQUÃMICO DEL EMBALSE SUATA DE ACUERDO AL CONTENIDO DE METALES PESADOS EN SUS SEDIMENTOS, AGUAS Y PECES','{}','2009-03-17','Estudio ambiental, sedimentos, peces, aguas, embalses.',6,1,1,1,1,'2013-09-17 08:24:17','2013-09-17 08:24:17','Documento_99.pdf','application/pdf',1483020,'2013-09-17 08:24:17',20,0,163,'COMPLETO'),(100,'SÃ­ntesis de Ferrias Cu-Co prepraradas por el MÃ©todo de CombustiÃ³n.','{}','2009-04-27','SÃ­ntesis por el MÃ©todo CombustiÃ³n Ferritas',3,1,1,1,1,'2013-09-17 08:24:19','2013-09-17 08:24:19','Documento_100.pdf','application/pdf',0,'2013-09-17 08:24:19',18,0,0,'INCOMPLETO'),(101,'SÃ­ntesis de Ferritas Ni-Co preparadas por CombustiÃ³n','{}','2009-04-27','SÃ­ntesis por CombustÃ³n',3,1,1,1,1,'2013-09-17 08:24:20','2013-09-17 08:24:20','Documento_101.pdf','application/pdf',3194352,'2013-09-17 08:24:20',19,0,141,'COMPLETO'),(102,'DESPOLIMERIZACIÃ“Ã“NN DE MEZCLA DE CARBONES VENEZOLANOS DE DISTINTO RANGO CON RESIDUOS PLÃÃSSTICOS EN PROPORCIONES VARIABLES ASISTIDA POR MEZCLAS DE SOLVENTES ORGÃÃNNICOS','A fin de evaluar el efecto de la adiciÃ³n de polÃ­meros sobre el rendimiento en la despolimerizaciÃ³n de carbones de diferente rango en presencia de la mezcla NPM/Tetralina como solvente, se desarrollÃ³ un diseÃ±o multifactorial que permitiÃ² corelacionar todas las variables presentes en la despolimerizaciÃ³n. Se utilizaron dos carbones (Guasare y Cerro Pelado), dos polÃ­meros (polipropileno y caucho), dosproporciones de mezcla (1:3 y 3:1). AdemÃ¡s, se ensayÃ³ la presencia o no de una amina (m-fenilendiamina) como aditivo en el sistema. Se mantuvieron fijas la temperatura (250Âº), el solvente (mezcla 1:1 v/v tetralina/ NMP) y el tiempo de ensayo (2 horas). Los resultados arrojaron que los mejores rendimientos de despolimerizaciÃ³n se encontraban al emplear el sistema carbÃ³n de Cerro Pelado-caucho (41-51%). Todas las experiencias realizadas con polipropileno arrojaron rendimientos sustancialmente menores. Las mejores condiciones de despolimerizaciÃ³n se presentan con el carbÃ³n de Cerro Pelado, utilizando caucho como polÃ­mero, en una proporciÃ³n 1:3, y en presencia de amina, de manera general, indicando que el rango de madurez del carbÃ³n estÃ¡ ejerciendo un efecto importante. Sin embargo, la tendencia observada para los sistemas carbÃ³n/polÃ­mero se mantuvo al emplear el carbÃ³n de Guasare. Dentro de los resultados se observa que el efecto de la proporciÃ³n empleada y la presencia de la amina estÃ¡n regidos por el polÃ­mero empleado, siendo relevante la proporciÃ³n 1:3 carbÃ³n:polÃ­mero y la presencia de la amina al emplear el mejor polÃ­mero mencionado, caucho. De igual forma, al evaluar el efecto de sinergia del sistema carbÃ³n/polÃ­mero se obtuvo que la conjugaciÃ³n carbÃ³n de Cerro Pelado/caucho es el sistema que mayor sinergia presenta (41-51%) en comparaciÃ³n con los resultados teÃ³ricos esperados (31-34%).','2008-12-12','DespolimerizaciÃ³n de carbones, carbones venezolanos, residuos plÃ¡sticos, solventes orgÃ¡nicos',6,1,1,1,1,'2013-09-17 08:24:23','2013-09-17 08:24:23','Documento_102.pdf','application/pdf',571549,'2013-09-17 08:24:23',19,0,88,'COMPLETO'),(103,'COMPLEJOS DE VANADIO ((III)) Y FENILALANINA POR MEDIO DE MEDIDAS DE EMF ((H)) ((KCl 33..00 M,, 2255 ÂºÂºC))','En el presente trabajo fueron estudiados los siguientes sistemas: Ã¼ HH++ -- f-- alanina ((HC))Ã¼ HH++ -- V33++ -- f--alanina por medio de medidas de fuerzas electromotrices emf(H) a 25 Â°C y empleando KCl 3.0 M como 