se homogÃ©nea; ademÃ¡s se soportaron ambos catalizadores en una arcilla montmorillonita cÃ¡lcica, funcionalizada con una sal de amina cuaternaria, para comparar sus actividades en las homopolimerizaciones y copolimerizaciones de los mismos monÃ³meros. Los resultados en fase homogÃ©nea y heterogÃ©nea muestran que ambos catalizadores presentaron mayor actividad catalÃ­tica al aumentar la relaciÃ³n aluminio-nÃ­quel (Al/Ni); pero de igual forma al comparar ambos sistemas catalÃ­ticos, el mÃ¡s activo resultÃ³ ser el catalizador bis(acetil acetonato) nÃ­quel (II) comercial (en ambas fases). En la comparaciÃ³n de los polÃ­meros y copolÃ­meros obtenidos, se observÃ³ que las propiedades tÃ©rmicas (degradaciÃ³n y temperatura de transiciÃ³n vÃ­trea) de los polÃ­meros sintetizados en fase heterogÃ©nea no mejoraron con respecto a la observada en los polÃ­meros sintetizados en fase homogÃ©nea; mientras que en la inflamabilidad el PMMA nanocomposito (fase heterogÃ©nea) retardÃ³ la inflamabilidad del material, con respecto al PMMA virgen (fase homogÃ©nea). Por Ãºltimo mediante difracciÃ³n de rayos X y microscopÃ­a electrÃ³nica de transmisiÃ³n se logrÃ³ confirmar la obtenciÃ³n de nanocompositos de: polibutadieno, polimetilmetacrilato (con mezcla de exfoliaciÃ³n e intercalaciÃ³n) y de copolÃ­mero (BD:MMA) con mezcla de estados: tactoÃ­de, intercalado y exfoliado.','2009-04-22','nanocompositos, montmorillonita, polibutadieno, polimetacrilato',6,1,1,1,1,'2013-09-17 08:24:24','2013-09-17 08:24:24','Documento_104.pdf','application/pdf',3227991,'2013-09-17 08:24:24',20,0,102,'COMPLETO'),(105,'Estudio de los elementos As, Cd, Cr, Hg, Pb asociados a laspartÃ­culas inhalables PM10, en el Valle de Caracas, Venezuela','El aumento de poblaciÃ³n ha traÃ­do como consecuencia un incremento de actividades antropogÃ©nicas que contribuyen con la producciÃ³n y emisiÃ³n de partÃ­culas inhalables PM10, en este proyecto se usaron muestras de dichas partÃ­culas, que fueron recolectadas por el Ministerio del Ambiente entre los meses de abril a octubre de 2007 en las estaciones de Los Ruices, El Cementerio, Bello Campo y CORE 5 en la ciudad de Caracas con un equipo Partisol 2000H durante 24 horas en filtro de fibra de cuarzo (WHA), las cuales fueron analizadas empleando la norma COVENIN 2465 para Pb mediante la tÃ©cnica de espectroscopÃ­a de emisiÃ³n atÃ³mica de plasma inductivamente acoplado de ArgÃ³n (ICP/OES) y plasma de acoplamiento inductivo de masa (ICP/MS) para obtener concentraciones de As, Cd, Cr y Pb y para el Hg absorciÃ³n atÃ³mica con vapor frÃ­o (FIMS), la exactitud del mÃ©todo del tratamiento de este tipo de muestras fueron evaluadas a traves del anÃ¡lisis de estÃ¡ndares certificados de partÃ­culas atmosfÃ©ricas (A3 SPEX CertiPerp y 2583 NIST) no encontrÃ¡ndose diferencias significativas, concluyendo que los resultados obtenidos con el anÃ¡lisis de estas muestras de partÃ­culas PM10 estÃ¡n por debajo de los lÃ­mites de concentraciÃ³n permitidos por la NAAQS, EPA, 2008, inferiÃ©ndose que la fuente de emisiÃ³n mÃ¡s importantes es la densidad vehicular y en la Ã©poca de sequÃ­a los incendios en el parque nacional El Ãvila.','2009-02-17','PartÃ­culas inhalables PM10 , PARTISOL 2000H, COVENIN 2465, elementos contaminantes',4,1,1,1,1,'2013-09-17 08:24:25','2013-09-17 08:24:25','Documento_105.pdf','application/pdf',2837797,'2013-09-17 08:24:25',18,0,130,'COMPLETO'),(106,'Generato: Generador de sitios Web administrativos basado en la ingenierÃ­a de reverso al modelo de datos','Generato es una aplicaciÃ³n que recibe como entrada una base de datos, y a partir de esta, extrae sus metadatos. Con la informaciÃ³n obtenida de los metadatos y junto con la informaciÃ³n de configuraciÃ³n del sitio suministrada por el usuario, se genera una aplicaciÃ³n Web administrativa. El sistema construido, Generato, tiene como objetivo generar de forma automÃ¡tica aplicaciones Web que se encarguen de gestionar la informaciÃ³n contenida en una base de datos, contribuyendo asÃ­ a minimizar el tiempo en el desarrollo de este tipo de aplicaciones. La gestiÃ³n que realiza el sistema sobre las diferentes bases de datos incluye operaciones como: listar, buscar, insertar, modificar y eliminar cualquier informaciÃ³n contenida en las tablas de la misma. En su versiÃ³n inicial, DEUSWEB [GonzÃ¡lez, 2006], la creaciÃ³n de los archivos fuentes del sitio generado es llevada a cabo por un solo motor implementado en la aplicaciÃ³n: JSP / Servlets, el cual estÃ¡ constituido por un conjunto de procesadores. Para este trabajo especial de grado se propuso la implementaciÃ³n y configuraciÃ³n de un nuevo motor en la aplicaciÃ³n de una forma fÃ¡cil, y que sea de provecho en versiones sucesivas, asÃ­ como la inclusiÃ³n de nuevos Sistemas Manejadores de Base de Datos para gestionar las tablas que son generadas en el sitio web. El propÃ³sito de este Trabajo Especial de Grado consiste en desarrollar el sistema que permita la creaciÃ³n de sitios web administrativos a partir de una base de datos existente, a travÃ©s del proceso de desarrollo de software: Scrum. El alcance de este desarrollo involucra generar cÃ³digo PHP a partir de bases de datos MySQL, PostgreSQL, y Oracle, de igual forma combinando la generaciÃ³n de cÃ³digo JSP con ellas. Para la construcciÃ³n de este sistema, se estudiaron herramientas que generan aplicaciones Web administrativas a partir de la ingenierÃ­a de reverso al modelo de datos, haciendo Ã©nfasis en la versiÃ³n previa de la aplicaciÃ³n. Del estudio de estas aplicaciones, surgieron las funcionalidades desarrolladas en el sistema. Sin embargo el sistema desarrollado incluye nuevas funcionalidades con respecto a los sistemas evaluados, por ejemplo: el manejo de las claves forÃ¡neas y la manipulaciÃ³n de los archivos almacenados en la base de datos, entre otros.','2009-04-30','Generador DEUSWEB Generato Aplicaciones Web Administrativas PHP JSP Ingenieria Reverso Modelo Base Datos Extensible Oracle Postgres MySQL Scrum Servlets Metadata Wizard Asistente',2,1,1,1,2,'2013-09-17 08:24:27','2013-09-17 08:24:27','Documento_106.pdf','application/pdf',0,'2013-09-17 08:24:27',20,0,0,'INCOMPLETO'),(107,'SISTEMA DE INFORMACION PARA LA MEDICIÃ“N Y ANÃLISIS DE LA PRESENCIA DE INFORMACIÃ“N EN LOS MEDIOS DE COMUNICACIÃ“N (APLICACIÃ“N: MEDIOS IMPRESOS)','El presente Trabajo Especial de grado tiene como finalidad organizar, acceder, procesar, recuperar y distribuir la informaciÃ³n de un medio de comunicaciÃ³n. Creando una herramienta tecnolÃ³gica que permita la mediciÃ³n de la presentaciÃ³n de la informaciÃ³n suministrada por los distintos medios, para el subsecuente anÃ¡lisis y comprensiÃ³n de los cambios sociales, polÃ­ticos y econÃ³micos del entorno de interÃ©s.','2009-03-06','ComunicaciÃ³n, Web, medios, prensa escrita, anÃ¡lisis morfolÃ³gico, anÃ¡lisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:24:27','2013-09-17 08:24:27','Documento_107.pdf','application/pdf',1231067,'2013-09-17 08:24:27',20,0,67,'COMPLETO'),(108,'ESTUDIO ESTADISTICO DE LAS FRECUENCIAS DE CONEXIONES PARA DECIDIR SI LAS REDES BIOLOGICAS SON LIBRES DE ESCALA','{}','2008-11-26','{}',5,1,1,1,1,'2013-09-17 08:24:28','2013-09-17 08:24:28','Documento_108.pdf','application/pdf',1335528,'2013-09-17 08:24:28',20,0,83,'COMPLETO'),(109,'SÃ­ntesis de 3-cianocumarinas sustituidas. Estudio de Modelaje Molecular.','En el siguiente trabajo se realiza la sÃ­ntesis de 3-ciano-4-hidroxicumarina, este compuesto puede presentar equilibrio tautomÃ©rico donde se generan tres especies, una en su forma ceto y dos en forma enÃ³lica. Dicho equilibrio se estudiÃ³ por mÃ©todos computacionales de estructura electrÃ³nica con cÃ¡lculos semiempÃ­ricos PM3 y la TeorÃ­a de Funcional de Densidad (DFT) como mÃ©todo, con funcionales B3LYP y mpw1pw91 con base de 6-31G (d), ademÃ¡s del estudio de algunas propiedades como cargas elÃ©ctricas, densidad electrÃ³nica, potencial electrostÃ¡tico, momento dipolar, energÃ­a de solvataciÃ³n, orbitales HOMO & LUMO, entre otras. Los cÃ¡lculos computacionales tambiÃ©n se realizaron para los tautÃ³meros sustituidos en la posiciÃ³n 6 por un grupo amino y un grupo nitro. Se encontrÃ³ que la formaciÃ³n del diester cianoacetato de (2-acetil)fenilo necesario para la primera ruta se intentÃ³ sintetizar por diferentes vÃ­as de esterificaciÃ³n, notando que el peso del grupo acetil como atractor de electrones es bastante importante, por lo que la obtenciÃ³n del compuesto de interÃ©s no fue satisfactoria. La transesterificaciÃ³n del cianoacetato de etilo con el salicilato suministrando calor no produce la cumarina esperada, sin embargo se obtiene Ã¡cido salicÃ­lico. En la segunda ruta de reacciÃ³n que se encuentra reportada en la literatura se obtiene un sÃ³lido cuyo espectro de RMN 1H no satisfacen la estructura esperada. Los cÃ¡lculos computacionales muestran que el nivel de teorÃ­a utilizado no es suficiente para determinar cual especie se encuentra preferentemente al calcular la constante de equilibrio, mientras que si se toma el calor de formaciÃ³n para analizar la estabilidad los resultados se acercan mÃ¡s a lo observado experimentalmente','2009-04-30','Cianocumarinas. Modelaje Molecular',6,1,1,1,1,'2013-09-17 08:24:29','2013-09-17 08:24:29','Documento_109.pdf','application/pdf',1100743,'2013-09-17 08:24:29',20,0,127,'COMPLETO'),(110,'ESTUDIO ANALITICO DEL COMPORTAMIENTO DE OSCILADORES ACOPLADOS Estudio AnalÂ¶Â³tico delComportamiento de OsciladoresAcoplados','{}','2009-04-30','{}',5,1,1,1,1,'2013-09-17 08:24:31','2013-09-17 08:24:31','Documento_110.pdf','application/pdf',1571147,'2013-09-17 08:24:31',20,0,55,'COMPLETO'),(111,'DiseÃ±o y EvaluaciÃ³n de un sistema colorimetrico para anÃ¡lisis clÃ­nicos en celdas ELISA','La mayorÃ­a de los anÃ¡lisis clÃ­nicos que se realizan en la actualidad, se basan en ensayos colorimÃ©tricos, donde las propiedades Ã³pticas de la sustancia de interÃ©s, permiten su detecciÃ³n y posterior cuantificaciÃ³n, mediante la aplicaciÃ³n de la Ley de Beer. Para detectar la radiaciÃ³n absorbida por el analito, suelen utilizarse espectrÃ³metros sencillos, tales como fotocolorÃ­metros y/o equipos dispersivos altamente sofisticados, tales como espectrofotÃ³metros o sistemas multicanal. Normalmente en este tipo de anÃ¡lisis, se requiere procesar simultÃ¡neamente una elevada cantidad de muestras, por tal razÃ³n se han desarrollado los denominados \"lectores de placas de ELISA\", que permiten medir en un solo paso hasta 96 muestras. Estos lectores presentan una alta sensibilidad y emplean sistemas mecÃ¡nicos para desplazar la muestra y leer los 96 pozos uno a uno o en el mejor de los casos en grupos de 8. En el presente trabajo, se construyÃ³ un analizador colorimÃ©trico, para ser utilizado en la realizaciÃ³n de algunos ensayos del tipo inmuno-enzimÃ¡ticos, ELISA. Este analizador tiene una fuente de radiaciÃ³n que consiste de un arreglo plano de diodos de emisiÃ³n de luz, leds, color blanco. El receptÃ¡culo de la muestra es una placa ELISA de 96 micro-pozos y el sistema de detecciÃ³n es una cÃ¡mara Web. El dispositivo se utilizÃ³ para determinar simultÃ¡neamente la absorciÃ³n de luz sobre soluciones coloreadas, contenidas en los micro-pozos de la placa ELISA. Para el tratamiento de los datos, se diseÃ±Ã³ un software que permite capturar las imÃ¡genes de la placa, digitalizarla y separarla en sus componentes RGB (rojo, verde y azul) e intensidad. De esta manera, se transforman las imÃ¡genes en superficies de respuesta de intensidades para cada color al que responde los filtros de la cÃ¡mara, permitiendo de esta forma al compararlo con una referencia, calcular la absorbancia de un punto en particular de la imagen y asÃ­ mediante una curva de calibraciÃ³n obtener la concentraciÃ³n de una determinada sustancia en ese punto. El sistema colorimÃ©trico se comparÃ³ con respecto a un espectrofotÃ³metro convencional, se obtuvo una menor sensibilidad del primero respecto al segundo, no obstante los demÃ¡s parÃ¡metros de calibraciÃ³n, fueron similares en magnitud con lo cual se concluyÃ³ que ambos sistemas presentaban una eficiencia analÃ­tica similar .Finalmente, se evaluÃ³ la aplicaciÃ³n del analizador, en la determinaciÃ³n de las concentraciones de glucosa y de proteÃ­nas en plasma de ratas. Se obtuvieron en los animales estudiados, niveles de glucosa en el intervalo de 750 a 3000 mg.L-1, mientras que para los proteÃ­nas, los niveles fueron de 2.5 a 10 g/100 mL. Ambos resultados estÃ¡n dentro de los niveles normales, para la glucosa 600 - 1000 mg.L-1 y para las proteÃ­nas entre 6,4 - 8,3 g/100 mL-1, con estos valores los animales presentan ausencia en las patologÃ­as esperadas, esto es diabetes y enfermedades renales, respectivamente. Los resultados obtenidos fueron comparados con aquellos suministrados por un espectrÃ³metro convencional, se encontrÃ³ que los resultados no presentan diferencias significativas a un nivel de confianza del 95%, lo que indica una alta exactitud del sistema. Estos resultados permitieron validar la eficiencia del analizador diseÃ±ado en la realizaciÃ³n de estos anÃ¡lisis clÃ­nicos en muestras reales. Por otro lado, se obtiene una precisiÃ³n del 7-8% para el sistema colorimÃ©trico y de 4-6% en el espectrÃ³metro al determinar proteÃ­nas; mientras que para la glucosa se obtuvo una precisiÃ³n de 2-9% en el sistema propuesto.','2009-04-29','sistema colorimÃ©trico, anÃ¡lisis clÃ­nicos, celdas ELISA,muestras biologicas, glucosa, proteÃ­nas.',6,1,1,1,1,'2013-09-17 08:24:31','2013-09-17 08:24:31','Documento_111.pdf','application/pdf',976505,'2013-09-17 08:24:31',20,0,75,'COMPLETO'),(112,'ESPECTROMETRÃÃAA GAMMA IN SITU DE ALTA RESOLUCIÃ“Ã“NN SOBRE ZONAS PETROLERAS DEL ESTADO MONAGAS..','El siguiente trabajo presenta los resultados de una investigaciÃ³n espectromÃ©trica orientada a la posibilidad de verificar la existencia de anomalÃ­as en las concentraciones (actividad por unidad de masa) de radionÃºclidos naturales pertenecientes a las series del U-238, Th-232 y el radionÃºclido K-40 sobre zonas petroleras del estado Monagas, empleando para ello espectrometrÃ­a gamma \"in situ\" con un detector de GeHp (Germanio hiperpuro). En primer lugar se verificÃ³ la posibilidad de llevar a cabo la calibraciÃ³n en eficiencia siguiendo la metodologÃ­a convencional desarrollada por Beck y cols. (Laboratorio de mediciones ambientales, Departamento de energÃ­a de los Estados Unidos), luego se verificÃ³ la exactitud de las concentraciones determinadas con el programa ISOTOPIC en un campo de prueba comparÃ¡ndolas con las obtenidas mediante la calibraciÃ³n en eficiencia (siguiendo la metodologÃ­a convencional) y el anÃ¡lisis de muestras de suelo en laboratorio. Los sitios de mediciÃ³n (estaciones) se ubicaron sobre una transecta de 40 puntos (separados por 250 m) que pasaba por dos pozos petroleros, uno productivo y el otro seco. Ambos pertenecientes al campo petrolero Amarilis. El tiempo de mediciÃ³n en cada punto de la transecta fue de 1800 s. Se determinÃ³ la variaciÃ³n diurna en las tasas de conteo de los radionÃºclidos de distintos radionÃºclidos de las series del U-238, del Th-232 y el radionÃºclido K-40, encontrando una tendencia a disminuir con la hora del dÃ­a (variaciÃ³n diurna en la tasa de conteo), no obstante dicha disminuciÃ³n fue independiente de la energÃ­a del radionÃºclido. Se determinaron las concentraciones de los radionÃºclidos Pb-214 (lÃ­nea de 352 keV) y Bi-214 (lÃ­neas de 609 y 1765 keV) correspondientes a la serie del U-238, los radionÃºclidos Pb-212 (lÃ­nea de 239 keV), Tl-208 (lÃ­nea de 2615 keV) y Ac-228 (lÃ­neas de 338 y 911 keV) correspondientes a la serie del Th-232 y el radionÃºclido K-40 (1461 keV), para todos los puntos de la transecta. Se encontrÃ³ que, de los radionÃºclidos estudiados para la serie del U-238, sÃ³lo la energÃ­a de 609 keV del Bi-214 presentÃ³ los menores valores de concentraciÃ³n en las estaciones cercanas al pozo productivo, no obstante este resultado no necesariamente ha de ser atribuible a la presencia de hidrocarburos en el subsuelo. Se realizÃ³ un procedimiento denominado normalizaciÃ³n al torio, con el fin de determinar la presencia o no de anomalÃ­as producidas por hidrocarburos en el subsuelo y suprimir cualquier efecto producido por la litologÃ­a de la superficie, la humedad del suelo, la presencia de vegetaciÃ³n y la geometrÃ­a de conteo. Los resultados obtenidos no mostraron el comportamiento esperado de acuerdo a la teorÃ­a sobre la zona del pozo productivo (estaciÃ³n 15), este resultado puede ser debido a las bajas concentraciones del radionÃºclido K-40 observadas a lo largo de la transecta.','2009-04-27','EspectrometrÃ­a gamma in situ, calibraciÃ³n en eficiencia, normalizaciÃ³n al torio',3,1,1,1,1,'2013-09-17 08:24:32','2013-09-17 08:24:32','Documento_112.pdf','application/pdf',2047505,'2013-09-17 08:24:32',20,0,116,'COMPLETO'),(113,'EFECTO DE LAS EMULSIONES ASFÃLTICAS Y LA ROCA FOSFÃ“RICA SOBRE LA ADSORCIÃ“N DE P EN SUELOS ÃCIDOS DE SABANAS DE PEDOGÃ‰NESIS CONTRASTANTES','En el presente trabajo se estableciÃ³ un diseÃ±o experimental para estudiar los cambios de adsorciÃ³n de fÃ³sforo en presencia de roca fosfÃ³rica y emulsiones asfÃ¡lticas de rompimiento lento (catiÃ³nica y aniÃ³nica), en suelos Ã¡cidos de pedogÃ©nesis contrastantes ubicados en el estado GuÃ¡rico (EstaciÃ³n Experimental la Iguana). Se encontrÃ³ que la presencia de las emulsiones afectÃ³ notablemente la adsorciÃ³n de fosfato y este efecto dependiÃ³ de la manera en la cual fue aÃ±adido el fosfato y la emulsiÃ³n; sin embargo no se observaron diferencias en la disminuciÃ³n de P, entre la emulsiÃ³n catiÃ³nica y la aniÃ³nica. Por otra parte, la fertilizaciÃ³n de los suelos junto a la aplicaciÃ³n de las emulsiones con un perÃ­odo de incubaciÃ³n de 10 dÃ­as disminuyeron marcadamente la adsorciÃ³n de P, por la combinaciÃ³n de efectos por parte de la roca fosfÃ³rica y las emulsiones. Es posible explicar las secuencias de adsorciÃ³n obtenidas tomando en consideraciÃ³n que el efecto de la emulsiÃ³n sobre la adsorciÃ³n del fosfato, no se debe a una simple competencia por los sitios activos de adsorciÃ³n, sino que hay en juego otros factores, como: el posible efecto bloqueador que ejercen los surfactantes cuando se desprenden de las emulsiones; el tiempo y la temperatura los cuales juegan un papel importante en el rompimiento de las emulsiones; la fertilizaciÃ³n ya que por medio de ella se puede disminuir el aluminio y el hierro, los cuales retienen e inmovilizan el P que puede ser usado por las plantas. El fenÃ³meno de adsorciÃ³n se estudiÃ³, obteniendo isotermas de adsorciÃ³n a partir de concentraciones bajas de P (0, 20, 40, 50, 60, 80 y 100) Âµg/g. Al graficar la concentraciÃ³n de P en el equilibrio contra el P adsorbido, la tendencia de los resultados experimentales se ajusto mejor al modelo de Langmuir, mostrando una disminuciÃ³n en la cantidad de fÃ³sforo adsorbido con los tratamientos aplicados.','2009-04-14','Isotermas de adsorciÃ³n de FosfÃ³ro en suelos de pedogÃ©nesis contrastantes. Emulsiones asfÃ¡lticas y roca fosfÃ³rica en suelos Ã¡cidos de sabanas.',6,1,1,1,1,'2013-09-17 08:24:36','2013-09-17 08:24:36','Documento_113.pdf','application/pdf',2489996,'2013-09-17 08:24:36',20,0,149,'COMPLETO'),(114,'\"ActivaciÃ³n de Residuales y materiales carbonosos para promover la gasificaciÃ³n catalÃ­tica\"','En el presente trabajo se estudia la posible activaciÃ³n catalÃ­tica para gasificaciÃ³n con vapor de agua de varios materiales carbonosos de bajo valor agregado que se obtienen en el circuito refinador de Venezuela. Se seleccionaron coques retardados identificados con P (coque Petrozuata) y A (coque Amuay), asÃ­ como Flexicoque. Para el caso del Flexicoque, la muestra original se tratÃ³ previamente para lograr la remociÃ³n selectiva de V y Ni, permitiendo una evaluaciÃ³n del papel catalÃ­tico de estos metales por separado. Todas las muestras fueron sometidas a las diferentes reacciones parciales que conforman el proceso de gasificaciÃ³n con vapor de agua, utilizado industrialmente a nivel mundial en paÃ­ses como Estados Unidos, China, y SudÃ¡frica, entre otros. Las reacciones estudiadas fueron: pirolisis, oxidaciÃ³n, reacciÃ³n con diÃ³xido de carbono (reacciÃ³n de Bouduard), y propiamente la gasificaciÃ³n con vapor de agua. Previamente, las muestras fueron caracterizadas mediante las tÃ©cnicas de ICP- OES, DRX, XPS y estudio textural, por medio de las cuales se obtuvo la composiciÃ³n elemental de las muestras, distribuciÃ³n de los metales en la superficie, y el Ã¡rea superficial de microporo y volumen de poro. La interpretaciÃ³n de los resultados analÃ­ticos permitiÃ³ alcanzar una correlaciÃ³n fisicoquÃ­mica entre la composiciÃ³n de los materiales carbonosos y la actividad. Las reacciones seleccionadas fueron llevadas a cabo principalmente en un termobalanza, utilizada como minireactor, acoplada a un cuÃ¡druplo de masas, con la finalidad de monitorear los gases consumidos y producidos en el transcurso de las reacciones. Los productos gaseosos identificados fueron hidrÃ³geno, metano, vapor de agua, monÃ³xido de carbono, oxÃ­geno, y diÃ³xido de carbono. Los estudios permitieron demostrar la actividad catalÃ­tica de los metales presentes de manera indÃ­gena en las muestras carbonosas: vanadio para la reacciÃ³n de oxidaciÃ³n y nÃ­quel en las reacciones de Bouduard y gasificaciÃ³n con vapor de agua.','2009-03-20','cpque retardado, flexicoque, gasificaciÃ³n, catalisis, vanadio y nÃ­quel.',6,1,1,1,1,'2013-09-17 08:24:38','2013-09-17 08:24:38','Documento_114.pdf','application/pdf',3306733,'2013-09-17 08:24:38',20,0,146,'COMPLETO'),(115,'DISEÃ‘O DE UN EQUIPO DE DISPERSIÃ“N DINÃMICA DE LUZ PARA EL ESTUDIO DE LA AGREGACIÃ“N DE ASFALTENOS','En el presente trabajo especial de grado se diseÃ±Ã³, implementÃ³ y optimizÃ³ un equipo de dispersiÃ³n dinÃ¡mica de luz para medir el tamaÃ±o de nanopartÃ­culas y posteriormente se probÃ³ su funcionalidad en la detecciÃ³n del punto de floculaciÃ³n y la medida de la cinÃ©tica de agregaciÃ³n de asfaltenos. Los resultados obtenidos demuestran que el equipo es capaz de monitorear la agregaciÃ³n de los asfaltenos asÃ­ como de medir su punto de floculaciÃ³n. Es posible medir partÃ­culas que van desde los 50 nm hasta unos pocos mm. El equipo consta de un lÃ¡ser He-Ne (l = 632 nm) como fuente, un fotomultiplicador como detector, un amplificador de corriente, una tarjeta de adquisiciÃ³n de datos, material Ã³ptico (espejos y polarizadores), una celda de 0,5 cm de espesor como contenedor de la muestra y un software creado para la adquisiciÃ³n de los datos y cÃ¡lculo del tamaÃ±o de las partÃ­culas. La optimizaciÃ³n de las variables de mediciÃ³n se realizÃ³ con partÃ­culas de LÃ¡tex cuyo diÃ¡metro nominal es de 150 nm. Las variables optimizadas fueron: Voltaje del fotomultiplicador, factor de ganancia del amplificador, frecuencia de muestreo, nÃºmero de muestras e iteraciones. Se determinÃ³ el diÃ¡metro de las partÃ­culas de lÃ¡tex obteniÃ©ndose un valor de tamaÃ±o de partÃ­culas muy cercano al reportado por la compaÃ±Ã­a elaboradora de las mismas con un error relativo de 3,5%. Una vez optimizado el equipo se midieron soluciones de asfalteno Furrial en tolueno con distintos porcentajes de n-heptano, obteniÃ©ndose que para una soluciÃ³n de 500 ppm a un porcentaje de n-heptano de 75% aproximadamente se encuentra el punto de floculaciÃ³n, mientras que para una soluciÃ³n de 1000 ppm Ã©ste se encuentra entre 65-70% de n-heptano. Se midieron las soluciones de 500 ppm y 1000 ppm con un porcentaje de n-heptano igual 60% y 57% respectivamente en el tiempo, encontrÃ¡ndose un comportamiento similar a un tipo de agregaciÃ³n conocida como \"agregaciÃ³n limitada por reacciÃ³n\" para la soluciÃ³n de 500 ppm, mientras que para la soluciÃ³n de 1000 ppm se observÃ³ un comportamiento errÃ¡tico el cual no puede describirse con ningÃºn modelo reportado en la bibliografÃ­a.','2009-04-24','DLS , dispersiÃƒÂ³n dinÃƒÂ¡mica de luz, FloculaciÃƒÂ³n, Asfaltenos, CinÃƒÂ©tica de agregaciÃƒÂ³n, PCS, dynamic light scattering',6,1,1,1,1,'2013-09-17 08:24:39','2013-09-17 08:24:39','Documento_115.pdf','application/pdf',2591273,'2013-09-17 08:24:39',19,0,118,'COMPLETO'),(116,'Evaluar por medio de un mÃ©todo quÃ­mico-enzimÃ¡tico el efecto del consumo de carbohidratos simples y complejos sobre el contenido de glucosa, trehalosa y glucÃ³geno en el gorgojo de arroz (Sitophilus oryzae)','En el presente trabajo, se estudiÃ³ el efecto del consumo de carbohidratos complejos de diferente biodisponibilidad (almidÃ³n de maÃ­z y almidÃ³n de papa) y de un carbohidrato simple (glucosa), sobre el contenido de glucosa, trehalosa y glucÃ³geno en el gorgojo de arroz (Sitophilus oryzae), mediante la utilizaciÃ³n de un mÃ©todo quÃ­mico-enzimÃ¡tico. AdemÃ¡s se analizÃ³ cÃ³mo son afectadas las principales rutas metabÃ³licas en la presencia de estos carbohidratos, a travÃ©s de la composiciÃ³n corporal. El mÃ©todo-quÃ­mico enzimÃ¡tico, permite cuantificar los niveles de glucosa, trehalosa y glucÃ³geno en el gorgojo de arroz. Para la aplicaciÃ³n del mÃ©todo es necesario deshidratar y desgrasar a los insectos, con lo cual se asegura la inactivaciÃ³n de las enzimas presentes en el homogeneizado. Se determinÃ³ que cantidades de glucosa mayores a 0,11 mg, obtenidas por hidrÃ³lisis de trehalasa (0,1 U), deben ser diluidas para no subestimar el contenido de trehalosa y se requiere un mÃ­nimo 30 insectos. La ingesta de carbohidratos complejos (almidÃ³n de maÃ­z y almidÃ³n de papa), que difieren en su contenido de almidÃ³n resistente total, ocasionaron un aumento en el peso y en las reservas corporales (glucÃ³geno y grasas), con relaciÃ³n al control positivo (arveja). La ganancia fue mayor en insectos alimentados con almidÃ³n de maÃ­z (15,04 Â± 0,88 %; 0,233 Â± 0,032 % grasa y glucÃ³geno, respectivamente). Indicando que el mayor contenido de almidÃ³n resistente total (almidÃ³n de papa), afecta la biodisponibilidad del almidÃ³n. El suministro de un carbohidrato simple (glucosa 5 %), disminuyÃ³ el peso de los insectos un 5 % (respecto al control positivo), a pesar del acentuado decrecimiento en el contenido de grasa (8,83 Â± 1,63 %). Por otra parte, los resultados obtenidos para los insectos sometidos a ayuno y ayuno con suministro de agua, sugirieron que un incremento del agua corporal, parece favorecer al mejor aprovechamiento de las reservas del individuo. El contenido de glucosa y glucÃ³geno en los insectos se vio influenciado por los diferentes carbohidratos suministrados. Sin embargo, no se altera el nivel de trehalosa en la hemolinfa del insecto. Esto podrÃ­a indicar, que el mantenimiento de este disacÃ¡rido es fundamental para el organismo. Los carbohidratos simples y complejos, promovieron la pÃ©rdida de las proteÃ­nas corporales con respecto al control positivo. Los anÃ¡lisis estadÃ­sticos de correlaciones simples y de componentes principales, seÃ±alaron que el contenido de agua corporal presenta una correlaciÃ³n negativa con el contenido de grasa corporal. Por otro lado, se obtuvo que las variables de glucosa, de glucÃ³geno y de grasa presentaron correlaciones positivas entre ellas, siendo mayor para las dietas de almidÃ³n. Las variables de supervivencia, variaciÃ³n de peso corporal y contenido de trehalosa, presentaron una correlaciÃ³n positiva y las dietas de carbohidratos no influyen directamente sobre la variable trehalosa.','2009-04-28','Normal 0 MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso- padding-alt:0in 5.4pt 0in 5.4pt; mso-par',1,1,1,1,1,'2013-09-17 08:24:42','2013-09-17 08:24:42','Documento_116.pdf','application/pdf',2542359,'2013-09-17 08:24:42',20,0,124,'COMPLETO'),(117,'ESTUDIO DE LA INTERACCIÃ“N DEL ANTICUERPO FAB G17.12 CON LA MSP-119 DE PLASMODIUM VIVAX EMPLEANDO MODELADO MOLECULAR, SELECCIÃ“N Y SÃNTESIS DE LOS PÃ‰PTIDOS INVOLUCRADOS EN LA INTERACCIÃ“N CON POSIBLE PROPIEDAD ANTIGÃ‰NICA','En el presente Trabajo Especial de Grado se realizÃ³ un estudio de modelado molecular (Docking) del complejo de la proteÃ­na MSP119 de P.vivax con la regiÃ³n Fab del anticuerpo G17.12. Este complejo se construyÃ³ a partir de la estructura cristalina del anticuerpo reportada por Pizarro y col.[38] para el complejo PfMSP119/FabG17.12 (pdb:1ob1) y la estructura de la MSP119 de P.vivax previamente modelada por homologÃ­a por Serrano y col.[36] El estudio docking se llevÃ³ a cabo empleando el programa o software libre PatchDock, el cual realiza la aproximaciÃ³n de cuerpo rÃ­gido para obtener las estructuras iniciales del complejo entre la PvMSP119 y el FabG17.12. Luego se empleÃ³ el programa FireDock y RosettaDock para el refinamiento de las soluciones obtenidas. Este estudio revelÃ³ que el complejo mÃ¡s estable entre la PvMSP119 y el FabG17.12 tiene una energÃ­a de -336,33 KCal/mol, donde se establecen un total de ochenta y seis interacciones entre las especies involucradas. BasÃ¡ndonos en este modelo del complejo se determinÃ³ que la regiÃ³n de interacciÃ³n de la PvMSP119 se extiende desde Met 1 hasta Asp 9 y luego desde Asn 11 hasta Arg 20, en la regiÃ³n N- Terminal; regiÃ³n que tambiÃ©n es similarmente reconocida en el complejo reportado para P.falciparum. Adicionalmente se observa otra regiÃ³n de interacciÃ³n comprendida entre Ser 89 y Ser 91 y desde Glu 80 hasta Glu 84, en la regiÃ³n C-Terminal. Dentro de las interacciones consideradas se enumeran las atractivas y repulsivas de van der Waals, la formaciÃ³n de puentes de hidrÃ³geno, solvataciÃ³n y un tÃ©rmino que incluye la frecuencia estadÃ­stica de interacciÃ³n entre pares de aminoÃ¡cidos.De los fragmentos de interacciÃ³n determinados, se escogiÃ³ para su sÃ­ntesis un fragmento de diecisÃ©is aminoÃ¡cidos ubicado en la regiÃ³n N-Terminal de la PvMSP119 que va desde la His 5 hasta la Arg 20 y que incluye un puente disulfuroentre la Cys 7 y la Cys 18 con la finalidad de obtener un pÃ©ptido con una estructura tridimensional similar a la del fragmento correspondiente dentro de la proteÃ­na. La sÃ­ntesis se llevÃ³ a cabo manualmente en fase sÃ³lida por la estrategia Fmoc/tBu, empleando la resina cloruro de 2- clorotritilo y mezcla activante HOBT/ TBTU. El espectro de masas indicÃ³ que la sÃ­ntesis del pÃ©ptido lineal se llevÃ³ a cabo adecuadamente; sin embargo el proceso de oxidaciÃ³n con yodo de las cisteÃ­nas (protegidas con el grupo Acm) para dar lugar a la formaciÃ³n del puente disulfuro, no ocurriÃ³ como era esperado. Los resultados obtenidos en este trabajo nos permiten ampliar el estudio en la bÃºsqueda de un antÃ­geno o grupo de antÃ­genos contra la infecciÃ³n causada por el Plasmodium vivax en pro de avanzar hacia una futura vacuna contra la Malaria.','2009-02-19','Malaria, PvMSP1(19), Plasmodium vivax, FabG17.12, Docking',6,1,1,1,1,'2013-09-17 08:24:42','2013-09-17 08:24:42','Documento_117.pdf','application/pdf',2353990,'2013-09-17 08:24:42',20,0,90,'COMPLETO'),(118,'El problema de Amplitud vs Offset como un polinomio de 5to grado','{}','2009-04-28','ReflexiÃ³n y transmisiÃ³n de ondas, problema de inversiÃ³n, EcuaciÃ³n de Zoeppritz, AVO(Amplitud vs Offset)',5,1,1,1,1,'2013-09-17 08:24:43','2013-09-17 08:24:43','Documento_118.pdf','application/pdf',1589609,'2013-09-17 08:24:43',20,0,102,'COMPLETO'),(119,'DESARROLLO DE UNA METODOLOGÃA CROMATOGRÃFICA PARA DETERMINAR COMPUESTOS DE AZUFRE EN COMBUSTIBLES LIVIANOS EMPLEANDO HIDRÃ“GENO COMO GAS PORTADOR','La determinaciÃ³n de azufre en combustibles livianos se ha venido realizando mediante el uso de tÃ©cnicas analÃ­ticas tales como: Espectroscopia de Fluorescencia de rayos-X por onda dispersiva (ASTM D-2622) [3] y Espectroscopia de Fluorescencia Ultravioleta (ASTM D-5453)[2], sin embargo, Ã©stas metodologÃ­as sÃ³lo permiten cuantificar el azufre total presente en el combustible. Desde hace varios aÃ±os en PDVSA-Intevep se emplea una metodologÃ­a capaz de determinar compuestos azufrados en combustibles livianos por cromatografÃ­a de gases con detecciÃ³n selectiva de azufre (adaptaciÃ³n de la Norma ASTM D-5623) [4]. La misma proporciona la caracterizaciÃ³n cromatogrÃ¡fica de compuestos azufrados de hasta 15 Ã¡tomos de carbono y no es capaz de identificar de manera individual las fracciones correspondientes a las familias de los tiofenos y benzotiofenos, debido a la poca separaciÃ³n que presentan las huellas cromatogrÃ¡ficas en esta zona. El objetivo de este trabajo fue encontrar condiciones cromatogrÃ¡ficas que ofrecieran una resoluciÃ³n y eficiencia tal que se puedieran identificar los constituyentes de las familias de los tiofenos y benzotiofenos. Para ello fue necesario sustituir el gas portador helio por hidrÃ³geno , el cual, debido a sus propiedades fÃ­sicas, proporcionÃ³ una mejor resoluciÃ³n cromatogrÃ¡fica. Esta modificaciÃ³n permitiÃ³ la identificaciÃ³n de gran cantidad de componentes individuales mediante la comparaciÃ³n con los tiempos de retenciÃ³n de los patrones certificados de azufre en las familias, y, adicionalmente se ampliÃ³ el nÃºmero de compuestos identificados que eluyen de la columna. Aquellos compuestos de interÃ©s que no fue posible caracterizar mediante la comparaciÃ³n con los tiempos de retenciÃ³n de los patrones certificados, fueron estudiados a travÃ©s de la tÃ©cnica CG-EM, resultando un posible compuesto: el etil hexil sulfuro, asignado en una zona en especÃ­fico debido a la interferencia de los hidrocarburos, los cuales se encuentran en mayor proporciÃ³n que los compuestos azufrados, ademÃ¡s que dichas muestras contienen muchos compuestos azufrados que en muchos casos son isÃ³meros. Al realizar el anÃ¡lisis cuantitativo se demostrÃ³ que los resultados obtenidos mediante el mÃ©todo desarrollado son equivalentes a los obtenidos con las otras tÃ©cnicas (Espectroscopia de Fluorescencia de rayos-X por onda dispersiva[3] y Espectroscopia de Fluorescencia Ultravioleta [2] y azufre discriminado, que se lleva a cabo en PDVSA-Intevep).','2009-04-22','CromatografÃ­a de gases, Quimiluminiscencia, Combustibles livianos, Nafta, Azufre',6,1,1,1,1,'2013-09-17 08:24:44','2013-09-17 08:24:44','Documento_119.pdf','application/pdf',2452072,'2013-09-17 08:24:44',20,0,157,'COMPLETO'),(120,'Estudio de los Complejos de Vanadio (III) y el AminoÃ¡cido Leucina','{}','2009-04-29','Fuerzas ElectromotricesVanadio (III) LeucinaComplejosAminoÃ¡cido Equilibrios en SoluciÃ³n',6,1,1,1,1,'2013-09-17 08:24:45','2013-09-17 08:24:45','Documento_120.pdf','application/pdf',1551038,'2013-09-17 08:24:45',19,0,93,'COMPLETO'),(121,'Determinacion de fenoles en agua por CromatografÃ­a de LÃ­quidos con preconcentraciÃ³n en fase solida','UNIVERSIDAD CENTRAL DE VENEZUELAFACULTAD DE CIENCIASESCUELA DE QUIMICA \"DETERMINACIÃ“N DE FENOLES EN AGUA POR CROMATOGRAFÃA DE LÃQUIDOS CON PRECONCENTRACIÃ“N EN FASE SÃ“LIDA\"Trabajo Especial de Grado, para optar al TÃ­tulo de Licenciado en QuÃ­mica. Autor: Cesar EspaÃ±olTutores: Dra. Nereida CarriÃ³nDr. AndrÃ©s Escalona RESUMEN En el desarrollo del estudio de los fenoles considerados por la EPA como contaminantes de remociÃ³n prioritaria en los cuerpos acuosos por CromatografÃ­a de LÃ­quidos de Alta ResoluciÃ³n (HPLC) se determinaron las condiciones Ã³ptimas para la separaciÃ³n, determinaciÃ³n y cuantificaciÃ³n de estos compuestos los cuales son elevadamente tÃ³xicos. Adicionalmente se calcularon las figuras de mÃ©rito para la separaciÃ³n cromatogrÃ¡fica obteniendo resultados que permiten utilizar el mÃ©todo cromatogrÃ¡fico como una alternativa para la regulaciÃ³n de lÃ­quidos que sean o vayan a ser descargados en forma directa o indirecta a rÃ­os, estuarios, lagos y embalses; y de esta forma realizar controles ambientales.Se realizaron estudios de la capacidad de adsorciÃ³n por alÃºminas modificadas con surfactantes de estos fenoles utilizando este sÃ³lido como material adsorbente en la extracciÃ³n en fase sÃ³lida.La alÃºmina modificada fue evaluada con dos procedimientos para la adsorciÃ³n segÃºn el volumen de soluciÃ³n a utilizar encontrÃ¡ndose diferencias significativas entre ambos procedimientos. En el primer procedimiento se utilizaron jeringas para hacer pasar las soluciones por medio de presiÃ³n positiva por el cartucho y en el segundo procedimiento se utilizÃ³ una bomba peristÃ¡ltica para este fin; siendo este ultimo procedimiento con el que se obtienen los resultados mas bajos de recuperaciÃ³n (11%) comparados con las recuperaciones cercana al 100% encontradas en el primer procedimiento.Al no obtener los resultados esperados en las experiencias de preconcentraciÃ³n se recomienda estudiar con mayor profundidad el segundo procedimiento con el fin de encontrar las condiciones de flujo que permitan una mayor adsorciÃ³n y recuperaciÃ³n de los fenoles por el sÃ³lido utilizado; y de esta forma encontrar las causas de la diferencia entre los resultados de ambos procedimientos utilizados en esta investigaciÃ³n.','2009-04-28','Fenoles; Cromatograia de Liquidos (HPLC); alÃºminas; Extraccion en fase sÃ³lida',6,1,1,1,1,'2013-09-17 08:24:46','2013-09-17 08:24:46','Documento_121.pdf','application/pdf',2979219,'2013-09-17 08:24:46',20,0,146,'COMPLETO'),(122,'ESTUDIO FITOQUÃMICO DEL ALGA Penicillus capitatus Y EVALUACIÃ“N DE SU POSIBLE ACTIVIDAD ANTIINFLAMATORIA','Se realizÃ³ el estudiÃ³ fotoquÃ­mico del alga verde Penicillus capitatus Lamarck, y la evaluaciÃ³n de la actividad antiinflamatoria de los metabolitos secundarios aislados. Las tÃ©cnicas de separaciÃ³n utilizadas fueron la cromatografÃ­a en capa fina y cromatografÃ­a en columna (utilizando sÃ­lica gel y C18 como fases estacionarias). Para la identificaciÃ³n de los metabolitos se utilizaron las tÃ©cnicas de resonancia magnÃ©tica nuclear de 1H, 13C, DEPT, COSY y HSQC; espectrometrÃ­a de masas y espectrometrÃ­a de infrarrojo. A partir del extracto de hexano se lograron aislar, purificar e identificar 3 compuestos. Dos de ellos tipo sulfoquinovosil diacil glicerol (con cadenas lipÃ­dicas saturadas de 16 y 18 Ã¡tomos de carbono), no reportados para algas verdes, y un compuesto nuevo tipo digalactoglicerolÃ­pido. Del extracto hidrometanÃ³lico se lograron aislar 2 compuestos: uno de tipo amino Ã©ster, y otro cuya data espectroscÃ³pica coincidiÃ³ con los compuestos 3-hidroxi-propanoato de etilo y el Ã¡cido 3-etoxi-propanÃ³ico. El compuesto tipo sulfoquinovosil diacil glicerol con dos cadenas saturadas de 18 Ã¡tomos de carbono, presentÃ³ una mayor actividad antiinflamatoria (IC50 = 43.62 mg/mL) debido a que inhibiÃ³ la producciÃ³n de NO sin ser citotÃ³xico.','2009-04-28','Penicillus capitatus, Estudio FtoquÃ­mico, GlicolÃ­pidos, Sulfoquinovosil diacil glicerol, digalactolÃ­pido, algas verdes',6,1,1,1,1,'2013-09-17 08:24:47','2013-09-17 08:24:47','Documento_122.pdf','application/pdf',0,'2013-09-17 08:24:47',19,0,0,'INCOMPLETO'),(123,'CaracterizaciÃ³Ã³nn de Litofacies en el Pozo SaltarÃ­Ã­n 11A a travÃ©Ã©s de la determinaciÃ³Ã³nn experimental de parÃ¡Ã¡metros magnÃ©Ã©ticos y su inferencia por medio de la tÃ©Ã©cnica de Redes Neuronales Difusas','RESUMEN En este trabajo, hemos estudiado el potencial del anÃ¡lisis neuronal difuso en la inferencia de relaciones matemÃ¡ticas entre parÃ¡metros magnÃ©ticos, tales como cociente S y susceptibilidad magnÃ©tica. Hemos realizado medidas de susceptibilidad magnÃ©tica (h) y del cociente S (S) en 134 muestras que abarcaron aproximadamente 670 metros de profundidad, en un pozo petrolero al este de Colombia, cuenca sedimentaria de los Llanos Orientales. Estas muestras contienen areniscas y limolitas de las formaciones Guayabo, LeÃ³n y Carbonera (Mioceno Superior/Medio/Inferior y Plioceno Superior). El mÃ©todo de redes neuronales difusas ha sido usado previamente para obtener otras propiedades petrofÃ­sicas, tales como permeabilidad a partir de valores experimentales de porosidad. Sin embargo, esta es la primera vez que esta tÃ©cnica se aplica a propiedades magnÃ©ticas. Los resultados obtenidos de esta inferencia, fueron comparados e integrados con los valores experimentales. La diferencia entre los valores inferidos y los datos experimentales del cociente S, disminuye al alimentar la red neuronal difusa con datos previamente clasificados y agrupados segÃºn: divisiÃ³n operacional en campo, edades geolÃ³gicas (envolventes transgresivas) y por ambiente reductor. Esta tÃ©cnica ademÃ¡s nos ha permitido identificar cambios de las condiciones paleoambientales durante la formaciÃ³n de la cuenca sedimentaria de los Llanos Orientales (Colombia).','2009-04-21','Palabras clave:: Redes neuronales difusas, susceptibilidad magnÃ©tica, cociente S, magnetoestratigrafÃ­a, paleoambiente.',3,1,1,1,1,'2013-09-17 08:24:48','2013-09-17 08:24:48','Documento_123.pdf','application/pdf',4474200,'2013-09-17 08:24:48',20,0,169,'COMPLETO'),(124,'Una IntroducciÃ³n a la GeometrÃ­a EstocÃ¡stica y losProcesos de PartÃ­culas Aleatorias.','{}','2008-10-30','Procesos de PartÃ­culas, Medida de Hausdorff, Procesos Puntuales, Caminatas aleatorias.',5,1,1,1,1,'2013-09-17 08:24:49','2013-09-17 08:24:49','Documento_124.pdf','application/pdf',439180,'2013-09-17 08:24:49',20,0,69,'COMPLETO'),(125,'SINTESIS DE ZSM-5 MEDIANTE CRISTALIZACIÃ“N DE GELES ALUMINOSILICATOS EN PRESENCIA DE SURFACTANTE','Con este trabajo se inicia una lÃ­nea de investigaciÃ³n basada en la obtenciÃ³n de un nuevo material denominado zeolita mesoporosa, en la cual se combinan las propiedades de la zeolita tipo ZSM-5 y el mesoporoso tipo Al-MCM-41, para obtener un sÃ³lido que combine las ventajas de los anteriores. En este estudio se sintetizaron distintos grupos de sÃ³lidos con Gomasil, Ludox y TEOS como fuentes de silicio. La obtenciÃ³n de los mismos se realizÃ³ en un reactor tipo Parr bajo presiÃ³n autÃ³gena, siguiendo la metodologÃ­a experimental propuesta en este trabajo. Los sÃ³lidos obtenidos fueron caracterizados por distintas tÃ©cnicas: DifracciÃ³n de Rayos X (DRX), FisisorciÃ³n de nitrÃ³geno, AnÃ¡lisis QuÃ­mico, Microscopia ElectrÃ³nica de Barrido y TransmisiÃ³n. La preparaciÃ³n de los materiales zeoliticos se llevÃ³ a cabo bajo dos condiciones de gel de sÃ­ntesis. El correspondiente a la zeolita tipo ZSM-5, y el del mesoporoso Al-MCM-41. Para las fuentes de silicio estudiadas y bajo las condiciones de gel ZSM-5, los difractogramas obtenidos nos revelan la presencia de esta fase zeolitica aunque con Gomasil y TEOS se muestra una contaminaciÃ³n con cuarzo y no se observa un efecto importante del periodo de envejecimiento. Estos sÃ³lidos muestran valores de Ã¡rea especÃ­fica de alrededor de 200 (m2/g). Para los sÃ³lidos obtenidos con condiciones de gel bÃ¡sico, los patrones de DRX muestran un efecto importante en cuanto a la secuencia de cristalizaciÃ³n y la fuente de silicio utilizada. Con Gomasil se obtiene Mordenita como sÃ³lido resultante, mientras que con Ludox ocurre una formaciÃ³n parcial de la fase ZSM-5. El Tetraetilortosilicato (TEOS) resultÃ³ ser el mÃ¡s adecuado para la obtenciÃ³n de ZSM-5. El Ã¡rea especÃ­fica para el material resultante Mordenita fue de 318 (m2/g), para los obtenidos con Ludox y TEOS 157 y 128 (m2/g) respectivamente. De acuerdo a los patrones de DRX para los tamices moleculares tipo Al-MCM-41, se observa que un aumento en la temperatura y el tiempo de sÃ­ntesis tienden a mejorar el ordenamiento hexagonal. Las fuentes de silicio Gomasil y Ludox no resultaron efectivas para obtener un material tipo Al-MCM-41. Los valores de Ã¡rea especÃ­fica tienden a aumentar con el aumento de la temperatura y el tiempo de sÃ­ntesis, aumentando desde 812 (m2/g) hasta 1059 (m2/g) con un cambio de 90oC y 12 horas a 150oC y 48 horas. Para la sÃ­ntesis de la zeolita mesoporosa (sÃ³lido combinado) en condiciones de gel ZSM-5, los patrones de DRX a Ã¡ngulos bajos, no indican la presencia de un ordenamiento hexagonal, sin embargo a Ã¡ngulos altos para las fuentes de silicio Ludox y Gomasil se obtiene un DRX caracterÃ­stico de la zeolitas tipo ZSM-5, mientras que con TEOS se obtuvo una fase densa identificada como analcima. Los patrones de difracciÃ³n de rayos X a Ã¡ngulos bajos para los sÃ³lidos combinados sintetizados bajo condiciones de gel bÃ¡sico, no muestran evidencia de un ordenamiento hexagonal. ObservÃ¡ndose a Ã¡ngulos altos la formaciÃ³n incipiente de la fase ZSM-5. Sin embargo, las isotermas de adsorciÃ³n de N2 para algunos sÃ³lidos combinados, son tÃ­picas de materiales mesoporosos con una distribuciÃ³n estrecha de tamaÃ±o de poro. Mediante Microscopia ElectrÃ³nica de TransmisiÃ³n, se pudo comprobar la mesoporosidad y el ordenamiento espacial del material combinado.','2009-04-20','ZSM-5, Al-MCM-41, SÃ“LIDOS COMBINADOS, TEOS, GOMASIL,LUDOX',6,1,1,1,1,'2013-09-17 08:24:50','2013-09-17 08:24:50','Documento_125.pdf','application/pdf',0,'2013-09-17 08:24:50',20,0,0,'INCOMPLETO'),(126,'Patrones de distribuciÃ³n, anÃ¡lisis geo-espacial y determinaciÃ³n de Ã¡reas de endemismo de los mosquitos (Diptera:: Culicidae) de Venezuela.','La Familia Culicidae en Venezuela ha sido estudiada ampliamente debido a su importancia mÃ©dica, por incluir vectores de mÃºltiples enfermedades que generan altas tasas de morbilidad y mortalidad tanto en animales como en humanos. Por lo tanto el conocimiento de la distribuciÃ³n de este grupo y el anÃ¡lisis de su biogeografÃ­a histÃ³rica permitirÃ­a tener una idea acerca de su historia natural, de las razones geolÃ³gicas y ecolÃ³gicas, asÃ­ como de la epidemiologÃ­a de las enfermedades de los cuales son vectores. Esto se puede obtener realizando anÃ¡lisis de biogeografÃ­a histÃ³rica, en cuyos mÃ©todos, se presume el previo conocimiento de las Ãreas de Endemismo (AE), es por ello que la delimitaciÃ³n de estas Ã¡reas es uno de los pasos fundamentales, y uno de los mÃ¡s problemÃ¡ticos en los anÃ¡lisis biogeogrÃ¡ficos. (Crisci et al. (2000)) Se elaboraron mapas de distribuciÃ³n, y se observÃ³ que los registros compilados de Familia Culicidae se distribuyen principalmente al Norte del paÃ­s, con distribuciones particulares para algunas taxa, hacia zonas montaÃ±osas exclusivamente o la regiÃ³n del Pantepui, entre otras. Mediante anÃ¡lisis de endemismo NDM y PAE, se propuso una delimitaciÃ³n de cuatro Ã¡reas de endemismo para mosquitos: denominadas 1.) RegiÃ³n Norcentral, 2) Cordillera Andina, 3) Cordillera Oriental y 4) Macizo GuayanÃ©s. Estas Ã¡reas tambiÃ©n fueron seÃ±aladas por Navarro et al.. 2007. Se recomienda intensificar los muestreos hacÃ­a el Sur del paÃ­s, para disminuir el efecto de este sobre los patrones de distribuciÃ³n, es decir homogenizar los registros; asÃ­ como estandarizar la informaciÃ³n final que se registre en las fichas de las colecciones e incluso en las planillas de campo.','2008-12-04','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:24:52','2013-09-17 08:24:52','Documento_126.pdf','application/pdf',1136396,'2013-09-17 08:24:52',20,0,127,'COMPLETO'),(127,'ESTUDIO DE LOS COMPLEJOS DE VANADIO (IV) Y TREONINA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES (25 Â°C, KCl 3.0 M)','En el presente trabajo fueron estudiados los siguientes sistemas:H+ - treonina (HC)H+ - VO2+ - treoninapor medio de medidas de fuerzas electromotrices, emf (H), en KCl 3.0 M y a 25 Â°C .El anÃ¡lisis de los datos mediante LETAGROP arrojÃ³ los siguientes resultados: o Sistema H+H2C+ HC + H+ - treoninaHC C- + H+EspeciespKaH2C+2.56(2)HC9.41(3)s(thc)0.010 o Sistema H+ - VO2+Especies - treoninaLog bpqr(3s)[HVOC]2+10.7(2)10.93(9)10.8(1)11.06(6)10.6 (< 10.8) [VOC]+6.9 ( < 7.4)7.2 ( < 6.3)7.2 (7.4)(b = 0)7.2(1)[H2VOC2]+22.53(4)22.48 (7)22.47(3)22.7(2)22.58(4)[HVOC2]+18.66(6)18.5(2)18.54(7)18.4( < 19.0)18.46(6) [VOC2](b = 0)(b = 0)(b = 0)14.3( < 14.9)13.8(2)s(thB)0.050s(thc)0.008s (thBf)0.045s(thcf)0.361s(E) / mV0.45','2009-04-15','COMPLEJOS, SOLUCION ACUOSA, KCl 3M',6,1,1,1,1,'2013-09-17 08:24:53','2013-09-17 08:24:53','Documento_127.pdf','application/pdf',10649970,'2013-09-17 08:24:53',20,0,77,'COMPLETO'),(128,'Sobre Espacios Ramsey-TopolÃ³gicos','Teorema de Ellentuck es el resultado se inicia la teorÃ­a topolÃ³gica de Ramsey, lacual estÃ¡ desarrolloda en el trabajo de S. Todorcevic.Esta teorÃ­a estudia los espacios topolÃ³gicos en los que se puede demostrar el teorema deEllentuck, es decir, en el que la propiedad de Ramsey y la propiedad de Baire son equivalentes.Los espacios en los que esto es posible se conocen como espacios de Ramsey-TopolÃ³gicos.S. Todorcevic ha podido identificar y formalizar un conjunto de caracterÃ­sticas que describen a dichos espacios.En este trabajo revisaremos los axiomas que conforman la caracterizaciÃ³n dada porTodorcevic y mostraremos algunos ejemplos de espacios que los satisfacen. En particularestudiaremos el espacio de Ellentuck y el espacio de las matrices infinitodimensionales sobre un cuerpo finito. En este Ãºltimo contexto, estudiaremos un resultado que se refiere a coloraciones de espacios vectoriales de dimensiÃ³n infinita.','2009-04-30','Ramsey, Espacios Ramsey-TopolÃ³gicos, TeorÃ­a de Ramsey, Teorema de Ellentuck, Matrices sobre un cuerpo finito.',5,1,1,1,1,'2013-09-17 08:24:54','2013-09-17 08:24:54','Documento_128.pdf','application/pdf',1521061,'2013-09-17 08:24:54',20,0,56,'COMPLETO'),(129,'\"\"EvaluaciÃ³Ã³nn de las corrientes de generaciÃ³Ã³nn de contaminantes sÃ³Ã³llidos,, lÃ­Ã­quidos y gaseosos de la Unidad de ((FCC)) de La RefinerÃ­Ã­a de Puerto La Cruz ((PDVSA)),, Estado AnzoÃ¡Ã¡tegui..\"\"','El trabajo realizado esta inscrito dentro de las Ã¡reas de ambiente y quÃ­mica sostenible de aplicaciÃ³n en una empresa nacional, dentro del que son aplicados conocimientos generados durante la carrera, como lo es la EvaluaciÃ³n de procesos quÃ­micos, prevenciÃ³n de la contaminaciÃ³n, reaprovechamiento de materiales y optimizaciÃ³n de procesos. El objetivo con que fuÃ© realizado este trabajo especial de grado era el de realizar una evaluaciÃ³n de las corrientes de contaminantes generadas por la Unidad de Craqueo CatalÃ­tico Fluidizado de la RefinerÃ­a Puerto La Cruz de PDVSA, Dividiendo el proceso de la unidad en operaciones unitarias y evaluando el impacto generado por cada una de estas en varios aspectos para asÃ­ poder identificar la operaciÃ³n unitaria crÃ­tica de la Unidad, y poder enfocar el trabajo en esta para buscar soluciones a los problemas que presentÃ³ la misma, en base a las mejores tÃ©cnicas y prÃ¡cticas ambientales disponibles, formulando a la vez un anÃ¡lisis tÃ©cnico econÃ³mico para estas alternativas, que debe ser llevado a cabo por el personal especializado en cada aspecto, con la finalidad de solventar la problemÃ¡tica existente referente a la disposiciÃ³n y manejo de las corrientes generadas por esta OperaciÃ³n, para conseguir asÃ­ la adecuaciÃ³n del proceso y el manejo del residuo segÃºn las mejores prÃ¡cticas disponibles en cumplimiento con la LegislaciÃ³n Nacional vigente para cada aspecto. Se obtuvo como resultado que la OperaciÃ³n Unitaria CrÃ­tica fue el Regenerador de la Unidad donde se analizaron dos de sus corrientes de contaminantes, el catalizador de equilibrio desalojado periÃ³dicamente y los gases de combustiÃ³n donde se determinÃ³ que para la primera corriente existe un uso factible en el proceso de producciÃ³n de cemento portland PuzÃ³lanico por sus caracterÃ­sticas puzÃ³lanicas y se propuso promover el uso de este residuo en las empresas cementeras nacionales, para la segunda corriente se determinÃ³ a travÃ©s de los anÃ¡lisis fisicoquÃ­micos realizados, que los niveles de MonÃ³xido de Carbono sobrepasan los lÃ­mites mÃ¡ximos permitidos por el Decreto 638 en su ArtÃ­culo 10, por lo cual se propuso tres alternativas : Uso de Calderas de MonÃ³xido de Carbono, para el aprovechamiento del poder calorÃ­fico de esta corriente, InclusiÃ³n de Aditivos QuÃ­micos promotores de combustiÃ³n que favorezcan la combustiÃ³n completa del coque a DiÃ³xido de Carbono ant