ces\" de los profesores J. Bagaria y J. LÃ³pez Abad. El ejemplo en concreto de subconjunto de B1(X) en que considerareos dicha propiedad son los subconjuntos abietos.','2008-12-04','Debilidad Ramsey, Conjuntos dÃ©bilmente Ramsey, Propiedad dÃ©bilmente Ramsey, Espacios de Banach.',5,1,1,1,1,'2013-09-17 08:24:59','2013-09-17 08:24:59','Documento_131.pdf','application/pdf',1906293,'2013-09-17 08:24:59',20,0,126,'COMPLETO'),(132,'Un Generador de PeriÃ³ddicos Comunales:: Llevando la TecnologÃ­a de la InformaciÃ³n a la comunidad','A lo largo de este Trabajo Especial de Grado se irÃ¡n recorriendo todos los aspectos, desde el mÃ¡s teÃ³rico hasta el mÃ¡s tÃ©cnico, que han permitido la producciÃ³n de la herramienta de software que en lo subsiguiente se denominarÃ¡ Generador de PeriÃ³dicos Comunales Ã³ GEPECO. En el primer capÃ­tulo se desarrollarÃ¡ el marco teÃ³rico sobre el tema planteado para este Trabajo Especial de Grado. De todo este marco teÃ³rico es importante resaltar los conceptos de periÃ³dico y periodismo comunal, ya que los mismos son piedra angular de este trabajo. Adicionalmente y para dar significado prÃ¡ctico a los anteriores conceptos se estudiarÃ¡ el proceso requerido para elaborar un periÃ³dico, haciendo un especial conexiÃ³n entre las tareas que aplican especÃ­ficamente para el caso del periÃ³dico comunal. Una vez establecido el marco teÃ³rico se procederÃ¡ a realizar un breve estudio sobre mÃ©todos Ã¡giles de desarrollo de software, para seleccionar uno en particular. Para la elaboraciÃ³n del Generador de PeriÃ³dicos Comunales, se escogiÃ³ AgilUs, ya que el mismo introduce la evaluaciÃ³n de la usabilidad del software desde el inicio hasta el fin de su ciclo de vida. La implementaciÃ³n de las dos (2) primeras etapas de este mÃ©todo se irÃ¡n exponiendo a lo largo del segundo capÃ­tulo. En la primera etapa, se definiÃ³ el dominio de la aplicaciÃ³n, el perfil del usuario y se generÃ³ la lista de requerimientos funcionales y no funcionales del sistema. En la segunda etapa se realizÃ³ el diseÃ±o de las funcionalidades de la aplicaciÃ³n a travÃ©s de diagramas UML (casos de uso, modelo de objeto del dominio), se generÃ³ un prototipo en papel y finalmente se realizÃ³ la primera versiÃ³n de los patrones de interacciÃ³n que describen la interfaz de usuario de la aplicaciÃ³n. En el tercer capÃ­tulo se ejecutaron las dos (2) Ãºltimas etapas del mÃ©todo AgilUs, prototipaje y entrega. En la etapa de prototipaje, se definiÃ³ la guÃ­a de estilo de la aplicaciÃ³n y se realizÃ³ la EvaluaciÃ³n HeurÃ­stica, arrojando Ã©sta detalles de usabilidad que fueron corregidos por el equipo de desarrollo. En la Ãºltima etapa se realizaron las pruebas de aceptaciÃ³n de la aplicaciÃ³n, utilizando como mÃ©todo de prueba los cuestionarios. Finalmente en el Ãºltimo capÃ­tulo, se exponen y detallan todos los componentes que integran la plataforma tecnolÃ³gica que han permitido el desarrollo de la aplicaciÃ³n del Generador de PeriÃ³dicos Comunales. AdemÃ¡s se traducen estos componentes a un entorno de producciÃ³n, en el cual se describen distintos escenarios para algunas de las funcionalidades de esta aplicaciÃ³n','2009-02-03','periodismo, periÃ³dico, periodismo comunal, periÃ³dico comunal, comunidad',2,1,1,1,1,'2013-09-17 08:25:01','2013-09-17 08:25:01','Documento_132.pdf','application/pdf',17117171,'2013-09-17 08:25:01',20,0,101,'COMPLETO'),(133,'Estudio QuÃŒmico del Coral Blando venezolano Pseudopterogorgia americana..','Este Trabajo Especial de Grado representa un aporte para la quÃ­mica de los Productos Naturales Marinos, a travÃ©s del estudio de algunos de los metabolitos secundarios presentes en el coral blando venezolano Pseudopterogorgia americana, colectado en el Parque Nacional Morrocoy, Edo. FalcÃ³n, Venezuela. Se realizÃ³ un estudio bio-dirigido del crudo metanÃ³lico del coralPseudopterogorgia americana, que condujo a la separaciÃ³n y purificaciÃ³n de dos metabolitos secundarios presentes en el extracto de hexano del mismo. Los compuestos fueron aislados y purificados empleando tÃ©cnicas cromatogrÃ¡ficas como: cromatografÃ­a de columna sobre silica gel y cromatografÃ­a de capa fina. Se caracterizaron usando tÃ©cnicas espectroscÃ³picas de Resonancia MagnÃ©tica Nuclear (RMN 1H y 13C) y espectrometrÃ­a de masas de baja y alta resoluciÃ³n. Los metabolitos encontrados fueron I y II, no han sido reportados hasta la fecha. La mezcla de compuestos I y IIpresentÃ³ toxicidad moderada (46,4 %) a una concentraciÃ³n de 1000 ppm de la mezcla de compuestos, para el ensayo de mortalidad de Artemia salina. En el ensayo de difusiÃ³n en discos de papel se obtuvo que en la especie Pseudopterogorgia americana no se encuentran componentes con la capacidad de inhibir el crecimiento bacteriano de las bacterias Escherichia coli,, Klebsiella pneumoniae (bacterias gram negativas) y Bacillus subtilis,, Staphylococcus aureus,, (bacterias gram positivas). Y en el ensayo de inhibiciÃ³n de la enzima glucosa-6-fosfatasa (G-6-Pasa) se obtuvo un porcentaje de inhibiciÃ³n de la enzima de 65,0 % (0,014 nm Pi/h x mg proteÃ­na) en microsomas intactos y de 13,6 % (0,19 nm Pi/h x mg proteÃ­na) en microsomas rotos, con una latencia del 92,6 %','2009-05-05','Pseudopterogorgia americana, Mortalidad de Artemia salina, actividad antibacterial, sistema G-6-Pasa',6,1,1,1,1,'2013-09-17 08:25:02','2013-09-17 08:25:02','Documento_133.pdf','application/pdf',938346,'2013-09-17 08:25:02',19,0,85,'COMPLETO'),(134,'Un Generador de PeriÃ³dicos Comunales: Llevando la TecnologÃ­a de la InformaciÃ³n a la comunidad','En la sociedad en la que nos desenvolvemos es tangible que un gran nÃºmero de individuosdeciden asociarse bajo un modelo comunitario totalmente renovado. Este modelo deja atrÃ¡sla comunidad pasiva y meramente simbÃ³lica. Estas comunidades desean expresarse yabrirse al mundo, siendo una de las mejores vÃ­as para ello la publicaciÃ³n de periÃ³dicoscomunales. Cualquier individuo de una comunidad puede ejercer el periodismo comunal, yaque las actividades comunicacionales son naturales en el ser humano. Sin embargo, lo queno es natural, pero es necesario, es hacer uso del computador para lograr el objetivo detransmitir informaciÃ³n a travÃ©s de la publicaciÃ³n del periÃ³dico comunal.Por este motivo el objetivo principal de este Trabajo Especial de Grado fue el desarrollo deuna herramienta de software que permitiera generar periÃ³dicos comunales. Adicionalmentese plantearon como objetivos especÃ­ficos que esta herramienta fuera usable, gratuita, decÃ³digo abierto y multiplataforma.En primera instancia para lograr que la aplicaciÃ³n fuera usable se hizo uso del MÃ©todo AgilUscomo mÃ©todo de desarrollo. Ã‰ste realiza evaluaciones de usabilidad a lo largo de todo elciclo de vida del sistema, dando como resultado un producto de usable. A fin de obtener unaaplicaciÃ³n multiplataforma se seleccionÃ³ como lenguaje de programaciÃ³n Java.Finalmente, el principal aporte de este Trabajo Especial de Grado fue darle al ciudadanocomÃºn el poder mantener informada a su comunidad, de los distintos eventos y noticiasrelevantes para ellos que no son reseÃ±adas por los grandes medios de comunicaciÃ³n. Por loque se considera necesario seguir realizando aplicaciones de este tipo que brinden a lascomunidades la oportunidad de facilitar sus tareas del dÃ­a a dÃ­a por medio de herramientastecnolÃ³gicas.','2009-02-03','Palabras Clave: PeriÃ³dico, periodismo, comunidad, generador periÃ³dicos comunales.',2,1,1,1,1,'2013-09-17 08:25:04','2013-09-17 08:25:04','Documento_134.pdf','application/pdf',4483744,'2013-09-17 08:25:04',20,0,147,'COMPLETO'),(135,'La Curva de Lorenz y Sistema de Pearson: Propiedades y AplicaciÃ³n','{}','2009-04-28','Curva de Lorenz, Indice de Gini, Formas Funcionales, Sistema generador de Pearson.',5,1,1,1,2,'2013-09-17 08:25:06','2013-09-17 08:25:06','Documento_135.pdf','application/pdf',554956,'2013-09-17 08:25:06',20,0,63,'COMPLETO'),(136,'Sistema de InformaciÃ³n para el Manejo de Correspondencia y Puntos de Cuenta','El objetivo del presente Trabajo Especial de Grado (TEG) es desarrollar un Sistema de InformaciÃ³n Transaccional que permita el manejo de correspondencia de la presidencia y el seguimiento de puntos de cuenta aprobados en Junta Directiva del BANAVIH. El desarrollo de este sistema se apoya en las siguientes metodologÃ­as y herramientas: XP(Extreme Programming), los patrones MVC y Singleton, y el sistema de control de versiones Subversion. El enfoque XPpermitiÃ³ al grupo de desarrollo acelerar la velocidad de construcciÃ³n de la aplicaciÃ³n, asÃ­ como tambiÃ©n, se involucrÃ³ al representante del Banco en la elaboraciÃ³n del sistema, por lo que tomÃ³ confianza en el producto desde la primera iteraciÃ³n. Por otro lado, a travÃ©s de la implementaciÃ³n del patrÃ³n MVC, se intercambiaron los roles de trabajo entre iteraciones; de esta forma, los miembros del equipo de trabajo intervinieron en cada una de las capas de la arquitectura MVC, por lo tanto, cada uno pudo obtener una compresiÃ³n integral de toda la estructura de la aplicaciÃ³n. El sistema desarrollado permitirÃ¡ disminuir los tiempos requeridos para la realizaciÃ³n de las tareas relacionadas con el manejo de la correspondencia y de los puntos de cuenta del BANAVIH.','2009-05-05','Sistemas de InformaciÃ³n Transaccional, Workflow, Correspondencia, Punto de Cuenta, XP, MVC.',2,1,1,1,1,'2013-09-17 08:25:09','2013-09-17 08:25:09','Documento_136.pdf','application/pdf',3642902,'2013-09-17 08:25:09',17,0,139,'COMPLETO'),(137,'SISTEMA DE INFORMACION PARA LA MEDICIÃ“N Y ANÃLISIS DE LA PRESENCIA DE INFORMACIÃ“N EN LOS MEDIOS DE COMUNICACIÃ“N','El presente Trabajo Especial de grado tiene como finalidad organizar, acceder, procesar, recuperar y distribuir la informaciÃ³n de un medio de comunicaciÃ³n. Creando una herramienta tecnolÃ³gica que permita la mediciÃ³n de la presentaciÃ³n de la informaciÃ³n suministrada por los distintos medios, para el subsecuente anÃ¡lisis y comprensiÃ³n de los cambios sociales, polÃ­ticos y econÃ³micos del entorno de interÃ©s.','2009-03-06','ComunicaciÃ³n, Web, medios, prensa escrita, anÃ¡lisis morfolÃ³gico, anÃ¡lisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:25:10','2013-09-17 08:25:10','Documento_137.pdf','application/pdf',1150602,'2013-09-17 08:25:10',20,0,78,'COMPLETO'),(138,'Estudio del contenido de elementos traza en cabello y orina de niÃ±os con SÃ­ndrome de spectro Autista.','Se determinÃ³ la concentraciÃ³n de elementos traza (Zn, Cu, Cr, Se, Pb, Cd y Hg) en muestras de cabello y orina de niÃ±os con SÃ­ndrome de Espectro Autista, con edades comprendidas entre 2 y 15 aÃ±os, pertenecientes al Centro Integral para la EstimulaciÃ³n Cognitiva y Comunicativa (CIPECC). Previo al anÃ¡lisis de las muestras, se optimizÃ³ la concentraciÃ³n del agente reductor (NaBH4) y la influencia de diferentes Ã¡cidos transportadores (HNO3 Ã³ HCl), para la determinaciÃ³n de Hg total por CV-AAS. Los resultados obtenidos arrojaron que la concentraciÃ³n Ã³ptima de reductor fue 0,2% p/v de NaBH4 y que el empleo de HCl como Ã¡cido transportador produce un aumento en la sensibilidad de la tÃ©cnica. TambiÃ©n se optimizaron los tiempos de lavado de las muestras de cabello con acetona y EDTA para la determinaciÃ³n de Cd y Hg, obteniÃ©ndose finalmente, porcentajes de remociÃ³n de aproximadamente 76% y 82% para Cd y Hg, respectivamente. Por tal motivo, los datos que deriven del anÃ¡lisis de estos elementos en cabello, incluirÃ¡n un error adicional que dependerÃ¡n de la exposiciÃ³n del individuo a estos metales. Asimismo, se estudiaron posibles problemas de adsorciÃ³n de Hg al utilizar material de plÃ¡stico para el anÃ¡lisis de cabello, encontrÃ¡ndose que Ã©stos no adsorben mercurio y pueden ser utilizados de manera confiable. En total se analizaron 29 muestras de orina y 31 muestras de cabello de niÃ±os autistas. La determinaciÃ³n de los elementos Zn, Cu, Cr, Se, Pb y Cd, se realizÃ³ mediante espectrometrÃ­a de emisiÃ³n atÃ³mica con plasma inductivamente acoplado (ICP-OES) y la concentraciÃ³n de Hg total fue determinada por espectrometrÃ­a de absorciÃ³n atÃ³mica con generaciÃ³n de vapor frÃ­o (CV-AAS). Las metodologÃ­as de anÃ¡lisis empleadas fueron validadas empleando para algunos elementos el factor de recuperaciÃ³n, partiendo de estÃ¡ndares puros de cada elemento, y para otros se utilizÃ³ material certificado apropiado. Los datos obtenidos fueron tratados empleando el paquete Statgraphic version 5.0 para Windows. Para las muestras de orina, las concentraciones de Zn y Cr en niÃ±os de Espectro Autista mostraron niveles de normales a bajos, para Cu y Se, las medianas presentaron niveles normales. Metales tÃ³xicos como Pb, Cd y Hg, se mantuvieron siempre por debajo de los valores umbrales. Se comparÃ³ la carga metÃ¡lica, liberadas por vÃ­a urinaria, del grupo autista con la poblaciÃ³n control, encontrÃ¡ndose que existe cierta tendencia por parte de los primeros a excretar cantidades menores de Zn, Cr y Se. En el caso del Hg, la tendencia es inversa, los niÃ±os sanos lo liberan en mayores proporciones, ademÃ¡s, en niÃ±os autistas se observÃ³ que la liberaciÃ³n de Hg aumenta a medida que disminuye la severidad del SÃ­ndrome. Se hallaron ademÃ¡s, correlaciones positivas para la excreciÃ³n de metales en orina, entre ellas: Pb-Se, Pb-Zn, Hg-Zn, Cu-Zn, Cu-Se y Cu-Pb; que pueden estar indicando la existencia de procesos metabÃ³licos o enzimÃ¡ticos afectados en el organismo de niÃ±os con autismo, capaces de generar dÃ©ficits de Zn y retenciÃ³n de Hg. AsÃ­ como tambiÃ©n, indicios de que el Se presenta una funciÃ³n protectora hacia elementos como Cu y Pb que puede estar favoreciendo la formaciÃ³n de complejos Se-Pb y Se-Cu que no son excretados por el cuerpo, generando asÃ­ una menor liberaciÃ³n de Pb por parte de niÃ±os de Espectro Autista. Los resultados obtenidos por el anÃ¡lisis de orina, concuerdan con teorÃ­as propuestas en estudios previos, que asocian la menor excreciÃ³n de Hg y Pb en niÃ±os de Espectro autista a dos posibles causas, afecciones en proteÃ­nas encargadas de la detoxificaciÃ³n del organismo y la capacidad del Se para formar complejos con Cu, Pb y/o Hg. En el caso del cabello, la informaciÃ³n adquirida fue muy limitada, observÃ¡ndose niveles relativamente normales para todos los elementos analizados.','2009-04-22','Cabello, Orina, Autismo, elementos traza, metales',6,1,1,1,1,'2013-09-17 08:25:11','2013-09-17 08:25:11','Documento_138.pdf','application/pdf',2731700,'2013-09-17 08:25:11',20,0,121,'COMPLETO'),(139,'EvoluciÃ³n estratigrÃ¡fica del comportamiento de los elementos mayoritarios, minoritarios y trazas durante el Cuaternario TardÃ­o de la Laguna de MucubajÃ­, estado MÃ©rida.','El presente trabajo de investigaciÃ³n tuvo como objetivo reconocer la seÃ±al y patrones de distribuciÃ³n de elementos mayoritarios, minoritarios y trazas, que puedan caracterizar el impacto de los efectos geoquÃ­micos, sedimentarios y posiblemente climÃ¡ticos del Cuaternario reciente, a travÃ©s de los sedimentos de la Laguna de MucubajÃ­, estado MÃ©rida. Se recolectaron nÃºcleos en la Laguna de MucubajÃ­ y se analizÃ³ el nÃºcleo MUCL 02-02-04, del que se tomaron 91 muestras. El trabajo de laboratorio consistiÃ³ en tratamiento y anÃ¡lisis fÃ­sico (descripciÃ³n de las muestras, secado y pulverizado), anÃ¡lisis quÃ­micos y estadÃ­sticos multivariado. Los anÃ¡lisis quÃ­micos consistieron en la determinaciÃ³n de elementos mayoritarios, minoritarios y trazas mediante la tÃ©cnica de EEO-IAP y determinaciÃ³n de volÃ¡tiles a travÃ©s de la tÃ©cnica de pÃ©rdida al rojo. Para el anÃ¡lisis estadÃ­stico se realizÃ³ un anÃ¡lisis exploratorio de datos que incluyÃ³ histogramas para determinar la normalidad de los datos y cajas grÃ¡ficas para detectar valores anÃ³malos, tambiÃ©n se realizÃ³ un anÃ¡lisis multivariado por agrupamiento. Dentro de los resultados obtenidos en base a las caracterÃ­sticas granulomÃ©tricas se determinÃ³ una fase de Turbidita y una fase Lacustre, los anÃ¡lisis de agrupamiento para ambas fases dieron como resultados dos quimiofacies. Para la turbidita una quimiofacies de homogenita y una base de turbidita y para la fase lacustre una quimiofacies de clÃ¡sticos finos y otra de clÃ¡sticos gruesos. Determinando dos eventos importantes dentro de la sedimentaciÃ³n, una fase relacionada a sedimentaciÃ³n climÃ¡tica representada en la fase lacustre en la base de la secuencia y una fase turbidÃ­tica descrita a una sedimentaciÃ³n sismotectÃ³nica.','2009-04-20','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',4,1,1,1,1,'2013-09-17 08:25:12','2013-09-17 08:25:12','Documento_139.pdf','application/pdf',6566621,'2013-09-17 08:25:12',19,0,116,'COMPLETO'),(140,'EvaluaciÃ³n de la tÃ©cnica del glaseado incorporando hidrocoloides como alternativa en el empaque de lomo de atÃºn (thunnus sp) congelado.','{}','2009-04-29','atun, hidrocoloides, carragenina, glaseado',1,1,1,1,1,'2013-09-17 08:25:14','2013-09-17 08:25:14','Documento_140.pdf','application/pdf',8690250,'2013-09-17 08:25:14',18,0,211,'COMPLETO'),(141,'ESTUDIO DE LA HIDRODESHALOGENACIÃ“N CATALÃTICA DE BIFENILOS POLICLORADOS','Los bifenilos policlorados forman una familia de compuestos orgÃ¡nicos cuya estructura estÃ¡ constituida por dos anillos bencÃ©nicos unidos por un enlace simple los cuales presentan Ã¡tomos de cloro como sustituyentes en un nÃºmero que puede variar entre uno y diez. Estos compuestos representan una fuente de contaminaciÃ³n ambiental debido a su carÃ¡cter altamente tÃ³xico y a que, por su escasa degradabilidad, el tiempo de residencia en suelos y cuerpos acuÃ­feros es apreciablemente prolongado. A partir de la prohibiciÃ³n de su fabricaciÃ³n y utilizaciÃ³n surgiÃ³ la necesidad de desarrollar metodologÃ­as seguras y confiables que permitisen su tratamiento y destrucciÃ³n. Como una respuesta a esta necesidad se planteÃ³ como objetivo del presente trabajo, la posibilidad de considerar la hidrodeshalogenaciÃ³n catalÃ­tica como opciÃ³n de trabajo, utilizando sendos catalizadores comerciales fabricados a base de compuestos de nÃ­quel/molibdeno y cobalto/molibdeno en presencia de una amina como especie bÃ¡sica.En el presente estudio se colocÃ³ una mezcla comercial de bifenilos policlorados en un reactor de vidrio al cual se incorporÃ³ el catalizador comercial de nÃ­quel/molibdeno o cobalto/molibdeno en proporciÃ³n catalÃ­tica, conjuntamente con una cantidad estequiomÃ©trica de etilendiamina (0,6 moles etilendiamina/mol BPC), utilizando metanol como medio de reacciÃ³n. Este sistema se conectÃ³ a un un condensador que permitiÃ³ el reflujo, se sometiÃ³ a agitaciÃ³n magnÃ©tica y se le hizo circular una corriente de hidrÃ³geno. El tiempo establecido para la reacciÃ³n se fijÃ³ en 120 minutos. El Ã¡cido clorhÃ­drico generado se capturÃ³ haciendolo burbujear dentro de una soluciÃ³n de hidrÃ³xido de sodio de concentraciÃ³n previamente conocida. El porcentaje de conversiÃ³n alcanzado se estableciÃ³ mediante la determinaciÃ³n de la cantidad de Ã¡cido clorhÃ­drico generado, el cual se obtuvo mediante la valoraciÃ³n del hidrÃ³xido de sodio remanente una vez finalizada la reacciÃ³n. Todas las experiencias se llevaron a cabo a presiÃ³n atmosfÃ©rica. Bajo condiciones de presiÃ³n atmosfÃ©rica y temperatura ambiente se obtuvo la conversiÃ³n del bifenilo policlorado, determinÃ¡ndose la presencia de bifenilo como producto mayoritario, ademÃ¡s de molÃ©culas que presentaban entre 1 y 4 Ã¡tomos de cloro como especies minoritarias. Se estableciÃ³ que el catalizador a base de nÃ­quel-molibdeno como la primera opciÃ³n catalÃ­tica a considerar, por presentar conversiones del orden del 77 %. De manera similar el catalizador de cobalto-molibdeno se considerÃ³ como segunda opciÃ³n catalÃ­tica por presentar conversiones del orden del 51 %. En ambos casos se sugiere que la amina presente en el sistema catalÃ­tico inhibe el envenenamiento del catalizador al neutralizar el Ã¡cido clorhÃ­drico a medida que este se genera en el proceso hidrotratamiento.','2009-01-26','BIFENILO POLICLORADO, BPCÂ´s, HIDROTRATAMIENTO, CONVERSIÃ“N, CATALIZADOR.',6,1,1,1,1,'2013-09-17 08:25:21','2013-09-17 08:25:21','Documento_141.pdf','application/pdf',6901547,'2013-09-17 08:25:21',0,0,88,'COMPLETO'),(142,'ImplementaciÃ³n de un sistema de seguridad para redes inalÃ¡mbricas basado en la integraciÃ³n del protocolo RADIUS y el protocolo LDAP','En la actualidad, la Facultad de Ciencias ofrece el servicio de conexiÃ³n a la red interna, asÃ­ como tambiÃ©n acceso a internet, esto se hace mediante el uso de una red inalÃ¡mbrica la cual carece de un mecanismo de seguridad que permita conocer quienes ingresan a la red y llevar un control de las actividades en la misma. Tomando en cuenta lo anteriormente planteado, se implementÃ³ un sistema de control de acceso inalÃ¡mbrico el cual representa una alternativa de seguridad como soluciÃ³n a la problemÃ¡tica de la red inalÃ¡mbrica de la Facultad de Ciencias. Dicha soluciÃ³n estÃ¡ basada en el uso de los protocolos RADIUS y LDAP, de manera tal que se pueda realizar un proceso de autenticaciÃ³n al momento de ingresar a la red; dicho proceso es realizado por el servidor RADIUS el cual consultarÃ¡ la informaciÃ³n contenida en el servidor LDAP y la compararÃ¡ con la suministrada por los usuarios. AdemÃ¡s, el servidor RADIUS se encarga tambiÃ©n de mantener un registro de las conexiones que se hayan realizado diariamente y de esta manera poder llevar un control de quienes han ingresado a la red, desde que equipo se realizÃ³ dicha conexiÃ³n, asÃ­ como tambiÃ©n la fecha y hora de la misma. Por otra parte, para simplificar el proceso de autenticaciÃ³n a los usuarios se configurÃ³ un portal cautivo, el cual permite realizar dicho proceso mediante una pÃ¡gina Web la cual se mostrarÃ¡ a los usuarios una vez se hayan conectado a la red inalÃ¡mbrica.','2009-04-27','Red InalÃ¡mbrica, AutenticaciÃ³n, RADIUS, LDAP, Portal Cautivo',2,1,1,1,1,'2013-09-17 08:25:22','2013-09-17 08:25:22','Documento_142.pdf','application/pdf',2882509,'2013-09-17 08:25:22',19,0,134,'COMPLETO'),(143,'Determinacion de mercurio por EAA con generacion de vapor y preconcentracion en fase solida','{}','2009-04-28','Mercurio, preconcentracion, arcilla',6,1,1,1,1,'2013-09-17 08:25:25','2013-09-17 08:25:25','Documento_143.pdf','application/pdf',8859998,'2013-09-17 08:25:25',19,0,72,'COMPLETO'),(144,'Estudio de los complejos de vanadio de valencia mixta(IV;V) con acido oxalico por medio de fuerzas electromotrices en medio ionico KCl 3 M a 25ÂºC.','En el presente trabajo fueron estudiados los siguientes sistemas: H+ - Ãcido OxÃ¡lico (C2-) H+ - VO2+- VO2+- Ã¡cido oxÃ¡lico (C2-) Por medio de fuerzas electromotrices emf(H) a 25ÂºC y empleando KCl 3.0 M como medio iÃ³nico inerte. El anÃ¡lisis de los datos mediante LETAGROP arrojo los siguientes resultados: Sistema H+ - Ãcido OxÃ¡lico (C2-) ReacciÃ³n pKa H2C HC- + H+ 1.27(1) HC- C2- + H+ 3.93(4) Sistema H+ - VO2+- VO2+- Ã¡cido oxÃ¡lico (C2-) Log bpqrs [HV2O3C]2+ 32.25(7) 32.27(7) [V2O3C]+ 30.80(5) 30.82(5) [(OH)V2O3C] 28.56(4) 28.58(4) [(OH)2V2O3C]- 25.53(4) 25.57(4) [ (OH)3V2O3C]2- 21.47(7) 21.50(7) [V2O3C2]- 37.5 (max = 37.8) 37.8(2) [V2O3C3]3- 45.1(2) 44.8(2) s(thC) 0.039 s(thCf) 0.039','2009-05-04','Valencia mixta vanadio(IV;V), medidas de fuerzas electromotrices,acido oxalico,equilibrios en solucion,estabilidad de complejos.',6,1,1,1,1,'2013-09-17 08:25:27','2013-09-17 08:25:27','Documento_144.pdf','application/pdf',1894702,'2013-09-17 08:25:27',17,0,112,'COMPLETO'),(145,'DeterminaciÃ³Ã³nn de especies tÃ³Ã³xxicas de arsÃ©Ã©nico en muestras marinas,, mediante ExtracciÃ³Ã³nn Acelerada con Solvente ((ASE)) y determinaciÃ³Ã³nn por Plasma Inductivamente Acoplado--EspectrometrÃ­Ã­a de EmisiÃ³Ã³nn Ã“Ã“pptica((HG--ICP--OES))..','El arsÃ©nico es un elemento ampliamente distrib