HPAS--SBA--1155','La mayorÃ­a de los procesos quÃ­micos para la obtenciÃ³n de compuestos orgÃ¡nicos realizados en la industria emplean catalizadores homogÃ©neos, que ademÃ¡s de ser difÃ­ciles de separar son contaminantes para el ambiente y potencialmente perjudiciales a la salud. Por esta razÃ³n, se busca reemplazar estos catalizadores por otros menos contaminantes con una eficiencia similar. Los catalizadores heterogÃ©neos tales como los sÃ³lidos silÃ­cicos mesoporosos son algunos de los que se estudian para este reemplazo. En el presente trabajo se sintetizaron los sÃ³lidos SBA-15 y el Al-SBA-15, este Ãºltimo sintetizado con relaciones Si/Al de 30 y 60. A estos sÃ³lidos se le incorporÃ³ un heteropoliacido de tungsteno (WHPA) por sÃ­ntesis directa con un contenido del 10% p/p de WHPA y por sÃ­ntesis indirecta con un contenido de WHPA del 10% y 20%. Los sÃ³lidos obtenidos se caracterizaron por diferentes tÃ©cnicas analÃ­ticas como lo fueron determinaciÃ³n de propiedades texturales, anÃ¡lisis quÃ­mico elemental, difracciÃ³n de rayos X y espectroscopÃ­a de absorciÃ³n en el infrarrojo. Se evaluaron en la reacciÃ³n de esterificaciÃ³n del Ã¡cido benzoico con metanol. El estudio de las propiedades texturales como la determinaciÃ³n de Ã¡rea especÃ­fica realizados al SBA-15 y al Al-SBA-15 con relaciones Si/Al=30 y 60, arrojaron valores de Ã¡rea entre 700 y 800 m2/g y diÃ¡metro de poro entre 3 y 4 nm, valores Ã©stos similares a los reportados en la literatura, siendo los valores mÃ¡s bajos de Ã¡rea los obtenidos con los sÃ³lidos que presentan incorporaciÃ³n de heteropoliacido, con valores entre 300 y 500 m2/g, y por ende el valor mÃ¡s alto de diÃ¡metro de poro. Para todos los sÃ³lidos se presentaron isotermas de absorciÃ³n con histÃ©resis tipo IV, caracterÃ­sticos de sÃ³lidos mesoporosos regulares. Los resultados obtenidos de los anÃ¡lisis quÃ­micos realizados a los sÃ³lidos sintetizados arrojaron que la cantidad de Al en la composiciÃ³n de los mismos es muy baja para ser cuantificable (<0,05% p/p), esta baja cantidad de Al presente en los sÃ³lidos se atribuyÃ³ en parte a los equilibrios en soluciÃ³n de las especies Si y Al al pH de sÃ­ntesis (1,5). TambiÃ©n se observa una pÃ©rdida de W cuando este se incorpora por sÃ­ntesis directa a los silicatos debido a que en el proceso de sÃ­ntesis el tungsteno queda en soluciÃ³n y es desechado en las aguas de lavado. Este fenÃ³meno se observa en menor proporciÃ³n con los aluminosilicatos, dado que este metal facilita el anclaje a la superficie. A travÃ©s de los resultados obtenidos por difracciÃ³n de rayos X se demostrÃ³ que la incorporaciÃ³n de heteropoliacido al sÃ³lido modifica su ordenamiento espacial, deformando su arreglo hexagonal. La presencia de aluminio en los sÃ³lidos mesoporosos le da mayor rigidez a su estructura hexagonal impidiendo que la incorporaciÃ³n del heteropoliacido a estos afecte su ordenamiento espacial que, mediante los espectros de IR, se puede observar que la presencia de aluminio fortalece los enlaces de la estructura ya que no muestran corrimientos en las bandas por la presencia del WHPA. Los resultados obtenidos en la reacciÃ³n de esterificaciÃ³n del Ã¡cido benzoico con metanol utilizando los sÃ³lidos sintetizados como catalizadores arrojaron que aquellos materiales que poseen mayor relaciÃ³n Si/Al retienen mejor la molÃ©cula de heteropoliacido en la superficie del sÃ³lido obteniÃ©ndose una mayor conversiÃ³n (79,3% de conversiÃ³n con WHPA/Al-SBA-15, relaciÃ³n Si/Al=60 y 20% p/p de WHPA), en comparaciÃ³n con los sÃ³lidos que poseen mayor cantidad de aluminio incorporado. Para el sÃ³lido SBA-15 la presencia de heteropoliacido modifica su ordenamiento espacial generando conversiones bajas (cercanas al 70%) del producto deseado. Por Ãºltimo, el aumento de la temperatura en la reacciÃ³n de esterificaciÃ³n utilizando como catalizadores los sÃ³lidos sintetizados, aumenta la conversiÃ³n del acido benzoico entre 14% y 70%. Y se corresponden con aquellos cuyo comportamiento es similar al de un aluminosilicato con bajo contenido de aluminio (Si/Al=60) no importando el contenido de heteropoliacido depositado sobre el catalizador.','2009-03-20','Tamices moleculares, SBA-15, SÃ³lidos mesoporosos, HeteropoliÃ¡cidos, EsterificaciÃ³n',6,1,1,1,1,'2013-09-17 08:25:42','2013-09-17 08:25:42','Documento_146.pdf','application/pdf',361431,'2013-09-17 08:25:42',19,0,52,'COMPLETO'),(147,'EvaluaciÃ³n de una Celda para la GeneraciÃ³n de Vapor FrÃ­o de Cadmio y su determinaciÃ³n en muestras de orina mediante EspectrometrÃ­a de AbsorciÃ³n AtÃ³mica','RESUMENEn este trabajo se evaluÃ³ una celda de reacciÃ³n para la generaciÃ³n de vapor frÃ­o de cadmio. Asimismo, se optimizÃ³ una metodologÃ­a aplicable a la determinaciÃ³n de cadmio en muestras de orina mediante CV-AAS. Para ello, se optimizaron los parÃ¡metros fÃ­sicos correspondientes al diseÃ±o de la celda y su ensamblaje para la introducciÃ³n apropiada de la muestra y los reactivos. Los parÃ¡metros que intervienen en la formaciÃ³n de la especie volÃ¡til de cadmio tambiÃ©n fueron optimizados, tanto en muestras de orina como en soluciones acuosas, empleando dos aproximaciones: un diseÃ±o factorial multivariado Box Behnken de cuatro factores a dos niveles y un anÃ¡lisis univariado. Los resultados obtenidos bajo las condiciones Ã³ptimas, en cada caso, fueron comparados en base al lÃ­mite de detecciÃ³n, porcentaje de recuperaciÃ³n y valor de concentraciÃ³n promedio. Asimismo, se determinÃ³ la exactitud y la precisiÃ³n de la metodologÃ­a. Bajo las condiciones optimizadas mediante el mÃ©todo multivariado (2,78% m/v de Ã¡cido clorhÃ­drico, 3,5 mg L-1 de Co, 5,90 % m/ v tiourea y 7,0 % m/v del agente reductor) y mediante el mÃ©todo univariado (2,8% m/v de Ã¡cido clorhÃ­drico, 2 mg L-1 de Co, 4 % m/v tiourea y 7,0 % m/v del agente reductor) se obtuvieron lÃ­mites de detecciÃ³n instrumental de 1,11 mg L- 1 y 0,96 mg L-1, respectivamente. El porcentaje de recuperaciÃ³n instrumental obtenido mediante ambos procedimientos fue comparable y se encuentra dentro del intervalo del 91% y 98%. Tampoco se encontraron diferencias significativas (P=0,05) entre los valores de concentraciÃ³n de Cd determinados en muestras de orina provenientes de donantes voluntarios. Los resultados de la concentraciÃ³n de Cd obtenidos en una muestra control de orina, Lyphocheck Nivel 1 de Bio-rad, bajo las condiciones experimentales optimizadas mediante el modo multivariado, estuvieron de acuerdo con los valores establecidos por el fabricante, mostrando un coeficiente de variaciÃ³n del 2,1% para tres rÃ©plicas. Los resultados obtenidos muestran que la celda diseÃ±ada y operada bajo las condiciones de anÃ¡lisis optimizadas, permite la obtenciÃ³n del vapor metÃ¡lico de cadmio y su determinaciÃ³n en muestras de orina de manera cuantitativa y con una buena precisiÃ³n. Los LOD obtenidos pueden ser mejorados realizando modificaciones adicionales dirigidas hacia la disminuciÃ³n del volumen muerto que diluye el vapor metÃ¡lico generado.','2009-04-24','Vapor FrÃ­o de CadmioEspectrometrÃ­a de AbsorciÃ³n AtÃ³micaDeterminaciÃ³n de Cadmio en muestras de orinaAnÃ¡lisis univariado AnÃ¡lisis multivariado',6,1,1,1,1,'2013-09-17 08:25:43','2013-09-17 08:25:43','Documento_147.pdf','application/pdf',16082371,'2013-09-17 08:25:43',20,0,178,'COMPLETO'),(148,'\"\"MODIFICACIÃ“Ã“NN QUÃÃMMICA DE ALMIDÃ“Ã“NN DE YUCAMEDIANTE RADIACIÃ“Ã“NN MICROONDAS\"\"','En el presente trabajo de investigaciÃ³n se estudian las condiciones de reacciÃ³n en medio acuoso para la modificaciÃ³n del almidÃ³n de yuca nativo con anhÃ­drido 2-octenil-1-succÃ­nico (OSA) utilizando como medio de calentamiento la radiaciÃ³n microondas, todo esto con el objeto de obtener un producto con caracterÃ­sticas hidrofÃ³bicas. Los productos obtenidos fueron caracterizados estructuralmente por medio de espectroscopÃ­a infrarroja con transformada de Fourier (FT-IR) y espectroscopia de resonancia magnÃ©tica nuclear (RMN) donde se identificaron bandas caracterÃ­sticas de los grupos funcionales introducidos (grupo Ã©ster, cadena alquÃ­lica). La evaluaciÃ³n de las condiciones de reacciÃ³n ideales se realizo tomando en cuenta diferentes aspectos: uso de acido esteÃ¡rico como catalizador de transferencia de fase (surfactante) y su influencia sobre el proceso de esterificaciÃ³n, cantidades de los reactivos de partida (OSA, Ã¡cido esteÃ¡rico), condiciones fisicoquÃ­micas de los mismos (almidÃ³n activado, liofilizado o gelatinizado) y agitaciÃ³n. AdemÃ¡s de la caracterizaciÃ³n estructural tambiÃ©n se realizÃ³ una evaluaciÃ³n cuantitativa del grado de sustituciÃ³n del almidÃ³n modificado por una titulaciÃ³n Ã¡cido-base asÃ­ como tambiÃ©n por medio de RMN-1H. Adicionalmente, se procediÃ³ a la construcciÃ³n de una curva de calibraciÃ³n empleando datos de los espectros de RMN y FT-IR de cinco productos, observÃ¡ndose el mayor grado de sustituciÃ³n 0,051 para el producto obtenido a partir del denominado procedimiento C que consistiÃ³ en un tratamiento previo de activaciÃ³n del almidÃ³n nativo y del acido esteÃ¡rico con hidrÃ³xido de sodio, posteriormente someter al almidÃ³n activado a un proceso de gelatinizaciÃ³n y liofilizaciÃ³n antes de la esterificaciÃ³n. TambiÃ©n se estudiÃ³ la morfologÃ­a de varios de los productos por medio de microscopia electrÃ³nica de barrido (MEB) asÃ­ como sus propiedades de solubilidad y adsorciÃ³n de humedad. En general se pudo apreciar que los derivados de almidÃ³n sintetizados mÃ¡s hidrofÃ³bicos que el almidÃ³n de partida, lo cual conllevo a una disminuciÃ³n de cerca del 20 % en la absorciÃ³n de humedad para el producto con el mayor grado de sustituciÃ³n (DS = 0,051).','2009-02-11','Almidon, yuca, plastico biodegradable, OSA',6,1,1,1,1,'2013-09-17 08:25:48','2013-09-17 08:25:48','Documento_148.pdf','application/pdf',323130,'2013-09-17 08:25:48',20,0,47,'COMPLETO'),(149,'Estudio geoquÃ­mico de la seÃ±aal paleoclimÃ¡tica Holocena en sedimentos lacustres del paleolago Los Zerpa, estado MÃ©rida.','AnÃ¡lisis limnolÃ³gicos y paleolimnolÃ³gicos de cuencas lacustres andinas ubicadas entre 1100m a 3700m han demostrado que los minerales de arcilla y algunas caracterÃ­sticas geoquÃ­micas siguen patrones altitudinales definidos y que el registro paleoclimÃ¡tico puede ser claramente observado a travÃ©s de los sedimentos lacustres (Weingarten et al..,,1991). En este sentido, los sedimentos lacustres del paleolago de los Zerpa han mostrado una importante seÃ±al climÃ¡tica observada a travÃ©s de la granulometrÃ­a y susceptibilidad magnÃ©tica de alta resoluciÃ³n (Carrillo, 2006). Este paleolago se encuentra en la regiÃ³n central de los Andes de MÃ©rida en el valle morrÃ©nico de Los Zerpa. El extremo norte del valle se encuentra controlado por la Falla de BoconÃ³ cuya actividad sismotectÃ³nica y ruptura superficial han controlado en gran medida la dinÃ¡mica sedimentaria del valle intramorrÃ©nico (Giengengack y Grauch, 1976; Schubert, 1981; Carrillo et al., 2006), alterando con perÃ­odos sÃ­smicos controlados exclusivamente por factores climÃ¡ticos. Este trabajo tiene como objetivo evaluar el comportamiento geoquÃ­mico de los sedimentos lacustres del paleolago de Los Zerpa depositados bajo control climÃ¡tico y determinar la influencia de factores climÃ¡ticos que pudieran incidir en la dinÃ¡mica de sedimentaciÃ³n en la cordillera andina. Para realizar esto, se tomÃ³ un nÃºcleo de pared o canaleta de 50 cm de largo de un afloramiento de sedimentos lacustres donde se llevÃ³ a cabo un muestreo sistemÃ¡tico cada 5 mm para realizar anÃ¡lisis de elementos mayoritarios, minoritarios y trazas por medio de espectrometrÃ­a de emisiÃ³n Ã³ptica inductivamente acoplado a plasma EEO-IAP (ICP-OES). La aplicaciÃ³n de herramientas de estadÃ­stica multivariada, permitiÃ³ establecer 2 asociaciones geoquÃ­micamente distintas, (clÃ¡stico grueso, clÃ¡stico fino). De acuerdo al comportamiento de los atributos quÃ­micos agrupados se identificaron 2 quimiofacies, relacionadas a las condiciones redox del paleoloago, utilizando como indicadores elementales el Fe y Mn, una fase posiblemente subÃ³xica, con concentraciones bajas de MnO2 (0,0474% - 0,1030) Â±6%, en la cual los perÃ­odos de sedimentaciÃ³n fueron alternados por la actividad sismotectÃ³nica y perÃ­odos de sedimentaciÃ³n climÃ¡tica; Sin embargo, para concentraciones altas de MnO2 (0,1091% - 0,1616%) Â± 6%, marca las condiciones Ã³xicas del paleolago y el comienzo de una sedimentaciÃ³n exclusivamente climÃ¡tica la cual se ve influenciada por patrones de sedimentaciÃ³n cÃ­clicos, que posiblemente podrÃ­an ser relacionados dentro de los perfiles quimioestratigraficos de Sc, SiO2 y ZrO2 a ciclos sedimentarios concernientes a los ciclos de Gleisbeerg de 80 - 90 aÃ±os referentes a la influencia de la actividad solar sobre la respuesta geoquÃ­mica de los sedimentos.','2009-04-20','UNIVERSIDAD CENTRAL DE VENEZUELA 12.00 Normal 0 21 false false false ES-VE X- NONE X-NONE MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-sty',4,1,1,1,1,'2013-09-17 08:25:49','2013-09-17 08:25:49','Documento_149.pdf','application/pdf',574745,'2013-09-17 08:25:49',19,0,88,'COMPLETO'),(150,'Sistema de InformaciÃ³n para el Manejo de Correspondencia yPuntos de Cuenta.','El objetivo del presente Trabajo Especial de Grado (TEG) esdesarrollar un Sistema de InformaciÃ³n Transaccional quepermita el manejo de correspondencia de la presidencia y elseguimiento de puntos de cuenta aprobados en Junta Directivadel BANAVIH. El desarrollo de este sistema se apoya en lassiguientes metodologÃ­as y herramientas: XP(ExtremeProgramming)),, los patrones MVC y Singleton,, y el sistema decontrol de versiones Subversion.. El enfoqueXPpermitiÃ³ al grupo de desarrollo acelerar la velocidad de construcciÃ³n de laaplicaciÃ³n, asÃ­ como tambiÃ©n, se involucrÃ³ al representante delBanco en la elaboraciÃ³n del sistema, por lo que tomÃ³ confianzaen el producto desde la prime