arrollado permitirÃ¡Ã¡ disminuir los tiempos requeridos para la realizaciÃ³Ã³nn de las tareas relacionadas con el manejo de la correspondencia y de los puntos de cuenta del BANAVIH..','2009-05-05','Sistemas de InformaciÃ³Ã³nn Transaccional,, Workflow,, Correspondencia,, Punto de Cuenta,, XP,, MVC..',2,1,1,1,1,'2013-09-17 08:25:51','2013-09-17 08:25:51','Documento_151.pdf','application/pdf',4434778,'2013-09-17 08:25:51',17,0,161,'COMPLETO'),(152,'ObtenciÃ³Ã³nn de un intermediario clave para la SÃ­Ã­NTESIS DE 44--AMINOQUINOLINAS SUSTITUIDAS EN LA POSICIÃ“Ã“NN 88 Y CÃÃLLCULO DE las PROPIEDADES FISICOQUÃ­Ã­MICAS de 44--aminoquinolinas MEDIANTE MODELAJE MOLECULAR','En este trabajo se presenta la sÃ­ntesis de 6 compuestos, con la forma general 3-carboxi -4-cloroquinolinas sustituidas en la posiciÃ³n 8, y se determinÃ³ las propiedades moleculares de las 4-aminoquinolinas como Log P, EnergÃ­a HOMO-LUMO, EnergÃ­a de solvataciÃ³n, Polaridad, Cargas y Potencial ElectrostÃ¡tico. La ruta sintÃ©tica empleada se indica a continuaciÃ³n: Los compuestos se purificaron mediante cromatografÃ­a de columna y cuyas estructuras se verificaron por IR, RMN1H y RMN13C. Posteriormente se modelaron las 4-aminoqunolinas y se realizÃ³ la dinÃ¡mica molecular utilizando el campo de fuerza MM2 implementado en el programa CAChe, para obtener la estructura de menor energÃ­a y se determinaron las propiedades termodinÃ¡micas mediante el mÃ©todo semiempÃ­rico PM3 implementado en el programa Hyperchem 7.5 y Spartan v 2.0. Realizando el modelaje molecular se obtuvieron estructuras con geometrÃ­as similares, sÃ³lo con pequeÃ±as variaciones en la orientaciÃ³n de la cadena aminoalquÃ­lica.En cuanto a la densidad de carga, se observÃ³ que la mayor densidad estaba centrada en el grupo carboetoxi y se logra una mayor separaciÃ³n de cargas en el caso de sustituyentes atractores de electrones. Por su parte el nitrÃ³geno N1 presentÃ³ valores de potencial cercanos a los valores reportados para compuestos activos, lo que resulta importante debido a que este grupo influye fuertemente en la interacciÃ³n con la hematina. Los orbitales HOMO estÃ¡n centrados en el anillo quinolÃ­nico y se observan pequeÃ±as variaciones cuando se introducen sustituyentes dadores de electrones, donde el orbital se desplaza hacia el grupo ester. Al comparar algunos parÃ¡metros tales como: volumen molecular, polaridad, afinidad con el agua y deslocalizaciÃ³n de carga, de los compuestos sintetizados y los reportados en la literatura que resultan ser activos, encontramos cierta similitud por lo que podrÃ­a esperarse que las quinolinas sintetizadas pudiesen ser activas. Los resultados obtenidos complementan un estudio mÃ¡s amplio donde se sintetizan 3-Carboetoxi-4-aminoquinolinas sustituidas en la posiciÃ³n 6, 7 y 8, para realizar pruebas de citotoxicidad y de actividad contra parÃ¡sitos. Adicionalmente, las propiedades y los descriptores calculados permiten ampliar una base de datos creada con el fin de realizar tanto correlaciones sencillas como mÃºltiples con la actividad.','2009-03-23','{}',6,1,1,1,1,'2013-09-17 08:25:54','2013-09-17 08:25:54','Documento_152.pdf','application/pdf',0,'2013-09-17 08:25:54',19,0,0,'INCOMPLETO'),(153,'MODELADO TRIDIMENSIONAL DE LA ESTRUCTURA LITOSFÃ‰Ã‰RRICA DE LA REGIÃ“Ã“NN NOR-- OCCIDENTAL DE VENEZUELA Y NORTE DE COLOMBIA CON BASE EN DATOS DE GRAVEDAD Y MAGNETISMO..','Por medio de mÃ©todos estadÃ­sticos se realizÃ³ una inversiÃ³n con base en datos de gravedad y magnetismo, para elaborar un modelo tridimensional de la corteza en la zona de interacciÃ³n de las placas Caribe y Suramericana. En nuestro mÃ©todo asignamos a cada una de las distintas capas del modelo cortical, informaciÃ³n estadÃ­stica previa sobre la estructura y estadÃ­sticas de las propiedades fÃ­sicas representadas: densidad y susceptibilidad magnÃ©tica. Se estudiÃ³ un modelo de siete y ocho capas, que incluye la subducciÃ³n de la placa del Caribe bajo la placa Suramericana. El trabajo tiene por objetivo evaluar el modelo geolÃ³gico en esta compleja regiÃ³n de interacciÃ³n de placas. En los resultados obtenidos en las inversiones realizadas, se observa que el modelo explica con precisiÃ³n las anomalÃ­as gravimÃ©tricas y magnÃ©ticas. Nuestros resultados muestran una subducciÃ³n incipiente de la placa Caribe penetrando con un Ã¡ngulo de inclinaciÃ³n de aproximadamente 30Â° bajo la placa continental, con un alcance de al menos 200-250 km al sur del prisma de acreeciÃ³n y alcanza una profundidad mÃ¡xima de aproximadamente 160 km.','2009-01-22','Noroccidente de Venezuela, Norte de Colombia, Monte Carlo, Placa Caribe, Gravedad, Magnetismo, SubducciÃ³n, Prisma de acreeciÃ³n.',3,1,1,1,1,'2013-09-17 08:25:55','2013-09-17 08:25:55','Documento_153.pdf','application/pdf',4149808,'2013-09-17 08:25:55',19,0,107,'COMPLETO'),(154,'EvoluciÃ³n estratigrÃ¡fica del comportamiento de los elementos mayoritarios, minoritarios y trazas durante el Cuaternario TardÃ­o de la Laguna de MucubajÃ­, estado MÃ©rida.','El presente trabajo de investigaciÃ³n tuvo como objetivo reconocer la seÃ±al y patrones de distribuciÃ³n de elementos mayoritarios, minoritarios y trazas, que puedan caracterizar el impacto de los efectos geoquÃ­micos, sedimentarios y posiblemente climÃ¡ticos del Cuaternario reciente, a travÃ©s de los sedimentos de la Laguna de MucubajÃ­, estado MÃ©rida. Se recolectaron nÃºcleos en la Laguna de MucubajÃ­ y se analizÃ³ el nÃºcleo MUCL 02-02-04, del que se tomaron 91 muestras. El trabajo de laboratorio consistiÃ³ en tratamiento y anÃ¡lisis fÃ­sico (descripciÃ³n de las muestras, secado y pulverizado), anÃ¡lisis quÃ­micos y estadÃ­sticos multivariado. Los anÃ¡lisis quÃ­micos consistieron en la determinaciÃ³n de elementos mayoritarios, minoritarios y trazas mediante la tÃ©cnica de EEO-IAP y determinaciÃ³n de volÃ¡tiles a travÃ©s de la tÃ©cnica de pÃ©rdida al rojo. Para el anÃ¡lisis estadÃ­stico se realizÃ³ un anÃ¡lisis exploratorio de datos que incluyÃ³ histogramas para determinar la normalidad de los datos y cajas grÃ¡ficas para detectar valores anÃ³malos, tambiÃ©n se realizÃ³ un anÃ¡lisis multivariado por agrupamiento. Dentro de los resultados obtenidos en base a las caracterÃ­sticas granulomÃ©tricas se determinÃ³ una fase de Turbidita y una fase Lacustre, los anÃ¡lisis de agrupamiento para ambas fases dieron como resultados dos quimiofacies. Para la turbidita una quimiofacies de homogenita y una base de turbidita y para la fase lacustre una quimiofacies de clÃ¡sticos finos y otra de clÃ¡sticos gruesos. Determinando dos eventos importantes dentro de la sedimentaciÃ³n, una fase relacionada a sedimentaciÃ³n climÃ¡tica representada en la fase lacustre en la base de la secuencia y una fase turbidÃ­tica descrita a una sedimentaciÃ³n sismotectÃ³nica.','2009-02-17','v:* {behavior:url(#default#VML);} o:* {behavior:url(#default#VML);} w:* {behavior:url(#default#VML);} .shape {behavior:url(#default#VML);} Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 st1:* {behavior:url(#ieooui) } /* Style',4,1,1,1,1,'2013-09-17 08:25:57','2013-09-17 08:25:57','Documento_154.pdf','application/pdf',976864,'2013-09-17 08:25:57',14,0,75,'COMPLETO'),(155,'IntegraciÃ³n del Repositorio de AMBAR con el Repositorio de Metadata a travÃ©s de la Capa de Servicios','El presente trabajo consiste en la integraciÃ³n de la base de datos (BD) del SIG-AMBAR con el Repositorio de Metadata a travÃ©s de la Capa de Servicios Web, asociada sÃ³lo a los Objetos de Aprendizaje.Actualmente, AMBAR es un proyecto que posee dos aplicaciones, donde cada aplicaciÃ³n maneja informaciÃ³n sobre el mismo recurso, el cual es llamado Objeto de Aprendizaje (OA). Por un lado, se tiene la base de datos (BD) del SIG-AMBAR que almacena OA, pero no posee una organizaciÃ³n estructurada de los atributos que describen a estos, es decir, los metadatos. Y por otro lado, se tiene el repositorio de Metadata el cual posee toda una estructura estandarizada de los atributos que describen a los OA, por tanto, al integrar estas aplicaciones, se estÃ¡ facilitando la bÃºsqueda, recuperaciÃ³n, catalogaciÃ³n y administraciÃ³n de los OA.La definiciÃ³n de los Servicios Web para el acceso a la BD del SIG-AMBAR mejora la interoperabilidad entre las diferentes aplicaciones que constituirÃ¡n el sistema, ya que Ã©stos ofrecen una alternativa de software independiente en cuanto a la plataforma, basada en estÃ¡ndares para la integraciÃ³n de aplicaciones, la automatizaciÃ³n de procesos de negocio y la publicaciÃ³n de la informaciÃ³n de diversas fuentes. El contar con una infraestructura integrada, segura, escalable y disponible, disminuye los costos y permite compartir informaciÃ³n de manera confiable.La integraciÃ³n de los repositorios de metadata y de OA, proporciona un espacio para manipular OA que pueden ser almacenados y recuperados de manera eficiente. Los objetos ahora serÃ¡n descritos a travÃ©s de una metadata que obedece a las especificaciones de un estÃ¡ndar mundial especializado para describirla, llamado Learning Object Metadata (LOM), que permite identificarlos para luego potenciar su bÃºsqueda, evaluaciÃ³n, obtenciÃ³n y reutilizaciÃ³n.Las tecnologÃ­as y herramientas utilizadas por ambas aplicaciones contribuyeron al desarrollo exitoso de la integraciÃ³n. La tecnologÃ­a JSP, que permite generar contenido dinÃ¡mico para ambiente Web con programaciÃ³n en java, lenguaje orientado a objetos para el desarrollo de los Servicios Web; Servidor de Apache Tomcat, servidor que se utilizÃ³ como contenedor Web de la aplicaciÃ³n; Axis y Axis2, implementaciÃ³n de SOAP (Simple Object Access Protocol) que proporciona el entorno para la ejecuciÃ³n y publicaciÃ³n de los Servicios Web, entre otros.Es importante resaltar que el proceso de integraciÃ³n se realizara Ãºnicamente sobre los Objetos de Aprendizaje debido a que el repositorio de metadata sÃ³lo almacena informaciÃ³n descriptiva sobre ellos y no informaciÃ³n adicional.','2009-04-27','Objetos de aprendizaje (OA), Metadata, Re