nca, mientras que elementos como As y Sb tienden a estar enriquecidos en la subunidad de metatobas al este de la cuenca del riÌo Cuira, por su parte el Cu, Pb y Zn , presentan una dispersioÌn heterogeÌnea en la cuenca .','2009-02-17','{}',4,1,1,1,1,'2013-09-17 08:26:00','2013-09-17 08:26:00','Documento_157.pdf','application/pdf',0,'2013-09-17 08:26:00',17,0,0,'INCOMPLETO'),(158,'CÃ¡lculo de la CohomologÃ­a de De Rham de los Espacios Proyectivos por medio de la SucesiÃ³n de Gysin','{}','2009-04-28','CohomologÃ­a de De Rham, Espacio Proyectivo Complejo, SucesiÃ³n de Gysin',5,1,1,1,1,'2013-09-17 08:26:01','2013-09-17 08:26:01','Documento_158.pdf','application/pdf',0,'2013-09-17 08:26:01',20,0,0,'INCOMPLETO'),(159,'AUTOMATIZACIÃ“N DE PROCESOS RELACIONADOS CON LAS SOLICITUDES ESTUDIANTILES Y ACTIVIDADES ADMINISTRATIVAS Y DE DOCENCIA DE LA FACULTAD DE CIENCIAS.','El objetivo del presente Trabajo Especial de Grado consiste en el desarrollo de unaaplicaciÃ³n Web que automatice el conjunto de procesos relacionados con las diversassolicitudes estudiantiles y actividades que realizan las escuelas y dependencias de laFacultad de Ciencias, en relaciÃ³n con la DivisiÃ³n de Control de Estudios; dando soporteal personal involucrado, para aumentar asÃ­ su satisfacciÃ³n, y al mismo tiempo optimizarlos costos y los tiempos de respuesta. Para ello, se aplicÃ³ una adaptaciÃ³n del mÃ©todo deDesarrollo RÃ¡pido de Aplicaciones, donde se realizÃ³ la fase de PlaneaciÃ³n deRequerimientos para cada proceso, el Taller de DiseÃ±o el cuÃ¡l se divide en iteraciones yla ImplementaciÃ³n para la aplicaciÃ³n de pruebas. Como producto final, se obtuvo unaintegraciÃ³n de estos procesos con la aplicaciÃ³n Web denominada CONEST, queactualmente representa el sistema de gestiÃ³n acadÃ©mica de la DivisiÃ³n de Control deEstudios de la Facultad de Ciencias en la Universidad Central de Venezuela.','2008-05-20','TecnologÃ­as para el desarrollo de Aplicaciones Web, Modelo Vista Controlador (MVC),Ruby on Rails,