lÃ³gica que permita la mediciÃ³n de la presentaciÃ³n de la informaciÃ³n suministrada por los distintos medios, para el subsecuente anÃ¡lisis y comprensiÃ³n de los cambios sociales, polÃ­ticos y econÃ³micos del entorno de interÃ©s.','2009-03-06','ComunicaciÃ³n, Web, medios, prensa escrita, anÃ¡lisis morfolÃ³gico, anÃ¡lisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:26:11','2013-09-17 08:26:11','Documento_165.pdf','application/pdf',980537,'2013-09-17 08:26:11',20,0,86,'COMPLETO'),(166,'Desarrollo de un MÃ³dulo de generaciÃ³n de reportes para el sistema CONEST de la Facultad de Ciencias.','Actualmente la DivisiÃ³n de Control de Estudios de la Facultad de Ciencias de la Universidad Central de Venezuela dispone de una aplicaciÃ³n Web denominada CONEST, la cual se encarga de automatizar sus procesos y a su vez almacena toda la informaciÃ³n correspondiente a la gestiÃ³n acadÃ©mica de la Facultad. Para los distintos procesos que lleva a cabo la DivisiÃ³n de Control de Estudios es necesario emitir una serie de reportes, para los cuales no poseen una herramienta que les permita elaborarlos, ademÃ¡s actualmente el modelo de datos de este sistema posee alrededor de 140 tablas y esto dificulta la tarea de elaboraciÃ³n de reportes. Dada esta situaciÃ³n, en el presente Trabajo Especial de Grado se desarrollÃ³ una aplicaciÃ³n, la cual es a su vez un mÃ³dulo del sistema CONEST, que estÃ¡ dedicado exclusivamente a la generaciÃ³n y administraciÃ³n de reportes a partir de los datos almacenados en el repositorio de datos, todo esto basÃ¡ndose en el estudio de algunos generadores de reportes comerciales, analizando la forma como estos, a travÃ©s de secuencias ordenadas de pasos (wizards), apoyan al usuario en la tarea de elaboraciÃ³n de reportes. Entre los aspectos de desarrollo de esta aplicaciÃ³n tenemos el diseÃ±o del wizard que permite la creaciÃ³n de los reportes de una forma mÃ¡s sencilla, el desarrollo de los algoritmos de exportaciÃ³n de datos a los formatos soportados, el anÃ¡lisis del modelo de datos actual de CONEST, en base al cual se diseÃ±aron un conjunto de vistas que faciliten el acceso a los datos y la integraciÃ³n con el sistema CONEST.','2009-06-08','Reporte, Ruby on Rails, Wizard, MySQL, Vistas.',2,1,1,1,1,'2013-09-17 08:26:12','2013-09-17 08:26:12','Documento_166.pdf','application/pdf',2677157,'2013-09-17 08:26:12',20,0,0,'INCOMPLETO'),(167,'Estudio de desempeÃ±o en un ambiente \nde comunicaciÃ³n Bluetooth. \nCaso de estudio Piconet y Scatternet.\n','La siguiente investigaciÃ³n trata de presentar un mÃ©todo que permita la interconexiÃ³n de varias Piconets (una red de dispositivos que se conectan utilizando Bluetooth), estas agrupaciones son conocidas con el nombre de Scatternet y estudiaremos el impacto en el desempeÃ±o de la comunicaciÃ³n extremo a extremo entre diversos dispositivos Bluetooth.\n	A pesar de la popularidad de la tecnologÃ­a Bluetooth para la interconexiÃ³n inalÃ¡mbrica de dispositivos electrÃ³nicos tales como: teclados, mouse, impresoras, telÃ©fonos mÃ³viles, auriculares, PDA (Asistente Digital Personal) y computadores; existen pocos trabajos de investigaciÃ³n para la implementaciÃ³n y mediciÃ³n de desempeÃ±o de la topologÃ­a de comunicaciÃ³n Scatternet Bluetooth. Adicionalmente, tanto la especificaciÃ³n del grupo especial de investigaciÃ³n SIG (special interest group) Bluetooth creadores de la tecnologÃ­a y el estÃ¡ndar de la IEEE 802.15.1 no definen un mecanismo para la creaciÃ³n de esta topologÃ­a, lo que motivÃ³ el desarrollo de esta investigaciÃ³n. \n	En esta investigaciÃ³n se presenta una metodologÃ­a para la implementaciÃ³n  de la estructura de comunicaciÃ³n Scatternet, desarrollado sobre una plataforma Linux en particular la distribuciÃ³n Ubuntu 8.04 â€“ Hardy Heron, adicionalmente se usaron los siguientes recursos: el perfil PAN (Personal Area Network), las bibliotecas y herramientas brindadas por Bluez (pila oficial de protocolos Bluetooth para Linux).\n	Se diseÃ±aron un conjunto de escenarios con diversas topologÃ­as con el objeto de evaluar el desempeÃ±o en las comunicaciones con la tecnologÃ­a Bluetooth e identificar aquellos factores que lo degradan\n	El conjunto de medidas obtenidas a partir de las pruebas realizadas, mostraron un bajo desempeÃ±o en topologÃ­as con saltos o nodos intermedios y en topologÃ­as pobladas con trÃ¡fico.\n','2009-06-23','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:26:14','2013-09-17 08:26:14','Documento_167.pdf','application/pdf',736911,'2013-09-17 08:26:14',20,0,81,'COMPLETO'),(168,'Trabajo Especial de grado presentado ante la ilustre Universidad Central de Venezuela, por el Br. Julian Rueda, para optar por el tÃ­tulo de Licenciado en QuÃ­mica. \"\"ESTUDIO DE LA INCORPORACION DE NIQUEL EN LA SILICE MESOPOROSA SBA--1155 PARA LA REACCION DE ALQUILACION FRIEDEL--CRAFTS\"\"','En este Trabajo Especial de Grado se sintetizaron 3 sÃ³lidos mesoporosos SBA-15 incorporando nÃ­quel, dos de ellos preparados mediante la tÃ©cnica de impregnaciÃ³n por humedad incipiente con 15 y 25% p/p de carga del metal y el ultimo mediante sÃ­ntesis directa con 25% de Ni. Los sÃ³lidos fueron caracterizados mediante estudios de FisisorciÃ³n de N2 e Isotermas de AdsorciÃ³n- DesorciÃ³n, anÃ¡lisis BET, Espectroscopia IR, TGA, DRX, anÃ¡lisis quÃ­mico elemental y TPR. Estos sÃ³lidos se utilizaron como catalizadores en la reacciÃ³n de alquilaciÃ³n Friedel-Crafts de benceno, tolueno, anisol, nitrobenceno, naftaleno y 8-hidroxiquinolina, empleando cloruro de bencilo como agente alquilante. Se pudo confirmar gracias a los anÃ¡lisis de TGA, DRX, IR y BET que se obtuvieron los sÃ³lidos mesoporosos SBA-15 satisfactoriamente, observÃ¡ndose sus caracterÃ­sticas texturales y estructurales tÃ­picas aun despuÃ©s de la incorporaciÃ³n del nÃ­quel. Los anÃ¡lisis de TPR y de DRX reflejaron que la especie activa catalÃ­ticamente de nÃ­quel se encontraba como NiO. Los sistemas de catalizadores NiO-SBA-15 presentaron bajas actividades con los sustratos utilizados para las alquilaciones Friedel-Crafts, esto atribuido a la baja acides Lewis de las especies de Ni+2. Los anÃ¡lisisespectroscÃ³picos indicaron que los productos obtenidos son compuestos monoalquilados, lo cual sugiere que estos catalizadores son altamente selectivos para productos monosustituidos. AdemÃ¡s, la alquilaciÃ³n de nitrobenceno se llevÃ³ a cabo sobre estos catalizadores.','2009-06-29','Catalisis, niquel, SBA-15, alquilaciÃ³n, Friedel-Crafts',6,1,1,1,1,'2013-09-17 08:26:18','2013-09-17 08:26:18','Documento_168.pdf','application/pdf',1508968,'2013-09-17 08:26:18',18,0,86,'COMPLETO'),(169,'Implantacion de una Plataforma de Software Colaborativo que Permita Integrar Servicios Ofertados por la Facultad de Ciencias','En este trabajo se desarrollÃ³ e implantÃ³ una aplicaciÃ³n que permita el acceso centralizado a un conjunto de servicios propios de la Facultad de Ciencias de la Universidad Central de Venezuela, como lo son: La solicitud y administraciÃ³n de los soportes tÃ©cnicos, el acceso al sistema de reservaciÃ³n de salas, el acceso a un cliente de mensajerÃ­a instantÃ¡nea y la integraciÃ³n de un sistema de administraciÃ³n de foros que permita mantener hilos de discusiÃ³n entre los usuarios de la intranet.','2009-07-16','Intranet, ComunicaciÃ³n, CentralizaciÃ³n, Sistema Colaborativo, PHP, JavaScript.',2,1,1,1,2,'2013-09-17 08:26:19','2013-09-17 08:26:19','Documento_169.pdf','application/pdf',0,'2013-09-17 08:26:19',20,0,0,'INCOMPLETO'),(170,'Registro de imÃ¡genes mÃ©dicas multimodalidad.','En la actualidad es habitual realizar diferentes estudios al mismo paciente o espÃ©cimen, ya sea empleando imÃ¡genes adquiridas a lo largo del tiempo bajo la misma modalidad o bajo distintas modalidades. En la investigaciÃ³n de ciertas enfermedades se contrastan incluso con imÃ¡genes pertenecientes a diferentes sujetos. Para comparar la informaciÃ³n obtenida de los diferentes estudios es necesario corregir las diferencias de tamaÃ±o, posicionamiento, orientaciÃ³n o incluso distorsiÃ³n espacial entre ellos. Se denomina registro al proceso de establecer la concordancia espacial punto a punto entre las diferentes imÃ¡genes, de manera que sea posible la comparaciÃ³n directa entre ellas. Se propone una metodologÃ­a para el registro de imÃ¡genes mÃ©dicas bidimensionales y tridimensionales obtenidas bajo diferentes modalidades. Las imÃ¡genes a considerar son de resonancia magnÃ©tica (MR), tomografÃ­a computarizada (CT) y tomografÃ­a por emisiÃ³n de positrones (PET) del cerebro. Para realizar el registro se determina una transformaciÃ³n espacial T que ponga en concordancia espacial a una imagen A, que se denominara imagen referencia, con otra imagen B, imagen a registrar. La aplicaciÃ³n de la transformaciÃ³n TT sobre la imagen B genera la imagen registrada B\'\'. Considerando las imÃ¡genes como matrices el problema se reduce a encontrar una matriz T cambio de base entre la imagen referencia y la imagen a registrar. La metodologÃ­a propuesta para el registro de imÃ¡genes comprende: pre-procesamiento, transformaciÃ³n, comparaciÃ³n y optimizaciÃ³n. El pre- procesamiento corresponde a la aplicaciÃ³n de diferentes tÃ©cnicas de procesamiento de imÃ¡genes para reducir el ruido, re-escalar y segmentar las imÃ¡genes de manera apropiada para la correspondencia. La trasformaciÃ³n permite el cÃ¡lculo de los coeficientes de T para obtener la imagen registrada, establece la relaciÃ³n entre los puntos del espacio de la imagen A y los del espacio de la imagen B. Se emplean transformaciones rÃ­gidas o afines, porque la aplicaciÃ³n se delimita a imÃ¡genes cerebrales intra-sujeto donde la forma generalmente es constante. El proceso de comparaciÃ³n permite cuantificar el nivel de alineamiento entre las imÃ¡genes Ay B\'\',, para ello se plantean como mÃ©tricas aplicables a diferentes tipos de registro el coeficiente de correlaciÃ³n y la informaciÃ³n mutua que es una mÃ©trica basada en la teorÃ­a de la informaciÃ³n. El problema de registro generalmente se basa en determinar los parÃ¡metros de la transformaciÃ³n que hacen que la mÃ©trica de comparaciÃ³n sea mÃ¡xima, para ello es necesario encontrar el valor Ã³ptimo de esta medida definido por los grados de libertad de la transformaciÃ³n TT. Se utiliza el mÃ©todo simplex como proceso de optimizaciÃ³n, que es un mÃ©todo basado en bÃºsqueda de direcciones, partiendo de un simplex inicial se realiza un proceso iterativo que evalÃºa las funciones en estos puntos encontrando el valor mÃ¡s Ã³ptimo realizando una serie de transformaciones hasta cumplir con los criterios de paradas establecidos.','2009-07-08','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',5,1,1,1,1,'2013-09-17 08:26:20','2013-09-17 08:26:20','Documento_170.pdf','application/pdf',0,'2013-09-17 08:26:20',20,0,0,'INCOMPLETO'),(171,'ESTUDIO DE LA RESPUESTA DE GELES POLIMÃ‰RICOS A LA RADIACIÃ“N IONIZANTE MEDIANTE SIMULACIÃ“N DE LA ALTERACIÃ“N DE SU ESTRUCTURA CON MODELOS DE GASES RETICULARES','{}','2009-04-28','RadiaciÃ³n Ionizante, Geles, polÃ­meros, SimulaciÃ³n, modelo, automata',3,1,1,1,1,'2013-09-17 08:26:21','2013-09-17 08:26:21','Documento_171.pdf','application/pdf',969231,'2013-09-17 08:26:21',18,0,81,'COMPLETO'),(172,'Un compilador portable para una notaciÃ³n AlgorÃ­tmica BÃ¡sica','Un compilador puede definirse como un traductor; puede traducir instrucciones a un \"idioma\" que entiende un computador. Este trabajo muestra la investigaciÃ³n e implementaciÃ³n que tomÃ³ la construcciÃ³n de un compilador que entiende cÃ³digo escrito en un lenguaje natural y lo traduce a cÃ³digo que entiende la maquina virtual de Java. La MV de Java tiene una arquitectura muy parecida a las maquinas fÃ­sicas de hoy en dÃ­a, es portable y poderosa lo cual la hace una buena opciÃ³n para este compilador. Fue creado con herramientas que se consiguen en casi todas las plataformas para que pueda ser instalado en cualquier computadora. Estas herramientas son muy poderosas, pueden crear analizadores lexicogrÃ¡ficos y sintÃ¡cticos, facilitan el manejo de errores y son fÃ¡ciles de entender. El resultado es un compilador Java de un lenguaje con conceptos bÃ¡sicos de la programaciÃ³n que tiene muchas posibilidades de extenderse, como aÃ±adir conceptos avanzados en investigaciones futuras.','2009-07-08','compilador java pseudoformal bison yacc flex lex portable traduccion',2,1,1,1,1,'2013-09-17 08:26:22','2013-09-17 08:26:22','Documento_172.pdf','application/pdf',1790887,'2013-09-17 08:26:22',20,0,101,'COMPLETO'),(173,'\"\"HIDROTRATAMIENTO DE UN RESIDUO DE REFINERÃÃAA,, EMPLEANDOCATALIZADORES EN BASE A Mo,, Ni--Mo y Co--Mo SOPORTADOS Y ACTIVADOSCON COMPUESTOS ORGÃÃNNICOS DE AZUFRE\"\"..','Debido a restricciones cada vez mayores en el campo ambiental, existe un interÃ©sespecial a nivel global en el desarrollo de catalizadores mÃ¡s selectivos para el procesode hidrotratamiento (HDT) de combustibles fÃ³siles. El mejoramiento de los catalizadorespara HDT considera el entendimiento de sus propiedades fÃ­sicas y quÃ­micas las cualesse ven afectadas por el uso de distintos materiales como soportes y la interacciÃ³n de losmismos con las fases metÃ¡licas que constituyen los centros activos. En este aspectolos mÃ©todos de preparaciÃ³n de los precursores catalÃ­ticos, incluyendo los procesos demodificaciÃ³n, juegan un papel fundamental en favorecer la actividad para la remociÃ³nde compuestos sulfurados y nitrogenados.El siguiente trabajo de grado se enfocÃ³ en un mÃ©todo de sÃ­ntesis que implica lamodificaciÃ³n de la superficie del soporte con g-aminopropiltrietoxisilano (GAPS) con el objetivo de sintetizar nanocatalizadores de sulfuros de CoMo, NiMo y Mo. LamodificaciÃ³n consiste en el anclaje de grupos organometÃ¡licos en la superficie de lasepiolita que luego es expuesta a la adsorciÃ³n de los iones Co2+, seguidos de la formaciÃ³n de clorhidratos que permite el intercambio iÃ³nico de los iones cloruros con laespecie de Mo6+ de la sal empleada. La modificaciÃ³n del soporte permitiÃ³ que hasta 4% de carga metÃ¡lica fuera depositada en el soporte, siendo este valor menor que la cargametÃ¡lica de los catalizadores comerciales utilizados actualmente en la industria yutilizados como referencia en este trabajo. El carbono formado in-situ, actuÃ³ comosoporte, mejorando la dispersiÃ³n de la fase metÃ¡lica y evitando la interacciÃ³n directacon la sepiolita. Los precursores catalÃ­ticos fueron activados con disulfuro de carbono(CS2) como agente sulfurante con una composiciÃ³n definida de H2/CS2 a baja temperatura (- 18;-20Â°C), proveyendo la composiciÃ³n necesaria para la activaciÃ³n delprecursor catalÃ­tico. Los mÃ©todos empleados para la caracterizaciÃ³n del soporte, los precursores catalÃ­ticos,los catalizadores sintetizados y el gasÃ³leo proveniente de la destilaciÃ³n al vacÃ­o (VGO)una vez hidrotratado, fueron establecidos por las siguientes tÃ©cnicas: Ãrea EspecÃ­fica,EspectroscopÃ­a de Infrarrojo (IR-TF) y AnÃ¡lisis TermogravimÃ©trico. Con este Ãºltimo, sedeterminÃ³ la cantidad total de carbono depositado sobre la superficie del catalizador,donde se pudo observar que en el catalizador NiMo se formÃ³ menos capa carbonÃ¡cea,posiblemente por la tendencia hacia un mecanismo de reacciÃ³n que involucra lapresencia de H..proveniente de un proceso de spill--over, facilitado por NiS altamente disperso.La actividad de los catalizadores fue medida por un proceso de hidrotratamientoempleando un reactor por carga, bajo las mismas condiciones en la reacciÃ³n de HDSde un residuo de refinerÃ­a. Los catalizadores bimÃ©talicos diseÃ±ados mostraron unamayor actividad con relaciÃ³n al comercial, a pesar que este Ãºltimo posee una cargametÃ¡lica 3 veces superior. Esto pone en relieve el valor del mÃ©todo de preparaciÃ³n conGAPS para obtener catalizadores mÃ¡s activos y contribuir al desarrollo de la industriade la refinaciÃ³n petrolera venezolana, en uno de los principales de procesos como lo esel hidrotratamiento catalÃ­tico.','2009-06-23','{}',6,1,1,1,1,'2013-09-17 08:26:25','2013-09-17 08:26:25','Documento_173.pdf','application/pdf',0,'2013-09-17 08:26:25',20,0,0,'INCOMPLETO'),(174,'SINTESIS DE 1-BENZOIL-1,2-DIHIDROQUINOLINAS SUSTITUIDAS COMO POSIBLES INHIBIDORES DE LA POLIMERIZACION DE TUBULINA','El cancer es considerado como una enfermedad del ciclo celular, un proceso complejo que consta de cuatro fases: gap 1 (G1), sintesis de ADN (S), gap 2 (G2) y mitosis (M). Los quimioterapeuticos actuan sobre las diversas fases del ciclo celular; uno de sus modos de accion es la inhibicion de la mitosis celular por despolimerizacion de los microtubulos, evitando la formacion del huso mitotico, la segregacion cromosomica y la citocinesis. Entre los despolimerizadores de microtubulos estan: La colchicina y derivados, la esteganacina y las combretastatinas. Considerando las caracteristicas estructurales comunes presentes en estos compuestos, se diseÃ±o la sintesis de un grupo de 1-benzoil-1,2-dihidroquinolinas sustituidas con caracteristicas estructurales semejantes a los compuestos previos, entre las que destacan un anillo trimetoxibencenico y un anillo aromatico con dos sustituyentes oxigenados adyacentes. Los compuestos obtenidos fueron caracterizados usando las tecnicas espectroscopicas masas, IR, RMN 1H y 13C.','2009-06-30','1-benzoil-1,2-dihidroquinolinas, mitosis, microtubulos, tubulina, ciclo celular.',6,1,1,1,1,'2013-09-17 08:26:26','2013-09-17 08:26:26','Documento_174.pdf','application/pdf',0,'2013-09-17 08:26:26',18,0,0,'INCOMPLETO'),(175,'AnÃ¡lisis Espectral al Registro de Alturas de Olas y Aplicaciones al Caribe del Sur','Se trata de un trabajo que explica el modelado de la superficie del mar como una superficie aleatoria y algunas tÃ©cnicas de AnÃ¡lisis Espectral aplicadas a varios registros de alturas de olas tomados de una boya ubicada en el mar Caribe Sur.','2009-07-10','CÃ¡lculo EstocÃ¡stico, AnÃ¡lisis Espectral, Olas, Superficie del Mar.',5,1,1,1,1,'2013-09-17 08:26:27','2013-09-17 08:26:27','Documento_175.pdf','application/pdf',1761668,'2013-09-17 08:26:27',20,0,77,'COMPLETO'),(176,'ABSORCIÃ“Ã“NN INTESTINAL DE FLAVONOIDES PRESENTES EN LAS HOJAS DE Bauhinia megalandra Y SUSEFECTOS SOBRE LA ELIMINACIÃ“Ã“NN URINARIADE GLUCOSA EN RATAS','Las investigaciones con respecto a los compuestos naturales de las plantas han tenido un gran auge en los Ãºltimos tiempos, debido a que Ã©stos presentan diversas propiedades medicinales y farmacolÃ³gicas. Dentro de estos componentes naturales se encuentran los flavonoides, que son metabolitos secundarios aromÃ¡ticos presentes en los vegetales, frutas, y productos procesados, tales como: vinos, cervezas, tÃ© negro y verde, entre otros. El objetivo principal de este trabajo es demostrar la absorciÃ³n intestinal de algunos flavonoides contenidos en el extracto acuoso de hojas de la planta Bauhinia megalandra y sus efectos sobre la eliminaciÃ³n urinaria de glucosa en ratas. De la orina se extrajeron los flavonoides y/o sus metabolitos, utilizando una modificaciÃ³n del mÃ©todo de Zhao y col. (2007). Los compuestos obtenidos fueron fraccionados, purificados e identificados, aplicando mÃ©todos cromatogrÃ¡ficos (capa fina y de columna) y espectroscÃ³picos (resonancia magnÃ©tica nuclear de [1H] y de [13C] y espectrometrÃ­a de masas); tambiÃ©n se determinÃ³ la cantidad de glucosa, por el mÃ©todo enzimÃ¡tico GOP/POD en orina y sangre. Al observarse los cromatogramas de las muestras biolÃ³gicas, se pudo visualizar un compuesto de color azul / grisÃ¡ceo en la orina experimental fraccionada con acetona, que no se visualizÃ³ ni en la orina control ni en el extracto acuoso de hojas de la planta, lo que sugiere que alguno de los flavonoides presentes, fue absorbido, metabolizado y excretado de una forma diferente. Se sugiriÃ³ que dicho metabolito es un compuesto derivado del benceno orto-disustituido. Asimismo se encontrÃ³ una mayor cantidad de glucosa en la muestra de orina de los animales que recibieron el extracto acuoso de hojas B.. megalandra (10,49 Â± 1.2 mg de glucosa/24 horas) en comparaciÃ³n con el control (2,92 Â± 0.23 mg glucosa/24 horas), lo cual fue estadÃ­sticamente significativo a p < 0,005. Esto corresponde a un incremento de aproximadamente 3,6 veces de la cantidad de glucosa eliminada por la orina. Por otra parte se observÃ³, una discreta disminuciÃ³n de la glicemia (controles 77,31 Â± 5,11 mg glucosa/dl y experimentales 70,26 Â± 1,17 mg glucosa/dl), que tambiÃ©n fue estadÃ­sticamente significativo a p < 0.01, representando una disminuciÃ³n de alrededor del 9% de la glucosa sanguÃ­nea. Puede sugerirse que la disminuciÃ³n en la glicemia, se debe a la actividad hipoglicemiante de los extractos de la planta, cuyo efecto probablemente es similar al de otras especies de Bauhinia, tales como: B.. kalbreyeri Harms, B.. cheilandra, B.. forticata y B.. monandra Kurz, entre otras (Sousa y col., 2004; Almeida y col., 2006; Murillo y col., 2006; Sousa y col., 2007). Estos resultados sugieren que estamos en presencia de un proceso de glucosuria renal, probablemente debido a la inhibiciÃ³n del SGLT1 (Sodium-- GlucoseTransporters 11)) de las cÃ©lulas de los tÃºbulos renales por flavonoides presentes en el extracto acuoso de Bauhinia megalandra que fueron absorbidos a nivel intestinal y por vÃ­a sanguÃ­nea alcanzan al riÃ±Ã³n. Este efecto, serÃ­a similar al observado por GonzÃ¡lez-Mujica y col. (2003), quienes demostraron que el extracto acuoso de las hojas de B.. megalandra inhibe la absorciÃ³n intestinal de glucosa, afectando al transportador SGLT1, posiblemente por flavonoides contenidos en el extracto acuoso de la misma planta. La glucosuria renal es una evidencia indirecta de la absorciÃ³n intestinal de flavonoides presentes en el extracto acuoso de hojas de B.. megalandra. Con esta investigaciÃ³n se pudo demostrar la absorciÃ³n intestinal de algunos flavonoides contenidos en el extracto acuoso de hojas de la planta Bauhinia megalandra y sus efectos sobre la eliminaciÃ³n urinaria de glucosa en ratas, todo con la finalidad de aportar una mayor informaciÃ³n para la elaboraciÃ³n de medicamentos orales a partir de los componentes activos presentes en los flavonoides del extracto, que permitan, combatir enfermedades como la Diabetes Mellitus.','2009-06-05','Bauhinia megalandra, absorciÃ³n intestinal,glucosuria renal',1,1,1,1,2,'2013-09-17 08:26:28','2013-09-17 08:26:28','Documento_176.pdf','application/pdf',4435190,'2013-09-17 08:26:28',20,0,116,'COMPLETO'),(177,'Estudio de las propiedades fÃ­sicas de espacio-tiempos cuasiesfÃ©ricos','Se presenta el estudio de algunos espaciotiempos de Weyl como la mÃ©trica M-- Q donde se calculÃ³ la aceleraciÃ³n radial medida por un observador Lorentziano cerca del horizonte de eventos. Como lo predice el teorema de Israe l, se produjeron bifurcaciones respecto al caso esfÃ©ricamente simÃ©trico de Schwarzschild, las cuales se estudiaron en tÃ©rminos del escalar de superenergÃ­a.','2009-07-17','teoremaisrael relatividad relatividadgeneral espaciotiempo cuasiesfÃ©rico weyl m-q superenergÃ­a',3,1,1,1,1,'2013-09-17 08:26:29','2013-09-17 08:26:29','Documento_177.pdf','application/pdf',5823679,'2013-09-17 08:26:29',18,0,0,'INCOMPLETO'),(178,'Desarrollo de un prototipo de aplicaciÃ³Ã³nn web para automatizar y optimizar los procesos acadÃ©Ã©micos de la CoordinaciÃ³Ã³nn de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela','En la unidad acadÃ©mica de la CoordinaciÃ³n de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela intervienen un determinado nÃºmero de procesos 