ia, sin embargo se ha observado que algunos tumores no responden a los fÃ¡rmacos (resistencia primaria o innata), mientras que otros que inicialmente son sensibles al tratamiento, eventualmente pueden desarrollar resistencia (resistencia secundaria o adquirida). Recientemente se ha mostrado interÃ©s en el uso de plantas como agentes antitumorales, ya que el cÃ¡ncer es una enfermedad que comprende un conjunto complejo de signos y sÃ­ntomas. El potencial terapÃ©utico de los fÃ¡rmacos antitumorales derivados de las plantas pueden deberse a una variedad de mecanismos, por ejemplo: muerte por apoptosis, como molÃ©cula antiangiogÃ©nica, inhibidores de proteasas, inmunomoduladores, anti- inflamatorios. Entre los compuestos naturales de importancia estÃ¡n las tetrahidroquinolinas aisladas de plantas superiores. El grupo de las 2,4- diaril-tetrahidroquinolinas sustituidas son anÃ¡logos sintÃ©ticos de las tetrahidroquinolinas (alcaloides) de origen natural aislados de diferentes plantas, como por ejemplo Galipea officinalis (Rutaceae). Estas estructuras tetrahidroquinolÃ­nicas son similares a otros compuestos reportados con actividades antitumorales y antioxidantes. El objetivo del presente trabajo es estudiar la actividad citotÃ³xica del grupo de compuestos sintÃ©ticos 2,4- diaril-tetrahidroquinolinas sustituidas en cÃ©lulas de cÃ¡ncer de mama. Para ello se realizaron ensayos de citotoxicidad con lÃ­neas celulares tumorales MCF-7 y SKBR3 de cÃ¡ncer de mama y cÃ©lulas normales obtenidas de cultivos primarios de fibroblastos dÃ©rmicos. La tÃ©cnica utilizada fue la del MTT diseÃ±ada por Mossman en 1983; luego de 72 horas de incubaciÃ³n se calcularon los valores de concentraciÃ³n inhibitoria (CI50), Ã­ndices de selectividad, relaciones dosis- respuesta y se realizaron combinaciones con los fÃ¡rmacos antitumorales Taxol y la Gemcitabina que son utilizadas recurrentemente en los tratamientos quimioterapÃ©uticos del cÃ¡ncer de mama. Los resultados obtenidos reflejan una alta selectividad de los compuestos sintÃ©ticos pertenecientes al grupo 2,4- diaril-tetrahidroquinolinas sustituidas hacia la citotoxicidad sobre las lÃ­neas celulares MCF-7 (CI50 = 3,01 a 30,81Âµg/mL) y SKBR3 (CI50 = 6,77 a 56,51 Âµg/mL) con respecto a las cÃ©lulas normales (CI50 = 16,77 a 58,55 Âµg/mL). Por otro lado, una de las 9 molÃ©culas evaluadas en este estudio presentÃ³ un Ã­ndice de selectividad casi tres veces mas grande que el obtenido para el fÃ¡rmaco de referencia Taxol en la lÃ­nea celular MCF-7, lo que demuestra la alta selectividad de estos compuestos sintÃ©ticos hacia las cÃ©lulas tumorales sin afectar demasiado a las cÃ©lulas normales. La combinaciÃ³n del compuesto DM5 con el fÃ¡rmaco antitumoral Taxol sobre la lÃ­nea celular SKBR3 presentÃ³ un sinergismo muy fuerte de tipo potenciaciÃ³n, lo que se tradujo en una disminuciÃ³n de la concentraciÃ³n de 100 Âµg/mL a 0,186 Âµg/mL para obtener una efectividad mÃ¡xima cercana al 90% para ambos compuestos quÃ­micos. En conclusiÃ³n, todos los compuestos pertenecientes al grupo 2,4-DAr-THQs muestran una inhibiciÃ³n sobre la viabilidad celular sobre las lÃ­neas tumorales MCF-7 y SKBR3, conforme aumenta la dosis de los compuestos.','2009-09-18','CÃ¡ncer, Ensayos de Citotoxicidad, Tetrahidroquinolinas, CombinaciÃ³n de FÃ¡rmacos, FarmacologÃ­a',1,1,1,1,1,'2013-09-17 08:26:32','2013-09-17 08:26:32','Documento_179.pdf','application/pdf',3124001,'2013-09-17 08:26:32',20,0,177,'COMPLETO'),(180,'Una herramienta basada en tecnologÃ­a Palm Pilot para el Sistema Industrial de CrÃ©dito: AnÃ¡lisis de Factibilidad y DiseÃ±o de una Interfaz de ComunicaciÃ³n.','El banco de la Gente Emprendedora tiene planteado dentro de sus estrategias organizacional la implantaciÃ³n de un sistema que apoye la gestiÃ³n de la asistente administrativo y el asesor de negocio, automatizando el proceso de transcripciÃ³n de informaciÃ³n de las solicitudes de crÃ©dito de los clientes y mejorando los procesos de obtenciÃ³n de informaciÃ³n del estatus de la cartera de crÃ©dito para el asesor de negocio; el mejoramiento de ambos procesos aumentarÃ­a la productividad de ambas Ã¡reas, lo que se traducirÃ­a en un ofrecimiento adecuado del servicio que se le presta a los clientes y el cumplimiento del eslogan de la organizaciÃ³n \"crÃ©ditos rÃ¡pidos y sin tanto papeleo\". Otra ventaja para el desarrollo de un sistema de esta envergadura es lo relacionado al ahorro de recursos materiales tales como papel, tinta, consumibles, espacio fÃ­sico de equipos destinados para asesores de negocio, etc. Por lo antes expuesto es que se estÃ¡ desarrollando un sistema basado en tecnologÃ­a Pal Pilot (Dispositivos mÃ³viles) para la captura de informaciÃ³n en campo de las solicitudes de crÃ©dito de clientes, que a travÃ©s de su respectiva interfaz podrÃ¡ llevar dicha informaciÃ³n al Core principal de la organizaciÃ³n eliminando las transcripciones innecesarias, el gasto excesivo de papel, uso de formularios, consumibles, etc. y eliminara en gran medida el uso y tiempo requerido de la fuerza de venta en un computador personal, ya que la mayorÃ­a de la informaciÃ³n requerida estarÃ¡ disponible en su dispositivo de bolsillo (Palm Pilot) a travÃ©s de las distintas sincronizaciones con la interfaz, mejorando asÃ­ eficientemente el servicio que se le presta a los clientes de esta prestigiosa organizaciÃ³n Financiera.','2009-10-02','Estrategia Organizacional, Procesos, Interfase, Dispositivos MÃ³viles, ahorro, productividad y Servicio.',2,1,1,1,1,'2013-09-17 08:26:33','2013-09-17 08:26:33','Documento_180.pdf','application/pdf',0,'2013-09-17 08:26:33',19,0,0,'INCOMPLETO'),(181,'Efecto de la simulaciÃ³Ã³nn de los cambios redox del suelo,, sobre las relaciones Fe--C--P en un bosque de tierra firme dela Reserva Forestal de Imataca,, Estado BolÃ­Ã­var','El fÃ³sforo (P) es uno de los principales nutrientes limitantes de la productividad primaria neta, en los suelos de bosques hÃºmedos tropicales, altamente meteorizados. La alta humedad prevaleciente, acoplada a un importante contenido de materia orgÃ¡nica y arcilla en el suelo, puede resultar en fluctuaciones del potencial redox, lo cual, puede conducir a la reducciÃ³n microbiana de los Ã³xidos de hierro (Fe) y la subsiguiente liberaciÃ³n de P a la soluciÃ³n del suelo. En este estudio se desarrollÃ³ un experimento de laboratorio simulando condiciones variadas en el potencial redox del suelo, con la finalidad de observar el efecto de estas variaciones en las relaciones Fe-C- P en un suelo de bosque hÃºmedo tropical de la Reserva Forestal de Imataca. Los resultados mostraron que en treinta dÃ­as de incubaciÃ³n la condiciÃ³n estrictamente anÃ³xica no conduce a la reducciÃ³n bacteriana de Fe y liberaciÃ³n de P, probablemente debido a limitaciones en la biodisponibilidad de carbono orgÃ¡nico (CO orgÃ¡nico lÃ¡bil). La suplencia de oxigeno (O2) en pequeÃ±as cantidades promueve la reducciÃ³n de Fe (III) con la consecuente liberaciÃ³n del P asociado. La mayor eficiencia bajo estas condiciones puede deberse a dos factores (i) que ocurra un incremento en la eficiencia de oxidaciÃ³n de la materia orgÃ¡nica debido a que microorganismos anaerÃ³bicos y aerÃ³bicos estÃ©n trabajando simultÃ¡neamente y (ii) que al ocurrir cambios en el establecimiento de la condiciÃ³n redox del suelo los microorganismos no adaptados a la nueva condiciÃ³n mueran y sirvan de sustrato orgÃ¡nico lÃ¡bil para el nuevo grupo de microorganismos que comienzan a establecerse, promoviÃ©ndose asÃ­ la reducciÃ³n bacteriana de los Ã³xidos de Fe(III).','2009-09-04','Suelos altamente meteorizados, potencial redox del suelo, reducciÃ³n bacteriana de Fe, liberaciÃ³n de fÃ³sforo, organismos aerÃ³bicos, organismos anaerÃ³bicos, carbono orgÃ¡nico lÃ¡bil.',4,1,1,1,1,'2013-09-17 08:26:33','2013-09-17 08:26:33','Documento_181.pdf','application/pdf',3124001,'2013-09-17 08:26:33',20,0,177,'COMPLETO'),(182,'Precondicionamiento por aproximaciones a la matriz pseudoinversa para el problema de mÃ­nimos cuadrados lineales.','Dada una matriz A en Rmxncon m >> n, de rango completo y un vector b en Rm, Se propone utilizar una aproximaciÃ³n a la matriz A++ en Rnxm, la pseudoinversa de A como precondicionador para el problema de mÃ­nimos cuadrados lineales asociado aA y b. Dicha aproximaciÃ³n a A++ se obtendrÃ¡ a partir del mÃ©Ã©todo iterativo de Schulz, un esquema iterativo basado en el mÃ©todo de Newton en espacios de matrices, usado para el cÃ¡lculo de matrices inversas y pseudoinversas. El problema de mÃ­nimos cuadrados precondicionado se resolverÃ¡ a travÃ©s del esquema de aceleraciÃ³Ã³nn de convergencia Richardson--PR22, un mÃ©todo iterativo--residual obtenido como a partir de una generalizaciÃ³n del mÃ©todo iterativo de Richardson de primer orden para sistemas de ecuaciones lineales. Se estudiarÃ¡n las propiedades del precondicionador y se realizarÃ¡n pruebas numÃ©ricas con diversas matrices densas ysparse.','2009-07-06','Ãlgebra lineal numÃ©rica, MÃ­nimos cuadrados, Precondicionamiento, Sistemas de ecuaciones lineales, mÃ©todos iterativos para sistemas lineales, matrices densas.',2,1,1,1,1,'2013-09-17 08:26:34','2013-09-17 08:26:34','Documento_182.pdf','application/pdf',4083291,'2013-09-17 08:26:34',20,0,136,'COMPLETO'),(183,'\"Desarrollo de LÃ¡minas Flexibles de Mango (Mangifera indica L) Enriquecidas con Calcio\"','Las lÃ¡minas de frutas constituyen una forma de conservaciÃ³n de alimentos, donde el producto es fabricado por deshidrataciÃ³n de pulpa acondicionada. El objetivo del presente trabajo fue desarrollar lÃ¡minas flexibles de mango (Mangifera indica L.) enriquecidas con calcio, estudiando las variables: contenido de sÃ³lidos solubles (20 y 30 Â°Brix), pectina aÃ±adida (0; 0,75 y 1,50%), y estabilidad en almacenamiento a temperatura ambiente (0; 1 y 4 semanas). DespuÃ©s de caracterizar la pulpa de mango `Bocado\', se realizaron pruebas para obtener la formulaciÃ³n base y se elaboraron las curvas de secado. Posteriormente, se probaron 6 formulaciones (20 y 30 Â°Brix inÃ­ciales con 0; 0,75 y 1,50% de pectina aÃ±adida) que se deshidrataron a 60 Â°C. Las lÃ¡minas se caracterizaron de forma fÃ­sica, quÃ­mica, microbiolÃ³gica y sensorial. AÃ±adir azÃºcar afectÃ³ el pH, el aw, la dureza y el color, mejorando el sabor. La adiciÃ³n de pectina sin aÃ±adir azÃºcar, incrementÃ³ la dureza; y en aquellas con azÃºcar aÃ±adida afectÃ³ favorablemente su color. DespuÃ©s de 4 semanas no se afectÃ³ significativamente el olor y sabor del producto, y se encontrÃ³ que si no se aÃ±ade pectina, aÃ±adir azÃºcar favorece la dureza de las lÃ¡minas. En conclusiÃ³n, utilizando pulpa de mango variedad Bocado, fue posible desarrollar lÃ¡minas flexibles enriquecidas con calcio, las cuales se caracterizaron por su bajo contenido de agua, alto contenido de azÃºcares, alta acidez y baja actividad de agua. Finalmente, la raciÃ³n propuesta (30 a 36 cm2), suministrarÃ­a el 9,23% del requerimiento de calcio en adolescentes.','2009-09-03','Mango, laminas flexibles, frutas, calcio, deshidrataciÃ³n, desarrollo de nuevos productos, cueritos de fruta, Mangifera indica L., pectina',1,1,1,1,1,'2013-09-17 08:26:36','2013-09-17 08:26:36','Documento_183.pdf','application/pdf',16742338,'2013-09-17 08:26:36',20,0,0,'INCOMPLETO'),(184,'Estudio de desempeÃ±o en un ambiente de comunicaciÃ³n BBluetooth. Caso de estudio Piconet y Scatternet.','La siguiente investigaciÃ³n trata de presentar un mÃ©todo que permita la interconexiÃ³n de varias Piconets (una red de dispositivos que se conectan utilizando Bluetooth), estas agrupaciones son conocidas con el nombre de Scatternet y estudiaremos el impacto en el desempeÃ±o de la comunicaciÃ³n extremo a extremo entre diversos dispositivos Bluetooth.A pesar de la popularidad de la tecnologÃ­a Bluetooth para la interconexiÃ³n inalÃ¡mbrica de dispositivos electrÃ³nicos tales como: teclados, mouse, impresoras, telÃ©fonos mÃ³viles, auriculares, PDA (Asistente Digital Personal) y computadores; existen pocos trabajos de investigaciÃ³n para la implementaciÃ³n y mediciÃ³n de desempeÃ±o de la topologÃ­a de comunicaciÃ³n Scatternet Bluetooth. Adicionalmente, tanto la especificaciÃ³n del grupo especial de investigaciÃ³n SIG (special interest group) Bluetooth creadores de la tecnologÃ­a y el estÃ¡ndar de la IEEE 802.15.1 no definen un mecanismo para la creaciÃ³n de esta topologÃ­a, lo que motivÃ³ el desarrollo de esta investigaciÃ³n.En esta investigaciÃ³n se presenta una metodologÃ­a para la implementaciÃ³n de la estructura de comunicaciÃ³n Scatternet, desarrollado sobre una plataforma Linux en particular la distribuciÃ³n Ubuntu 8.04 - Hardy Heron, adicionalmente se usaron los siguientes recursos: el perfil PAN (Personal Area Network), las bibliotecas y herramientas brindadas por Bluez (pila oficial de protocolos Bluetooth para Linux).Se diseÃ±aron un conjunto de escenarios con diversas topologÃ­as con el objeto de evaluar el desempeÃ±o en las comunicaciones con la tecnologÃ­a Bluetooth e identificar aquellos factores que lo degradan.El conjunto de medidas obtenidas a partir de las pruebas realizadas, mostraron un bajo desempeÃ±o en topologÃ­as con saltos o nodos intermedios y en topologÃ­as pobladas con trÃ¡fico.','2009-06-23','EstÃ¡ndar 802.15.1, WPAN, SIG Bluetooth, Piconet, Scatternet, perfil PAN, Bluez.',2,1,1,1,1,'2013-09-17 08:26:37','2013-09-17 08:26:37','Documento_184.pdf','application/pdf',0,'2013-09-17 08:26:37',20,0,0,'INCOMPLETO'),(185,'Definiendo la integral de Riemann sin utilizar sumas de Riemann','En este T.E.G. se construye una teorÃ­a de integraciÃ³n bastante simple, basada en un par de axiomas. Dan aplicaciones que muestran como puede aparecer la integral en el cÃ¡lculo, sin necesidad de sumas de Riemann y discuten la conexiÃ³n entre esta presentaciÃ³n y la historia del cÃ¡lculo.','2009-10-07','Integral de Riemann, integral de Darboux, propiedad aditiva y propieda asimptotiva',5,1,1,1,1,'2013-09-17 08:26:38','2013-09-17 08:26:38','Documento_185.pdf','application/pdf',7453225,'2013-09-17 08:26:38',19,0,0,'INCOMPLETO'),(186,'Desarrollo de un MÃ³dulo de generaciÃ³n de reportes para el sistema CONEST de la Facultad de Ciencias.','Actualmente la DivisiÃ³n de Control de Estudios de la Facultad de Ciencias de la Universidad Central de Venezuela dispone de una aplicaciÃ³n Web denominada CONEST, la cual se encarga de automatizar sus procesos y a su vez almacena toda la informaciÃ³n correspondiente a la gestiÃ³n acadÃ©mica de la Facultad. Para los distintos procesos que lleva a cabo la DivisiÃ³n de Control de Estudios es necesario emitir una serie de reportes, para los cuales no poseen una herramienta que les permita elaborarlos, ademÃ¡s actualmente el modelo de datos de este sistema posee alrededor de 140 tablas y esto dificulta la tarea de elaboraciÃ³n de reportes. Dada esta situaciÃ³n, en el presente Trabajo Especial de Grado se desarrollÃ³ una aplicaciÃ³n, la cual es a su vez un mÃ³dulo del sistema CONEST, que estÃ¡ dedicado exclusivamente a la generaciÃ³n y administraciÃ³n de reportes a partir de los datos almacenados en el repositorio de datos, todo esto basÃ¡ndose en el estudio de algunos generadores de reportes comerciales, analizando la forma como estos, a travÃ©s de secuencias ordenadas de pasos (wizards), apoyan al usuario en la tarea de elaboraciÃ³n de reportes. Entre los aspectos de desarrollo de esta aplicaciÃ³n tenemos el diseÃ±o del wizard que permite la creaciÃ³n de los reportes de una forma mÃ¡s sencilla, el desarrollo de los algoritmos de exportaciÃ³n de datos a los formatos soportados, el anÃ¡lisis del modelo de datos actual de CONEST, en base al cual se diseÃ±aron un conjunto de vistas que faciliten el acceso a los datos y la integraciÃ³n con el sistema CONEST.','2009-06-08','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:26:40','2013-09-17 08:26:40','Documento_186.pdf','application/pdf',3183462,'2013-09-17 08:26:40',20,0,102,'COMPLETO'),(187,'ElaboraciÃ³n de un Gem de Ruby que encapsule un Middleware SMS para el envÃ­o y recepciÃ³n de mensajes de texto.','El presente Trabajo Especial de Grado tiene como objetivo principal la elaboraciÃ³n de un gem de extensiÃ³n para el lenguaje de programaciÃ³n Ruby. Este gem encapsula un middleware que permite el envÃ­o y recepciÃ³n de mensajes de texto a travÃ©s de dispositivos celulares conectados al computador.Para la realizaciÃ³n de los mÃ³dulos de envÃ­o y recepciÃ³n de mensajes se utiliza Gnokii, logrando la omunicaciÃ³n del computador con el dispositivo celular a travÃ©s de comandos AT. Dichos comandos estÃ¡n soportados hoy en dÃ­a por la mayorÃ­a de los telÃ©fonos celulares que utilizan la tecnologÃ­a GSM.Se debe utilizar un mecanismo para poder integrar la librerÃ­a Gnokii(en lenguaje C/C++) con el lenguaje Ruby, para esto, debe crearse una extensiÃ³n a partir del cÃ³digo desarrollado en lenguaje C/C++. Existen distintos mecanismos que permiten la creaciÃ³n de una extensiÃ³n para Ruby. Se puede crear manualmente, utilizando un generador como Swig, o utilizar cÃ³digo C/C++ embebido en cÃ³digo Ruby. Al construir un gem de Ruby, Ã©ste puede ser distribuido fÃ¡cilmente colocÃ¡ndolo en repositorios como Github o RubyForge, desde donde puede ser descargado y utilizado por otros usuarios.','2009-09-07','SMS, Ruby, Gem, Comandos AT',2,1,1,1,1,'2013-09-17 08:26:43','2013-09-17 08:26:43','Documento_187.pdf','application/pdf',1171235,'2013-09-17 08:26:43',20,0,106,'COMPLETO'),(188,'Ecuaciones Funcionales en la TeorÃ­a de la ElecciÃ³n Social','Como herramienta para el estudio cuantitativo y la modelizaciÃ³n de fenÃ³menos, las matemÃ¡ticas estÃ¡n presentes en todas las disciplinas, y en particular en las ciencias polÃ­ticas. Los modelos matemÃ¡ticos que tradicionalmente han servido para describir situaciones surgidas en la fÃ­sica, en la ingenierÃ­a o en las finanzas, se han revelado recientemente Ãºtiles en el estudio y la descripciÃ³n de fenÃ³menos relativos a la conducta humana. En este trabajo lo que se hizo fue ver la aplicabilidad de la matemÃ¡tica en las ciencias sociales. Todo parte de querer tomar una decisiÃ³n colectiva ((Regla de ElecciÃ³Ã³nn Social)) a partir de ciertas decisiones individuales (Preferencias Individuales), sabiendo que esto requiere de un ordenamiento a dichas preferencias y para ello existen ciertos mÃ©todos que son capaces de darlo, precisamente es el estudio de las Ecuaciones Funcionales, una de las ramas de las matemÃ¡ticas utilizada para el modelaje de esta aplicaciÃ³n econÃ³mica. En la tesis se hizo especial referencia a la EcuaciÃ³n Funcional de Sincov como una de las mÃ¡s conocidas y utilizadas dentro de este Ã¡mbito, asÃ­ como tambiÃ©n se realizÃ³ el estudio de cierto contenido de matemÃ¡tica elemental tal como Relaciones Binarias, Relaciones de Equivalencia, Relaciones de Preferencia, Ordenes Intervalo, Semi ordenes entre otros.','2009-10-14','TeorÃ­a de ElecciÃ³n Social, Teorema de Arrow, relaciones binarias, elecciÃ³n, decisiÃ³n, preferencia, orden, intervalo, semi orden, ecuaciones funcionales, sincov.',5,1,1,1,1,'2013-09-17 08:26:44','2013-09-17 08:26:44','Documento_188.pdf','application/pdf',319761,'2013-09-17 08:26:44',20,0,10,'COMPLETO'),(189,'\"DeterminaciÃ³n de la masa molar de los asfaltenso utilizando su fracciÃ³n plegable A2\"','Las investigaciones en torno a los asfaltenos se han visto incrementadas en los Ãºltimos aÃ±os por los inconvenientes que causan a la industria petrolera. En este Ã¡mbito el cÃ³mo determinar la masa molar de los asfaltenos es una de las grandes dificultades que se presenta hoy en dÃ­a. Esto se atribuye a la capacidad que tienen los asfaltenos para agregarse, debido a que los agregados en este estado de asociaciÃ³n, las molÃ©culas que se forman poseen un valor de la masa molar por encima de su valor real. Por lo antes expuesto, este trabajo se basa en la hipÃ³tesis que la fracciÃ³n A2 de los asfaltenos tiene una menor tendencia a la agregaciÃ³n que la fracciÃ³n A1 debido a la capacidad que posee su estructura de plegarse y desplegarse en sÃ­ misma; por lo tanto puede ser utilizada para determinar la masa molecular sin el riesgo de monitorear agregados de mayor tamaÃ±o. CÃ¡lculos sencillos de mecÃ¡nica molecular demuestran que los confÃ³rmeros plegados son mucho mÃ¡s estables en comparaciÃ³n con los desplegados(12); cuando los confÃ³rmeros plegados se aproximan entre sÃ­, el nÃºmero de Ã¡tomos que interactÃºan entre las molÃ©culas es menor que el mÃ¡ximo posible, y esto lleva a una interacciÃ³n dÃ©bil tipo van der Waals dÃ©bil, por lo tanto en las molÃ©culas de la fracciÃ³n A2 no se espera agregaciÃ³n de este tipo. Por el contrario para la fracciÃ³n A1 se espera una alta tendencia a la agregaciÃ³n debido a que esta no posee capacidad de plegamiento, es decir, que cuando se aproxima una molÃ©cula de un modelo A1 a otra del mismo tipo, existe una fuerte interacciÃ³n de van der Waals (la llamada interacciÃ³n co-facial). Por lo tanto en esta fracciÃ³n si se espera agregaciÃ³n. Para iniciar el estudio, fue necesario llevar a cabo el fraccionamiento de los asfaltenos mediante el mÃ©todo p-nitrofenol (PNF)(3), obteniÃ©ndose de esta manera las dos fracciones A1 y A2 (insoluble y soluble en tolueno respectivamente). Adicionalmente, se determinÃ³ la masa molecular promedio en nÃºmero de los asfaltenos provenientes del crudo Carabobo y sus respectivas fracciones A1 y A2 a tres diferentes temperaturas (80, 100 y 125Â°C) usando la tÃ©cnica de OsmometrÃ­a de PresiÃ³n de Vapor (VPO). Los valores arrojados para los asfaltenos a las tres temperaturas fue de (1580 Â± 150) gmol-1; (1450 Â± 200) gmol-1 y (1540 Â± 340) gmol-1 respectivamente. Mientras que para el caso de la fracciÃ³n A1 a 80Â°C se obtuvo una masa molar de (3190 Â± 540) gmol-1; a 100Â°C (2970 Â± 570) gmol-1 y a 125Â°C el valor obtenido fue de (2600 Â± 520) gmol-1. Finalmente para la fracciÃ³n A2 a 80Â°C arrojo un valor de (1020 Â± 55) gmol-1; a 100Â°C (1200 Â± 190) gmol-1 y por Ãºltimo a 125Â°C (1060 Â± 140) gmol-1. Siendo la fracciÃ³n A2 quien presentÃ³ el menor valor en la determinaciÃ³n de la masa molar y manteniendo un valor relativamente constante al variar la temperatura y la concentraciÃ³n, se demuestra que la fracciÃ³n A2 tiene una menor tendencia a la agregaciÃ³n que la fracciÃ³n A1, que por el contrario dicha fracciÃ³n al disminuir la temperatura aumenta el valor de la masa molar lo que nos indica su agregaciÃ³n. En el caso de los asfaltenos al variar la temperatura no presenta variaciÃ³n con la temperatura, esto se atribuye a que los asfaltenos son una mezcla de la fracciÃ³n A1 y la fracciÃ³n A2 en un estado de agregaciÃ³n desconocido y muy difÃ­cil de anticipar, como tambiÃ©n es desconocido su comportamiento al variar la temperatura.','2009-09-29','crudo, asfaltenos, petroleo, S.A.R.A, fracciÃ³n A1, fracciÃ³n A2.',6,1,1,1,1,'2013-09-17 08:26:45','2013-09-17 08:26:45','Documento_189.pdf','application/pdf',437309,'2013-09-17 08:26:45',20,0,75,'COMPLETO'),(190,'DESARROLLO DE UNA APLICACIOÌN WEB DE PROGRAMA DE INCENTIVOS BAJO LA ARQUITECTURA CLIENTE-SERVIDOR UTILIZANDO LA METODOLOGIÌA DE DESARROLLO RUP-SCRUM','El objetivo de este Trabajo Especial de Grado es construir una aplicacioÌn web que sirva como base para el desarrollo de programas de incentivos, a traveÌs de la faÌcil modificacioÌn de la interfaz seguÌn la imagen de la empresa asiÌ como las reglas de negocio que deben aplicar, utilizando una metodologiÌa de desarrollo hiÌbrida entre RUP y Scrum, donde se tomen los aspectos de cada una que permitan desarrollar un buen producto con tiempos de espera cortos.\nUn programa de incentivos pretende incentivar la fuerza de trabajo de una empresa en la promocioÌn y venta de los productos que ofrece dicha empresa.\nEl desarrollo de la aplicacioÌn web se llevoÌ a cabo utilizando como meÌtodo de desarrollo una combinacioÌn entre RUP y Scrum. El trabajo se dividioÌ en cuatro (4) fases seguÌn la metodologiÌa RUP (a saber): inicio, elaboracioÌn, construccioÌn y transicioÌn. En la fase de inicio se analizoÌ el problema, se determinaron las principales funcionalidades del sistema y se realizaron las primeras versiones del modelo conceptual, del modelo de datos y de la interfaz del sistema tomando en cuenta la navegabilidad dentro de la aplicacioÌn web. En la fase de elaboracioÌn se profundizoÌ el anaÌlisis y se determinaron el resto de las funcionalidades del sistema. La fase de construccioÌn se desarrolloÌ de acuerdo a la metodologiÌa Scrum realizando un listado de las funcionalidades del sistema agrupadas por moÌdulos, seguÌn su afinidad, e implementaÌndolas semanalmente de modo que al final de cada semana se obtuvo un incremento funcional de la aplicacioÌn. Finalmente en la fase de transicioÌn se instaloÌ el producto y se realizaron pruebas colectivas mediante una matriz de pruebas.\nEsta combinacioÌn de metodologiÌas de desarrollo de software permitioÌ formalizar la documentacioÌn del proyecto, a traveÌs de los diferentes diagramas realizados, y minimizar los tiempos de entrega, al dividir el trabajo de tal forma que semanalmente se obtuviera un incremento funcional del sistema. A la vez que se logroÌ un producto de calidad que cumplioÌ con las expectativas del usuario final.','2009-10-09','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:26:47','2013-09-17 08:26:47','Documento_190.pdf','application/pdf',8888214,'2013-09-17 08:26:47',18,0,151,'COMPLETO'),(191,'ESTUDIO DE LA FRACCIÃ“N DE ARCILLAS Y MINERALES PESADOS, ASOCIADOS AL RESIDUO INSOLUBLE DEL MÃRMOL DE GUACURIPIA, EDO. BOLÃVAR Y SUELOS SUPRAYACENTES','En el presente trabajo de investigaciÃ³n se realizÃ³ un estudio de la fracciÃ³n de minerales tamaÃ±o arcilla y minerales pesados, asociados al residuo insoluble del MÃ¡rmol de Guacuripia y suelos suprayacentes del Edo. BolÃ­var, Venezuela.Para ello se trabajÃ³ con una muestra de roca y seis muestras de suelo. El anÃ¡lisis quÃ­mico solo se ejecutÃ³ para el caso de la muestra de roca, la cual fue sometida a digestiÃ³n parcial con HCl 4 M hasta obtener la disoluciÃ³n de la fase carbonÃ¡tica y el residuo insoluble. Una vez obtenido ambos materiales, las muestras de suelo y el residuo insoluble obtenido de la roca carbonÃ¡tica, se procediÃ³ a separar las fracciones de interÃ©s, en este caso la fracciÃ³n de los minerales de arcilla, a travÃ©s del mÃ©todo del pipeteo y los minerales pesados por el mÃ©todo hidrodinÃ¡mico.Los materiales obtenidos tanto de la roca como de los suelos se sometieron a anÃ¡lisis de difracciÃ³n de rayos X para determinar las fases minerales constituyentes y microscopia electrÃ³nica de barrido para determinar la morfologÃ­a y composiciÃ³n quÃ­mica de los granos minerales.Los resultados obtenidos indican que los minerales pesados presentes en el residuo insoluble de la roca son los siguientes: fosrterita, rutilo, actinolita y greenalita. Para el caso de los suelos los minerales pesados presentes son la goethita, pirolusita, pirita, cuarzo, barita, clorita y groutita. En cuanto a la fracciÃ³n tamaÃ±o arcilla los suelos presentan halita y yeso y el residuo insoluble de la roca wollastonita, montmorillonita, tephorita y manganolagbeirita.Los resultados arrojados por la microscopia electrÃ³nica de barrido indican que morfolÃ³gicamente los granos presentes en la roca presentan caras definidas, mientras que los que estÃ¡n presentes en los suelos presentan gran variabilidad son angulares, pasando por granos poco redondeados hasta observar granos esfÃ©ricos, pero en general corresponden a masas amorfas porosas. De igual forma con esta tÃ©cnica se realizÃ³ el anÃ¡lisis en una muestra de mÃ¡rmol dolomÃ­tico constituida por la roca fresca, semialterada, alterada y costra con el fin de ver la distribuciÃ³n y comportamiento de los elementos durante el proceso de meteorizaciÃ³n, los resultados obtenidos seÃ±alan que con la evoluciÃ³n del suelo, es decir, desde la roca fresca hasta la costra el Mges lixiviado de la estructura de la dolomita, mientras que el Fe y Mn presentan un comportamiento similar, sutituyendo al Ca en la estructura de la calcita y dolomita. TambiÃ©n es favorecida la formaciÃ³n de Ã³xidos ricos en Fe y Mn.','2009-09-07','MÃ¡rmol dolomÃ­tico, carbonatos, suelos, arcillas, minerales pesados.',4,1,1,1,1,'2013-09-17 08:26:48','2013-09-17 08:26:48','Documento_191.pdf','application/pdf',18586409,'2013-09-17 08:26:48',18,0,143,'COMPLETO'),(192,'wradvs: Un Servidor de AutoconfiguraciÃ³n sin Estado para IPv6 en Plataforma Windows','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicaciÃ³n denominada \"wradvs\" que lleva a cabo el proceso de autoconfiguraciÃ³n sin estado de IPv6 a travÃ©s de un servicio de Windows. El documento comienza con un estudio teÃ³rico de todos los conceptos necesarios para la comprensiÃ³n del proceso de autoconfiguraciÃ³n sin estado incluyendo los RFC 2460, 4861, 5006, 4191, 3775 y 3963. La implementaciÃ³n se lleva a cabo utilizando una metodologÃ­a Ã¡gil de desarrollo denominada Scrum que propone ciclos cortos para la planificaciÃ³n y posterior codificaciÃ³n de los diferentes mÃ³dulos de la aplicaciÃ³n. La aplicaciÃ³n consta de cuatro mÃ³dulos: el mÃ³dulo de configuraciÃ³n del servidor permite almacenar todos los parÃ¡metros y opciones de los mensajes Router Advertisement en un archivo XML. El mÃ³dulo principal es el servidor wradvs que lee este archivo para enviar mensajes Router Advertisement periÃ³dicos y en respuesta a mensajes Router Solicitation mientras llena un log de eventos con mensajes de informaciÃ³n y error. Para la lectura del log se ofrece un visor de eventos que muestra la informaciÃ³n en tiempo real. Por Ãºltimo se proporciona una herramienta para la administraciÃ³n de direcciones IPv6, rutas por defecto, tabla de enrutamiento y reenvÃ­o de paquetes. Cada mÃ³dulo posee una amigable e intuitiva interfaz grÃ¡fica para sus usuarios. El producto final junto a la documentaciÃ³n de la investigaciÃ³n estÃ¡ publicada como una aplicaciÃ³n con licencia GNU GPL a travÃ©s de SourceForge.net (un sitio Web que permite el hospedaje y distribuciÃ³n de software libre y sistemas de cÃ³digo abierto) en el siguiente enlace: http:// wradvs.sourceforge.net.','2009-06-03','Normal 0 false false false EN-US X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:26:50','2013-09-17 08:26:50','Documento_192.pdf','application/pdf',0,'2013-09-17 08:26:50',20,0,0,'INCOMPLETO'),(193,'REDUCCIOÌN DE ESPECIES METAÌLICAS DE V, Ni, Co y Mo CON HIDROÌGENO ATOÌMICO (Hï‚·) ELECTROQUIÌMICAMENTE ADSORBIDO SOBRE SUPERFICIES DE Pd Y NEGRO DE Pd','Se estudioÌ la reactividad del hidroÌgeno atoÌmico (Hï‚·) electroquiÌmicamente adsorbido sobre superficies de paladio y negro de Pd en la de reduccioÌn de especies metaÌlicas de niÌquel, cobalto, molibdeno y vanadio. El Hï‚· generado electroquiÌmicamente permea a traveÌs de la membrana de paladio y reacciona con el precursor metaÌlico. Fue demostrado la alta capacidad cataliÌtica del negro de Pd respecto al Pd. El negro de Pd fue preparado por reduccioÌn quiÌmica con Hï‚· de una solucioÌn PdCl2 0,02 M en HCl 0,1 M. En las reacciones de reduccioÌn viÌa permeacioÌn de hidroÌgeno, se realizoÌ una serie de experimentos con el fin de establecer las condiciones experimentales que permitan optimizar el proceso de reduccioÌn asistida electroquiÌmicamente con Hï‚·. En estos ensayos fue observado que las reacciones de reduccioÌn con Hï‚· se ven fuertemente influenciadas por la densidad de corriente aplicada, la temperatura, el tiempo de descarga de Hï‚· y el flujo de reactivos, ya que estos paraÌmetros podriÌan estar determinando la cantidad de hidroÌgeno atoÌmico disponible para la reaccioÌn. La potencialidad del Hï‚· ha sido evidenciada tanto en la reduccioÌn de especies metaÌlicas sencillas, asiÌ como tambieÌn en la reduccioÌn de sistemas maÌs complejos como lo son las metaloporfirinas, en este caso la meso-tetrafenilporfirina de vanadilo (VOTPP) y meso- tetrafenilporfirina de niÌquel (NiTPP). Puesto que se ha comprobado la reactividad de Hï‚· para la reduccioÌn de metales, su aplicacioÌn se enfoca al desarrollo de nuevas tecnologiÌas destinadas a la extraccioÌn de metales contenidos en fracciones de crudos, permitiendo el mejoramiento de los mismos de manera eficiente, sencilla, rentable y amigable al ambiente (comparado con los esquemas convencionales de refinacioÌn). Adicionalmente, la modificacioÌn de membranas de permeacioÌn con depoÌsitos metaÌlicos que presentan actividad cataliÌtica es de intereÌs en reacciones fundamentadas en el uso de hidroÌgeno atoÌmico.','2009-10-08','HidrÃ³geno atÃ³mico, negro de Pd, reducciÃ³n con hidrÃ³geno atÃ³mico',6,1,1,1,1,'2013-09-17 08:26:51','2013-09-17 08:26:51','Documento_193.pdf','application/pdf',0,'2013-09-17 08:26:51',20,0,0,'INCOMPLETO'),(194,'RediseÃ±o de la aplicaciÃ³n Web para la divulgaciÃ³n de la oferta acadÃ©mica y servicios generales en linea del Programa de CooperaciÃ³n Interfacultades (PCI) U.C.V., siguiendo el workflow propuesto por Emily Cotler y Kelly Goto.','En este trabajo, se reflejan los aspectos metodolÃ³gicos y prÃ¡cticos inherentes al proceso de rediseÃ±o que se realizÃ³ en la aplicaciÃ³n Web del Programa de CooperaciÃ³n Interfacultades (PCI), instituciÃ³n perteneciente a la U.C.V. Se describen los criterios y lineamientos propuestos por Emily Cotler y Kelly Goto para la planificaciÃ³n y gestiÃ³n del rediseÃ±o Web, conjuntamente con la metodologÃ­a de desarrollo utilizada. El PCI se encarga fundamentalmente de interrelacionar acadÃ©micamente a las diversas Facultades de esta instituciÃ³n universitaria, recolectando y gestionando informaciÃ³n concerniente a aquellas asignaturas de otras carreras que un estudiante regular de la Universidad pudiese cursar; constituyÃ©ndose Ã©sto en un aliciente de sumo beneficio para el enriquecimiento acadÃ©mico y personal de los estudiantes que decidan incorporarse a dicho programa.','2009-10-27','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:26:52','2013-09-17 08:26:52','Documento_194.pdf','application/pdf',0,'2013-09-17 08:26:52',20,0,0,'INCOMPLETO'),(195,'\"\"SÃ­Ã­ntesis y caracterizaciÃ³Ã³nn de nanopartÃ­Ã­culas bimetÃ¡Ã¡licas de Rh--Pt por vÃ­Ã­a electroquÃ­Ã­mica\"\"','En el siguiente trabajo se presenta un estudio sobre la sÃ­ntesis de nanopartÃ­culas de Pt, Rh y Rh-Pt por vÃ­a electroquÃ­mica, y la caracterizaciÃ³n de las mismas por MicroscopÃ­a ElectrÃ³nica de TransmisiÃ³n (MET) y voltamperometrÃ­a cÃ­clica. Las nanopartÃ­culas fueron sintetizadas a partir del Ã¡cido hexacloroplatÃ­nico (H2PtCl6) y del cloruro de rodio(III) (RhCl3) en medio acuoso y en acetonitrilo, en presencia de bromuro de tetrapropilamonio y bromuro de tetrabutilamonio respectivamente. Las sales de tetraalquilamonio fueron utilizadas como electrolito soporte y agente estabilizante de las nanopartÃ­culas formadas. Durante el estudio se aplicaron diferentes valores de densidad de corriente y de potencial para estudiar la influencia de ambos parÃ¡metros en el tamaÃ±o y composiciÃ³n de las nanopartÃ­culas formadas. AdemÃ¡s se variÃ³ la concentraciÃ³n molar del estabilizante y la relaciÃ³n estequiomÃ©trica de los precursores metÃ¡licos en una serie de nanopartÃ­culas de Rh-Pt sintetizadas a corriente constante.El tamaÃ±o promedio de las nanopartÃ­culas fue determinado por MET y la composiciÃ³n elemental fue determinada por EspectroscopÃ­a de Rayos X Dispersivos (EDX). Estos estudios revelaron que el tamaÃ±o promedio de las nanopartÃ­culas sintetizadas a potencial controlado disminuyÃ³ a medida que se aumentÃ³ la diferencia de potencial aplicada al sistema. La misma tendencia fue observada al aumentar la densidad de corriente aplicada. Los anÃ¡lisis de por EDX sugirieron que el porcentaje de Pt en la muestra aumentÃ³ a medida que aumentÃ³ la diferencia de potencial y la densidad de corriente aplicada al sistema. La tÃ©cnica de voltamperometrÃ­a cÃ­clica fue utilizada para caracterizar las nanopartÃ­culas de Rh-Pt sintetizadas a potencial controlado y a corriente constante. AdemÃ¡s se utilizÃ³ la tÃ©cnica electroquÃ­mica para estudiar la actividad electrocatalÃ­tica de las nanopartÃ­culas de Rh-Pt sintetizadas a potencial controlado y a -5,0mA con diferentes concentraciones de estabilizante. Las nanopartÃ­culas sintetizadas a -0,6V y -5,0mA con concentraciÃ³n de estabilizante 0,1M presentaron mejoras en la actividad electrocatalÃ­tica para la oxidaciÃ³n de metanol con respecto a las nanopartÃ­culas de Pt. En comparaciÃ³n con un electrodo de Pt mÃ¡sico, las nanopartÃ­culas sintetizadas a -0,6V presentaron mayor intensidad de corriente en el proceso de electrooxidaciÃ³n de metanol.','2009-10-27','VoltamperometrÃ­a cÃ­clica, nanopartÃ­culas de Rh, Pt, Rh-Pt.',6,1,1,1,1,'2013-09-17 08:26:53','2013-09-17 08:26:53','Documento_195.pdf','application/pdf',3183462,'2013-09-17 08:26:53',20,0,102,'COMPLETO'),(196,'Estudio geoquÃ­mico y mineralÃ³gico de los sedimentos de la Laguna Paso Real, SerranÃ­a de Santo Domingo, Estado MÃ©rida','Los sedimentos lacustres son utilizados como registros de las condiciones paleoambientalesdebido a su alto grado de continuidad depositacional y alta tasa de acumulaciÃ³n de sedimentos.La quimioestratigrafÃ­a constituye una herramienta Ãºtil para interpretar los procesos dedepositaciÃ³n a pequeÃ±a escala. La Laguna Paso Real se encuentra a una altura de 3000 m ubicadaen la serranÃ­a de Santo Domingo en Los Andes venezolanos, represada por material morrÃ©nicoerosionado. Se extrajo un nÃºcleo de 280 cm de profundidad utilizando un mecanismo de pistÃ³n,se describiÃ³ la estratigrafÃ­a de la columna y se realizÃ³ un muestreo, condicionado por laestratificaciÃ³n, de la secciÃ³n mÃ¡s profunda del mismo. Se obtuvieron 60 muestras cubriendo unasecciÃ³n de 70 cm, para cada una de estas muestras se realizaron anÃ¡lisis granulomÃ©tricos,mineralÃ³gicos y geoquÃ­micos. A partir del tamizado de sedimentos se determinÃ³ un aumento detamaÃ±o de grano hacia el tope de la secuencia, con una secciÃ³n de 280 a 230 cm de profundidadde intercalaciÃ³n de capas de arena fina lodosa y lodo arenoso y otra de 230 a 210 cm deprofundidad de arena media y grava. El anÃ¡lisis mineralÃ³gico se realizÃ³ mediante difracciÃ³n deRayos-X separando las distintas fracciones de sedimento y concentrando las arcillas. Losminerales principales son cuarzo, plagioclasa, feldespato potÃ¡sico y muscovita, presentando comominerales de arcilla predominantes la illita y clorita. La composiciÃ³n mineralÃ³gica no varÃ­asignificativamente entre las distintas fracciones, mientras que las muestras ubicadas entre los 270y 227 cm de profundidad presentan una cantidad apreciable del mineral illita-vermiculita. LacomposiciÃ³n mineralÃ³gica de los sedimentos es caracterÃ­stica de un grado de meteorizaciÃ³nintermedio. Para el anÃ¡lisis quÃ­mico se realizÃ³ la determinaciÃ³n de los elementos mayoritarios yminoritarios Si, Al, K, Na, Ca, Mg, Fe, Ti, Mn, P y Cr mediante ICP-EOS. Se estableciÃ³ unaproveniencia fÃ©lsica Ã­gnea/ sedimentaria en los sedimentos, lo cual concuerda con la composiciÃ³nde las rocas presentes en la zona de estudio. Las herramientas geoquÃ­micas tambiÃ©n indicaron ungrado de meteorizaciÃ³n moderado en los sedimentos y condiciones Ã³xicas constantes en lacolumna. Mediante los perfiles quimioestratigrÃ¡ficos y las herramientas estadÃ­sticas se definieronlos elementos que presentaban un comportamiento similar y las asociaciones geoquÃ­micas: Al,Mg, Si, K, Na, Ca: SiliciclÃ¡sticos; Fe, Ti, Mn: Ã“xidos (ilmenita); Ca, P: Fosfatos. Para lasdistintas asociaciones se establecieron lÃ­mites de quimiofacies. Las caracterÃ­sticas de la columnapermitieron definir un sistema depositacional deltaico.','2009-09-09','Sedimentos lacustres, quimioestratigrafÃ­a, Andes venezolanos',4,1,1,1,1,'2013-09-17 08:26:56','2013-09-17 08:26:56','Documento_196.pdf','application/pdf',3183462,'2013-09-17 08:26:56',20,0,102,'COMPLETO'),(197,'HIDRODESCLORINACIÃ“N CATALÃTICA DE BIFENILOS POLICLORADOS EMPLEANDO CARBUROS DE VANADIO','Se realizÃ³ la sÃ­ntesis de una serie de catalizadores no soportados de carburos de nÃ­quel-vanadio, preparados mediante el mÃ©todo de reducciÃ³n a temperatura programada (TPR) de VCl3 y Ni(NO3)2.6H2O, utilizando una mezcla carburante 20% de gas natural en hidrÃ³geno. Las relaciones atÃ³micas de Ni/Ni+V empleadas para la preparaciÃ³n de los carburos de vanadio fueron 0; 0.15; 0.21; 0.35; 0.62 y 1. La sÃ­ntesis de los catalizadores se llevÃ³ a cabo en un reactor de flujo continuo a una temperatura 750 Â°C y una velocidad de calentamiento de 18Â°C/min. Los sÃ³lidos fueron caracterizados por: difracciÃ³n de rayos X (DRX), Ã¡rea especÃ­fica (BET), volumen de poro y MicroscopÃ­a Auger de Barrido (SAM). El anÃ¡lisis por difracciÃ³n de rayos X mostrÃ³ la presencia de carburos de vanadio, especÃ­ficamente la fase V8C7, asÃ­ como Ã³xido de vanadio (V2O3) y nÃ­quel metÃ¡lico (Ni). Por su parte, el anÃ¡lisis por BET indicÃ³ que se lograron obtener catalizadores con altas Ã¡reas superficiales (96 m2.g-1). Los catalizadores fueron evaluados en la reacciÃ³n catalÃ­tica de hidrodesclorinaciÃ³n (HDCl) de Bifenilos Policlorados (BPC). Esta se llevÃ³ a cabo en un reactor de flujo continuo a 350 Â°C y una presiÃ³n de hidrÃ³geno de 540 psi. La concentraciÃ³n que se utilizÃ³ de BPC fue de 560 ppm. El proceso de pre-sulfuraciÃ³n se realizÃ³ iin situ a presiÃ³n atmosfÃ©rica de hidrÃ³geno y una temperatura de 350Â°C. Los catalizadores que se mostraron activos para la reacciÃ³n de hidrodesclorinaciÃ³n de bifenilos policlorados, fueron los que poseÃ­an una relaciÃ³n Ni/Ni+V de 0.15 y 0.21, con valores de conversiÃ³n relativamente altos con 49 y 69 %,respectivamente. Se obtuvo como productos de reacciÃ³n, benceno y ciclohexano. De los resultados logrados, se puede indicar que el comportamiento presentado sigue el modelo del Control Remoto, mostrando la existencia de sinergÃ­a entre las fases de nÃ­quel y vanadio en la reacciÃ³n de hidrodesclorinaciÃ³n de Aroclor 1260.','2009-10-15','Carburos de vanadio, Bifenilos Policlorados, HidrodesclorinaciÃ³n',6,1,1,1,1,'2013-09-17 08:26:59','2013-09-17 08:26:59','Documento_197.pdf','application/pdf',0,'2013-09-17 08:26:59',20,0,0,'INCOMPLETO'),(198,'CaracterizaciÃ³n geoquÃ­mica y petrogrÃ¡fica de rocas fosfÃ¡ticas CretÃ¡cicas, de la FormaciÃ³n la Luna, Estado TÃ¡chira, Venezuela','El estudio abarcÃ³ un total de 13 muestras, pertenecientes al Miembro Ftanita de TÃ¡chira, de la FormaciÃ³n La Luna, Estado TÃ¡chira. La metodologÃ­a experimental involucrÃ³ un anÃ¡lisis quÃ­mico (SiO2, P2O5, CaO, Al2O3,Na2O, Fe2O3,MgO, K2O,TiO2 ,MnO, Sr, Ba, V, Cr, Ni, Sc, Co, U, Y, Zr, Th, Nb y Rb, Ta, Cs, La, Ce, Pr, Nd, Sm, Eu, Tb, Gd, Dy, Ho, Er, Tm, Yb y Lu), petrogrÃ¡fico y mineralÃ³gico (DRX). Se tuvo como objetivo establecer las caracterÃ­sticas quÃ­micas y petrogrÃ¡ficas que definen a estas rocas, en bÃºsqueda de proponer un posible origen. La petrografÃ­a revela que las rocas estÃ¡n constituidas por un componente fosfÃ¡tico (colofano y restos fÃ³siles fosfatizados), componente carbonÃ¡tico (esparita, restos fÃ³siles y lodo carbonÃ¡tico) y componente siliciclÃ¡stico (cuarzo). El anÃ¡lisis mineralÃ³gico establece que el cuarzo, calcita y fluorapatito son los minerales dominantes (dolomita, pirita y minerales de arcillas, tambiÃ©n son identificados). Los resultados quÃ­micos sugieren la intervenciÃ³n de algunos procesos geoquÃ­micos (fosfogenesis, procesos redox, productividad primaria e incorporaciÃ³n de sedimentos terrÃ­genos). Las anomalÃ­as negativas de Ce sugieren una seÃ±al primaria, la cual, refleja la quÃ­mica de aguas de ambientes de ocÃ©anos abiertos. La preservaciÃ³n de materia orgÃ¡nica sugiere que la sedimentaciÃ³n pudo ocurrir bajo condiciones sub-Ã³xicas. Los resultados petrogrÃ¡ficos sugieren una diagÃ©nesis temprana hacia moderada, donde la mayorÃ­a de los elementos trazas fueron incorporados por los fosfatos. El comportamiento geoquÃ­mico de los elementos de las REE, revela que principalmente fueron incorporados directamente del agua de mar, aunque procesos de adsorciÃ³n tambiÃ©n estuvieron presentes. En contraste, otros elementos trazas fueron incorporados por adsorciÃ³n y/o por sustituciones isomÃ³rficas dentro de la estructura de los fosfatos. Por otro lado, la fracciÃ³n detrÃ­tica fue incorporada por una fuente Ãºnica y pobremente diferenciada, que afectÃ³ la sedimentacÃ­Ã³n de ambas secciones.','2009-10-09','fosfogÃƒÂ©nesis, geoquÃƒÂ­mica, fosfatos, fosforita, TÃƒÂ¡chira, FormaciÃƒÂ³n La Luna',4,1,1,1,1,'2013-09-17 08:27:00','2013-09-17 08:27:00','Documento_198.pdf','application/pdf',2214718,'2013-09-17 08:27:00',19,0,74,'COMPLETO'),(199,'Desarrollo de la AplicaciÃ³n de GestiÃ³n AcadÃ©mica CONEST 2.0: MÃ³dulo Administrativo','El objetivo de este Trabajo Especial de Grado consiste en generar la nueva versiÃ³n del sistema CONEST, basÃ¡ndose en la experiencia del desarrollo de la versiÃ³n anterior, realizando migraciones de tecnologÃ­a y datos, ademÃ¡s de realizar mejoras correspondientes a las entidades, procesos, gestiones administrativas, interfaces, entre otras actividades necesarias para la evoluciÃ³n del Software. Asimismo brindarÃ¡ un mejor soporte al personal involucrado, aumentando su satisfacciÃ³n al usar nuevas tecnologÃ­as relacionadas con la web 2.0, que ofrecen beneficios tales como, accesibilidad para el usuario, usabilidad del sistema y personalizaciÃ³n de la aplicaciÃ³n. En esta investigaciÃ³n se realiza un estudio de los modelos de datos, comparando el existente y el propuesto. El mÃ©todo de desarrollo de software utilizado es ProgramaciÃ³n Extrema (XP). Como producto final se obtienen las funcionalidades del MÃ³dulo de AdministraciÃ³n del Sistema CONEST 2.0, relacionadas a la gestiÃ³n administrativa de los estudiantes y docentes de la Facultad de Ciencias.','2009-10-26','CONEST, CONEST 2.0, Modelo Vista Controlador (MVC), Ruby on Rails, Rails 2.3, MigraciÃ³n de datos, MigraciÃ³n de tecnologÃ­as, DivisiÃ³n de Control de Estudios, Web 2.0, ProgramaciÃ³n Extrema (XP).',2,1,1,1,1,'2013-09-17 08:27:01','2013-09-17 08:27:01','Documento_199.pdf','application/pdf',4474200,'2013-09-17 08:27:01',20,0,169,'COMPLETO'),(200,'Desarrollo de una aplicaciÃ³Ã³nn colaborativa vÃ­Ã­a web para reuniones electrÃ³Ã³nnicas asÃ­Ã­cronas','Actualmente es de gran interÃ©s el proveer herramientas usables que faciliten la comunicaciÃ³n entre los miembros de una organizaciÃ³n, han surgido soluciones que superan las barreras de tiempo y espacio para facilitar la comunicaciÃ³n, como lo son el chat y los foros. Sin embargo, en busca de mejorar la comunicaciÃ³n se requiere evolucionar estas soluciones combinÃ¡ndolas con protocolos especÃ­ficos que representan dinÃ¡micas de comunicaciÃ³n que surgen en ciertos niveles organizacionales. El objetivo de este Trabajo Especial de Grado consiste en el desarrollo de una AplicaciÃ³n Colaborativa vÃ­a Web para coordinar, organizar y ejecutar reuniones electrÃ³nicas asÃ­ncronas orientadas bajo un protocolo de colaboraciÃ³n de Agendas y Actas. El anÃ¡lisis se centrÃ³ en caracterizar los diferentes aspectos al momento de organizar y llevar a cabo una reuniÃ³n entre un grupo de trabajo. Algunos de estos aspectos son: discrepancia entre los miembros del grupo para llegar a un acuerdo que permita definir cuando se ejecutarÃ¡ la reuniÃ³n y la necesidad de contar con un protocolo de colaboraciÃ³n que ayude al coordinador de la reuniÃ³n y a los participantes en el proceso de interacciÃ³n, que facilite alcanzar los objetivos propuestos. La aplicaciÃ³n se elaborÃ³ siguiendo el mÃ©todo de desarrollo basado en el Modelado Ãgil (MA), especificando como artefactos principales: el modelado de casos de uso y diagramas de flujo de trabajo. Patrones de interacciÃ³n propuestos por Welie para la descripciÃ³n de la interfaz y como tecnologÃ­a a utilizar Ruby on Rails con la base de datos MySQL.','2009-10-21','AplicaciÃ³n Colaborativa, Reuniones ElectrÃ³nicas, Protocolo de ComunicaciÃ³n, Agendas y Actas, Modelado Ãgil, Patrones de InteracciÃ³n, Ruby on Rails, Modelo Vista Controlador (MVC)',2,1,1,1,1,'2013-09-17 08:27:03','2013-09-17 08:27:03','Documento_200.pdf','application/pdf',4474200,'2013-09-17 08:27:03',20,0,169,'COMPLETO'),(201,'\"\"Estudio de la capacidad de adsorciÃ³Ã³nn de los elementos U,, Sb,, Co y Ni sobre las turbas del Golfete de Cuare,, estado FalcÃ³Ã³nn\"\"..','El presente estudio tiene como objetivo fundamental la determinaciÃ³n de la capacidad de adsorciÃ³n de los elementos U, Sb, Co y Ni por las turbas de manglar del Golfete de Cuare, Estado FalcÃ³n. Para ello, se realizaron ensayos de adsorciÃ³n en sistemas simples, por contacto y agitaciÃ³n con soluciones de diferente concentraciÃ³n de cada una de las especies quÃ­micas en un perÃ­odo de 24h, a una temperatura de 25 ÂºC y bajo condiciones de pH cercanas a la neutralidad. De igual manera, una vez culminadas las adsorciones de las especies quÃ­micas en estudio, la turba fue sometida a ensayos de desorciÃ³n en sistemas simples agitando en esta ocasiÃ³n las turbas impregnadas de cationes con agua destilada y manteniendo las mismas condiciones de tiempo, temperatura y pH aplicadas en los ensayos de adsorciÃ³n. Los datos experimentales de adsorciÃ³n obtenidos para cada uno de los iones se ajustaron exitosamente al modelo de isoterma de Langmuir y de Freundlich, teniendo una mejor correlaciÃ³n con el primero. El orden de adsorciÃ³n para los cationes ensayados fue UO22+>>Ni2+>Co2+>Sb3+, el cual estÃ¡ determinado por el grado de afinidad de cada uno de los cationes por la materia orgÃ¡nica, por las propiedades quÃ­micas propias de cada elemento y por la compatibilidad con los sitios activos encontrados en la turba. Los mecanismos de adsorciÃ³n predominantes en la mayorÃ­a de los casos fueron la quelataciÃ³n y el intercambio iÃ³nico, proponiendo los grupos funcionales carboxÃ­licos como los sitios activos preferidos para la adsorciÃ³n de las especies quÃ­micas en estudio. En los ensayos de desorciÃ³n el orden obtenido muestra un comportamiento inverso al de adsorciÃ³n, Sb3+>Co2+>Ni2+>UO22+. Dicho orden se encuentra relacionado con el grado de afinidad de cada catiÃ³n por la materia orgÃ¡nica y con la estabilidad de los complejos formados con ella. Se propone que la interacciÃ³n de los cationes con la turba estÃ¡ dominada por procesos de quimisorciÃ³n mÃ¡s que por adsorciÃ³n fÃ­sica; por tanto, los enlaces formados son bastante fuertes como para sugerir que el proceso de adsorciÃ³n es prÃ¡cticamente irreversible, bajo las condiciones de pH trabajadas. De acuerdo a los resultados obtenidos, se confirma el importante rol que cumplen las turbas en los ecosistemas naturales como barreras para la retenciÃ³n de especies metÃ¡licas.','2009-09-07','Turba, adsorciÃƒÂ³n, desorciÃƒÂ³n, isotermas de adsorciÃƒÂ³n, quelataciÃƒÂ³n, intercambio iÃƒÂ³nico',4,1,1,1,1,'2013-09-17 08:27:05','2013-09-17 08:27:05','Documento_201.pdf','application/pdf',0,'2013-09-17 08:27:05',20,0,0,'INCOMPLETO'),(202,'Cultivo de cÃ©lulas madre mesenquimales del cordÃ³n umbilical humano.Potencialidad Ã³steo-condrogÃ©nica \"in vitro\"','Las cÃ©Ã©lulas madre mesenquimales son cÃ©lulas con capacidad de autorenovarse indefinidamente y generar uno o mas tipos de cÃ©lulas diferenciadas. Debido a estas propiedades son activamente estudiadas para su uso en los diferentes campos de la medicina regenerativa asÃ­ como en la creaciÃ³n de modelos de estudio in vitro. Actualmente, una fuente de estas cÃ©lulas madre, es la Gelatina de Wharton del cordÃ³n umbilical humano; el cual une al feto con su madre. Estas cÃ©lulas madre son embrionarias, ya que provienen de un Ã³rgano presente solo hasta el nacimiento, y pluripotenciales, ya que diversos trabajos reportan su capacidad de diferenciaciÃ³n en cÃ©lulas de los tres linajes embrionarios. Estas diferenciaciones son posibles gracias al uso de distintos factores solubles adicionados a los medios de cultivo, y a los propios sistemas de cultivo empleados como los cultivos en monocapa y en sistemas tridimensionales, libres o no de matriz, los cuales buscan imitar las condiciones in vivo.Los trabajos realizados con este tipo de cÃ©lulas madre embrionarias de la Gelatina de Wharton del cordÃ³n umbilical humano son escasos y mucho mÃ¡s en nuestro paÃ­s, por lo que se ha propuesto establecer cultivos de estas cÃ©lulas y estudiar su proliferaciÃ³n y capacidad de diferenciaciÃ³n Ã³steo - condrogÃ©nica in vitro. Los cultivos primarios de la Gelatina de Wharton presente tanto en la zona perivascular como intervascular, muestran una poblaciÃ³n heterogÃ©nea formada por: cÃ©lulas tipo fibroblasto, cÃ©lulas con citoplasma extenso, cÃ©lulas endoteliales y cÃ©lulas gigantes multinucleadas (estas dos Ãºltimas sÃ³lo por disgregaciÃ³n enzimÃ¡tica). Estas poblaciones fueron casi totalmente homogÃ©neas a lo largo de los subcultivos, observÃ¡ndose solo la persistencia de cÃ©lulas tipo fibroblasto y algunas cÃ©lulas con citoplasma extenso. La proliferaciÃ³n de cada cultivo fue diferencial, pero un ensayo para determinar este parÃ¡metro determinÃ³ el comienzo de la fase de crecimiento exponencial a los 4 dÃ­as, sin llegarse a observar la fase Plateau. Con trozos de CordÃ³n Umbilical almacenados bajo condiciones especÃ­ficas se pudo determinar la viabilidad, obteniendo un aumento en el tiempo de proliferaciÃ³n a medida que se aumentaba el tiempo de almacenaje, observÃ¡ndose el mÃ¡ximo a los 4 dÃ­as de almacenaje. Por medio de coloraciones de rutina realizadas en diversos cultivos de ambas fuentes, se pudo evidenciar la presencia de cÃ©lulas tipo fibroblasto, con una morfologÃ­a ahusada, nÃºcleo ovalado y central fuertemente basÃ³filo, y citoplasma moderadamente basÃ³filo. AdemÃ¡s se han observado cÃ©lulas vacuoladas con citoplasma extenso, nÃºcleo central, circular y basÃ³filo; y cÃ©lulas con citoplasma extenso moderadamente basÃ³filo, proteÃ­nas del citoesqueleto visible, nÃºcleo excÃ©ntrico y ovalado. Gracias a determinaciones inmunocitoquÃ­micas se determino la co-expresiÃ³n de Vimentina y Citoqueratinas en los dos tipos celulares presentes en los subcultivos, disminuyendo su nivel de expresiÃ³n a lo largo de los mismos. Tanto los cultivos en monocapa como los sistemas en micromasas, sometidos a inducciÃ³n asÃ­ como los controles, mostraron una diferenciaciÃ³n hacia el linaje Ã³steo-condrogÃ©nico, determinado esto por coloraciones con Rojo Alizarina S, Azul de Toluidina y Safranina O. La intensidad de tinciÃ³n en cultivos en monocapa mostrÃ³ un aumento a medida que se inducÃ­a por mÃ¡s tiempo, sin embargo en las micromasas se mantuvo constante. AdemÃ¡s de esto, a nivel general, se observÃ³ que la intensidad de tinciÃ³n de los cultivos provenientes de arterias siempre fue mayor que los cultivos provenientes de la Gelatina de Wharton, por lo que se sugiere que las primeras son mÃ¡s fÃ¡cilmente inducibles a diferenciaciÃ³n.','2009-10-20','CordÃ³n umbilical, CÃ©lulas madre mesenquimales, Gelatina de Wharton.',1,1,1,1,1,'2013-09-17 08:27:06','2013-09-17 08:27:06','Documento_202.pdf','application/pdf',0,'2013-09-17 08:27:06',20,0,0,'INCOMPLETO'),(203,'VARIACIONES ESPACIALES Y TEMPORALES DE LA COMUNIDAD ZOOPLANCTÃ“Ã“NNICA EN DOS LOCALIDADES DEL EMBALSE SUATA ((ESTADO ARAGUA,, VENEZUELA))','Hasta el momento no existen trabajos publicados sobre aspectos relacionados con la ecologÃ­a de la comunidad del zooplancton del embalse Suata (Edo. Aragua). Por ello, se planteÃ³ el objetivo de cuantificar su abundancia y biomasa y relacionarlas con las variables fisicoquÃ­micas y con la concentraciÃ³n de clorofila-adel cuerpo de agua.. Para la realizaciÃ³n del estudio se tomaron muestras en dos localidades del embalse con una frecuencia mensual, de mayo a octubre de 2008. La estaciÃ³n 1 (E1) ubicada cerca del dique en las cercanÃ­as de la zona donde desemboca el principal afluente del embalse y donde simultÃ¡neamente se genera la principal salida de agua, y la estaciÃ³n 2 (E2) ubicada en el lado opuesto al dique. Entre las variables fisicoquÃ­micas se estimaron la transparencia del agua, temperatura, oxÃ­geno disuelto, pH, conductividad, concentraciones de nitrÃ³geno total y fÃ³sforo total, mientras que la biomasa del fitoplancton se estimÃ³ mediante la extracciÃ³n de la clorofila-a con etanol. Los organismos del zooplancton fueron colectados en el estrato oxigenado del cuerpo de agua con una red de plancton (luz de malla 77 mm) y preservados en formol (4% concentraciÃ³n final). La abundancia se estimÃ³ mediante conteos duplicados en cÃ¡maras Sedgwick-Rafter (1ml). La biomasa se estimÃ³ mediante la determinaciÃ³n del peso seco de los especÃ­menes contenidos en una alÃ­cuota de 0,1 ml de muestra por secado a 60Â°C por 20 horas. El embalse Suata, se clasificÃ³ como polimÃ­ctico debido a que permanece mezclado la mayor parte del aÃ±o. Se registraron diferencias significativas en cuanto a la concentraciÃ³n de oxÃ­geno disuelto entre ambas estaciones. El carÃ¡cter de las aguas fue alcalino y se registraron altas concentraciones de Nt y Pt que permitieron clasificar el embalse como hipereutrÃ³fico. Estas Ãºltimas y la concentraciÃ³n de clorofila-a no presentaron diferencias significativas entre ambas estaciones. Se identificaron 24 taxones de zooplancton, de los cuales los rotÃ­feros presentaron 12 especies, los cladÃ³ceros 6 especies y los copÃ©podos 3 especies. El grupo de los ostrÃ¡codos dominÃ³ la comunidad del zooplancton durante la mayor parte del perÃ­odo de estudio. La abundancia del zooplancton variÃ³ entre 114 org/l (julio) a 1566 org/l (septiembre) en E1, y entre 444 org/l (julio) a 5118 org/l (octubre) en E2. Estos valores son propios de sistemas hipereutrÃ³ficos como lo es el embalse Suata. Los ostrÃ¡codos representaron en promedio el 59,2% de la abundancia relativa, seguidos por los rotÃ­feros con un promedio de 27,1% y por los cladÃ³ceros con un 8%. El grupo de los copÃ©podos representÃ³ el 13% de los individuos en E1 y el 5,4% en E2. Otros grupos (protozoarios, nematodos), presentaron promedios menores al 0,4%. La mayor abundancia del zooplancton se registrÃ³ en los estratos superficiales de ambas estaciones. Por su parte, la biomasa del zooplancton presentÃ³ un promedio de1889 Â± 2331 mg/l con un mÃ­nimo de 72 mg/l (julio) y un mÃ¡ximo de 6551 mg/l (septiembre) para E1, mientras que en E2 el promedio fue de 2364 Â± 4000 mg/l con un mÃ­nimo de 329 mg/l (mayo) y un mÃ¡ximo de 10490 mg/l (octubre). La mayor parte de la biomasa total fue aportada por los ostrÃ¡codos. Los cambios temporales en las condiciones ambientales parecieron ser los responsables de las fluctuaciones en la abundancia y en la biomasa del zooplancton en el embalse Suata.','2009-10-15','Zooplancton; Abundancia; Biomasa; Embalse Tropical; Suata; Venezuela',1,1,1,1,1,'2013-09-17 08:27:08','2013-09-17 08:27:08','Documento_203.pdf','application/pdf',36253801,'2013-09-17 08:27:08',19,0,227,'COMPLETO'),(204,'CARACTERIZACIÃ“N GEOQUÃMICA DE LOS SEDIMENTOS DE FONDO DE LA ZONA ESTE DEL GOLFETE DE CUARE Y SU ZONA PRÃ“XIMA COSTERA, ESTADO FALCÃ“N','En el presente estudio fue determinada la concentraciÃ³n de Al, Ca, Fe, Mg, Co, Cr, Cu, Ni, Mn, Sr, Pb, Zn y Hg, en la fracciÃ³n lodo de los sedimentos de fondo de la secciÃ³n este del Golfete de Cuare y su zona prÃ³xima costera. Para ello, fueron captadas 17 muestras de nÃºcleos de 20 cm de largo, seguidamente sometidas a una extracciÃ³n Ã¡cida secuencial con HCl 1M y posteriormente con HNO3 concentrado. El anÃ¡lisis de estos nÃºcleos fue realizado utilizando la tÃ©cnica de Espectroscopia de EmisiÃ³n AtÃ³mica con Fuente de Plasma Inductivamente Acoplado (EEA-ICP). Por su parte el Hg en los sedimentos fue determinado por medio de un equipo analizador de mercurio total (TMA~80). AsÃ­ mismo fueron realizados anÃ¡lisis de DifracciÃ³n de Rayos X para establecer las fases minerales presentes en las muestras de sedimentos con el propÃ³sito de conocer su asociaciÃ³n con las concentraciones de los elementos. Los resultados obtenidos indican que la fracciÃ³n lodo es la dominante en la zona de estudio dentro del Golfete de Cuare con un promedio de 95%; mientras que, en la zona prÃ³xima costera predominan arenas muy fina en aproximadamente un 55%. La concentraciÃ³n de Al, Fe, Mn, Cu, Zn y Pb dentro del golfete, es mayor en relaciÃ³n a la zona prÃ³xima costera, pero el Co presenta un comportamiento contrario. Por otro lado, el Mg, Ni, Cr y Hg muestran una mayor homogeneidad en sus concentraciones en el sistema bajo estudio; finalmente el Ca y el Sr aumentan hacia la boca del golfete. A su vez, verticalmente es notada una distribuciÃ³n homogÃ©nea de los metales estudiados en el golfete; mientras que en la zona prÃ³xima costera puede observarse un aumento de la concentraciÃ³n de estos en funciÃ³n de la profundidad. El Al estÃ¡ asociado a fases de hidrÃ³xidos de aluminio amorfas o alumino-silicatos pobremente cristalinos; por su parte, los elementos Fe y Mn estÃ¡n incorporados a oxi- hidrÃ³xidos amorfos y cristalinos; mientras que, el Ca y el Sr a carbonatos. Los metales Co, Cu, Zn, Ni y Pb estÃ¡n como elementos sorbidos sobre las arcillas, y/u oxi-hidrÃ³xidos de Fe, ta,nien asociados a estos Ãºltimos por coprecipitaciÃ³n. El anÃ¡lisis de DifracciÃ³n de Rayos X pudo constatar la presencia de fases minerales como goetita, calcita, cuarzo y arcillas en los sedimentos de fondo de la zona bajo estudio','2009-09-07','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',4,1,1,1,1,'2013-09-17 08:27:11','2013-09-17 08:27:11','Documento_204.pdf','application/pdf',8905728,'2013-09-17 08:27:11',19,0,0,'INCOMPLETO'),(205,'Estudio quÃ­mico y evaluaciÃ³n biolÃ³gica de los componentes principales del alga venezolana Ulva lactuca','Al alga Ulva lactuca colectada en las costas de la isla de Margarita, se le realizÃ³ un estudio quÃ­mico y una evaluaciÃ³n biolÃ³gica. Se prepararon cuatro extractos principales a partir del material seco, mediante la particiÃ³n del crudo metanÃ³lico (CM) inicial: EH, ED, EM y EA. Del EM, mediante tÃ©cnicas cromÃ¡togrÃ¡ficas de columna y capa fina, se aislaron tres fracciones principales: EM1, EM3 y EM4. De EM1 se logrÃ³ caracterizar un Ã¡cido graso como constituyente principal. En EM3 se presume la presencia de dos monosacÃ¡ridos, uno en forma libre y otro unido a un glicerol. Finalmente, usando los datos espectroscÃ³picos de EM4 y realizando ensayos quÃ­micos se pudo inferir la presencia de un monosacÃ¡rido como constituyente de esta fracciÃ³n (EM4).','2009-10-26','Ulva lactuca, glucosa-6-fosfatasa, algas',6,1,1,1,1,'2013-09-17 08:27:11','2013-09-17 08:27:11','Documento_205.pdf','application/pdf',1923055,'2013-09-17 08:27:11',19,0,153,'COMPLETO'),(206,'RediseÃ±o de la aplicaciÃ³n Web para la divulgaciÃ³n de la oferta acadÃ©mica y servicios generales en linea del Programa de CooperaciÃ³n Interfacultades (PCI) U.C.V., siguiendo el workflow propuesto por Emily Cotler y Kelly Goto.','En este trabajo, se reflejan los aspectos metodolÃ³gicos y prÃ¡cticos inherentes al proceso de rediseÃ±o que se realizÃ³ en la aplicaciÃ³n Web del Programa de CooperaciÃ³n Interfacultades (PCI), instituciÃ³n perteneciente a la U.C.V. Se describen los criterios y lineamientos propuestos por Emily Cotler y Kelly Goto para la planificaciÃ³n y gestiÃ³n del rediseÃ±o Web, conjuntamente con la metodologÃ­a de desarrollo utilizada. El PCI se encarga fundamentalmente de interrelacionar acadÃ©micamente a las diversas Facultades de esta instituciÃ³n universitaria, recolectando y gestionando informaciÃ³n concerniente a aquellas asignaturas de otras carreras que un estudiante regular de la Universidad pudiese cursar; constituyÃ©ndose Ã©sto en un aliciente de sumo beneficio para el enriquecimiento acadÃ©mico y personal de los estudiantes que decidan incorporarse a dicho programa.','2009-10-27','Programa, CooperaciÃ³n, Interfacultades, PCI, UCV, RediseÃ±o, Goto, Cotler, aplicaciÃ³n Web, oferta acadÃ©mica',2,1,1,1,1,'2013-09-17 08:27:13','2013-09-17 08:27:13','Documento_206.pdf','application/pdf',0,'2013-09-17 08:27:13',20,0,0,'INCOMPLETO'),(207,'GestiÃ³n de historias medicas de hospitalizaciones utilizando dispositivos mÃ³viles y tecnologÃ­a Wi-Fi.','En el presente Trabajo Especial de Grado se describe el proceso de anÃ¡lisis, diseÃ±o e implementaciÃ³n de un sistema de gestiÃ³n de historias mÃ©dicas de hospitalizaciones, utilizando dispositivos mÃ³viles con capacidades de navegaciÃ³n Web y capacidades de conexiÃ³n a redes inalÃ¡mbricas IEEE 802.11. La soluciÃ³n planteada se desarrollÃ³ bajo una arquitectura Web de tipo Cliente/ Servidor. La gestiÃ³n tradicional de historias mÃ©dicas conlleva mÃºltiples inconvenientes, un ejemplo consiste en el almacenamiento fÃ­sico y custodia de historiales mÃ©dicos, los cuales se convierten en un verdadero problema debido a la gran cantidad de informaciÃ³n que se maneja. De igual forma, la gestiÃ³n tradicional conlleva a posibles equivocaciones de legibilidad al momento de realizar el llenado de la informaciÃ³n o al momento de realizar transcripciones de un lugar a otro, pudiendo causar demoras e inconvenientes en la prestaciÃ³n del servicio mÃ©dico. El uso de dispositivos mÃ³viles para la gestiÃ³n de historiales mÃ©dicos en un Ã¡rea de hospitalizaciÃ³n, representa una soluciÃ³n portable y poco costosa a los problemas inherentes de la gestiÃ³n tradicional. Los beneficios del uso de dispositivos mÃ³viles en un Ã¡rea de hospitalizaciÃ³n se evidencian al permitir que los profesionales de la medicina ejecuten procesos de toma de decisiones eficientes y oportunos, teniendo acceso a la informaciÃ³n de forma electrÃ³nica sin importar el lugar donde se encuentren.','2009-10-26','Historias MÃ©dicas, Dispositivos MÃ³viles, Redes InalÃ¡mbricas, Hospitalizaciones, IEEE 802.11.',2,1,1,1,1,'2013-09-17 08:27:14','2013-09-17 08:27:14','Documento_207.pdf','application/pdf',2303351,'2013-09-17 08:27:14',20,0,110,'COMPLETO'),(208,'EVALUACIÃ“Ã“NN DE LA TÃ‰Ã‰CCNICA DE PCR PARA LA IDENTIFICACIÃ“Ã“NN MOLECULAR DE ESPECIES DE ATÃšÃšNN COMERCIALIZADAS EN VENEZUELA..','En la actualidad, los consumidores estÃ¡n mÃ¡s conscientes de los sistemas ecolÃ³gicos y en la materia del medio ambiente; la demanda de alimentos orgÃ¡nicos y de los productos obtenidos de los sistemas eco-sostenibles aumentÃ³. Sin embargo, los procesos de industrializaciÃ³n, asÃ­ como la globalizaciÃ³n de los mercados, han hecho difÃ­cil mantener un control en el procesamiento de los alimentos, haciendo relativamente fÃ¡cil sustituir fraudulentamente las variedades mÃ¡s valoradas de pescado por otras de caracterÃ­sticas similares. La genÃ©tica molecular tiene herramientas que permiten solventar estas dificultades, ya que facilita la identificaciÃ³n de las diferentes especies pesqueras y sus productos gracias a su propio ADN y no a una etiqueta asociados a ellos. En el presente trabajo se planteÃ³ evaluar la identificaciÃ³n, mediante tÃ©cnicas moleculares, de algunas muestras de atÃºn tanto fresco como enlatado, que son comercializados en el paÃ­s, con la finalidad de crear una herramienta confiable, fÃ¡cil y de resultados rÃ¡pidos que permita distinguir las diferentes especies de pescados que puedan ser enmascarados bajo etiquetas falsas. Se realizaron distintos mÃ©todos de aislamiento de muestras de ADN, se realizÃ³ una ReacciÃ³n en Cadena de la Polimerasa asociada a Polimorfismo de la Longitud de Fragmentos de RestricciÃ³n (PCR-RFLP), utilizando dos juegos de cebadores y diferentes enzimas de restricciÃ³n. Se demostrÃ³ que la cantidad y calidad del ADN depende del grado de procesamiento y de los tipos de aditivos agregados en la materia prima. Se pudo identificar que una de las especies empleadas para el proceso de enlatado es el atÃºn blanco o Thunnus alalunga. Esta primera prueba piloto permitiÃ³ evaluar la identificaciÃ³n de algunas especies de atÃºn, para que posteriormente pueda ser transferida a los sectores empresarial y gubernamental.','2009-10-16','PCR-RFLP; ; T.. alalunga',1,1,1,1,1,'2013-09-17 08:27:15','2013-09-17 08:27:15','Documento_208.pdf','application/pdf',0,'2013-09-17 08:27:15',19,0,0,'INCOMPLETO'),(209,'CaracterizaciÃ³n GeoquÃ­mica de las Cuarcitas Ferruginosas situadas en la Cuenca del rÃ­o Aro, estado BolÃ­var, Venezuela','Se llevÃ³ a cabo un estudio sobre la abundancia y distribuciÃ³n de la concentraciÃ³n de los elementos mayoritarios, minoritarios, trazas y Tierras Raras en cuarcitas ferruginosas de la cuenca del rÃ­o Aro, con la finalidad de caracterizar su ambiente de formaciÃ³n, determinar que tipo de cuarcita ferruginosa se presenta y establecer si representan una reserva importante de hierro y otros elementos que pudiesen estar asociados a estos cuerpos rocosos. Se colectaron 36 muestras de roca, las cuales se trituraron y pulverizaron, para su posterior anÃ¡lisis mediante la tÃ©cnica de ActivaciÃ³n de Neutrones (INAA) en un laboratorio comercial en CanadÃ¡ y por el mÃ©todo de fusiÃ³n alcalina mediante la tÃ©cnica de Espectroscopia de EmisiÃ³n AtÃ³mica de Plasma Inductivamente Acoplado (ICP-AES), obteniendo asÃ­ la concentraciÃ³n de los elementos analizados en esta investigaciÃ³n. El patrÃ³n de distribuciÃ³n de los elementos mayoritarios y minoritarios permite determinar una composiciÃ³n similar a la encontrada para las Formaciones Bandeadas de Hierro (BIF) del Arqueano y del Paleoproterozoico, con la excepciÃ³n de los elementos Mg, Ca, K, que presentan un empobrecimiento con una concentraciÃ³n por debajo del lÃ­mite establecido para estas formaciones. Los patrones de distribuciÃ³n de los elementos de Tierras Raras normalizados con NASC (North American Shale Composite) y composiciÃ³n condrÃ­tica, asÃ­ como los valores encontrados para Eu/Eu* y Ce/Ce*, permiten proponer posibles anomalÃ­as positivas leves a moderadas de Eu, anomalÃ­as negativas de Ce y enriquecimiento de bajo a moderado grado de La, lo cual, es evidencia de un posible aporte hidrotermal, con soluciones hidrotermales fuertemente diluidas o soluciones hidrotermales muy alejadas de la fuente. Los patrones de distribuciÃ³n de los elementos trazas y la composiciÃ³n mineralÃ³gica encontrada para las cuarcitas ferruginosas de la cuenca del rÃ­o Aro, permiten proponer un ambiente de formaciÃ³n similar al propuesto para las formaciones bandeadas de hierro de el tipo Lago Superior.','2009-09-07','Cuarcitas Ferruginosas, FormaciÃ³n Bandeada de Hierro, RÃ­o Aro',4,1,1,1,1,'2013-09-17 08:27:17','2013-09-17 08:27:17','Documento_209.pdf','application/pdf',18219344,'2013-09-17 08:27:17',18,0,91,'COMPLETO'),(210,'SÃ­ntesis y CaracterizaciÃ³n del compuesto Nd((11--x))SrxMn((11-- y))FeyO33 nanocristalino..','Se sintetizaron compuestos del sistema Nd(1-x)SrxMn(1-y)FeyO3 para las siguientes composiciones: (X=0,0; Y=1,0), (X=1,0; Y=1,0) y para (X=0,3; Y=0,5), mediante los mÃ©todos de CombustiÃ³n y Sol-Gel (a excepciÃ³n del compuesto Nd0,7Sr0,3Mn0,5Fe0,5O3 que no fue sintetizado por Sol-Gel). Todas las muestras fueron calcinadas en un horno convencional tubular, usÃ¡ndose para (X=0,0; Y=1,0) y (X=0,3; Y=0,5) una temperatura de 650K y para (X=1,0; Y=1,0) una temperatura de 1000K. La caracterizaciÃ³n estructural en los compuestos se realizÃ³ mediante la difracciÃ³n de rayos X (DRX). El anÃ¡lisis de los difractogramas mostrÃ³ que el compuesto Nd0,7Sr0,3Mn0,5Fe0,5O3 sintetizado por el mÃ©todo de CombustiÃ³n presenta una mezcla de fases cristalogrÃ¡ficas del tipo ortorrÃ³mbica y tetragonal. El SrFeO3 sintetizado por el mÃ©todo de CombustiÃ³n presenta una mezcla de fases cristalogrÃ¡ficas del tipo ortorrÃ³mbica y tetragonal, mientras que sintetizado por el mÃ©todo de Sol-Gel presenta una estructura cristalina del tipo cÃºbica simple. El compuesto NdFeO3 sintetizado por el mÃ©todo de CombustiÃ³n cristaliza en una estructura ortorrÃ³mbica, mientras que por el mÃ©todo de sol-gel no hubo una clara formaciÃ³n de una fase deseada. Fue determinado el tamaÃ±o promedio de partÃ­cula usÃ¡ndose la ecuaciÃ³n de Scherrer obteniÃ©ndose un tamaÃ±o alrededor de 20,7 nm para el compuesto Nd0,7Sr0,3Mn0,5Fe0,5O3, 60,6 nm para el SrFeO3por el mÃ©todo de CombustiÃ³n y 41,4 nm por el mÃ©todo de Sol-Gel; y 70,8 nm para el NdFeO3. UtilizÃ¡ndose la MicroscopÃ­a ElectrÃ³nica de TransmisiÃ³n (TEM), mediante micrografÃ­as, se confirmÃ³ la existencia de nanopartÃ­culas con una amplia distribuciÃ³n de tamaÃ±o, con un tamaÃ±o promedio de 89,60 nm para el NdFeO3 y 31,70 nm para el Nd0,7Sr0,3Mn0,5Fe0,5O3, resultados que difieren un poco de los encontrados con el uso de la ecuaciÃ³n de Scherrer en los difractogramas de difracciÃ³n en polvo. Espectros de Resonancia ParamagnÃ©tica ElectrÃ³nica (RPE) fueron obtenidos en el rango de temperaturas entre 100K y 600K para las diversas concentraciones de Nd, Sr, Mn y Fe. Todos los espectros presentaron un pico de absorciÃ³n principal en g = 2. Entre los resultados observados destaca que el ancho de lÃ­nea pico- pico decrece con el aumento de la temperatura. Este comportamiento estÃ¡ relacionado con la interacciÃ³n de intercambio entre los iones magnÃ©ticos. A partir del anÃ¡lisis de la dependencia de DHpp con la temperatura, se extrajeron valores estimados para la temperatura de Curie-Weiss (th) y la temperatura de congelamiento Tf de la fase de vidrio de spin. Los valores de th obtenidos fueron negativos, lo que es indicativo de una fuerte interacciÃ³n del tipo antiferromagnÃ©tico, con un parÃ¡metro de J = 1 que nos indica sobre una posible transiciÃ³n de una fase paramagnÃ©tica a una fase del tipo vidrio de spin.','2009-10-29','SÃ­ntesis y CaracterizaciÃ³n del compuesto Nd(1-x)SrxMn(1-y)FeyO3 nanocristalino. Nanocristalino. Perovskitas.',3,1,1,1,1,'2013-09-17 08:27:18','2013-09-17 08:27:18','Documento_210.pdf','application/pdf',1524578,'2013-09-17 08:27:18',19,0,172,'COMPLETO'),(211,'ImplementaciÃ³n de una arquitectura de red WLAN basada en el estÃ¡ndar IEEE 880022..1111 y en el esquema de seguridad WPA22--Enterprise','La empresa C.G.S.I., C.A. (ConsultorÃ­a Global en Seguridad InformÃ¡tica) requerÃ­a implementar una red inalÃ¡mbrica con fuerte Ã©nfasis en la seguridad, para remplazar su antigua WLAN basada en un dispositivo orientado a redes hogareÃ±as y con bajos niveles de protecciÃ³n. En este Trabajo Especial de Grado se presenta el proceso de diseÃ±o, implementaciÃ³n y pruebas de una nueva red inalÃ¡mbrica para C.G.S.I, C.A., acorde con las mejores prÃ¡cticas de la industria. Esta red consta de una arquitectura de conectividad que da soporte al acceso de los clientes inalÃ¡mbricos, conforme al estÃ¡ndar IEEE 802.11. Los componentes de esta arquitectura estÃ¡n basados en dispositivos del fabricante de equipamiento para WLAN Aruba Networks. Por otra parte, existe tambiÃ©n una arquitectura de seguridad donde se establece la infraestructura de autenticaciÃ³n y control de acceso a la red inalÃ¡mbrica. La arquitectura de seguridad, construida sobre los componentes de la plataforma Microsoft Active Directory de la compaÃ±Ã­a, implementa el esquema WPA2-Enterprise (WI--Fi Protected Access 22), que provee autenticaciÃ³n IEEE 802.1X y cifrado de datos CCMP-AES. El resultado final es una soluciÃ³n WLAN completamente funcional que cumple con la especificaciÃ³n de red de seguridad robusta (RSN) definida en el estÃ¡ndar IEEE 802.11-2007.','2009-10-27','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:27:19','2013-09-17 08:27:19','Documento_211.pdf','application/pdf',835819,'2013-09-17 08:27:19',19,0,117,'COMPLETO'),(212,'Prototipo del Sistema de GestiÃ³Ã³nn de Preparadores de la Escuela de ComputaciÃ³Ã³nn,, mÃ³Ã³ddulos GestiÃ³Ã³nn de Retiros y Administrativo..','El desarrollo del presente trabajo, constituye la construcciÃ³n de un Prototipo del Sistema de GestiÃ³n de Preparadores de la Escuela de ComputaciÃ³n (SGP--EC), mÃ³dulos Administrativo y GestiÃ³n de Retiros para el mejoramiento de los procesos de dicha gestiÃ³n, siguiendo las fases de la metodologÃ­a OpenUp produciendo en la primera fase un flujo de trabajo (Workflow) que representa las actividades correspondientes a los usuarios actuales. TambiÃ©n se llevÃ³ a cabo la definiciÃ³n y especificaciÃ³n de los elementos necesarios para la creaciÃ³n de los servicios Web que permiten el suministro de los datos para los mÃ³dulos de GestiÃ³n de Retiros y Administrativo empleando la herramienta tecnolÃ³gica Ruby on Rails. Durante la Ãºltima fase se realizÃ³ la simulaciÃ³n de la ejecuciÃ³n de las funcionalidades. Alcanzando el objetivo principal de este trabajo especial de grado se consiguiÃ³ como resultado el desarrollo el mÃ³dulo de GestiÃ³n de Retiros, del Sistema de GestiÃ³n de preparadores de la Escuela de ComputaciÃ³n, en conjunto con el mÃ³dulo Administrativo del sistema.','2009-10-29','GestiÃ³n de preparadores, GestiÃ³n por procesos, Workflow, servicios Web, OpenUp, Ruby on Rails.',2,1,1,1,1,'2013-09-17 08:27:21','2013-09-17 08:27:21','Documento_212.pdf','application/pdf',1942437,'2013-09-17 08:27:21',20,0,103,'COMPLETO'),(213,'CaracterizaciÃ³Ã³nn del fenÃ³Ã³mmeno de sorciÃ³Ã³nn de los elementos As,, Cr,, Hg y Pb por la turba del manglar del Refugio de Fauna Silvestre de Cuare,, localidad Boca del Zorro,, estado FalcÃ³Ã³nn','El presente trabajo tiene como objetivo principal evaluar la capacidad de adsorciÃ³n y desorciÃ³n de la turba del manglar de Morrocoy, estado FalcÃ³n hacia las especies As3+, Cr3+, Hg2+ y Pb2+. Para tal fin se efectuÃ³ una caracterizaciÃ³n composicional gruesa a la turba, determinando que se encuentra conformada por aproximadamente 20% humedad, 44% de materia orgÃ¡nica y 36% de material inorgÃ¡nico (arcillas). Para los ensayos de adsorciÃ³n, se prepararon soluciones de concentraciÃ³n conocida de cada uno de los adsorbatos y se colocaron en agitaciÃ³n con la turba. Se mantuvo un pH entre 6 y 7 y una temperatura promedio de 25 ÂºC. Cada ensayo se realizÃ³ por triplicado. Los resultados obtenidos mostraron que las cuatro especies quÃ­micas bajo estudio se adsorbieron sobre la turba en una gran extensiÃ³n, ajustÃ¡ndose satisfactoriamente al modelo de Langmuir. Las concentraciones mÃ¡ximas de adsorciÃ³n calculadas (Xmax) para cada especie fueron: para el As3+, 9655Â±2845 mg/Kg; Cr3+, 6130Â±1665 mg/Kg; Pb2+, 27382Â±9047 mg/Kg; y Hg2+, 53134Â±7178 mg/Kg. El orden de afinidad de los cationes hacia el sustrato fue Hg2+>Pb2+> As3+> Cr3+. El ajuste satisfactorio observado hacia el modelo de Langmuir sugiere adsorciÃ³n en monocapa, y por tanto un fenÃ³meno de quimiosorciÃ³n. Este comportamiento se asocia principalmente a la naturaleza quÃ­mica de cada especie y a la estabilidad que tienen de formar complejos estables con la materia orgÃ¡nica. Los resultados de los ensayos de desorciÃ³n de los cationes para la turba revelaron que este sustrato no libera las especies adsorbidas con facilidad. Los porcentajes de desorciÃ³n promedio fueron menores al 1%, siendo el orden de desorciÃ³n observado Hg2+>Pb2+>Cr3+. El comportamiento del As3+ en las pruebas de desorciÃ³n fue errÃ¡tico y no reproducible, pero sugiere que se desorbe en mayor proporciÃ³n que los restantes elementos ensayados. Los resultados de adsorciÃ³n y desorciÃ³n obtenidos son de gran importancia, pues revelan que la turba adsorbe gran cantidad de iones y no los libera, lo que implica que este sustrato puede estar jugando un papel primordial en el control quÃ­mico y disponibilidad de especies tÃ³xicas en los ambientes naturales en los que se forma.','2009-09-07','AdsorciÃƒÂ³n, turba, desorciÃƒÂ³n, manglar.',4,1,1,1,1,'2013-09-17 08:27:23','2013-09-17 08:27:23','Documento_213.pdf','application/pdf',6041266,'2013-09-17 08:27:23',19,0,157,'COMPLETO'),(214,'OBTENCIÃ“Ã“NN Y CARACTERIZACIÃ“Ã“NN MOLECULAR DE RESINAS TIPO I Y RESINAS TIPO II DE CRUDOS VENEZOLANOS','Debido a que experimentalmente se ha encontrado que las resinas tipo I y tipo II de los crudos poseen caracterÃ­sticas dispersantes de los coloides asfaltÃ©nicos dentro de los mismos, actuando como surfactantes naturales, resulta interesante un estudio de caracterizaciÃ³n molecular de dichas fracciones para crudos venezolanos de diferente estabilidad. En el presente trabajo de investigaciÃ³n se obtuvieron las resinas tipo I y tipo II de los crudos inestables Furrial y Ceuta, y los estables Cerro Negro y Hamaca, y a travÃ©s de estudios de caracterizaciÃ³n molecular como VPO, AnÃ¡lisis Elemental de C, N, H, S y O, IR y RMN de 1H y 13C, se encontraron diferencias en las caracterÃ­sticas moleculares promedio de dichas fracciones. En general se obtuvo que las resinas tipo II de todos los crudos son estructuras menos aromÃ¡ticas de mayor tamaÃ±o, con presencia de mayor cantidad de sustituyentes alquÃ­licos y heteroÃ¡tomos como O y S que las resinas tipo I de un mismo crudo. Esto permite presumir que las resinas tipo I tienen mayor capacidad de establecer interacciones efectivas con los asfaltenos por lo que coprecipitan con ellos, mientras que las resinas tipo II por ser mÃ¡s sustituidas establecen interacciones mÃ¡s efectivas con las demÃ¡s molÃ©culas del crudo quedando en soluciÃ³n cuando ocurre dicha precipitaciÃ³n. TambiÃ©n se encontrÃ³ que los grupos carbonilos presente en las resinas que provienen de crudos estables Cerro Negro y Hamaca estÃ¡n asociados a Ã¡cidos carboxÃ­licos mientras que en las provenientes de crudos inestables Furrial y Ceuta se asocian a cetonas conjugadas. Las interacciones tipo puente de hidrÃ³geno que se establecen entre los hidrÃ³genos de los grupos carboxilos de las resinas de los crudos estables con los grupos bÃ¡sicos de sus asfaltenos, permiten justificar la estabilidad de los mismos en soluciÃ³n ya que son interacciones difÃ­ciles de romper ante cualquier perturbaciÃ³n del sistema del crudo.','2009-10-26','Asfaltenos, resinas tipo I, resinas tipo II, FloculaciÃ³n, Aromaticidad',6,1,1,1,1,'2013-09-17 08:27:24','2013-09-17 08:27:24','Documento_214.pdf','application/pdf',586785,'2013-09-17 08:27:24',20,0,59,'COMPLETO'),(215,'APROVECHAMIENTO INTEGRAL DEL MAMÃ“Ã“NN ((Melicocca bijugaL..)) COMO MATERIA PRIMA PARA LA INDUSTRIA ALIMENTARIA','El mamÃ³n (Melicocca bijuga L.) es una fruta que es utilizada a nivel domÃ©stico como materia prima en la elaboraciÃ³n de jugos, dulces y mermeladas, pudiendo ser la base de varias industrias; asÃ­, considerando las caracterÃ­sticas de la semilla, la adaptabilidad de la planta a la geografÃ­a nacional y la importancia en diversos renglones econÃ³micos regionales, asÃ­ como fomentar la ingesta de frutas criollas, se desarrollÃ³ el presente trabajo, en el cual se evaluÃ³ la adaptabilidad del fruto de mamÃ³n (Melicocca bijuga L.) a la metodologÃ­a de extracciÃ³n de almidÃ³n de su semilla y a la elaboraciÃ³n de jaleas y mermeladas. Los valores mÃ¡s representativos en la pulpa fueron los de su proporciÃ³n respecto al resto de los constituyentes del fruto, ya que Ã©sta representa casi el 50 % del fruto entero. Su pH es de 3,70 lo que hace que al realizar productos como la jalea y la mermelada la adiciÃ³n de Ã¡cido cÃ­trico para cumplir con las normas vigentes sea mÃ­nima. AdemÃ¡s, presenta un porcentaje de sÃ³lidos totales de 22,59 %. En el caso de la semilla, el alto porcentaje de proteÃ­na (21,07 %) resulta interesante para realizar diversos productos. En el almidÃ³n extraÃ­do de la semilla de mamÃ³n llama la atenciÃ³n el alto contenido de amilosa (31,04 %) en comparaciÃ³n con otros almidones. Los productos desarrollados (jalea y mermelada) se adaptan perfectamente al esquema de producciÃ³n tradicional y cumplen con las normas establecidas; al mismo tiempo presentaron una buena aceptaciÃ³n por parte de un panel de consumidores.','2009-09-03','Melicocca bijuga, mamÃ³n, mermelada, jalea, almidÃ³n',1,1,1,1,1,'2013-09-17 08:27:26','2013-09-17 08:27:26','Documento_216.pdf','application/pdf',1250993,'2013-09-17 08:27:26',20,0,37,'COMPLETO'),(216,'ESTUDIO DE LA HOMOGENEIDAD QUÃÃMMICA DE LAS VARIABLES Si, Ca, Fe, K, Ti, Ba, Ce, Pb, Ni, Sc, Sn, Sr, Sb, La, Y y Mo, EN LA MUESTRA COMPUESTA DE ARCILLITAS DE FALCÃ“Ã“NN ((MCAF)),, CANDIDATA A MATERIAL DE REFERENCIA','El presente trabajo de investigaciÃ³n estuvo enfocado en realizar un estudio sobre la homogeneidad de distintos elementos quÃ­micos en la Muestra Compuesta de Arcillitas de FalcÃ³n (MCAF). La muestra fue preparada por Escorcia en 2008, a partir de la mezcla de muestras simples pertenecientes a las Formaciones geolÃ³gicas Urumaco, Socorro, Querales, Cerro Pelado, Agua Clara, Pedregoso, Pecaya y El ParaÃ­so, de la Cuenca Central de FalcÃ³n. Los elementos quÃ­micos que constituyeron las variables de estudio fueron Si, Fe, Ca, K, Ti, Ba, Pb, Sc, Sn, Sr, La, Mo, Y, Ni, Ce y Sb. La metodologÃ­a analÃ­tica empleada consistiÃ³ en seleccionar aleatoriamente 15 submuestras de la MCAF y realizar el anÃ¡lisis quÃ­mico por duplicado de cada una, una vez que estas fueron llevadas a soluciÃ³n mediante el mÃ©todo de fusiÃ³n alcalina. Otras 4 submuestras se seleccionaron igualmente al azar para realizar el anÃ¡lisis mineralÃ³gico. Las tÃ©cnicas de anÃ¡lisis empleadas fueron EspectrometrÃ­a de EmisiÃ³n AtÃ³mica con fuente de Plasma, EEO-IAP y EspectrometrÃ­a de EmisiÃ³n AtÃ³mica, (EEA-Llama, en el caso del K), para determinar las concentraciones elementales; y para las determinaciones mineralÃ³gicas se empleÃ³ la tÃ©cnica de DifracciÃ³n de Rayos X. Posteriormente se realizÃ³ un anÃ¡lisis exploratorio de datos que involucrÃ³ pruebas de normalidad y datos anÃ³malos y se procediÃ³ a realizar las pruebas de homogeneidad a los datos de composiciÃ³n quÃ­mica obtenidos para cada variable (excepto para Ce, Ni y Sb los cuales estÃ¡n por debajo del lÃ­mite de detecciÃ³n y no se determinaron), utilizando el ANOVA de un factor y la prueba de `homogeneidad suficiente\'\' descrita por Fearn y Thompson, (2001) para pruebas de homogeneidad en materiales. Los resultados obtenidos revelaron que todas las variables que pudieron ser determinadas presentan homogeneidad en el material para un 95% de confianza. Los datos son reportados como provisionales, o provisionales no recomendados para los casos en los que se presentÃ³ muy baja exactitud y precisiÃ³n (obtenido para Pb, Mo y La). Por su parte, el anÃ¡lisis mineralÃ³gico revelÃ³ la presencia de al menos 6 fases minerales, de las cuales, 3 corresponden a las arcillas ilita, caolinita y montmorillonita, y el resto a cuarzo, anatasa y yeso. Se establece que el material es un buen prospecto para ser actualmente un material de referencia intralaboratorio y para continuar con estudios sobre el mismo que permitan incrementarle su rango de clasificaciÃ³n.','2009-10-16','Homogeneidad quÃ­mica; Muestra compuesta; Arcillitas; material de referencia; FalcÃ³n.',4,1,1,1,1,'2013-09-17 08:27:27','2013-09-17 08:27:27','Documento_217.pdf','application/pdf',2739307,'2013-09-17 08:27:27',19,0,128,'COMPLETO'),(217,'Implantacion de una plataforma grid basada en gLite y Scientific Linux para el Centro de Computacion Paralela y Distribuida','Actualmente las aplicaciones de c ÃŒÂlculo complejo aumentan dr ÃŒÂsticamente la carga de trabajos en los computadores, exigi ÃŒÂndoles mayores recursos para terminar sus tareas. Gra- cias a los avances logrados en el c ÃŒÂmputo distribuido, es posible contar con gran poder de procesamiento y de almacenamiento de datos a bajo coste, esto gracias a la creaci ÃŒÂn deo cluster de alto rendimiento con m ÃŒÂquinas tipo PC. Esto compensa a los grandes y costosos equipos de procesamiento, los cuales hace poco tiempo eran los encargados de realizar las ta- reas de c ÃŒÂmputo de alto desempe ÃŒÂƒo. Es aqu ÃŒÂ es donde la tecnolog ÃŒÂ Grid ofrece una soluci ÃŒÂn viable y robusta para la resoluci ÃŒÂn de problemas de alto desempe ÃŒÂƒo.','2009-11-02','paralelismo, grid, glite',2,1,1,1,2,'2013-09-17 08:27:28','2013-09-17 08:27:28','Documento_218.pdf','application/pdf',0,'2013-09-17 08:27:28',20,0,0,'INCOMPLETO'),(218,'EvaluaciÃ³Ã³nn de la actividad CitotÃ³Ã³xxica de las CÃ©Ã©lulas NK de Pacientes CrÃ³Ã³nnicamente Infectados con el Virus de Hepatitis C ((VHC))','La Hepatitis viral consiste en la inflamaciÃ³n del hÃ­gado generada por un virus de las cuales existen 5 tipos principales de hepatitis: A, B, C, D y E. Actualmente 180 millones de personas estÃ¡n infectadas con el virus de la hepatitis C (VHC) a nivel mundial. De las personas infectadas, el 85% presentan infecciÃ³n persistente de los cuales 30% desarrollan patologÃ­a hepÃ¡tica como hepatocarcinoma o cirrosis hepÃ¡tica y del 1 a 5% mueren. El sistema inmunolÃ³gico tiene como principal funciÃ³n la protecciÃ³n del organismo de daÃ±os causados por agentes externos, la inmunidad innata actÃºa como un brazo efector de este sistema, siendo la primera lÃ­nea de defensa contra virus. Uno de los principales componentes de esta respuesta son las cÃ©lulas citotÃ³xicas naturales o Natural Killers (NK) las cuales se definen como linfocitos grandes granulares que expresan las molÃ©culas de superficie CD56, CD16 y ausencia del complejo CD3, con la capacidad de generar citotoxicidad de manera natural sin ninguna sensibilizaciÃ³n previa. Sus cÃ©lulas blanco estÃ¡n representadas por cÃ©lulas tumorales o infectadas por virus. En el modelo de infecciÃ³n por el VHC se ha reportado que la capacidad citotÃ³xica de las cÃ©lulas NK se encuentra lo cual podrÃ­a explicar la alta prevalencia del virus en estos pacientes. Objetivo:: Caracterizar desde el punto de vista funcional los linfocitos citotÃ³xicos naturales de pacientes crÃ³nicamente infectados con el virus de Hepatitis C (VHC). Materiales y MÃ©Ã©todos::Para la determinaciÃ³n de la de la actividad citotÃ³xica de la NK se usaron 3 mÃ©todos diferentes: el kit cytotox96, basado en la mediciÃ³n de la enzima Lactato Deshidrogenasa, un ensayo citofluoromÃ©trico con Anexina-V y Ioduro de propidio y evaluaciÃ³n de la molÃ©cula CD107a (Lamp-1). AsÃ­ mismo se evaluÃ³ la expresiÃ³n de los receptores citotÃ³xico naturales (NCR) en las cÃ©lulas NK de pacientes y controles. Resultados::En el ensayo citotÃ³xico basado en anexina y ioduro de propidio, los controles sanos registraron mayor porcentaje de citotoxicidad que los pacientes con un mÃ¡ximo de 4% de diferencia entre ellos, estos resultados se repiten con el estuche comercial para la mediciÃ³n de la enzima LDH. Estas diferencias sin embargo no fueron significativas. En la evaluaciÃ³n de la expresiÃ³n de CD107a no encontramos diferencias significativas entre pacientes y controles. Este ensayo permitiÃ³ determinar la actividad citotÃ³xica de la NK de una manera mÃ¡s fÃ¡cil y practica. Los receptores citotÃ³xicos naturales (NCR) no mostraron variaciÃ³n en su nivel de expresiÃ³n entre pacientes y controles. Conclusiones:: No se observaron diferencias significativas en la actividad citotÃ³xica de los pacientes crÃ³nicamente infectados con el virus de la hepatitis C, en comparaciÃ³n con individuos controles sanos','2009-10-16','CÃ©lulas NKCitotÃ³xicidadHepatitis CLamp-1',1,1,1,1,1,'2013-09-17 08:27:29','2013-09-17 08:27:29','Documento_219.pdf','application/pdf',1228511,'2013-09-17 08:27:29',19,0,84,'COMPLETO'),(219,'ESTUDIO QUÃMICO Y EVALUACIÃ“N DE LA POSIBLE ACTIVIDAD ANTIINFLAMATORIA DEL ALGA Gracilariopsis hommersandii','Esta investigaciÃ³n tuvo como objetivo, aislar, purificar, y evaluar la actividad antiinflamatoria de los metabolitos hallados en el alga Gracilariopsis hommersandii, a travÃ©s de tÃ©cnicas cromatogrÃ¡ficas y la elucidaciÃ³n mediante tÃ©cnicas espectroscÃ³picas, tales como: RMN-1H, RMN-13C, DEPT 135 y EM. Por otro parte, la actividad antiinflamatoria se evaluÃ³ a travÃ©s del MÃ©todo de Griess, determinÃ¡ndose la capacidad inhibidora, por parte de los metabolitos, hacia el radical NO.Adicionalmente, dicha capacidad inhibidora pudo caracterizarse en funciÃ³n del ensayo de viabilidad celular MTT, estableciÃ©ndose asÃ­, si la inhibiciÃ³n es causada por muerte celular o por la capacidad intrÃ­nseca hacia el radical.Se obtuvieron 9 metabolitos: 4 de tipo Ã¡cido graso (IV, VI, VII, VIII), 1 de tipo Ã©ster (III), 1 de tipo ftalato (V), 1 de tipo galactopiranosilglicerol (IX), 1 de tipo sulfoquinovosil diacilglicerol (II) y finalmente una estructura nueva de tipo poliol similar al xilitol (I). El metabolito que presentÃ³ mayor actividad antiinflamatoria fue el Ã¡cido eicosanoico (VII), con IC50 = 11,65 Âµg/mL.','2009-10-16','Estudio QuÃ­mico, Actividad antiinflamatoria, Alga Gracilarioposis hommersandii',6,1,1,1,1,'2013-09-17 08:27:29','2013-09-17 08:27:29','Documento_220.pdf','application/pdf',897723,'2013-09-17 08:27:29',19,0,105,'COMPLETO'),(220,'Modelado del Proceso de GestiÃ³Ã³nn de Cambios segÃºÃºnn ITIL bajo el Software Libre Intalio','La LibrerÃ­Ã­a de Infraestructura de TecnologÃ­Ã­a de la InformaciÃ³Ã³nn ((ITIL -- Information Technology Infrastructure Library)) propone un conjunto de mejores prÃ¡Ã¡cticas para gestionar el proceso de cambios en las organizaciones,, debido a que en muchas de ellas no existe un control eficiente de los cambios que se realizan.. Para implementar este proceso de manera eficiente,, se realizÃ³Ã³ la evaluaciÃ³Ã³nn de herramientas de software libre y de sistemas de gestiÃ³Ã³nn de procesos de negocios,, seleccionando a Intalio BPMS 55..22 para cumplir con el objetivo de este Trabajo Especial de Grado..El uso de esta herramienta permitiÃ³Ã³ modelar el proceso;; definir valores a los parÃ¡Ã¡metros,, tales como los nombres o roles de los actores de las tareas;; y poner en ejecuciÃ³Ã³nn el proceso,, sin tener que esperar a ningÃºÃºnn desarrollo de programaciÃ³Ã³nn..Finalmente se obtuvo el modelo del proceso en una plataforma que permite gestionarlo y adaptarlo a cualquier organizaciÃ³Ã³nn en base a las mejores prÃ¡Ã¡cticas propuestas por ITIL..','2009-10-28','BPM,, BPMS,, Intalio,, ITIL,, Proceso de GestiÃ³Ã³nn de Cambios,, SOA,, Web Services',2,1,1,1,1,'2013-09-17 08:27:31','2013-09-17 08:27:31','Documento_221.pdf','application/pdf',1361124,'2013-09-17 08:27:31',19,0,66,'COMPLETO'),(221,'EVALUAR LA DEGRADACIOÌN DE FENOL EMPLEANDO UN MEÌTODO DE OXIDACIOÌN AVANZADA: OZONO-LUZ ULTRAVIOLETA-CATALIZADOR.','Las tecnologiÌas avanzadas de oxidacioÌn se perfilan como los tratamientos por excelencia para la mineralizacioÌn de compuestos orgaÌnicos, especialmente compuestos aromaÌticos, dada su toxicidad auÌn a muy bajas concentraciones, su resistencia a los tratamientos tradicionales especialmente los bioloÌgicos, los costos de tratamiento y a las normas ambientales cada vez maÌs exigentes. Se ha comprobado que la exposicioÌn al fenol puede llegar a producir coma, convulsiones, hemoÌlisis, edema cerebral y pulmonar, llegando hasta la muerte por falla respiratoria o shock. La dosis de exposicioÌn maÌxima establecida es de 5mg/L y la dosis letal es 1,5 mg.\nEn el presente trabajo especial de grado se evaluoÌ la degradacioÌn de fenol empleando un meÌtodo de oxidacioÌn avanzada: Ozono-luz ultravioleta-catalizador en un reactor trifaÌsico. El catalizador utilizado fue TiO2 dopado con Fe al 1% en peso la caracterizacioÌn fue realizada mediante: DifraccioÌn de Rayos X (XRD), AÌrea especiÌfica (B.E.T.) y anaÌlisis quiÌmico. Las pruebas de adsorcioÌn realizada para los catalizadores TiO2, Fe/TiO2 y TiO2 Degussa P-25 mostraron que para los dos primeros catalizadores la adsorcioÌn aumenta al aumentar la concentracioÌn de fenol hasta 50 y 30 mg/L respectivamente. Luego de lo cual existe una caiÌda abrupta en la adsorcioÌn por efecto del valor de pH del medio. Para el catalizador TiO2 de la casa Degussa P-25 se observoÌ el aumento de los moles adsorbidos proporcional a la concentracioÌn de fenol lo cual permitioÌ concluir que la presencia de la fase rutilo conjuntamente a la anatasa modifica la adsorcioÌn.\nLa optimizacioÌn de los paraÌmetros de reaccioÌn permitioÌ establecer que las condiciones oÌptimas de reactividad son: flujo de ozono: 248,96 mL/min, concentracioÌn de catalizador:	250 mg/L, concentracioÌn de fenol: 30 mg/L. Se observoÌ que el porcentaje de degradacioÌn decae cuando hay presencia de sales en solucioÌn o el pH del medio es diferente al neutro. Bajo las condiciones estudiadas no se puedo establecer una\necuacioÌn cineÌtica debido principalmente a la alta velocidad de degradacioÌn. Sin embargo, se notoÌ un compromiso entre las diferentes variables estudiadas para alcanzar el mayor porcentaje de degradacioÌn.','2009-10-30','Fotocatalisis Heterogenea, Fenol, TiO2, Degradacion',6,1,1,1,1,'2013-09-17 08:27:32','2013-09-17 08:27:32','Documento_222.pdf','application/pdf',0,'2013-09-17 08:27:32',20,0,0,'INCOMPLETO'),(222,'Sistema de gestiÃ³n de servicios de reservaciÃ³n y control de inventario a travÃ©s del uso de dispositivos mÃ³viles','El presente Trabajo Especial de Grado tiene como objetivo la realizaciÃ³n de un sistema que permitirÃ¡ la administraciÃ³n del inventario y el almacÃ©n de una empresa que presta servicios de spa, ademÃ¡s de las reservaciones de las citas para sus servicios. Este sistema deberÃ¡ operar tanto para los empleados de la empresa como para los clientes de la misma, con distintos niveles de acceso y de forma remota desde un computador o algÃºn dispositivo mÃ³vil con capacidades de conexiÃ³n. Para ello se debieron recolectar datos sobre la empresa y las distintas herramientas existentes actualmente en el mercado para el desarrollo de sistemas de informaciÃ³n de manejo de almacenes, desarrollo de sistemas para dispositivos tanto fijos como mÃ³viles e inalÃ¡mbricos. En funciÃ³n de lo antes expuesto se elaborÃ³ una propuesta de Sistema de GestiÃ³n de Servicios para la empresa Jumbo Spa, para dar una soluciÃ³n eficiente a los requerimientos de la empresa.','2009-11-02','Sistema de InformaciÃƒÂ³n, Control de Inventario, Manejo de Reservaciones, Dispositivo mÃƒÂ³vil, Desarrollo Web, DiseÃƒÂ±o, AutomatizaciÃƒÂ³n, AlmacÃƒÂ©n.',2,1,1,1,1,'2013-09-17 08:27:32','2013-09-17 08:27:32','Documento_223.pdf','application/pdf',881306,'2013-09-17 08:27:32',18,0,110,'COMPLETO'),(223,'AnÃ¡lisis mineralÃ³gico y quÃ­mico de minerales pesados de sedimentos de la cuenca del rÃ­o Aro, estado BolÃ­var, Venezuela','Se realizÃ³ un estudio mineralÃ³gico y quÃ­mico de minerales pesados provenientes de sedimentos fluviales de la cuenca del rÃ­o Aro, con el propÃ³sito de determinar las fases minerales dominantes que contienen concentraciones notables de U, Th, La y Ce y de determinar la distribuciÃ³n de estos elementos dentro de los granos minerales que los contienen. El anÃ¡lisis de las muestras se llevÃ³ a cabo a travÃ©s de las tÃ©cnicas de microscopia electrÃ³nica de barrido con acoplamiento de un espectrÃ³metro de dispersiÃ³n de rayos X (MEB-EDX) y difracciÃ³n de rayos X (DRX). Se determinÃ³ que la monacita es el mineral que aporta las concentraciones elevadas de Th, Ce y La, y que estos elementos se distribuyen de manera homogÃ©nea dentro de los granos, lo que hace pensar en un solo proceso uniforme en su formaciÃ³n. El uranio sÃ³lo se detectÃ³ de manera directa en inclusiones de uraninita dentro de granos de circÃ³n. Otras inclusiones encontradas son torita en granos de monacita y circÃ³n, y torianita en monacita. Las relaciones de las intensidades de las lÃ­neas espectralesMb /Ma y Mg/Ma para el torio varÃ­an en las muestras en relaciÃ³n a sus relaciones en dos patrones que no contienen uranio, lo que indica que, probablemente, el uranio estÃ¡ presente en las monacitas en concentraciones relativamente bajas en comparaciÃ³n al Th y que sus lÃ­neas espectrales se hayan solapadas con las del Th.','2009-10-29','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',4,1,1,1,1,'2013-09-17 08:27:33','2013-09-17 08:27:33','Documento_224.pdf','application/pdf',1570286,'2013-09-17 08:27:33',19,0,112,'COMPLETO'),(224,'EvaluaciÃ³n de tÃ©cnicas de anÃ¡lisis multivariado sobre minerales pesados pertenecientes a sedimentos de drenajes activos de la regiÃ³n de Imataca, estado BolÃ­var, Venezuela: ImplicaciÃ³n en la determinaciÃ³n de proveniencia','La determinaciÃ³n de proveniencia de sedimentos de drenajes activos se puede realizar a partir del estudio quÃ­mico de los minerales pesados, particularmente cuando los afloramientos de la zona de estudio se encuentran bastante meteorizados, tal es el caso del Ã¡rea del presente estudio. En este sentido, se utilizaron 34 atributos quÃ­micos obtenidos del anÃ¡lisis (bajo la tÃ©cnica de INAA) de minerales pesados provenientes de 94 muestras pertenecientes a drenajes activos de la regiÃ³n de Imataca, estado BolÃ­var. Con el fin de estimar la proveniencia de estos sedimentos, se compararon dos tÃ©cnicas de anÃ¡lisis multivariado: anÃ¡lisis de factores (AF) y anÃ¡lisis de componentes principales (ACP). Cada una de estas tÃ©cnicas fue explorada detalladamente, encontrando las condiciones Ã³ptimas para los datos tratados en base a los criterios de selecciÃ³n: facilidad de interpretar los resultados geoquÃ­micamente (criterio geoquÃ­mico) y el porcentaje de explicaciÃ³n de la varianza total (criterio estadÃ­stico). En el anÃ¡lisis multivariado sÃ³lo se emplearon 15 de los 34 atributos quÃ­micos determinados, debido a que el resto de las variables presentaban mÃ¡s del 25% de las muestras por debajo del lÃ­mite de detecciÃ³n. Esto se realizÃ³ para evitar que ocurrieran posibles distorsiones en los resultados del anÃ¡lisis multivariado, debido a la incertidumbre de estas variables. Por otro lado, a las variables seleccionadas se les aplicaron transformaciones como Box?Cox y Ln, y posteriormente se estandarizaron, para evaluar como influye el tratamiento previo sobre los resultados obtenidos. Tanto en el caso de la tÃ©cnica de AF, como la tÃ©cnica de ACP, resultÃ³ ser mÃ¡s favorable transformar los datos con Ln, donde la herramienta de estandarizaciÃ³n fue indiferente, emplear un tipo de matriz de correlaciÃ³n, estimar la covarianza con el mÃ©todo robusto y rotar los factores con Quartimax. Ambas tÃ©cnicas arrojaron los mismos resultados desde el punto de vista geoquÃ­mico; no obstante, el AF logrÃ³ explicar mejor la varianza total. A partir de los resultados obtenidos se pudo establecer que las muestras de la parte septentrional de la quebrada El Catire provienen de una fuente mÃ¡fica, mientras que la mayorÃ­a de las muestras de la parte Sur de esta quebrada son producto de una mezcla de fuentes fÃ©lsicas y mÃ¡ficas. Por Ãºltimo, se obtuvo que las muestras de las quebradas Los Brinquitos y Chaparrillal se encuentran aportadas principalmente por una fuente fÃ©lsica. Estos resultados son coincidentes con los aportados a partir de la distribuciÃ³n de valores de correlaciones interelementales (Th/Sc, La/Co, La/Sc, Cr/Th) y de grÃ¡ficos de discriminaciÃ³n Th/Co vs. La/Sc y La-Sc-Th.','2009-09-07','anÃ¡lisis de factores; anÃ¡lisis de componentes principales; proveniencia; regiÃ³n de Imataca, Venezuela.',4,1,1,1,1,'2013-09-17 08:27:35','2013-09-17 08:27:35','Documento_225.pdf','application/pdf',7512802,'2013-09-17 08:27:35',20,0,109,'COMPLETO'),(225,'DESARROLLO DE UNA SOLUCIÃ“Ã“NN DEINTELIGENCIA DE NEGOCIOS PARA UN DEPARTAMENTO DE FINANZAS DENTRO DEL SECTOR PETROQUÃÃMMICO','El presente Trabajo Especial de Grado (TEG) consiste en el desarrollo de una soluciÃ³n de inteligencia de negocios (BI, Business Intelligence por sus siglas en InglÃ©s) para un departamento de finanzas del sector petroquÃ­mico, el cual maneja una gran cantidad de informaciÃ³n y esta es utilizada para realizar los anÃ¡lisis, reportes e informes necesarios. En la actualidad estas tareas son realizadas de manera manual apoyÃ¡ndose en hojas de cÃ¡lculos, lo que puede traer como consecuencia errores de manipulaciÃ³n en los datos y una gran pÃ©rdida de tiempo en todo este proceso. Nuestra soluciÃ³n de inteligencia de negocio disminuye los tiempos empleados para la extracciÃ³n y carga de los datos asÃ­ como para la generaciÃ³n de reportes, informes, grÃ¡fica, entre otros y aseguran la entrega de informaciÃ³n exacta, Ãºtil y necesaria para apoyar la toma de decisiones.El objetivo de este TEG es aprovechar las ventajas que nos ofrece una plataforma BI la cual es una arquitectura y colecciÃ³n de operaciones integradas y bases de datos que proporcionan a la comunidad empresarial el acceso fÃ¡cil a los datos; es decir seaprovecha los proceso analÃ­tico (OLAP) el cual nos permite un mejor rendimiento para acceder a los datos ultidimensionales proporcionando una base tÃ©cnica para los anÃ¡lisis y cÃ¡lculos requeridos, ayudando a que se tomen decisiones de manera rÃ¡pida y precisa. Para alcanzar dicho objetivo se utilizÃ³ una metodologÃ­a de desarrollo de soluciones de inteligencia de negocio llamada \"\"The Business Dimensional Lifecycle\"\"propuesta por Ralph Kimball. Y como plataforma de desarrollo se utilizÃ³ una herramienta de cÃ³digo abierto (Open Source) llamada Pentaho BI la cual es una plataforma que ofrece funcionalidades como los son la integraciÃ³n de datos (ETL), reportes, anÃ¡lisis, herramientas OLAP, minerÃ­a de datos, entre otras.','2009-10-30','Inteligencia de Negocio,, Datawarehouse,, Pentaho,, AnÃ¡Ã¡lisis,, OLAP,, IntegraciÃ³Ã³nn de datos,, MetodologÃ­Ã­a de Ralph Kimball..',2,1,1,1,1,'2013-09-17 08:27:37','2013-09-17 08:27:37','Documento_226.pdf','application/pdf',342972,'2013-09-17 08:27:37',19,0,40,'COMPLETO'),(226,'\"Estudio de la actividad catalÃ­tica de nanopartÃ­culas de Mo, Ni y Fe en reacciones de hidrodesulfuraciÃ³n de molÃ©culas tipo dibenzotiofeno presentes en el diesel\"','En este trabajo se sintetizaron nanopartÃ­culas de Mo, Ni y Fe soportadas sobre alÃºmina, por descomposiciÃ³n tÃ©rmica de precursores organometÃ¡licos, a 150 ÂºC y presiÃ³n atmosfÃ©rica empleando nonano como solvente y dimetil disulfuro como agente sulfurante. Los sÃ³lidos obtenidos fueron caracterizados mediante las tÃ©cnicas de microscopia electrÃ³nica de transmisiÃ³n (MET), espectroscopia fotoelectrÃ³nica de rayos X (XPS por sus siglas en inglÃ©s), difracciÃ³n de rayos X (DRX) y anÃ¡lisis quÃ­mico por absorciÃ³n atÃ³mica con plasma inductivamente acoplado (ICP por sus siglas en inglÃ©s). Se obtuvieron partÃ­culas con distribuciones de tamaÃ±o relativamente estrechas (2-14 nm), con morfologÃ­a esfÃ©rica y ovalada, siendo la esfÃ©rica la poblaciÃ³n predominante. Las nanopartÃ­culas sintetizadas correspondÃ­an a Ã³xidos y sulfuros de los diferentes metales empleados y ademÃ¡s, no se evidenciÃ³ formaciÃ³n de nanopartÃ­culas bimetÃ¡licas o trimetÃ¡licas, ni formaciÃ³n de aleaciones. La actividad catalÃ­tica de las nanopartÃ­culas soportadas, fue estudiada empleando la hidrodesulfuraciÃ³n (HDS) de molÃ©culas tipo dibenzotiofeno, en un reactor por carga sin agitaciÃ³n y sumergido en un baÃ±o de arena, a una T= 370 ÂºC, a dos presiones de reacciÃ³n (500 psig o 1000 psig) durante 1,5 horas como tiempo de reacciÃ³n. En general se observaron actividades y conversiones bajas para los catalizadores empleados, aunque mostraron una tendencia a incrementar la actividad con un aumento en la presiÃ³n de reacciÃ³n. AsÃ­ como tambiÃ©n una tendencia a disminuir con el incremento de la complejidad estructural de la molÃ©culas tipo dibenzotiofeno. Las bajas actividades reportadas se deben posiblemente a que las nanopartÃ­culas sintetizadas sufrieron cambios importantes durante la reacciÃ³n de HDS, evidenciado especÃ­ficamente con el Mo para todos los catalizadores, para dar lugar a la formaciÃ³n de especies tÃ­picas de MoS2 en forma laminar (\"slabs\"). La selectividad tambiÃ©n fue discutida aunque cualitativamente, ya que no se generaron suficientes productos como para ser cuantificados, resultado que fue mÃ¡s marcado para molÃ©culas sustituidas.','2009-10-28','HidrodesulfuraciÃ³n, nanopartÃ­culas, actividad catalÃ­tica, descomposiciÃ³n tÃ©rmica',6,1,1,1,1,'2013-09-17 08:27:39','2013-09-17 08:27:39','Documento_227.pdf','application/pdf',36253801,'2013-09-17 08:27:39',20,0,227,'COMPLETO'),(227,'CORRELACIÃ“Ã“NN DELd1188O,, SUSCEPTIBILIDAD MAGNÃ‰Ã‰TTICA Y COCIENTE S,, EN EL POZO SALTARÃÃNN 11A ((COLOMBIA)),, USANDO REDES NEURONALES DIFUSAS','En el presente trabajo se busca establecer mediante el uso de la tÃ©cnica computacional de redes neuronales difusas (RND), la posible relaciÃ³n entre los valores globales de d18O obtenidos de foraminÃ­feras bÃ©nticas y los valores de dos parÃ¡metros magnÃ©ticos de cociente S (CS) y susceptibilidad magnÃ©tica (c) medidos a un nÃºmeros de muestras del pozo SaltarÃ­n 1A, ubicado en la Cuenca Sedimentaria de los Llanos Orientales de Colombia. Para llevar a cabo las pruebas computacionales debimos asociar los valores de CS, c y d18O, para esto se realizaron estudios bioestratigrÃ¡ficos entre los estudios que realizamos se encuentra el estudio de foraminÃ­feros y palinologÃ­a. Sin embargo, a partir de estos estudios no logramos establecer las edades de las muestras por lo que debimos asumir la hipÃ³tesis de una tasa de sedimentaciÃ³n constante entre dos amarres de edades disponibles, los cuales sitÃºan al tope del Mioceno Inferior a 305 metros y al tope del Mioceno Medio a 610 metros de profundidad aproximadamente. El sistema difuso fue construido considerando tres combinaciones de datos de entradas: d18O - CS, d18O - c, d18O - CS - c; esto se realizÃ³ con el fin de determinar la influencia de cada parÃ¡metro sobre los valores del d18O inferidos. ObteniÃ©ndose la mejor inferencia mediante la combinaciÃ³n de valores de entrada d18O - CS - c, con ecuaciones del tipo: d18O = a CS + b c + c. Debido a que asumimos una tasa de sedimentaciÃ³n constante, decidimos dividir los datos en cuatro secciones de espesores iguales (en profundidad), con la finalidad de estimar cuÃ¡n realista resulta esta consideraciÃ³n. EncontrÃ¡ndose que la inferencia desmejora a en la Ãºltima secciÃ³n, esto puede deberse a que en esta secciÃ³n existe una gran densidad de superficies de erosiÃ³n, indicÃ¡ndonos que gran parte de la continuidad en la secuencia estratigrÃ¡fica se ha perdido. Resultando asÃ­ inadecuada la hipÃ³tesis de una tasa de sedimentaciÃ³n constante, la cual podrÃ­a estar influyendo negativamente en la inferencia.','2009-10-20','{}',3,1,1,1,1,'2013-09-17 08:27:42','2013-09-17 08:27:42','Documento_228.pdf','application/pdf',2448633,'2013-09-17 08:27:42',20,0,162,'COMPLETO'),(228,'InterpretaciÃ³n FÃ­sica de los Escalares de Estructura','Se estudia la evoluciÃ³n de fluidos esfÃ©ricamente simÃ©tricos, no disipativos y localmenteanisÃ³tropos, en el contexto de la Relatividad General, usando los escalares de es-tructura obtenidos a partir de la descomposiciÃ³n ortogonal del tensor de Riemann.Se analizan dos soluciones de fluidos esfÃ©ricamente simÃ©tricos en evoluciÃ³n lenta y laapariciÃ³n de fracturas en dos modelos de fluidos de densidad de energÃ­a inhomogÃ©nea,cuyo estudio se enfoca en dar una interpretaciÃ³n fÃ­sica de los escalares de estructuraYT e YTF . Los resultados obtenidos ponen en evidencia la relevancia fÃ­sica de dichosescalares.','2009-10-02','Escalares de estructura, fluidos relativistas, anisotropos',3,1,1,1,1,'2013-09-17 08:27:45','2013-09-17 08:27:45','Documento_229.pdf','application/pdf',0,'2013-09-17 08:27:45',19,0,0,'INCOMPLETO'),(229,'\"\"ESTUDIO DE LA INFLUENCIA DEL PERSULFATO Y DEL MONOPERSULFATO DE POTASIO EN LA DEGRADACIÃ“Ã“NN DE GELES DE POLIACRILAMIDA\"\"..','Geles de poliacrilamida entrecruzados con una mezcla de fenol - formaldehÃ­do y otros entrecruzados con una mezcla de melamina formaldehÃ­do, fueron sometidos a reacciones de degradaciÃ³n empleando persulfato de potasio (K2S2O8) y monopersulfato de potasio (2KHSO5 o KHSO4 o K2SO4) como agentes degradantes. Estas degradaciones fueron monitoreadas mediante reometrÃ­a dinÃ¡mica, empleando geometrÃ­a placa - placa, determinando el mÃ³dulo de almacenamiento (GÂ´) en funciÃ³n del tiempo de degradaciÃ³n, observÃ¡ndose que las curvas de degradaciÃ³n presentan una tendencia exponencial. Los sistemas de degradaciÃ³n quÃ­mica sometidos a estudio presentan dependencia de distintos factores como lo son: El agente degradante empleado, el pH de dicho agente degradante, la estructura quÃ­mica del gel y su morfologÃ­a, por lo que todas estas variables fueron objeto de estudio. El pH del agente degradante ejerce cierta influencia sobre los geles de poliacrilamida entrecruzados con fenol - formaldehÃ­do, adicional al hecho de que el persulfato de potasio se descompone tÃ©rmicamente siguiendo distintos mecanismos dependiendo del pH del medio. Por otro lado, el monopersulfato de potasio resulta ser tan efectivo como el persulfato de potasio en la degradaciÃ³n de estos geles cuando el pH inicial del agente degradante no es cambiado (pH inicial =2,4). Los estudios de morfologÃ­a fueron realizados mediante microscopÃ­a electrÃ³nica de barrido (MEB), observÃ¡ndose para ambos sistemas de geles, que las formulaciones sellantes son mucho menos porosas que las formulaciones no sellantes, las cuales difieren entre sÃ­ en el grado de entrecruzamiento. Adicionalmente, se realizÃ³ la caracterizaciÃ³n de los productos de degradaciÃ³n extraÃ­bles del medio de reacciÃ³n, asÃ­ como de los reactivos de partida para la sÃ­ntesis de los geles, mediante espectrometrÃ­a infrarroja (FTIR), RMN1H y RMN13C.','2009-10-29','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',6,1,1,1,1,'2013-09-17 08:27:46','2013-09-17 08:27:46','Documento_230.pdf','application/pdf',537763,'2013-09-17 08:27:46',19,0,108,'COMPLETO'),(230,'Efecto de las emulsiones asfalticas sobre las propiedades fisico-quimicas y aguas lixiviadas de un suelo de sabana','Se determino el efecto que causan las emulsiones asfalticas sobre las propiedades fÃ­sicas, quÃ­micas y bio-quÃ­micas del suelo de sabana de Santa BÃ¡rbara - Edo. Monagas, y el efecto que causa al combinar este suelo con fertilizantes orgÃ¡nicos e inorgÃ¡nicos y cal agrÃ­cola. AdemÃ¡s de como estas emulsiones afectan las propiedades de pH, conductividad electrica, turbidez, %aceites y grasas, y metales lixiviadas en las aguas lixiviadas de este suelo.','2009-10-30','suelo, sabana, Edo. Monagas, emulsiones asfalticas',6,1,1,1,1,'2013-09-17 08:27:47','2013-09-17 08:27:47','Documento_231.pdf','application/pdf',0,'2013-09-17 08:27:47',19,0,0,'INCOMPLETO'),(231,'CaracterizaciÃ³n geoquÃ­mica de una secciÃ³n de rocas carbonÃ¡ticas con intrusiÃ³n de un dique de textura pegmatÃ­tca presente en Guacuripia, Estado BolÃ­var.','En este trabajo de investigaciÃ³n se lleva a cabo la caracterizaciÃ³n geoquÃ­mica de cinco especÃ­menes de rocas carbonÃ¡ticas, compuestas principalmente por mÃ¡rmol dolomÃ­tico, haciendo Ã©nfasis en la determinaciÃ³n de la composiciÃ³n quÃ­mica y mineralÃ³gica de las muestras de roca recolectadas. El muestreo se realizÃ³ en el afloramiento de una secciÃ³n de posible edad precÃ¡mbrica correspondiente a la FormaciÃ³n Guacuripia, Provincia de Imataca en el estado BolÃ­var.El tratamiento de las muestras consistiÃ³ en la preparaciÃ³n de secciones finas, pulverizaciÃ³n y disoluciÃ³n para realizar anÃ¡lisis petrogrÃ¡ficos, mineralÃ³gicos y quÃ­micos de los elementos Ca, Mg, Mn, Al, Fe, Si, Ni, Ti, Cu, Zn, Co, Rb, Sr, Pb y Ba.Los anÃ¡lisis quÃ­micos y mineralÃ³gicos de las muestras de roca, indican que para el caso de la muestra SMGR- I, SMGR- II y SMGR- IV, su composiciÃ³n quÃ­mica es alta en los elementos Ca, Mg, Mn y Fe, siendo sus concentraciones promedio de 165000 ppm, 70000 ppm, 8000 ppm y 7000 ppm respectivamente, y se asocian mineralÃ³gicamente a un mÃ¡rmol dolomÃ­tico donde pudieron haber operado procesos tanto de dolomitizaciÃ³n como dedolomitizaciÃ³n que de alguna forma se ven influenciados por el metamorfismo, en el caso de la muestra SMGR- III la composiciÃ³n mineralÃ³gica es de tipo granÃ­tica y estÃ¡ asociada a una intrusiÃ³n tipo dique pegmatÃ­tico, y para el caso de la SMGR- V corresponde a la capa superior cuya composiciÃ³n es de tipo silicatado y se diferencia de la muestra SMGR- III en textura, la cual es mÃ¡s fina en este espÃ©cimen y tambiÃ©n por la presencia de fases minerales distintas, ambas muestras presentan altas concentraciones de los elementos Si y Al principalmente, su presencia dentro del afloramiento obedece a la interacciÃ³n de fluidos con la roca que se consolidaron rellenando cavidades y fracturas.Los resultados derivados de la investigaciÃ³n indican un posible origen sedimentario para estas rocas que han sido sometidas a procesos asociados como dolomitizaciÃ³n y dedolomitizaciÃ³n, asÃ­ como un proceso de metamorfismo regional donde localmente se presenta un ensamblaje mineralÃ³gico de dolomita, calcita, diÃ³psido y cuarzo que permite ubicar la secciÃ³n en un grado bajo.','2009-09-14','MÃ¡rmol dolomÃ­tico, carbonÃ¡tica, Guacuripia, Provincia de Imataca.',4,1,1,1,1,'2013-09-17 08:27:48','2013-09-17 08:27:48','Documento_232.pdf','application/pdf',1236570,'2013-09-17 08:27:48',19,0,102,'COMPLETO'),(232,'EVALUACIÃ“N DE LA HOMOGENEIDAD QUÃMICA DE ALGUNOS ELEMENTOS MAYORITARIOS, MINORITARIOS Y TRAZA, EN LA MUESTRA COMPUESTA DE ARCILLITAS DE FALCÃ“N MCAF, PROPUESTA COMO MATERIAL DE REFERENCIA','En el presente estudio se evaluÃ³ la homogeneidad quÃ­mica de los elementos Al, Na, Mg, Mn, P, Co, Cr, Cu, V, Zn, U, Th y Zr en la Muestra Compuesta de Arcillitas de FalcÃ³n (MCAF) mediante las pruebas estadÃ­sticas ANOVA de un factor y \"homogeneidad suficiente\", esta Ãºltima descrita por Fearn y Thompson (2001)(1); ambas para un P == 00,,0055. Ã‰stas pruebas se aplicaron a los datos de concentraciÃ³n de los elementos en estudio, los cuales fueron obtenidos empleando las tÃ©cnicas analÃ­ticas de espectrometrÃ­a de emisiÃ³n Ã³ptica acoplado inductivamente a plasma (EEO-AIP) y emisiÃ³n atÃ³mica a llama (EEA) para el caso del Na. Los resultados obtenidos indicaron que los elementos propuestos presentan homogeneidad quÃ­mica en la muestra a excepciÃ³n del Co y Zn, los cuales tienen asociados los valores mÃ¡s altos de incertidumbre y de los cuales se obtuvo poca reproducibilidad en las medidas, siendo por lo tanto considerados como datos no recomendados. Las fases minerales presentes en la muestra se determinaron mediante la tÃ©cnica de difracciÃ³n de rayos X (DRX), obteniÃ©ndose a travÃ©s de este anÃ¡lisis los minerales cuarzo, anatasa, yeso y las arcillas caolinita, illita y montmorillonita.','2009-10-16','material de referencia, arcillita, homogeneidad quÃ­mica, muestra compuesta, falcÃ³n',4,1,1,1,1,'2013-09-17 08:27:49','2013-09-17 08:27:49','Documento_233.pdf','application/pdf',1556556,'2013-09-17 08:27:49',19,0,128,'COMPLETO'),(233,'ESTUDIOS DE LA HIDRÃ“LISIS Y LA FORMACIÃ“N DE COMPLEJOS DE NÃQUEL (II) CON LOS ÃCIDOS OX