a cantidad (gramos) del producto obtenido en una relaciÃ³n molar Si/Ti= 1 y Si/Ti= 2 respectivamente, las mezclas Catalizador/TMS/MMAO (MÃ©todo A) y MMAO/TMS/Catalizador(MÃ©todo B) arrojaron valores similares. Los complejos sintetizados fueron el Ti(OSi(CH3)3)4 y Cp*2Ti (OSi(CH3)3)2 obteniÃ©ndose una disminuciÃ³n en la cantidad del producto en comparaciÃ³n con el valor de referencia. El complejo Cp*2Ti(OSi (CH3)3)2fue sintetizado al hacer reaccionar el Cp*2TiCl2 con la sal TMSNa en una relaciÃ³n 1:2 (Ti: Si) empleando diclorometano como solvente, la reacciÃ³n fue realizada a temperatura ambiente (24Â°C), bajo agitaciÃ³n constante durante un tiempo de 24 horas obteniÃ©ndose un rendimiento porcentual del 62%. La especie Cp2Ti(OSi(CH3)3)Cl no se logrÃ³ sintetizar, debido a que la especie obtenida fue el Ti(OSi(CH3)3)4al hacer reaccionar el catalizador Cp2TiCl2 con la sal TMSNa en una relaciÃ³n 1:1 (Ti: Si) bajo agitaciÃ³n constante por un tiempo de 4 horas y a temperatura ambiente (24Â°C), el rendimiento porcentual fue del 60%. Estos productos fueron caracterizados por espectroscopÃ­a IRFT y RMN 1H. La soluciÃ³n de los catalizadores comerciales fueron puesta en contacto con el TMS (diferentes relaciones Si/Ti) por 10 min, consecutivamente fue adicionado el MMAO, (MÃ©todo A) Ã³, el TMS fue agregado al cocatalizador y culminado un tiempo de 10 min fue adicionado el catalizador (MÃ©todo B); en el caso de los complejos sintetizados fueron agregados en soluciÃ³n y activados con MMAO. Las mezclas de reacciÃ³n fueron envejecidas por 10 min y posteriormente fue adicionado el 1-undeceno, las reacciones fueron realizadas bajo atmÃ³sfera inerte a una temperatura de 80Â°C por un tiempo de 24 horas, empleando tolueno como solvente. Transcurrido las 24 horas las reacciones fueron detenidas aÃ±adiendo HCl al 5%, la fase orgÃ¡nica fue extraÃ­da y secada con sulfato de sodio anhidro, los productos eran lÃ­quidos solubles en tolueno, por lo que fueron obtenidos al evaporar el solvente a presiÃ³n reducida y caracterizados mediante las tÃ©cnicas de IRFT y RMN1H. La sÃ­ntesis del TMS fue realizada bajo el mÃ©todo de hidrÃ³lisis en dos fases, utilizando como compuesto de partida el CTMS. La fase acuosa estuvo constituida por agua saturada con NaCl y (NH4)2CO3 como aceptor Ã¡cido y la fase orgÃ¡nica por dietilÃ©ter. La reacciÃ³n fue llevada a cabo bajo agitaciÃ³n constante y a una temperatura por debajo de los 0Â°C (en baÃ±o de hielo) por un tiempo de 30 minutos. Finalizado el tiempo de reacciÃ³n, la fase orgÃ¡nica fue lavada con dietilÃ©ter y secada con sulfato de sodio anhidro, finalmente el producto fue obtenido por destilaciÃ³n fraccionada y caracterizado mediante la tÃ©cnica IRTF. La sÃ­ntesis de TMSNa fue llevada a cabo al hacer reaccionar HMDS y NaOH en tolueno como solvente, la mezcla de reacciÃ³n fue agitada vigorosamente en reflujo durante 72 horas. El producto fue obtenido al evaporar el tolueno a presiÃ³n reducida, lavado varias veces con CH2Cl2y caracterizado mediante las tÃ©cnicas de IRTF y RMN1H. La influencia del TMS en las reacciones de polimerizaciÃ³n del 1-undeceno empleando los sistemas catalÃ­ticos metaloceno/ MMAO no se logrÃ³ determinar debido a que el monÃ³mero empleado no era el adecuado para los sistemas catalÃ­ticos descritos, no se obtuvo un polÃ­mero como producto, posiblemente ocurriÃ³ la metilaciÃ³n del monÃ³mero, para dar lugar al dodecano. El catalizador y el TMS parecen no intervenir en la reacciÃ³n, la posible metilaciÃ³n serÃ­a realizada por el MMAO.','2009-10-27','SILANOL, METALOCENOS, MAO, POLIMERIZACIÃ“N DE OLEFINAS.',6,1,1,1,1,'2013-09-17 08:27:56','2013-09-17 08:27:56','Documento_236.pdf','application/pdf',2493772,'2013-09-17 08:27:56',20,0,133,'COMPLETO'),(236,'ImplementaciÃ³n de un dispositivo integrado de seguridad UTM y evaluaciÃ³n de la factibilidad de su configuraciÃ³n a travÃ©s de la metodologÃ­a de intrusiÃ³n LPT','El presente Trabajo Especial de Grado consiste en evaluar la factibilidad de la configuraciÃ³n de un UTM (Unified Threat Management) Firebox 750e Watchguard, el cual permite la administraciÃ³n de la red y proporciona seguridad a la misma, a travÃ©s de la metodologÃ­a de intrusiÃ³n LPT (Licensed Penetration Tester). El fuerte de los dispositivos UTM es la integraciÃ³n de los diferentes servicios de seguridad en un solo dispositivo, mediante el cual se provee de manera centralizada la seguridad y administraciÃ³n de la red, facilitando la labor del administrador de red y del analista de seguridad. Es importante acotar que la instalaciÃ³n y configuraciÃ³n descritas en el T.E.G. son genÃ©ricas para cualquier dispositivo UTM de la marca Watchguard. El trabajo se inicia con un estudio teÃ³rico de los aspectos mÃ¡s relevantes que se deben tomar en consideraciÃ³n en lo que a seguridad informÃ¡tica se refiere y un anÃ¡lisis de las tÃ©cnicas mÃ¡s comunes utilizadas por los hackers. Para la instalaciÃ³n del dispositivo se utilizan las recomendaciones del fabricante y para su configuraciÃ³n se toma en cuenta la polÃ­tica de uso de internet de la instituciÃ³n y sus requerimientos en cuanto al servicio. Se aplica la metodologÃ­a LPT al dispositivo para verificar la factibilidad de la configuraciÃ³n del UTM. Los dispositivos UTM brindan protecciÃ³n de Firewall convencional, protecciÃ³n AAntispam - Antiphishing - Filtro de contenidos - Antivirus y DetecciÃ³n/PrevenciÃ³n de Intrusos IDS (Intrusion Detection System) / IPS (Intrusion Prevention System)). Estos dispositivos tambiÃ©n permiten la creaciÃ³n de redes VPN (Virtual Private Network), utilizar protocolos de ruteo, traducciones de direcciones y registro delogs, entre otros. La metodologÃ­a para pruebas de intrusiÃ³n LPT es propia de la casa de consultores de seguridad EC Council, la cual define una serie de pasos para probar la seguridad de diferentes equipos, aplicaciones y entornos de trabajo.','2009-10-29','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:27:58','2013-09-17 08:27:58','Documento_237.pdf','application/pdf',1838166,'2013-09-17 08:27:58',20,0,83,'COMPLETO'),(237,'\"Fotoelectro-oxidaciÃ³n de fenoles\"','Estudiar la fotooxidaciÃ²n de el p-metoxifenol y el p-nitrofenol, mediante la reacciÃ²n de transferencia de oxigeno relacionado con los fenomenos que ocurren en la superficie del electrodo, utilizando tecnicas hidrodinamica de disco- anillo, asi como estudiar las propiedades del semiconductor TiO2.','2009-10-28','fotooxidaciÃ³n oxidaciÃ³n p-metoxifenol y p-nitrofenolsemiconductor tipo-n',6,1,1,1,1,'2013-09-17 08:27:59','2013-09-17 08:27:59','Documento_238.pdf','application/pdf',4375107,'2013-09-17 08:27:59',20,0,109,'COMPLETO'),(238,'RESPUESTA DEL FITOPLANCTO AL ENRIQUECIMIENTO CON NITRÃ“GENO Y FÃ“SFORO EN COSMO EN EL GOLFETE DE CUARE, ESTADO FALCÃ“N','Los cambios en las concentraciones de N y P en los cuerpos de agua pueden afectar la estructura de su comunidad fitoplanctÃ³nica. Estas concentraciones pueden variar por procesos naturales y con mayor frecuencia se incrementan por actividades antropogÃ©nicas. Este incremento en la concentraciÃ³n de dichos elementos provoca el deterioro de la calidad del agua en las costas marinas, estuarinas, lagunas costeras, etc., originÃ¡ndose un proceso de eutrofizaciÃ³n. Este trabajo intenta evaluar la respuesta del fitoplancton de una localidad en la boca del Golfete de Cuare, Estado FalcÃ³n, a la adiciÃ³n de estos nutrientes (N y P); el tiempo de respuesta del fitoplancton al aumento de N y P; determinar los cambios temporales al enriquecimiento con nutrientes en dos Ã©pocas del aÃ±o (sequÃ­a y lluvia). Se utilizÃ³ la modalidad de microcosmos. Se llenaron treinta (30) microcosmos de 10 L \"in situ\" con agua de la zona subsuperficial de la estaciÃ³n de muestreo, de los cuales quince (15) fueron enriquecidos una sola vez al inicio, triplicando las concentraciones iniciales de N y P reportadas para ese ambiente, utilizando soluciones de NH4Cl y KH2PO4, hasta una concentraciÃ³n final de 304 Âµg/L de P y de 2.181,5 Âµg/L de N, para una relaciÃ³n de 16:1. Los quince (15) microcosmos restantes se dejaron como controles. Las muestras de ambiente, microcosmos control y tratamiento se tomaron por triplicado durante cinco dÃ­as de muestreo en cada Ã©poca (sequÃ­a y lluvia). Las muestras se envasaron en botellas de polietileno de 1 L que se preservaron inmediatamente con lugol. En el laboratorio se sedimentaron submuestras de 10 mL en cÃ¡maras UtermÃ¶hl y se examinaron en el microscopio invertido para clasificar mediante claves taxonÃ³micas el fitoplancton presente hasta el nivel de especie. Los valores de las variables ambientales medidas no presentaron grandes cambios en las dos Ã©pocas (sequÃ­a y lluvia), por lo que se confirma el Golfete de Cuare como un ambiente estuarino estable. En el microcosmos enriquecido (N1P1) aumentÃ³ la abundancia, la diversidad tuvo una variaciÃ³n significativa para ambas Ã©pocas, y la riqueza aumentÃ³ para la Ã©poca de lluvia. El grupo de las Bacillariophyta presentÃ³ el mayor nÃºmero de especies y la mayor abundancia en todas las muestras, para ambas Ã©pocas. En la Ã©poca de sequÃ­a quedaron en orden descendente de riqueza, las Pyrrophyta y las Cyanophyta; e invirtiendo el orden para la Ã©poca de lluvia. Las Euglenophyta, Chromophyta y Chlorophyta, en orden decreciente, presentaron las menores riquezas y abundancias para la Ã©poca de lluvia.','2009-07-15','FITOPLANCTON, ENRIQUECIMIENTO, FÃ“SFORO, NITRÃ“GENO, COSMOS, ESTUARIO',1,1,1,1,1,'2013-09-17 08:28:04','2013-09-17 08:28:04','Documento_239.pdf','application/pdf',34369844,'2013-09-17 08:28:04',16,0,131,'COMPLETO'),(239,'Estructura fÃ­Ã­sica y biolÃ³Ã³ggica del componente arbÃ³Ã³rreo de lacomunidad de plantas de un bosque hÃºÃºmmedo premontano,, de laReserva EcolÃ³Ã³ggica GuÃ¡Ã¡quira,, en el Macizo de Nirgua,,Edo.. Yaracuy,, Venezuela..','Los sistemas forestales mÃ¡s perjudicados con la actividad antrÃ³picacorresponden a bosques que se localizan a bajas altitudes. Por consiguiente se realizÃ³una caracterÃ­zaciÃ³n empleando criterios fisionÃ³micos y florÃ­sticos de los estratosarbÃ³reos del Bosque hÃºmedo, localizado aproximadamente a 155 m s.n.m.El muestreo fuÃ© estratificado y sistemÃ¡tico En un Ã¡rea de 1/2 ha, seestablecieron 5 parcelas de 20x 50 m, y se subdividieron en 10 subparcelas de 100 m2cada una, considerando a los individuos leÃ±osos con un diÃ¡metro a la altura del pechomayor o igual a 5 cm. Se describiÃ³ la forma de la copa, la altura de los individuos y lascaracterÃ­sticas mÃ¡s resaltantes de tallos y hojas, se codificaron los individuos y lasespecies fueron identificadas posteriormente.Se registraron un total de 23 familias conocidas y aproximadamente 61 especiesdiferentes. La forma de vÃ­da predominante son mesofanerofitas con hojas simples ypecioladas, mesÃ³filas, con igual proporciÃ³n de Ã¡pices agudos y acuminados. Sedefinieron tres estratos arbÃ³reos considerando la abundancia de individuos tanto porclases diamÃ©tricas como por clases de altura. El primero de los estratos (estrato medio)registrÃ³ la mayor abundancia absoluta, tanto de especies como de individuos, losindividuos presentaron alturas menores a los 13 m y dap entre 5 y 15 cm, dominado porGustavia augusta L, el segundo de los estratos , estÃ¡ formado por individuos cuyasalturas estÃ¡n comprendidas entre 13 y 20 m y dap entre 15-30 cm dominado porPouteria trilocularis y el tercer estrato, estÃ¡ formado principalmente por individuos dealturas mayores a 20 m y de dap mayores a 30 cm dominado por PseudopiptadeniaPittieri (Harms). a lo largo de esta estratificaciÃ³n vertical de la vegetaciÃ³n la diversidaddisminuye y la equidad aumenta en funciÃ³n de las alturas de los estratos.','2009-09-04','Bosque hÃºmedo tropical, Reserva EcolÃ³gica GuÃ¡quira, diÃ¡metroa la altura del pecho (dap), criterios fisionÃ³micos, florÃ­stica.',1,1,1,1,1,'2013-09-17 08:28:11','2013-09-17 08:28:11','Documento_240.pdf','application/pdf',1236946,'2013-09-17 08:28:11',17,0,87,'COMPLETO'),(240,'ImplementaciÃ³n y Mejoramiento de TÃ©cnicas SerolÃ³gicas para la OptimizaciÃ³n del DiagnÃ³stico de Arbovirus en la SecciÃ³n de InmunoserologÃ­a Viral del Instituto Nacional de Higiene Rafael Rangel \"INHRR\"','RESUMENImplementaciÃ³Ã³nn y Mejoramiento de TÃ©Ã©cnicas SerolÃ³Ã³ggicas para la OptimizaciÃ³Ã³nn del Diagnostico de Arbovirus en la SecciÃ³Ã³nn de InmunoserologÃ­Ã­a viral del instituto Nacional de Higiene Rafael Rangel..Las tÃ©cnicas serolÃ³gicas constituyen una herramienta imprescindible en el diagnÃ³stico virolÃ³gico y se les confiere esta importancia por lo difÃ­cil que resulta en la mayorÃ­a de los casos lograr el diagnostico por aislamiento viral (VÃ¡zquez y col, 1968). La TÃ©cnica de NeutralizaciÃ³n por ReducciÃ³n en Placas (PRNT), ha sido usada por mÃ¡s de 30 aÃ±os, para medir anticuerpos neutralizantes contra flavivirus, los cuales son virus que se encuentran clasificados dentro de la familia Flaviviridae, a la cual pertenece el virus de la fiebre amarilla y del dengue. Estos virus son transmitidos a travÃ©s de mosquitos (Putnak y col, 2008). A fin de Implementar la PRNT en el Laboratorio de InmunoserologÃ­a Viral del Instituto Nacional de Higiene Rafael Rangel (INHRR), fueron comparados los parÃ¡metros, sensibilidad y especificidad, de la PRNT, cuya tÃ©cnica es novedosa en esta instituciÃ³n, con los de la tÃ©cnica patrÃ³n, InhibiciÃ³n de la HemaglutinaciÃ³n (I.H), que se usa de rutina en esta SecciÃ³n del INHRR. Se analizaron 48 muestras de sueros de pacientes, separadas por grupos: 13 pares de muestras de sueros (constituidas por una muestra aguda y una convaleciente), 20 muestras de sueros Ãºnicos, en fase aguda y 15 muestras de sueros Ãºnicos, en fase convaleciente. Para el desarrollo del mÃ©todo de la PRNT, se amplificÃ³ semilla viral de la cepa vacunal del virus de la fiebre amarilla y de una cepa local de los serotipos 1 y 2 del dengue, en las lÃ­neas celulares Vero E6 y C6/36 HT, respectivamente. Se titularon las semillas virales, la de fiebre amarilla en Vero E6 y las del dengue en Vero NK, empleando el mÃ©todo semilÃ­quido de plaqueo tradicional, con carboximetilcelulosa (CMC). Por su parte, para el desarrollo del mÃ©todo de la I.H, se produjeron antÃ­genos virales de los serotipos 1 y 2 del dengue, a partir de las mismas cepas locales amplificadas en C636/HT, en cerebro de ratÃ³n lactante y se extrajeron empleando el mÃ©todo de la acetona-sacarosa de Clarke y Casals,ix1958. Se encontrÃ³, segÃºn los anÃ¡lisis de residuales estandarizados para una tabla de contingencia de dos vÃ­as, con los cuatro grupos de muestras de sueros analizadas, que la PRNT tendiÃ³ a ser igualmente sensible, pero mucho mÃ¡s especÃ­fica que la I.H. En cuanto a los resultados serolÃ³gicos, todas las muestras, en cada uno de los grupos, tuvieron tÃ­tulos elevados de anticuerpos hacia los dos serotipos del virus dengue por PRNT, similar al que presentÃ³ el control positivo hacia Den-1. Por I.H todas las muestras resultaron tener anticuerpos hacia los dos serotipos del dengue, tan o mÃ¡s elevados como el control positivo. EncontrÃ¡ndose una relaciÃ³n entre los niveles elevados de anticuerpos detectados por l.H y la sensibilidad que presenta esta tÃ©cnica para detectar anticuerpos contra cualquier flavivirus. Lo que se corresponde con los resultados de sensibilidad para esta tÃ©cnica, obtenidos previamente por AnÃ¡lisis de Residuales Estandarizados. La tÃ©cnica PRNT, fue capaz de discernir entre infecciÃ³n por dengue de infecciÃ³n por fiebre amarilla, con cada grupo de muestras de suero, por lo que es posible que el diagnostico de estos arbovirus, sea optimizado prÃ³ximamente, en el Laboratorio de InmunoserologÃ­a Viral del INHRR.','2009-07-06','{}',1,1,1,1,1,'2013-09-17 08:28:14','2013-09-17 08:28:14','Documento_241.pdf','application/pdf',4383181,'2013-09-17 08:28:14',18,0,138,'COMPLETO'),(241,'DeterminaciÃ³n de los polimorfismos: + 647 G>C en el gen del Receptor de Glucocorticoide y -159 C>T en el gen de CD14, en pacientes con Asma y Enfermedad Obstructiva CrÃ³nica (EPOC)','El Asma y la Enfermedad Pulmonar Obstructiva CrÃ³nica (EPOC) son enfermedades respiratorias que se originan por un proceso inflamatorio crÃ³nico; ambas patologÃ­as se caracterizan por ser complejas, y resultan de la interacciÃ³n de mÃºltiples agentes ambientales con diversos genes. Se conoce que un nÃºmero importante de pacientes es resistente a los efectos de glucocorticoides y se desconoce las razones; por ello, la importancia de analizar los polimorfismos del gen del receptor de Glucocorticoide y las pruebas funcionales para ensayarlo. Diversos investigadores han indicado que algunos polimorfismos de tipo SNP (polimorfismos de nucleÃ³tido simple), han sido asociados con el desarrollo de Asma y EPOC, uno de ellos en el gen del Receptor de Glucocorticoide (GR), el cual esta definido a +647 pb en el intrÃ³n 2 y consiste en la transversiÃ³n de una Guanina (G) por una Citosina (C). Por otro lado, el CD14 es una glicoproteÃ­na expresada en la membrana de mastocitos, macrÃ³fagos, que actÃºa como receptor de componentes bacterianos como LipopolisacÃ¡ridos (LPS).Uno de los polimorfismos en la regiÃ³n promotora del gen de CD14, estÃ¡ definido a -159 pb del sitio de inicio de la transcripciÃ³n, y consiste en la transiciÃ³n de una Citosina (C) por una Timina (T). El objetivo de nuestra investigaciÃ³n fuÃ©: estudiar la posible asociaciÃ³n entre la presencia de las variantes alÃ©licas de estos dos polimorfismos, con el desarrollo y severidad de Asma y EPOC, en comparaciÃ³n con sujetos controles (sin enfermedades respiratorias). Para ello, se realizÃ³ la amplificaciÃ³n de los segmentos de interÃ©s en cada polimorfismo por PCR y luego el corte con enzimas de restricciÃ³n especÃ­ficas. Al mismo tiempo se analizÃ³ en dichos pacientes, tanto la funciÃ³n del receptor LPS-CD14-TLR-4 en ensayos biolÃ³gicos in vitro deactivaciÃ³n celular, como la funciÃ³n del Receptor de Glucocorticoide, mediante la producciÃ³n o inhibiciÃ³n inducida por LPS, de TNF-a y radicales O2-. Se observÃ³ que la presencia de los genotipos del polimorfismo en el gen del GR, difieren significativamente de lo reportado para la poblaciÃ³n caucasoide control (p < 0,01), y de lo reportado para Asma y EPOC en dicha raza. Por su parte, entre las variantes alÃ©licas del polimorfismo de CD14, no se obtuvieron diferencias significativas. En las pruebas funcionales, no se hallÃ³ asociaciÃ³n directa entre los genotipos de los polimorfismos estudiados, y la respuesta celular a dexametasona y sus anÃ¡logos (ginsenoides). Se concluye que la resistencia farmacolÃ³gica a los esteroides depende de varios mecanismos de respuesta celular que, en principio, no estÃ¡n directamente asociados con las variantes genotÃ­picas de los dos polimorfismos SNP estudiados.','2009-10-21','Asma, EPOC, gen del Receptor de Glucocorticoide, gen de CD14',1,1,1,1,1,'2013-09-17 08:28:15','2013-09-17 08:28:15','Documento_242.pdf','application/pdf',1904667,'2013-09-17 08:28:15',17,0,93,'COMPLETO'),(242,'CARACTERIZACIÃ“Ã“NN MOLECULAR DEPhytophthorasp.ASOCIADAS AL CACAO(Theobroma cacao L) EN VENEZUELA..','RESUMEN..El cacao, Theobroma cacao L., es un cultivo tradicional en Venezuela. Nuestro paÃ­s, a pesar de poseer genotipos de excelente calidad, presenta bajos rendimientos por hectÃ¡rea, siendo uno de los factores limitantes mÃ¡s importantes, la incidencia de enfermedades. Algunas especies del gÃ©nero Phytophthora causan en cacao la enfermedad llamada \"pudriciÃ³n parda de la mazorca\" que provoca pÃ©rdidas econÃ³micas en todo el territorio nacional. En sentido general, existe un desconocimiento de las especies asociadas a la esta y de su variabilidad genÃ©tica. El objetivo de este trabajo fue la identificaciÃ³n mediante tÃ©cnicas moleculares de aislados asociados a sÃ­ntomas de la enfermedad de diferentes regiones productoras de cacao del paÃ­s y la caracterizaciÃ³n de los mismos con marcadores AFLP e ISSR con el objetivo de observar su variabilidad genÃ©tica.Fueron identificados 25 aislados pertenecientes a la especie Phytophthora palmivora, presentes en los estados Aragua, Miranda, Carabobo y Zulia mediante la amplificaciÃ³n por PCR y posterior secuenciaciÃ³n de las regiones de los espaciadores internos transcritos del ADN ribosomal y su comparaciÃ³n con base de datos pÃºblicas. El anÃ¡lisis con los marcadores AFLP e ISSR mostrÃ³ muy baja variabilidad entre todos los aislados estudiados.','2009-10-26','{}',1,1,1,1,1,'2013-09-17 08:28:17','2013-09-17 08:28:17','Documento_243.pdf','application/pdf',4384313,'2013-09-17 08:28:17',20,0,95,'COMPLETO'),(243,'Aspectos de mecÃ¡nica cuÃ¡ntica relativista en dimensiones bajas','En este trabajo se consideran ciertos aspectos de la mecÃ¡nica cuÃ¡ntica relativista en (1+1) y (1+2) dimensiones. Nuestros objetivos principales han sido el estudio de las consecuencias de la invariancia de PoincarÃ© en estas dimensiones bajas y la construcciÃ³n de teorÃ­as cuÃ¡nticas de campos que satisfacen los axiomas de Wightman. En particular, verificamos que SL(2,R), contrariamente a su uso, no es simplemente conexo y por lo tanto no es el grupo de recubrimiento universal del grupo de Lorentz en (1+2). A demÃ¡s, construimos explÃ­citamente teorÃ­as cuÃ¡nticas de campos libres: (i) Campo escalar neutro y masivo, (ii) Campo escalar cargado y masivo, (iii) Campo de Dirac cargado y masivo, que satisfacen los axiomas de Wightman en (1+1). Uno de los resultados de esta construcciÃ³n es que no se satisface el teorema de espÃ­n-estadÃ­stica en (1+1). Este Ãºltimo resultado es consistente con la conocida bosonizaciÃ³n en (1+1).','2009-07-10','cuÃ¡ntica, campos, axiomÃ¡tica, Wightman, grupo de Poincare, bajas dimensiones',3,1,1,1,1,'2013-09-17 08:28:21','2013-09-17 08:28:21','Documento_244.pdf','application/pdf',2586815,'2013-09-17 08:28:21',20,0,103,'COMPLETO'),(244,'MecÃ¡nica cuÃ¡ntica en el espacio de Lobachevski','En este trabajo se estudian las consecuencias para la mecÃ¡nica cuÃ¡ntica de suponer que el espacio de configuraciÃ³n no es euclÃ­deo, sino hiperbÃ³lico. Nuestro objetivo principal en este trabajo ha sido la obtenciÃ³n de los observables bÃ¡sicos que describen la mecÃ¡nica cuÃ¡ntica de una partÃ­cula en espacio hiperbÃ³lico. El procedimiento de cuantizaciÃ³n, para obtener estos observables bÃ¡sicos, se realiza de manera geomÃ©trica (esto es, independiente de las coordenadas). En este caso, como el euclÃ­deo, los observables se obtienen de propiedades fundamentales de la geometrÃ­a hiperbÃ³lica (los vectores de Killing asociados a la mÃ©trica). El modelo de espacio hiperbÃ³lico usado es el del hiperboloide en espacio de Minkowski. Se considera, por completitud y para verificar resultados previos, el Ã¡tomo de hidrÃ³geno y el oscilador armÃ³nico en esta geometrÃ­a.','2009-06-26','cuÃ¡ntica, lobachevski, hiperbÃ³lico, geometrÃ­a, espacio curvo, killing',3,1,1,1,1,'2013-09-17 08:28:22','2013-09-17 08:28:22','Documento_245.pdf','application/pdf',1879881,'2013-09-17 08:28:22',20,0,97,'COMPLETO'),(245,'DETECCIÃ“Ã“NN DE INFECCIONES SENCILLAS Y MIXTAS POR Trypanosoma rangeli Y Trypanosoma cruzi EN MUESTRAS PROVENIENTES DE VECTORES DE DIFERENTES REGIONES DE VENEZUELA PRESERVADAS EN PAPEL FTA','Los parÃ¡Ã¡sitos Trypanosoma rangeli y Trypanosoma cruzi, son protozoarios de los subgÃ©nero Herpetosoma y Schyzotrypanum respectivamente, familia Trypanosomatidae, orden Kinetoplastida, que han sido descrito en gran parte del continente Americano, superponiendo en muchos casos su distribuciÃ³n geogrÃ¡fica; T.. cruzi, el agente etiolÃ³gico de la enfermedad de Chagas, comparte con T.. rangeli hospedadores vertebrados e invertebrados. Los hospedadores invertebrados de estos parÃ¡sitos son hemipteros hematÃ³fagos (triatominos), y son capaces de transmitir T.. rangeli al vertebrado durante la picadura y T.. cruzi por contacto con las heces. Las semejanzas morfolÃ³gicas y antigÃ©nicas entre estos parÃ¡sitos dificultan los procesos de detecciÃ³n, por lo cual se han desarrollado herramientas que permitan una mejor identificaciÃ³n de estas especies, asÃ­ como el estudio detallado de las variaciones intra-especifica. T.. rangeliha sido considerado un complejo biolÃ³gico con un grado significativo de polimorfismo genÃ©tico, que permite separarlo en sub-grupos (grupos A, B, C y D) de amplia distribuciÃ³n en hospederos vertebrados e invertebrados. Por su parte, en T.. cruzi se han descrito dos sub-grupos principales (linajes I y II). Estas muestras de diversidad genÃ©tica hacen de estas especies un objeto interesante de estudio. De aquÃ­ la importancia del anÃ¡lisis del mayor numero de aislados posibles, provenientes de diferentes regiones que permitan establecer las relaciones existentes entre estas sub-poblaciones a nivel biolÃ³gico y taxonÃ³mico.Con la finalidad de evaluar la distribuciÃ³n geogrÃ¡fica de estas especies y las sub-poblaciones que se encuentran circulando en vectores triatominos, utilizando ensayos de PCR especie-especÃ­ficos para T.. rangeli y T.. cruzi, nos proponemos evaluar la presencia de infecciones sencillas y mixtas en muestras de triatominos de captura y xenodiagnosticos de mamÃ­feros domÃ©sticos provenientes de diferentes regiones de Venezuela, recolectadas en papel FTA. En este trabajo se estandarizaron las condiciones de preservaciÃ³n y tratamiento de las muestras preservadas en papel FTA para su utilizaciÃ³n en anÃ¡lisis con PCR; la evaluaciÃ³n del nivel de sensibilidad de la tÃ©cnica mostrÃ³ una detecciÃ³n de hasta 5 parÃ¡sitos (0,5parasitos/ÂµL) colocados en un disco de papel FTA de 0,5cm. de diÃ¡metro. Con esta metodologÃ­a se analizaron 84 muestras de triatominos de captura provenientes de 76 triatominos capturados en zonas urbanas y rurales de los estados Sucre, Miranda, Vargas, Aragua y Distrito Capital, de los cuales un 84% pertenece al gÃ©nero Panstrongylus que en su mayorÃ­a fueron capturados en zonas urbanas. El 76% de triatominos evaluados resultaron positivos a infecciones por T.. cruzi, con prevalencia del linaje TCI (encontrado en el 55% de las muestras infectadas); no se detectaron triatominos infectados por T.. rangeli. 71 de las muestras de triatominos capturados fueron analizadas al microscopio de luz, observando tripanosomas en el 21%, mientras que con los anÃ¡lisis por PCR el 76% de estas mismas muestras fueron positivas a T.. cruzi. En las muestras provenientes de xenodiagnÃ³stico se detectÃ³ la presencia de infecciÃ³n por T.. cruzi en 45 muestras (63%), sugiriendo la contaminaciÃ³n de estas durante el proceso de toma.','2009-10-19','Trypanosoma cruzi, Trypanosoma rangeli, enfermedad de Chagas, identificaciÃ³n molecular, triatominos, papel FTA.',1,1,1,1,1,'2013-09-17 08:28:24','2013-09-17 08:28:24','Documento_246.pdf','application/pdf',2957965,'2013-09-17 08:28:24',19,0,126,'COMPLETO'),(246,'AdecuaciÃ³n a ambientes Grid de dos aplicaciones de ComputaciÃ³n de Alto DesempeÃ±o en el dominio de FÃ­sica de Altas EnergÃ­as y SimulaciÃ³n AtmosfÃ©rica','Hoy en dÃ­a, las aplicaciones operativas o en desarrollo aumentan drÃ¡sticamente la carga de trabajo de los computadores, exigiendoles mayores niveles de recursos para la ejecuciÃ³n de las mismas. La filosofÃ­a Grid , el alto poder de procesamiento que ofrecen hoy en dÃ­a muchos computadores y las altas capacidades de almacenamiento disponibles en la actualidad, ofrecen una soluciÃ³n viable para la soluciÃ³n de estos problemas. El termino Grid se refiere a una infraestruc-tura que permite la integraciÃ³n y el uso colectivo de computadores, redes y bases de datos que son propiedad y estÃ¡n administradas por diferentes instituciones. El modelo hidrometeorolÃ³gico BRAMS y el sistema de simulaciÃ³n AIRES son aplicaciones que requieren un alto poder de procesamiento, el objetivo principal de este trabajo es adaptar dichas aplicaciones a una plataforma Grid, en este caso de estudio se harÃ¡ uso de la plataforma instalada en el Centro de ComputaciÃ³n Paralela y Distribuida.','2009-11-02','Grid, gLite, BRAMS, AIRES',2,1,1,1,1,'2013-09-17 08:28:26','2013-09-17 08:28:26','Documento_247.pdf','application/pdf',1421994,'2013-09-17 08:28:26',20,0,83,'COMPLETO'),(247,'Estudio de la variaciÃ³n en la composiciÃ³n de minerales pesados con el tamaÃ±o de grano en los sedimentos de las cuencas de los rÃ­os Aro, Arizo, Pao y Orinoco, Venezuela.','La bÃºsqueda de las concentraciones de minerales pesados en los sedimentos aluviales es uno de los mÃ©todos mÃ¡s antiguos de prospecciÃ³n de yacimientos minerales. AsÃ­, los minerales pesados, ademÃ¡s de ser de gran interÃ©s por su importancia econÃ³mica, aportan informaciÃ³n a la prospecciÃ³n geoquÃ­mica y a la geoquÃ­mica ambiental. Por ello en el presente trabajo parcialmente financiado por FONACIT se estableciÃ³ como objetivo general determinar la variaciÃ³n de la composiciÃ³n de minerales pesados de diferentes fracciones granulomÃ©tricas en sedimentos de las cuencas de los rÃ­os Aro, Arizo, Pao y Orinoco. Para cumplir con esto las muestras de sedimentos fluviales se tamizaron para obtener sus distintas fracciones granulomÃ©tricas, fueron separados los minerales pesados de dichas fracciones a travÃ©s del sistema hidrodinÃ¡mico, luego se separaron magnÃ©ticamente con el isodinÃ¡mico Frantz y, parte del producto de estas separaciones, fue caracterizado mineralÃ³gicamente por difracciÃ³n de rayos X y sus elementos analizados cualitativamente por fluorescencia de rayos X. Con los anÃ¡lisis quÃ­micos y mineralÃ³gicos realizados en las distintas cuencas estudiadas se pudo evidenciar que los minerales pesados se encuentran distribuidos en distintas proporciones aumentando y disminuyendo en porcentaje en las distintas fracciones granulomÃ©tricas. Existe, en forma general una alta variabilidad de especies de minerales pesados en las fracciones de arenas gruesas y medias, mientras que en las arenas finas la variabilidad de especies de minerales pesados es menor y vuelve a aumentar en la fracciones de limos y arcillas. Dicha variabilidad en las especies minerales estÃ¡ acompaÃ±ada de la variabilidad en la composiciÃ³n quÃ­mica. Es posible diferenciar cuencas hidrogrÃ¡ficas de diverso orden, con el uso de la distribuciÃ³n de las especies minerales pesados y sus abundancias relativas en los diversos tamaÃ±os de grano de los sedimentos derivados de ellas.','2009-10-16','Minerales pesados,, sedimentos,, hidrodinÃ¡Ã¡mico,, cuencas hidrogrÃ¡Ã¡ficas,, Aro,, Arizo,, Pao,, Orinoco..',4,1,1,1,1,'2013-09-17 08:28:27','2013-09-17 08:28:27','Documento_248.pdf','application/pdf',2702679,'2013-09-17 08:28:27',17,0,145,'COMPLETO'),(248,'ESTUDIO DE LOS COMPLEJOS DE VANADIO(IV) Y LEUCINA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES (KCl 3.0 M, 25 ÂºC)','{}','2009-10-26','{}',6,1,1,1,1,'2013-09-17 08:28:27','2013-09-17 08:28:27','Documento_249.pdf','application/pdf',1839204,'2013-09-17 08:28:27',19,0,83,'COMPLETO'),(249,'DegradaciÃ³Ã³nn de las ProteÃ­Ã­nas en el Lomo de AtÃºÃºnn ((Tunnussp))Empacado con PelÃ­Ã­culas Comestibles y Almacenado a --1100 ÂºÂºC','El AtÃºn ((Thunnus sp) representa una especie de gran importancia comercial a nivel mundial, siendo consumido fresco en productos como el sushi y el ceviche, o procesado en productos como el surimi y en conservas. Por ser el pescado un alimento con gran aporte proteico y a la vez muy perecedero el procedimiento mÃ¡s comÃºnmente utilizado para su conservaciÃ³n fresco es la congelaciÃ³n, como medida preventiva del deterioro de origen microbiano y descomposiciÃ³n quÃ­mica, lo cual conlleva a la perdida de humedad, la rancidez de lÃ­pidos y a la desnaturalizaciÃ³n de proteÃ­nas. Otro mÃ©todo alternativo empleado en los procesos de conservaciÃ³n es el uso de empaques los cuales deben garantizar la estabilidad y prolongar la vida Ãºtil del producto que contiene, actuando como barrera protectora de microorganismos, gases, agentes quÃ­micos y mecÃ¡nicos.En la actualidad se han venido desarrollando empaques alternativos; muestra de ellos es el uso de empaques comestibles, glaseado con hidrocoloides, como la gelatina, la carragenina y el almidÃ³n, siendo utilizados en frutas, vegetales y carnes. Estos, ademÃ¡s de cumplir sus funciones como pelÃ­cula protectora del alimento, son mas econÃ³micos, pueden ser ingeridos por el consumidor sin riesgo de toxicidad para el organismo y proporcionan un aporte nutricional ya que son fuente de proteÃ­nas y carbohidratos. AdemÃ¡s, por ser biodegradables, contribuyen a la conservaciÃ³n del ambiente, ayudan a preservar el olor y el sabor de los alimentos y proporcionan un aspecto mÃ¡s atractivo para consumidor.Debido a las caracterÃ­sticas antes mencionadas, se propone como objetivo del presente proyecto de investigaciÃ³n evaluar la estabilidad proteica, mediante anÃ¡lisis de solubilidad de proteÃ­nas y mÃ©todos electroforÃ©ticos, en el lomo de AtÃºn ((Thunnus sp)) empacado con pelÃ­culas comestibles elaboradas con hidrocoloides y almacenado a bajas temperaturas.','2009-06-15','Atun,hidrocoloides,proteinas,electroforesis,empaque,glaseado,carrgenina,gelatina',1,1,1,1,1,'2013-09-17 08:28:28','2013-09-17 08:28:28','Documento_250.pdf','application/pdf',4294105,'2013-09-17 08:28:28',20,0,142,'COMPLETO'),(250,'CaracterizaciÃ³n mineralÃ³gica de las cuarcitas ferruginosas encontradas en la cuenca del rÃ­o Aro, estado BolÃ­var, Venezuela.','El presente estudio abarca la caracterizaciÃ³n mineralÃ³gica de las cuarcitas ferruginosas encontradas en la cuenca de rÃ­o Aro, en el estado BolÃ­var. Fueron analizadas 38 muestras de roca tomadas en diferentes puntos de la cuenca de este rÃ­o. Se realizaron secciones finas para todas las muestras y se efectuÃ³ un anÃ¡lisis petrogrÃ¡fico. De las 38 muestras se seleccionaron 3 muestras (AroAr- 9, DT-55-R, Aror191) y se les realizÃ³ un anÃ¡lisis por difracciÃ³n de rayos X utilizando el mÃ©todo del polvo. Las rocas estudiadas 33 fueron clasificadas como cuarcitas ferruginosas y 5 como metagabros cuarcÃ­feros. La cuarcitas ferruginosas tienen una composiciÃ³n mineralÃ³gica conformada por cuarzo (49- 65%), magnetita (26-44%), hematita (3-23%), ferrosilita (8-20%) y plagioclasa (2-6%). Los metagabros cuarcÃ­feros tienen una composiciÃ³n mineralÃ³gica conformada por hornablenda verde (41-47%), plagioclasa del tipo bytownita (27- 35%), cuarzo (18-26%) y magnetita (5Â±4). Las cuarcitas ferruginosas tienen una textura xenoblÃ¡stica, mientras que los metagabros tienen una textura nematoblastica. El metamorfismo alcanzado por estas rocas (tanto los metagabros como las cuarcitas ferruginosas), es de la facie de la anfibolita, en la isÃ³grada perteneciente a la zona de la cianita y la silimanita. El aumento en el grado de metamorfismo no afecto de forma relevante la asociaciÃ³n mineralÃ³gica de estas rocas. Solo en el caso de las cuarcitas ferruginosas observamos la presencia de ferrosilita como mineral producto del metamorfismo. Las cuarcitas ferruginosas pueden clasificarse en funciÃ³n de su composiciÃ³n mineralÃ³gica como formaciones de hierro ricas en Ã³xidos; la textura de estas permite clasificarlas como Fearenitas tipo Packstone o formaciones granulares de hierro tipo Packstone; y en base a su posible ambiente de formaciÃ³n y con apoyo de la composiciÃ³n quÃ­mica, como formaciones de hierro tipo Lago Superior. Las cuarcitas ferruginosas se agrupan geogrÃ¡ficamente por su concentraciÃ³n de ferrosilita y hematita en dos Ã¡reas. Estas Ã¡reas coinciden con la ubicaciÃ³n que propone Beukes et al. (1990) para estos minerales en su modelo de sedimentaciÃ³n para las formaciones de hierro.','2009-10-29','Formaciones de hierro, Cuarcitas Ferruginosas, rÃƒÂ­o Aro',4,1,1,1,1,'2013-09-17 08:28:29','2013-09-17 08:28:29','Documento_251.pdf','application/pdf',1509075,'2013-09-17 08:28:29',18,0,65,'COMPLETO'),(251,'Animaciones de Algoritmos Distribuidos para DetecciÃ³n de TerminaciÃ³n','Se desarrolla una herramienta monoprocesadora que anima modelos de ejecuciÃ³n de los sistemas distribuidos con el fin de soportar el proceso didÃ¡ctico en la enseÃ±anza de los algoritmos distribuidos. Las animaciones desarrolladas se centran en la detecciÃ³n de terminaciÃ³n de los procesos distribuidos, permitiÃ©ndose la parametrizaciÃ³n de variables como el volumen de actividades, la productividad y el grafo de comunicaciÃ³n del sistema. Adicionalmente se realiza una comparaciÃ³n de las distintas implementaciones de los mÃ©todos hechos, en tÃ©rminos de los datos almacenados y mensajes utilizados. Con esto se crea un modelo bÃ¡sico que sirve como prototipo para el desarrollo posterior de los sistemas estudiados, o bien sistemas simuladores de Ã©stos.','2009-10-29','algoritmos distribuidos, detecciÃ³n terminaciÃ³n, animaciones',2,1,1,1,1,'2013-09-17 08:28:30','2013-09-17 08:28:30','Documento_252.pdf','application/pdf',1167612,'2013-09-17 08:28:30',16,0,78,'COMPLETO'),(252,'AplicaciÃ³n de los biomarcadores e hidrocarburos aromÃ¡ticos en breas de playas,, como indicadores de contaminaciÃ³n por petrÃ³leo en regiones costeras de Venezuela..','En este estudio se identificaron los biomarcadores presentes en las fracciones de hidrocarburos saturados e hidrocarburos aromÃ¡ticos policÃ­clicos (HAPÂ´s), en breas de varias playas de Venezuela, con el fin de inferir posibles fuentes de origen y determinar el grado de alteraciÃ³n (meteorizaciÃ³n). La instrumentaciÃ³n analÃ­tica empleada fue CG/EM. Las caracterÃ­sticas fÃ­sicas de las muestras (dureza, y olor), la distribuciÃ³n de los n-alcanos (C15-C33) y la presencia de UCM, permitiÃ³ clasificar las breas en 3 grupos de acuerdo al grado de alteraciÃ³n observada. El anÃ¡lisis CG/EM muestra proporciones variables de terpanos tricÃ­clicos en el rango de C20-C25 y gran abundancia de terpanos pentacÃ­clicos ab (C29-C35), con predominancia de ab norhopano C29-C30 y hopano ab. Los compuestos esteranos tetracÃ­clicos fueron identificados en el rango de C27-C29. De igual manera revela en algunas muestras la presencia de un pico identificado como gammacerano y la seÃ±al asociada a 18a(H)oleanano. Algunas relaciones entre biomarcadores especÃ­ficos sugieren que las breas se derivan de crudos inmaduros de origen mixto con predominancia marina, asociados a una roca fuente carbonÃ¡tica (tipo marga) y algunas de ellas asociadas a facies siliciclÃ¡sticas, depositadas bajo condiciones anÃ³xicas en una columna de agua de salinidad normal. A partir de la identificaciÃ³n de seÃ±ales claras e intensas en los cromatogramas de algunas de las breas se propone la relaciÃ³n Metilfenantreno/ Criseno (MF/C), para inferir el grado de alteraciÃ³n (meteorizaciÃ³n). La informaciÃ³n generada fue comparada con datos publicados de estudios geoquÃ­micos realizados en diferentes Cuencas PetrolÃ­feras de Venezuela. Las correlaciones positivas a partir de las caracterÃ­sticas composicionales entre ambos permitieron sugerir que las breas pueden ser de origen autÃ³ctono y provienen de diversas fuentes de contaminaciÃ³n.','2009-10-26','biomarcadores,, HAPÂ´Â´s,, CG//EM,, breas,, playas,, Venezuela..',4,1,1,1,1,'2013-09-17 08:28:31','2013-09-17 08:28:31','Documento_253.pdf','application/pdf',3912283,'2013-09-17 08:28:31',19,0,122,'COMPLETO'),(253,'ESTUDIO DE LA EXPRESIÃ“N DE RECEPTORES KIR EN CÃ‰LULAS K','El cumplimiento de las funciones del sistema inmunitario se debe a la existencia de receptores y de un conjunto de molÃ©culas que determinan la identidad biolÃ³gica del individuo, que son codificadas por los genes del Complejo Principal de Histocomptibilidad llamados en el hombre HLA. Las cÃ©lulas NK humanas expresan una familia de receptores de muerte, altamente polimÃ³rficos tipo inmunoglobulinas llamados KIR, que regulan la actividad citotÃ³xica de estas cÃ©lulas. Los genes KIR proveen seÃ±ales de activaciÃ³n o supresiÃ³n, para asÃ­ regular la activaciÃ³n de las cÃ©lulas NK, de tal modo que juegan un papel importante en la inmunidad anti viral y anti tumoral y cada conjunto de receptores inhibidores o activadores reconocen determinantes de un mismo grupo de molÃ©culas HLA clase I. La Hepatitis C es una infecciÃ³n que causa estragos a nivel mundial, causada por un virus (VHC) de ARN. Aproximadamente 2%-3% de la poblaciÃ³n mundial estÃ¡ crÃ³nicamente infectada con el virus de la Hepatitis C y cerca del 20% de Ã©sta se sobrepone de una infecciÃ³n aguda, estando involucrada en este hecho, la interacciÃ³n entre los receptores KIR y sus ligandos. El objetivo de este trabajo fue estudiar la expresiÃ³n a nivel del ARNm de los receptores KIR inhibidores (2DL1, 2DL2, 2DL3 y 3DL1) y del KIR activador (2DS4) en cÃ©lulas NK de sangre perifÃ©rica de pacientes crÃ³nicamente infectados con Hepatitis C e individuos controles. Para ello, se obtuvieron suspensiones celulares altamente enriquecidas en cÃ©lulas NK, se evaluÃ³ la expresiÃ³n del ARNm de los receptores KIR mediante RT-PCR obteniÃ©ndose que los receptores se expresan de acuerdo al genotipo dado para cada gen. Se logrÃ³ estandarizar la tÃ©cnica de PCR en tiempo real para posteriormente evaluar la expresiÃ³n del ARNm mediante PCR tiempo real y se obtuvo que los individuos controles expresaron mÃ¡s el receptor inhibidor KIR 2DL1 y los pacientes el KIR 2DL3; en ambos grupos, el receptor menos expresado fue el KIR activador 2DS4. SÃ³lo se encontrÃ³ diferencia significativa en controles y pacientes en cuanto al nivel de expresiÃ³n de KIR 2DL3. En cuanto a la expresiÃ³n de los genes KIR a nivel de ARNm y superficie, se encontrÃ³ una correlaciÃ³n inversa sin diferencias significativas en los receptores KIR 2DL1, 2DL3, 3DL1 y 2DS4.','2009-10-27','CÃ©lulas NK, receptores KIR, PCR en tiempo real',1,1,1,1,1,'2013-09-17 08:28:33','2013-09-17 08:28:33','Documento_254.pdf','application/pdf',3792064,'2013-09-17 08:28:33',20,0,158,'COMPLETO'),(254,'AplicaciÃ³n de la minerÃ­a de datos para la clasificaciÃ³n de la morfologÃ­a de espermatozoides humanos','AplicaciÃ³n de la minerÃ­a de datos para la clasificaciÃ³n de la morfologÃ­a de espermatozoides humanos','2009-09-08','mineria de datos, espermatozoides',2,1,1,1,1,'2013-09-17 08:28:35','2013-09-17 08:28:35','Documento_255.pdf','application/pdf',3382702,'2013-09-17 08:28:35',15,0,89,'COMPLETO'),(255,'Establecimiento de un Sistema de EmbriogÃ©Ã©nesis SomÃ¡Ã¡tica y de OrganogÃ©Ã©nesis in vitroen Ananas comosus ((L..)) Merr..','La especie Ananas comosus (piÃ±a) pertenece a la familia Bromeliaceae. La piÃ±a es cultivada predominantemente para ser consumida como fruta fresca o enlatada. Es una fuente abundante de manganeso y vitaminas C y B1, ademÃ¡s es usada como ingrediente en una gran variedad de comidas y tambiÃ©n es de importancia medicinal por el uso de la enzima proteolÃ­tica bromelina. El tÃ©rmino Cultivo de Tejidos Vegetales se refiere al cultivo in vitro de cualquier estructura de una planta (explante), sean cÃ©lulas, tejidos u Ã³rganos bajo condiciones asÃ©pticas, aportÃ¡ndole todos los requerimientos fÃ­sicos y quÃ­micos adecuados para inducir la respuesta de los explantes hacia un proceso determinado. La propagaciÃ³n iin vitro ha sido ampliamente utilizada para lograr la rÃ¡pida multiplicaciÃ³n de numerosas especies vegetales y su Ã©xito a escalas comerciales depende de la habilidad de transferir las plantas a condiciones ex vitro, el bajo costo de la tÃ©cnica empleada y la obtenciÃ³n de una alta tasa de supervivencia de las plantas regeneradas. La organogÃ©nesis es un proceso de regeneraciÃ³n que implica la formaciÃ³n de Ã³rganos de novo a partir de meristemoides. Este tipo de desarrollo tambiÃ©n se caracteriza por la presencia de conexiÃ³n vascular entre el tejido del explante y el tejido regenerado. Por otra parte, la embriogÃ©nesis somÃ¡tica es el proceso mediante el cual las cÃ©lulas somÃ¡ticas, se desarrollan para producir un embriÃ³n completo a partir de una sola cÃ©lula, como sucede en la embriogÃ©nesis cigÃ³tica pero sin fusiÃ³n de gametos y al contrario de la organogÃ©nesis, los embriones somÃ¡ticos no poseen conexiÃ³n vascular con el tejido materno. Debido a la importancia agrÃ­cola, econÃ³mica y medicinal que tiene la piÃ±a, se planteÃ³ establecer sistemas de regeneraciÃ³n iin vitro vÃ­a EmbriogÃ©nesis SomÃ¡tica y OrganogÃ©nesis para la especie Ananas comosus(L.) Merr. como mÃ©todo de clonaciÃ³n de la misma. Para alcanzar los objetivos de este proyecto, se cultivaron bases de hojas de plantas de piÃ±a de la variedades EspaÃ±ola Roja y TabÃ« CanÃ¤, obtenidas y mantenidas in vitro en un medio con las sales de Murashige y Skoog (1962), suplementado con 0,4mg/L de tiamina, 100mg/L de mio-inositol, 30g/L de sacarosa y con diferentes concentraciones de: Ãcido naftalenacÃ©tico (ANA), Bencil- adenina (BA), Ãcido 2,4-diclorofenoxiacÃ©tico (2,4-D), Picloram (Pic) y Thidiazuron (Tdz). El material vegetal, fue incubado en cÃ¡mara de crecimiento a 25Â±1ÂºC, en oscuridad durante el lapso de tiempo necesario para la inducciÃ³n de ambos procesos. Luego, fue transferido a condiciones de luz fluorescente continua y temperatura de 27Â±1ÂºC. En la organogÃ©nesis, en la mayorÃ­a de los casos se observaron cambios morfolÃ³gicos en los explantes a partir de la cuarta semana de cultivo en ambas variedades, formÃ¡ndose un callo granular de consistencia friable y coloraciÃ³n amarillenta, mientras que en la embriogÃ©nesis somÃ¡tica hubo respuesta de los explantes a partir de la cuarta semana de cultivo en los medios MS4 y MS6, y a la quinta en el medio MS5. Aproximadamente a los 3 meses de cultivo, los callos organogÃ©nicos formados comenzaron a mostrar indicios de desarrollo de Ã³rganos en los dos medios de cultivo para las dos variedades produciendo la formaciÃ³n de raÃ­ces y/o brotes en los explantes. A las 10 semanas de cultivo se obtuvo la formaciÃ³n de los primeros embriones somÃ¡ticos en estado globular en el medio MS4 en la var. EspaÃ±ola Roja, mientras que en los medios MS5 y MS6, ocurriÃ³ a las 13 y 15 semanas de cultivo respectivamente. En la presente investigaciÃ³n ocurriÃ³ embriogÃ©nesis somÃ¡tica directa en el 15% de los explantes de la var. EspaÃ±ola Roja cultivados en el medio MS5. Comparando las dos variedades, estadÃ­sticamente se encontrÃ³ que: en cuanto a la formaciÃ³n de raÃ­ces, hubo diferencias significativas solamente en el medio de cultivo MS2 en la var. TabÃ« CanÃ¤. En el caso de la formaciÃ³n de brotes hubo diferencias significativas en el medio de cultivo MS3 tanto para la var. EspaÃ±ola Roja como para la var. TabÃ« CanÃ¤, pero no hubo diferencias entre los resultados obtenidos en el medio de cultivo MS2 para ambas variedades. Del total de 30 plantas aclimatadas de cada, se obtuvo un 100% de sobrevivencia en la var. EspaÃ±ola Roja y un 90% de sobrevivencia en la var. TabÃ« CanÃ¤.','2009-07-16','BiotecnologÃ­a vegetal, MicropropagaciÃ³n, OrganogÃ©nesis, EmbriogÃ©nesis SomÃ¡tica, Ananas comosus..',1,1,1,1,1,'2013-09-17 08:28:36','2013-09-17 08:28:36','Documento_256.pdf','application/pdf',1351986,'2013-09-17 08:28:36',20,0,82,'COMPLETO'),(256,'\"Facies hidrogeoquÃ­micas de las aguas subterrÃ¡neas del sector oeste de la sub- cuenca del rÃ­o Zuata, Ãrea JunÃ­n de la Faja PetrolÃ­fera del Orinoco, Venezuela\"','RESUMEN En la presente investigaciÃ³n fueron determinadas las especies quÃ­micas mayoritarias Ca2+, Mg2+, Na+, K+, Cl-, NO3-, SO42-, HCO3- y sÃ­lice disuelta (SiO2) en muestras de aguas subterrÃ¡neas y superficiales del sector oeste de la sub-cuenca del rÃ­o Zuata de la Faja PetrolÃ­fera del Orinoco, con el fin de determinar las facies hidrogeoquÃ­micas presentes en la zona, los procesos geoquÃ­micos que pueden estar influyendo sobre la composiciÃ³n quÃ­mica, asÃ­ como tambiÃ©n, la evaluaciÃ³n de la probable contaminaciÃ³n de las aguas del acuÃ­fero. Para la realizaciÃ³n de este estudio fueron captadas 25 muestras de aguas subterrÃ¡neas y 15 muestras de aguas superficiales, la cual se llevÃ³ a cabo en el mes de julio del aÃ±o 2007; simultÃ¡neamente, fueron medidos \"in situ\" los parÃ¡metros fisicoquÃ­micos pH, Eh, conductividad y temperatura. En el laboratorio fueron determinadas las especies quÃ­micas mayoritarias mediante tÃ©cnicas analÃ­ticas tales como: espectroscopÃ­a de absorciÃ³n y emisiÃ³n atÃ³mica con llama, cromatografÃ­a iÃ³nica y espectrofotometrÃ­a de UV-visible. Asimismo, fue determinada la concentraciÃ³n teÃ³rica de HCO3- utilizando para ello un modelo de interacciÃ³n del agua con las probables unidades geolÃ³gicas que constituyen la regiÃ³n de estudio. Para la interpretaciÃ³n de los resultados obtenidos, se emplearon herramientas como las distribuciones espaciales, las relaciones interelementales y el diagrama de Piper, que permitieron establecer la existencia de tres tipos de aguas en este sector: bicarbonatadas cÃ¡lcicas y/ o magnÃ©sicas (Ca2+-Mg2+-HCO3-), bicarbonatadas sÃ³dicas (Na+-HCO3-), y aguas tipo sulfatadas cÃ¡lcicas (Ca2+-SO42-). Igualmente, el uso de dichas herramientas indican que los principales procesos que gobiernan las caracterÃ­sticas de las aguas subterrÃ¡neas son: el intercambio catiÃ³nico, la disoluciÃ³n de minerales carbonÃ¡ticos, la disoluciÃ³n de silicatos y aluminosilicatos y en menor proporciÃ³n, el aporte atmosfÃ©rico. AsÃ­ como, los probables factores, estÃ¡n relacionados al tiempo de residencia, litologÃ­a, clima y las actividades antrÃ³picas causantes de las especies contaminantes como el NO3-.','2009-10-16','{}',4,1,1,1,1,'2013-09-17 08:28:37','2013-09-17 08:28:37','Documento_257.pdf','application/pdf',1987453,'2013-09-17 08:28:37',19,0,124,'COMPLETO'),(257,'TOXICIDAD IN VIVO Y PROTEÃ“Ã“MMICA COMPARATIVA PARA EL ESTUDIO DE LA EXPRESIÃ“Ã“NN DE PROTEÃÃNNASCON ACTIVIDAD INSECTICIDA PRESENTES EN SEMILLAS DE Phaseolus vulgaris L..','Las caraotas (Phaseolus vulgaris) son una de las leguminosas mÃ¡s cultivadas en el mundo, su composiciÃ³n las hace una excelente fuente de proteÃ­nas, carbohidratos, fibra dietÃ©tica y micronutrientes por lo que son de gran interÃ©s desde el punto de vista nutricional. La alta calidad nutricional de P.. vulgaris la hace en ocasiones blanco de ataques de distintos tipos de insectos desde antes de la cosecha hasta el almacenamiento de los granos. Un ejemplo de este tipo de plagas son los bruquidios, particularmente las especies Acanthoscelides obtectus y Zabrotes subfasciatus.. Estos se alimentan del endospermo y causan graves daÃ±os a la semilla por lo que puede disminuir la calidad y cantidad de granos producidos hasta en un 48 %. Si bien los agricultores han empleado distintas estrategias para disminuir el efecto de los insectos, Ã©stas generalmente tienen consecuencias negativas y no son por completo efectivas. Es preciso desarrollar una estrategia que permita combatir eficazmente los bruquidios y que no implique daÃ±o a otras especies o afecte de manera considerable la producciÃ³n. Ciertas lectinas presentes en las leguminosas (como la fitohemaglutinina, los inhibidores de a-amilasa y las arcelinas) afectan a los insectos y confieren una resistencia natural al ataque de las semillas, no implican estrategias complejas o costosas para contrarrestar el efecto de las plagas y representan una buena opciÃ³n para evitar el ataque de insectos. Se realizÃ³ un bioensayo con el gorgojo de arroz (Sitophilus oryzae) a fin de estimar la toxicidad de semillas sin testa de diferentes variedades de P.. vulgaris, si bien este insecto no ataca en condiciones normales las semillas de P.. vulgaris, se ha demostrado su susceptibilidad a las proteÃ­nas tÃ³xicas presentes en las semillas. Mediante electroforesis en dos dimensiones se estudiaron las proteÃ­nas presentes en el endospermo de las semillas, obtenidas a partir de harinas de los granos. Esta tÃ©cnica permitiÃ³ comparar distintas muestras entre si mediante el anÃ¡lisis de las electroforesis por bioinformÃ¡tica. Mediante la correlaciÃ³n entre los resultados del bioensayo y el anÃ¡lisis de los geles, se buscÃ³ identificar las variedades de P.. vulgaris resistentes al ataque de insectos que pueden ser de interÃ©s como parte de programas de introducciÃ³n de nuevas variedades de caraotas al mercado venezolano mÃ¡s resistentes a las plagas de almacenamiento. Se obtuvieron tres grupos de resultados, semillas de toxicidad alta, moderada y baja, siendo las variedades Tacarigua, Victoria y MGMÃ¢Â€Â‘08Ã¢Â€Â‘02Ã¢Â€Â‘026, las mÃ¡s tÃ³xicas y Tenerife y DORÃ¢Â€Â‘500 las menos daÃ±inas para los insectos. Las electroforesis en dos dimensiones mostraron grupos de proteÃ­nas comunes para todas las variedades de semillas que mostraron ser tÃ³xicas, mientras que en las variedades no tÃ³xicas no se observaron estas proteÃ­nas. Aparentemente existe una correlaciÃ³n entre la presencia de spots en ciertas regiones de los geles y la toxicidad de las semillas','2009-10-26','Phaseolus vulgaris, Plagas de almacenamiento, ProteÃ­nas con actividad insecticida, Gorgojos, Electroforesis en 2 dimensiones, ProteÃ³mica comparativa, Bioensayo de toxicidad',1,1,1,1,1,'2013-09-17 08:28:39','2013-09-17 08:28:39','Documento_258.pdf','application/pdf',0,'2013-09-17 08:28:39',20,0,0,'INCOMPLETO'),(258,'CaracterizaciÃ³Ã³nn CaracterizaciÃ³Ã³nn de plÃ¡Ã¡smidos presentes en cepas bacterianas deA.. baumannii y S.. maltophiliacon determinantes de resistencia a antibiÃ³Ã³tticos,, aisladas del Hospital ClÃ­Ã­nico Universitario..','Acinetobacter baumanniiy Stenotrophomonas maltophiliason patÃ³genos emergentes de gran impacto en tÃ©rminos de salud pÃºblica, y son la causa de infecciones en la mayorÃ­a de los hospitales, especialmente en las Ã¡reas de Cuidados Intensivos. Presentan un perfil de resistencia bastante complejo, siendo resistentes a la mayorÃ­a de los antibiÃ³ticos de uso actual. Las bacterias adquieren la capacidad de resistir a la acciÃ³n de los antibiÃ³ticos por varios mecanismos, entre los que destacan, como uno de los mas importantes, los procesos de intercambio de informaciÃ³n genÃ©tica mediante la conjugaciÃ³n, proceso por el cual, de manera directa, el DNA plasmÃ­dico de una bacteria es transferido a otra, y pueden ser movilizados genes que confieran resistencias mÃºltiples. Esta situaciÃ³n a desencadenado que los Centros de Salud sean centros de selecciÃ³n y reservorio de cepas resistentes a mÃºltiples antimicrobianos. En este trabajo nos propusimos analizar los plÃ¡smidos presentes en cepas de A.. baumanniiy S.. maltophiliapresentes en el HUC. Se aislaron 26 cepas de A.. baumanniiy 15 cepas de S.. maltophilia. Mediante el mÃ©todo de difusiÃ³n en disco se determinÃ³ el perfil de resistencia empleando 15 antibiÃ³ticos de uso clÃ­nico actual. Los plÃ¡smidos fueron aislados y visualizados en electroforesis. Para determinar si estos plÃ¡smidos son capaces de conferir las resistencias a diversos antimicrobianos, se realizaron ensayos de transformaciÃ³n y de conjugaciÃ³n, en medio lÃ­quido y en sÃ³lido, con diferentes marcadores. TambiÃ©n se obtuvo el patrÃ³n de restricciÃ³n de los plÃ¡smidos presentes en las cepas en estudio. Nuestros resultados mostraron que las 26 cepas de A.. baumanniipresentaron multirresistencia, entre 12 y 15 de los antibiÃ³ticos examinados. Los resultados de los ensayos de conjugaciÃ³n, tanto en lÃ­quido como en sÃ³lido, demostraron que en las condiciones empleadas, ninguna de las cepas en estudio logrÃ³ transferir informaciÃ³n genÃ©tica a una cepa E.. colireceptora utilizada. Esta informaciÃ³n es relevante para las autoridades de Salud para mejorar el diseÃ±o de las medidas a implementar para el control de la dispersiÃ³n de la multirresistencia.','2009-10-16','A. baumannii, S. maltophilia, Conjugacion, Transformacion, Plasmidos, Resistencia bacteriana.',1,1,1,1,1,'2013-09-17 08:28:39','2013-09-17 08:28:39','Documento_259.pdf','application/pdf',0,'2013-09-17 08:28:39',20,0,0,'INCOMPLETO'),(259,'CaracterizaciÃ³Ã³nn de Integrones clase I en cepas de Acinetobacter baumannii y Stenotrophomonas maltophilia aisladas del Hospital Universitario de Caracas..','Los integrones se han identificado como elementos que actÃºan como un vector natural de clonamiento y expresiÃ³n, porque pueden incorporar un nÃºmero indefinido de genes de resistencia. La posibilidad que se generen diversos arreglos de genes en los integrones, ha contribuido al surgimiento de cepas multirresistentes. Los integrones se pueden encontrar asociados a transposones, que a su vez pueden encontrarse en plÃ¡smidos conjugativos, por lo que su movilidad estÃ¡ asegurada. La transmisiÃ³n de genes que confieren resistencia entre diferentes especies bacterianas, es un problema creciente en el Ã¡mbito de las enfermedades infecciosas, y mÃ¡s grave si nos referimos a infecciones nosocomiales. En este estudio nos propusimos, identificar y caracterizar los integrones Clase I en aislados bacterianos provenientes del Hospital Universitario de Caracas, en los cuales la multirresistencia puede estar asociada a estas estructuras. Acinetobacter baumannii y Stenotrophomonas maltophilia son bacilos Gram negativos, frecuentemente asociados a infecciones nosocomiales. Fueron analizadas 41 cepas aisladas de pacientes con infecciones nosocomiales y de ambientes inanimados del Hospital Universitario de Caracas. Los datos de resistencia contra los diferentes agentes antimicrobianos empleados, revelaron la presencia de patrones complejos de resistencia mÃºltiple, que puede estar mediada por plÃ¡smidos. El perfil plasmÃ­dico obtenido, mostrÃ³ para todas las cepas, un plÃ¡smido de alto peso molecular, ademÃ¡s de otras molÃ©culas menores. Mediante la amplificaciÃ³n del gen ribosomal 16S por PCR, se evaluÃ³ la calidad tanto de los lisados celulares como del ADN plasmÃ­dico extraÃ­do de las diferentes cepas estudiadas, con fin de verificar que el material fue adecuado para ser molde en las reacciones de PCR. Analizando las cepas de A.. baumannii portadoras de plÃ¡smidos, se determinÃ³ una frecuencia de 90% de integrones clase I en las cepas provenientes de pacientes con infecciones nosocomiales de la UCI, de 40% de integrones clase I en las cepas provenientes del ambiente de la UCI y de 25% en las cepas provenientes del ambiente del Servicio de NeonatologÃ­a. TambiÃ©n se determinÃ³ la frecuencia de integrones clase I en las cepas de S.. maltophilia, evidenciÃ¡ndose una frecuencia de 57% en las cepas provenientes del ambiente de la UCI, de 33% en las cepas provenientes de pacientes con infecciones nosocomiales de la UCI y no detectÃ¡ndose estos elementos genÃ©ticos en la cepa de ambiente del Servicio de NeonatologÃ­a. La secuenciaciÃ³n de las regiones variables de algunos integrones, permitiÃ³ conocer cuales determinantes de resistencia estÃ¡n asociados a estas estructuras. En las regiones variables caracterizadas se identificaron los genes aacC1 y aadA1, que confieren resistencia a aminoglucÃ³sidos Estos resultados nos permiten inferir que los integrones clase I, contribuyen a la diseminaciÃ³n de genes de resistencia en los aislados nosocomiales y ambientales provenientes la UCI y del Servicio de NeonatologÃ­a del HUC.','2009-10-16','Infecciones nosocomiales, Acinetobacter baumannii, Stenotrophomonas maltophilia, Integrones clase I',1,1,1,1,1,'2013-09-17 08:28:40','2013-09-17 08:28:40','Documento_260.pdf','application/pdf',4028931,'2013-09-17 08:28:40',20,0,100,'COMPLETO'),(260,'DESCONTAMINACIÃ“N DE NÃ‰CTAR Y JUGO DE FRUTAS CON TRATAMIENTO DE LUZ ULTRAVIOLETA.','Los jugos comerciales poseen caracterÃ­sticas diferentes a los naturales debido principalmente a sufrir degradaciÃ³n tÃ©rmica durante su pasteurizaciÃ³n. Algunos estudios han demostrado la utilidad del tratamiento con luz UV-C para inactivar microorganismos presentes en jugos, sin embargo, ninguno de ellos ha estudiado el efecto de la luz UV-C sobre las caracterÃ­sticas sensoriales de los jugos. Igualmente, estudios previos han demostrado la eficacia del reactor UV- C construido en el Laboratorio de Nuevas TecnologÃ­a, pero la dosimetrÃ­a respectiva no ha sido realizada. El presente trabajo tuvo como objetivo estudiar el efecto de la luz UV-C sobre la carga microbiana y la calidad sensorial del jugo de naranja y los nÃ©ctares de guayaba y parchita. Para reportar adecuadamente las condiciones de trabajo se hizo la estimaciÃ³n radiomÃ©trica respectiva. Los resultados demostraron que la luz UV-C corresponde a dosis volumÃ©tricas de 6,19-23,62 KJ/L, y dosis por Ã¡rea de 3,64-13,89 J/cm2. Los tratamientos lograron un mÃ¡ximo de inactivaciÃ³n en el recuento de microorganismos aerobios mesÃ³filos de 1,36 log10 UFC/mL (parchita) y en mohos y levaduras de 0,93 log10 UFC/mL (naranja). Las tasas de inactivaciÃ³n estuvieron en el rango 0,02-0,14 log10 UFC/KJ, con R2=0,88-0,98, y su orden no estuvo correlacionado con la absorbancia de los jugos. El panel entrenado observÃ³ diferencias estadÃ­sticamente significativas (p<0,05) entre las muestras tratadas y las controles. Se concluye que los tratamientos con luz UV-C usados lograron inactivar microorganismos presentes en jugo de naranja y nÃ©ctares de guayaba y parchita, pero alteraron sus caracterÃ­sticas sensoriales; siendo este Ãºltimo resultado el mÃ¡s importante.','2009-10-22','NÃ©ctar, Jugo, Ultravioleta, Reactor, UV-C, Efecto, Dosis, Flujo, InactivaciÃ³n, AlteraciÃ³n.',1,1,1,1,1,'2013-09-17 08:28:41','2013-09-17 08:28:41','Documento_261.pdf','application/pdf',544615,'2013-09-17 08:28:41',19,0,0,'INCOMPLETO'),(261,'ESTUDIO HIDROGEOQUÃÃMMICO DE LAS AGUAS SUBTERRÃÃNNEAS DEL SECTOR ESTE DE LA SUB-- CUENCA DEL RÃÃOO ZUATA DEL ÃÃRREA JUNIN DE LA FAJA PETROLÃÃFFERA DEL ORINOCO','Con la finalidad realizar un estudio hidrogeoquÃ­mico en el sector este de la sub-cuenca del rÃ­o Zuata, fueron captadas 15 muestras de aguas subterrÃ¡neas en aljibes y pozos de bombeo. Durante la fase de campo, se midieron los parÃ¡metros fisicoquÃ­micos pH, conductividad y Eh; posteriormente en el laboratorio, fue determinada la concentraciÃ³n de las especies quÃ­micas mayoritarias Na+, K+, Ca2+, Mg2+, NO3-, SO42-, y SiO2(sÃ­lice disuelta); asÃ­ como, la concentraciÃ³n teÃ³rica del HCO3-, a partir de los probables minerales presentes en la regiÃ³n de estudio. Los resultados obtenidos se interpretaron atendiendo a mapas de distribuciÃ³n espacial, a algunas relaciones interiÃ³nicas, asÃ­ como a los diagramas de Gibbs y Piper, permitiendo establecer la existencia de tres tipos de aguas en la zona de estudio, a saber: Ca2+-HCO3-, Na+-HCO3- y una tipo Ca2+-SO42-. AsÃ­ mismo la caracterizaciÃ³n geoquÃ­mica evidenciÃ³ que la composiciÃ³n quÃ­mica de estas aguas estÃ¡ controlada por procesos de precipitaciÃ³n y disoluciÃ³n de sales evaporiticas, histolisis de aluminosilicatos e intercambio iÃ³nico; mientras que, los factores estÃ¡n asociados al clima, a la interacciÃ³n agua-medio poroso y al tiempo de residencia.','2009-09-07','{}',4,1,1,1,1,'2013-09-17 08:28:42','2013-09-17 08:28:42','Documento_262.pdf','application/pdf',961035,'2013-09-17 08:28:42',19,0,134,'COMPLETO'),(262,'ESTIMAR LA CINETICA DE HIDRODESCLORINACION DE LOS CONGENERES 2,3,4,5 Y 2,4,4\',6 DE LOS CONGENERES DEL TETRACLOROBIFENILO EN CONDICIONES DE HIDROTRATAMIENTO CATALÃTICO.','El presente TEG abarca un estudio fisicoquÃ­mico desde el punto de vista teÃ³rico-computacional de las cinÃ©tica de la hidrodesclorinacion de bifenilos policlorados en condiciones de hidrotratamiento catalÃ­tico empleando una herramienta matemÃ¡tica computacional llamada MATLAB. Se calcularon la concentracion de las especies en el tiempo sin hacer ningun tipo de aproximaciones y se determinaron parÃ¡metros de diseÃ±o de una reactor flujo piston.','2009-10-13','BifenilosMatlabReactor Flujo Piston',6,1,1,1,1,'2013-09-17 08:28:43','2013-09-17 08:28:43','Documento_263.pdf','application/pdf',2443143,'2013-09-17 08:28:43',18,0,103,'COMPLETO'),(263,'Factores y procesos que determinan la calidad quÃ­mica de las aguas subterrÃ¡neas del sector sur-central del Ã¡rea JunÃ­n de la Faja PetrolÃ­fera del Orinoco','En Ã©ste trabajo se determinÃ³ la calidad quÃ­mica de las aguas subterrÃ¡neas del sector sur-central del Ã¡rea JunÃ­n de la Faja PetrolÃ­fera del Orinoco. Para ello, fueron analizadas 31 muestras, distribuidas de la siguiente manera: 18 de aljibes, 12 de rÃ­o y 1 muestra de morichal, de las cuales se realizÃ³ mayor Ã©nfasis en las muestras de aljibes. Cabe destacar que el muestreo fue realizado en el mes de julio de 2007, a travÃ©s de una campaÃ±a llevada a cabo por el Instituto de Ciencias de la Tierra, el Instituto de ZoologÃ­a Tropical y PDVSA. Se determinaron las concentraciones de las especies mayoritarias, a travÃ©s de diferentes tÃ©cnicas analÃ­ticas, los datos obtenidos fueron analizados a travÃ©s del uso de diferentes herramientas graficas, como diagramas de Piper, cajas graficas, y distribuciÃ³n espacial, entre otras. Los resultados obtenidos indican que el 78% de las muestras de aljibes corresponden a aguas del tipo Ca2+-HCO3-,mientras que un 11% son Na+- K+-HCO3- y el resto corresponden al tipo Na+-SO42- y K+-SO42-. La composiciÃ³n de las aguas posiblemente estÃ© controlada por diversos factores, entre los que se encuentran la interacciÃ³n agua- roca, a travÃ©s del intercambio iÃ³nico; precipitaciÃ³n atmosfÃ©rica y actividades antropicas. Esta Ãºltima posiblemente estÃ© afectando sectores particulares del Ã¡rea de estudio.En cuanto a la calidad quÃ­mica, atendiendo al decreto 883 (Gaceta Oficial NÂº 5021, 2005) el 93,5% de las muestras analizadas entran en la clasificaciÃ³n de buena a excelente, que pueden ser usadas para cualquier actividad; mientras que, el 6,5%, correspondiente a dos muestras, estÃ¡n por debajo de la clasificaciÃ³n de buenas, es probable que tengan una mayor influencia de las actividades agrÃ­colas, ganaderas e industriales de la regiÃ³n.','2009-10-06','aAguas subterrÃ¡Ã¡neas,, calidad quÃ­Ã­mica,, JunÃ­Ã­n,, aljibes,, Decreto 888833..',4,1,1,1,1,'2013-09-17 08:28:44','2013-09-17 08:28:44','Documento_264.pdf','application/pdf',1188425,'2013-09-17 08:28:44',19,0,73,'COMPLETO'),(264,'\"\"Estudio de los parÃ¡Ã¡metros que influyen en el proceso de electrogasificaciÃ³Ã³nn de residuos sÃ³Ã³llidos de carbono\"\"','Investigaciones previas han reportado la oxidaciÃ³n electroquÃ­mica del carbÃ³n, ya sea mineral o activado. El objeto de estudio de este trabajo es la electrooxidaciÃ³n de materiales carbonosos mÃ¡s complejos como: flexicoque Amuay con alto contenido de vanadio y coque Petrozuata. Para el primero se consigue la electrogasificaciÃ³n en medio Ã¡cido (H2SO4 1 M) donde la suspensiÃ³n es agitada hasta ser obtenido un porcentaje de CO2 mÃ­nimo y constante (0,14 %), al aplicar la perturbaciÃ³n elÃ©ctrica (1,87 V vs. SCE o 25 mAcm-2) este porcentaje aumenta hasta aproximadamente 2 % y se detecta la presencia de CO (0,10 %). TambiÃ©n es electrooxidado en medio bÃ¡sico (NaOH 1 M) produciÃ©ndose 0,06 % de CO con la aplicaciÃ³n de 1,87 V vs. SCE. La presencia de los metales ocluidos en la matriz carbonosa juega un papel importante en la respuesta electroquÃ­mica del material, ya que Ã©stos actÃºan como catalizador en la reacciÃ³n. Los procesos electroquÃ­micos no ejercen efecto significativo en la remociÃ³n de metales del material al contacto con el medio electrolÃ­tico.','2009-10-22','electrogasificaciÃ³n. coque.',6,1,1,1,1,'2013-09-17 08:28:45','2013-09-17 08:28:45','Documento_265.pdf','application/pdf',4614516,'2013-09-17 08:28:45',20,0,0,'INCOMPLETO'),(265,'ComparaciÃ³Ã³nn de la cisteÃ­Ã­n proteasa y del kinetoplasto de dos aislados venezolanos de tripanosomas de interÃ©Ã©s veterinario','La tripanosomiasis animal es una enfermedad ampliamente distribuida en todo el mundo, particularmente la equina y la bovina son causadas por especies del subgÃ©nero Trypanozoon: Trypanosoma brucei brucei,, T.. evansiy T.. equiperdum. La tripanosomiasis atribuida a T.. evansi se conoce como surra o derrengadera, y la enfermedad causada por T.. equiperdum, es denominada durina, caracterizada por transmitirse Ãºnicamente de forma venÃ©rea y por la formaciÃ³n de placas edematosas cutÃ¡neas en el Ã¡rea urogenital. Estos parÃ¡sitos son morfolÃ³gicamente indistinguibles entre sÃ­, pero pueden diferenciarse a travÃ©s del estudio microscÃ³pico y molecular de su kinetoplasto, el cual estÃ¡ compuesto por dos clases de molÃ©culas concatenadas entre sÃ­: los mini y los maxicÃ­rculos. En el caso de T.. evansi, se observa la ausencia de maxicÃ­rculos, a diferencia de T.. equiperdum, que aÃºn presenta fragmentos del mismo, similar en secuencia a los presentes en T.. brucei. Sin embargo, conjuntamente, con el estudio de estos marcadores moleculares, se requiere de la bÃºsqueda de marcadores bioquÃ­micos que permitan distinguir entre T.. equiperdumy T.. evansi, y que a su vez, pudieran correlacionarse con las diferencias en el grado de virulencia y/o patogenicidad de la durina y derrengadera, respectivamente. Las proteasas constituyen factores claves para la virulencia de varios parÃ¡sitos y en el establecimiento de la patogÃ©nesis de dichas parasitosis. La principal cisteÃ­n proteasa de los tripanosomas africanos, posee una secuencia primaria y caracterÃ­sticas bioquÃ­micas similares a la catepsina L de los mamÃ­feros, presentando cuatro regiones: pre-catalÃ­tica, pro-catalÃ­tica, catalÃ­tica y una regiÃ³n C-terminal que inicia con nueve residuos de prolina contiguos e incluye ocho residuos de cisteÃ­na, caracterÃ­stica propia que la diferencia de las cisteÃ­n proteasas reportadas en mamÃ­feros. El objetivo de este trabajo fue comparar la secuencia y la actividad de la cisteÃ­n proteasa y las diferencias en el kinetoplasto de dos aislados venezolanos de tripanosomas de interÃ©s veterinario, uno de los cuales presenta caracterÃ­sticas de T.. equiperdum (TeAp- N/D1). El anÃ¡lisis de la secuencia de la principal cisteÃ­n proteasa (Cat-L) del aislado TeAp-N/D1, presentÃ³ un residuo extra de prolina en la regiÃ³n bisagra, caracterÃ­stica que comparte con la secuencia reportada para T.. brucei y que lo diferencia del aislado TeAp-FrÃ­o01, el cual sÃ³lo presenta ocho prolinas. AsÃ­ mismo, el estudio de la secuencia completa del minicÃ­rculo agrupÃ³ a TeAp-N/D1 con minicÃ­rculos tipo B (correspondientes a cepas de T.. equiperdum), y lo diferenciÃ³ del aislado TeAp-FrÃ­o01 que presenta minicÃ­rculos tipo A1. SimultÃ¡neamente, se determinÃ³ la presencia de una fracciÃ³n de maxicÃ­rculo en el aislado TeAp-N/D1, excluyendo la posibilidad que este aislado sea clasificado como T.. evansi. Durante el estudio de la actividad proteolÃ­tica se realizaron ensayos de zimografÃ­a con gelatina y fluorimetrÃ­a con los sustratos ZFR-AMC y ZRR-AMC, para comparar cualitativa y cuantitativamente la actividad de los dos aislados de interÃ©s. Se encontrÃ³ que el aislado mÃ¡s virulento (TeAp-N/D1) presenta una menor actividad proteolÃ­tica, tanto en el ensayo de zimografÃ­a como en el ensayo para catepsina L, en relaciÃ³n al aislado menos virulento en infecciones experimentales (TeAp-ElFrÃ­o01). Se determinÃ³ tambiÃ©n que no existen diferencias significativas, entre ambos aislados, en cuanto a la actividad proteolÃ­tica tipo catepsina B. Con este trabajo se concluye que el aislado TeAp-N/D1, inicialmente clasificado como Trypanosoma evansi, no pertenece a esta especie, sino que presenta caracterÃ­sticas moleculares consistentes con su reclasificaciÃ³n como Trypanosoma equiperdum.','2009-10-28','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:28:46','2013-09-17 08:28:46','Documento_266.pdf','application/pdf',6676443,'2013-09-17 08:28:46',20,0,252,'COMPLETO'),(266,'Estudio de la posible asociaciÃ³Ã³nn del sistema KIR--HLA--I con la susceptibilidad a Hepatitis Autoinmune tipo I..','ESTUDIO DE LA POSIBLE ASOCIACIÃ“Ã“NN DEL SISTEMA KIR--HLA--I CON LA SUSCEPTIBILIDAD A HEPATITIS AUTOINMUNE TIPO I..((Study of the possible association of the system KIR--HLA-- I with the susceptibility to autoimmune hepatitis type 11))..Bochichio M..11;; Conesa A.. 11;; Fortes M.. 1111Instituto de InmunologÃ­Ã­a.. Facultad de Medicina,, UCV.. marybochichio666600@@gmail..com Estudios recientes han demostrado que las cÃ©lulas NK expresan familias de receptores, que generan tanto seÃ±ales activadoras como inhibidoras de la actividad citotÃ³xica de las mismas. Entre estos receptores se encuentran los KIR perteneciente a la superfamilia de las inmunoglobulinas. El polimorfismo de KIR e interacciÃ³n con combinaciones especÃ­ficas KIR-HLA, estÃ¡n relacionadas con la susceptibilidad o resistencia a numerosas enfermedades. Por ello, el objetivo de este trabajo es el estudio de la posible asociaciÃ³n del sistema KIR-HLA con la susceptibilidad a Hepatitis Autoinmune tipo 1, ya que sobre dicha enfermedad no se ha realizado ningÃºn estudio referente a estos receptores. El estudio se realizara mediante aislamiento de ADN de la capa de blancos (Buffy coat) y su posterior amplificaciÃ³n mediante PCR-SSP con cebadores sentido y antisentido especÃ­ficos para cada KIR. El estudio de los alelos HLA se realizarÃ¡ mediante la hibridaciÃ³n con sondas especÃ­ficas de OligonucleÃ³tidos (PCR-SSO) usando el estuche comercial de Dynal Reli[TM] SSO HLA Typing Kit. Los resultados muestran que 2DL1, 2DL3 y 2DP1 asÃ­ como las combinaciones 3DL1 HLA-Bw4 y 2DL3 HLA-C1 confieren protecciÃ³n a individuos con HAI tipo 1. En cambio 2DL2 con HLA-C1 ambos en condiciÃ³n homÃ³ciga, pudieran conferir susceptibilidad a HAI tipo 1, lo cual nos lleva a concluir que la presencia de las combinaciones encontradas podrÃ­an actuar inhibiendo la actividad citotÃ§oxica de las cÃ©lulas NK y por ende, actuar como un factor protector.','2009-10-27','Hepatitis Autoinmune, cÃ©lulas NK, receptores KIR, Susceptibilidad',1,1,1,1,1,'2013-09-17 08:28:47','2013-09-17 08:28:47','Documento_267.pdf','application/pdf',1793069,'2013-09-17 08:28:47',19,0,124,'COMPLETO'),(267,'IdentificaciÃ³Ã³nn de la presencia de genes plasmÃ­Ã­dicos qnrque confieren resistencia a quinolonas en cepas de Escherichia coli causantes de infecciones de tracto urinario con expresiÃ³Ã³nn de b--lactamasas de espectro extendido','Las infecciones de tracto urinario (ITU) son un problema de Salud PÃºblica que afecta a gran parte del mundo, no sÃ³lo por su incidencia, sino por la rÃ¡pida diseminaciÃ³n de genes de resistencias a los antibiÃ³ticos que han surgido en los Ãºltimos tiempos en los microorganismos productores de este tipo de infecciones. Estas resistencias se adquieren por mutaciones o por ganancia horizontal de material genÃ©tico, sobre todo, por el uso indiscriminado de antibiÃ³ticos, lo cual genera la selecciÃ³n de microorganismos resistentes. Las cepas productoras de BLEE, resistentes a cefalosporinas de 3ra y 4ta generaciÃ³n, son un claro ejemplo del problema al que nos estamos enfrentado actualmente, debido a que su presencia dificulta la aplicaciÃ³n de un tratamiento eficaz. Para estos casos se utilizan otros antibiÃ³ticos con mayor espectro de acciÃ³n como lo son las quinolonas, pero ahora se estÃ¡ observando un aumento en la selecciÃ³n de cepas resistentes a este grupo de antibiÃ³ticos. La resistencia a las quinolonas aparece principalmente por mutaciones cromosomales, pero tambiÃ©n se han reportado genes plasmÃ­dicos qnr, capaces de conferir resistencia contra estos antibiÃ³ticos. En Venezuela, existe una frecuencia elevada de cepas de E.. coli causantes de ITU multiresistentes a los antibiÃ³ticos comÃºnmente empleados en su tratamiento, pero no se ha realizado, hasta el momento, la determinaciÃ³n de la incidencia de estos genes plasmÃ­dicos codificantes para resistencia a quinolonas, en cepas que concomitantemente expresen BLEEs. Como un aporte para la vigilancia epidemiolÃ³gica y el entendimiento de las causas para la prevalencia y la dispersiÃ³n de estas cepas multiresistentes, en este trabajo se determinÃ³ la coexistencia de resistencia a BLEE y a quinolonas en cepas causante de ITU. En este estudio se reportÃ³ que el 76,4% de las ITU en pacientes de consulta ambulatoria fueron causadas por E.. coli, predominando en pacientes femeninos en un 79,2% de los aislados. Las cepas productoras de BLEE estuvieron representadas por el 3,5% de las cepas de E.. coliaisladas de ITU, las cuales presentaban un perfil de multiresistencia a distintas familias de antibiÃ³ticos, con una resistencia elevada a SXT (83,3%), CRO (75%), CTX (79,2%), CIP (87%), OFX (87%), NAL (91,7%),TOB (62,5%), ATM (56,5%), seguidos de GN (34,8%), FOX (21,7%), CAZ (20,8%), AMC(17,4%), mientras que para IMP y AN no se obtuvieron cepas resistentes, constituyendo estos Ãºltimos antibiÃ³ticos la mejor opciÃ³n terapÃ©utica para estos pacientes en particular. Se obtuvo predominancia del gen blaCTX -M(87,5%) en los aislados seguido del gen bla TEM (25%) y del gen blaSHV (12,5%)), particularmente las cepas positivas para el gen blaTEM tambiÃ©n estaban asociadas al gen blaCTX-M. AdemÃ¡s se determinÃ³ la presencia de los genes qnrB y qnrS en 20,8% y 16,7% respectivamente. No fue detectada la presencia de los determinantes qnrA, qnrC, qnrD y qepA en las cepas evaluadas. La incidencia de genes bla y qnr en una misma cepa fue encontrada en 33,3% de los aislados y fue asociada principalmente a los genes blaCTX-M y se encontraron en menor proporciÃ³n en cepas que portaban los genes blaSHVyblaTEM. Esta investigaciÃ³n permitiÃ³ detectar la incidencia de qnr en la comunidad, indicando la diseminaciÃ³n de este mecanismo de resistencia fuera de ambientes hospitalarios, representando un serio problema al considerar que las ITU afectan a gran parte de la poblaciÃ³n y la expresiÃ³n concomitante de genes bla y qnr dificulta las opciones terapÃ©uticas, ya que la transferencia horizontal de estos genes de resistencia es muy probable.','2009-10-29','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:28:48','2013-09-17 08:28:48','Documento_268.pdf','application/pdf',7344129,'2013-09-17 08:28:48',20,0,128,'COMPLETO'),(268,'DeterminaciÃ³n de los polimorfismos: + 647 G>C en el gen del Receptor de Glucocorticoide y -159 C>T en el gen de CD14, en pacientes con Asma y Enfermedad Obstructiva CrÃ³nica (EPOC)','El Asma y la Enfermedad Pulmonar Obstructiva CrÃ³nica (EPOC) son enfermedades respiratorias que se originan por un proceso inflamatorio crÃ³nico; ambas patologÃ­as se caracterizan por ser complejas, y resultan de la interacciÃ³n de mÃºltiples agentes ambientales con diversos genes. Se conoce que un nÃºmero importante de pacientes es resistente a los efectos de glucocorticoides y se desconoce las razones; por ello, la importancia de analizar los polimorfismos del gen del receptor de Glucocorticoide y las pruebas funcionales para ensayarlo. Diversos investigadores han indicado que algunos polimorfismos de tipo SNP (polimorfismos de nucleÃ³tido simple), han sido asociados con el desarrollo de Asma y EPOC, uno de ellos en el gen del Receptor de Glucocorticoide (GR), el cual esta definido a +647 pb en el intrÃ³n 2 y consiste en la transversiÃ³n de una Guanina (G) por una Citosina (C). Por otro lado, el CD14 es una glicoproteÃ­na expresada en la membrana de mastocitos, macrÃ³fagos, que actÃºa como receptor de componentes bacterianos como LipopolisacÃ¡ridos (LPS).Uno de los polimorfismos en la regiÃ³n promotora del gen de CD14, estÃ¡ definido a -159 pb del sitio de inicio de la transcripciÃ³n, y consiste en la transiciÃ³n de una Citosina (C) por una Timina (T). El objetivo de nuestra investigaciÃ³n fuÃ©: estudiar la posible asociaciÃ³n entre la presencia de las variantes alÃ©licas de estos dos polimorfismos, con el desarrollo y severidad de Asma y EPOC, en comparaciÃ³n con sujetos controles (sin enfermedades respiratorias). Para ello, se realizÃ³ la amplificaciÃ³n de los segmentos de interÃ©s en cada polimorfismo por PCR y luego el corte con enzimas de restricciÃ³n especÃ­ficas. Al mismo tiempo se analizÃ³ en dichos pacientes, tanto la funciÃ³n del receptor LPS-CD14-TLR-4 en ensayos biolÃ³gicos in vitro deactivaciÃ³n celular, como la funciÃ³n del Receptor de Glucocorticoide, mediante la producciÃ³n o inhibiciÃ³n inducida por LPS, de TNF-a y radicales O2-. Se observÃ³ que la presencia de los genotipos del polimorfismo en el gen del GR, difieren significativamente de lo reportado para la poblaciÃ³n caucasoide control (p < 0,01), y de lo reportado para Asma y EPOC en dicha raza. Por su parte, entre las variantes alÃ©licas del polimorfismo de CD14, no se obtuvieron diferencias significativas. En las pruebas funcionales, no se hallÃ³ asociaciÃ³n directa entre los genotipos de los polimorfismos estudiados, y la respuesta celular a dexametasona y sus anÃ¡logos (ginsenoides). Se concluye que la resistencia farmacolÃ³gica a los esteroides depende de varios mecanismos de respuesta celular que, en principio, no estÃ¡n directamente asociados con las variantes genotÃ­picas de los dos polimorfismos SNP estudiados.','2009-10-21','Asma, EPOC, gen del Receptor de Glucocorticoide, gen de CD14',1,1,1,1,1,'2013-09-17 08:28:51','2013-09-17 08:28:51','Documento_269.pdf','application/pdf',9370196,'2013-09-17 08:28:51',17,0,89,'COMPLETO'),(269,'EvaluaciÃ³n de la capacidad de sorciÃ³n de metano y otros hidrocarburos, por los carbones de la FormaciÃ³n Cerro Pelado (Mioceno temprano), Edo. FalcÃ³n.','El presente estudio contemplÃ³ como objetivos principales la capacidad de desorciÃ³n de metano por los carbones de la FormaciÃ³n Cerro Pelado y su relaciÃ³n con la granulometrÃ­a de la muestra, asÃ­ como su capacidad de adsorciÃ³n de diferentes hidrocarburos. Para ello la muestra fue sometida a un anÃ¡lisis termogravimÃ©trico a partir de cuyos resultados se obtuvieron las condiciones adecuadas para los ensayos posteriores. Posteriormente, la muestra fue triturada manualmente y tamizada en diferentes granulometrÃ­as (250-1000Âµm, 149- 250 Âµm, 74-149 Âµm y <74 Âµm). Cada una de ellas fue sometida a tratamiento tÃ©rmico mediante un dispositivo, que permitiÃ³ medir el volumen de gas liberado por una masa conocida de muestra sÃ³lida. Por otro lado, la fracciÃ³n comprendida entre 74-149 Âµm fue utilizada para los ensayos de adsorciÃ³n, al ponerla en contacto con diferentes hidrocarburos (hexano, octano, decano, trimetilpentano, ciclohexano, y decalina), durante un tiempo de 12h, para luego separar la muestra del lÃ­quido y dejar evaporar durante el mismo tiempo. Por ultimo, la muestra fue desorbida mediante la utilizaciÃ³n del dispositivo antes mencionado.La granulometrÃ­a de la muestra no es un factor determinante en las mediciones de gas desorbido; sin embargo, la mayor homogeneidad de la forma grano y del proceso de desorciÃ³n se encuentra en la fracciÃ³n comprendida entre 74-149 Âµm. Los resultados obtenidos en este trabajo sugieren que el gas contenido por unidad de masa para los carbones de la FormaciÃ³n Cerro Pelado es de 2,565cm3/g, mientras que las reservas de gas, en el espacio micro y mesoporoso calculadas para la cuenca, estÃ¡n en el orden de 0,014TFC, o trillones (1012) de pies cÃºbicos. Los resultados de las pruebas indican que la adsorciÃ³n de molÃ©culas en los microporos del carbÃ³n estÃ¡ condicionada no sÃ³lo por la forma del poro sino tambiÃ©n con la interacciÃ³n de las molÃ©culas con las paredes y puntos activos dentro de los microporos. De esta manera, molÃ©culas de estructura similar como n-alcanos presentan volÃºmenes adsorbidos similares, mientras que con el cambio de estructura de los compuestos existen restricciones. La molÃ©cula de benceno a pesar de tener un tamaÃ±o considerable se adsorbe en volÃºmenes importantes en comparaciÃ³n a molÃ©culas similares pero de menor polaridad.','2009-09-07','carbÃ³n, sorciÃ³n, Cerro Pelado, Coalbed Methane, hidrocarburos.',4,1,1,1,1,'2013-09-17 08:28:53','2013-09-17 08:28:53','Documento_270.pdf','application/pdf',4697649,'2013-09-17 08:28:53',20,0,145,'COMPLETO'),(270,'DISTRIBUCIÃ“N, ABUNDANCIA Y ESTRUCTURA POBLACIONAL DEL BABO MORICHALERO (Paleosuchus palpebrosus) EN LOS LLANOS ORIENTALES DEL ESTADO ANZOÃTEGUI, VENEZUELA','El babo morichalero (Paleosuchus palpebrosus) estÃ¡ considerado uno de los cocodrilos mÃ¡s pequeÃ±os y menos conocidos del mundo. El propÃ³sito de este trabajo fue evaluar la ecologÃ­a de esta especie en tÃ©rminos de su abundancia poblacional, distribuciÃ³n espacial y estructura poblacional, en ambientes perturbados por la explotaciÃ³n petrolera al suroeste del Estado AnzoÃ¡tegui, a 20 km de San Diego de Cabrutica (8Âº 24Â´ 55Â´Â´ N, 64Âº 53Â´ 03Â´Â´ O). Los recorridos se realizaron en cuatro rÃ­os con una vegetaciÃ³n de bosques siempre verdes y palmares de Mauritia flexuosa (Morichales). El clima es biestacional con un periodo de 6 meses de lluvias (mayo a octubre) y 6 meses de sequÃ­a (noviembre a abril). La temperatura media anual es 26,2 ÂºC y la precipitaciÃ³n total media anual es de 890 mm. Se realizaron conteos nocturnos a pie utilizando linternas de mano y faros pilotos. Los animales avistados fueron capturados y marcados, registrando medidas corporales, sexo, peso, localidad geo-referenciada y descripciÃ³n del micro hÃ¡bitat. El babo morichalero estuvo presente en todos los rÃ­os recorridos, avistÃ¡ndose, en 64 km. recorridos, 66 individuos, de los cuales 46 fueron capturados. La abundancia poblacional variÃ³ entre 0,28 a 2,3 individuos/ km, valores similares a las reportados en su Ã¡rea de distribuciÃ³n. Se reportaron mayormente densidades bajas y medias de babos morichaleros en los lechos de los rÃ­os, a excepciÃ³n de RÃ­o Negro, donde se reportaron sectores con alta densidad, compuestas por individuos juveniles y sub-adultos. La estructura de tallas estuvo mayormente compuesta por individuos adultos, y la proporciÃ³n de sexos estuvo representada por 1,8 machos por hembra. La distribuciÃ³n espacial de la poblaciÃ³n del babo morichalero mostrÃ³ una tendencia a un arreglo uniforme y aleatoria. En cambio, el babo morichalero y el babo comÃºn (Caiman crocodilus), tambiÃ©n presente en el Ã¡rea de estudio, tienden a estar negativamente asociados en cuanto a su disposiciÃ³n espacial, lo cual sugiere una relaciÃ³n de competencia o depredaciÃ³n entre estas especies.','2009-07-04','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:28:54','2013-09-17 08:28:54','Documento_271.pdf','application/pdf',2969756,'2013-09-17 08:28:54',19,0,117,'COMPLETO'),(271,'ELABORACIÃ“N DE HARINA DE PULPA Y CÃSCARA DE PLÃTANO VERDE CLON HARTÃ“N COMÃšN PARA LA FORMULACIÃ“N DE UNA MEZCLA DE HARINA PARA AREPAS A BASE DE PLÃTANO:MAÃZ','Resumen En el presente trabajo se plantearon como objetivos la elaboraciÃ³n de harina de la pulpa y cÃ¡scara del plÃ¡tano verde clon HartÃ³Ã³nn ComÃºÃºnn y su caracterizaciÃ³n proximal, quÃ­mica y fisicoquÃ­mica, para ser utilizada como posible sustituta de la harina de maÃ­z. En los anÃ¡lisis realizados se encontrÃ³ que las harinas son potencialmente utilizables, ya que son de fÃ¡cil obtenciÃ³n mediante un proceso muy eficiente y con altos rendimientos, lo que la hace disponible para el desarrollo de nuevos productos con una materia prima subutilizada, como es la cÃ¡scara del plÃ¡tano. AdemÃ¡s, las caracterÃ­sticas nutricionales de ambos tipos de harina (pulpa y cÃ¡scara), constituyen un aporte nutricional a la poblaciÃ³n que consuma este producto. Se demostrÃ³ que la harina de cÃ¡scara aporta proteÃ­na y fibra dietaria a la harina compuesta formulada, lo cual la hace un producto funcional. Se formulÃ³ la harina compuesta con 80 % harina de maÃ­z, 15% harina de pulpa de plÃ¡tano y 5% harina de cÃ¡scara de plÃ¡tano, aceptada por un panel evaluador; con la cual se elaboraron arepas. Esta proporciÃ³n usada en la harina compuesta reÃºne las propiedades para obtener un producto como la arepa, de buena calidad y aceptaciÃ³n por el consumidor.','2009-11-02','HartÃ³n ComÃºn, harina, harina compuesta, composiciÃ³n proximal, fisico quÃ­mica y funcional.',1,1,1,1,1,'2013-09-17 08:28:56','2013-09-17 08:28:56','Documento_272.pdf','application/pdf',4194071,'2013-09-17 08:28:56',20,0,171,'COMPLETO'),(272,'NEUROANATOMÃÃAA DEL ENCÃ‰Ã‰FFALO DEL BAGRE SIERRA NEGRA,, Oxydoras sifontesi:: DISTRIBUCIÃ“Ã“NN DE LAS NEURONAS PRODUCTORAS DE LA HORMONA LIBERADORA DE LAS GONODOTROFÃÃNNAS ((GnRH)) Y DE LOS RECEPTORES DE MELATONINA ((Mel--R))','El proceso reproductivo en los vertebrados, estÃ¡ regulado por el eje hipotÃ¡lamo-hipÃ³fisis-gÃ³nada. El factor regulador neurohormonal de este proceso, es la hormona liberadora de gonadotropinas (GnRH), sintetizada y liberada principalmente por el hipotÃ¡lamo. Debido a que la actividad reproductiva de los peces es estacional, la sincronizaciÃ³n de la secreciÃ³n hormonal con el medio ambiente es un evento crÃ­tico. En este sentido, la participaciÃ³n de la hormona melatonina en el control diario y estacional de estas funciones es bastante conocido en los vertebrados superiores, sin embargo, en los peces tropicales, estos sistemas no han sido estudiados. El presente trabajo representa un primer esfuerzo en la bÃºsqueda de relaciones morfolÃ³gicas y funcionales entre la hormona melatonina y el eje reproductivo neuronendocrino en una especie de bagre de nuestra regiÃ³n, conocido como \"Sierra Negra\",Oxydoras sifontesi,, (Familia Doradidae). Para ello se desarrollaron 3 objetivos especÃ­ficos que en resumen buscan: describir la morfologÃ­a y la neuroanatomÃ­a del cerebro; determinar la distribuciÃ³n de las neuronas productoras de la hormona liberadora de las gonadotropinas (GnRH); y de los receptores de melatonina en el encÃ©falo del bagre, utilizando diferentes tÃ©cnicas inmunohistiquÃ­micas. Para ello, se utilizaron las tÃ©cnicas de tinciÃ³n con hematoxilina/eosina para el estudio neuroanatÃ³mico; autoradiografÃ­a de receptor utilizando como ligando radiactivo la 2-[(125)I]-yodomelatonina para la detecciÃ³n de los receptores de melatonina; y la inmunohistoquÃ­mica para localizar las neuronas inmunoreactivas a GnRH (GnRHir).Los resultados muestran una aparente colocalizaciÃ³n de las neuronas GnRHir y de los receptores de melatonina en los nÃºcleos hipofisiotrÃ³picos hipotÃ¡lamicos, asÃ­ como en otras Ã¡reas cerebrales involucradas en el control de la actividad reproductiva, en el procesamiento visual y en la modulaciÃ³n de la conducta sexual (p.. ej., los nÃºcleos anterioris tuberis, nÃºcleo glomerulosus, nÃºcleo diffusus torus lateralis, nÃºcleo preglomerulosus y nÃºcleo lateralis tuberis). Estas evidencias sustentan la hipÃ³tesis que la melatonina pudiera participar en la modulaciÃ³n de la producciÃ³n de la GnRH en esta especie, tal y como se ha reportado en algunas especies de teleÃ³steos.','2009-10-28','teleÃ³steos, GnRH, receptores de melatonina, reproducciÃ³n, cerebro, hipotÃ¡lamo.',1,1,1,1,2,'2013-09-17 08:28:59','2013-09-17 08:28:59','Documento_273.pdf','application/pdf',4100952,'2013-09-17 08:28:59',20,0,154,'COMPLETO'),(273,'Estudios de el efecto de las resinas I y II como estabilizantes de asfaltenos en soluciÃ³n','El crudo estÃ¡ constituido segÃºn su composiciÃ³n SARA por componentes tales como: saturados, aromÃ¡ticos y macromolÃ©culas complejas de alto peso molecular conocidas como resinas y asfaltenos. Estos componentes se constituyen como un sistema complejo y en el cual los asfaltenos y las resinas forman la fase dispersa mientras que los maltenos (saturados, aromÃ¡ticos y una porciÃ³n de resinas) la fase continua o dispersante. Algunos autores han reportado la existencia de dos fracciones de resinas en el crudo, una de ellas se encuentra como parte del agregado coloidal de la fracciÃ³n asfaltÃ©nica y denominada resinas I, y la otra fracciÃ³n se encuentra en los maltenos denominada resinas II. El objetivo fundamental del presente trabajo fue el estudio del efecto dispersante de resinas I y resinas II sobre la floculaciÃ³n de asfaltenos en soluciÃ³n de tolueno. A partir de muestras de crudos venezolanos de diferente estabilidad, como crudo Furrial (inestable) y Carabobo (estable) se obtuvieron las muestras de asfaltenos resinas I y resinas II. El estudio del efecto estabilizador se realizÃ³ empleando un equipo de dispersiÃ³n de luz, el cual es automatizado y permite determinar el umbral de floculaciÃ³n de asfaltenos en soluciÃ³n de tolueno, el cual se induce por la adiciÃ³n de n-heptano como agente precipitante. Los resultados mostraron diferencias en el poder de estabilizaciÃ³n de asfaltenos con el tipo y concentraciÃ³n de resinas en la soluciÃ³n. Las resinas II resultaron ser mÃ¡s eficientes en la estabilizaciÃ³n de los asfaltenos, siendo las resinas II provenientes del crudo estable las que mostraron un efecto mayor. La estabilizaciÃ³n de asfaltenos se alcanza a partir de relaciÃ³n resinas /asfaltenos superior a 1.A partir del estudio cinÃ©tico ensayado a fin de evaluar las diferencias en la velocidad de agregaciÃ³n aparente de los asfaltenos y su relaciÃ³n con las diferencias en la participaciÃ³n de las resinas I y resinas II en el mecanismo de agregaciÃ³n asfaltenos, se encontrÃ³ que la constante de velocidad de agregaciÃ³n es mayor para el sistema resinas II - asfaltenos. La diferencia en la velocidad de agregaciÃ³n permite proponer mecanismos de estabilizaciÃ³n, por parte de los dos tipos de resinas, tambiÃ©n diferentes. Por lo que se propone que la diferencia debe estar relacionada con el tamaÃ±o y nÃºmero de flÃ³culos, donde una fracciÃ³n de resinas modifica el mecanismo de agregaciÃ³n retardando la formaciÃ³n de flÃ³culos de gran tamaÃ±o y el otro grupo de resinas interactÃºan con los asfaltenos produciendo sobre sus agregados un efecto estÃ©rico, estabilizÃ¡ndolos aÃºn en presencia de mayor proporciÃ³n de agente precipitante.','2009-10-29','floculaciÃ³n, asfaltenos, resinas.',6,1,1,1,1,'2013-09-17 08:29:03','2013-09-17 08:29:03','Documento_274.pdf','application/pdf',594323,'2013-09-17 08:29:03',18,0,57,'COMPLETO'),(274,'Estudio de la distribuciÃ³n de Cd, Fe, Zn y Mn en tejido de ratas dosificadas con Cd y Zn','Estudio de la influencia del Cd y Zn sobre los niveles de Cd, Fe, Mn y Zn en tejido de hÃ­gado y riÃ±Ã³n de ratas','2009-09-11','Cd, Fe, Mn, Zn, hÃ­gado, riÃ±Ã³n y ratas',6,1,1,1,1,'2013-09-17 08:29:04','2013-09-17 08:29:04','Documento_275.pdf','application/pdf',1868828,'2013-09-17 08:29:04',19,0,164,'COMPLETO'),(275,'Estudio hidrogeoquÃ­Ã­mico de las aguas subterrÃ¡Ã¡neas de la Cuenca de los Valles del Tuy en el sector de Charallave--Paracotos,,Edo.. Miranda,, Venezuela','El crecimiento demogrÃ¡fico, junto con el desarrollo urbanÃ­stico e industrial en el estado Miranda, especÃ­ficamente en la regiÃ³n de Charallave y Paracotos, han motivado el estudio de la calidad de las aguas subterrÃ¡neas en funciÃ³n de su composiciÃ³n quÃ­mica. Para ello, fueron captadas 22 de pozos y 3 muestras de aguas superficiales, ubicadas en ambos sectores. La evaluaciÃ³n de estas aguas fue realizada mediante la mediciÃ³n de los parÃ¡metros fisicoquÃ­micos pH, temperatura, conductividad y alcalinidad, seguido de la determinaciÃ³n de las especies quÃ­micas Na+, K+, Ca2+, Mg 2+, Cl-, HCO3-, SO42- , NO3- y sÃ­lice disuelta (SiO2), mediante las tÃ©cnicas de AbsorciÃ³n y EmisiÃ³n AtÃ³mica, CromatografÃ­a IÃ³nica y Espectroscopia de AbsorciÃ³n AtÃ³mica UV-Visible. Para la caracterizaciÃ³n de las aguas fue utilizado el diagrama de Piper, la distribuciÃ³n espacial, la variaciÃ³n de los datos expresados en cajas grÃ¡ficas y relaciones interelelmentales. Asimismo, diagramas como el de Gibbs y el cÃ¡lculo del Ã­ndice de saturaciÃ³n (IS) de algunas especies minerales, ayudaron a la interpretaciÃ³n de los procesos controladores de la composiciÃ³n de las aguas subterrÃ¡neas. El tipo de agua identificadas para la regiÃ³n de Charallave y Paracotos son bÃ¡sicamente dos grupos: sulfatadas cÃ¡lcicas (Ca2+- SO42-) y/o magnÃ©sicas (Mg2+- SO42-) y bicarbonatadas cÃ¡lcicas (Ca2+- HCO3-) y/ o magnÃ©sicas (Mg2+- HCO3-). Donde procesos como la disoluciÃ³n e hidrÃ³lisis de minerales como calcita y anhidrita son los que controlan la composiciÃ³n de estas aguas a travÃ©s de la interacciÃ³n agua-roca. Sin embargo, existe evidencia de la influencia de las actividades antrÃ³picas sobre las caracterÃ­sticas quÃ­micas de estas aguas.','2009-10-26','{}',4,1,1,1,1,'2013-09-17 08:29:06','2013-09-17 08:29:06','Documento_276.pdf','application/pdf',1632170,'2013-09-17 08:29:06',19,0,116,'COMPLETO'),(276,'Desarrollo del Sistema de GestiÃ³n AcadÃ©mica CONEST 2.0: MÃ³dulo de Reportes, Constancias y Tareas en Lote','MÃ³dulo de reportes, constancias y tareas en lote del sistema CONEST 2.0, basadas en las nuevas tecnologÃ­as Ruby 1.9, Rails 2.2 y MySQL 5.0. Las funcionalidades ofrecen una mayor usabilidad y rendimiento que las presentes en el sistema CONEST y permite el ahorro de recursos en la impresiÃ²n fÃ¬sica de documentos.','2009-11-02','CONEST, CONEST 2.0, Ruby, Rails, MySQL, BackgrounDRb, reportes, constancias, tareas en lote.',2,1,1,1,1,'2013-09-17 08:29:09','2013-09-17 08:29:09','Documento_277.pdf','application/pdf',1412410,'2013-09-17 08:29:09',20,0,76,'COMPLETO'),(277,'ElaboraciÃ³n de harina de plÃ¡tano para la formulaciÃ³n de productos instantÃ¡neos tipo atol con bajo y alto contenido de fenilalanina','La elaboraciÃ³n de fÃ³rmulas infantiles con bajo contenido de fenilalanina a base de harina de plÃ¡tano verde, le ofrece a los pacientes fenilcetonÃºricos una opciÃ³n para mantener su dieta especial. En el mercado venezolano se encuentran pocos productos dirigidos a este tipo de pacientes que, en su mayorÃ­a, son importados. El uso de un insumo de producciÃ³n nacional como lo es el plÃ¡tano transformado en harina para elaborar estos productos, disminuirÃ­a los costos de estos alimentos y mantendrÃ­a disponibilidad de los mismos en el mercado. La harina de plÃ¡tano es rica en carbohidratos y fibra, por lo que se dispondrÃ­a de un alimento de gran valor nutricional. Por otra parte, la formulaciÃ³n de alimentos tipo atol enriquecido con leche completa serÃ­a un producto con alto contenido de proteÃ­nas, que puede ser dirigido a cualquier sector de la poblaciÃ³n. El objetivo de este trabajo fue desarrollar productos instantÃ¡neos a base de harina de plÃ¡tano verde, con baja y alta concentraciÃ³n de fenilalanina. Para alcanzar los objetivos propuestos, los frutos fueron recolectados en la poblaciÃ³n de Ocumare de la Costa en el estado Aragua en plantaciones asesoradas por el CENIAP-Maracay (Centro Nacional de InvestigaciÃ³n Agropecuaria). Se elaborÃ³ la harina de plÃ¡tano verde y se formularon dos productos instantÃ¡neos tipo atol, con bajo contenido de fenilalanina dirigido a pacientes fenilcetonÃºricos y con alto contenido de fenilalanina dirigido a la poblaciÃ³n general. Para la caracterizaciÃ³n de la harina de plÃ¡tano y de los productos elaborados se realizaron anÃ¡lisis fÃ­sicos y quÃ­micos; asÃ­ como pruebas de evaluaciÃ³n sensorial en los productos elaborados. Se encontrÃ³ que la harina de plÃ¡tano precocida es un producto con bajo contenido de fenilalanina que puede ser utilizado en formulaciones para la elaboraciÃ³n de productos como bebidas instantÃ¡neas de buena calidad dirigido a pacientes fenilcetonÃºricos y se demostrÃ³ la factibilidad de elaborar dos productos tipo atol con bajo y alto contenido de fenilalanina.','2009-10-16','Harina, PlÃ¡tano, ComposiciÃ³n, Atol, Instantaneo, Fenilalanina.',1,1,1,1,1,'2013-09-17 08:29:10','2013-09-17 08:29:10','Documento_278.pdf','application/pdf',1046053,'2013-09-17 08:29:10',20,0,123,'COMPLETO'),(278,'Ultraestructura de adenocarcinomas y sus efectos peritumorales en pacientes tratados con quimioterapia y radioterapia..','El cÃ¡ncer es una enfermedad caracterizada por la proliferaciÃ³n incontrolada e inadecuada de cÃ©lulas que morfolÃ³gica y funcionalmente son inmaduras y aberrantes, con capacidad para invadir los tejidos adyacentes y diseminarse a distancia. El cÃ¡ncer es la segunda causa de muerte en Venezuela, siendo sÃ³lo superado por enfermedades del corazÃ³n. Alrededor del 40% de los tumores malignos de colon estÃ¡n situados en el recto y es la tercera causa de muerte por cÃ¡ncer en el mundo con una tasa de incidencia 10 veces mayor en paÃ­ses desarrollados que en paÃ­ses en desarrollo. El cÃ¡ncer de colon y recto representa en nuestro paÃ­s la mayor incidencia despuÃ©s de los tumores de pulmÃ³n, prÃ³stata y estÃ³mago en los hombres, y luego de cuello uterino y mama en mujeres. MÃ¡s del 95% de los tumores del recto son adenocarcinomas. Existen diferentes tipos de tratamientos para todos los pacientes con cÃ¡ncer del recto, utilizÃ¡ndose principalmente tres tipos de tratamiento estÃ¡ndar: quimioterapia, radioterapia y cirugÃ­a. Con este trabajo se intenta ampliar el conocimiento que sobre la ultraestructura de los tumores gastrointestinales existe actualmente, conocimiento que es importante dado la alta incidencia actual de los tumores gastrointestinales en nuestro paÃ­s. Para el logro de esta investigaciÃ³n, las muestras se sometieron al procesamiento rutinario de corte fino para microscopÃ­a electrÃ³nica de transmisiÃ³n. Los resultados obtenidos tanto a nivel tumoral como peritumoral en pacientes tratados y no tratados incluyeron cuadros de atrofia en cÃ©lulas epiteliales y en cÃ©lulas musculares lisas con incremento significativo de vacuolas autofÃ¡gicas, degeneraciÃ³n con subsiguiente necrosis tanto en cÃ©lulas musculares lisas como en la inervaciÃ³n amielÃ­nica y en algunos infiltrados celulares. AÃºn cuando los capilares mostraron diferentes alteraciones (engrosamiento del endotelio, prolongaciones del mismo hacia la luz del vaso, oclusiÃ³n de la luz, engrosamiento y reduplicaciÃ³n de membrana basal), en los mismos no se observÃ³ necrosis. Por su parte, en el Ã¡rea tumoral, en pacientes tratados se localizaron cuadros apoptÃ³ticos, pudiendo ello estar relacionado con un efecto beneficioso del tratamiento antineoplÃ¡sico, dada la relaciÃ³n inversa que existe entre apoptosis y malignidad. Sin embargo, la similitud en el grado de alteraciÃ³n de otras estructuras celulares y extracelulares perecen sugerir que el tratamiento por lo menos no eliminÃ³ del todo los efectos del tumor ni los peritumorales. Estos resultados apoyan a otras investigaciones en el sentido de que los tejidos que rodean a diferentes tipos de tumores primarios no son normales, siendo sumamente importante estudiar su ultraestructura para un mejor conocimiento del proceso tumoral.','2009-07-08','CÃ¡ncer colorrectal, alteraciones ultraestructurales',1,1,1,1,1,'2013-09-17 08:29:11','2013-09-17 08:29:11','Documento_279.pdf','application/pdf',763185,'2013-09-17 08:29:11',19,0,92,'COMPLETO'),(279,'Efecto de la mezcla Resina cruda/TOFA sobre la formaciÃ³n de Macroemulsiones de aceite en agua (O/W) y sus propiedades como fluido de completaciÃ³n de pozos.','La industria petrolera emplea una variedad de surfactantes que son utilizados para la formulaciÃ³n de fluidos de perforaciÃ³n, completaciÃ³n y rehabilitaciÃ³n de pozos, estos aditivos en su mayorÃ­a son importados y aÃ±aden un valor agregado en la formulaciÃ³n de dichos fluidos. Durante los Ãºltimos aÃ±os en nuestro paÃ­s se han venido estudiando alternativas para disminuir la dependencia de estos aditivos y poder formular nuestros propios fluidos con materia prima nacional. Para lograr este objetivo se ha propuesto emplear como surfactante natural una resina cruda extraÃ­da de las cortezas de pino caribe de Uverito proveniente de las plantaciones de CVG - Proforca, y una mezcla de Ã¡cidos grasos y su sal, mejor conocida como TOFA, siendo esta ultima importada. El alcance de esta investigaciÃ³n se basa en emplear una mezcla surfactante Resina cruda/ TOFA para la formaciÃ³n de emulsiones (O/W), de manera de crear un efecto sinergÃ­stico que mejore las propiedades del fluido y tenga potencial aplicaciÃ³n en la completaciÃ³n de pozos. Para ello se evaluaron formulaciones con distintas relaciones RC/TOFA, concentraciones de sal, para concentraciones de la mezcla en 1,5 y 2 % p/p, en pruebas de estabilidad estÃ¡tica, dinÃ¡mica, comportamiento reolÃ³gico, diferentes interacciones en pruebas de compatibilidad y finalizando con un estudio completo en pruebas de desplazamiento del tipo dinÃ¡mico y semidinÃ¡mico, empleando crudo Urdaneta del pozo UD-300. Se obtuvieron emulsiones con diÃ¡metros de gotas menores a 10 Âµm siendo estables a 40Â°C solo para las relaciones de RC/TOFA 75/25 en ambas concentraciones de la mezcla estudiada, tolerando temperaturas de envejecimiento hasta 250Â°F (121 Â°C) para formulaciones con 1% p/p de KCl. Con esto se concluye que la mezcla surfactante RC/TOFA origina una sinergia positiva incrementando la estabilidad de las emulsiones de aceite BiodoilÂ® en agua ((O/W)) y obteniÃ©ndose bajos daÃ±os a la formaciÃ³n, ubicando a este fluido como candidato potencial para su aplicaciÃ³n en las Ã¡reas de completaciÃ³n de pozos petroleros en nuestro paÃ­s.','2009-10-26','resina cruda, emulsiones, TOFA, fluidos de completaciÃ³n',6,1,1,1,1,'2013-09-17 08:29:13','2013-09-17 08:29:13','Documento_280.pdf','application/pdf',6041275,'2013-09-17 08:29:13',20,0,157,'COMPLETO'),(280,'Soluciones polinomiales de la ecuaciÃ³n en diferencias de tipo hipergeomÃ©trica','{}','2009-06-29','{}',5,1,1,1,1,'2013-09-17 08:29:15','2013-09-17 08:29:15','Documento_281.pdf','application/pdf',1993922,'2013-09-17 08:29:15',20,0,139,'COMPLETO'),(281,'IDENTIFICACION DEL COMPUESTO PRESENTE EN EL EXTRACTO DE BAUHINIA MEGALANDRA,, RESPONSABLE DE LA INHIBICION DE LA ABSORCION INTESTINAL DE GLUCOSA','Uno de los principales factores que incrementan la glicemia se encuentra la absorciÃ³n intestinal de glucosa, por lo cual el reducir la mis