n VIH, es la Toxoplasmosis causada por un protozoario obligatorio intracelular denominado Toxoplasma gondii. Cabe destacar que en personas inmunocompetentes, la infecciÃ³n por T.. gondii es latente, generalmente asintomÃ¡tica, no obstante, la inmunodeficiencia causada por la infecciÃ³n con VIH puede conllevar a una reactivaciÃ³n de la infecciÃ³n parasitaria, desarrollando graves afecciones a nivel del sistema nervioso central. En pacientes co-infectados con VIH+/Tx+ con un mayor progreso de la infecciÃ³n viral, los bradizoÃ­tos pueden reactivarse y manifestarse una encefalitis toxoplÃ¡smica. En nuestros estudios nos interesÃ³ evaluar si la progresiÃ³n de la infecciÃ³n viral afectarÃ­a a la respuesta del linfocito T CD4 contra T.. gondii generando una mayor inmunodeficiencia, por lo que pudiese influir en la clÃ­nica de los pacientes VIH+ con serologÃ­a positiva. Estudiamos la funciÃ³n de los linfocitos T CD4+ de pacientes VIH+ con serologÃ­a positiva para T.. gondii, en diferentes estadios de la infecciÃ³n viral, buscando una mejor comprensiÃ³n de los mecanismos inmunopatolÃ³gicos que estÃ¡n afectando al cuadro de co- infecciÃ³n. Los resultados de los ensayos ex vivo observamos mayores alteraciones en la expresiÃ³n de ciertas molÃ©culas que relacionan con la muerte/ supervivencia y funcionalidad de linfocitos TCD4 de pacientes co-infectados en relaciÃ³n a los infectados por VIH solamente, lo cual, pudiese explicar el por quÃ© aquellos pacientes co-infectados mÃ¡s inmunodeficientes (<200 CD4/ml) presentaron valores menores de cÃ©lulas TCD4+ en sangre en relaciÃ³n a pacientes a pacientes VIH+ mÃ¡s inmunodeficientes (<200 CD4/ml). Cabe destacar que este grupo de pacientes co-infectados mÃ¡s inmunodeficientes presentaron una tendencia mayor de carga viral en comparaciÃ³n a los pacientes mÃ¡s inmunodeficientes, infectados solamente con el virus, la cual indica que este parÃ¡metro puede estar jugando tambiÃ©n un papel fundamental en la disminuciÃ³n de niveles sanguÃ­neos de cÃ©lulas TCD4,. , Por otra parte, se encontrÃ³ que los pacientes co-infectados presentaron a un valor similar de la frecuencia de apoptosis o muerte celular en cÃ©lulas TCD4+ sanguÃ­neas en relaciÃ³n a los grupos de pacientes VIH, a pesar, que presentaron una mayor sobre-expresiÃ³n de las molÃ©culas Fas/CD95, HLA-DR y PD-1 y una menor expresiÃ³n de IL-7a en los linfocitos TCD4 totales, vÃ­rgenes y memoria, particularmente de los pacientes co-infectados mÃ¡s inmunodeficientes con respecto a los pacientes VIH. Finalmente, en referencia a los mecanismos efectores de los linfocitos T CD4, se encontrÃ³ que la capacidad de proliferaciÃ³n con estimulaciÃ³n mitogÃ©nica (PHA) se perdiÃ³ parcialmente en los grupos de pacientes. En presencia de antÃ­genos T.. gondii, los pacientes VIH/Tx+ aÃºn no han perdido esa respuesta proliferativa especifica al protozoario pero hay una tendencia a disminuir en presencia de la infecciÃ³n viral. En presencia o estimulaciÃ³n especÃ­fica a antÃ­genos del virus, los pacientes VIH estaba significativamente mÃ¡s perdida la respuesta de proliferaciÃ³n vs los pacientes co-infectados, indicando que la respuesta anti- VIH por los linfocitos T CD4 es afectada por la infecciÃ³n viral, mientras que la co-infecciÃ³n pareciera ejercer un efecto menos drÃ¡stico en tal pÃ©rdida de clones anti-VIH. Todos estos resultados pueden estar ocasionando importantes efectos sobre la inmunidad contra el parÃ¡sito, ocasionando en aquellos pacientes realmente infectados por T.. gondii en un futuro, una reactivaciÃ³n de la infecciÃ³n parasitaria que puede establecer una cuadro de encefalitis, generalmente letal.','2009-10-23','VIH, Toxoplasma gondii, linfocito TCD4, apoptosis, receptores, activacion, co- infecciÃ³n.',1,1,1,1,1,'2013-09-17 08:29:20','2013-09-17 08:29:20','Documento_283.pdf','application/pdf',4192458,'2013-09-17 08:29:20',19,0,121,'COMPLETO'),(283,'Desarrollo de una AplicaciÃ³Ã³nn Adaptativa para el Control de PrÃ©Ã©stamo de los Equipos del Centro de ComputaciÃ³Ã³nn','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicaciÃ³n para el control de prÃ©stamos de los equipos del Centro de ComputaciÃ³n de la Facultad de Ciencias de la UCV. Dicha aplicaciÃ³n es adaptativa, es decir que su interfaz de usuario (basada en tecnologÃ­a Web) se puede visualizar tanto en un computador de escritorio como en un dispositivo mÃ³vil pequeÃ±o. El documento comienza con el estudio teÃ³rico de todos los conceptos necesarios que se tomaron en cuenta para el desarrollo de este proyecto. La metodologÃ­a utilizada para la implementaciÃ³n consiste en una metodologÃ­a iterativa adaptada al modelo de desarrollo Ã¡gil, donde una iteraciÃ³n refleja el proceso de creaciÃ³n de un mÃ³dulo de la aplicaciÃ³n. La tecnologÃ­a utilizada para el desarrollo de la aplicaciÃ³n incluye el servidor Web Apache versiÃ³n 2.2.8, el lenguaje de programaciÃ³n PHP versiÃ³n 5.2.5 y el servidor de base de datos MySQL versiÃ³n 5.0.51a. Cabe destacar que todas estas herramientas utilizadas son open source (cÃ³digo abierto). La aplicaciÃ³n desarrollada es capaz de adaptarse a diferentes dispositivos, ofreciendo a los usuarios todas las funciones independientemente del dispositivo que se utilice, donde la Ãºnica diferencia percibida es la interfaz. Las principales funciones de la aplicaciÃ³n consisten en registrar la entrada y salida de los equipos del Centro de ComputaciÃ³n, para asÃ­ tener un mejor control de estos.','2009-09-15','Redes,, Dispositivos InalÃ¡Ã¡mbricos,, Dispositivos MÃ³Ã³vviles,, Web MÃ³Ã³vvil,, PDA,, Web,, PHP,, MySQL',2,1,1,1,1,'2013-09-17 08:29:21','2013-09-17 08:29:21','Documento_284.pdf','application/pdf',3889705,'2013-09-17 08:29:21',12,0,130,'COMPLETO'),(284,'SÃÃNNTESIS DE POLIESTIRENO Y POLI ((METIL METACRILATO)),, EMPLEANDO CATALIZADOR DEL TIPO a-- DIIMINA DE COBRE,, A TRAVÃ‰Ã‰SS DE POLIMERIZACIÃ“Ã“NN VÃÃAA RADICAL POR TRANSFERENCIA ATÃ“Ã“MMICA ((ATRP))','En el presente trabajo se sintetiza el complejo a-diimina de cobre: Diacetilbutil-(2,4,6-trimetil-fenil)iminacobre (I) partiendo del ligando Diacetilbutil-(2,4,6-trimetil-fenil)imina y cloruro de cobre (I), con el propÃ³sito de ser empleado como catalizador en la sÃ­ntesis de poli (metil metacrilato) (PMMA), con cloruro de bencenosulfonilo como iniciador (en fase homogÃ©nea) y tolueno como solvente. Los resultados experimentales muestran que es posible la reacciÃ³n de ATRP del metil metacrilato (MMA) con los reactivos mencionados, siendo la mejor condiciÃ³n experimental de polÃ­merizaciÃ³n la combinaciÃ³n de (0,0005 Â± 0,0001) mmol de catalizador y (0,34 Â± 0,06) mmol de iniciador; asimismo se registra mayor cantidad de polÃ­mero a la temperatura de 40 ÂºC. Se percibe que para aquellos procesos donde el catalizador es generado \"in situ\" partiendo de cantidades equimolares (0,0005 Â± 0,0001) mmol de sal de cobre y ligando, la productividad de PMMA es mucho menor; sin embargo, anÃ¡logo a lo anterior el parÃ¡metro de temperatura favorece la reacciÃ³n. De forma adicional y a manera de comparaciÃ³n, se efectÃºan reacciones con la amina bidentada N,N,NÂ´,NÂ´-tetrametiletilendiamina y cloruro de cobre (I) bajo las condiciones planteadas para el catalizador a-diimina, en donde no se genera producto para cada uno de los casos.','2009-10-29','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',6,1,1,1,1,'2013-09-17 08:29:22','2013-09-17 08:29:22','Documento_285.pdf','application/pdf',2581041,'2013-09-17 08:29:22',20,0,172,'COMPLETO'),(285,'DETERMINACION DE ELEMENTOS TRAZA EN SUERO SANGUINEO DE SUJETOS SANOS, CON HIPERPLASIA PROSTATICA Y CON CANCER PROSTATICO, POR ESPECTROMETRIA DE EMISION OPTICA CON PLASMA INDUCTIVAMENTE ACOPLADO.','En el presente trabajo se estudiaron las concentraciones de Cu, Zn y Se en suero sanguÃ­neo de pacientes sanos, con hiperplasia prostÃ¡tica benigna y cÃ¡ncer de prÃ³stata por espectrometrÃ­a de emisiÃ³n atÃ³mica con plasma inductivamente acoplado. Se analizaron 97 muestras tomadas en pacientes del Hospital ClÃ­nico Universitario de Caracas de individuos de diferentes edades, de las cuales 15 fueron de pacientes sanos, 61 con hiperplasia benigna prostÃ¡tica, y 21 sufrÃ­an de cÃ¡ncer de prÃ³stata. Se encontrÃ³ que el Cu estÃ¡ presente en menores cantidades en pacientes sanos que en pacientes con hiperplasia prostÃ¡tica o con cÃ¡ncer. Para el Se, se observÃ³ que Ã©ste ejerce un efecto protector ya que su concentraciÃ³n es mayor en personas sanas que en personas con hiperplasia prostÃ¡tica, y a su vez estÃ¡ en mayores proporciones en este Ãºltimo grupo que en personas con cÃ¡ncer. Para el Zn se observÃ³ una dÃ©bil variaciÃ³n en su comportamiento, sin embargo no se determinÃ³ que existan diferencias estadÃ­sticamente significativas en sus valores de concentraciÃ³n en los tres grupos. Se encontraron correlaciones en los valores de las relaciones de concentraciones Cu/Zn, Se/Cu y Se/Zn de pacientes sanos, con hiperplasia prostÃ¡tica y con cÃ¡ncer de prÃ³stata. La relaciÃ³n Cu/Zn, disminuye en pacientes sanos con respecto a pacientes con cÃ¡ncer. La relaciÃ³n Se/Zn disminuye en pacientes con cÃ¡ncer con respecto a los individuos sanos. La relaciÃ³n Se/Cu es la mÃ¡s sensible de las tres relaciones estudiadas, debido a que las concentraciones de Se y Cu presentan mayores variaciones entre los tres grupos.','2009-10-30','Elementos Traza, CÃ¡ncer, CÃ¡ncer de PrÃ³stata, Hiperplasia ProstÃ¡tica, Niveles de elementos traza en suero humano',6,1,1,1,1,'2013-09-17 08:29:23','2013-09-17 08:29:23','Documento_286.pdf','application/pdf',2231638,'2013-09-17 08:29:23',18,0,177,'COMPLETO'),(286,'OrganizaciÃ³n, GestiÃ³n y AnÃ¡lisis de Datos de Levantamiento de Suelos Mediante un Agente de Software','Uno de los principales problemas encontrados en el proceso de levantamiento de suelos, estÃ¡ relacionado con la manera de organizar la informaciÃ³n que se genera relativa a los suelos, debido a las distintas fuentes de informaciÃ³n que son utilizadas tales como imÃ¡genes satelitales, levantamiento de suelos, resultados de distintas pruebas de laboratorio, entre otros. Esta falta de organizaciÃ³n dificulta el almacenamiento y posterior ubicaciÃ³n de manera rÃ¡pida y concisa de la informaciÃ³n por parte de los investigadores. Con el fin de apoyar a los edafÃ³logos en el estudio de suelos, toma de decisiones sobre el uso apropiado de este recurso y realizar predicciones mÃ¡s precisas sobre usos especÃ­ficos de ellos, este anÃ¡lisis permite su clasificaciÃ³n determinando asÃ­ su disponibilidad en calidad, cantidad y distribuciÃ³n. En este trabajo se propone un agente de software que gestione y almacene los datos inherentes a los perfiles de suelos; siendo este el nÃºcleo de un Sistema Basado en Agentes (SBA) que apoye a los profesionales de agronomÃ­a en sus labores rutinarias de captura, gestiÃ³n y clasificaciÃ³n de la informaciÃ³n. Este sistema permitirÃ¡ gestionar la informaciÃ³n relacionada con los aspectos propios del suelo y otras variables geogrÃ¡ficas de un espacio particular, mediante la carga de informaciÃ³n y consultas complejas que permitirÃ¡n al usuario descifrar de manera mÃ¡s simple todo lo relacionado con los suelos, indicando sus potencialidades y limitaciones mÃ¡s importantes, asÃ­ como, la superficie que ellos ocupan y donde se ubican los que poseen ciertas caracterÃ­sticas particulares. Durante el desarrollo del Sistema de Software se realizaron diversas investigaciones sobre las metodologÃ­as mÃ¡s utilizadas para el desarrollo de Sistemas Basado en Agentes. Se aplicÃ³ la metodologÃ­a MAS-CommonKADS, debido a que esta posee herramientas para determinar todos los elementos que interactÃºan junto a sus relaciones, lo cual permite poder identificar de forma precisa los actores activos y pasivos. Por esto, al usar esta metodologÃ­a se logro diseÃ±ar un modelo de Sistema Multi-Agentes el cual sirviÃ³ de guÃ­a durante todo el desarrollo y posteriormente formular los objetivos que llevaron a la mejor soluciÃ³n mediante la elaboraciÃ³n de requisitos.','2009-10-30','MAS-CommonKADS, Multi-Agentes, Suelos, Gestionar, Software.',2,1,1,1,1,'2013-09-17 08:29:27','2013-09-17 08:29:27','Documento_287.pdf','application/pdf',1251071,'2013-09-17 08:29:27',19,0,104,'COMPLETO'),(287,'MODELADO DE LA INTERACCIÃ“Ã“NN DE RADICALES LIBRES SOBRE SUPERFICIES DE HIDROCARBUROS POLIAROMÃÃTTICOS ((PAH))..','En este trabajo se modela, usando el mÃ©todo cuÃ¡ntico paramÃ©trico MINDO/SR incluido en el paquete CATIVIC, la interacciÃ³n quÃ­mica de las especies radicales (adsorbatos) metileno (CH2o), metilo (CH3o), amino (NH2o) e hidrÃ³xilo (OHo), sobre un modelo de coroneno cargado positivamente (sustrato). Este Ãºltimo tiene hidrogenado todos los Ã¡tomos de carbono externos para saturar los bordes, ademÃ¡s tiene quimisorbidos sobre la superficie Ã¡tomos de hidrÃ³geno. A travÃ©s, de la metodologÃ­a planteada en el paquete CATIVIC, se determinÃ³ la formaciÃ³n de las especies sustrato-adsorbato (S-A), para cada uno de los radicales nombrados anteriormente, se obtiene que es posible la formaciÃ³n de especies S-A tales como [Coro-H-CH2]+, [Coro-H-NH2]+ y [Coro-H-OH]+, las cuales interaccionan a travÃ©s de uno o dos enlaces, en estructuras de tipo puente. TambiÃ©n se estudiÃ³ la formaciÃ³n de las especies moleculares metilo (CH3o), metano (CH4), amoniaco (NH3) y agua (H2O), a partir de la interacciÃ³n, a travÃ©s del mecanismo Eley-Rideal (ER), de los radicales CH2o, CH3o, NH2o yOHo, sobre los hidrÃ³genos quimisorbidos en la superficie del sustrato. De igual manera, se estudiÃ³ la formaciÃ³n de las mismas especies moleculares, a partir de intermediarios encontrados en este trabajo, a travÃ©s del mecanismo Langmuir- Hinshelwood (LH). Se encuentra que la vÃ­a mÃ¡s adecuada para formar estas especies, es la vÃ­a ER. AdemÃ¡s a lo anterior se hallÃ³ que es posible la formaciÃ³n de metilamina y metanol a partir de la reacciÃ³n, vÃ­a ER, de la especie radical libre CH3o con un intermediario en el cual estÃ¡n adsorbidos el NH2o y el OHo sobre el sustrato.','2009-07-13','Hidrocarburos poliaromÃ¡ticos, radicales libres, adsorbato, sustrato y mÃ©todos cuÃ¡nticos paramÃ©tricos.',6,1,1,1,1,'2013-09-17 08:29:28','2013-09-17 08:29:28','Documento_288.pdf','application/pdf',0,'2013-09-17 08:29:28',19,0,0,'INCOMPLETO'),(288,'DETERMINACIÃ“Ã“NN DE LA FACTIBILIDAD DEL SISTEMA ARN ANTISENTIDO COMO HERRAMIENTA DE ANÃÃLLISIS GENÃ‰Ã‰TTICO EN Trypanosoma rangeli,, ACOPLADO AL SISTEMA DE EXPRESIÃ“Ã“NN CONDICIONAL DE GENES ARNpT77//TetR..','Los tripanosomÃ¡tideos constituyen una familia de protozoos que incluye parÃ¡sitos de importancia mÃ©dica y veterinaria, entre los cuales se encuentran Trypanosoma cruzi, Trypanosoma brucei, y las diferentes especies de Leishmaniacausantes de diversos cuadros clÃ­nicos en humanos. Dentro de la familia del orden Kinetoplastida se encuentra Trypanosoma rangeli, parÃ¡sito que infecta a humanos sin patologÃ­as asociadas a la infecciÃ³n en el hospedador vertebrado, el cual comparte con T.. cruzi hospedadores vertebrados e invertebrados, reservorios y en consecuencia la distribuciÃ³n geogrÃ¡fica en el continente Americano. Ambos protozoarios han sido utilizados como modelos experimentales, para conocer y entender los distintos mecanismos que operan en los sistemas de interacciÃ³n parÃ¡sito-hospedador a nivel molecular. Para este abordaje molecular se han desarrollado herramientas genÃ©ticas, particularmente vectores de expresiÃ³n especÃ­ficos para tripanosomatÃ­deos, permitiendo generar el fondo genÃ©tico necesario para la producciÃ³n condicional de ARN antisentido y ARN de interferencia (ARNi) in vivo. Basados en el conocimiento existente de los sistemas inducibles en Tripanosomatideos y la efectividad de la metodologÃ­a del ARNi y ARN antisentido para la inactivaciÃ³n funcional de genes en T.. brucei y Leishmania,, en el Laboratorio de GenÃ©tica Molecular nos hemos planteado determinar la factibilidad del sistema ARN antisentido en T.. rangeli,, acoplado a un sistema de expresiÃ³n condicional de genes utilizando los vectores pLew13 y pTcIndex. La estrategia de trabajo planteo la construcciÃ³n de lÃ­neas estables de T.. rangeli mediante la inserciÃ³n de pLew13 lineal en el genoma, mediada por recombinaciÃ³n homÃ³loga de la regiÃ³n b tubulina presente en el vector. Contrario a lo esperado, el anÃ¡lisis del Southern blot determinÃ³ la ubicaciÃ³n episomal del vector pLew13 en los clones 1, 3 y 4, sin embargo el anÃ¡lisis por Western blot determinÃ³ la expresiÃ³n estable del gen ARNpT7 en estas tres lÃ­neas. La evaluaciÃ³n preliminar de la organizaciÃ³n de la tanda a- b tubulina en T.. rangeli demostrÃ³ la existencia de un polimorfismo en el sitio HindIII, presente en el gen de a tubulina de la cepa venezolana Triat-1, similar al reportado por Esquenazi y colaboradores (1989) en un aislado venezolano, y ausente en una cepa del amazonas, abriendo la posibilidad de utilizar este marcador para diferenciar los grupos poblacionales descritos en T.. rangeli (Da Silva y col., 2007). La evaluaciÃ³n del sistema ARN antisentido planteo el clonamiento dirigido del gen de a tubulina de T.. rangeli sentido y antisentido en el vector pTcIndex-RFP, utilizando los sitios XbaI y BamHI y partiendo del aislamiento del gen de los recombinantes pTrTriatalfatub 3 y pTrTriatalfatub 4. La verificaciÃ³n de los sitios XbaI y BamHI en pTcIndex-RFP demostrÃ³ la presencia de sitios Ãºnicos de corte en posiciones espaciadas por 1600 pb, impidiendo su utilizaciÃ³n para este clonamiento. En la actualidad planteamos el clonamiento dirigido del gen a tubulina en ambos sentidos en el vector pTcIndexI, utilizando los sitios NotI/BamHI. La transfecciÃ³n de pTcIndexatub en lÃ­neas T.. rangeli Triat-1[pLew13], permitirÃ¡ evaluar la presencia del sistema ARN antisentido en T.. rangeli, permitiendo asÃ­ la utilizaciÃ³n de esta herramienta en el anÃ¡lisis genÃ©tico mediante Knock out funcionales.','2009-10-15','Trypanosoma rangeli, ARN antisentido, pLew13, pTcIndex, sistema inducible, Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0',1,1,1,1,1,'2013-09-17 08:29:30','2013-09-17 08:29:30','Documento_289.pdf','application/pdf',10685459,'2013-09-17 08:29:30',19,0,101,'COMPLETO'),(289,'Efecto de emulsiones asfÃ¡lticas sobre la estructura comunitaria microbiana en microagregados de un suelo de sabana','En las Ãºltimas dÃ©cadas, los volumnes de uso del asfalto en forma de emulsiones asfÃ¡lticas han sido grandes debido a su bajo costo, a las propiedades de hidrofobicidad y a la relativa resistenca a la intemperie (Talavera et al, 2001). Los efectos sobre el ambiente, en particular, sobre el estado de agregaciÃ³n de las particulas del suelo y la comunidad microbiana en suelos de sabana han sido poco estudiados en el Ã¡mbito nacional (Casanova, 1991). Sin embargo, investigaciones llevadas a cxabo a nivel internacional, han demostrado que las emulsiones asfÃ¡lticas o bituminosas, incrmenetan la temperatura del suelo en climas frÃ­os, preservan la humedad del suelo en Ã©pocas de sequÃ­a, y mejoran la estructura del suelo (Jiuzhi et al, 1985). En Venezuela, cerca de un tercio del territorio nacional esta asociado a los ecosistemas de sabana. Estas se caracterizan por ser ecosistemas herbÃ¡ceos tropicales con un estrato arbÃ³reo mÃ¡s o menos uniforme o escaso algunas veces. (Sarmineto, 1990). Por otro lado, la marcada bioestacionalaidad entre Ã©pocas de lluvia y de sequÃ­a, han generado una alta meteorizaciÃ³n del componente suelo, generando suelos de baja fertilidad natural por contener poco aporte de materia orgÃ¡nica (vegetaciÃ³n herbÃ¡cea), ademÃ¡s de presentar un elevado Ã­ndice de lavado de bases ibntercambiables, torenando a estos suelos Ã¡cidos y de poca estructura. En el presente trabajo se evaluÃ³ el efecto de emulsiones aasfÃ¡lticas sobre la estructura de suelos arenosos Ã¡cidos proveniente de las sabanas orientales de PariaguÃ¡n y su efecto sobre la estructura comunitaria microbiana asociada a microagregados. Los resultados mostraron que la estructura comuinitaria no es alterada significativamente por la presencia de estas emulsiones (p=0.05). mientras que la estructura se estabilizo y en algunos casos se incrmentÃ³ el porcentaje de agregados en >10 % en suelos tratados con emulsiÃ³n.','2009-09-04','Comunidad microbiana, emulsiones asfÃ¡lticas, agregados, suelos de sabana',1,1,1,1,1,'2013-09-17 08:29:31','2013-09-17 08:29:31','Documento_290.pdf','application/pdf',576341,'2013-09-17 08:29:31',17,0,66,'COMPLETO'),(290,'EvaluaciÃ³n de mÃ©todos para la preservaciÃ³n de cepas bacterianas de uso frecuente como control en microbiologÃ­a de alimentos','RESUMEN Uno de los principales problemas en la mayorÃ­a de los laboratorios de microbiologÃ­a es la preservaciÃ³n de las cepas bacterianas que se mantienen como muestras de referencia o control para los mÃºltiples ensayos o pruebas inherentes a la actividad microbiolÃ³gica. CentrÃ¡ndonos en esto, es necesario evaluar para disponer de un mÃ©todo sencillo, econÃ³mico, el cual no requiera de procesos complejos y equipos sofisticados, aplicable en cualquier laboratorio de microbiologÃ­a, que sea capaz de permitir la versatilidad en cuanto a tipos microbianos a ser preservados, asÃ­ como tambiÃ©n mantener la viabilidad de los microorganismos el mayor tiempo posible y en general, ajustado a los criterios inicialmente seÃ±alados para un buen mÃ©todo de preservaciÃ³n. Fue evaluada y comparada la efectividad de tres mÃ©todos de preservaciÃ³n aplicada sobre cuatro microorganismos donde las caracterÃ­sticas estudiadas fueron viabilidad y pureza durante un tiempo de preservaciÃ³n para asÃ­ establecer el o los mÃ©todos mÃ¡s efectivos basado en el anÃ¡lisis de dichas caracterÃ­sticas. El resultado obtenido fue que cada microorganismo analizado mostrÃ³Ã³ las mismas caracterÃ­Ã­sticas bioquÃ­Ã­micas y morfolÃ³Ã³ggicas en cada uno de los mÃ©Ã©todos aplicados,, por lo que se puede afirmar que ninguno de los tres mÃ©Ã©todos de preservaciÃ³Ã³nn aplicados durante el tiempo de estudio causa un estrÃ©Ã©s lo suficientemente fuerte en las cepas como para dar origen a un cambio sensible a nivel bioquÃ­Ã­mico y fenotÃ­Ã­pico,, ademÃ¡Ã¡s se deduce que no hubo contaminaciÃ³Ã³nn de las cepas en ninguno de los procesos aplicados..','2009-07-16','mÃ©todos,preservaciÃ³n, microbiologÃ­a,alimentos',1,1,1,1,1,'2013-09-17 08:29:32','2013-09-17 08:29:32','Documento_291.pdf','application/pdf',1645405,'2013-09-17 08:29:32',18,0,80,'COMPLETO'),(291,'EvaluaciÃ³n fÃ­sica, quÃ­mica y biolÃ³gica de un suelo de sabana mezclado con una emulsiÃ³n asfÃ¡ltica sembrado con la especie vegetal: Urochloa brizantha','Con la finalidad de estudiar el efecto de una emulsiÃ³n asfÃ¡ltica en las propiedades fÃ­sicas, quÃ­micas y biolÃ³gicas de un suelo de sabana moderadamente Ã¡cido sembrado con la especie Urochloa brizantha, mediante la realizaciÃ³n de dos ensayos. En el primero se determino el tipo de emulsiÃ³n asfÃ¡ltica (catiÃ³nica y aniÃ³nica) y la dosis que origino cambios fÃ­sicos, quÃ­micos y biolÃ³gicos en el suelo favorables para el crecimiento de la especie vegetal. Para ello, se utilizaron 13 tratamientos de suelo: control, 0,5; 1,0; 1,5; 2,0; 2,5; 3,0 %p/p EA y 0,5; 1,0; 1,5; 2,0; 2,5; 3,0 %p/p EC. Las emulsiones se aplicaron mecÃ¡nicamente sobre el suelo, y los microcosmos fueron estudiados por un perÃ­odo de 30 dÃ­as, bajo condiciones de invernadero. Los resultados de las propiedades fÃ­sicas y quÃ­micas no arrojaron cambios importantes en el suelo, en cambio, la actividad biolÃ³gica, empleando como indicador la actividad de la enzima deshidrogenasa (ADH), mostrÃ³ que el 3,0 %p/p EC presentÃ³ diferencias significativas con la mayorÃ­a de los tratamientos (p<0,05), exhibiendo el valor mÃ¡s elevado (82,24 Âµg/g suelo) de la serie. En funciÃ³n de que la actividad microbiolÃ³gica del suelo afecta directamente su fertilidad, se selecciono la emulsiÃ³n catiÃ³nica a una concentraciÃ³n de 3,0 %p/p, para la realizaciÃ³n de la segunda parte del diseÃ±o experimental. En el segundo ensayo se compararon 6 tratamientos: T0: suelo control; T1: suelo + 3 %p/p emulsiÃ³n + T2: suelo + 3 %p/p emulsiÃ³n + fertilizante ; T3: suelo + 3 %p/p emulsiÃ³n + 10 %p/p estiÃ©rcol de aves; T4: suelo + 3 %p/p emulsiÃ³n + 10 %p/p de estiÃ©rcol de aves + fertilizante; T5: suelo + 3 %p/p emulsiÃ³n + cal, en presencia de Urochloa brizantha. Los microcosmos fueron evaluados por un perÃ­odo de 120 dÃ­as, bajo condiciones de invernadero, con un muestreo inicial y a los 30, 60 y 120 dÃ­as. Los resultados obtenidos sugieren que la gramÃ­nea tolera la concentraciÃ³n 3,0 %p/p de la emulsiÃ³n catiÃ³nica y ademÃ¡s favorece su producciÃ³n de biomasa seca total. Con respecto a las propiedades fÃ­sicas, los tratamientos T3 y T4 presentaron diferencias significativas en el contenido de humedad con los demÃ¡s tratamientos (p<0,05) a 120 dÃ­as de estudio, debido a que el acondicionador orgÃ¡nico se caracteriza por su capacidad de absorber agua, evitando asÃ­ su rÃ¡pida evaporaciÃ³n en el suelo. La estabilidad de los agregados no mostrÃ³ diferencias significativas en los tratamientos al finalizar el estudio. En cuanto a las propiedades quÃ­micas, se observÃ³ diferencias significativas en el pH del suelo en los tratamientos en comparaciÃ³n con el suelo control a 120 dÃ­as de ensayo (p<0,05), lo cual demuestra que la emulsiÃ³n por su carÃ¡cter Ã¡cido, podrÃ­a estar confiriÃ©ndoles protones a la soluciÃ³n del suelo, provocando la disminuciÃ³n del pH. La conductividad elÃ©ctrica (CE), el contenido de cloruros (Cl-) y de fÃ³sforo disponible, bases intercambiables (BI), capacidad de intercambio catiÃ³nico (CIC), saturaciÃ³n con base (%SB) y relaciÃ³n de adsorciÃ³n de sodio (RAS) no mostraron cambios significativos en el tratamiento T1 con respecto al suelo control para el tiempo de estudio. El contenido de los hidrocarburos biodegradables (saturados y aromÃ¡ticos) disminuyÃ³ en el tiempo, en relaciÃ³n a los tratamientos que presentan estiÃ©rcol y fertilizaciÃ³n, debido a la incorporaciÃ³n de nutrientes al suelo. En el caso de los tratamientos donde se favoreciÃ³ la producciÃ³n de biomasa (T1, T2 y T5), presentan una reducciÃ³n en el contenido de aceites y grasas y de las concentraciones de los metales Ba y Zn principalmente, con respecto a los resultados obtenidos para el diseÃ±o experimental sin planta para 120 dÃ­as de estudio. Por otra parte, la actividad biolÃ³gica, empleando como indicador la actividad de la enzima deshidrogenasa (ADH) y respiraciÃ³n edÃ¡fica (CO2), se incrementÃ³ en los primeros 30 dÃ­as de estudio con respecto al control (suelo sin emulsiÃ³n) y luego al decrecer la concentraciÃ³n de los hidrocarburos biodegradables, se observÃ³ una disminuciÃ³n gradual en el tiempo, destacÃ¡ndose que el tratamiento T4presentÃ³ la mÃ¡xima actividad de los microorganismos en el suelo.','2009-10-30','Suelo de sabana; EmulsiÃ³n asfÃ¡ltica; Urochloa brizantha',6,1,1,1,1,'2013-09-17 08:29:33','2013-09-17 08:29:33','Documento_292.pdf','application/pdf',4165339,'2013-09-17 08:29:33',19,0,76,'COMPLETO'),(292,'Estudio del Mecanismo de HidrodesclorinaciÃ³n CatalÃ­tica por intercambio Deuterio-HidrÃ³geno empleando un catalizador bimetalico Ni-Mo soportado','RESUMEN..Los bifenilos policlorados (BPC), son el nombre genÃ©rico dado a una clase de compuestos organoclorados. Se estima que debido al gran empleo de los BPC a nivel mundial, el 40% se ha introducido al ambiente. En la actualidad, existen diversos mÃ©todos para la eliminaciÃ³n de los BPC, siendo el hidrotratamiento catalÃ­tico el mÃ©todo reductivo mÃ¡s adecuado, el cual utiliza catalizadores para extraer progresivamente los cloros de dicha molÃ©cula, generando productos de menor grado de toxicidad. El presente trabajo se basa en el estudio del mecanismo superficial de la HidrodesclorinaciÃ³n y cuyo seguimiento se realizÃ³ empleando deuterio. El cual nos proporcionÃ³ la herramienta necesaria para dar la ubicaciÃ³n y procedencia del hidrÃ³geno que sustituye los cloros extraÃ­dos de las molÃ©culas organocloradas. Para ello se propuso examinar el rol del hidrÃ³geno en el mecanismo superficial de la hidrodesclorinaciÃ³n de compuestos organoclorados (clorobenceno y Aroclor 1260), por intercambio hidrÃ³geno-deuterio, usando catalizadores soportados de nÃ­quel (Ni) y nÃ­quel-molibdeno (Ni-Mo). En la determinaciÃ³n del mecanismo se emplearon clorobenceno y Aroclor 1260 utilizando etanol como solvente. El deuterio se utilizÃ³, para entender y determinar el papel del hidrÃ³geno dentro de la hidrodesclorinaciÃ³n (HDCl). Para ello se utilizÃ³ un agente reductor deuterado (LiAlD4), a fin de seguir la reacciÃ³n superficial y poder promover el papel del hidrÃ³geno dentro del mecanismo de HDCl. Tratando de explicar la reacciÃ³n de HDCl del Aroclor 1260, se empleÃ³ clorobenceno como molÃ©cula modelo sencilla. Para este estudio se emplearon catalizadores de nÃ­quel y nÃ­quel-molibdeno soportados sobre g-alÃºmina, que fueron caracterizados mediante Ãrea EspecÃ­fica por el mÃ©todo BET, DifracciÃ³n de Rayos X (DRX) y Resonancia MagnÃ©tica Nuclear en estado sÃ³lido (2D-MAS-RMN). De aquÃ­ se propone que el mecanismo de reacciÃ³n ocurre vÃ­a sinergia de contacto. El presente trabajo muestra la importancia del modelo de Ã¢Â€Â•Control Remoto y el rol que juega en la sinergÃ­a hacia la HDCl de bifenilos policlorados. Desde el punto de vista fundamental, los resultados permiten avanzar en la comprensiÃ³n del mecanismo de Ã¢Â€Â•spill-over del hidrÃ³geno. En una primera aproximaciÃ³n, los resultados obtenidos empleando deuterio indican cierta facilidad para disociarse, adsorberse y migrar sobre la superficie. Por otra parte, este trabajo muestra la existencia de sinergÃ­a entre las fases de sulfuro de nÃ­quel y sulfuro de molibdeno en la reacciÃ³n de hidrodesclorinaciÃ³n de Aroclor 1260.','2009-10-27','HidrodesclorinaciÃ³n, Deuterio,HidrÃ³geno, Ni-MO',6,1,1,1,1,'2013-09-17 08:29:35','2013-09-17 08:29:35','Documento_293.pdf','application/pdf',1464313,'2013-09-17 08:29:35',18,0,109,'COMPLETO'),(293,'ESTUDIO DE LA DISTRIBUCIÃ“N DE Cd, Fe, Mn y Zn EN Ã“RGANOS DE RATASTRATADAS CON Cd Y Zn','Estudiar la influencia que ejerce el suministrÃ³ de Cd y Zn sobre los niveles de Fe, Cd, Mn y Zn en tejido de hÃ­gado y riÃ±Ã³n de ratas','2009-09-11','Fe, Cd, Mn y Zn, elementos traza, higado y riÃ±Ã³n de ratas',6,1,1,1,1,'2013-09-17 08:29:36','2013-09-17 08:29:36','Documento_294.pdf','application/pdf',2916508,'2013-09-17 08:29:36',19,0,104,'COMPLETO'),(294,'DistribuciÃ³n de la enzima 3a-hidroxiesteroide oxidoreductasaen el cerebro de rata durante el desarrollo embrionario y postnatal:un posible rol para los neuroesteroides en el control dela biologÃ­a de los progenitores neurales','Por mucho tiempo se pensÃ³, que una vez culminado el desarrollo del sistema nervioso, las cÃ©lulas madrey los progenitores neurales desaparecÃ­an por completo. Sin embargo, actualmente se sabe que estas cÃ©lulaspersisten en nichos neurogÃ©nicos en el tejido adulto, sirviendo como fuente de nuevas cÃ©lulas nerviosasdurante toda la vida, y pudiendo participar en procesos regenerativos. Debido a esto, el estudio enprofundidad de la biologÃ­a de las cÃ©lulas madre y de los progenitores neurales, y en particular de los factoresque regulan la proliferaciÃ³n, migraciÃ³n, diferenciaciÃ³n y supervivencia de estas cÃ©lulas, es indispensable parael desarrollo exitoso de estrategias terapÃ©uticas. AdemÃ¡s de los factores de crecimiento, otras molÃ©culas estÃ¡ncobrando interÃ©s en la actualidad, este es el caso de los neurotransmisores, en particular del GABA y de losneuroesteroides, como la 3a,5a-tetrahidroprogesterona (3a,5a-THP o alopregnanolona) un metabolitoneuroactivo de la progesterona que actÃºa como un potente modulador del receptor GABAA. Recientemente,utilizando un modelo in vitro, de progenitores neurales aislados de cerebro de rata reciÃ©n nacida, seestableciÃ³ que la 3a,5a-THP y el GABA eran capaces de estimular la proliferaciÃ³n de estas cÃ©lulas actuandovÃ­a receptores GABAA. El objetivo general del presente trabajo fue el de aportar evidencias anatÃ³micas de laposible participaciÃ³n de la 3a,5a-THP en el control de la biologÃ­a de los progenitores neurales in vivo. SedeterminÃ³, por inmunofluorescencia, la distribuciÃ³n de la 3a-hidroxiesteroide oxidoreductasa (3a-HSOR),enzima responsable de la sÃ­ntesis de la 3a,5a-THP, en el cerebro de rata durante el desarrollo. Se utilizaronratas Sprague-Dawley de 14, 17 y 20 dÃ­as embrionarios (E14, E17 y E20), y de 1, 4, 7, 12, 15 y 21postnatales (P1, P4, P7, P12, P15 y P21). En E14, la enzima se expresÃ³ en la zona ventricular (ZV), elneuroepitelio olfatorio y las eminencias gangliÃ³nicas. En E17, la 3a-HSOR se expresÃ³ en las capas externasde la corteza, los bulbos olfatorios (BO) y el hipocampo. En E20, la expresiÃ³n de la enzima fue mas amplia yse observÃ³ en la ZV y en la zona subventricular (ZSV). En las etapas postnatales, la expresiÃ³n de la 3a-HSOR en las zonas neurogÃ©nicas aumentÃ³ durante las primeras semanas y luego disminuyÃ³ sin desaparecer.En la extensiÃ³n caudal de la ZSV, se observÃ³ una alta densidad de cÃ©lulas 3a-HSOR+ que conforman cadenasradiales que penetran el cuerpo calloso (CC). En P21, las cadenas celulares en el CC desaparecen, quedandosolo cÃ©lulas 3a-HSOR+ aisladas. Se observaron tambiÃ©n endotelios vasculares 3a-HSOR+ asociados a laszonas neurogÃ©nicas. AdemÃ¡s, la expresiÃ³n de la enzima en los vasos se incrementÃ³ considerablementedurante P12 y P15. En tÃ©rminos generales, los resultados obtenidos muestran que la 3a-HSOR se expresaampliamente durante el desarrollo embrionario y postnatal siguiendo un patrÃ³n espacio-temporal definido.Pudimos establecer que la expresiÃ³n de la enzima es considerable en las zonas neurogÃ©nicas, siendo mÃ¡s altaal comienzo del desarrollo embrionario y durante el perÃ­odo postnatal comprendido entre P7 y P12. Elpresente trabajo aporta evidencias anatÃ³micas sobre el posible papel de la 3a,5a-THP en el control de labiologÃ­a de las cÃ©lulas madre neurales y de los progenitores neurales in vivo durante el desarrollo.','2009-07-14','cÃ©lulas madre neurales, progenitores neurales, neuroesteroides, 3a,5a- tetrahidroprogesterona(alopregnanolona), receptor GABAA, desarrollo del sistema nervioso central.',1,1,1,1,1,'2013-09-17 08:29:37','2013-09-17 08:29:37','Documento_295.pdf','application/pdf',1951688,'2013-09-17 08:29:37',20,0,98,'COMPLETO'),(295,'SISTEMA DE GESTIÃ“N DE PREPARADORES PARA LA FACULTAD DE CIENCIAS DE LA UCV','La gestiÃ³n de preparadores no estÃ¡ automatizada en la Universidad Central de Venezuela, por lo que los trÃ¡mites se hacen lentos y propensos a frecuentes errores. Esto trae como consecuencia retardos e inconvenientes administrativos en la contrataciÃ³n delpersonal docente de preparadurÃ­as.En este trabajo se diseÃ±Ã³ y construyÃ³ una aplicaciÃ³n basada en tecnologÃ­as web que permiten automatizar y agilizar los procesos administrativos referentes a la contrataciÃ³n, seguimiento y control del personal de preparadurÃ­as. El sistema estÃ¡ diseÃ±ado para atenderlas demandas de la Facultad de Ciencias de la UCV. El diseÃ±o se basa en la metodologÃ­a de flujos de trabajo (workflows) lo que lo hace flexible y fÃ¡cil de extender a nuevos requerimientos.El sistema ha sido desarrollado en Ruby usando el framework de desarrollo Rails y una arquitectura basada en Servicios Web que permite integrar este sistema con otros ya previamente desarrollados o en desarrollo, especialmente el sistema de Control de EstudiosCONEST y con el sistema de gestiÃ³n de personal de la UCV.','2009-10-30','PREPARADORES, PRESUPUESTO, MOVIMIENTO DE PERSONAL, RECURSOS HUMANOS, CONSEJO DE FACULTAD.',2,1,1,1,1,'2013-