e y Varadero. En cada sitio se midieron los parÃ¡metros fÃ­sico- quÃ­micos (temperatura y salinidad) y la profundidad de la columna de agua. En el laboratorio, los nÃºcleos fueron cortados y la porciÃ³n de sedimento de los primeros 5 cm tamizados y analizados por las tÃ©cnicas de combustiÃ³n seca y EspectrometrÃ­a de AbsorciÃ³n Molecular para la determinaciÃ³n de carbono total y fÃ³sforo total, respectivamente. La concentraciÃ³n de carbono orgÃ¡nico fue determinada por el mÃ©todo de Walkley - Black (1934), la de nitrÃ³geno total (NT) por el mÃ©todo de Kjeldahl, mientras que el fÃ³sforo total por el mÃ©todo de Murphy - Riley (1962). Los resultados obtenidos indican que Las concentraciones de CT, CO y CI en las muestras de sedimento superficial (0- 5 cm) de toda la zona de estudio fueron: 1,08 a 5,54 Ã¢Â„Â…, 0,26 a 3,49 % y 0,48 a 3,32 %, respectivamente. La distribuciÃ³n espacial del CT muestra dos poblaciones de datos bien definidas; la primera en la zona de playa cuyos valores de concentraciÃ³n son inferiores a 2,91 %, y la segunda en el Golfete de Cuare con valores que oscilaron entre 1,50 y 5,54 %. Esta distribuciÃ³n es similar a la del CO, donde las concentraciones de este componente en las localidades de la zona de playa variaron entre 0,26 y 1,73 %, mientras que las del Golfete de Cuare entre 2,06 y 3,49%. Las concentraciones de NT para las muestras de sedimento superficial fueron: 0,07 a 0,39 Ã¢Â„Â…. Su distribuciÃ³n espacial es similar a la de CO debido a que las concentraciones de NT estÃ¡n controladas por la descomposiciÃ³n de la materia orgÃ¡nica. La relaciÃ³n CO/NT (7,9) calculada para las muestras captadas en la regiÃ³n podrÃ­a ser consecuencia de una proporciÃ³n apreciable de materia orgÃ¡nica de origen marino. Las concentraciones de PT para las muestras de sedimento superficial oscilaron entre: 202 y 835 Âµg/g. La distribuciÃ³n espacial del PT a lo largo de la zona de estudio es de una poblaciÃ³n logarÃ­tmica normal, producto de que la concentraciÃ³n de este elemento, de origen litolÃ³gico, estÃ¡ controlada principalmente por fases de oxihidrÃ³xidos de Fe y Mn, compuestos amorfos de Al o arcillas, despuÃ©s de la alteraciÃ³n quÃ­mica de los minerales de fosfatos de calcio de origen litolÃ³gico.','2009-10-26','GOLFETE DE CUARE, SEDIMENTO, NITRÃ“GENO, CARBONO, FÃ“SFORO',4,1,1,1,1,'2013-09-17 08:29:43','2013-09-17 08:29:43','Documento_298.pdf','application/pdf',974780,'2013-09-17 08:29:43',18,0,89,'COMPLETO'),(298,'Prototipo del Sistema de GestiÃ³n de Preparadores de la Escuela de ComputaciÃ³n, mÃ³dulos GestiÃ³n de Concursos y Nombramientos.','El propÃ³sito de este trabajo especial de grado se orientÃ³ en la elaboraciÃ³n de un prototipo del sistema de gestiÃ³n de preparadores de la Escuela de ComputaciÃ³n, enfocado especÃ­ficamente en el desarrollo de los mÃ³dulos de gestiÃ³n de concursos y nombramientos, tomando como base el modelo Workflow propuesto para estos procesos. Para llevar a cabo la implementaciÃ³n de este sistema se uso OpenUp como metodologÃ­a de desarrollo de software y la herramienta de Ruby on Rails como plataforma de construcciÃ³n. El resultado obtenido fue la creaciÃ³n de un prototipo encargado de controlar la gestiÃ³n de los preparadores, especÃ­ficamente en lo concerniente a los mÃ³dulos gestiÃ³n de concurso y gestiÃ³n de nombramiento. Este prototipo depende de la interacciÃ³n con la base de datos a travÃ©s de servicios Web. Dado que el desarrollo de la base de datos del sistema corresponde a un trabajo a futuro, el prototipo fue dotado de una soluciÃ³n preliminar, a travÃ©s de archivos XML que simulan la capa de datos, con la cual se muestran los resultados a travÃ©s de la aplicaciÃ³n, mientras se alcanza en otra etapa la implantaciÃ³n del acceso a los datos mediante los servicios Web.','2009-11-02','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-sty