 de acidez sobre superficies asfaltÃ©nicas provenientes decrudos con diferentes caracterÃ­sticas de estabilidad. Luego de la adsorciÃ³n por parte dela FASH en una interfase hexano- asfalteno, se construyeron las isotermas de adsorciÃ³ny desorciÃ³n para las FASH, empleando la espectrometrÃ­a de absorciÃ³n molecular UVVisiblea 230,4 nm, para la cuantificaciÃ³n de la adsorciÃ³n. Se evidenciÃ³ una grantendencia a la adsorciÃ³n a medida que se aumentÃ³ la concentraciÃ³n de FASH(Carabobo y Lagunilla) en soluciÃ³n. Las isotermas de adsorciÃ³n resultaron del tipo IV,caracterÃ­stico de superficies mesoporosas.Los estudios de desorciÃ³n demostraron que la adsorciÃ³n de FASH sobreasfaltenos es \"irreversible\", sugiriendo la incorporaciÃ³n de estos compuestos en elsÃ³lido asfaltÃ©nico, logrando establecer interacciones efectivas con centros bÃ¡sicos delos asfaltenos. La interacciÃ³n que se corresponde con el hecho de la nula desorciÃ³n deFASH a partir del sÃ³lido es del tipo Ã¡cido- base.TambiÃ©n se estudiÃ³ el efecto de la FASH adsorbida en asfaltenos sobre sufloculaciÃ³n inducida con n-heptano, hecho que no mostrÃ³ ninguna evidencia que puedaexplicar la incongruencia de los valores negativos de estabilizaciÃ³n obtenidos con losaltos valores de adsorciÃ³n y bajos valores de desorciÃ³n, esto se debe a la baja relaciÃ³nFASH/asfaltenos que permita modificar positivamente el umbral de floculaciÃ³n deasfaltenos. Sin embargo, y de acuerdo a resultados cualitativos de los ensayos deadsorciÃ³n de FASH en soluciÃ³n de n-heptano sobre asfaltenos es posible asegurar quelos componentes que constituyen la FASH, tienen caracterÃ­sticas de surfactantesnaturales de alta compatibilidad con crudo y con un alto potencial para su empleo comodispersantes de asfaltenos en soluciÃ³n','2009-09-07','Crudo, Asfalteno, AdsorciÃ³n, DesorciÃ³n, FloculaciÃ³n,',6,1,1,1,1,'2013-09-17 08:29:47','2013-09-17 08:29:47','Documento_301.pdf','application/pdf',1073835,'2013-09-17 08:29:47',20,0,89,'COMPLETO'),(301,'HIDRODESCLORINACIÃ“Ã“NN CATALÃÃTTICA DE BIFENILOS POLICLORADOS EMPLEANDO CARBUROS DE VANADIO','Se realizÃ³ la sÃ­ntesis de una serie de catalizadores no soportados de carburos de nÃ­quel-vanadio, preparados mediante el mÃ©todo de reducciÃ³n a temperatura programada (TPR) de VCl3 y Ni(NO3)2.6H2O, utilizando una mezcla carburante 20% de gas natural en hidrÃ³geno. Las relaciones atÃ³micas de Ni/Ni+V empleadas para la preparaciÃ³n de los carburos de vanadio fueron 0; 0.15; 0.21; 0.35; 0.62 y 1. La sÃ­ntesis de los catalizadores se llevÃ³ a cabo en un reactor de flujo continuo a una temperatura 750 Â°C y una velocidad de calentamiento de 18Â°C/min. Los sÃ³lidos fueron caracterizados por: difracciÃ³n de rayos X (DRX), Ã¡rea especÃ­fica (BET), volumen de poro y MicroscopÃ­a Auger de Barrido (SAM). El anÃ¡lisis por difracciÃ³n de rayos X mostrÃ³ la presencia de carburos de vanadio, especÃ­ficamente la fase V8C7, asÃ­ como Ã³xido de vanadio (V2O3) y nÃ­quel metÃ¡lico (Ni). Por su parte, el anÃ¡lisis por BET indicÃ³ que se lograron obtener catalizadores con altas Ã¡reas superficiales (96 m2.g-1). Los catalizadores fueron evaluados en la reacciÃ³n catalÃ­tica de hidrodesclorinaciÃ³n (HDCl) de Bifenilos Policlorados (BPC). Esta se llevÃ³ a cabo en un reactor de flujo continuo a 350 Â°C y una presiÃ³n de hidrÃ³geno de 540 psi. La concentraciÃ³n que se utilizÃ³ de BPC fue de 560 ppm. El proceso de pre-sulfuraciÃ³n se realizÃ³ iin situ a presiÃ³n atmosfÃ©rica de hidrÃ³geno y una temperatura de 350Â°C.Los catalizadores que se mostraron activos para la reacciÃ³n de hidrodesclorinaciÃ³n de bifenilos policlorados, fueron los que poseÃ­an una relaciÃ³n Ni/Ni+V de 0.15 y 0.21, con valores de conversiÃ³n relativamente altos con 49 y 69 %,respectivamente. Se obtuvo como productos de reacciÃ³n, benceno y ciclohexano.De los resultados logrados, se puede indicar que el comportamiento presentado sigue el modelo del Control Remoto, mostrando la existencia de sinergÃ­a entre las fases de nÃ­quel y vanadio en la reacciÃ³n de hidrodesclorinaciÃ³n de Aroclor 1260.','2009-10-15','hidrodesclorinaciÃ³n, carburos, bifenilos policlorados.',6,1,1,1,1,'2013-09-17 08:29:48','2013-09-17 08:29:48','Documento_302.pdf','application/pdf',811524,'2013-09-17 08:29:48',20,0,62,'COMPLETO'),(302,'Edad y crecimiento del cazÃ³n playÃ³n, Rhizoprionodon porosus Poey (1861), de la regiÃ³n nororiental de Venezuela','En este trabajo se describiÃ³ el crecimiento del cazÃ³n playÃ³n, Rhizoprionodon porosus, de la regiÃ³n nororiental de Venezuela, utilizando ejemplares provenientes de la pesca artesanal que opera en la zona. En la evaluaciÃ³n de las capturas de elasmobranquios durante el periodo muestreado (agosto 2008 - agosto 2009) se encontrÃ³ que el grupo de los tiburones pertenecientes al gÃ©nero Rhizoprionodones uno de los mÃ¡s comÃºnmente capturados (12%) en la zona de estudio. Los parÃ¡metros de crecimiento de R.. porosusse estimaron a travÃ©s del anÃ¡lisis de frecuencia de tallas y la aplicaciÃ³n de los modelos de crecimiento de von Bertalanffy (1938), Fabens (1965) y Richards (1959). Los individuos reciÃ©n nacidos encontrados (n=7; 35,0-45,5 cm LT) tuvieron una talla promedio de 42,3 cm LT. La Ã©poca de nacimiento parece estar entre enero y abril y la de apareamiento en el segundo trimestre del aÃ±o. Se encontrÃ³ una talla de madurez sexual para machos (LT50%) de 67 cm. El anÃ¡lisis de la tasa de incremento marginal (n=53) sugiere que la formaciÃ³n de los anillos de crecimiento es anual. La determinaciÃ³n de la edad de R.. porosusa partir del anÃ¡lisis de vÃ©rtebras se realizÃ³ con base en 38 hembras (41,5-93,6 cm LT) y 55 machos (35-88,8 cm LT). Tomando en cuenta una periodicidad anual para la formaciÃ³n de los anillos de crecimiento, las edades estimadas estuvieron comprendidas entre 0 y 9 aÃ±os. El modelo de Fabens (1965) fue el que resultÃ³ mÃ¡s adecuado para describir el crecimiento de tipo isomÃ©trico de R.. porosus. Los parÃ¡metros poblacionales estimados son una tasa de crecimiento (K) de 0,29- 0,33 aÃ±os-1 y una talla mÃ¡xima teÃ³rica (Loo) de 90,3-92,2 cm. R.. porosuspodrÃ­a considerarse una especie de crecimiento rÃ¡pido (K>1) donde los individuos presentan incrementos de talla de aproximadamente 20 y 11 cm en el primer y segundo aÃ±o de vida respectivamente. Los pocos individuos de tallas asintÃ³ticas encontrados en el presente estudio y la evidente escasez de los mismos desde hace dÃ©cadas puede ser consecuencia de la creciente presiÃ³n pesquera en el nororiente de Venezuela y sugiere la presencia de seÃ±ales de sobreexplotaciÃ³n del recurso. Una proporciÃ³n importante de individuos inmaduros del cazÃ³n playÃ³n es capturada por las pesquerÃ­as artesanales de la regiÃ³n y se propone como estrategia de manejo bÃ¡sica, el establecer como talla mÃ­nima de captura permitida 67 cm.','2009-10-28','Caribe, VÃƒÂ©rtebras, Edad y crecimiento, Rhizoprionodon, Isla de Margarita',1,1,1,1,1,'2013-09-17 08:29:49','2013-09-17 08:29:49','Documento_303.pdf','application/pdf',2428289,'2013-09-17 08:29:49',20,0,97,'COMPLETO'),(303,'Prototipo del Sistema de GestiÃ³n de Preparadores de la Escuela de ComputaciÃ³n, MÃ³dulos GestiÃ³n de Concursos y Nombramientos','El propÃ³sito de esta trabajo especial de grado se orientÃ³ en la elaboraciÃ³n de un prototipo del sistema de gestiÃ³n de preparadores de la Escuela de ComputaciÃ³n, enfocado especificamente en el desarrollo de los mÃ³dulos de gestiÃ³n de concursos y nombramientos, tomando como base el modelo Workflow propuesto para estos procesos, el cual estÃ¡ basado en la manera en como se maneja dicha gestiÃ³n actualmente en la Escuela de ComputaciÃ³n.','2009-11-13','GestiÃ³n de Preparadores, GestiÃ³n por Procesos, Workflow, Servicios Web, OpenUp, Ruby on Rails.',2,1,1,1,1,'2013-09-17 08:29:51','2013-09-17 08:29:51','Documento_304.pdf','application/pdf',0,'2013-09-17 08:29:51',19,0,0,'INCOMPLETO'),(304,'Respuestas fisiolÃ³gicas y anatÃ³micas de Nicotiana glauca Graham (Solanaceae)a la sequÃ­a y la sa