baricus,, Bloch 11779944)),, capturadas en el embalse hipereutrÃ³Ã³ffico de Suata ((Estado Aragua))..','En este trabajo se evaluÃ³ el contenido de aminoÃ¡cidos en guabinas (Hoplias malabaricus), capturadas en el embalse de Suata, Estado Aragua, con la finalidad de aportar informaciÃ³n sobre la calidad nutricional de las guabinas comercializadas en la zona. AdemÃ¡s se adquiriÃ³ una guabina (H.. malabaricus) de referencia en el embalse el Pueblito, Estado GuÃ¡rico para observar si existe algÃºn efecto de las condiciones de las aguas en el contenido de aminoÃ¡cidos en los peces. El muestreo en el embalse de Suata se realizÃ³ durante los meses de noviembre de 2007 a julio de 2008, determinÃ¡ndose tanto en la guabina referencia como en las guabinas de Suata el contenido de proteÃ­nas, grasa y cenizas. El anÃ¡lisis de aminoÃ¡cidos de las proteÃ­nas se realizÃ³ en cuatro pasos: hidrÃ³lisis, resecado, derivatizaciÃ³n y anÃ¡lisis por HPLC, segÃºn el protocolo para el anÃ¡lisis de aminoÃ¡cidos (totales y libres) aplicado en los laboratorios de CervecerÃ­a Polar C.A. Los resultados obtenidos indicaron que el contenido de proteÃ­nas no variÃ³ significativamente durante los meses de muestreo. Los aminoÃ¡cidos no esenciales mayoritarios fueron el acido aspÃ¡rtico y el acido glutÃ¡mico. Los contenidos de serina, glicina y lisina presentaron diferencias estadÃ­sticamente significativas durante los meses de muestreo. La lisina y la leucina fueron los aminoÃ¡cidos esenciales mayoritarios presentes en las guabinas H.. malabaricus capturadas en el embalse de Suata. En los meses de diciembre de 2007 y febrero de 2008 se observÃ³ una disminuciÃ³n en el contenido de aminoÃ¡cidos no esenciales, esenciales y totales que afectan la calidad nutricional de las proteÃ­nas del pescado, probablemente debido a la reducciÃ³n de nutrientes, como consecuencia de que no se habÃ­a iniciado el periodo de lluvias que permitiera la resuspenciÃ³n de nutrientes del fondo a la superficie, para asi aumentar sus disponibilidades. El contenido de nitrÃ³geno en noviembre y diciembre de 2007 fue bajo, lo que limitÃ³ la sÃ­ntesis de aminoÃ¡cidos no esenciales en estos meses. AdemÃ¡s, las actividades antrÃ³picas en los alrededores del embalse Suata promovieron la presencia de contaminantes como, metales, pesticidas, amonio, entre otros, que afectaron la salud del hÃ¡bitat acuÃ¡tico, calidad y alimentos disponibles, causando posiblemente una disminuciÃ³n en el contenido de aminoÃ¡cidos de guabinas durante algunos de los meses de muestreo. Las guabinas H.. malabaricus del embalse de Suata aportan a los humanos proteÃ­nas de valor nutritivo por el alto contenido de lisina y otros aminoÃ¡cidos esenciales. Las condiciones del agua del embalse de Suata parecieron no afectar el contenido de aminoÃ¡cidos en las guabinas H.. malabaricus, ya que no se observaron diferencias estadÃ­sticamente significativas entre la muestra de referencia capturada en el embalse oligotrÃ³fico el Pueblito y las guabinas del embalse de Suata.','2009-09-21','Embalse hipereutrÃ³fico, Hoplias malabaricus, aminoÃ¡cidos.',1,1,1,1,1,'2013-09-17 08:29:54','2013-09-17 08:29:54','Documento_306.pdf','application/pdf',3154894,'2013-09-17 08:29:54',18,0,67,'COMPLETO'),(306,'Criterio del segundo cociente para convergencia de series numÃ©ricas.','Criterio del segundo cociente para convergencia de series numÃ©ricas.','2009-09-24','Criterio de convergencia, series numÃ©ricas, segundo cociente.',5,1,1,1,1,'2013-09-17 08:29:55','2013-09-17 08:29:55','Documento_307.pdf','application/pdf',0,'2013-09-17 08:29:55',19,0,0,'INCOMPLETO'),(307,'Actividad de catalizadores de W, Co-W y Ni-W Soportados en Sepiolita y Activados con Compuestos OrgÃ¡nicos de Azufre en el Hidrotratamiento de Fracciones de Crudo','Se sintetizaron catalizadores en base W y NiW por el mÃ©todo de intercambio iÃ³nico, soportados por sepiolita modificada con el agente g- aminopropiltrietoxisilano, y se estudiÃ³ su comportamiento en el hidrotratamiento de HVGO. Se estableciÃ³ un mÃ©todo de activaciÃ³n con disulfuro de carbono (CS2) para los precursores catalÃ­ticos de W y NiW utilizando como referencia un catalizador comercial, KF 757 1.5E (14% Co+Mo/Al2O3). Se obtuvo una superficie de material carbonÃ¡ceo proveniente de la descomposiciÃ³n tÃ©rmica del agente modificante y del disulfuro de carbono en el proceso de activaciÃ³n. Los sÃ³lidos preparados se caracterizaron mediante la tÃ©cnica de espectrometrÃ­a IR de transformada de Fourier, anÃ¡lisis textural, anÃ¡lisis quÃ­mico elemental y anÃ¡lisis termogravimÃ©trico. Se determinÃ³ la actividad de los catalizadores para el proceso de hidrotatamiento de una carga de HVGO. Los productos se caracterizaron mediante anÃ¡lisis elemental de azufre y nitrÃ³geno, medidas de densidad y anÃ¡lisis termogravimÃ©trico. El catalizador sintetizado en base a Ni-W, con una relaciÃ³n atÃ³mica R= 0,2 Ni/[Ni +W] y 1,78 % p/p de carga metÃ¡lica, mostrÃ³ un valor de actividad catalÃ­tica (expresada por gramos de fase metÃ¡lica) 1,12 veces mayor que la actividad del catalizador comercial KF 757 1,5E CoMo con una carga metÃ¡lica de 13% p/p.','2009-05-29','Hidrotratamiento, Catalizadores, Tungsteno, Soportados, HidrodesulfuraciÃ³n',6,1,1,1,1,'2013-09-17 08:29:56','2013-09-17 08:29:56','Documento_308.pdf','application/pdf',0,'2013-09-17 08:29:56',20,0,0,'INCOMPLETO'),(308,'ProducciÃ³Ã³nn y evaluaciÃ³Ã³nn de un anticuerpo ((IgY)) anti--Tirotropina ((TSH)) conjugado con fosfatasa alcalina,, biotina e isotiocianato de fluoresceÃ­Ã­na','La Pesquisa Neonatal tiene como funciÃ³n detectar el hipotiroidismo congÃ©nito para evitar el retardo mental. La prueba que se realiza para el diagnÃ³stico es determinar los niveles de Tirotropina (TSHh) en sangre de neonatos, por un inmunoensayo enzimÃ¡tico utilizando anticuerpos monoclonales para capturar la Tirotropina y un anticuerpo secundario marcado, para su detecciÃ³n. La producciÃ³n de anticuerpos monoclonales es costosa y requiere de personal especializado, por ello, se han buscado otras alternativas como es el desarrollo de anticuerpos policlonales de gallinas, tecnologÃ­a utilizada recientemente para el diagnÃ³stico de muchas enfermedades. El objetivo de este trabajo fue producir y evaluar anticuerpos policlonales en gallinas (IgY), contra pÃ©ptidos sintÃ©ticos de la hormona Tirotropina, y se conjugÃ³ con fosfatasa alcalina, biotina e isotiocianato de fluoresceÃ­na, para utilizarlo como sonda para el diagnÃ³stico del hipotiroidismo congÃ©nito. Para ello, se inmunizÃ³ una gallina Isabrown con un pÃ©ptido sintÃ©tico de la cadena a de la tirotropina (IMT-771), se purificaron los anticuerpos de la yema de los huevos por mÃ©todos de precipitaciÃ³n y se caracterizaron a travÃ©s de las tÃ©cnicas de ELISA, MABA y Western blot. El pÃ©ptido fue inmunogÃ©nico, encontrÃ¡ndose un mÃ¡ximo de producciÃ³n de anticuerpos en los dÃ­as 42 y 49 postinmunizaciÃ³n y un tÃ­tulo de 1:10.000 a travÃ©s del ensayo de ELISA. Los anticuerpos fueron especÃ­ficos al evaluarlos por medio de MABA. Sin embargo, no reconocieron a la TSHh. TambiÃ©n se evaluÃ³ un anticuerpo contra la subunidad beta de la TSH (IMT- 861), el cual demostrÃ³ una alta especificidad y reconocimiento de la TSHh. Finalmente, estos anticuerpos se marcaron con fosfatasa alcalina, biotina e isotiocianato de fluoresceÃ­na y se evaluaron en un ensayo de ELISA de captura con TSHh comercial y en suero de neonatos, resultando el anticuerpo anti-861 con mayor potencial. La metodologÃ­a desarrollada en este trabajo permitiÃ³ establecer las bases para el marcaje de los anticuerpos IgY y su utilizaciÃ³n en el diagnÃ³stico del hipotiroidismo congÃ©nito.','2009-07-10','Anticuerpos IgY, TSH, marcaje, fosfatasa alcalina, biotina, fluoresceina',1,1,1,1,2,'2013-09-17 08:29:57','2013-09-17 08:29:57','Documento_309.pdf','application/pdf',2041669,'2013-09-17 08:29:57',20,0,112,'COMPLETO'),(309,'Sintesis de nanoparticulas bimetalicas por via electroquimica','El interÃ©s en nanopartÃ­culas de transiciÃ³n ha aumentado en los Ãºltimos aÃ±os debido a la variedad de aplicaciones de Ã©stos materiales, en especial de las nanopartÃ­culas bimetÃ¡licas. Existen varios mÃ©todos para la obtenciÃ³n de materiales a esta escala, pero presentan algunas inconvenientes. Por esta razÃ³n se han aplicado mÃ©todos electroquÃ­micos en la sÃ­ntesis de Ã©stos materiales nanoestructurados ya que ofrecen ventajas como alto rendimiento, ausencia de productos colaterales o residuales, productos fÃ¡cilmente aislables y control de tamaÃ±o por simple variaciÃ³n de potencial o densidad de corriente aplicada. En este trabajo se sintetizaron nanopartÃ­culas bimetÃ¡licas de Rh-Ni por vÃ­a electroquÃ­mica, utilizando como precursor tricloruro de Rodio (III) y cloruro y bromuro de NÃ­quel (II) hexahidratadado y como agente estabilizante y electrolÃ­tico el bromuro de tetrapropilamonio; se aplicaron potenciales constantes de valores -0,7 V, -0,6 V y -0, 9 V. Se sintetizaron ademÃ¡s nanopartÃ­culas bimetÃ¡licas Rh-Ni aplicando densidades de corriente constantes de -1 mA/cm2, -3 mA/cm2y -5 mA/cm2. Todas las reacciones se realizaron bajo atmosfera inerte de argÃ³n. El anÃ¡lisis para la determinaciÃ³n de tamaÃ±o para las nanopartÃ­culas bimetÃ¡licas Rh-Ni se realizo mediante microscopia electrÃ³nica de transmisiÃ³n (MET). La determinaciÃ³n de los porcentajes de metales se realizo mediante difracciÃ³n de rayos x (EDX). Los anÃ¡lisis por MET indicaron, en los casos en que se pudo realizar el anÃ¡lisis, que el tamaÃ±o promedio de partÃ­cula es menor a 20 nm. Los tamaÃ±os y distribuciones dependen del potencial aplicado. AdemÃ¡s se sintetizaron nanopartÃ­culas bimetÃ¡licas de Rh-Ni a -0,7 V en diferentes solventes: agua, etano y acetonitrilo para determinar la influencia del medio en el tamaÃ±o de partÃ­cula. Los resultados por voltamperometrÃ­a cÃ­clica demuestran que se trata de procesos cuasireversibles. Ensayos preliminares de electrocatÃ¡lisis mostraron que existe un aumento significativo de la corriente, en las zonas de adsorciÃ³n y desorciÃ³n de hidrogeno, lo que indica cierta actividad electrocatalÃ­tica frente para la reducciÃ³n de hidrogeno.','2009-07-14','sintesis de nanoparticulas bimetalicas de Rh-Ni',6,1,1,1,1,'2013-09-17 08:30:00','2013-09-17 08:30:00','Documento_310.pdf','application/pdf',2878327,'2013-09-17 08:30:00',18,0,123,'COMPLETO'),(310,'CARACTERIZACIÃ“Ã“NN HISTOTRÃ“Ã“PPICA Y GENÃ‰Ã‰TTICA MEDIANTE LSSP--PCR DE AISLADOS RECIENTES DE Trypanosoma cruziDE VENEZUELA..','{}','2009-10-21','Trypanosoma cruzi, LSSP-PCR, Histotropismo, Genetica',1,1,1,1,1,'2013-09-17 08:30:03','2013-09-17 08:30:03','Documento_311.pdf','application/pdf',442868,'2013-09-17 08:30:03',19,0,87,'COMPLETO'),(311,'Desarrollo de un mÃ³dulo que permita manejar eventos dentro de los procesos modelados para el prototipo de la aplicaciÃ³n Web de gestiÃ³n de Procesos AcadÃ©micos de la CoordinaciÃ³n de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela','En la unidad acadÃ©mica de la CoordinaciÃ³n de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela intervienen un determinado nÃºmero de procesos donde destaca la complejidad y flujo constante de informaciÃ³n afectando de manera directa o indirecta el tiempo de respuesta para llevar a cabo la realizaciÃ³n efectiva de diversos trÃ¡mites internos y externos que allÃ­ son demandados. El presente Trabajo Especial de Grado tiene como objetivo desarrollar un sistema de workflow u herramienta que permita monitorear los procesos y controlar su ejecuciÃ³n, encargÃ¡ndose de crear una lista de trabajo segÃºn los procesos vayan iniciÃ¡ndose, y segÃºn sea el perfil entre el conjunto de actores como lo son estudiantes, docentes y personal administrativo que labora en dicha organizaciÃ³n. La metodologÃ­a de desarrollo utilizada para la gestiÃ³n de esta aplicaciÃ³n fue una adaptaciÃ³n de la ProgramaciÃ³n Extrema (XP), la cual permitiÃ³ la elaboraciÃ³n de la parte prÃ¡ctica del presente trabajo de investigaciÃ³n. Dentro de las necesidades contempladas en la aplicaciÃ³n se tiene lo siguiente: Mantener informado a los actores involucrados del flujo de trabajo con la informaciÃ³n pertinente dependiente del tipo de proceso que se estuviese llevando a cabo en determinado momento. El desarrollo de la aplicaciÃ³n contemplÃ³ el estudio e incorporaciÃ³n del conocimiento previamente desarrollado en los sistemas referentes a: el Sistema de Control de Estudios (CONEST) y el Sistema de GestiÃ³n de Postgrado (SIGEPOST) y el nuevo sistema Conest Postgrado.','2009-10-30','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:30:04','2013-09-17 08:30:04','Documento_312.pdf','application/pdf',3345016,'2013-09-17 08:30:04',20,0,132,'COMPLETO'),(312,'Muscas domestica como vector mecÃ¡nico de Salmonella spp. en la comunidad agrÃ­cola de la Colonia Tovar, Edo. Aragua.','La mosca domÃ©stica es considerada una plaga comÃºn y abundante en las granjas avÃ­colas. Su densidad es proporcional a la acumulaciÃ³n de estiÃ©rcol de ave, el cual constituye un excelente medio de cultivo para las larvas de estos insectos. M.. domestica puede actuar como vector mecÃ¡nico y/o biolÃ³gico de diferentes microorganismos patÃ³genos, presentes en las heces de pollo y causantes de enfermedades gastrointestinales en humanos, convirtiÃ©ndose asÃ­ en un problema de salud pÃºblica. Entre estos microorganismos se encuentran algunas especies del gÃ©nero Salmonella, en su mayorÃ­a capaces decolonizar el aparato gastrointestinal de los pollos y dispersarse en el ambiente a travÃ©s de sus heces. Se busca demostrar que la M.. domestica puede actuar como vector mecÃ¡nico para la transmisiÃ³n de bacterias entÃ©ricas potencialmente patÃ³genas, principalmente serotipos de Salmonellapresentes en la gallinaza. Se colectaron moscas en el municipio Tovar, Edo. Aragua. Se estableciÃ³ la crÃ­a de M.. domestica segÃºn la metodologÃ­a de Martiradonna y Soto (2006). Los insectos fueron expuestos a bajas temperaturas a fin de producir aletargo. Se midiÃ³ el tiempo requerido para que la mosca recobrara su actividad. Para eliminar la carga microbiana en la cutÃ­cula de las moscas, fueron sumergidas en desinfectantes comerciales a base de: hipoclorito de sodio al 5%, amonio cuaternario al 10% y polimetilendiurea al 5%, con posteriores baÃ±os en agua destilada estÃ©ril. Luego del tratamiento, la eliminaciÃ³n bacteriana era comprobada haciendo caminar las moscas sobre agar nutritivo estÃ©ril, con la consecuente ausencia de crecimiento microbiano. Las moscas libres de microorganismos eran infectadas selectivamente con Salmonella typhimurium LT2 presente en estiÃ©rcol de pollo. Se colectaron moscas, muestras de heces de pollo y gallinaza en diferentes lugares del Municipio Tovar, de las cuales se aislÃ³ SSalmonellaspp..utilizando los medios especÃ­ficos Agar SS y XLD, y la posterior confirmaciÃ³n de las bacterias aisladas con tinciÃ³n Gram y pruebas bioquÃ­micas. El tiempo de exposiciÃ³n ideal de las moscas al frÃ­o fue de 150 seg, obteniendo un aletargo de alrededor de 5 minutos. El desinfectante como componente activo, amonio cuaternario eliminÃ³ toda la carga microbiana de la cutÃ­cula de las moscas en 4 de las rÃ©plicas. Las moscas desinfectadas colocadas en presencia de gallinaza contaminada con S.. typhimurium LT2 presentaron esta bacteria en su cuerpo; lo cual se comprobÃ³ mediante la transferencia de cada mosca a placas de agar XLD. En el 16,4% de las moscas colectadas en campo se encontrÃ³ en su cuerpo Salmonellaspp.. En 4 de 6 muestras de heces de pollo se encontrÃ³ SSalmonellaspp. y en 4 de 6 muestras de gallinaza tambiÃ©n. Ya que M.. domestica desarrolla gran parte de su ciclo de vida en heces de pollo y gallinaza, se puede considerar una relaciÃ³n directa entre la Salmonellaspp.. aislada de la gallinaza y heces y la Salmonellaspp.. aislada del cuerpo de las moscas en El Municipio Tovar. Relacionando esto con la alta densidad de M.. domesticaen esta zona y que los habitantes sufren constantes disenterÃ­as provocadas por bacterias entÃ©ricas.','2009-10-16','Muscas domestica, Salmonella spp, Gallinaza, estiÃ©rcol de pollo, Colonia Tovar, Vector mecÃ¡nico.',1,1,1,1,1,'2013-09-17 08:30:06','2013-09-17 08:30:06','Documento_313.pdf','application/pdf',989668,'2013-09-17 08:30:06',19,0,105,'COMPLETO'),(313,'Estructura FÃ­sica y BiolÃ³gica de la Comunidad de Epifitas Vasculares de un Bosque HÃºmedo Premontano, de la Reserva EcolÃ³gica GuÃ¡quira, en el Macizo de Nirgua, Edo. Yaracuy, Venezuela','La diversidad y estructura de la comunidad de epifitas vasculares, fue estudiada en todosaquellos portadores reales con D.A.P >= 2,5cm, en un bosque hÃºmedo premontano, ubicadoen la Reserva EcolÃ³gica GuÃ¡quira. Se establecieron 5 parcelas de 0,1ha, subdivididas ensubparcelas de 10x10m. Se registrÃ³ un total de 53 especies epifitas, representadas en 12familias (Bromeliaceae, Orchidaceae, Araceae, Gesneriaceae, Piperaceae, Clusiaceae,Aspleniaceae, Polypodiaceae y dos familias no identificadas). Se encontraron relacionesinversas entre el nÃºmero de especies e individuos epifitos y la altura y diÃ¡metro del soporte.Las epifitas revelaron preferencia por la regiÃ³n superior de las ramas y tipos de cortezaestriada y rugosa. A partir de un anÃ¡lisis de agrupamiento, se obtuvieron 6 grupos deespecies epifitas, los cuales responden a cambios en los gradientes ambientales que se dan alo largo del fuste y ramas de los portadores. El grado de perturbaciÃ³n en el Ã¡rea estudiada,tambiÃ©n podrÃ­a estar influenciando el patrÃ³n de distribuciÃ³n de este grupo de plantas.TambiÃ©n fue encontrada preferencia de las especies epifitas por un ejemplar de la zona,perteneciente a la familia Bombacaceae (Ceiba pentandra), la corteza rugosa y con fisurasprofundas de este individuo parecen brindar condiciones adecuadas para el establecimientode las mismas, ademÃ¡s la disposiciÃ³n casi horizontal de sus ramas y el alto grado dedesarrollo de Ã©stas y del fuste, podrÃ­a indicar una relaciÃ³n especie-Ã¡rea como la definida porYeaton y Gladstone (1982). Los forofitos pertenecientes a clases de alturas superiores,presentaron mayor diversidad de grupos de plantas epifitas, que aquellos forofitos en clasesde alturas bajas e intermedias, debido posiblemente a la mayor cantidad de microhÃ¡bitatsadecuados presentados en los primeros.','2009-09-04','Palabras Clave: Epifitas, PatrÃ³n de DistribuciÃ³n, Preferencias, Corteza, PerturbaciÃ³n.',1,1,1,1,1,'2013-09-17 08:30:07','2013-09-17 08:30:07','Documento_314.pdf','application/pdf',5723177,'2013-09-17 08:30:07',18,0,85,'COMPLETO'),(314,'ESTUDIO DE LA HIDRODESCLORINACIÃ“N CATALÃTICA DE ACEITES DE TRANSFORMADOR CONTAMINADOS CON BIFENILOS POLICLORADOS (AROCLOR 1260) EMPLEANDO CATALIZADORES DE Ni-Mo','En el presente estudio se realizÃ³ la HidrodesclorinaciÃ³n CatalÃ­tica de Bifenilos Policlorados (Aroclor 1260), en un reactor de lecho fijo a una presiÃ³n de 540 Psi y temperaturas entre 350 y 400Â°C, la soluciÃ³n reactante es una mezcla de aceite mineral y 500ppm de BPC. Los productos de reacciÃ³n fueron identificados por CromatografÃ­a de Gases, entre los resultados obtenidos, los catalizadores no presentaron actividad en el aceite mineral como medio de reacciÃ³n.','2009-10-30','HidrodesclorinaciÃ³n CatalÃ­tica de Bifenilos Policlorados',6,1,1,1,1,'2013-09-17 08:30:08','2013-09-17 08:30:08','Documento_315.pdf','application/pdf',1919055,'2013-09-17 08:30:08',18,0,142,'COMPLETO'),(315,'El teorema de Nehari y el teorema de Kronecker..','Se estudia en detalle el teorema deNehari y de Kronecker, y los conocimientos bÃ¡sicos para comprender y desarrollar estos Teoremas.','2009-09-03','Nehari,, Kronecker,, AnÃ¡Ã¡lisis..',5,1,1,1,1,'2013-09-17 08:30:11','2013-09-17 08:30:11','Documento_316.pdf','application/pdf',2810852,'2013-09-17 08:30:11',20,0,89,'COMPLETO'),(316,'SISTEMA DE GESTIÃ“N DE PREPARADORES PARA LA FACULTAD DE CIENCIAS DE LA UCV','La gestiÃ³n de preparadores no estÃ¡ automatizada en la Universidad Central de Venezuela, por lo que los trÃ¡mites se hacen lentos y propensos a frecuentes errores. Esto trae como consecuencia retardos e inconvenientes administrativos en la contrataciÃ³n delpersonal docente de preparadurÃ­as.En este trabajo se diseÃ±Ã³ y construyÃ³ una aplicaciÃ³n basada en tecnologÃ­as web que permiten automatizar y agilizar los procesos administrativos referentes a la contrataciÃ³n, seguimiento y control del personal de preparadurÃ­as. El sistema estÃ¡ diseÃ±ado para atenderlas demandas de la Facultad de Ciencias de la UCV. El diseÃ±o se basa en la metodologÃ­a de flujos de trabajo (workflows) lo que lo hace flexible y fÃ¡cil de extender a nuevos requerimientos.El sistema ha sido desarrollado en Ruby usando el framework de desarrollo Rails y una arquitectura basada en Servicios Web que permite integrar este sistema con otros ya previamente desarrollados o en desarrollo, especialmente el sistema de Control de EstudiosCONEST y con el sistema de gestiÃ³n de personal de la UCV.','2009-10-30','PREPARADORES, PRESUPUESTO, RECURSOS HUMANOS, CONSEJO DE FACULTAD, MOVIMIENTO DE PERSONAL.',2,1,1,1,1,'2013-09-17 08:30:12','2013-09-17 08:30:12','Documento_317.pdf','application/pdf',1380176,'2013-09-17 08:30:12',20,0,82,'COMPLETO'),(317,'ESTUDIO COMPARATIVO DE LA COMPOSICIÃ“N PROXIMAL Y ELEMENTAL EN BIVALVOS DEL ESTADO NUEVA ESPARTA.','{}','2009-09-03','{}',1,1,1,1,1,'2013-09-17 08:30:15','2013-09-17 08:30:15','Documento_318.pdf','application/pdf',5881546,'2013-09-17 08:30:15',19,0,104,'COMPLETO'),(318,'INFLUENCIA DEL CRECIMIENTO DE RAÃCES FINAS EN LOS RESERVORIOS DE P EN EL SUELO DE LOS BOSQUES INUNDABLES DE LA PARTE BAJA DEL RIO ORINOCO. IMPLICACIONES DE LA ESTACIOANALIDAD.','Fue llevado a cabo un estudio con el propÃ³sito de evaluar a lo largo de un hidroperÃ­odo el crecimiento de raÃ­ces finas y sus implicaciones en los reservorios de P, la materia orgÃ¡nica y la actividad de la fosfatasa Ã¡cida en el suelo, en un experimento de campo al sur del Estado AnzoÃ¡tegui, en la parte baja del rÃ­o Orinoco. El estudio fue realizado en dos zonas de diferente intensidad de inundaciÃ³n: MAX y MIN, las cuales se inundan 8, y 2 meses por aÃ±o respectivamente, siguiendo un completo hidroperÃ­odo: (i) inicio de lluvias (Junio 2007), (ii) final de la inundaciÃ³n (Noviembre 2007) y (iii) mÃ¡xima sequÃ­a (Abril-2008). Cada zona fue subdividida en 10 subparcelas. Al final de la Ã©poca seca (mayo 2007) fueron instalados en cada subparcela dos cilindros de crecimiento (CCR) y dos de exclusiÃ³n (CE) (n= 20 zona/tratamiento). Para dos fechas de muestreo: inicio de lluvias y salida de la inundaciÃ³n, fueron colectados de cada subparcela 1 CCR y 1 CE (n=10/zona/fecha/tratamiento). Con el propÃ³sito de evaluar la Ã©poca seca, fueron instalados en cada zona en Noviembre 2007 1 CCR y 1 CE por subparcela (n=10/zona/tratamiento), los cuales fueron removidos en Abril 2008. Durante las tres fechas de muestreo el suelo de los cilindros fue secado, pesado, toda raÃ­z extraÃ­da y pesada. La cantidad de materia orgÃ¡nica, actividad de la fosfatasa Ã¡cida y el P en el suelo en sus distintas formas fueron determinados en el suelo de los cilindros. Â§Los resultados mostraron que para las tres fechas de muestreo en MAX se obtuvo la mayor productividad. Para ambos tratamientos, la productividad de raÃ­ces decrece con la inundaciÃ³n teniendo la mayor productividad en los CCR, sin embargo, el contenido de P en las raÃ­ces aumento significativamente durante la inundaciÃ³n. La influencia del crecimiento o no de raÃ­ces no parece generar cambios en los distintos reservorios de P en el suelo, sin embargo las variaciones en el hidroperÃ­odo tienen un efecto significativo. La presencia de raÃ­ces finas no tiene efecto sobre el contenido de materia orgÃ¡nica y la actividad de la fosfatasa Ã¡cida en ambientes inundables. La biodegradaciÃ³n de la materia orgÃ¡nica y la AFA estÃ¡ regulada por la duraciÃ³n de los perÃ­odos de inundaciÃ³n.','2009-10-27','Productividad, Fraccionamiento, Rstacionalidad',1,1,1,1,1,'2013-09-17 08:30:18','2013-09-17 08:30:18','Documento_319.pdf','application/pdf',0,'2013-09-17 08:30:18',19,0,0,'INCOMPLETO'),(319,'Caracteristicas Combinatorias del Cardinal del Continuo','Estudia distintas caracteristicas combinatorias del cardinal del continuo.','2009-12-16','Teoria de conjuntos, Cardinales, Hipotesis del continuo.',5,1,1,1,1,'2013-09-17 08:30:19','2013-09-17 08:30:19','Documento_320.pdf','application/pdf',1799438,'2013-09-17 08:30:19',20,0,108,'COMPLETO'),(320,'Framework basado en Colonias de Hormigas Artificiales para la resoluciÃ³n de Problemas de OptimizaciÃ³n','En el trabajo se realizÃ³ un estudio a profundidad de los modelos computacionales derivados los sistemas de Colonias de Hormigas naturales en bÃºsqueda de alimento. Luego, se construyÃ³ una herramienta basada en Software libre, en la cual el programador puede hacer uso de los principales algoritmos de Colonias de Hormigas artificiales. Por Ãºltimo, se verificÃ³ el funcionamiento del framework, y la aplicabilidad de los algoritmos de Colonias de Hormigas a distintos problemas de optimizaciÃ³n.','2010-01-28','colonias de hormigas, framework, optimizaciÃ³n, sistemas bioinspirados, inteligencia artificial',2,1,1,1,1,'2013-09-17 08:30:20','2013-09-17 08:30:20','Documento_321.pdf','application/pdf',3937401,'2013-09-17 08:30:20',20,0,87,'COMPLETO'),(321,'DiseÃ±o e ImplementaciÃ³n de un Servicio de E-mail Aunado a TÃ©cnicas Antispam y Basado en Software de Dominio PÃºblico','El presente Trabajo Especial de Grado estÃ¡ enfocado hacia la implementaciÃ³n de un sistema de correo electrÃ³nico conjugado con tÃ©cnicas y herramientas para el control de spam basado en software de dominio pÃºblico. El objetivo del trabajo es proponer una soluciÃ³n que permita a cualquier persona u organismo implementar un sistema de correo electrÃ³nico con un eficaz manejo de mensajes no deseados. El proyecto estÃ¡ compuesto por un proceso de investigaciÃ³n, instalaciÃ³n y configuraciÃ³n de los componentes necesarios para implementar una plataforma de correo electrÃ³nico con control de spam. La soluciÃ³n antispam se basa en spamassassin, el cual es un software de cÃ³digo abierto que implementa funcionalidades necesarias para el control del spam. Como caso de estudio se seleccionÃ³ a la Asamblea Nacional, en la cual se efectuÃ³ reingenierÃ­a total de la plataforma de correo, quedando establecido Zimbra Messaging and Collaboration Suite 5.0 como plataforma de mensajerÃ­a y colaboraciÃ³n. Esta suite usa como background el sistema operativo Debian Etch release 4. Todos estos sistemas se integraron para proporcionar un servicio de correo libre de spam en concordancia con los lineamientos del decreto NÂº 3.390. Con la implementaciÃ³n de la plataforma de correo electrÃ³nico con control de spam, se logrÃ³ obtener una soluciÃ³n que proporciona beneficios adicionales (antivirus, firewall, etc.) que brinda mÃ¡s y mejores opciones a los usuarios y administradores. De igual forma se obtuvo una plataforma fÃ¡cilmente escalable en cuanto a servicios y funcionalidades, ademÃ¡s de ser extensible, ya que esta soluciÃ³n se podrÃ­a implementar en otros entes pÃºblicos y privados.','2009-12-16','spam e-mail zimbra postfix spamassassin mta correo electronico',2,1,1,1,1,'2013-09-17 08:30:22','2013-09-17 08:30:22','Documento_322.pdf','application/pdf',1824744,'2013-09-17 08:30:22',18,0,109,'COMPLETO'),(322,'ESTIMAR LA REACTIVIDAD HACIA LA HIDRODESCLORINACIÃ“N CATALÃTICA DE BIFENILOS POLICLORADOS ((AROCLOR 11226600)):: SISTEMA NiW SOPORTADO..','Los bifenilos policlorados (PCB) son mezclas de hidrocarburos clorados que se han utilizado en abundancia desde 1930 en diversas aplicaciones industriales, por ejemplo como material aislante de transformadores y condensadores grandes, fluidos de intercambio tÃ©rmico, aditivos de pinturas, papel autocopiante y plÃ¡sticos. El interÃ©s de los PCB para aplicaciones industriales radica en la inercia quÃ­mica, la resistencia al calor, la no inflamabilidad, la baja presiÃ³n de vapor y la alta constante dielÃ©trica. Existen 209 PCB posibles, desde los tres isÃ³meros monoclorados hasta el isÃ³mero decaclorobifenilo, completamente clorado. Generalmente, la solubilidad en agua y la presiÃ³n de vapor disminuyen con el aumento de las sustituciones y la liposolubilidad se eleva a medida que hay mÃ¡s sustituciones de cloro. En el medio ambiente es mÃ¡s probable encontrar los PCB unidos a componentes orgÃ¡nicos del suelo, sedimentos y tejidos biolÃ³gicos, o bien al carbono orgÃ¡nico disuelto en sistemas acuÃ¡ticos, mÃ¡s que en soluciÃ³n acuosa. Los PCB se volatilizan de la superficie del agua a pesar de su baja presiÃ³n de vapor, en parte como consecuencia de su hidrofobia; el transporte atmosfÃ©rico, por consiguiente, puede ser una ruta importante para la distribuciÃ³n de los PCB en el medio ambiente. Las tÃ©cnicas de remediaciÃ³n quÃ­mica usualmente se basan en la sustituciÃ³n de cloros, reducciÃ³n por hidruros, hidrodesclorinaciÃ³n, desclorinaciÃ³n empleando metales, radiÃ³lisis, oxidaciÃ³n, electrolisis. Algunas de ellas empleadas comercialmente para el tratamiento de lÃ­quidos y aceites contaminados con BPC. Sin embargo, la baja reactividad y / o selectividad hacia la desclorinaciÃ³n hace que los mÃ©todos de tratamiento mÃ¡s empleados requieran de altas temperaturas y presiones. La hidrodesclorinaciÃ³n (HDCl) ha sido estudiada para el tratamiento de desechos lÃ­quidos contaminados por compuestos orgÃ¡nicos clorados como: olefinas cloradas, bencenos clorados, clorofenoles, bifenilos policlorados (BPC), etc... La hidrodesclorinaciÃ³n de haluros orgÃ¡nicos produce el hidrocarburo correspondiente y cloruro de hidrÃ³geno. El cloruro de hidrÃ³geno producido puede ser fÃ¡cilmente separado, mientras que el hidrocarburo puede ser reciclado para minimizar el desecho o valorizarlos. En el presente estudio se estudiÃ³ la hidrodesclorinaciÃ³n catalÃ­tica de bifenilos policlorados (Aroclor 1260), empleando un reactor de lecho fijo a una presiÃ³n de 540psi y temperaturas entre 350 y 400 ÂºC con soluciÃ³n de BPC en heptano. Para llevar a cabo este proceso, se sintetizaron una serie de catalizadores NiW, variando el porcentaje del nÃ­quel (1-5%) siendo el porcentaje tungsteno constante a 20% en peso. La caracterizaciÃ³n fisicoquÃ­mica se realizo mediante: Ã¡rea especÃ­fica con N2, difracciÃ³n de rayos x, espectroscopia fotoelectrÃ³nica de rayos x y anÃ¡lisis elemental. Los catalizadores fueron presulfurados con una soluciÃ³n de CS2 (presiÃ³n de 1atm y 350ÂºC), antes de iniciar las reacciones de hidrodesclorinaciÃ³n, de 4 horas de duraciÃ³n. Los productos de reacciÃ³n fueron identificados por cromatografÃ­a de gases, ObteniÃ©ndose benceno como Ãºnico producto.','2010-02-25','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',6,1,1,1,1,'2013-09-17 08:30:23','2013-09-17 08:30:23','Documento_323.pdf','application/pdf',1880884,'2013-09-17 08:30:23',20,0,83,'COMPLETO'),(323,'DINAMICA DE PRODUCCION DE COPROLITOS DE LOMBRICES DE TIERRA EN LA SABANA DE LA ESTACION BIOLOGICADELOS LLANOS','Fue analizada la dinÃ¡mica de producciÃ³n espacio-temporal de coprolitos epÃ­geos de lombrices de tierra en dos sistemas, una sabana protegida del fuego y pastoreo durante mÃ¡s de treinta aÃ±os ubicada en la EstaciÃ³n BiolÃ³gica de los Llanos en el Estado Guarico (SP) y una sabana adyacente no protegida actualmente sometida a quemas anuales y baja tasa de pastoreo, perteneciente a el Fundo \"La Matica\" (SNP). Adicionalmente, se analizÃ³ la composiciÃ³n de las comunidades de lombrices de tierra a nivel de Familia en ambos sistemas y se estimaron algunos parÃ¡metros fÃ­sicos (temperatura, humedad, densidad aparente, capacidad de campo y textura) a profundidades de 0-10,10-20,20-30 cm. Se realizaron tres muestreos, uno en Ã©poca de sequÃ­a y dos en Ã©poca de lluvia. Para el muestreo de coprolitos epÃ­geos se delimitÃ³ una parcela de 90 x 90 cm en cada sistema y se eligieron 5 unidades muestrales de 1 m2 en cada parcela. En cada perÃ­odo de muestreo la extracciÃ³n de lombrices se realizÃ³ tomando 5 muestras de 25 cm2 x 30 cm de profundidad, adyacentes a las unidades muestrales de los coprolitos, empleando el mÃ©todo de extracciÃ³n manual (Anderson e Ingram, 1989) y el mÃ©todo de flotabilidad para el anÃ¡lisis de presencia de capullos de lombrices de tierra en las mismas fracciones de suelo. La producciÃ³n de coprolitos en ambos sistemas, SP y SNP, difiriÃ³ notablemente siendo mayor en SP y presentando formas generalmente globulares. La densidad y biomasa de lombrices de tierra fue mayor en SP y no se encontrÃ³ diferencia entre estaciones (sequÃ­a y lluvia) para un mismo sistema (SP o SNP). Entre los cambios de estaciones se pudo notar que los individuos tienden a migrar a zonas mÃ¡s profundas (20-30 cm) en la Ã©poca seca permaneciendo inactivos y se desplazan a la superficie (0-10 cm) en la Ã©poca de lluvia para alimentarse. El principal factor que determinÃ³ la distribuciÃ³n de lombrices en la Ã©poca seca fue la humedad del suelo. Los individuos encontrados en ambos sistemas pertenecieron a la familia Glossoscolecidae siendo mÃ¡s abundantes los individuos en estado inmaduro. No se encontraron capullos en los estratos de suelos durante los distintos muestreos. Estos resultados indican una respuesta positiva en el proceso de producciÃ³n de coprolitos epÃ­geos en la sabana protegida, adicionalmente, indican que la protecciÃ³n de la sabana ha favorecido la proliferaciÃ³n de lombrices de tierra, indicado por un mayor valor de densidad y biomasa de las mismas.','2010-01-22','Coprolitos, lombrices de tierra, sabana, EstaciÃ³n BiolÃ³gica de los Llanos, macrofauna',1,1,1,1,1,'2013-09-17 08:30:24','2013-09-17 08:30:24','Documento_324.pdf','application/pdf',6977808,'2013-09-17 08:30:24',20,0,128,'COMPLETO'),(324,'EFECTO DE LA ILUMINACIÃ’N CON LUZ UV- C SOBRE MICROFLORA NATURAL EN TRES VARIEDADES DE LECHUGAS FRESCAS (Lactuca sativa L)) CORTADAS DE ENSALADAS LISTAS PARA SERVIR DE DISTRIBUCIÃ“N COMERCIAL.','Trozos de lechugas ((Lactuca sativa L..)) frescas cortadas con mÃ­Ã­nimo proceso distribuidas comercialmente como ensaladas listas para servir,, fueron sometidas a bajas dosis de iluminaciÃ³Ã³nn ((22,,77;; 44,,55 y 66,,33 kJ..m--22)) por ambas caras de la muestra,, con lÃ¡Ã¡mparas germicidas ((225544 nm)) de luz ultravioleta banda C ((UV--C)) en periodos de 33,,55,, y 77 minutos,, con el propÃ³Ã³ssito de evaluar su efecto germicida sobre microflora inicial deteriorativa del producto.. Las muestras fueron aportadas por productor local,, analizÃ¡Ã¡ndose de tres lotes con dÃ­Ã­a de producciÃ³Ã³nn cero,, compuesto por una mezcla de tres variedades ((Lactuca sativa var.. capitata,, Lactuca sativa var.. longifolia,, Lactuca sativa sp..)) almacenados a temperaturas de refrigeraciÃ³Ã³nn de 44Â±Â±11ÂºÂºC analizados durante diez ((1100)) dÃ­Ã­as.. La evaluaciÃ³Ã³nn sensorial del producto mÃ­Ã­nimamente procesado se realizÃ³Ã³ al tercer dÃ­Ã­a de almacenamiento refrigerado a 44Â±Â±11ÂºÂºC,, donde se evaluÃ³Ã³ las variables cualitativas aroma,, color,, textura y aceptaciÃ³Ã³nn global,, a travÃ©Ã©s de panel no entrenado de degustaciÃ³Ã³nn.. La investigaciÃ³Ã³nn arrojo como resultado que una exposiciÃ³Ã³nn durante 55 minutos a una dosis de 44,,55 KJ//m22 es una combinaciÃ³Ã³nn tiempo--energÃ­Ã­a adecuada que inhibe el desarrollo de la microflora inicial,, y mÃ¡Ã¡s especÃ­Ã­ficamente el crecimiento del grupo Enterobacterias,, Mohos y Levaduras.. No presentÃ¡Ã¡ndose diferencia significativa en el nivel de aceptaciÃ³Ã³nn segÃºÃºnn el panel evaluador no entrenado..','2009-12-01','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',1,1,1,1,1,'2013-09-17 08:30:26','2013-09-17 08:30:26','Documento_325.pdf','application/pdf',0,'2013-09-17 08:30:26',20,0,0,'INCOMPLETO'),(325,'Desarrollo de una AplicaciÃ³n Web para el Centro de CÃ³mputo de una Procesadora de Medios de Pago que automatice la GestiÃ³n de Incidencias.','El presente Trabajo Especial de Grado expone el desarrollo de una aplicaciÃ³n Web capaz de gestionar eficientemente, las incidencias ocurridas en el Centro de CÃ³mputo. La AplicaciÃ³n desarrollada deberÃ¡ facilitar, el registro actualizaciÃ³n, consulta y seguimiento de las incidencias. Adicionalmente, deberÃ¡ mejorar el rendimiento, productividad y capacidad de respuesta al personal del Centro de CÃ³mputo. La AplicaciÃ³n se desarrollÃ³ siguiendo una metodologÃ­a denominada Proceso Unificado, la cual utiliza como una de sus herramientas principales los diagramas de casos de uso para representar las funcionalidades y requerimientos de la aplicaciÃ³n, se caracteriza por ser capaz de adaptarse a cambios de requisitos en cualquier punto del ciclo de desarrollo de la aplicaciÃ³n y estimula el continuo contacto que debe mantenerse entre el desarrollador y el cliente. Para la implementaciÃ³n se utiliza como herramientas de desarrollo, PHP (Hypertext Pre-processor), Sistema Manejador de Bases de Datos MySQL y JavaScrip, estas herramientas se caracterizan por ser Software Libre y juntas proveen las funcionalidades necesarias para la construcciÃ³n de la aplicaciÃ³n. El resultado obtenido es una aplicaciÃ³n sencilla de manejar, que logra optimizar y facilitar el proceso de gestiÃ³n de incidencias, a travÃ©s de una infraestructura tecnolÃ³gica que abre las puertas hacia un crecimiento competitivo y permanente.','2010-02-08','Medios de pago, Procesadora de medios de pago, Centro de CÃƒÂ³mputo, Incidencias, Sistema de Registro de Incidencias.',2,1,1,1,1,'2013-09-17 08:30:27','2013-09-17 08:30:27','Documento_326.pdf','application/pdf',1299518,'2013-09-17 08:30:27',18,0,78,'COMPLETO'),(326,'ImplementaciÃ³Ã³nn de un Protocolo de Enrutamiento Avanzado de Vector de Distancia','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicaciÃ³n denominada Easy-EIGRP para la enseÃ±anza del protocolo EIGRP (Enhanced Interior Gateway Routing Protocol) patentado por Cisco Systems. La aplicaciÃ³n provee un conjunto de herramientas que permiten depurar paso a paso todos los procesos llevados a cabo durante el funcionamiento de EIGRP en distintos escenarios. El trabajo se inicia con un estudio basado en ingenierÃ­a inversa, el cual consiste en el desarrollo de situaciones puntuales para el estudio del comportamiento del protocolo utilizando routers Cisco. Durante la implementaciÃ³n de la aplicaciÃ³n, se utilizÃ³ una metodologÃ­a iterativa basada en las nuevas tendencias del modelo de desarrollo Ã¡gil que plantea la creaciÃ³n de cada una de las herramientas de la aplicaciÃ³n en una iteraciÃ³n del proceso que abarca las fases de AnÃ¡lisis, DiseÃ±o, ImplementaciÃ³n y Pruebas. Easy-EIGRP estÃ¡ diseÃ±ado para ser instalado en cualquier computador y convertir al mismo en un router creando la posibilidad de comunicarse con otros routers o computadores que cuenten con el protocolo. Easy-EIGRP es una implementaciÃ³n parcial de EIGRP donde se encuentra el protocolo RTP (Reliable Transfer Protocol), el algoritmo DUAL (Diffussing Update Algorithm), el protocolo de descubrimiento y recuperaciÃ³n de vecinos, entre otros. AdemÃ¡s, la aplicaciÃ³n incorpora una gran cantidad de funcionalidades para facilitar el uso de la herramienta y el entendimiento del protocolo. Algunas de estas funcionalidades son: posibilidad de configuraciÃ³n de interfaces fÃ­sicas y virtuales, mapas parciales de la red, mÃ¡quina de estado finito, sniffer, bitÃ¡coras de sucesos con distintos niveles de depuraciÃ³n, etc.','2010-01-27','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:30:28','2013-09-17 08:30:28','Documento_327.pdf','application/pdf',796088,'2013-09-17 08:30:28',20,0,77,'COMPLETO'),(327,'ImplementaciÃ³Ã³nn de un Protocolo de Enrutamiento Avanzado de Vector de Distancia','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicaciÃ³n denominada Easy-EIGRP para la enseÃ±anza del protocolo EIGRP (Enhanced Interior Gateway Routing Protocol) patentado por Cisco Systems. La aplicaciÃ³n provee un conjunto de herramientas que permiten depurar paso a paso todos los procesos llevados a cabo durante el funcionamiento de EIGRP en distintos escenarios. El trabajo se inicia con un estudio basado en ingenierÃ­a inversa, el cual consiste en el desarrollo de situaciones puntuales para el estudio del comportamiento del protocolo utilizando routers Cisco. Durante la implementaciÃ³n de la aplicaciÃ³n, se utilizÃ³ una metodologÃ­a iterativa basada en las nuevas tendencias del modelo de desarrollo Ã¡gil que plantea la creaciÃ³n de cada una de las herramientas de la aplicaciÃ³n en una iteraciÃ³n del proceso que abarca las fases de AnÃ¡lisis, DiseÃ±o, ImplementaciÃ³n y Pruebas. Easy-EIGRP estÃ¡ diseÃ±ado para ser instalado en cualquier computador y convertir al mismo en un router creando la posibilidad de comunicarse con otros routers o computadores que cuenten con el protocolo. Easy-EIGRP es una implementaciÃ³n parcial de EIGRP donde se encuentra el protocolo RTP (Reliable Transfer Protocol), el algoritmo DUAL (Diffussing Update Algorithm), el protocolo de descubrimiento y recuperaciÃ³n de vecinos, entre otros. AdemÃ¡s, la aplicaciÃ³n incorpora una gran cantidad de funcionalidades para facilitar el uso de la herramienta y el entendimiento del protocolo. Algunas de estas funcionalidades son: posibilidad de configuraciÃ³n de interfaces fÃ­sicas y virtuales, mapas parciales de la red, mÃ¡quina de estados finitos, sniffer, bitÃ¡coras de sucesos con distintos niveles de depuraciÃ³n, etc.','2010-01-27','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:30:30','2013-09-17 08:30:30','Documento_328.pdf','application/pdf',8354004,'2013-09-17 08:30:30',20,0,121,'COMPLETO'),(328,'ConstrucciÃ³n de un parche triangular de BÃ©zier cuadrÃ¡tico','Al clacular la ecuaciÃ³n implÃ­cita de una superficie racional cuadrÃ¡tica de BÃ©zier resultan que tienen a lo sumo grado algebraico cuatro. EL objetivo principal de este trabajo es construir un parche racional cuadrÃ¡tico de BÃ©zier cuya ecuaciÃ³n implÃ­cita sea de grado dos.','2009-12-11','parches, BÃƒÂ©zier, geometrÃƒÂ­a, proyectiva, homogenizaciÃƒÂ³n, superficie, puntos de control, racional',5,1,1,1,1,'2013-09-17 08:30:31','2013-09-17 08:30:31','Documento_329.pdf','application/pdf',1939848,'2013-09-17 08:30:31',20,0,125,'COMPLETO'),(329,'EVALUACIÃ“Ã“NN DE LA PRESENCIA DE IgG ANTI--Trypanosoma cruzi Y SU CINÃ‰Ã‰TTICA DE AVIDEZ EN PACIENTES DE FASE AGUDA INFECTADOS POR VÃÃAA ORAL EN CARACAS--VENEZUELA..','RESUMEN La presencia de IgG especÃ­ficos es una prueba que permite definir de forma rÃ¡pida si una persona ha estado en contacto con Trypanosoma cruzi. Por su parte, la IgM es un marcador de fase aguda, y con frecuencia permanece positiva por varios meses despuÃ©s de una primo-infecciÃ³n, pero en algunas ocasiones el resultado es inconcluso. Solo con estas dos pruebas se dificulta precisar la fase reciente, indeterminada o crÃ³nica de la infecciÃ³n. La poca fuerza de uniÃ³n de anticuerpos IgG a los antÃ­genos es caracterÃ­stico de infecciones recientes, y se puede determinar con pruebas serolÃ³gicas deavidez de las IgG por ELISA y \"Western blot\", de fÃ¡cil ejecuciÃ³n y econÃ³micas. Se determinÃ³ la avidez de las IgG por ELISA y \"Western blot\", asÃ­ como los tÃ­tulos de IgG e IgM de 35 personas (24 niÃ±os y 11 adultos) infectados por vÃ­a oral con T.. cruzi en la Escuela AndrÃ©s Bello del Municipio Chacao, los cuales fueron confirmados por ELISA IgG e IgM y PCR reactivos. Se trabajÃ³ con cuatro muestras una pre-tratamiento y tres post-tratamiento. El uso de una prueba para medir la avidez de las IgG especÃ­ficas en la preparaciÃ³n antÃ­genica de epimastigotes de T.. cruzi ha sido propuesta para distinguir entre infecciones recientes y crÃ³nicas. En base a los resultados obtenidos, el Ã­ndice de avidez incrementa al transcurrir el tiempo de infecciÃ³n, como se evidencio para todas las muestras de pre-tratamiento que presentaron una avidez baja, lo que sugiere que un Ã­ndice de avidez <0,45 indica una infecciÃ³n reciente. Con una sensibilidad de 100% y especificidad de 91% se puede decir que la prueba estandarizada para determinar la avidez de las IgG especÃ­ficas para la ECh, es vÃ¡lida para detectar infecciones recientes. Al caracterizar el patrÃ³n de reconocimiento de polipÃ©ptidos, encontramos que para la fase reciente hay un patrÃ³n de 3 bandas que presentan una frecuencia de apariciÃ³n mayor o igual al 70% (72-, 18- y 15 kDa), en el caso de la fase crÃ³nica hay un patrÃ³n de 2 bandas (31 y 29 kDa). Basados en esta alta frecuencia de apariciÃ³n, hemos considerado que las bandas que conforman cada patrÃ³n son caracterÃ­sticas para diferenciar una fase de otra.','2010-01-22','Enfermedad de Chagas ((ECh)),, Trypanosoma cruzi,, Avidez..',1,1,1,1,1,'2013-09-17 08:30:32','2013-09-17 08:30:32','Documento_330.pdf','application/pdf',2293979,'2013-09-17 08:30:32',20,0,81,'COMPLETO'),(330,'Mejoras al Prototipo de Sistema de InformaciÃ³Ã³nn de GestiÃ³Ã³nn de Proyectos:: MÃ³Ã³ddulos de Alcance,, Tiempo,, Costes y Recursos Humanos','Este trabajo especial de grado (T.E.G.) comprende la revisiÃ³n y reparaciÃ³n de un sistema de informaciÃ³n para la gestiÃ³n de proyectos en el Ã¡rea de alcance, tiempo, costes y recursos humanos, siguiendo las buenas prÃ¡cticas planteadas por la guÃ­a del PMBOK (Project Management Body of Knowledge, GuÃ­a de Fundamentos de la DirecciÃ³n de Proyectos). Con este T.E.G. se desea: revisar y reparar los mÃ³dulos de alcance, tiempo, costes y recursos humanos para su integraciÃ³n en el prototipo de Sistema de InformaciÃ³n de GestiÃ³n de Proyectos (SIGP), con el fin de cumplir un conjunto de requisitos y requerimiento para la Gerencia de Proyectos. Para llevar a cabo este desarrollo se utilizÃ³ una MetodologÃ­a de Mejoras, ajustando la MetodologÃ­a de trabajo de la tesis doctoral: DiseÃ±Ã±oos instructivos adaptativos:: formaciÃ³Ã³nn personalizada y reutilizable en entornos educativos Berlanga ((22000066)). El mÃ©todo de desarrollo utilizado consiste en: Conocer el estado del arte::En este paso se desea conocer y obtener las bases conceptuales de la gerencia de proyecto. Identificar Ã¡Ã¡reas de mejora::En este paso se revisa el SIGP, a fin de determinar cuÃ¡les son las herramientas que posee el sistema y cuÃ¡les de estas presentan fallas. Proponer y desarrollar alternativas de soluciÃ³Ã³nn::En este paso se propone y se desarrollan las alternativas de soluciÃ³n para mejorar las fallas presentadas. Obtener retroalimentaciÃ³Ã³nn de la comunidad cientÃ­Ã­fica y reflexionar y plantear nuevas cuestiones::En este paso se revisan las propuestas establecidas en el paso anterior considerando si las mismas son o no son adecuadas. Probar y evaluar la propuesta final::En este paso una vez que la propuesta es lo suficientemente consistente, se implementa, se prueba y se evalÃºa mediante la aplicaciÃ³n de un caso prÃ¡ctico. Se revisan las herramientas correspondientes al Ã¡rea de tiempo, alcance, costo y recursos humanos para seleccionar aquellas que presentan fallas en el prototipo. Una vez seleccionadas se llevan a cabo las mejoras de las mismas y las pruebas necesarias para comprobar su correcto funcionamiento.','2010-02-26','Proyecto, GestiÃ³n de Proyecto, Herramientas y TÃ©cnicas, Ãrea de conocimientos, alcance, tiempo, costes, RRHH, revisiÃ³n, falla, reparaciÃ³n.',2,1,1,1,1,'2013-09-17 08:30:34','2013-09-17 08:30:34','Documento_331.pdf','application/pdf',9873039,'2013-09-17 08:30:34',20,0,110,'COMPLETO'),(331,'ESTUDIOS DE FORMACIÃ“Ã“NN DE COMPLEJOS TERNARIOS ENTRE EL SISTEMA VANADIO((III)) -- ÃÃCCIDO DIPICOLÃÃNNICO Y LOS AMINOÃÃCCIDOS PROLINA,, GLICINA,, a -- ALANINA Y b -- ALANINA','En este trabajo se estudiaron las reacciones de formaciÃ³n de complejos ternarios en el sistema vanadio(III) - Ã¡cido dipicolÃ­nico y los aminoÃ¡cidos prolina (pro), glicina (gly), a-alanina (a-ala) y b-alanina (b-ala), realizados mediante medidas de fuerzas electromotrices emf((H). Los datos fueron analizados utilizando el programa computacional de mÃ­nimos cuadrados generalizados LETAGROP, tomando en consideraciÃ³n los productos de hidrÃ³lisis del ion vanadio (III), las constantes de acidez de los ligandos empleados y las constantes de formaciÃ³n de complejos binarios. En el sistema V(III) - Ã¡cido dipicolÃ­nico - a- alanina el modelo que mejor ajustÃ³ los datos experimentales incluÃ­a a las especies [V(Hdipic)(Ha-ala)]+ (log bpqrs = 7.1(3)), [V(dipic)(Ha-ala)]+ (log bpqrs = 6.29(6)),[V(dipic)(a-ala)] (log bpqrs = 2.88(5)), [V(dipic)(a- ala)(OH)]-(log bpqrs = -3.7(1)) y [V(dipic)(a-ala)(OH)2]2-(log bpqrs = -12.0 (1)), en el sistema V(III) - Ã¡cido dipicolÃ­nico - b-alanina se obtuvieron los complejos [V(dipic)(Hb-ala)]+ (log bpqrs = 7.02(6)), [V(dipic)(b-ala)] (log bpqrs = 2.83(5)), [V(dipic)(b-ala)(OH)]- (log bpqrs = -3.85(8))y [V(dipic)(b- ala)(OH)2]2-(log bpqrs = -11.9(2)), mientras que en el sistema V(III) - Ã¡cido dipicolÃ­nico - glicina el modelo obtenido fue [V(Hdipic)(Hgly)]2+ (log bpqrs = 7.4(4)), [V(dipic)(Hgly)]+(log bpqrs = 6.4(1)), [V(dipic)(gly)] (log bpqrs = 3.2(1)), [V(dipic)(gly)(OH)]- (log bpqrs = -3.7(2)) y [V(dipic)(gly)(OH)2]2- (log bpqrs = -13.83(5)), y finalmente en el sistema V(III) - Ã¡cido dipicolÃ­nico - prolina se obtuvieron las especies [V(Hdipic)(Hpro)]2+(log bpqrs = 7.9(1)), [V(dipic)(Hpro)]+(log bpqrs = 5.92(7)), [V(dipic)(pro)] (log bpqrs = 1.98(9)) y [V(dipic)(pro)(OH)]-(log bpqrs = -5.1(2)).','2010-04-21','CONSTANTES DE FORMACIÃ“N, COMPLEJO TERNARIO.',6,1,1,1,1,'2013-09-17 08:30:35','2013-09-17 08:30:35','Documento_332.pdf','application/pdf',15421552,'2013-09-17 08:30:35',18,0,153,'COMPLETO'),(332,'EVALUACIÃ“N DEL PROCESO DE REMOCIÃ“N DE As (V) UTILIZANDO NANOPARTÃCULAS DE Ã“XIDO DE Fe COMO SISTEMA ADSORBENTE','La presencia natural o por fuentes antropogÃ©nicas de As (V) en muestras de aguas de pozos subterrÃ¡neos, en condiciones del medio oxidantes y de bajos pH, constituye actualmente un grave problema ambiental y de salud pÃºblica. En varias regiones del mundo tales como Asia, SudamÃ©rica y Europa, este tipo de aguas estÃ¡n contaminadas con elevados niveles de As (V) y son consumidas por su poblaciÃ³n como agua potable. El lÃ­mite establecido por la OrganizaciÃ³n Mundial de la Salud (OMS) para evitar la afectaciÃ³n de la salud humana por As (V) en agua, es de 10 Âµg/L, sin embargo en las regiones mencionadas la concentraciÃ³n de este metaloide es del orden de los mg/L, de allÃ­ que resulta urgente desarrollar metodologÃ­as eficientes de remociÃ³n de esta especie. En este sentido, este trabajo tuvo como objetivo principal desarrollar una metodologÃ­a para la remociÃ³n de As (V) en agua, utilizando NanopartÃ­culas de Ã³xidos de hierro (Nps OxFe) como sistema adsorbente. Las Nps OxFe fueron producidas mediante AblaciÃ³n LÃ¡ser (AL), bajo las siguientes condiciones: tiempo de ablaciÃ³n de (15 minutos), concentraciÃ³n de SDS (0,045 M), volumen (4 mL), energÃ­a del laser (146,5 mJ /pulso) y Ã¡rea del spot (0,00145 cm2). Estas NanopartÃ­culas (Nps) presentaron propiedades Ã³pticas relativas al fenÃ³meno de Resonancia de PlasmÃ³n Superficial (SPR) con una banda ancha entre 330 y 340 nm, la cual es mÃ¡s definida a pH fuertemente Ã¡cido (pH=1). El ensanchamiento de dicha banda de SPR se debe a los efectos de confinamiento cuÃ¡ntico que se presentan en Nps de diÃ¡metro menores a 20nm, en este trabajo las Nps son susceptibles de dicho confinamiento dado que su diÃ¡metro promedio fue de 20 nm, segÃºn la tÃ©cnica de DispersiÃ³n DinÃ¡mica de la Luz (DLS). La capacidad de RemociÃ³n de As (V) sobre las Nps OxFe fue de 24,3 mg As/g Nps Fe y los datos de adsorciÃ³n de este sistema Nps OxFe - As se ajustan al modelo lineal de isoterma de Langmuir con un coeficiente de correlaciÃ³n R2= 0,980 y una KL de adsorciÃ³n de 3,847. Se encontrÃ³ que la capacidad de adsorciÃ³n de las Nps OxFe es dependiente del pH del medio, obteniendo como pH Ã³ptimo (pH=1) para una remociÃ³n del 86% del analito. La metodologÃ­a de remociÃ³n de As (V) fue utilizada para la determinaciÃ³n de este analito presente en muestras reales de agua. Para ello se enriquecieron muestras de agua potable y de agua de grifo con 3 mg/L de As (V). En ambos casos el porcentaje de recuperaciÃ³n fue mayor al 96 % lo que indica la ausencia del efecto matriz en dichas muestras.','2010-04-20','NanopartÃ­culas, AblaciÃ³n, PlasmÃ³n Superficial, isoterma de Langmuir',6,1,1,1,1,'2013-09-17 08:30:37','2013-09-17 08:30:37','Documento_333.pdf','application/pdf',0,'2013-09-17 08:30:37',19,0,0,'INCOMPLETO'),(333,'CLASIFICACIÃ“N DE TUMORES CEREBRALES DE ACUERDO AL GRADO DE MALIGNIDAD MEDIANTE EL ANÃLISIS DE PARÃMETROS CARACTERÃSTICOS DEL BORDE DEL TUMOR','En general los tumores presentan una forma irregular con propiedades geomÃ©tricas que parecen depender del grado de malignidad del tumor. Para estudiar estas irregularidades es necesario implementar procedimientos de segmentaciÃ³n de imÃ¡genes para definir el contorno y las zonas activas del tumor. En el presente trabajo, imÃ¡genes de Resonancia MagnÃ©tica con y sin contraste provenientes de un servicio de Radioterapia fueron utilizadas para evaluar los parÃ¡metros del contorno que pueden estar relacionados con el estadio de malignidad, teniendo como referencia la clasificaciÃ³n de la lesiÃ³n mediante estudios HistoÃ¢Â€ÂpatolÃ³icos, pudiendo asÃ­ establecer una relaciÃ³n entre dichos parÃ¡metros y la biologÃ­a del tumor. El contorno del tumor ha sido obtenido para cada plano de la imagen en su extensiÃ³n volumÃ©trica con la finalidad de obtener la dispersiÃ³n de los valores en funciÃ³n del corte. Para obtener dichos contornos se han utilizado diferentes mÃ©todos de segmentaciÃ³n como el MÃ©todo del Umbral. Exponentes CrÃ­ticos asociados a la rugosidad del contorno del tumor fueron calculados obteniendo resultados que demuestran una buena relaciÃ³n entre dichos parÃ¡metros y el grado de malignidad del tumor.','2010-02-10','SegmentaciÃƒÂ³n de ImÃƒÂ¡genes, Crecimiento tumoral, Estadio del tumor, Exponentes CrÃƒÂ­ticos, Dimension Fractal',3,1,1,1,1,'2013-09-17 08:30:37','2013-09-17 08:30:37','Documento_334.pdf','application/pdf',450950,'2013-09-17 08:30:37',20,0,74,'COMPLETO'),(334,'VARIACIÃ“Ã“NN MORFOLÃ“Ã“GGICA DE LA REGIÃ“Ã“NN CEFÃÃLLICA DE ESPECIES DEL GÃ‰Ã‰NNERO CROTALUS,, UTILIZANDO MÃ‰Ã‰TTODOS DE MORFOMETRÃÃAA GEOMÃ‰Ã‰TTRICA','El estudio taxonÃ³mico de las serpientes de cascabel, al igual que el de muchas otras serpientes ha sido bastante complicado por la cantidad de variaciones que se pueden presentar en los caracteres mÃ¡s comÃºnmente utilizados como lo son lepidosis y patrones de coloraciÃ³n, incluso dentro de poblaciones relativamente cercanas de una misma especie. Esta falta de caracteres cuantificables al momento de aceptar alguna de las clasificaciones propuestas hasta ahora, como vÃ¡lida, ha llevado a una bÃºsqueda de metodologÃ­as distintas para discernir entre los distintos grupos de cascabeles. Actualmente se consideran cinco grupos de cascabeles en el paÃ­s pero no se ha podido unificar un criterio para determinar si lo que esta presente en Venezuela son realmente cinco especies o una o mÃ¡s especies con cierto nÃºmero de subespecies. Esta necesidad de encontrar una metodologÃ­a que ayude a discernir entre un grupo y otro de manera mÃ¡s concisa nos ha motivado a aplicar metodologÃ­as de anÃ¡lisis de morfometrÃ­a geomÃ©trica a nivel cefÃ¡lico para determinar si existen variaciones en la forma de la cabeza de los distintos grupos y asÃ­ contribuir un poco a aclarar el estado taxonÃ³mico del gÃ©nero Crotalus en Venezuela. Objetivo General: En este trabajo se plantea como principal objetivo, la determinaciÃ³n de las variaciones morfolÃ³gicas a lo largo del desarrollo ontogenÃ©tico en la cabeza de los distintos representantes del gÃ©nero Crotalus en Venezuela, asÃ­ como las variaciones Ã­nter especÃ­ficas del gÃ©nero las cuales podrÃ­an ser utilizadas en descripciones taxonÃ³micas mÃ¡s robustas de las especies estudiadas. MetodologÃ­a: Se va a realizar un anÃ¡lisis morfomÃ©trico utilizando el mÃ©todo de cerchas (box truss). Se van a tomar fotos de las cabezas de los ejemplares del gÃ©nero Crotalus que se encuentren preservados en las principales colecciones herpetolÃ³gicas del paÃ­s, sobre dichas fotos se van a tomar un total de 26 hitos homÃ³logos, 13 de la zona dorsal y 13 de la zona ventral, luego se van a medir un total de 53 distancias inter-hitos 26 en la zona dorsal y 27 en la zona ventral, y con dichas distancias se va a realizar un anÃ¡lisis de componentes principales el cual permita eliminar el componente del tamaÃ±o de los distintos ejemplares, de forma tal que permita analizar especÃ­ficamente variaciones en la forma de los ejemplares. RESULTADOS Luego de realizado este estudio, podemos notar que efectivamente existen diferencias morfolÃ³gicas a lo largo del desarrollo ontogenÃ©tico de los individuos, en las distintas especies y subespecies de serpientes de cascabel presentes en Venezuela. Estas diferencias morfolÃ³gicas a nivel cefÃ¡lico siguen patrones distintos que van asociados a cada grupo en particular, mÃ¡s sin embargo, observamos que las zonas de mayor variaciÃ³n entre los distintos grupos, es la zona correspondiente a las Cerchas IV y V, siendo esto un resultado comÃºn entre todos los grupos.Igualmente se puede observar que no existen evidencias de dimorfismo sexual a nivel cefÃ¡lico en ninguno de los grupos estudiados asÃ­ como tampoco se evidencia ningÃºn patrÃ³n que permita hacer diferenciaciones entre los individuos estudiados segÃºn sus localidades, sin embargo consideramos prudente la realizaciÃ³n de estudios mÃ¡s especÃ­ficos y detallados para determinar o descartar diferencias morfolÃ³gicas intrapoblacionales de las distintas especies y subespecies. Los resultados obtenidos demuestran que efectivamente existen diferencias morfolÃ³gicas a nivel cefÃ¡lico, entre los individuos adultos de las dos subespecies de C.. durissus que se encuentran en Venezuela, al igual que diferencias morfolÃ³gicas a nivel cefÃ¡lico entre C.. maricelae y el resto de las cascabeles del paÃ­s. Sin embargo consideramos que dichas diferencias no poseen un peso suficiente como para sustentar o desestimar, alguna de las clasificaciones de las serpientes de cascabel venezolanas, existentes hasta ahora.','2010-04-30','Crotalus, cascabeles, morfometrÃ­a geomÃ©trica',1,1,1,1,1,'2013-09-17 08:30:38','2013-09-17 08:30:38','Documento_335.pdf','application/pdf',472182,'2013-09-17 08:30:38',18,0,56,'COMPLETO'),(335,'ESTUDIO DE ANISOTROPIA SISMICA BAJO EL OCCIDENTE DE VENEZUELA A PARTIR DEL DESDOBLAMIENTO DE ONDAS DE CORTE','En este trabajo, se realizo un estudio de anisotropÃ­a sÃ­smica en la regiÃ³n occidental de Venezuela analizando el desdoblamiento de ondas de corte de fases telesÃ­smicas SKS, en sismogramas grabados por la estaciones CAPV, CURV, DABV, JACV, MONV, SIQV, SOCV, TERV y VIRV pertenecientes a la Red SismolÃ³gica nacional de FUNVISIS. Para el anÃ¡lisis se empleo la metodologÃ­a desarrollada por Silver y Chan (1991). Los resultados obtenidos muestran que los tiempos de retraso varÃ­an en direcciÃ³n SO-NE, donde el extremo NE muestra mayores porcentajes de anisotropÃ­a sÃ­smica que el SO, es decir la deformaciÃ³n del manto es mayor en el noreste. Las direcciones de polarizaciÃ³n promedio en las estaciones ubicadas en las regiones del bloque de Maracaibo y los Andes de Venezuela (CAPV, CURV, QARV, SOCV y VIRV) coinciden, aproximadamente, con la direcciÃ³n E-O del movimiento absoluto de placas (MAP) de SudamÃ©rica, en cambio, las estaciones ubicadas en el bloque de Bonaire (DABV, JACV y MONV) muestran direcciones de polarizaciÃ³n que coinciden con las fallas superficiales cercanas a las estaciones lo que indica que el proceso de deformaciÃ³n del manto es diferente en esta regiÃ³n. Resultados anÃ³malos se encontraron en las estaciones TERV y SIQV, ubicadas en la regiÃ³n de los andes y la regiÃ³n del bloque de Maracaibo, respectivamente, donde las direcciones de polarizaciÃ³n y su promedio difieren en 90 grados, aproximadamente, de la direcciÃ³n del MAP de SudamÃ©rica y tampoco coinciden con la direcciÃ³n SO-NE de las estructuras geolÃ³gicas superficiales cercanas a las estaciones, estos resultados, que son distintos a los obtenidos en otras estaciones muy cercanas (CURV, DABV y QARV) indican que el flujo del manto puede estar siendo alterado por alguna estructura u obstÃ¡culo.','2010-04-06','AnisotropÃ­a SÃ­smica, Desdoblamiento de Ondas de Corte, Tiempo de Retraso, Manto Superior',3,1,1,1,1,'2013-09-17 08:30:39','2013-09-17 08:30:39','Documento_336.pdf','application/pdf',713242,'2013-09-17 08:30:39',20,0,104,'COMPLETO'),(336,'EVALUACIÃ“N DE LA VARIACIÃ“N EN PROFUNDIDAD DE LA ANISOTROPÃA SÃSMICA EN LA REGION NOR-ORIENTAL DE VENEZUELA','Las caracterÃ­sticas anisotrÃ³picas bajo el noreste de Venezuela son estudiadas por medio del anÃ¡lisis del desdoblamiento de ondas de corte medido en 346 sismos locales. Las formas de onda usadas fueron registradas entre 2003 y 2009 por las estaciones banda-ancha AVEV, BLOS, CRUV, CUPC, DRKS, GUIV, GUNV, IBAV, ITEV y MIPC, pertenecientes a la red sismolÃ³gica de FUNVISIS y al arreglo telemÃ©trico de Venezuela (proyecto BOLIVAR). En esta regiÃ³n convergen el sistema transpresivo asociado a las Fallas de El Pilar, Los Bajos- El Soldado, y La subducciÃ³n entre las Placas Sur-Americana y Caribe, causando que el Ã¡rea sea geodinÃ¡micamente compleja. La polarizaciÃ³n medida en estaciones instaladas en el continente es coherente con los principales accidentes geolÃ³gicos de la regiÃ³n (i.e. falla El Pilar y Graben de San Juan), mientras que en las regiones de ante-arco y retro-arco, pasa de ser normal a sub- paralela a la trinchera de las Antillas Menores. En la placa Caribe la polarizaciÃ³n pareciera coincidir con el mÃ¡ximo esfuerzo compresional (shmax) regional, y en el caso especÃ­fico de IBAV coincide con el rumbo de la falla de Punta Arenas. Los valores de tiempo de retraso medido a lo largo del noreste de Venezuela son bastante pequeÃ±os (ÃŽÂ´tmax dtmax = 0,22 s), estables, y no evidencian dependencia alguna con la profundidad. El anÃ¡lisis de la magnitud de anisotropÃ­a en sismos localizados por debajo de los 140 Km de profundidad y la consideraciÃ³n de los resultados obtenidos mediante fases telesÃ­smicas (ej. SKS) en estudios anteriores, indica que la anisotropÃ­a bajo el noreste de Venezuela estÃ¡ contenida principalmente en dos capas: en la corteza y regiones someras del manto superior (menor a 65 Km), y por encima de los 130 Km de profundidad, mientras, la cuÃ±a mantÃ©lica aparenta ser isotrÃ³pica.','2010-04-15','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',3,1,1,1,2,'2013-09-17 08:30:41','2013-09-17 08:30:41','Documento_337.pdf','application/pdf',1116114,'2013-09-17 08:30:41',20,0,90,'COMPLETO'),(337,'Propuesta de diseÃ±o de una soluciÃ³n de videovigilancia soportada en cÃ¡maras IP con tecnologÃ­a IEEE 802.11 para el Edificio el Rectorado, la Plaza Cubierta y el Complejo Cultural Aula Magna de la UCV','Debido a los diversos ataques en los que se ha visto involucrada la UniversidadCentral de Venezuela, surgiÃ³ la necesidad de una propuesta de diseÃ±o de una soluciÃ³nde videovigilancia soportada en cÃ¡maras IP, con la finalidad de incrementar los nivelesde vigilancia en el Edificio el Rectorado, la Plaza Cubierta y el Complejo Cultural AulaMagna de la UCV. Esta fue la propuesta de la DirecciÃ³n de TecnologÃ­a de InformaciÃ³ny Comunicaciones (DTIC), con el objetivo de reforzar los niveles de seguridad y de estamanera brindar tranquilidad a la comunidad universitaria.En este Trabajo Especial de Grado se presenta el diseÃ±o, los dispositivosinalÃ¡mbricos usados y unas pruebas de funcionamiento, que dan soporte al diseÃ±o dela soluciÃ³n. Los dispositivos inalÃ¡mbricos involucrados en el diseÃ±o estÃ¡n basados enel fabricante Cisco Systems. La propuesta de diseÃ±o de la soluciÃ³n de videovigilanciase basa en el estÃ¡ndar IEEE 802.11 y asÃ­ mismo se propone la implementaciÃ³n de QoS(Quality of Service), especÃ­ficamente del mecanismo de DiffServ (DifferentiatedServices), con la finalidad de evitar la congestiÃ³n del trÃ¡fico que transita por la red. A suvez para validar esta propuesta de diseÃ±o, se realizaron diversas pruebas. El resultadofinal, es una soluciÃ³n de videovigilancia soportada en una WLAN completamentefuncional, que cumple con los requisitos exigidos por la DTIC y por la DirecciÃ³n deSeguridad de la UCV.','2010-05-03','WLAN, IEEE 802.11, Quality of Service, QoS, Differentiated Services, DiffServ, cÃ¡maras IP.',2,1,1,1,1,'2013-09-17 08:30:43','2013-09-17 08:30:43','Documento_338.pdf','application/pdf',1426004,'2013-09-17 08:30:43',20,0,128,'COMPLETO'),(338,'ESTUDIOS DE ADSORCIÃ“Ã“NN DE LAS SUBFRACCIONES A11 Y A22 DE ASFALTENOS SOBRE SUPERFICIES INORGÃÃNNICAS\"\"','La industria petrolera venezolana estÃ¡ enfocada en la bÃºsqueda de una explotaciÃ³n eficaz del crudo, por lo cual busca minimizar los gastos e inconvenientes que puedan presentarse en todos sus procesos. Los crudos pesados se caracterizan por poseer alta viscosidad debido a su alto contenido de asfaltenos, los cuales tienden a asociarse entre sÃ­ para formar agregados, que luego continÃºan asociÃ¡ndose hasta formar flÃ³culos que, posteriormente precipitan y obstaculizan determinados procesos en la industria. Debido a la inquietud que se tiene acerca de la diferencia en cuanto al comportamiento coloidal de los asfaltenos, algunos trabajos reportan su fraccionamiento a fin de simplificar su estudio. Estas fracciones conocidas como A1 y A2 presentan comportamiento diferente de solubilidad, por lo que en este trabajo se propone como objetivo principal el estudio de diferencias a nivel molecular a partir de la adsorciÃ³n de las subfracciones A1 y A2 de asfaltenos provenientes de los crudos Carabobo y Furrial sobre superficies inorgÃ¡nicas. A partir de las soluciones de A1 y A2 en cloroformo en un rango de concentraciones comprendido entre 500 y 20000 mg/L, se construyeron isotermas de adsorciÃ³n representando el espesor de capa en funciÃ³n de la concentraciÃ³n en soluciÃ³n empleando un interferÃ³metro de luz blanca de barrido modelo New View 600. Los resultados encontrados revelan que para el crudo Carabobo (estable) la formaciÃ³n de agregados se traduce en un incremento en el tamaÃ±o de las partÃ­culas de los asfaltenos, mientras que para el crudo Furrial (inestable); la formaciÃ³n de agregados estÃ¡ gobernada por el aumento en el nÃºmero de los mismos, formando multicapas en la superficie.','2010-05-06','AdsorciÃ³n, Asfaltenos, A1, A2, agregados, InterferometrÃ­a',6,1,1,1,1,'2013-09-17 08:30:44','2013-09-17 08:30:44','Documento_339.pdf','application/pdf',1507362,'2013-09-17 08:30:44',19,0,77,'COMPLETO'),(339,'DESARROLLO DE UN TEXTURIZADO FUNCIONAL A BASE DE PULPA DE PARCHITA (Passiflora edulisvar. Flavicarpa) Y GELATINA CON INCORPORACIÃ“N DE INGREDIENTES PROBIÃ“TICOS Y PREBIÃ“TICOS','Fue desarrollado un texturizado funcional a base de pulpa de parchita y gelatina incorporando ingredientes prebiÃ³tico (Inulina) y probiÃ³tico (encapsulados de bÃ­fidobacterias en alginato de sodio). En la primera fase del trabajo, se realizaron ensayos preliminares para determinar la concentraciÃ³n de los componentes principales del texturizado, obteniendo una formulaciÃ³n final de 30% de Pulpa de Parchita ajustada a 30Â°Brix, 6% de Gelatina, 1% de Inulina y aproximadamente 8 g de encapsulados de bÃ­fidobacterias. En una segunda fase, se realizÃ³ un anÃ¡lisis fÃ­sico, quÃ­mico, microbiolÃ³gico y sensorial de los texturizados formulados, durante un periodo de 27 dÃ­as para asÃ­ tener una idea de la estabilidad de Ã©stos y adicionalmente determinar la aceptabilidad por parte de los consumidores. El texturizado funcional de parchita, presentÃ³ caracterÃ­sticas fisicoquÃ­micas resaltantes, como un bajo pH (<4) y una actividad de agua de 0,965 las cuales permitieron que el producto fuera muy estable, tanto fisicoquÃ­mica, como microbiolÃ³gicamente durante su almacenamiento bajo refrigeraciÃ³n. Sin embargo, la mediciÃ³n de textura (Dureza) instrumental y sensorial de los texturizados reportÃ³ cambios significativos de este parÃ¡metro durante el almacenamiento de los mismos.Los resultados obtenidos en las pruebas sensoriales realizadas, indican que el producto final fue ampliamente aceptado por los consumidores y que no presenta cambios significativos en caracterÃ­sticas de olor, color y sabor, lo que es de gran importancia.','2010-04-30','Texturizado, Alimento Funcional, ProbiÃ³ticos, Passiflora edulis, Pulpa de Parchita',1,1,1,1,1,'2013-09-17 08:30:48','2013-09-17 08:30:48','Documento_340.pdf','application/pdf',1557768,'2013-09-17 08:30:48',20,0,105,'COMPLETO'),(340,'Desarrollo de un agente para la captura de datos agronÃ³micos desde dispositivos mÃ³viles utilizando la metodologÃ­a JADE','El estudio y clasificaciÃ³n de suelos resulta ser una actividad imprescindible para el manejo sustentable de este recurso en mÃºltiples actividades humanas. Un problema al que se enfrentan los investigadores en esta Ã¡rea estÃ¡ relacionado con la manera cÃ³mo se organiza y gestiona la informaciÃ³n que se genera desde las distintas fuentes utilizadas, tales como: imÃ¡genes satelitales, levantamiento de suelos, resultados de distintas pruebas de laboratorio, entre otras. Con el fin de apoyar a los profesionales en esta actividad, se ha propuesto un sistema basado en agentes inteligentes para el almacenamiento, gestiÃ³n y clasificaciÃ³n de datos. En este sistema se contempla el diseÃ±o y construcciÃ³n de un agente que permita la captura de datos desde un dispositivo mÃ³vil, que es el motivo del presente trabajo. El agente beneficia el proceso de recolecciÃ³n de datos, haciendo la captura y el registro de los datos de campo desde la misma aplicaciÃ³n; a diferencia de los procesos manuales, los cuales requieren realizar gastos adicionales de tiempo y recursos, para la validaciÃ³n y el almacenamiento de los datos. AdemÃ¡s, el agente proporciona asistencia al especialista durante el proceso de captura.','2010-05-06','Agente, Captura de datos, dispositivo mÃ³vil, JADE, metodologÃ­a de agentes, Siscla, Agentes Inteligentes, agronomÃ­a, edafÃ³logo, agrologo, Laboratorio de Inteligencia Artificial',2,1,1,1,1,'2013-09-17 08:30:49','2013-09-17 08:30:49','Documento_341.pdf','application/pdf',2161039,'2013-09-17 08:30:49',20,0,100,'COMPLETO'),(341,'Ecuaciones de inferencia entre cociente S y susceptibilidad magnÃ©tica del pozo SaltarÃ­n 1A, usando redes neuronales difusas','En este trabajo se ha utilizado las redes neuronales difusas (RND), en la inferencia del cociente S (CS ) a travÃ©s de la susceptibilidad magnÃ©tica (h). Se cuenta con 90 datos experimentales de h y CS , las cuales abarcaron 670 metros de profundidad, del pozo SaltarÃ­n 1A, localizado al este de Colombia (cuenca de los Llanos Orientales). Las pruebas computacionales se hicieron tomando en cuentas dos tipos de divisiones: a) por formaciones litolÃ³gicas (Guayabo, LeÃ³n y Carbonera), b) por envolventes transgresivas (envolvente 1, envolvente 2 y envolvente 3). Las ecuaciones provenientes de los entrenamientos para una determinada formaciÃ³n o envolvente, no infieren correctamente al evaluarlas con los datos de h de las otras dos formaciones y envolventes. Sin embargo, las ecuaciones derivadas del entrenamiento de la FormaciÃ³n Guayabo del pozo SaltarÃ­n 1A, infieren adecuadamente al evaluarlas con los datos experimentales de la h de los pozos G-1X y G-8X, pertenecientes a la FormaciÃ³n Guayabo del campo Guafita, sur-oeste de Venezuela. De estudios anteriores se sabe que el pozo SaltarÃ­n 1A, en la FormaciÃ³n Guayabo, presenta una anomalÃ­a magnÃ©tica tipo A, producida principalmente por framboides de magnetita autigÃ©nica y con una relaciÃ³n genÃ©tica con un posible yacimiento de hidrocarburos subyacente. Por otro lado, se conoce que el pozo G-1X presenta tambiÃ©n una anomalÃ­a tipo A y otra tipo B (contraste litolÃ³gico sin relaciÃ³n genÃ©tica con el hidrocarburo subyacente), mientras que el pozo G-8X posee Ãºnicamente una anomalÃ­a tipo B. De esta forma es importante destacar que la mejor inferencia de las reglas difusas derivadas de la FormaciÃ³n Guayabo en el pozo SaltarÃ­n 1A se obtiene precisamente para la anomalÃ­a tipo A de G-1X. Por otro lado para el pozo G-1X se empleÃ³ el modelo A (simple), mientras que para el pozo G-8X se usÃ³ el modelo B (semi-Log), con un ligero empeoramiento en la inferencia del CS . Esta diferencia de modelos para la inferencia del CS , puede ser debida a la diferencia en el origen de las anomalÃ­as magnÃ©ticas que se encuentran en ambos pozos. Las ecuaciones asociadas a la FormaciÃ³n Guayabo perteneciente al pozo SaltarÃ­n 1A, infieren razonablemente bien sobre otros datos experimentales de h si Ã©stos son similares a su litologÃ­a y tipos de ambientes.','2010-03-24','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',3,1,1,1,1,'2013-09-17 08:30:52','2013-09-17 08:30:52','Documento_342.pdf','application/pdf',10378482,'2013-09-17 08:30:52',20,0,106,'COMPLETO'),(342,'EvaluaciÃ³n del efecto anti-inflamatorio de compuestos kauranos extraÃ­dos de plantas del gÃ©nero Croton.','Los productos naturales pueden definirse como una sustancia quÃ­mica que esta presente o es producida por un organismo vivo. Muchos de los compuestos utilizados en el tratamiento de enfermedades relacionadas con la inflamaciÃ³n, son obtenidos de los extractos de plantas y otros organismos; y Ã©stos incluyen diversos compuestos como fenoles, terpenoides, alcaloides, esteroides, glicÃ³sidos y carbohidratos. Bajo esta premisa el objetivo de este trabajo es estudiar el efecto antiinflamatorio de los compuestos extraÃ­dos de plantas del gÃ©nero Croton: Micanol, KAJ y Deoxo-geayine, sobre leucocitos humanos y macrÃ³fagos mÃºridos Raw 264.7.Para esto se aplicaron las siguientes tÃ©cnicas y metodologÃ­as: determinaciÃ³n del efecto de compuestos kauranos Micanol, KAJ y Deoxo-geayine sobre la inhibiciÃ³n de la producciÃ³n de Ã³xido nÃ­trico en macrÃ³fagos mÃºridos RAW 264.7 (mÃ©todo de Griess), los ensayos de viabilidad celular por el mÃ©todo de reducciÃ³n de MTT, la actividad captadora del radical Ã³xido nÃ­trico (NPS) por parte de los compuestos, el mÃ©todo de reducciÃ³n del azul de nitrotetrazolio (NBT) para cuantificar la variaciÃ³n en la producciÃ³n de aniÃ³n superÃ³xido involucrada en la cascada de reacciones pro-inflamatorias inducida por el PMA en leuc