de forma priorizada en el contexto de las actividades de GestiÃ³n Ambiental, a travÃ©s de los cuales se potencie el establecimiento de esquemas de manejo seguro que garanticen un mayor nivel de protecciÃ³n ambiental, como parte de las metas y objetivos de los diferentes sectores productivos y de servicios, en funciÃ³n de la Excelencia Empresarial. PEPSI-COLA VENEZUELA, C.A, empresa perteneciente al sector de bebidas refrescantes dedicada a la producciÃ³n de bebidas carbonatadas y no carbonatadas, preocupada por mejorar su desempeÃ±o ambiental, propicia el espacio para un detallado diagnÃ³stico ambiental de los procesos de manufactura de concentrados lÃ­quidos en el centro productivo PCV Planta de Concentrados, herramienta que fue crucial para la implementaciÃ³n de su plan de manejo de desechos peligrosos sÃ³lidos. Este diagnÃ³stico sirviÃ³ de base para desarrollar todas las actividades necesarias que permitieran mitigar los impactos ambientales identificados, enfocÃ¡ndose en una fase inicial en los residuos sÃ³lidos peligrosos, ya que estos se generan en los procesos productivos de mayor relevancia. A partir de este estudio, se establecieron los procedimientos necesarios para garantizar el manejo adecuado de los desechos sÃ³lidos peligrosos derivados de los procesos de manufactura de bases concentradas para Bebidas Carbonatadas y No Carbonatadas, los cuales ascienden a 21.273 Kg, cifra que constituye el 49% de los desechos sÃ³lidos generados por PCV Planta de Concentrados, ubicÃ¡ndose dentro de la categorÃ­a de Grandes Generadores de desechos peligrosos, de acuerdo con el Art.42. del Decreto No.2.635, relativo al control Administrativo de Generadores de Desechos Peligrosos. Como resultado de la formulaciÃ³n e implementaciÃ³n del Plan de Manejo de Desechos Peligrosos SÃ³lidos (PMDPS), se logrÃ³ incrementar el nivel de cumplimiento legal-ambiental de la planta en un 59,24% en su primera etapa, con la construcciÃ³n y adecuaciÃ³n de un AlmacÃ©n Temporal de Desechos Peligrosos, de conformidad con los lineamientos establecidos en el Decreto 2.635, contentivo de las Normas para el Control de la RecuperaciÃ³n de Materiales Peligrosos y el Manejo de los Desechos Peligrosos, estimÃ¡ndose un incremento del 97,27% para finales del perÃ­odo 2009-2010. Adicionalmente, se impulsaron proyectos de ingenierÃ­a e infraestructura de gran envergadura en materia de adecuaciÃ³n de Ã¡reas de almacenamiento de sustancias peligrosas, que contribuirÃ¡n a incrementar el estÃ¡ndar de operaciÃ³n de la planta, al minimizar los riesgos asociados con las operaciones de manejo de insumos dentro de las Ã¡reas productivas.','2010-04-30','Desechos peligrosos, desechos sÃ³lidos, gestiÃ³n de desechos peligrosos',6,1,1,1,1,'2013-09-17 08:30:59','2013-09-17 08:30:59','Documento_344.pdf','application/pdf',0,'2013-09-17 08:30:59',20,0,0,'INCOMPLETO'),(344,'DetecciÃ³n de algunas mutaciones comunes en los genes BRCA1 y BRCA2 en mujeres con cÃ¡ncer de mama del tipo hereditario.','El cÃ¡ncer de mama es la quinta causa de muerte a nivel mundial y la segunda entre las mujeres, en las cuales, el 10% son del tipo hereditario, debido principalmente a mutaciones germinales en los genes BRCA11 y BRCA22. Se han detectado mÃ¡s de 1600 mutaciones en estos genes, siendo las deleciones e inserciones las que tienen un comprobado efecto patolÃ³gico. Algunas mutaciones se han detectado mÃ¡s comÃºnmente en grupos Ã©tnicos particulares. En Venezuela no se han realizado estudios de este tipo y es por ello, que en el presente trabajo se procediÃ³ a la determinaciÃ³n de la presencia de mutaciones debidas a inserciones o deleciones en los genes BRCA11 (c.943ins10, c.1135insA, c.1623del5, c.2080delA, c.2552delC, c.3450del4, c.3875del4 y c.5083insC) y BRCA22 (c.3036del4, c.3492insT, c.6696delTC y c.9254del5), mÃ¡s comÃºnmente encontradas en la poblaciÃ³n espaÃ±ola, italiana, africana y latinoamericana en general; poblaciones de gran influencia en la composiciÃ³n actual de nuestra poblaciÃ³n. AdemÃ¡s, se analizÃ³ la presencia de las mutaciones encontradas con mayor frecuencia en la poblaciÃ³n mundial general, con efecto fundador en la poblaciÃ³n JudÃ­a-Ashkenazi (c.185delAG y c.5382insC para el gen BRCA11 y c.6174delT en BRCA22). Para llevar a cabo este estudio, a partir del ADNg aislado de 48 muestras de sangre de pacientes venezolanos con cÃ¡ncer de mama del tipo hereditario, diagnosticadas por el Centro ClÃ­nico de EstereotÃ¡xia (CECLINES), se procediÃ³ inicialmente a la detecciÃ³n de las mutaciones mediante PCR y electroforesis en geles de poliacrilamida en condiciones desnaturalizantes. Con esta tÃ©cnica se logrÃ³ evaluar las mutaciones de origen JudÃ­o-Ashkenazi, las cuales no estuvieron presentes en la muestra poblacional analizada. Debido a dificultades en la estandarizaciÃ³n de esta tÃ©cnica para evaluar el resto de las mutaciones se procediÃ³ al uso de la tÃ©cnica de SSCP (ConformaciÃ³n de Polimorfismos de cadena Sencilla). Con el uso de ambas metodologÃ­as, en total, se detectaron 7 mutaciones diferentes distribuidas en 8 pacientes. Cinco de las mutaciones detectadas se hallan en el exÃ³n 11 del gen BRCA11; c.1128_1136insA, p.P871L, p.K1183R y p.S694S, ya reportadas previamente, y c.951_952insA, mutaciÃ³n descrita por primera vez en este estudio. En BRCA22 se detectaron las mutaciones c.2733insA y c.3036_3039del4 en el exÃ³n 11, de las cuales, la primera no ha sido reportada y la segunda si esta reportada en BIC (Breast Cancer Information Core). Este estudio constituyÃ³ el primero realizado en Venezuela para la evaluaciÃ³n del espectro mutacional de BRCA11//22 en el paÃ­s, mediante estudios posteriores, serÃ¡ posible establecer la poblaciÃ³n con mayor riesgo de padecer la enfermedad, con la finalidad de aumentar la vigilancia mÃ©dica en pro de la detecciÃ³n temprana de la enfermedad, y la aplicaciÃ³n del consejo genÃ©tico en las pacientes portadoras.','2010-04-30','CÃ¡ncer de mama, BRCA1, BRCA2, mutaciÃ³n fundadora.',1,1,1,1,1,'2013-09-17 08:31:00','2013-09-17 08:31:00','Documento_345.pdf','application/pdf',1216393,'2013-09-17 08:31:00',20,0,107,'COMPLETO'),(345,'\"ESTUDIO DE LA TENSIÃ“N INTERFACIAL DE LAS FRACCIONES A1 Y A2DE ASFALTENOS CARABOBO Y FURRIAL\"','En este trabajo se determinÃ³ la tensiÃ³n superficial de los asfaltenos Furrial y de Carabobo asÃ­ como de sus subfracciones (A1 y A2), empleando el mÃ©todo de la gota en reposo. Para ello se desarrollÃ³ y empleo una metodologÃ­a que consistiÃ³ en la adsorciÃ³n de asfaltenos y sus subfracciones, a partir de soluciones de 10000ppm de las mismas sobre superficies sÃ³lidas, en este caso vidrio. El equipo utilizado para estas medidas se desarrollÃ³ en el laboratorio de EspectroscopÃ­a LÃ¡ser en la Facultad de Ciencias, UCV. Los resultados obtenidos demuestran que los asfaltenos del crudo Carabobo, presentan los mayores valores de Ã¡ngulo de contacto es decir presentan mayor carÃ¡cter hidrofÃ³bico. Para las muestras del crudo Furrial se encontrÃ³ menor carÃ¡cter hidrofÃ³bico, por lo que debe poseer mayor cantidad de compuestos polares del tipo puente de hidrÃ³geno. Las subfracciones presentaron menores Ã¡ngulos de contacto, esto se debe a que al fraccionar a los asfaltenos, existe una distribuciÃ³n de compuestos que exhiben centros activos a su interacciÃ³n con el solvente conduciendo a un mayor carÃ¡cter hidrofilico. Se realizaron medidas de espesores de capa adsorbida (asfaltenos y subfracciones) sobre vidrio, encontrando evidencias de que A1 se agrega mucho mÃ¡s posiblemente por el tipo de estructura que presenta esta fracciÃ³n, ya que estÃ¡ conformada por anillos aromÃ¡ticos que estÃ¡n enlazados entre sÃ­, haciendo una estructura rÃ­gida, que no permite una buena interacciÃ³n con el solvente, a diferencia de A2 donde sus anillos estÃ¡n unidos por cadenas alifÃ¡ticas que le confiere flexibilidad y una mejor interacciÃ³n con el solvente. Por otro lado las diferencias entre Furrial y Carabobo se basan en la mayor tendencia de agregaciÃ³n de los asfaltenos de Furrial debido a un aumento en el nÃºmero de agregados, mientras que Carabobo tiende a aumentar es en el tamaÃ±o de los agregados ya que mostraron mayor espesor de capa.','2010-04-28','{}',6,1,1,1,1,'2013-09-17 08:31:01','2013-09-17 08:31:01','Documento_346.pdf','application/pdf',0,'2013-09-17 08:31:01',17,0,0,'INCOMPLETO'),(346,'Estudio de los Complejos de Vanadio de Valencia Mixta ((IV,, V)) y la Glicina ((KCl 33..00 M,, 2255 Â°Â°C)) Estudio de los Complejos de Vanadio de Valencia Mixta ((IV,, V)) y la Glicina ((KCl 33..00 M,, 2255 Â°Â°C))','En este trabajo se estudiaron las reacciones de formaciÃ³n de los complejos de vanadio valencia mixta (IV, V) y el aminoÃ¡cido glicina, realizados mediante medidas de fuerzas electromotrices emf (H). Los datos fueron analizados utilizando el programa computacional de mÃ­nimos cuadrados generalizados LETRAGROP, tomando en consideraciÃ³n los productos de hidrÃ³lisis de los iones de vanadio (IV, V), las constantes de acidez del ligando empleado y las constante de formaciÃ³n de los complejos. E n el Sistema H+ - VO2+ - VO2+ - glicina el modelos que mejor ajusto los datos experimentales incluyo a las espÃ©cies : [HV2O3C]3+ (Log Ã¯ÂÂ¢pqrs = 32.43(4)), [HV2O3C2]2+ (Log Ã¯ÂÂ¢pqrs = 41.63(7)), [H2V2O3C2]3+ (Log Ã¯ÂÂ¢pqrs = 42.9 < 43.6), [V2O3C]2+ (Log Ã¯ÂÂ¢pqrs = 28.9(3)), [V2O3C2]+ (Log Ã¯ÂÂ¢pqrs = 36.8 < 37.7). [(OH)V2O3C]+ (Log Ã¯ÂÂ¢pqrs = 26.54(5)), [ (OH)2V2O3C] (Log Ã¯ÂÂ¢pqrs = 22.70(3)). Y finalmente, los valores de pKa para el ligando protonado y neutro fueron: H2C+ pKa= 2.72 (2) y HC pKa= 10.09 (3)','2010-05-06','TEG',6,1,1,1,1,'2013-09-17 08:31:02','2013-09-17 08:31:02','Documento_347.pdf','application/pdf',1472797,'2013-09-17 08:31:02',15,0,147,'COMPLETO'),(347,'SÃÃNNTESIS DE POLÃÃMMEROS ARCILLA -- NANOCOMPOSITOS A TRAVÃ‰Ã‰SS DE POLIMERIZACIÃ“Ã“NN VÃÃAA RADICAL POR TRANSFERENCIA ATÃ“Ã“MMICA ((ATRP))','En el presente trabajo de investigaciÃ³n se sintetiza polimetacrilato de metilo (PMMA) arcilla nanocomposito