nte la primera iteraciÃ³n.','2010-05-06','Estrategia de Aprendizaje, WebQuest, Aprendizaje Colaborativo, IMS Learning Design, DiseÃ±o de Aprendizaje, Unidad de Aprendizaje, Moodle, Sistema de GestiÃ³n de Cursos, curso web, entorno virtual de aprendizaje, plataforma virtual educativa, proceso de E',2,1,1,1,1,'2013-09-17 08:31:08','2013-09-17 08:31:08','Documento_349.pdf','application/pdf',5094367,'2013-09-17 08:31:08',20,0,99,'COMPLETO'),(349,'MorfologÃ­a del gÃ©nero AbutilonMill. (Malvaceae) en Venezuela','La palinologÃ­a es la ciencia que estudia el polen y las esporas. La morfologÃ­a del polen posee alto valor diagnÃ³stico por ser un caracter reproductivo y porque sus paredes tienen una composiciÃ³n quÃ­mica que le permiten conservarse por miles de aÃ±os. En taxonomÃ­a, la contribuciÃ³n de la palinologÃ­a se concentra en la exina, ya que Ã©sta incorpora un gran nÃºmero de caracteres diagnÃ³sticos fÃ¡cilmente estudiables, y tambiÃ©n porque los estudios de polen fÃ³sil estÃ¡n hechos con base en el esqueleto de la exina. Para Venezuela los trabajos en morfologÃ­a del polen son numerosos; sin embargo, no se encontraron para la familia Malvaceae Juss. En el presente trabajo se estudiÃ³ la morfologÃ­a del polen del gÃ©nero AbutilonMill. como una contribuciÃ³n a la taxonomÃ­a del grupo. Este gÃ©nero pertenece a la tribu Malveae, familia Malvaceae, con 11 especies en Venezuela, de las cuales A.. burandtiiy A.. cuspidatum son endÃ©micas. Se analizaron 10 muestras de polen provenientes de material de herbario, incluyendo A.. divaricatum (excluida del Nuevo CatÃ¡logo de la Flora de Venezuela) A.. striatum (especie cultivada, pero reportada en la Flora de Ãvila como naturalizada) y Pseudabutilon umbellatum (muy cercana al gÃ©nero). Se midieron, al MO, 30 granos acetolizados por especie (en vista polar y ecuatorial) en la exina, aberturas y espinas; al MEB se detallÃ³ la ornamentaciÃ³n de la exina y las aberturas. Los datos obtenidos se analizaron para evaluar si habÃ­a difer