te de asfaltenos en crudos. Para esto, se empleÃ³ la espectroscopia de infrarrojo empleando mÃ©todos cuantitativos de anÃ¡lisis mediante integraciones en los espectros de IR de las seÃ±ales mÃ¡s resaltantes, como bandas representativas de compuestos aromÃ¡ticos, alifÃ¡ticos, carbonÃ­licos y sulfÃ³xidos. Resultando de la informaciÃ³n espectroscÃ³pica diferencias de aromaticidad en algunas fracciones y un mayor contenido de compuestos carbonÃ­licos y sulfÃ³xidos en las fracciones mÃ¡s polares de las resinas, separadas por adsorciÃ³n en silica gel. AdemÃ¡s se encontrÃ³ que las resinas II y los crudos estables presentaron el mayor porcentaje de carbonilos, por lo que se presume que estos grupos funcionales son los responsables de fuertes interacciones con grupos bÃ¡sicos de los asfaltenos, inhibiendo entonces su agregaciÃ³n.','2010-05-03','CRUDO, FRACCIONAMIENTO, RESINAS, CARACTERIZACIÃ“N MOLECULAR',6,1,1,1,1,'2013-09-17 08:31:13','2013-09-17 08:31:13','Documento_351.pdf','application/pdf',31404752,'2013-09-17 08:31:13',18,0,126,'COMPLETO'),(351,'estudio de la cinÃ©tica de agregaciÃ³n de asfaltenos furrial y carabobo a partir de la medida de dispersiÃ³n dinÃ¡mica de luz en funciÃ³n del tiempo','Los asfaltenos presentan impactos negativos en varias de las estapas de producciÃ³n en la industria petrolera. Muchos de los problemas estÃ¡n relacionados al caracterÃ­stico estado coloidal en que se encuentran los asfaltenos en el crudo y su fuerte tendencia a la agregaciÃ³n y floculaciÃ³n. A partir de estudios cinÃ©ticos de agregaciÃ³n de los asfaltenos no solo se puede tener una idea del crecimiento tamaÃ±o y nÃºmero de los agregados, sino que ademÃ¡s se puede entender la dinÃ¡mica que gobierna este fenÃ³meno, bien sea del tipo de agregaciÃ³n por difusiÃ³n o del tipo de agregaciÃ³n por reacciÃ³n. El presente estÃ¡ enfocado en el estudio de la cinÃ©tica de agregaciÃ³n de asfaltenos de Furrial y de Carabobo en soluciÃ³n de tolueno/n-heptano, a partir de medidas de dispersiÃ³n dinÃ¡mica de luz con un equipo construido en el laboratorio. A travÃ©s de la tÃ©cnica utilizada, es posible obtener valores del diÃ¡metro hidrodinÃ¡mico de las partÃ­culas o agregados de los asfaltenos dispersos en una soluciÃ³n en funciÃ³n del tiempo. Se encontraron diferencias en la cinÃ©tica de agregaciÃ³n entre los dos tipos de asfaltenos. Una de ellas fue que, para los asfaltenos Carabobo, la velocidad de crecimiento de los agregados resultÃ³ independiente de la concentraciÃ³n de asfaltenos en soluciÃ³n, asÃ­ como de la relaciÃ³n tolueno/n-heptano en el intervalo estudiado. Contrariamente, los asfaltenos de Furrial resultaron mostrar una cinÃ©tica de agregaciÃ³n dependiente de las dos variables mencionadas anteriormente. Otra diferencia interesante observada fue que los diÃ¡metros de los agregados de asfaltenos de Furrial en soluciÃ³n alcanzan un valor mÃ¡ximo de 2000nm, mientras que para los asfaltenos del crudo Carabobo los diÃ¡metros mÃ¡ximos llegan hasta 6000nm. Esta diferencia estÃ¡ relacionada con las caracterÃ­sticas de los agregados formados y dispersos en soluciÃ³n, asÃ­ como las diferencias en densidad de masa de los agregados de asfaltenos provenientes de crudos con diferencias en estabilidad operacional.','2010-05-06','asfaltenos dispersiÃ³n cinÃ©tica agregaciÃ³n',6,1,1,1,1,'2013-09-17 08:31:15','2013-09-17 08:31:15','Documento_352.pdf','application/pdf',3172285,'2013-09-17 08:31:15',20,0,116,'COMPLETO'),(352,'Prototipo de un proceso para la extracciÃ³n, transformaciÃ³n y visualizaciÃ³n de Ã­ndices acadÃ©micos de la base de datos CONEST.','ImplantaciÃ³n de un proceso automatizado para la extracciÃ³n, transformaciÃ³n y visualizaciÃ³n de Ã­ndices acadÃ©micos que apoyen la gestiÃ³n de la comisiÃ³n curricular de la Escuela de ComputaciÃ³n','2010-05-06','Desarrollo RÃ¡pido de Aplicaciones, Ãndice AcadÃ©mico, ComisiÃ³n Curricular, VisualizaciÃ³n de datos, MVC, Ruby On Rails, Escuela de ComputaciÃ³n, UCV, RAD',2,1,1,1,1,'2013-09-17 08:31:16','2013-09-17 08: