emÃ¡s de realizar pruebas preliminares para estandarizar la taxonomÃ­a molecular de T.. decipiens. MÃ©Ã©todos: Se estimaron las variables fisicoquÃ­micas del lago, la biomasa del fitoplancton, y se colectaron organismos zooplanctÃ³nicos, para posteriores ensayos para la caracterizaciÃ³n molecular de T.. decipiens. Se amplificÃ³ la regiÃ³n del espaciador interno transcrito ITS2 del ADN ribosomal de los individuos T.. decipiens por medio de ensayos de PCR y se analizÃ³ por secuenciaciÃ³n. Resultados:: Las variables fisicoquÃ­micas presentaron variaciones marcadas en todo el periodo de estudio asÃ­ como tambiÃ©n la biomasa de fitoplancton. La mayor abundancia zooplanctÃ³nica se presentÃ³ en los estratos superficiales, en los cuales los copÃ©podos y los rotÃ­feros fueron los grupos mÃ¡s abundantes. Se logrÃ³ un aislamiento eficiente del ADN genÃ³mico de individuos T.. decipiens recolectados del lago y se amplificÃ³ la regiÃ³n del ITS2. ConclusiÃ³Ã³nn: Las tÃ©cnicas moleculares ofrecen herramientas muy Ãºtiles en los estudios de la sistemÃ¡tica de copÃ©podos. Estos estudios moleculares no han sido realizados en Venezuela, por lo que nuestros resultados podrÃ¡n ser aplicados en el futuro cercano para el anÃ¡lisis taxonÃ³mico del zooplancton presente en nuestros cuerpos de agua.','2010-05-06','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:31:21','2013-09-17 08:31:21','Documento_356.pdf','application/pdf',4042762,'2013-09-17 08:31:21',19,0,94,'COMPLETO'),(356,'IdentificaciÃ³n de genes de virulencia de Helicobacter pylori en pacientes con lesiones gÃ¡stricas precancerosas.','Helicobacter pylori es una bacteria Gram negativa, de gran variabilidad genÃ©tica y de alta prevalencia en Venezuela y el mundo, que coloniza la capa de moco de las cÃ©lulas del epitelio estomacal, desencadenando una respuesta inflamatoria local de intensidad y extensiÃ³n variables asociada con el desarrollo de diversas enfermedades gÃ¡stricas severas como lo son gastritis crÃ³nica, Ãºlcera pÃ©ptica y cÃ¡ncer gÃ¡strico. La isla de patogenicidad cag, las variantes alÃ©licas del gen vacA (s11//s22 y m11//m22) y el gen babA son factores de virulencia asociados al desarrollo de estas patologÃ­as. Sus productos de expresiÃ³n son transportados hasta al interior de las cÃ©lulas epiteliales causando alteraciones importantes en su estructura y funciÃ³n. El objetivo de este trabajo fue identificar genes de Helicobacter pylori asociados a virulencia y ademÃ¡s evaluar algunos parÃ¡metros inmunolÃ³gicos en pacientes con lesiones precancerosas del Hospital Universitario de Caracas. A partir de las biopsias gÃ¡stricas y del cultivo de H..pylori se realizÃ³ la extracciÃ³n de ADN y posteriormente con una PCR multiplex, se amplificaron los genes de virulencia vacAm11//m22 (567/642 pb), vacAs11//s22 (259/286 pb). Con una PCR sencilla se amplificaron los genes ureC(294 pb), cagA33Â´Â´ (642 pb) y babA (832 pb). AdemÃ¡s se determinaron anticuerpos especÃ­ficos IgG anti H.. pylori en suero y anticuerpos secretores IgA en saliva, mediante inmunoensayo de ELISA, en pacientes que asistieron a consulta de gastroenterologÃ­a del Hospital Universitario de Caracas. De la poblaciÃ³n estudiada, un 72% fue positiva para H.. pylori. La combinaciÃ³n alÃ©lica del gen vacA mÃ¡s frecuente fue, vacA m11//s11 con un 25%. Los resultados obtenidos sugieren una baja frecuencia del gen babA..El 9% de la poblaciÃ³n fue cagA positivo, no encontrÃ¡ndose diferencias significativas con las lesiones precancerosas halladas. El porcentaje de coinfecciÃ³n en esta investigaciÃ³n oscilÃ³ entre el 4% y el 9% en cepas vacAm11//m22 y vacAs1/s2, respectivamente. La presencia de H.. pylori fue detectada en 30% (13/43) de las lesiones negativas para malignidad, 40% (17/43) de las lesiones indefinidas para displasia, mientras que en ningÃºn caso de displasia de bajo grado se observÃ³ la presencia de la bacteria. En cuanto a la respuesta inmune observada se obtuvo un 70% (40/57) de positividad al determinar anticuerpos IgA secretores en muestras de saliva, ademÃ¡s fue estandarizada una ELISA casera para la determinaciÃ³n de anticuerpos IgG sÃ©ricos anti H.. pylori.','2010-04-30','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',1,1,1,1,1,'2013-09-17 08:31:23','2013-09-17 08:31:23','Documento_357.pdf','application/pdf',4073365,'2013-09-17 08:31:23',18,0,106,'COMPLETO'),(357,'DiseÃ±Ã±oo y evaluaciÃ³Ã³nn dosimÃ©Ã©trica de un maniquÃ­Ã­ para tratamiento de mama con braquiterapia intersticial ((HDR)),','DISEÃ‘Ã‘OO Y EVALUACIÃ“Ã“NN DOSIMÃ‰Ã‰TTRICA DE UN MANIQUÃÃ PARA TRATAMIENTO DE MAMA CON BRAQUITERAPIA INTERSTICIAL ((HDR))La braquiterapia de alta tasa de dosis (HDR), mejora significativamente la distribuciÃ³n de dosis de radiaciÃ³n, mediante el control de la posiciÃ³n de la fuente y la variaciÃ³n del tiempo de permanencia en cada posiciÃ³n durante el tratamiento.El objetivo general de este trabajo consiste en evaluar dosimÃ©tricamente un maniquÃ­ para tratamiento de mama con braquiterapia intersticial (HDR). Es por ello que se plantea comparar las distribuciones dosimÃ©tricas relativas para una fuente puntual, un arreglo lineal de fuentes y cinco arreglos lineales de fuentes en un plano, para un maniquÃ­ de polimetilmetacrilato (PMMA), el cual cumple con las caracterÃ­sticas necesarias para ser considerado como sustituto del tejido mamario. Aplicando los parÃ¡metros y funciones establecidas por el protocolo de la AAPM TG - 43 para cÃ¡lculos teÃ³ricos y el uso del sistema de planificaciÃ³n Brachy Vision para la optimizaciÃ³n de los planes, ademÃ¡s, se describen los mÃ©todos utilizados para la verificaciÃ³n de las distribuciones de dosis; que incluye dosimetrÃ­a relativa con el arreglo de cÃ¡maras de ionizaciÃ³n (PTW 2D - Array seven29) y el estudio del Ã­ndice gamma para la comparaciÃ³n de las distribuciones de dosis entre los datos proporcionados por el sistema de planificaciÃ³n y las medidas realizadas. Las evaluaciones realizadas mediante los distintos mÃ©todos empleados en la comparaciÃ³n de las distribuciones de dosis relativas para distancias radiales inferiores a 7.17cm, permitieron mantener las incertidumbres por debajo de 5% respecto a la variaciÃ³n de la dosis, lo cual garantiza una correcta implementaciÃ³n de los aspectos dosimÃ©tricos para una tÃ©cnica tan compleja como lo es la braquiterapia generando una buena distribuciÃ³n de dosis uniforme. De hecho estas diferencias estÃ¡n en el rango de tolerancia de acuerdo a las incertidumbres planteadas por los organismos internacionales. AdemÃ¡s, se compararon los mapas de fluencias obtenidos por el sistema de planificaciÃ³n y las medidas experimentales mediante el criterio gamma estableciendo lÃ­mites de tolerancias de (4%, 4mm) en el plano de detecciÃ³n (frontal) para la dosis y la distancia fÃ­sica respectivamente, los resultados obtenidos son satisfactorios, cumpliÃ©ndose una buena correspondencia entre lo medido y planificado.Las diferencias dosimÃ©tricas relativas presentadas en este trabajo ratifican los resultados de los estudios realizados, garantizando la correcta implementaciÃ³n de los aspectos dosimÃ©tricos de la braquiterapia intersticial de mama, trayendo como consecuencia directa el beneficio del paciente.','2010-04-07','{}',3,1,1,1,1,'2013-09-17 08:31:24','2013-09-17 08:31:24','Documento_358.pdf','application/pdf',0,'2013-09-17 08:31:24',20,0,0,'INCOMPLETO'),(358,'ESTUDIO DEL EFECTO DE LA ACTIVIDAD DE LAS PROTEASAS ((CATEPSINAS B,, D Y L)) EN LOS CAMBIOS FÃÃSSICOS Y QUÃÃMMICOS DEL MÃšÃšSSCULO DE BAGRE SIERRA ((Oxydoras sifontesi)) EN DIFERENTES ESTADIOS DE MADUREZ SEXUAL..','Oxydoras sifontesi,,conocido como Bagre Sierra, representa un grupo de peces neotropicales, de aguas dulces continentales. Su nombre se deriva de la presencia de una serie de placas Ã³seas laterales con espinas centrales curvadas y dirigidas hacia atrÃ¡s, a manera de sierra, que pueden o no cubrir todo el cuerpo. Son de constituciÃ³n robusta y poseen fuertes espinas en la aleta dorsal y pectoral que utilizan como medida de defensa; puede llegar a alcanzar los 120 cm de longitud y 20 Kg de peso. Se caracterizan por su largo hocico cÃ³nico, cabeza estrecha y centralmente son aplanados. Es una especie endÃ©mica, la cual se puede encontrar con mayor frecuencia en la Cuenca del RÃ­o Orinoco. El presente estudio consistiÃ³ en evaluar como objetivo la influencia de la actividad de las proteasas (catepsina B, D y L) en los cambios fÃ­sicos y quÃ­micos del mÃºsculo de Bagre Sierra((Oxydoras sifontesi))en diferentes estadios de madurez sexual. A las muestras de bagre sierra se le realizaron los siguientes anÃ¡lisis: anÃ¡lisis proximal, proteÃ­nas solubles, actividad enzimÃ¡tica de las catepsinas B, D y L, determinaciÃ³n de pH. Los resultados fueron analizados en Statgraphics plus 5.1 mediante una prueba de ANOVA de una vÃ­a, con un nivel de significancia del 5%. Se concluyÃ³ que la acciÃ³n de las enzimas proteolÃ­ticas especÃ­ficamente catepsinas B, D y L ejercen influencias en el tejido muscular sobre las diferentes etapas del ciclo reproductivo en la especie estudiada.','2010-01-15','Proteasa; actividad enzimatica',1,1,1,1,1,'2013-09-17 08:31:24','2013-09-17 08:31:24','Documento_359.pdf','application/pdf',0,'2013-09-17 08:31:24',18,0,0,'INCOMPLETO'),(359,'DETERMINACIÃ“Ã“NN DE ARSÃ‰Ã‰NNICO EMPLEANDO EXTRACCIÃ“Ã“NN ACELERADA CON SOLVENTES Y DETERMINACIÃ“Ã“NN CON HG--ICP--OES','El arsÃ©nico, es un elemento metÃ¡lico altamente tÃ³xico y se encuentra ampliamente distribuido en la naturaleza (alrededor del 5 x 10-4% de la corteza terrestre), si a ello sumamos el hecho de que el hombre a travÃ©s de la industrializaciÃ³n ha incrementado su presencia en el medio ambiente, representando asÃ­ un gran riesgo para la salud humana. Ejemplo de ello, es que en una zona contaminada, el excedente del metal puede migrar a travÃ©s de las lluvias y los rÃ­os a los mares, donde la biota marina tiende con facilidad a bioacumularlo. El consumo de estos alimentos con niveles de arsÃ©nico \"altos\", puede causar en el humano enfermedades como cÃ¡ncer de pulmÃ³n, de vejiga, de riÃ±Ã³n, enfermedades cardÃ­acas, etc. Por lo tanto, el presente trabajo estuvo enfocado en la determinaciÃ³n de arsÃ©nico en productos alimenticios marinos, en especial las algas utilizadas en la preparaciÃ³n de \"sushi\" y afines. Para ello, se empleÃ³ como tÃ©cnica de tratamiento de muestra la ExtracciÃ³n Acelerada con Solventes y la medida de arsÃ©nico se realizÃ³ empleando la combinaciÃ³n de la GeneraciÃ³n de Hidruros con Plasma Inductivamente Acoplado-EspectrometrÃ­a de EmisiÃ³n Ã“ptica. En los ensayos de optimizaciÃ³n de la ExtracciÃ³n Acelerada con Solvente se logrÃ³ obtener un 92 % de recuperaciÃ³n con un DSR del 3 %. Se logrÃ³ determinar arsÃ©nico en el orden de los 0,6 mg/g. En las muestras en estudio de algas Nori, no se encontraron valores detectables de arsÃ©nico.','2010-05-03','Arsenico, Extraccion Acelerada con Solvente, Espectroscopia de emisiÃ³n optica con plasma inductivamente acoplado ICP-OES, Generacion de Hidruros, algas, sushi, porcentaje de recuperacion.',6,1,1,1,1,'2013-09-17 08:31:26','2013-09-17 08:31:26','Documento_360.pdf','application/pdf',5508867,'2013-09-17 08:31:26',18,0,156,'COMPLETO'),(360,' Efectos TopolÃ³gicos y CuantizaciÃ³n en Corrientes de EspÃ­n','En este trabajo se realiza el desarrollo y anÃ¡lisis de un filtro de espÃ­n en dos dimensiones, basado en el interferÃ³metro Mach-Zehnder, tanto para estados de entrada puros como para estados mezclados, en presencia de un campo magnÃ©tico externo e interacciÃ³n espÃ­n-Ã³rbita Rashba y Dresselhaus. Este tipo de interacciÃ³n espÃ­n-Ã³rbita es producida en materiales semiconductores que no poseen simetrÃ­a de inversiÃ³n. Para este caso la interacciÃ³n espÃ­n-Ã³rbita se representa como una teorÃ­a de calibre SU(2)XU(1), obteniendo asÃ­ una formulaciÃ³n no Abeliana del campo de calibre, tipo campo de Yang-Mills. Se analizaron las condiciones necesarias para obtener un filtro de espÃ­n asÃ­ como los invariantes topolÃ³gicos.','2010-05-06','Normal 0 false false false EN-US X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',3,1,1,1,1,'2013-09-17 08:31:26','2013-09-17 08:31:26','Documento_361.pdf','application/pdf',0,'2013-09-17 08:31:26',20,0,0,'INCOMPLETO'),(361,'FRACCIONAMIENTO DEL FÃ“Ã“SSFORO Y ACTIVIDADES ENZIMÃÃTTICAS EN COPROLITOS DE LOMBRICES DE TIERRA EN SABANAS DEL ORINOCO VENEZOLANO','El fraccionamiento del fÃ³sforo ha sido ampliamente estudiado en diferentes tipos de suelos en Venezuela y el mundo, Sin embargo es poco lo que se ha investigado respecto a las formas de fÃ³sforo presentes en los coprolitos que producen las lombrices de tierra que habitan las sabanas venezolanas. Bajo la premisa el siguiente trabajo fue desarrollado con la intenciÃ³n de conocer la influencia de la lombriz de tierra en el cambio de las fracciones de fÃ³sforo disponible en suelos de sabana de Trachypogon ubicados en los estados Amazonas y GuÃ¡rico. Los suelos fueron recolectados a profundidades de 0-10, 10-20 y 20-30cm en tres calicatas realizadas a lo largo de una transecta, escogida al azar. Los coprolitos frescos y viejos fueron recolectados manualmente en parcelas cercanas a las calicatas primero los viejos al limpiar cada Ã¡rea y luego los frescos. Posterior al tratamiento de muestras respectivo: secado, pulverizado y tamizado, se procediÃ³ a realizar un estudio de laboratorio y uno de campo previo que incluyo: anÃ¡lisis fÃ­sicos del suelo (temperatura, humedad, densidad aparente y textura), anÃ¡lisis quÃ­micos de suelos y coprolitos (pH, fÃ³sforo total, fÃ³sforo orgÃ¡nico, inorgÃ¡nico y microbiano) y anÃ¡lisis bioquÃ­micos de suelos y coprolitos (actividades ureÃ¡sicas y fosfatÃ¡sicas). Los resultados demostraron los efectos de la actividad alimentaria de las lombrices al incrementarse las fracciones de fÃ³sforo inorgÃ¡nico lÃ¡bil y las de fÃ³sforo orgÃ¡nico fÃ¡cilmente mineralizable. La actividad enzimÃ¡tica fosfatÃ¡sica arrojÃ³ como resultado una notable influencia en la mineralizaciÃ³n del fÃ³sforo al verse aumentada en los coprolitos siendo mÃ¡s notorio su efecto en el Ã¡rea protegida de Calabozo. La actividad ureÃ¡sica mostrÃ³ su posible participaciÃ³n en la fijaciÃ³n biolÃ³gica del nitrÃ³geno, al verse incrementada especialmente en la EstaciÃ³n BiolÃ³gica. Lo cual fue consistente con los reportes de N total en esa misma zona. El fÃ³sforo microbiano por su lado presentÃ³ valores exageradamente altos no esperados para el caso de Amazonas, no obstante estos datos podrÃ­an confirmar la hipÃ³tesis planteada por otros autores donde se relacionan la disponibilidad del fÃ³sforo y el contenido del mismo en los microorganismos, sin embargo no se descarta la posibilidad de errores metodolÃ³gicos.','2010-05-07','coprolitos, lombrices de tierra, sabanas, Orinoco, fraccionamiento, fÃ³sforo',6,1,1,1,1,'2013-09-17 08:31:27','2013-09-17 08:31:27','Documento_362.pdf','application/pdf',1863015,'2013-09-17 08:31:27',16,0,81,'COMPLETO'),(362,'ESTUDIO INICIAL DE GESTIÃ“Ã“NN DE RIESGOS DE LA FACULTAD DE CIENCIAS,, COMO ESTRATEGIA PARA REDUCIR LA VULNERABILIDAD DE Ã‰Ã‰SSTA A DESASTRES SOCIO--NATURALES','Establecer pautas para gestionar los diferentes tipos de riesgos de una comunidad requiere un trabajo de investigaciÃ³n y evaluaciÃ³n de gran importancia y relevancia, debido a la magnitud del impacto a largo plazo que esto puede representar para la comunidad de estudio. Actualmente la Facultad de Ciencias de la Universidad Central de Venezuela ha iniciado una serie de investigaciones y trabajos que nos permitirÃ¡n paulatinamente adecuarnos a la normativa legal correspondiente y acercarnos a los estÃ¡ndares internacionales relacionados con gestiÃ³n de riesgos. Se sabe que Ã©ste recinto universitario presenta un elevado nivel de riesgo debido a los materiales peligrosos que en el se encuentran; existen diversas escuelas e institutos que trabajan con ellas y estÃ¡n en pro de las condiciones mÃ­nimas necesarias de seguridad, lo que se plantea en Ã©ste escrito. Como cientÃ­ficos debemos preocuparnos por el impacto que pueden ocasionar nuestras labores de docencia e investigaciÃ³n y luchar por minimizar dicho impacto, como por ejemplo desarrollar y trabajar en una ciencia \"limpia\" aplicable al medio ambiente, fomentando el trabajo seguro dentro de un ambiente potencialmente peligroso como en el que trabajamos para evitar que ocurran accidentes lamentables para nosotros y el entorno. A lo largo de Ã©sta investigaciÃ³n se evaluaron las condiciones de riesgo de la Facultad, dando prioridad a los riesgos de mayor relevancia como: el riesgo quÃ­mico, escapes de gas, derrames de sustancias peligrosas, el descontrol de agentes biolÃ³gicos, sismos, incendios y explosiones, debido al posible impacto que puede ocasionar un accidente de Ã©stas Ã­ndoles. En el presente trabajo de investigaciÃ³n se presentan pautas de gestiÃ³n de riesgo, reportando opciones que permitan reducir la vulnerabilidad de la Facultad de Ciencias a desastres socio-naturales, asÃ­ mismo se desarrollÃ³ un plan de respuesta en caso de emergencias que nos permitirÃ¡ tener una clara idea de que hacer ante una situaciÃ³n adversa, se plantea una polÃ­tica de prevenciÃ³n de riesgos, se presenta una propuesta de reglamento interno de seguridad y salud laboral donde se trazan condiciones mÃ­nimas de seguridad para el buen desempeÃ±o del personal dentro de