s y temas de la TeorÃ­a de Sistema DinÃ¡mico. Se demostrÃ³ que la ecuaciÃ³n de Van der Pol posee soluciÃ³n periÃ³dica, por lo tanto posee ciclos lÃ­mites, variando el parÃ¡metro que pertenece a la ecuaciÃ³n. AdemÃ¡s Ã©sta soluciÃ³n es orbitalmente asintÃ³ticamente estable, asÃ­ como tambiÃ©n encontramos que dicha soluciÃ³n puede ser expandida por una serie de potencia convergente. Estas soluciones fueron halladas por el Teorema de Bedixson, el Teorema de LiÃ©nard y el MÃ©todo de PoincarÃ©-Lindstedt, respectivamente. Finalmente, se hizo una representaciÃ³n grÃ¡fica de la ecuaciÃ³n mediante el programa Matlab.','2010-04-28','EcuaciÃƒÂ³n de Van der Pol, Sistema DinÃƒÂ¡mico, Teorema de Bendixson, Teorema de LiÃƒÂ©nard, MÃƒÂ©todo PoincarÃƒÂ©-Linsdtedt.',5,1,1,1,1,'2013-09-17 08:31:30','2013-09-17 08:31:30','Documento_365.pdf','application/pdf',0,'2013-09-17 08:31:30',20,0,0,'INCOMPLETO'),(365,'Estudio de los niveles de Isoleucina en orina como un biomarcador de CÃ¡ncer de PrÃ³stata','El cÃ¡ncer de prÃ³stata es una de las neoplasias comÃºnmente diagnosticadas y representa la primera causa de muerte por cÃ¡ncer en hombres. En la actualidad, investigadores han determinado los niveles de aminoÃ¡cidos como posibles biomarcadores, para evaluar si estos estÃ¡n relacionados con el desarrollo de este carcinoma. En el presente proyecto se propuso determinar y comparar las concentraciones de isoleucina (ILE), aminoÃ¡cido primario, en orina de ayuna de pacientes con y sin cÃ¡ncer de prÃ³stata. Las muestras de orina de pacientes que se realizan biopsia prostÃ¡tica son suministradas por el Hospital Universitario de Caracas de la Universidad Central de Venezuela. Como grupo control o sujetos sanos se toman muestras de individuos voluntarios con valores de PSA menores a 4 ng/mL. Se analizaron (32) muestras de individuos mayores de 40 aÃ±os, divididas en grupos: con cÃ¡ncer de prÃ³stata (8), de individuos que deben realizarse nueva biopsia en un perÃ­odo de seis meses (4), sin cÃ¡ncer (1