subterrÃ¡neas evolucione como un proceso de Ito.','2009-12-03','EcuaciÃ³n Hamilton-Jacobi-Bellman, Principio del MÃ¡ximo de Pontryagin, ProgramaciÃ³n DinÃ¡mica, Principio de Optimalidad de Bellman, FunciÃ³n Valor, Proceso de Wiener, Lema de Ito, AcuÃ­feros, GestiÃ³n de AcuÃ­feros.',5,1,1,1,1,'2013-09-17 08:31:35','2013-09-17 08:31:35','Documento_370.pdf','application/pdf',4231266,'2013-09-17 08:31:35',20,0,84,'COMPLETO'),(370,'VÃ­nculo entre las ecuaciones diferenciales ordinarias y las ecuaciones diferenciales estocÃ¡sticas.','Desde que en el siglo XVII Newton y Leibniz pusieron las bases de lo que ahora llamamos\"Calculo Diferencial\", las ecuaciones diferenciales ordinarias han sido una herramienta matemÃ¡ticafundamental para modelar sistemas fÃ­sicos. Las leyes fÃ­sicas que gobiernan un sistemadeterminan las ecuaciones correspondientes, que despuÃ©s intentamos resolver, es decir,de las cuales intentamos obtener una expresiÃ³n del estado del sistema en el instante detiempo t como funciÃ³n explÃ­cita de t. Entre algunos de los innumerables ejemplos de fenÃ³menosque pueden ser modelados por ecuaciones diferenciales ordinarias se encuentran: lainteracciÃ³n de planetas, flujos de fluidos, reacciones quÃ­micas, dinÃ¡micas poblacionales yeconÃ³micas. Pero estas ecuaciones diferenciales ordinarias solo modelan fenÃ³menos en unsistema ideal es decir sin perturbaciones, pero en una gran cantidad de casos existen fenÃ³menosaleatorios que nos alteran el sistema con lo que debemos introducir un termino anuestra ecuaciÃ³n diferencial llamado ruido; esta ecuaciÃ³n diferencial es llamada estocÃ¡stica.En los Ãºltimos aÃ±os el estudio de estas ecuaciones diferenciales estocÃ¡sticas ha tenidouna creciente e importante atenciÃ³n, en mecÃ¡nica y en muchas otras Ã¡reas de la fÃ­sica teÃ³ricaasÃ­ como de la biologÃ­a experimental y tambiÃ©n en el estudio de finanzas.Para nuestro estudio consideramos una ecuaciÃ³n diferencial ordinaria de la siguienteforma:dXt = a(t, Xt)dt, X(0) = x0.a la cual le introducimos una condiciÃ³n inicial aleatoria y un termino de ruido aleatorio adicional:dXt = a (t, Xt)dt + b(t, Xt)dBt, X0(w) = Y(w), (1)La soluciÃ³n de esta ecuaciÃ³n, si esta existe, es un proceso estocÃ¡stico.Muchos autores han investigado sobre las ecuaciones diferenciales del tipo (1) y, la existencia y unicidad de lassoluciones de estas ecuaciones se ha demostrado en cada uno de estos estudios y se basaen la utilizaciÃ³n de la ecuaciÃ³n integral estocÃ¡stica asociada. Tanto lascondiciones para obtener la existencia y la unicidad de la soluciÃ³n de este tipo de ecuacionesdiferenciales estocÃ¡sticas asÃ­ como la demostraciÃ³n se basan en las implementadas enlas ecuaciones diferenciales ordinarias. Nuestro interes es desarrollar e implementar estas ecuaciones.','2010-01-28','ecuaciones diferenciales ordinarias; ecuaciones diferenciales estocÃ¡sticas; movimiento Browniano; proceso estocÃ¡stico; integral estocÃ¡stica ItÃ´; condiciÃ³n de Lipshitz; Existencia y unicidad de la solucion de las ecuaciones diferenciales de primer ord',5,1,1,1,1,'2013-09-17 08:31:36','2013-09-17 08:31:36','Documento_371.pdf','application/pdf',1437296,'2013-09-17 08:31:36',20,0,99,'COMPLETO'),(371,'Perturbaciones de los Solitones Ã“pticos de la EcuaciÃ³n No-Lineal de SchrÃ¶dinger','El presente trabajo realiza un estudio tanto analÃ­tico como numÃ©rico de las principales perturbaciones de los solitones temporales-brillantes con orden N = 1 de la EcuaciÃ³n No-Lineal de SchrÃ¶dinger (ENLS), aplicada al campo de la Ã³ptica no-lineal y escrita en forma escalar, continua y en 1 + 1 dimensiones. Mediante el formalismo Lagrangiano clÃ¡sico se desarrolla un anÃ¡lisis variacional que, junto al teorema de los procesos adiabÃ¡ticos, resulta en la dinÃ¡mica de las coordenadas colectivas del solitÃ³n fundamental perturbado, quedando Ã©stas escritas en funciÃ³n de los modelos matemÃ¡ticos de cada perturbaciÃ³n tratada, i.e. disipaciÃ³n energÃ©tica, auto-escarpado (\"self- steepening\") y dispersiÃ³n intra-pulso de Raman (\"intra-pulse Raman scattering\"). Finalmente, el anÃ¡lisis numÃ©rico por el mÃ©todo Split-Step de Fourier Simetrizado es empleado para confirmar las predicciones analÃ­ticas de la dinÃ¡mica adiabÃ¡tica ante cada perturbaciÃ³n individual, mediante la integraciÃ³n directa de la ENLS modificada correspondiente y la comparaciÃ³n de las caracterÃ­sticas de la soluciÃ³n numÃ©rica resultante vs. la analÃ­tica respectiva.','2009-12-16','solitÃƒÂ³n, solitones ÃƒÂ³pticos, ecuaciÃƒÂ³n no lineal de SchrÃƒÂ¶dinger, ÃƒÂ³ptica no lineal, perturbaciÃƒÂ³n de solitones, coordenadas colectivas, split-step de Fourier simetrizado',3,1,1,1,1,'2013-09-17 08:31:37','2013-09-17 08:31:37','Documento_372.pdf','application/pdf',0,'2013-09-17 08:31:37',20,0,0,'INCOMPLETO'),(372,'CATALIZADORES NANOESTRUCTURADOS EN BASE A NÃÃQQUEL EN EL REFORMADO DE METANO CON VAPOR:: PROBLEMAS DE TRANSFERENCIA DE CALOR','El presente trabajo se realizÃ³ con el propÃ³sito de estudiar el efecto que tienen la diluciÃ³n de lecho y el uso de estructuras metÃ¡licas con una serie de catalizadores en base a nÃ­quel, en los problemas de transferencia de calor que ocurren en la reacciÃ³n de reformado de metano con vapor de agua. Se sintetizaron tres precursores catalÃ­ticos en base a nÃ­quel, un precursor tipo hidrotalcita utilizando la metodologÃ­a de coprecipitaciÃ³n, un precursor tipo perovskita utilizando la metodologÃ­a sol-gel y un precursor nanoestructurado soportado, utilizando la preparaciÃ³n del complejo in situ. Estos sÃ³lidos fueron caracterizados mediante anÃ¡lisis quÃ­mico, difracciÃ³n de rayos X (DRX), reducciÃ³n con temperatura programada (RTP), Ã¡rea especÃ­fica (B.E.T.), anÃ¡lisis termogravimÃ©trico termodiferencial (ATG-ATD). Se realizÃ³ una estrategia de deposiciÃ³n hÃºmeda de una pelÃ­cula de material catalÃ­tico sobre una estructura rÃ­gida en varias etapas, proceso conocido como \"Washcoating\", se utilizÃ³ como estructura rÃ­gida una aleaciÃ³n de hierro FeCrAlloyÂ®, esta estructura fue analizada mediante microscopÃ­a electrÃ³nica de barrido (MEB). Las pruebas catalÃ­ticas en polvo sirvieron de referencia para evaluar el efecto sobre la transferencia de calor que tiene el uso de la diluciÃ³n de lecho, los resultado indican que la diluciÃ³n de lecho disminuye los problemas de transferencia de calor, pero hay que evaluar la formaciÃ³n de carbÃ³n. Los resultados de probar el catalizador NiAl2O4 estructurado en forma de placa indica que la trasferencia de calor disminuye en mayor proporciÃ³n que la diluciÃ³n de lecho, hay que hacer las estructuras en forma de monolitos y probarlas en reacciÃ³n, ya que esto no se logrÃ³ por completo y tambiÃ©n realizar el anÃ¡lisis de deposiciÃ³n de carbÃ³n para poder hacer una comparaciÃ³n entre ambos mÃ©todos.','2010-05-05','Washcoating, monolitos, perovskitas, hidrotalcitas, reformado de metano con vapor, slurry, complejos orgaometÃ¡licos',6,1,1,1,1,'2013-09-17 08:31:38','2013-09-17 08:31:38','Documento_373.pdf','application/pdf',1390453,'2013-09-17 08:31:38',19,0,88,'COMPLETO'),(373,'Filogenia IntraespecÃ­Ã­fica y Variabilidad GenÃ©Ã©tica en Culex quinquefasciatusSay ((Diptera:: Culicidae)) utilizando secuencias de ADN mitocondrial','Culex quinquefasciatus Say, es una especie de mosquito perteneciente a la familia Culicidae, y forma parte del complejo Pipiens de Culex. Esta especie tiene amplia distribuciÃ³n en el mundo y en Venezuelase distribuye por casi todo el territorio nacional (Sutil, 1980; Del Ventura, 2008). Esta especie es acentuadamente antropofÃ­lica y es considerado un importante vector de varios virus asÃ­ como de algunos parÃ¡sitos, los cuales son mantenidos en la naturaleza en un ciclo enzoÃ³tico ave-mosquito- ave. Su amplia distribuciÃ³n y ocupaciÃ³n de diversos hÃ¡bitats larvales de origen antropogÃ©nico podrÃ­a sugerir la presencia de subpoblaciones geogrÃ¡ficas que pudieran participar en forma diferencial en la transmisiÃ³n de patÃ³genos. AnÃ¡lisis de las secuencias de porciones del ADN mitocondrial pueden ser de utilidad para delimitar la existencia de una estructuraciÃ³n poblacional de origen geogrÃ¡fico verificado por medio de mÃ©todos filogenÃ©ticos de las secuencias (filogeografÃ­a) y verificar hipÃ³tesis de variabilidad, homogeneidad genÃ©tica y de estructuraciÃ³n filogenÃ©tica. Se realizaron anÃ¡lisis genÃ©ticos haciendo uso de los genes mitocondriales COI (Subunidad I del Citocromo oxidasa) y ND5 (Subunidad 5 de la NADH deshidrogenasa) en poblaciones de Cx.. quinquefasciatus de nueve localidades del paÃ­s (especÃ­ficamente de cementerios locales), para establecer la presencia de una estructura subpoblacional y/ o posibles linajes intraespecÃ­ficos, relacionados con Ã¡reas geogrÃ¡ficas u otro mecanismos de diferenciaciÃ³n poblacional. Los resultados obtenidos revelan niveles altos de variaciÃ³n genÃ©tica tanto para el gen COI como para ND5. Particularmente para el gen ND5 los niveles de variaciÃ³n encontrada fueron altos en contraste a secuencias de ND5 de otras poblaciones de mosquitos, como Aedes aegypti y Aedes albopictus,, mientras que el gen COI comparativamente con ND5 revelÃ³ niveles de variaciÃ³n menor dentro de Cx.. quinquefasciatus. Los anÃ¡lisis filogenÃ©ticos realizados con ambos genes sugieren que las poblaciones de Cx.. quinquefasciatus de las distintas localidades estudiadas mostraron una alta homogeneidad genÃ©tica, reflejÃ¡ndose en una ausencias de clados monofilÃ©ticos entre poblaciones de los diferentes cementerios sin divergencia entre haplotipos, lo que demuestra la presencia de una sola entidad filogenÃ©tica (monofilia) correspondiente a la especie Cx quinquefasciatus. Se demostrÃ³ que el fragmento del gen COI estudiado es mÃ¡s sensible en la definiciÃ³n de la filogenia de especies cercanas, asÃ­ como a nivel de gÃ©neros y correlacionado con la clasificaciÃ³n actual, mientras que el gen ND5 por su alta variaciÃ³n es mÃ¡s Ãºtil para estudios poblacionales.','2010-05-05','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:31:39','2013-09-17 08:31:39','Documento_374.pdf','application/pdf',2077723,'2013-09-17 08:31:39',18,0,85,'COMPLETO'),(374,'Estudio de los cambios en la tendencia de consumo de antibiÃ³Ã³tticos y su relaciÃ³Ã³nn con la resistencia bacteriana en Venezuela,, durante el periodo 22000055--22000088..','Diversas publicaciones cientÃ­ficas, basadas en la determinaciÃ³n de la susceptibilidad microbiana en aislados clÃ­nicos, han reportado que el empleo inadecuado de antibiÃ³ticos promueve la selecciÃ³n de cepas de bacterias resistentes, lo que deriva en un problema de salud pÃºblica a nivel mundial, ya que se reducen las opciones terapÃ©uticas para tratar las infecciones, se incrementan los gastos y se aumenta la mortalidad. Como una medida para contener el aumento de la resistencia bacteriana en el paÃ­s, el 2 de enero de 2006, se publica la resoluciÃ³n NÂ° 604 de la Gaceta Oficial Venezolana NÂ° 38.348, mediante la cual se regula la dispensaciÃ³n de medicamentos antimicrobianos en farmacias, servicios farmacÃ©uticos y cualquier otro establecimiento debidamente autorizado, mediante la presentaciÃ³n de la prescripciÃ³n facultativa. Los medicamentos antimicrobianos a los que se refiere dicha Gaceta, son aquellos de uso sistÃ©mico que pertenezcan a las siguientes categorÃ­as: Fluoroquinolonas, MacrÃ³lidos - Lincosamidas, Cefalosporinas de tercera generaciÃ³n y aquellos cuyo principio activo sea Rifampicina. En este trabajo se estudiaron los cambios derivados de la medida regulatoria de dispensaciÃ³n de antibiÃ³ticos sobre la tendencia de venta de antimicrobianos en Venezuela y su vÃ­nculo con la variaciÃ³n de la resistencia bacteriana durante el periodo 2005-2008. Se estimÃ³ la fracciÃ³n de la poblaciÃ³n Venezolana expuesta al grupo de antibiÃ³ticos regulados y a un grupo de antibiÃ³ticos de libre dispensaciÃ³n, a travÃ©s de la dosis diaria definida por 1000 habitantes por dÃ­a (DHD). Se realizaron anÃ¡lisis de varianzas de un factor (ANOVA) y se observaron las diferencias en el comportamiento de la tendencia de consumo, de las categorÃ­as de antibiÃ³ticos del grupo regulado y no regulado. Los resultados se compararon con los porcentajes de resistencia bacteriana total en el paÃ­s, para un periodo pre- medida regulatoria de 1 aÃ±o (2005) y para un periodo post - medida regulatoria de 3 aÃ±os (2006 a 2008). Se relacionaron los porcentajes de cepas resistentes reportadas para 7 microorganismos Gram negativos y 2 microorganismos Gram positivos, con las DHD de los antibiÃ³ticos sugeridos como indicadores de resistencia por el CSLI. Se obtuvieron los resultados para conocer la tendencia de la resistencia bacteriana entre el aÃ±o 2005 y 2008, y la tendencia del consumo de antibiÃ³ticos para el mismo periodo. Se encontrÃ³ ausencia de cambios derivados de la medida regulatoria de dispensaciÃ³n de antibiÃ³ticos tanto en el consumo de antimicrobianos como en el porcentaje de cepas bacterianas resistentes. Este resultado nos permite sugerir que la ausencia de diferencias en la venta de antimicrobianos puede deberse a la falta de informaciÃ³n referente a la medida y a la falta de seguimiento del cumplimiento de la misma. AdemÃ¡s, se deben implementar medidas complementarias a la regulaciÃ³n de la dispensaciÃ³n de algunos antibiÃ³ticos, a los fines de lograr controlar la apariciÃ³n, selecciÃ³n y dispersiÃ³n de la resistencia bacteriana a estos agentes, y continuar este tipo de estudios para monitorear el Ã©xito de estos programas Venezuela es uno de los primeros paÃ­ses latinoamericanos que ha legislado una medida regulatoria de dispensaciÃ³n de antibiÃ³ticos, por lo que el presente estudio no solo aporta informaciÃ³n relevante para el paÃ­s, sino que sirve de monitor para otros paÃ­ses que estÃ¡n persiguiendo el mismo propÃ³sito.','2010-04-30','AntibiÃ³tico, resistencia bacteriana, estudio de utilizaciÃ³n de medicamentos',1,1,1,1,1,'2013-09-17 08:31:40','2013-09-17 08:31:40','Documento_375.pdf','application/pdf',2792653,'2013-09-17 08:31:40',20,0,108,'COMPLETO'),(375,'AISLAMIENTO Y CARACTERIZACIÃ“N DEL GEN HMG-CoA REDUCTASA DE YUCA (Manihot esculenta, Crantz) EVALUANDO SU EXPRESIÃ“N MEDIANTE UNA PCR EN TIEMPO REAL','El cultivo de yuca es de suma importancia para combatir la desnutriciÃ³n en el mundo, ya que es capaz de crecer en suelos pobres y con gran sequÃ­a. Sin embargo el rÃ¡pido deterioro post-cosecha resulta en pÃ©rdidas del 90% de la siembra total, por esto se han dirigido las investigaciones en biotecnologÃ­a, al desarrollo de plantas de yuca resistentes a enfermedades e insectos.El gen HMG-CoA reductasa (3-hidroxi-3-metil-glutaril-CoA reductasa) regula la ruta metabÃ³lica del mevalonato que desencadena en la producciÃ³n de metabolitos secundarios, como las fitoalexinas, compuestos que le confieren a la planta resistencia contra microorganismos patÃ³genos y plagas. Por lo tanto se cree que el estudio de este gen y su posterior manipulaciÃ³n podrÃ­a ayudar a disminuir el deterioro post-cosecha de los cultivos de yuca.Como objetivo inicial de este trabajo se planteÃ³ el clonamiento del gen HMG-CoA reductasa, utilizando la estrategia propuesta por Sambrook (2.001), para luego secuenciar el clon completando la secuencia parcial del gen de 1.907 pb, que fue obtenida en investigaciones previas en el laboratorio de BiotecnologÃ­a AgrÃ­cola del IDEA. La publicaciÃ³n del genoma de yuca en noviembre de 2.009, permitiÃ³ identificar la secuencia del gen HMG-CoA reductasa y enfocar el trabajo a la caracterizaciÃ³n molecular de este gen en la planta de yuca.El anÃ¡lisis in sÃ­lico posibilitÃ³ la identificaciÃ³n de la secuencia del gen HMG-CoA reductasa en 2.493pb ordenados en 4 exones y 3 intrones, con una similitud de 97,7% del mismo gen en otras especies de plantas. El anÃ¡lisis de la organizaciÃ³n la secuencia facilitÃ³ el diseÃ±o de dos pares de cebadores, para la evaluaciÃ³n mediante una PCR en tiempo real de los niveles de expresiÃ³n del gen HMG-CoA reductasa en diferentes condiciones fisiolÃ³gicas. Pero no se pudo medir la expresiÃ³n debido a errores en la estandarizaciÃ³n de la PCR, luego de normalizar las condiciones de temperatura, concentraciÃ³n de cloruro de magnesio y concentraciÃ³n de ADN se realizÃ³ la PCR en tiempo real cuyos resultados preliminares se presentaron en este trabajo.','2010-04-20','gen HMG-CoA reductasa, 3-hidroxi-3-metil-glutaril-CoA reductasa, yuca, manihot, PCR en tiempo real',1,1,1,1,1,'2013-09-17 08:31:41','2013-09-17 08:31:41','Documento_376.pdf','application/pdf',2383612,'2013-09-17 08:31:41',14,0,90,'COMPLETO'),(376,'Soluciones Autosimilares para las Primeras Etapas de FormaciÃ³n Estelar','Se estudia el proceso de condensaciÃ³n de nubes de plasma a bajas temperaturas, en regiones del medio interestelar que son inicialmente tÃ©rmicamente biestables.Se utilizan las variaciones de la velocidad inicial del plasma en la frontera de la nube como forma de simular perturbaciones de diferentes magnitudes. Estas condiciones son estudiadas para el caso de 3 plasmas astrofÃ­sicos que difieren entre ellos Ãºnicamente en el mecanismo mediante el cual radÃ­an energÃ­a. Se estudia: (a) Una nube de gas frÃ­o compuesto principalmente de hidrÃ³geno molecular; (b) Un plasma totalmente ionizado y (c) Una nube de gas adiabÃ¡tico. Esto con la finalidad de estudiar mediante el mÃ©todo de bÃºsqueda de soluciones autosimilares quÃ© tipo de plasma colapsa de manera mÃ¡s eficiente.Se analiza el comportamiento del fluido al tomar en cuenta la conductividad tÃ©rmica en las ecuaciones, encontrÃ¡ndose que al incluir este efecto no es posible encontrar soluciones autosimilares, restringiÃ©ndose los casos de estudio a plasmas donde la interfase sea sostenida Ãºnicamente por los efectos radiativos, es decir que la longitud de la misma sea mayor que la Longitud de Field.A pesar de que el marco de trabajo simplificado que se propone deja de lado caracterÃ­sticas importantes para flujos reales tridimensionales, se halla que las nubes frÃ­as de hidrÃ³geno molecular son mÃ¡s propensas a sufrir una condensaciÃ³n inducida por una compresiÃ³n, y que este mecanismo debe ser el principal para la formaciÃ³n de protoestrellas.','2010-05-03','AstrofÃ­sica, MecÃ¡nica de Fluidos, Soluciones NumÃ©ricas, Ecuaciones Diferenciales No Lineales, Autosimilaridad, FormaciÃ³n Estelar',3,1,1,1,1,'2013-09-17 08:31:43','2013-09-17 08:31:43','Documento_377.pdf','application/pdf',2758481,'2013-09-17 08:31:43',19,0,183,'COMPLETO'),(377,'\"\"Estudio de capacidad alergÃ©Ã©nica de las proteÃ­Ã­nas del polen de capim melao ((Melinis minutiflora))en individuos venezolanos con enfermedades alÃ©Ã©rgicas\"\"','La alergia al polen es el prototipo de enfermedad alÃ©rgica a nivel de la poblaciÃ³n mundial. Cuando Ã©ste entra en contacto con la nariz, el ojo o la mucosa gastrointestinal, libera proteÃ­nas que se difunden a travÃ©s del medio acuoso de las mucosas. Las personas alÃ©rgicas a Ã©stas, presentan hipersensibilidad con incremento en la producciÃ³n de anticuerpos IgE, asÃ­ como la secreciÃ³n de citocinas por los linfocitos del fenotipo Th2. En Venezuela se ha establecido una relaciÃ³n entre los perÃ­odos de floraciÃ³n de las gramÃ­neas y la incidencia de crisis de rinitis y asma, se ha sugerido que el polen de capim melao (Melinis minutiflora.) podrÃ­a ser un contaminante biolÃ³gico del aire con posible implicaciÃ³n en la etiologÃ­a de alergia respiratoria (Pinto, 1972). Los extractos procesados de polen de capim melao fueron analizados por la tÃ©cnica de electroforesis en geles de poliacrilamida para separar las proteÃ­nas las cuales fueron transferidas a membranas de nitrocelulosa. Posteriormente se confrontaron con sueros de pacientes clasificados de acuerdo a sus niveles de IgE total mediante la tÃ©cnica denominada western Blot. Se identificaron varias bandas entre 150 a 7 kDa y se reconocieron proteÃ­nas de 65, 44 y 33 kDa de masa molecular. Este trabajo nos permitiÃ³, por primera vez en nuestro paÃ­s, identificar proteÃ­nas asociadas a la respuesta de tipo IgE especÃ­fica contra el polen del capim melao (Melinis minutiflora.), determinar la existencia de reacciÃ³n cruzada entre los pÃ³lenes de capim melao y el polen de la mezcla comercial gramÃ­neas IV, asÃ­ como una correspondencia entre los niveles de IgE total y los niveles de IgE especifica de pacientes alÃ©rgicos que posiblemente podrÃ­an estar sensibilizados a esta gramÃ­nea.','2010-05-03','Alergia, Polen, Capim Melao (Melinis minutiflora.)',1,1,1,1,1,'2013-09-17 08:31:44','2013-09-17 08:31:44','Documento_378.pdf','application/pdf',809747,'2013-09-17 08:31:44',14,0,76,'COMPLETO'),(378,'EVALUACIÃ“Ã“NN CATALÃÃTTICA DE ZSM--55,, Al--MCM--4411 Y SISTEMA COMBINADO ZSM--55--Al--MCM--4411 MEDIANTE REACCIONES DE CATÃÃLLISIS ÃÃCCIDA','En el presente trabajo se sintetizaron la zeolita ZSM-5, el tamiz molecular mesoporoso Al-MCM-41 y un material combinado ZSM-5-Al-MCM-41. Estos tres sÃ³lidos fueron comparados con una mezcla mecÃ¡nica (ZSM-5//Al-MCM-41) preparada mezclando cantidades iguales de zeolita y mesoporoso. Los cuatro materiales fueron caracterizados por fisisorciÃ³n de nitrÃ³geno, difracciÃ³n de rayos X y microscopÃ­a electrÃ³nica de barrido en conjunto con energÃ­a dispersiva de rayos X para el anÃ¡lisis quÃ­mico. La evaluaciÃ³n catalÃ­tica fue realizada utilizando reacciones modelo basadas en la transformaciÃ³n de aromÃ¡ticos, alcanos y olefinas, especÃ­ficamente la transformaciÃ³n de m-xileno, n-hexano, 3- metilpentano y 1-buteno. La caracterizaciÃ³n de los sÃ³lidos mostrÃ³ que se obtuvieron las fases de ZSM-5 y de Al-MCM-41 con las propiedades esperadas. En cuanto al material combinado, presentÃ³ caracterÃ­sticas particulares que indicaron su naturaleza micro y mesoporosa. La transformaciÃ³n de m-xileno se realizÃ³ a 370 ÂºC bajo condiciones que permitieran comparar el comportamiento del material combinado con las fases puras en condiciones favorables a la reactividad de la fase correspondiente denominadas \"condiciones de zeolita\" (velocidad espacial VEHP de 40 h-1 y relaciÃ³n NitrÃ³geno/m-xileno de 4) y \"condiciones de mesoporoso\" (velocidad espacial VEHP de 8 h-1 y relaciÃ³n NitrÃ³geno/m-xileno de 1,5). A la mayor velocidad espacial y mezcla de alimentaciÃ³n mÃ¡s diluida, sÃ³lo la zeolita y la mezcla mecÃ¡nica mostraron actividad. La disminuciÃ³n de la velocidad espacial y uso de alimentaciÃ³n mÃ¡s concentrada (condiciones mÃ¡s severas), permitiÃ³ obtener conversiones del orden del 3 % para el material combinado y el mesoporoso, mientras que para la zeolita y la mezcla mecÃ¡nica se obtuvo un aumento notable en la conversiÃ³n y una menor relaciÃ³n p-xileno/o-xileno en comparaciÃ³n a las \"condiciones de zeolita\". Para los sÃ³lidos Al-MCM-41 y ZSM-5-Al-MCM-41, la relaciÃ³n p-xileno/o-xileno se fijÃ³ como 1, debido a la ausencia de limitaciones difusionales de estos isÃ³meros dado el tamaÃ±o de poro de los materiales. A partir de la transformaciÃ³n de n-hexano y de 3-metilpentano a 500 ÂºC, se determinÃ³ el Ã­ndice de restricciÃ³n de los cuatro sÃ³lidos. La zeolita ZSM-5 y la mezcla mecÃ¡nica presentaron valores mayores a 1, mientras que para el Al-MCM-41 y el material combinado se obtuvieron valores menores o iguales a 1, indicando diferentes caracterÃ­sticas estructurales de los sÃ³lidos evaluados. La transformaciÃ³n de 1-buteno fue realizada a 470 ÂºC, obteniÃ©ndose el siguiente orden de conversiÃ³n total del hidrocarburo: ZSM-5 > ZSM-5//Al-MCM-41 ~= ZSM-5-Al-MCM-41 >> Al-MCM-41 y el siguiente orden de selectividad hacia la formaciÃ³n de isobuteno: Al-MCM-41 > ZSM-5//Al-MCM-41 > ZSM-5-Al-MCM-41 > ZSM-5. Los sÃ³lidos mÃ¡s activos fueron mÃ¡s selectivos hacia la formaciÃ³n de productos de craqueo, indicando una acidez mÃ¡s fuerte. Se evaluÃ³ la estabilidad catalÃ­tica de los sÃ³lidos Al-MCM-41 y ZSM-5-Al-MCM-41, realizando pruebas de 48 horas de duraciÃ³n, con regeneraciÃ³n del catalizador en corriente de aire y posterior uso del catalizador regenerado en las mismas condiciones de reacciÃ³n y tiempo que el catalizador fresco. Ambos sÃ³lidos son activos despuÃ©s de la regeneraciÃ³n, obteniÃ©ndose mayor estabilidad con el sÃ³lido Al-MCM-41 debido probablemente a la menor conversiÃ³n lograda.','2010-05-03','Tamices moleculares, zeolitas mesoporosas',6,1,1,1,1,'2013-09-17 08:31:46','2013-09-17 08:31:46','Documento_379.pdf','application/pdf',417880,'2013-09-17 08:31:46',20,0,72,'COMPLETO'),(379,'ConstrucciÃ³n y optimizaciÃ³n de un equipo para la lectura de celdas de ELISA por fluorescencia molecular..','En el presente trabajo se realizÃ³ la construcciÃ³n y la evaluaciÃ³n preliminar de un equipo de mediciÃ³n simultÃ¡nea de fluorescencia molecular, teniendo como objetivo su aplicaciÃ³n futura en el anÃ¡lisis de muestras clÃ­nicas. Se ensayaron dos montajes experimentales: uno basado en un digitalizador de imÃ¡genes (scanner) convencional y otro empleando un montaje convencional de fluorescencia por reflexiÃ³n. En el primer caso no se logrÃ³ obtener una sensibilidad adecuada. El montaje del equipo propuesto emplea lÃ¡mparas fluorescentes convencionales como fuentes de excitaciÃ³n, placas de 96 pozos para inmuno-ensayo de ELISA como porta muestras y una cÃ¡mara fotogrÃ¡fica convencional como sistema de detecciÃ³n y registro de la seÃ±al de fluorescencia. Para el procesamiento de la seÃ±al se empleÃ³ un programa diseÃ±ado empleando Matlab. La evaluaciÃ³n analÃ­tica se realizÃ³ empleando soluciones de fluoresceÃ­na en una mezcla de etanol/agua. El intervalo lineal obtenido es relativamente limitado, tÃ­pico de los metodos basados en medidas de fluorescencia. La sensibilidad, evaluada como la pendiente de la curva de calibraciÃ³n es sustancialmente menor que la obtenida en equipos comerciales, sin embargo, es lo sufientemente elevada para realizar anÃ¡lisis cuantitativos de especies de interes que no se encuentren en niveles de concentraciÃ³n de trazas. El equipo diseÃ±ado mostrÃ³ sensibilidad, estabilidad y respuesta lineal para realizar anÃ¡lisis cuantitativo de hasta 96 muestras de forma simultÃ¡nea en un corto tiempo.','2010-05-05','Fluorescencia, LEDs, CCD',6,1,1,1,1,'2013-09-17 08:31:47','2013-09-17 08:31:47','Documento_380.pdf','application/pdf',3172285,'2013-09-17 08:31:47',19,0,116,'COMPLETO'),(380,'Generando Sitios Web Dirigidos a Profesionales Independientes','Este Trabajo Especial de Grado presenta el desarrollo de un Generador de Sitios Web de Profesionales Independientes, denominado G-WEBPRi, el cual fue diseÃ±ado considerando la necesidad que poseen los profesionales independientes de contar con un sitio Web donde puedan ofrecer sus productos y/o servicios. De esta forma, los usuarios de esta aplicaciÃ³n podrÃ¡n construir y mantener actualizado de forma sencilla su sitio Web de profesional independiente, mediante una serie de pasos guiados. Asimismo, el usuario podrÃ¡ cambiar la apariencia de su sitio Web, a travÃ©s de un conjunto de plantillas que ofrece la aplicaciÃ³n. Para realizar el anÃ¡lisis y diseÃ±o de G-WEBPRi,,asÃ­ comopara la implementaciÃ³n, se utilizÃ³ un mÃ©todo Ad Hoc basado en el Proceso Unificado ((Unified Process -- UP)) en su versiÃ³n Ãgil (Agile Unified Process --AUP), con la incorporaciÃ³n de patrones de interacciÃ³n y evaluaciones heurÃ­sticas, empleando como lenguaje de programaciÃ³n PHP y como Sistema Manejador de Bases de Datos MySQL. El producto obtenido es una aplicaciÃ³n que promueve la participaciÃ³n de los ciudadanos en la construcciÃ³n de su sitio Web, sin requerir conocimientos avanzados de la tecnologÃ­a subyacente ni plataformas complejas, apoyando la labor que realiza cada uno de los profesionales independientes en pro de mejorar sus condiciones econÃ³micas y sociales, al ofrecer sus productos y/o servicios en Internet, a travÃ©s del sitio Web creado.','2010-05-05','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:31:49','2013-09-17 08:31:49','Documento_381.pdf','application/pdf',0,'2013-09-17 08:31:49',19,0,0,'INCOMPLETO'),(381,'Desarrollo y evaluaciÃ³n de un biosensor quimioluminiscente para su aplicaciÃ³n en anÃ¡lisis clinicos.','En este trabajo se explorÃ³ la viabilidad de elaborar un biosensor para la determinaciÃ³n de Glucosa en sangre por quimioluminiscencia usando como receptÃ¡culo de la muestra una placa ELISA. El mÃ©todo se basa en las diferencia s en la intensidad de quimioluminiscencia del luminol debido a las diferentes cantidades de perÃ³xido de hidrÃ³geno producido por la reacciÃ³n enzimÃ¡tica de glucosa catalizada por la enzima glucosa oxidasa. Para la adquisiciÃ³n y el procesamiento de los datos experimentales se utilizÃ³ una cÃ¡mara CCD y un software diseÃ±ado en Matlab R2006a. Con el fin de obtener las condiciones experimentales Ã³ptimas, fueron investigados una serie de parÃ¡metros y dos sistemas de medida. En uno glucosa oxidasa (GO) es encapsulada en un sol gel y en otro GO es utilizada directamente en soluciÃ³n. Dentro de los parÃ¡metros estudiados estÃ¡n, el efecto del Ã¡rea de observaciÃ³n y la reproducibilidad del sistema con la enzima tanto en la matriz sÃ³lida como en soluciÃ³n. En el primer caso se encontraron problemas en la velocidad de difusiÃ³n de las especies a travÃ©s de los poros del gel, lo cual impidiÃ³ que se realizaran medidas con este. Para las medidas en soluciÃ³n se evaluaron dos software, uno cuya seÃ±al emitida es igual a la mediana de los pixeles ubicados en el Ã¡rea de observaciÃ³n seleccionada y otro en el cual esta es igual a la suma de todos los pixel. El segundo software usando un tiempo de integraciÃ³n de la seÃ±al entre 0,1 y 1,0 seg. presentÃ³ mejor reproducibilidad y por lo tanto fue el empleado para el resto de los anÃ¡lisis. La curva de calibraciÃ³n obtenida con las condiciones Ã³ptimas del sistema fue lineal en el rango de 500 a 2000 mg/l con un coeficiente de correlaciÃ³n de 0,9457. El mÃ©todo propuesto fue aplicado en la determinaciÃ³n de glucosa en plasma sanguÃ­neo de ratas encontrando que existen interferencias por parte de la matriz de la muestra en el procedimiento de medida lo que impidiÃ³ validar el mÃ©todo propuesto.','2010-04-28','Quimioluminiscencia, CCD, MÃ©todos enzimÃ¡ticos.',6,1,1,1,1,'2013-09-17 08:31:50','2013-09-17 08:31:50','Documento_382.pdf','application/pdf',2229058,'2013-09-17 08:31:50',20,0,110,'COMPLETO'),(382,'EvaluaciÃ³n del potencial de rendimiento en 14 variedades de arroz (Oryza sativaL..)), cultivadas en Venezuela desde la dÃ©cada de los aÃ±os 50.','En Venezuela la producciÃ³n de arroz ha aumentado desde el aÃ±o 1960, como consecuencia de una mayor Ã¡rea cultivada y mayores rendimientos. No obstante, desde 1989, el rendimiento promedio nacional se ha estancado en alrededor de 500 g.m-2; con una tasa promedio anual de 8 g.m-2.aÃ±o-1; a pesar de la liberaciÃ³n de un nÃºmero considerable de nuevas variedades en este perÃ­odo. El incremento del rendimiento ha sido producto esencialmente de tres factores: i) Mejoramiento genÃ©tico del rendimiento per se; ii) Mejoramiento genÃ©tico de la tolerancia/resistencia a plagas y enfermedades; y iii) Mejoras en las prÃ¡cticas de manejo agronÃ³mico. Sin embargo, la informaciÃ³n disponible no permite dilucidar el aporte relativo de estos componentes al incremento del rendimiento del arroz en Venezuela. Este trabajo tiene como objetivos determinar los cambios en el rendimiento del arroz en Venezuela producto del mejoramiento genÃ©tico desde la dÃ©cada de los aÃ±os 50 y evaluar la importancia de algunos parÃ¡metros de crecimiento y morfolÃ³gicos en la determinaciÃ³n del rendimiento del arroz en el paÃ­s. Se evaluaron 14 variedades de arroz, liberadas desde 1951 hasta 2006, las cuales fueron sembradas por trasplante, utilizando un diseÃ±o completamente aleatorio con cuatro rÃ©plicas, en las localidades de Calabozo y Acarigua, en la Ã©poca de lluvias de 2006; y se cultivaron bajo prÃ¡cticas actuales de manejo agronÃ³mico, protegiÃ©ndolas contra posibles daÃ±os ocasionados por plagas y enfermedades. El muestreo se realizÃ³ en diferentes estadios de desarrollo del cultivo. Las variables a evaluar fueron rendimiento, tasa de crecimiento relativo (TCR), biomasa total, biomasa vegetativa, Ãndice de Cosecha (IC) y, largo y ancho de la hoja bandera. Se utilizÃ³ el anÃ¡lisis de regresiÃ³n lineal para correlacionar las variables evaluadas con los aÃ±os de liberaciÃ³n de las variedades, asÃ­ como tambiÃ©n para correlacionar el rendimiento con el resto de las variables. Los resultados obtenidos seÃ±alan que: El mejoramiento genÃ©tico ha contribuido con un 50% al aumento en el rendimiento, y posiblemente el mayor aporte parece haber sido sobre el Ã­ndice de cosecha en combinaciÃ³n con una mayor biomasa total. Araure 4 la menos rendidora, Centauro la mÃ¡s rendidora. Acarigua es la localidad con los mayores rendimientos, asÃ­ como tambiÃ©n con la mayor TCR, biomasa total y biomasa vegetativa en comparaciÃ³n con Calabozo. El PR de las variedades de arroz en Venezuela se encuentra entre 1114,1 y 1120,0 g.m-2; el rendimiento promedio nacional del arroz en Venezuela apenas supera los 500 g.m-2, por tanto, existe una amplia brecha que superar para incrementar la producciÃ³n de arroz en el paÃ­s. Este trabajo aporta por primera vez indicadores del progreso genÃ©tico para algunas determinantes en variedades de arroz cultivadas en Venezuela desde la dÃ©cada de los aÃ±os 50.','2010-04-30','{}',1,1,1,1,1,'2013-09-17 08:31:52','2013-09-17 08:31:52','Documento_383.pdf','application/pdf',0,'2013-09-17 08:31:52',17,0,0,'INCOMPLETO'),(383,'CaracterizaciÃ³Ã³nn fisicoquÃ­Ã­mica y evaluaciÃ³Ã³nn de la calidad e inocuida