contrÃ³ que hay diferencias en cuanto a los parÃ¡metros fisicoquÃ­micos evaluados en las variedades de mapuey y la yuca algodonada.','2010-05-06','{}',1,1,1,1,1,'2013-09-17 08:31:53','2013-09-17 08:31:53','Documento_384.pdf','application/pdf',1161063,'2013-09-17 08:31:53',19,0,69,'COMPLETO'),(384,'\"\"SÃ­Ã­ntesis y CaracterizaciÃ³Ã³nn de Agregados MetÃ¡Ã¡licos de los Grupos 77 y 88 con Terbutildialilfosfina y Dialilfenilfosfina\"\"..','El interÃ©s generado por el desarrollo de complejos de agregados metÃ¡licos en quÃ­mica organometÃ¡lica ha sido especialmente por lo que respecta a su potencial como catalizadores homogÃ©neos, asÃ­ como tambiÃ©n, se ha especulado que el estudio de estos complejos polinucleares que contiene enlaces metal-metal pueden servir como modelos de superficies catalÃ­ticas ayudando a encontrar la conexiÃ³n entre la catÃ¡lisis homogÃ©nea y la heterogÃ©nea,[1] ademÃ¡s, se basa en sus aplicaciones en varios campos de investigaciÃ³n, tales como, la electrÃ³nica, la Ã³ptica no lineal, incluso en el Ã¡rea de la biologÃ­a.[2,3] Los agregados metÃ¡licos han sido utilizados como modelos de la interacciÃ³n que existe entre los sustratos orgÃ¡nicos y las superficies metÃ¡licas de catalizadores, debido a la similitud de los agregados polinucleares con dichas superficie. AsÃ­, el entendimiento de los modos de coordinaciÃ³n de los ligandos podrÃ­a conllevar a la creaciÃ³n de nuevos catalizadores o al mejoramiento de los ya existentes. [4] En este proyecto se estudiÃ³ la reactividad quÃ­mica de las fosfinas hemilÃ¡biles dialilfenilfosfina y terbutildialilfosfina con los agregados metÃ¡licos bis(acetonitrilo) dodecacarbonilo de triosmio [Os3(CO)10(CH3CN)2] y bis(acetonitrilo) octacarbonilo de direnio [Re2(CO)8(CH3CN)2], respectivamente. La reacciÃ³n de la dialilfenilfosfina con el [Os3(CO)10 (CH3CN)2], conduce a la formaciÃ³n de 3 complejos, el primero [Os3(CO)11{P (C3H5)2(Ph)}] (I.1) donde la dialilfenilfosfina se encuentra monocoordinada a un centro metÃ¡lic