perfila como vehÃ­culo de diversos ingredientes funcionales de carÃ¡cter bioactivo. El uso de modelos biolÃ³gicos como el gorgojo de arroz constituye una manera fÃ¡cil, rÃ¡pida y econÃ³mica para la evaluaciÃ³n iin vivode diversos componentes de la dieta y hacer inferencias de carÃ¡cter nutricional. Es por ello, que se evaluÃ³ la viabilidad de pelÃ­culas comestibles elaboradas con almidones de yuca, batata y plÃ¡tano con un bioensayo sencillo que utiliza el gorgojo de arroz (Sitophilus oryzae). De los tres almidones estudiados, el de plÃ¡tano fue el que mantuvo la supervivencia mÃ¡s elevada y ademÃ¡s fue el Ãºnico que produjo un incremento de peso, por lo cual se seleccionÃ³ como el polÃ­mero definitivo para la incorporaciÃ³n de Ã¡cidos grasos omega-3 (O-3), inulina y bifidobacterias; por ser el mÃ¡s adecuado para satisfacer las demandas nutricionales del mantenimiento de los insectos. En relaciÃ³n a las propiedades fÃ­sicas y mecÃ¡nicas evaluadas, la adiciÃ³n de O-3 produjo un aumento en el grosor, la capacidad de retenciÃ³n de agua y flexibilidad de las pelÃ­culas comestibles de almidÃ³n de plÃ¡tano; mientras que la incorporaciÃ³n de inulina y bifidobacterias influyÃ³ disminuyendo la capacidad de retenciÃ³n de agua; pero incrementando la permeabilidad al vapor de agua, grosor, solubilidad en agua y fuerza de punciÃ³n. Por Ãºltimo, se puede mencionar que los resultados de esta investigaciÃ³n indican que las pelÃ­culas de almidÃ³n de plÃ¡tano sirven como un medio de transferencia de bifidobacterias para al gorgojo de arroz, pues se encontraron bifidobacterias viables en el insecto.','2010-05-06','pelÃ­culas comestibles, gorgojo de arroz, alimentos funcionales, bioensayo',1,1,1,1,1,'2013-09-17 08:31:55','2013-09-17 08:31:55','Documento_386.pdf','application/pdf',4640851,'2013-09-17 08:31:55',20,0,104,'COMPLETO'),(386,'Propuesta de diseÃ±o de una soluciÃ³n de videovigilancia soportada en cÃ¡maras IP con tecnologÃ­a IEEE 802.11 para el Edificio El Rectorado, Plaza Cubierta yComplejo Cultural Aula Magna de la Universidad Central de Venezuela','Debido a los diversos ataques en los que se ha visto involucrada la Universidad Central de Venezuela, surgiÃ³ la necesidad de una propuesta de diseÃ±o de una soluciÃ³n de videovigilancia soportada en cÃ¡maras IP, con la finalidad de incrementar los niveles de vigilancia en el Edificio el Rectorado, la Plaza Cubierta y el Complejo Cultural Aula Magna de la UCV. Esta fue la propuesta de la DirecciÃ³n de TecnologÃ­a de InformaciÃ³n y Comunicaciones (DTIC), con el objetivo de reforzar los niveles de seguridad y de esta manera brindar tranquilidad a la comunidad universitaria. En este Trabajo Especial de Grado se presenta el diseÃ±o, los dispositivos inalÃ¡mbricos usados y unas pruebas de funcionamiento, que dan soporte al diseÃ±o de la soluciÃ³n. Los dispositivos inalÃ¡mbricos involucrados en el diseÃ±o estÃ¡n basados en el fabricante Cisco Systems. La propuesta de diseÃ±o de la soluciÃ³n de videovigilancia se basa en el estÃ¡ndar IEEE 802.11 y asÃ­ mismo se propone la implementaciÃ³n de QoS (Quality of Service), especÃ­ficamente del mecanismo de DiffServ (Differentiated Services), con la finalidad de evitar la congestiÃ³n del trÃ¡fico que transita por la red. A su vez para validar esta propuesta de diseÃ±o, se realizaron diversas pruebas. El resultado final, es una soluciÃ³n de videovigilancia soportada en una WLAN completamente funcional, que cumple con los requisitos exigidos por la DTIC y por la DirecciÃ³n de Seguridad de la UCV.','2010-05-03','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:31:57','2013-09-17 08:31:57','Documento_387.pdf','application/pdf',2678056,'2013-09-17 08:31:57',20,0,138,'COMPLETO'),(387,'Estudio de la actividad catalÃ­tica de nanopartÃ