a la remociÃ³n de mercurio en aguas de consumo humano. El material tiene una composiciÃ³n de 27% de minerales de arcilla, dentro de los cuales estÃ¡n presentes la caolinita, lilita y esmectita. Se estudiÃ³ el tamaÃ±o de partÃ­cula, caudal de adsorciÃ³n y desorciÃ³n, capacidad de adsorciÃ³n, recuperaciÃ³n de la columna rellena con el material adsorbente luego de ser usada y forma de empaquetamiento del material adsorbente para ser utilizado como filtro para la remediaciÃ³n de las aguas contaminadas con mercurio. El filtro optimizado consta de una columna rellena con aproximadamente 48 gramos del material adsorbente con un tamaÃ±o de grano entre 250 y 500 micras, el cual adsorbe 100% de mercurio por largos perÃ­odos de tiempo en condiciones de caudal mÃ­nimo (0,91 mL/min) y para caudales cercanos al del servicio de agua domÃ©stica (1000mL/min) adsorbe entre 85% y 33% dependiendo de la concentraciÃ³n de mercurio presente en el agua.La determinaciÃ³n de la concentraciÃ³n de mercurio fue realizada utilizando espectrometrÃ­a de absorciÃ³n atÃ³mica con generaciÃ³n de vapor frio y espectrometrÃ­a de fluorescencia atÃ³mica con generaciÃ³n de vapor frio.','2010-05-03','ContaminaciÃ³n mercurial, adsorbente, arcilla, mineria',6,1,1,1,1,'2013-09-17 08:32:04','2013-09-17 08:32:04','Documento_391.pdf','application/pdf',1062117,'2013-09-17 08:32:04',18,0,78,'COMPLETO'),(391,'\"Estudio preliminar del contenido de Vanadio y NÃ­quel en las fracciones A1 y A2 de asfaltenos provenientes de crudos Venezolanos\"','Venezuela es uno de los paÃ­ses con mayores reservas de petrÃ³leo, en su mayorÃ­a de crudos pesados y extrapesados. Sin embargo, la explotaciÃ³n de estos se dificulta debido a su alta viscosidad y mayor proporciÃ³n de fracciones pesadas como resinas y asfaltenos, siendo esta la que genera problemas en las distintas etapas de producciÃ³n y almacenamiento, ademÃ¡s de que el contenido de metales presentes en esta fracciÃ³n causa el envenenamiento de catalizadores.Los asfaltenos han sido el objetivo de muchos estudios que intentan proponer estructuras que sean consistentes con la informaciÃ³n experimental existente, en este sentido, se ha reportado la existencia de dos fracciones de asfaltenos las cuales presentan diferencias en solubilidad, la fracciÃ³n A1 insoluble en tolueno y la fracciÃ³n A2 soluble, dicho comportamiento se ha podido explicar de acuerdo a las diferencias estructurales encontradas para cada una de ellas, aÃºn cuando no se han encontrados diferencias significativas en sus caracterÃ­sticas moleculares como peso molecular, aromaticidad y contenido de heteroÃ¡tomos que permitan justificar este comportamiento.En relaciÃ³n a lo expuesto, se propuso determinar el contenido de Ni, V, Fe y Zn en las fracciones A1 y A2 de asfaltenos de crudos con diferente estabilidad empleando espectroscopia de emisiÃ³n Ã³ptica con plasma inductivamente acoplado y estudiar como se distribuyen dichos metales en estas fracciones y correlacionarlo con sus caracterÃ­sticas de solubilidad y estabilidad de asfaltenos en crudos.Los valores de concentraciÃ³n obtenidos para V y Ni mostraron una muy buena reproducibilidad y bajo porcentaje de error comparado con los de Fe y Zn los cuales presentaron un porcentaje de error alto, el cual se puede atribuir a la baja concentraciÃ³n de estos metales en crudo y a la contaminaciÃ³n de los reactivos Ã¡cidos empleados en las digestiones.5Los resultados obtenidos en este trabajo muestran que existe una mayor concentraciÃ³n de V y Ni en asfaltenos de crudos estables que de crudos inestables. En cuanto a las fracciones A1 y A2, se encontrÃ³ que existe una mayor concentraciÃ³n de V y Ni en la fracciÃ³n A1 y esta pareciera ser mas marcada en la fracciÃ³n A1 de crudos inestables, de acuerdo a esto se puede establecer que los compuestos organometÃ¡licos son atrapados por molÃ©culas de A1 de manera eficiente quedando ocluido dentro de ellas, por ello, se pudiera pensar que los metales de tipo porfirinico quedan atrapados en el coloide asfaltenico entre las molÃ©culas de A1 y A2','2010-04-28','vanadio, niquel, asfaltenos, fracciones A1 y A2, digestion por microondas',6,1,1,1,1,'2013-09-17 08:32:05','2013-09-17 08:32:05','Documento_392.pdf','application/pdf',0,'2013-09-17 08:32:05',20,0,0,'INCOMPLETO'),(392,'Ã¢Â€ÂœSÃƒÂNTESIS ELECTROQUÃƒÂMICA Y CARACTERIZACIÃƒÂ“N DE NANOPARTÃƒÂCULAS BIMETÃƒÂLICAS DE METALES DE TRANSICIÃƒÂ“NÃ¢Â€Â','A continuaciÃƒÂ³n se presenta un estudio sobre la sÃƒÂ­ntesis electroquÃƒÂ­mica de nanopartÃƒÂ­culas bimetÃƒÂ¡licas de Rh-Pd y Rh-Ru y su caracterizaciÃƒÂ³n por MicroscopÃƒÂ­a ElectrÃƒÂ³nica de TransmisiÃƒÂ³n (MET), voltamperometrÃƒÂ­a cÃƒÂ­clica y espectroscopÃƒÂ­a uv-visible. Las sÃƒÂ­ntesis se realizaron a partir de RhCl3, PdBr2 y RuCl3 en presencia de bromuro de tetrapropilamonio el cual sirviÃƒÂ³ como electrolito soporte y estabilizador de las nanopartÃƒÂ­culas; se realizaron variaciones en las condiciones de sÃƒÂ­ntesis (densidad de corriente aplicada, voltaje, concentraciÃƒÂ³n de metales y de estabilizante) para determinar la influencia de ÃƒÂ©stos en el tamaÃƒÂ±o de las partÃƒÂ­culas y en la proporciÃƒÂ³n de los metales que las conforman. La determinaciÃƒÂ³n del tamaÃƒÂ±o de las partÃƒÂ­culas fue realizada por MET, estos estudios mostraron que el tamaÃƒÂ±o promedio de las partÃƒÂ­culas estÃƒÂ¡ relacionado con la densidad de corriente y el potencial aplicado, a medida que ÃƒÂ©stos aumentan, el tamaÃƒÂ±o de las nanopartÃƒÂ­culas disminuye. Los patrones de difracciÃƒÂ³n de electrones obtenidos de ÃƒÂ©ste estudio mostraron que en las nanopartÃƒÂ­culas bimetÃƒÂ¡licas de Rh-Pd y Rh-Ru se encuentran presentes fases metÃƒÂ¡licas y oxidadas de los metales que las conforman. Por medio de los estudios de voltamperometrÃƒÂ­a cÃƒÂ­clica y espectroscopÃƒÂ­a UV-visible sugieren que las nanopartÃƒÂ­culas bimetÃƒÂ¡licas de Rh- Pd y Rh-Ru son nanoaleaciones. Se realizaron los estudios de la actividad electrocatalÃƒÂ­tica mediante voltamperometrÃƒÂ­a cÃƒÂ­clica de las nanopartÃƒÂ­culas de Rh-Pd y Rh-Ru sobre la oxidaciÃƒÂ³n del MeOH y del HCOOH respectivamente, encontrando que las que tuvieron mejores respuestas fueron las nanopartÃƒÂ­culas de Rh-Pd sintetizadas a -0,7V/Ag/AgCl y las de Rh-Ru sintetizadas a -5mA con una concentraciÃƒÂ³n inicial de 1.10-2 mol/L de Rh.','2010-04-08','NanopartÃƒÂ­culas bimetÃƒÂ¡licas, voltamperometrÃƒÂ­a cÃƒÂ­clica, espectroscopÃƒÂ­a UV- visible, microscopÃƒÂ­a electrÃƒÂ³nica de transmisiÃƒÂ³n',6,1,1,1,1,'2013-09-17 08:32:06','2013-09-17 08:32:06','Documento_393.pdf','application/pdf',2018065,'2013-09-17 08:32:06',20,0,107,'COMPLETO'),(393,'SÃ­ntesis y caracterizaciÃ³n de nuevos materiales microestructurados basados en hidrogeles de acrilamida y/o Ã¡cido acrÃ­lico con esferas de carbono funcionalizadas para la remociÃ³n de metales pesados\"','En los Ãºltimos aÃ±os, se ha innovado en el desarrollo de nuevas mÃ©todos aplicados a la sÃ­ntesis de materiales a partir de materiales de bajo costo y compatibles con el medio ambiente, dentro de esta gama de nuevas tecnologÃ­as se encuentra el desarrollo de materiales hÃ­bridos con propiedades y/o funcionalidad aumentada con respecto a los componentes individuales a travÃ©s del ensamblaje cooperativo de especies orgÃ¡nicas e inorgÃ¡nicas (sinergismo). Normal 0 false false false EN-US X-NONE X-NONE / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-them