s traza como Zn, Cu, Cr, Se, Cd, Pb y Hg en muestras de cabello y orina con 24 horas de recolecciÃ³n en niÃ±os con SÃ­ndrome de Espectro Autista con edades comprendidas entre 3 y 16 aÃ±os, pertenecientes al Hospital J. M. de los RÃ­os y al Hospital PÃ©rez CarreÃ±o y de una poblaciÃ³n de grupo control (niÃ±os sanos) pertenecientes, en su mayorÃ­a, a la Gran Caracas. Se analizaron en total 21 muestras de orina y 42 muestras de cabello de niÃ±os con SÃ­ndrome de Espectro Autista. Adicionalmente, se analizaron 9 muestras de orina y 8 muestras de cabello de niÃ±os pertenecientes a un grupo control. La determinaciÃ³n de Zn, Cu, Cr, Se, Cd y Pb se realizÃ³ mediante espectrometrÃ­a de emisiÃ³n atÃ³mica con plasma inductivamente acoplado (ICP-OES) y la determinaciÃ³n de Hg total se realizÃ³ mediante espectrometrÃ­a de absorciÃ³n atÃ³mica con generaciÃ³n de vapor frÃ­o (CV-AAS). Finalmente, se determinÃ³ creatinina en orina mediante espectrometrÃ­a ultravioleta - visible. Los resultados obtenidos fueron tratados estadÃ­sticamente empleando el programa Statgraphic Plus versiÃ³n 5.0. Las concentraciones de los elementos en cabello y orina de niÃ±os con SÃ­ndrome de Espectro Autista y pertenecientes al grupo control, fueron comparadas con intervalos de referencia internacional. Para las muestras de orina, las concentraciones de Zn, Se y Hg de niÃ±os autistas estuvieron dentro del intervalo de las concentraciones de referencia, el Cu y el Pb presentaron niveles por encima de los valores referenciales y el Cr se encontrÃ³ superior a estos niveles. Para una poblaciÃ³n sana, las concentraciones de Cr y Hg estuvieron dentro de los valores referenciales, mientras que Cu y Se seubicaron por encima de los mismos y finalmente las concentraciones de Zn por debajo y Pb se encontraron por encima de los valores de referencia. Los valores de las concentraciones de Se, Cr y Hg se encontraron dentro del rango referencial en muestras de cabello de niÃ±os autistas, mientras que las concentraciones de Pb se ubicaron por encima y las de Zn y Cu por debajo de los mismos. Para el cabello, se encontrÃ³ que sÃ³lo el Hg estuvo dentro del intervalo de referencia en la poblaciÃ³n sana, los elementos Se, Cr y Pb se hallaron por encima, finalmente los valores obtenidos de las medianas para el Zn y el Cu, estuvieron por debajo de los valores de referencia. Se compararon las tendencias encontradas para cada elemento en niÃ±os autistas con respecto a una poblaciÃ³n control observÃ¡ndose que, tanto para la orina como para el cabello la eliminaciÃ³n de Cu y Pb fue mayor en niÃ±os autistas que sanos. Por otro lado, la de Se, Cr y Hg fue mayor en la poblaciÃ³n control que en la autista por ambas vÃ­as y la excreciÃ³n de Zn en orina fue mayor en autistas que sanos y caso contrario ocurriÃ³ con el cabello. Finalmente se establecieron relaciones entre elementos como Se/Zn, Cu/Se y Cu/Zn en las muestras de orina indicando que las tendencias de concentraciones de los dos primeros eran inversamente proporcionales mientras que para la relaciÃ³n Cu/Zn fue directamente proporcional.','2010-05-07','NiÃƒÂ±os con SÃƒÂ­ndrome de Espectro autista, Mercurio, Elementos traza',6,1,1,1,1,'2013-09-17 08:32:15','2013-09-17 08:32:15','Documento_396.pdf','application/pdf',1237578,'2013-09-17 08:32:15',18,0,65,'COMPLETO'),(396,'\"\"EVOLUCIÃ“Ã“NN Y GEOQUÃÃMMICA DE LOS SEDIMENTOS HOLOCENOS PROXIMALES DEL SISTEMA LAGUNAR DE HIGUEROTE,, ESTADO MIRANDA.. NÃšÃšCCLEO HSR--11\"\"','Este trabajo tiene como objetivo la caracterizaciÃ³Ã³nn geoquÃ­Ã­mica de los elementos mayoritarios presentes en los sedimentos recolectados en la paleolaguna ubicada al noroeste de la poblaciÃ³Ã³nn de Higuerote,, a 33 Km de la costa oriental del Estado Miranda y la identificaciÃ³Ã³nn de posibles cambios paleoambientales recientes.. Los sedimentos fueron recuperados usando el tomador de nÃºÃºccleos de sedimentos no consolidados de 11,,55 m de longitud fabricado en el Centro de GeologÃ­Ã­a del Instituto de Ciencias de la Tierra para este fin,, el cual emplea un sistema de percusiÃ³Ã³nn,, permitiendo recuperar los sedimentos sin inducir deformaciÃ³Ã³nn.. El nÃºÃºccleo recuperado HSR--11 tiene una longitud de 5500 cm,, se realizÃ³Ã³ un muestreo sistemÃ¡Ã¡tico de alta resoluciÃ³Ã³nn cada 55 milÃ­Ã­metros y se analizaron por FRX ((Fluorescencia de Rayos X)) y AES ((EspectrometrÃ­Ã­a de EmisiÃ³Ã³nn AtÃ³Ã³mmica)),, para determinar las concentraciones de los elementos:: Al22O33,, CaO,, Fe22O33,, K22O,, MnO,, Na22O,, SiO22 y TiO22.. Ã‰Ã‰sstos muestran el lÃ­Ã­mite de dos quimiofacies caracterizadas por materia orgÃ¡Ã¡nica y depÃ³Ã³ssitos siliciclÃ¡Ã¡sticos.. El sodio disminuye gradualmente hacia el tope,, el hierro y el manganeso aumentan en la secciÃ³Ã³nn oxidada con mayor bioturbaciÃ³Ã³nn,, mientras que los incrementos del calcio son debidos a la presencia de minerales de yeso por precipitaciÃ³Ã³nn de agua marina,, otros minerales como cuarzo,, illita,, goethita,, dolomita y calcita estÃ¡Ã¡n presentes.. AdemÃ¡Ã¡s,, se concluye que la secciÃ³Ã³nn de la base,, corresponde a un paleosuelo de manglar existente hace 22550000 aÃ±Ã±oos tomando la tasa de sedimentaciÃ³Ã³nn de 00,,22 mm//aÃ±Ã±oo tÃ­Ã­pica para sedimentos lagunares de la costa centro--oriental de Venezuela.. Estos resultados indican que ha existido una disminuciÃ³Ã³nn significativa del aporte de influencia marina en el sistema ocasionando la desapariciÃ³Ã³nn de lagunas de gran envergadura en la regiÃ³Ã³nn,, dando paso a una sedimentaciÃ³Ã³nn siliciclÃ¡Ã¡stica predominante hasta colmatarla completamente.. Tomando en cuenta un contexto de transgresiÃ³Ã³nn marina global,, los resultados sugieren de manera preliminar que localmente existe una regresiÃ³Ã³nn,, forzada probablemente por un aumento significativo en la tasa de sedimentaciÃ³Ã³nn en la costa..','2010-05-06','Laguna Costera, Holoceno, GeoquÃƒÂ­mica, Amenazas Naturales.',6,1,1,1,1,'2013-09-17 08:32:16','2013-09-17 08:32:16','Documento_397.pdf','application/pdf',2167502,'2013-09-17 08:32:16',19,0,101,'COMPLETO'),(397,'\"SÃ­ntesis y CaracterizaciÃ³n de los Derivados deDifenilalilfosfina de los Agregados MetÃ¡licos [Ru3(CO)12] y[H2Os3(CO)10] \"','I) RESUMENLa quÃ­mica de los agregados metÃ¡licos ha despertado un gran interÃ©s en losÃºltimos aÃ±os, debido a pueden funcionar como catalizadores homogÃ©neos y ademÃ¡sayudan a entender los procesos que ocurren en las superficies metÃ¡licas de loscatalizadores heterogÃ©neos, puesto que estos complejos contienen enlaces directosmetal-metal [1].Por esta razÃ³n, este trabajo se enfoca en la sÃ­ntesis y caracterizaciÃ³n de nuevosagregados metÃ¡licos con aplicaciones catalÃ­ticas, estudiando la reactividad quÃ­mica defosfinas terciarias frente agregados metÃ¡licos del grupo 8, especÃ­ficamente[H2Os3(CO)10] y [Ru3(CO)12]. Los resultados de este trabajo provienen de la interacciÃ³ndel ligando orgÃ¡nico alildifenilfosfina con los clusters [H2Os3(CO)10] y [Ru3(CO)12].El ligando alildifenilfosfina reacciona con [H2Os3(CO)10], a la temperatura dereflujo del ciclohexano durante 16 horas, originando los complejos minoritarios[Os3(CO)11 {Ã¯ÂÂ¨1-P(C3H7)(C6H5)2Ã¯ÂÂ½] (I), [Os3(Ã¯ÂÂ­-H)(CO)9{Ã¯ÂÂ­3-Ã¯ÂÂ¨3-P(C6H4)(C6H6) (C3H7)Ã¯ÂÂ½] (II)[Os3(CO)10{Ã¯ÂÂ­-Ã¯ÂÂ¨3-P(C3H5)(C6H5)2Ã¯ÂÂ½] (III) y en mayor proporciÃ³n el complejo [Os3(CO)9{Ã¯ÂÂ­-Ã¯ÂÂ¨3-P(C3H5)(C6H5)2,}{Ã¯ÂÂ¨1-P(C3H7) (C6H5)2}] (IV).Por otro lado, el ligando alildifenilfosfina reacciona rÃ¡pidamente con el agregadometÃ¡lico [Ru3(CO)12] bajo reflujo de ciclohexano durante 40 min, dando lugar a laobtenciÃ³n de dos complejos mayoritarios, [Ru3 (CO)10{Ã¯ÂÂ¨1-P(C3H5)(C6H5)}2] (I) y[Ru3(CO)9{Ã¯ÂÂ¨1-P(C3H5)(C6H5)}3] (II).','2009-12-08','{}',6,1,1,1,1,'2013-09-17 08:32:18','2013-09-17 08:32:18','Documento_398.pdf','application/pdf',1828779,'2013-09-17 08:32:18',20,0,74,'COMPLETO'),(398,'GestiÃ³n de Residuos de Permanganato de Potasio generados en los Laboratorios de Docencia de la Escuela de QuÃ­mica','RESUMENEn los Laboratorios de Docencia de la Escuela de QuÃ­mica se generan constantemente y se acumulan gran cantidad de residuos y desechos que por sus caracterÃ­sticas fÃ­sicas y quÃ­micas se consideran materiales peligrosos. Dentro de esta problemÃ¡tica se destacan los residuos de Permanganato de Potasio, dado que son los que se generan en un mayor volumen y representan un alto grado de peligrosidad por sÃ­ mismos y por hallarse en diversas mezclas. Este trabajo de investigaciÃ³n tuvo como objetivo establecer una gestiÃ³n para los diversos residuos de Permanganato de Potasio generados por la InstituciÃ³n, diseÃ±ando metodologÃ­as experimentales que puedan ser aplicadas por los mismos estudiantes que los generan, con el fin de reducir su concentraciÃ³n, peligrosidad, almacenamiento y transformarlos en un producto Ãºtil. La gestiÃ³n consistiÃ³ primeramente en hacer la identificaciÃ³n completa de este tipo residuos a travÃ©s del estudio de cada prÃ¡ctica y experimento que los generaban. Se elaboraron esquemas de segregaciÃ³n para cada prÃ¡ctica, Ã©stos contenÃ­an la reacciÃ³n quÃ­mica, los procesos y cantidades de residuo producidas, asÃ­ como su composiciÃ³n y asignaciÃ³n de un cÃ³digo. A partir de esta informaciÃ³n se hizo el inventario correspondiente, se investigÃ³ la clasificaciÃ³n de peligrosidad y se construyeron las etiquetas. Se estableciÃ³ recuperar el Manganeso como DiÃ³xido de Manganeso, para ello se evaluaron varios tratamientos quÃ­micos de los cuales se seleccionaron los dos mÃ¡s sencillos, rÃ¡pidos y eficaces que fueron el uso de H2O2 y del propio KMnO4, ademÃ¡s Ã©stos no dejan residuos ni introducen especies nuevas a la soluciÃ³n. El Ã³xido obtenido fue secado a 100Â°C y caracterizado por XRD y FTIR determinÃ¡ndose como fase mayoritaria g-MnO2 hidratada o Nsutita que posee propiedades catalÃ­ticas entre otras.Se diseÃ±Ã³ una marcha analÃ­tica sencilla para eliminar las otras especies contaminantes como Fe, Sb, Ag, fosfatos, sulfatos, alcohol bencÃ­lico, benzaldehÃ­do, entre otras, logrÃ¡ndose disminuir sus concentraciones, exceptuando los nitratos, por debajo de los lÃ­mites permitidos en el Decreto 883. Un 57% de los productos obtenidos pueden ser reinsertados como reactivos en los propios laboratorios de esta instituciÃ³n, el 14% pueden ser descartados por el drenaje y el 29% deben ser almacenadas para su disposiciÃ³n final. El costo promedio de los tratamientos propuestos es de 37,05 BsF por litro de residuo y debido a la sencillez de los procedimientos pueden ser ejecutados por los propios alumnos, para lo cual se elaborÃ³ una prÃ¡ctica para los dos primeros laboratorios de la carrera, Principios de QuÃ­mica e InorgÃ¡nica I, quedando demostrado que no se necesita de grandes desarrollos tecnolÃ³gicos para dar soluciÃ³n al problema de los residuos de Permanganato de Potasio.','2010-05-06','GestiÃ³n de Residuos de Laboratorios, Residuos de Permanganato de potasio, DiÃ³xido de Manganeso',6,1,1,1,2,'2013-09-17 08:32:19','2013-09-17 08:32:19','Documento_399.pdf','application/pdf',1128540,'2013-09-17 08:32:19',20,0,60,'COMPLETO'),(399,'Dieta natural del zooplancton del embalse Suata (Edo. Aragua)','En vista de la inexistente informaciÃ³n sobre los vÃ­nculos entre el fitoplancton y el zooplancton del embalse Suata (Edo. Aragua), se propuso el objetivo de analizar la dieta natural del zooplancton de este cuerpo de agua en Ã©pocas climÃ¡ticas diferentes. Los especÃ­menes se capturaron mensualmente (noviembre 2007- octubre 2008) en una localidad cercana al dique del embalse mediante barridos verticales de 2 m con ayuda de una red de cierre (77 mm de luz de malla); los organismos se anestesiaron con agua carbonatada para evitar el regurgitado de su contenido estomacal y posteriormente fueron preservados con soluciÃ³n de formaldehido (concentraciÃ³n final 4 %). Una vez en el laboratorio los especÃ­menes se aclararon con medio de Hoyer, el cual disuelve los tejidos blandos de los especÃ­menes sin daÃ±ar su contenido estomacal, para posteriormente ser observados bajo el microscopio. Se analizÃ³ un total de 2273 individuos (6,98% presentaron sus tractos digestivos vacÃ­os): 207 Prionodiaptomus colombiensis, 317 copÃ©podos Cyclopoida, 197 Keratella spp., 198 Brachionus spp., 398 ostrÃ¡codos, 200 Diaphanosoma spinulosum, 158 Moina micrura, 220 Alona sp., 121 Ceriodaphnia cornuta y 257 nauplios pertenecientes a los copÃ©podos Cyclopoida y Calanoida. Se reconocieron 11 items alimenticios, de los cuales el material particulado (conformado por algas trituradas, fragmentos de algas, detritus y partÃ­culas minerales) presentÃ³ las mayores frecuencias de apariciÃ³n entre los organismos estudiados. La diatomea Cyclotella y el alga verde Monoraphidium parecieron ser las especies mÃ¡s consumidas por la mayorÃ­a de los organismos estudiados. Los copÃ©podos Cyclopoida presentaron la dieta mÃ¡s variada (incluyeron en su dieta todos los items que se logrÃ³ identificar, incluyendo rotÃ­feros y cianobacterias), seguidos del copÃ©podo Calanoida Prionodiaptomus colombiensis, de los cladÃ³ceros Diaphanosoma spinulosum, Moina micrura, Alona sp., Ceriodaphnia cornuta y de los ostrÃ¡codos (10), los nauplios (9), Brachionus spp. (7) y Keratella spp. (5). Se registrÃ³ una alta superposiciÃ³n de las dietas entre los diferentes grupos del zooplancton estudiado (>70%). AdemÃ¡s se encontraron diferencias significativas entre las dietas de sequÃ­a y lluvias para Brachionus spp., Keratella spp. y para los nauplios de los copÃ©podos de Calanoida y Cyclopoida. El material particulado fue el items mÃ¡sconsumido en ambas Ã©pocas climÃ¡ticas. Las algas mÃ¡s frecuentemente encontradas fueron Cyclotella, Oocystis, Monoraphidium y Aulacoseira en la Ã©poca de sequÃ­a y Monoraphidium, Cyclotella y Trachelomonas en la Ã©poca de lluvias. Los resultados mostraron que, a semejanza con otros embalses venezolanos, el zooplancton del embalse Suata consumiÃ³ principalmente material particulado, diatomeas y algas verdes.','2010-05-03','Zooplancton-Dieta-Suata',1,1,1,1,1,'2013-09-17 08:32:21','2013-09-17 08:32:21','Documento_400.pdf','application/pdf',3522579,'2013-09-17 08:32:21',17,0,120,'COMPLETO'),(400,'Dieta natural de Thoracocharax stellatus (Characiformes: Gasteropelecidae) en una secciÃ³n de la cuenca baja del rÃ­o Orituco, Estado GuÃ¡rico.','Una manera de estudiar las relaciones trÃ³ficas es a travÃ©s del anÃ¡lisis de la dieta de las especies en condiciones naturales, de la disponibilidad del alimento y de su conducta alimentaria lo que resulta fundamental para entender la estructura de las comunidades, sus patrones de distribuciÃ³n, las estrategias de vida de las especies y el papel que Ã©stas desempeÃ±an dentro del ecosistema (Blaber 1997). Los estudios de los hÃ¡bitos alimenticios en peces de sistemas tropicales han demostrado la importancia que tienen los diferentes recursos en las comunidades Ã­cticas, seÃ±alando que no existen regÃ­menes alimentarios estrictos, debido a las considerables variaciones en la disponibilidad de los recursos a lo largo del aÃ±o (Lowe-McConnell 1987, Sanchez y col. 2003, Ortaz 1992). En este trabajo se planteÃ³ cuantificar, en distintas fases hidrolÃ³gicas, la dieta de Thoracocharax stellatus, especie de Characiforme presente en la cuenca baja del rio Orituco asÃ­ como evaluar la variaciÃ³n de la dieta entre fases y entre diferentes clases de tallas. Los muestreos se realizaron en la cuenca baja del rÃ­o Orituco, aproximadamente a 167 km aguas debajo de la cuenca alta y cerca de la poblaciÃ³n de Calabozo. Se analizaron 380 ejemplares de muestras provenientes de colectas realizadas entre junio-2006 a mayo-2007 y entre diciembre-2007 a febrero-2008. Los resultados obtenidos sugieren que T.. Stellatus posee una dieta orientada al consumo de invertebrados acuÃ¡ticos y terrestres, en relaciÃ³n a las presas consumidas. La clase Insecta fue el recurso de mayor importancia durante las tres fases hidrolÃ³gicas evaluadas en ambos periodos de campo, sin embargo no se encontraron todas las categorÃ­as en las 3 fases hidrolÃ³gicas evaluadas. Los insectos acuÃ¡ticos fueron un recurso de gran importancia en la dieta de Thorachocarax stellatus durante la fase de ascenso de aguas. En la Ã©poca de lluvia los invertebrados acuÃ¡ticos se encuentran mÃ¡s disponibles dentro de la columna de agua como consecuencia de una mayor productividad en el medio, ademÃ¡s se presenta un incremento del Ã¡rea superficial del rÃ­o y el arrastre de nutrientes al lecho del rÃ­o por efecto de la escorrentÃ­a (Angermeier y Karr, 1983).se encontraron diferencias en la dieta de la especie ne las dieferentes tallas como consecuencia de las necesidades energÃ©ticas de los diferentes grupos de tallas y no relacionadas con las variaciones ontogÃ©nicas.','2010-05-04','dieta de ictiofauna, ontogenicos, cambios estacionales',1,1,1,1,1,'2013-09-17 08:32:23','2013-09-17 08:32:23','Documento_401.pdf','application/pdf',1387451,'2013-09-17 08:32:23',18,0,57,'COMPLETO'),(401,'MÃ©todo de AnÃ¡lisis de Riesgo (SPAN)','En esta tesis se estudio el mÃ©todo de anÃ¡lisis de riesgo SPAN, que es un mÃ©todo que sirve para la dministraciÃ³n y contro de riesgo de diversas institucioines y empresas financieras. El SPAN genera mediante una serie de parÃ¡metros la peor pÃ©rdida probable en la que puediera incurrir una cartera de inversion que contiene instrumentos derivados. Se estudiaron cada uno de los parÃ¡metros del SPAN, demostrando los aspectos matemÃ¡ticos del mismo.','2010-02-24','Riesgo financiero, Medidas choherentes de riesgo, AdministraciÃ³n de riesgo',5,1,1,1,1,'2013-09-17 08:32:25','2013-09-17 08:32:25','Documento_403.pdf','application/pdf',28334978,'2013-09-17 08:32:25',20,0,171,'COMPLETO'),(402,'ZOOPLANCTON EN SEIS CUERPOS DE AGUA DE LA REGIÃ“Ã“NN CENTRO--NORTE DE VENEZUELA Y CARACTERIZACIÃ“Ã“NN MOLECULAR DE LA ESPECIE MÃÃSS COMÃšÃšNN','Durante el estudio de las comunidades zooplanctÃ³nicas de los ecosistemas acuÃ¡ticos, se pueden presentar dificultades en la identificaciÃ³n de especies, muchas de las cuales son discriminadas con base en caracteres morfolÃ³gicos y morfomÃ©tricos, algunos muy sutiles. Estas comunidades pueden ser indicadoras de la calidad del agua y de su estado trÃ³fico, por lo que resulta de gran interÃ©s su estudio e identificaciÃ³n. Como una contribuciÃ³n al conocimiento de los cuerpos de agua de nuestro paÃ­s, se estimaron variables fisicoquÃ­micas y la biomasa del fitoplancton y se determinÃ³ la composiciÃ³n y la abundancia del zooplancton en los siguientes cuerpos de agua: Embalses Guanapito y Tierra Blanca (Edo. GuÃ¡rico), Lago del CÃ­rculo Militar y Embalse La Mariposa (Distrito Capital), Embalse La Pereza (Edo. Miranda) y Lago de Valencia (Edos. Carabobo y Aragua). AdemÃ¡s, se estandarizÃ³ el mÃ©todo para aislar ADN de zooplancton y mediante la tÃ©cnica de PCR se amplificaron 3 regiones del genoma del cladÃ³cero Diaphanosoma birgeiKorineck, 1981. Las regiones amplificadas forman parte de los genes que codifican para el gen 12S ARN ribosomal del ADN mitocondrial (12S ARNr), el gen de la subunidad I de la citocromo oxidasa C mitocondrial (mtCOI) y el espaciador ribosomal interno transcrito 2 (ITS2). La recolecciÃ³n del zooplancton se realizÃ³ a travÃ©s de un muestreo puntual en cada sistema mediante barridos verticales en el estrato oxigenado con una red de cierre (luz de malla= 77 Âµm). Las muestras se preservaron en formaldehÃ­do al 4% de concentraciÃ³n final y en etanol 99,8% y vivas. La biomasa del fitoplancton se estimÃ³ mediante la determinaciÃ³n de la concentraciÃ³n de clorofila-a. La mayorÃ­a de los cuerpos de agua estuvieron estratificados tÃ©rmicamente durante los muestreos, con temperaturas superficiales superiores a los 26,5 ÂºC. En el Lago de Valencia y los embalses La Pereza y Tierra Blanca se registraron condiciones de hipoxia en los estratos profundos, posiblemente debido a las altas tasas de descomposiciÃ³n de materia orgÃ¡nica. En general, los valores de pH registrados fueron alcalinos. En cuanto a las caracterÃ­sticas biÃ³ticas, el menor valor de la biomasa fitoplanctÃ³nica se registrÃ³ en el embalse Guanapito (0 Âµg/L) y el mayor en el Lago del CÃ­rculo Militar (21,2 Âµg/L). Los embalses Guanapito y La Mariposa presentaron las menores abundancias medias de zooplancton (8 y 16 ind./L, respectivamente). En el Lago de Valencia, por el contrario, se registrÃ³ la mayor abundancia media (131 ind./L), seguido por: embalse Tierra Blanca (81 ind./L), Lago del CÃ­rculo Militar (59 ind./L) y embalse La Pereza (30 ind./L). Los copÃ©podos resultaron ser el grupo dominante, seguidos de los rotÃ­feros y de los cladÃ³ceros. Las abundancias del zooplancton en algunos de los cuerpos de agua estudiados parecieron corresponderse con la biomasa del fitoplancton, la cual representarÃ­a la oferta de alimento para los animales planctÃ³nicos. El gÃ©nero de Cladocera mÃ¡s comÃºn presente en los seis cuerpos de agua bajo estudio fue Diaphanosoma, por lo que cuyos representantes fueron empleados en los anÃ¡lisis genÃ©ticos. En estos, los resultados indicaron que la preservaciÃ³n con etanol fue la mÃ¡s efectiva para la extracciÃ³n del ADN, con posterior hidrataciÃ³n. Se evaluÃ³ la eficiencia de la tÃ©cnica de extracciÃ³n empleando tres mÃ©todos distintos, de los cuales resultÃ³ mÃ¡s eficaz el uso de un estuche comercial, con algunas modificaciones. Los cebadores empleados en las reacciones de amplificaciÃ³n no parecieron ser especÃ­ficos para los genes 12S ARNr, ITS2 y mtCOI codificados por organismos de este gÃ©nero. La inclusiÃ³n de caracteres taxonÃ³micos moleculares es una herramienta Ãºtil para la identificaciÃ³n exacta y confiable de los individuos, y dado que en Venezuela no se han realizado estudios de biologÃ­a molecular con microcrustÃ¡ceos, la estandarizaciÃ³n llevada a cabo en el presente trabajo es pionera en esta Ã¡rea.','2010-05-04','Zooplancton, cuerpos de agua.',1,1,1,1,1,'2013-09-17 08:32:29','2013-09-17 08:32:29','Documento_404.pdf','application/pdf',38762784,'2013-09-17 08:32:29',18,0,140,'COMPLETO'),(403,'MorfologÃ­a del polen del gÃ©nero Abutilon Mill. (Malvaceae) en Venezuela','La palinologÃ­a es la ciencia que estudia el polen y las esporas. La morfologÃ­a del polen posee alto valor diagnÃ³stico por ser un caracter reproductivo y porque sus paredes tienen una composiciÃ³n quÃ­mica que le permiten conservarse por miles de aÃ±os. En taxonomÃ­a, la contribuciÃ³n de la palinologÃ­a se concentra en la exina, ya que Ã©sta incorpora un gran nÃºmero de caracteres diagnÃ³sticos fÃ¡cilmente estudiables, y tambiÃ©n porque los estudios de polen fÃ³sil estÃ¡n hechos con base en el esqueleto de la exina. Para Venezuela los trabajos en morfologÃ­a del polen son numerosos; sin embargo, no se encontraron para la familia Malvaceae Juss. En el presente trabajo se estudiÃ³ la morfologÃ­a del polen del gÃ©nero AbutilonMill. como una contribuciÃ³n a la taxonomÃ­a del grupo. Este gÃ©nero pertenece a la tribu Malveae, familia Malvaceae, con 11 especies en Venezuela, de las cuales A.. burandtiiy A.. cuspidatum son endÃ©micas. Se analizaron 10 muestras de polen provenientes de material de herbario, incluyendo A.. divaricatum (excluida del Nuevo CatÃ¡logo de la Flora de Venezuela) A.. striatum (especie cultivada, pero reportada en la Flora de Ãvila como naturalizada) y Pseudabutilon umbellatum (muy cercana al gÃ©nero). Se midieron, al MO, 30 granos acetolizados por especie (en vista polar y ecuatorial) en la exina, aberturas y espinas; al MEB se detallÃ³ la ornamentaciÃ³n de la exina y las aberturas. Los datos obtenidos se analizaron para evaluar si habÃ­a diferencias estadÃ­sticamente significativas. Como resultado se encontrÃ³ que el polen de Abutilonesgrande, suboblato - oblato-esferoidal, 3-(4)zonocolporado, con anillo; tectado, equinado, imperforado - foveolado, con espinas erectas o torcidas y disco basal. Se determinÃ³ que los caracteres cuantitativos de los granos de polen evaluados, asÃ­ como la forma de estos y la perforaciÃ³n del tectum, son Ãºtiles para la separaciÃ³n de las especies y fueron utilizados en la elaboraciÃ³n de la clave palinolÃ³gica.','2010-04-26','PalinologÃ­a, Abutilon, polen, Malvaceae',1,1,1,1,1,'2013-09-17 08:32:31','2013-09-17 08:32:31','Documento_405.pdf','application/pdf',4022472,'2013-09-17 08:32:31',20,0,0,'INCOMPLETO'),(404,'Modelos de MediciÃ³Ã³nn de Riesgo de CrÃ©Ã©dito en Portafolios','La teorÃ­a de riesgo en seguros es Ãºtil en el Ã¡mbito de los crÃ©ditos, una vez que se muestra la similitud entre un seguro y un crÃ©dito. Las metodologÃ­as elaboradas con esta teorÃ­a parten de un enfoque de portafolio; estas permiten cuantificar elementos importantes como la volatilidad de las probabilidades de incumplimiento, y los efectos que tienen sobre el portafolio la concentraciÃ³n y la diversificaciÃ³n.','2010-01-22','Riesgo, Seguros, Portafolio, CrÃƒÂ©dito, Modelos',5,1,1,1,1,'2013-09-17 08:32:32','2013-09-17 08:32:32','Documento_406.pdf','application/pdf',1977283,'2013-09-17 08:32:32',20,0,100,'COMPLETO'),(405,'SÃÃNNTESIS Y CARACTERIZACIÃ“Ã“NN DE NANOPARTÃÃCCULAS DE RODIO ESTABILIZADAS CON LÃÃQQUIDOS IÃ“Ã“NNICOS..ESTUDIO DE SU ACTIVIDAD CATALÃÃTTICA EN REACCIONES DE HIDROGENACIÃ“Ã“NN DE HIDROCARBUROS INSATURADOS..','RESUMEN..Utilizando el mÃ©todo de reducciÃ³n y desplazamiento de ligandos se evaluÃ³ la influencia que tiene emplear un precursor monometÃ­lico vs un dÃ­mero organometÃ¡lico del metal. En la obtenciÃ³n de nanopartÃ­culas de Rh estabilizadas en diferentes lÃ­quidos iÃ³nicos (LIs). La utilizaciÃ³n de diferentes LIs como agentes estabilizantes de las nanopartÃ­culas metÃ¡licas fue realizada con el fin de comparar el efecto que pudiese tener el tamaÃ±o del catiÃ³n y el tamaÃ±o de la cadena alquÃ­lica de estos lÃ­quidos iÃ³nicos, tanto en la distribuciÃ³n de tamaÃ±o de las nanopartÃ­culas, su estabilidad, asÃ­ como su actividad catalÃ­tica en reacciones de hidrogenaciÃ³n. En tal sentido se sintetizaron los siguientes LIs de hexafluorofosfato: de 1-pentil-3-metil-imidazolio, de 1-dodecil-3-metil- imidazolio, de 1-pentil-4-picolinio y el de 1-dodecil-4-picolinio. La caracterizaciÃ³n de estos LIs se llevÃ³ a cabo mediante espectroscopia de resonancia magnÃ©tica nuclear (1HRMN), espectrometrÃ­a de masas y anÃ¡lisis elemental por ICP-OES.Los precursores organometÃ¡licos [Bis-m-cloro-di-(1,5- ciclooctadieno)]dirodio(I) y 2,4-pentanodiona(1,5-ciclooctadieno)rodio(I) utilizados tambiÃ©n fueron sintetizados como parte de este trabajo y caracterizados por espectroscopÃ­a de infrarrojo con transformada de Fourier.Los ocho sistemas de rodio sintetizados fueron caracterizados mediante:, microscopia electrÃ³nica de transmisiÃ³n de alta resoluciÃ³n (HRTEM), difracciÃ³n de electrones, difracciÃ³n de rayos X (DRX) y anÃ¡lisis elemental por ICP-OES. Estos anÃ¡lisis evidencian que todos los sistemas estÃ¡n compuestos de nanopartÃ­culas de Rh metÃ¡lico, con tamaÃ±os promedios comprendidos entre 1,3 y 6,5nm. Estos sistemas tienen un arreglo cristalogrÃ¡fico cÃºbico centrado en las caras. Los porcentajes de metal obtenidos para cada sistema dependieron del precursor y el LI empleado para su obtenciÃ³n.Con el fin de evaluar la influencia del precursor organometÃ¡lico y del LI utilizado en la actividad catalÃ­tica de estos sistemas, se estudiÃ³ la reactividad de los mismos en las reacciones de hidrogenaciÃ³n de ciclohexeno y benceno. Los resultados obtenidos de este estudio arrojan que los sistemas sintetizados a partir del precursor dimÃ©rico (Rh1-LIn) fueron eficientes a temperatura ambiente, exceptuando al (Rh1-1-dodecil-3-metil-imidazolio), que solo presentÃ³ un 24% de conversiÃ³n a estas condiciones. Al aumentar la temperatura a 80ÂºC todos los sistemas (Rh1- LIn) presentaron 100% de conversiÃ³n a excepciÃ³n del (Rh1-LI2). Sin embargo todos los TOF obtenidos son altos en relaciÃ³n a los reportados en la literatura para la hidrogenaciÃ³n del ciclohexeno en condiciones similares.En la hidrogenaciÃ³n catalÃ­tica del benceno, todos los catalizadores (Rh1-LIn) generaron ciclohexano como Ãºnico producto. El (Rh1-LI3) fue el mejor catalizador presentando una conversiÃ³n cercana al 50% con un TOF de 84h-1 el resto de los sistemas presentaron conversiones bajas en condiciones suaves.Los sistemas sintetizados con el precursor monometÃ¡lico (Rh2-LIn) fueron 100% eficientes en la hidrogenaciÃ³n catalÃ­tica del ciclohexeno a temperatura ambiente.Los sistemas (Rh2-LIn) fueron activos en la hidrogenaciÃ³n catalÃ­tica del benceno. Sin embargo, sÃ³lo el sistema (Rh2-1-dodecil-4-picolinio) presentÃ³ una conversiÃ³n mayor al 60% en la hidrogenaciÃ³n catalÃ­tica del benceno a temperatura ambiente con un TOF de 4509 moles de productos/ mol de metal o h, lo cual es muy superior a los reportes encontrado en la literatura.Se comprueba que mediante el diseÃ±o del LI y la escogencia apropiada del precursor organomÃ©talico se logra optimizar la actividad catalÃ­tica de estos sistema','2010-04-29','SÃ­ntesis y CaracterizaciÃ³n de NanopartÃ­culas, NanopartÃ­culas de Rh, LÃ­quidos IÃ³nicos, HidrogenaciÃ³n de Hidrocarburos Insaturados.',6,1,1,1,1,'2013-09-17 08:32:34','2013-09-17 08:32:34','Documento_407.pdf','application/pdf',7861473,'2013-09-17 08:32:34',20,0,99,'COMPLETO'),(406,'EVALUACIÃ“N DE FORMULACIONES DE DESEMULSIFICANTES PARA EMULSIONES DE AGUA EN CRUDO EXTRAPESADO VENEZOLANO.','Las principales reservas de petrÃ³leo en Venezuela son de crudo pesado y extrapesado, y debido al incremento de demanda de energÃ­a del mundo, Venezuela esta investigando sobre diferentes mÃ©todos de producciÃ³n de este crudo. Uno de los mÃ©todos estudiados es la inyecciÃ³n de vapor de agua, con el fin de disminuir la viscosidad del crudo y mover el mismo a superficie. Sin embargo, este mÃ©todo puede promover la formaciÃ³n de emulsiones estables agua en aceite (emulsiones W/O), las cuales incrementan la viscosidad original del crudo y dificultan el transporte del mismo en superficie. Para tratar de solventar este problema, diferentes formulaciones de surfactantes acuosos son usados para mezclarlos con las emulsiones W/O y producir emulsiones inversas inestables de crudo extrapesado en agua (emulsiones O/W). AdemÃ¡s, este mÃ©todo permite disminuir la viscosidad del crudo y consecuentemente mejorar el transporte del mismo hasta las plantas de tratamientos, donde la emulsiÃ³n es rota y deshidratada. Las formulaciones de surfactantes evaluadas para formar las emulsiones O/W fueron soluciones alcalinas, las cuales activan los surfactantes naturales (SN) presentes en el crudo. Adicionalmente se evaluaron mezclas de Ã¡cidos grasos, mayoritariamente acido oleico y linoleico, con sales de sodio y monoetanolamina. Los resultados muestran la formaciÃ³n de emulsiones mÃºltiples tipo W/O/W, cuando la emulsiÃ³n OW es mezclada con las formulaciones de surfactantes. Sin embargo, la viscosidad de las emulsiones mÃºltiples es similar a la del agua y puede ser fÃ¡cilmente transportada. En orden de romper y deshidratar las emulsiones mÃºltiples fue utilizado el mÃ©todo de calentamiento en sinergia con salmuera durantes varias horas. Los mejores resultados fueron obtenidos cuando las emulsiones mÃºltiples estuvieron en contacto con el quÃ­mico natural de alquil-poliglucÃ³sido extraÃ­do de la planta Aloe Vera. Este alquil- pliglucÃ³sido trabaja como un excelente desemulsificante en sinergia con calentamiento por varias horas desde que el porcentaje de deshidrataciÃ³n fue hasta 98%.','2010-05-04','Emulsiones, Crudo Extrapesado, Formulaciones, Surfactantes Naturales',6,1,1,1,1,'2013-09-17 08:32:36','2013-09-17 08:32:36','Documento_408.pdf','application/pdf',18379307,'2013-09-17 08:32:36',17,0,136,'COMPLETO'),(407,'El CÃ­rculo GuÃ­a de una CÃ­clide.','Una cÃ­clide general es una superficie tubular definida por la envolvente de una familia cuadrÃ¡tica monoparamÃ©trica de esferas en el espacio EuclÃ­deo. Las CÃ­clides generales son las principales primitivas geomÃ©tricas mbox{usadas} en la modelaciÃ³n de estructuras tubulares de radio constante o variable y de conexiÃ³n suave. Estas superficies han sido estudiadas por importantes geÃ³metras en el Ã¡rea de C.A.G.D (Computer Aided Geometric Design) durante los Ãºltimos 20 aÃ±os, cabe destacar a W. Boehm, Pottman, Larry Schumaker, entre otros. Diversos modelos matemÃ¡ticos se emplean en el estudio de las cÃ­clides, por ejemplo: el modelo propuesto por Dan Pedoe, el modelo de MoebiÃ¼s y el modelo de Laguerre. En este trabajo se emplea el modelo propuesto por Dan Pedoe el cual establece una correspondencia biyectiva entre puntos que yacen en el exterior de una cuÃ¡drica $varphi subset,R^4,$ que denotaremos por $varphi^+$ y esferas y/ o puntos en el espacio 3D. A partir de esta correspondencia se establece tambiÃ©n una correspondencia entre rectas que yacen en $varphi^+$ con cÃ­rculos en 3D.\\ Al considerar una cÃ³nica de BÃ©zier $b(t)subsetvarphi^+,$ se obtiene una familia cuadrÃ¡tica monoparamÃ©trica de esferas en $R^3$ y la superficie envolvente de dicha familia serÃ¡ la cÃ­clide asociada a la cÃ³nica $b.$ Las rectas tangentes a $b$ se corresponden a las secciones circulares de la envolvente, las cuales serÃ¡n de gran ayuda para el despliegue de su grÃ¡fico sin hacer uso su ecuaciÃ³n implÃ­cita. \\ Independientemente del modelo usado para construir una cÃ­clide, esta superficie tiene asociado un cÃ­rculo muy especial denominado 	extit{cÃ­rculo guÃ­a,} ver [3], el cual aparece por la propiedad de ortogonalidad entre las esferas, $mbox{ver [1].}$ Es nuestro interÃ©s estudiar este cÃ­rculo y su relaciÃ³n con la forma de la cÃ­clide. Para ello, se llevÃ³ a cabo el diseÃ±o de una interfaz grÃ¡fica con el software MATLAB 2008 que permite la visualizaciÃ³n de los resultados.\\ El manuscrito estÃ¡ estructurado de la siguiente forma: En el CapÃ­tulo 1, se comienza con la definiciÃ³n de los polinomios de Bernstein y el estudio de algunas propiedades importantes de estos; A partir de estos polinomios se definen unas curvas muy importantes en la modelaciÃ³n geomÃ©trica que se denominan curvas de BÃ©zier, estudiandose alguna de sus propiedades mÃ¡s importantes como por ejemplo la interpolaciÃ³n y la tangencia. Luego, se describe un algoritmo muy eficiente para el despliegue de estas curvas conocido como Algoritmo de de Casteljau. Por Ãºltimo se define superficie envolvente. En el CapÃ­tulo 2, se describe el modelo de Dan Pedoe, extendiendo la idea original a una dimensiÃ³n mayor, estableciendo una correspondencia biyectiva entre puntos de $R^4$ que yacen en el exterior de una cuadrica muy particular ($varphi$) y esferas y/o puntos de $R^3.$ A partir de esta correspondencia se establece tambiÃ©n una correspondencia entre rectas de $R^4$ que no cortan a $varphi$ y cÃ­rculos en 3D. En el CapÃ­tulo 3, se introduce la definiciÃ³n de cÃ­clide general, como la superficie envolvente de una familia monoparamÃ©trica de esferas en 3D. En este trabajo una cÃ­clide se define como la envolvente de una familia monoparamÃ©trica de esferas generada por una cÃ³nica de BÃ©zier $b(t)subsetvarphi^+.$ Por Ãºltimo se define el cÃ­rculo guÃ­a asociado a una cÃ­clide el cual se corresponde con la recta conjugada del 2-plano que contiene a la cÃ³nica $b(t)subset R^4$ y se estudian algunas propiedades interesantes que relacionan este cÃ­rculo con la cÃ­clide.','2010-06-28','Ciclide general, recta conjugada, armonicos conjugados, modelo de pedoe.',5,1,1,1,1,'2013-09-17 08:33:07','2013-09-17 08:33:07','Documento_409.pdf','application/pdf',899938,'2013-09-17 08:33:07',20,0,73,'COMPLETO'),(408,'Desarrollo de una aplicaciÃ³n para procesar y organizar oficios digitalizados de modificaciÃ³n y apertura de materias de la DivisiÃ³n de Control de Estudios de la Facultad de Ciencias de la Universidad Central de Venezuela.','El objetivo del presente Trabajo Especial de Grado consiste en el desarrollo de un sistema que automatice el proceso de digitalizaciÃ³n de oficios de aperturas y modificaciones de materias de la Facultad de Ciencias de la Universidad Central de Venezuela, que han sido almacenados en las instalaciones de la DivisiÃ³n de Control de Estudios, especÃ­ficamente un archivo ubicado en la oficina de la directora de dicha divisiÃ³n. El sistema estÃ¡ dividido en dos partes, donde se tiene una aplicaciÃ³n local encargada de empaquetar y enviar las imÃ¡genes al servidor, y en segundo lugar se tiene una aplicaciÃ³n Web encargada del procesamiento de los oficios. Para cumplir con los objetivos de la aplicaciÃ³n se utilizÃ³ la metodologÃ­a Ã¡gil XP (ProgramaciÃ³n Extrema), la cual se basa fundamentalmente, en la construcciÃ³n progresiva del software sin hacer Ã©nfasis en etapas de diseÃ±os.','2010-06-28','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:33:10','2013-09-17 08:33:10','Documento_410.pdf','application/pdf',2470879,'2013-09-17 08:33:10',20,0,176,'COMPLETO'),(409,'Estudio de Ecuaciones Duferenciales Utilizando MÃ©todos GeomÃ©tricos','Explicamos el mÃ©todo de simetrÃ­as de Lie y el de la caracterÃ­stica de Cartan- Monge para resolver ecuaciones diferenciales y por Ãºltimo formulamos el formalismo de fibrados de Jets para ecuaciones diferenciales, sus soluciones y los mÃ©todos nombrados anteriormente.','2010-07-06','Ecuaciones diferenciales y GeometrÃ­a',5,1,1,1,1,'2013-09-17 08:33:13','2013-09-17 08:33:13','Documento_411.pdf','application/pdf',12922282,'2013-09-17 08:33:13',20,0,127,'COMPLETO'),(410,'PROCESAMIENTO E INVERSIÃ“Ã“NN GRAVIMÃ‰Ã‰TTRICA EN LA REGION DEL SUR DEL LAGO DE MARACAIBO','El Uranio en el mundo entero se estÃ¡ considerando cada vez mÃ¡s, como una fuente de energÃ­a limpia y confiable. Alrededor del 30% de los recursos de Uranio en el mundo constan de depÃ³sitos de Uranio en areniscas y corresponden al segundo tipo de depÃ³sitos de Uranio mÃ¡s importante (International Atomic Energy Agency, 3003). Este tipo de depÃ³sitos se forma cuando el agua oxidante subterrÃ¡nea (que contiene Uranio diluido U6+) se mueve a travÃ©s de una unidad de areniscas permeables y encuentra un agente reductor tal como materia orgÃ¡nica o pirita, donde el Uranio es precipitado en su estado tetravalente U4+. La reducciÃ³n es causada principalmente por el H2S que se genera de la materia orgÃ¡nica en descomposiciÃ³n, o por la introducciÃ³n de gases o fluidos reductores (H2S, hidrocarburos o ambos) a travÃ©s de estructuras geolÃ³gicas favorables (Spirakis, 1996). Con la finalidad de encontrar fuentes alternativas de energÃ­a en Venezuela, a partir de los aÃ±os 70 en todo el territorio nacional se llevaron a cabo diversos estudios geoquÃ­micos, sobre muestras de rocas, agua y sedimentos, asÃ­ como estudios geolÃ³gicos donde se evalÃºa la potencialidad de distintos ambientes como Ã¡reas favorables para la mineralizaciÃ³n de Uranio (Audemar, 1977; Escola, 1977; Lo Monaco, 1985; Pasquali, 1974, 1977, 1981; Perez & Sifontes, 1985; Sifontes et al., 1982, 1985; Yanes et al., 1985). Los resultados de estos estudios muestran que en Venezuela existen tres Ã¡reas donde potencialmente puedan existir yacimientos de Uranio: La discordancia de la base del Grupo Roraima en el Escudo de Guayana, la discordancia de rocas mÃ¡s jÃ³venes supreyacentes al Escudo de Guayana, al sur de la Cuenca Oriental de Venezuela y las areniscas, lodositas y fosforitas del Miembro Quevedo de la FormaciÃ³n Navay en el Edo. TÃ¡chira. Existe otra zona en Venezuela donde potencialmente puedan existir yacimientos de Uranio, ubicada al norte de los Andes venezolanos, al sur del Lago de Maracaibo, donde se plantea la hipÃ³tesis de encontrar depÃ³sitos de Uranio en areniscas de tipo \"Roll Front\" (Pinero y Tosiani, comunicaciÃ³n personal). En este modelo, el Uranio diluido que proviene de los Andes (de los granitos que forman parte de las asociaciones Los Torres y Bella Vista y el complejo Iglesias), es incorporado en las aguas superficiales y subterrÃ¡neas del flanco norte de los Andes, que gradualmente percolan hacia las zonas bajas del pie de monte, hasta encontrar agentes reductores o iones precipitantes, los cuales fijan el Uranio, generando el yacimiento. Con la finalidad de identificar de forma regional paleo canales, acuÃ­feros, fallas y altos estructurales, que pudieran estar asociados directamente con el transporte de gases y fluidos reductores, asÃ­ como del propio Uranio, se lleva a cabo un estudio gravimÃ©trico, en el cual se reprocesa y analiza un conjunto de datos ubicados al sur del lago de Maracaibo en el piedemonte norte de los Andes, que pertenecen a PDVSA-INTEVEP. Esta base de datos contiene valores de anomalÃ­as de Bouguer simple, calculados a partir de una densidad de 2,67g/cm3, con su respectiva ubicaciÃ³n espacial y altura. A cada estaciÃ³n se le calcula la correcciÃ³n topogrÃ¡fica para obtener valores de anomalÃ­a de Bouguer completa, que varÃ­an de los -156mGal hasta los 4,04mGal. Los mÃ¡ximos valores de anomalÃ­a se encuentran sobre los Andes, mientras que los mÃ­nimos se encuentran en el piedemonte norte de los Andes, en una franja de direcciÃ³n sur-oeste nor-este, que corresponden con la raÃ­z de los Andes de MÃ©rida.Se calcula y analiza el espectro de potencias del mapa de anomalÃ­a de Bouguer completa, para luego aplicarle distintos filtros y asÃ­ obtener la separaciÃ³n regional-residual. Se calculan ademÃ¡s, las derivadas direccionales y las soluciones de Euler al mapa de la anomalÃ­a de Bouguer y a los mapas de sus componentes residual y regional. Dichos mapas (especialmente los de la componente residual) realzan ciertos rasgos que ubican estructuras geolÃ³gicas como fallas, paleocanales, altos estructurales, entre otras, que no se observan a simple vista sobre el mapa de anomalÃ­a de Bouguer. De esta manera se localizaron numerosas fallas, la mayorÃ­a de direcciÃ³n nor-oeste sur-este que se encuentran en el piedemonte norte de los Andes, cercanas a los mÃ¡rgenes del lago de Maracaibo.Adicionalmente se trazan dos perfiles sobre el mapa de la anomalÃ­a de Bouguer y su componente residual, uno de direcciÃ³n nor-oeste sur-este, perpendicular a los andes y otro paralelo a los Andes, de direcciÃ³n nor-este sur-oeste que corta perpendicularmente al primer perfil. Sobre estos perfiles se obtienen modelos bidimensionales del subsuelo, en los cuales se muestran un conjunto de fallas inversas que involucran basamento y sedimentos del CretÃ¡cico y Mioceno/Eoceno. Algunas de estas fallas forman parte del frente de deformaciÃ³n que dio origen a los Andes, otras simplemente son el producto de diferentes procesos compresionales de direcciÃ³n nor-oeste sur-este que ocurrieron al norte de los Andes cerca de los mÃ¡rgenes con el lago de Maracaibo. Estas fallas resultan ser estructuras que potencialmente pudieran favorecer a la depositaciÃ³n de Uranio.','2010-09-10','Uranio, MÃ©todos GravimÃ©tricos, anÃ¡lisis espectral, InversiÃ³n 2D',3,1,1,1,1,'2013-09-17 08:33:15','2013-09-17 08:33:15','Documento_412.pdf','application/pdf',2180799,'2013-09-17 08:33:15',20,0,82,'COMPLETO'),(411,'AnÃ¡Ã¡lisis numÃ©Ã©rico del efecto de la AnisotropÃ­Ã­a de Superficie en NanopartÃ­Ã­culas FerromagnÃ©Ã©ticas','En este trabajo hacemos un estudio numÃ©rico de los efectos de la anisotropÃ­a superficial en cantidades termodinÃ¡micas de nanopartÃ­culas ferromagnÃ©ticas cÃºbicas, representadas mediante un modelo mixto de Ising de espines S==00,, Â±Â±11. Se consideran interacciones de intercambio a primeros vecinos entre los espines, asÃ­ como los efectos producidos por la anisotropÃ­a de superficie, KS, y de volumen ,KV. Variamos el tamaÃ±o de los nanocubos desde un L00==44 espines por aristas, donde la relaciÃ³n superficie-volumen es mayor a uno S//V>>11, hasta Lmax==2200espines con S//V~~==00..44, incluyendo un tamaÃ±o intermedio Lu==1100 espines, cuya relaciÃ³n SS//V~~==11. Usando el mÃ©todo de Monte Carlo se generan configuraciones de importancia, para calcular la energÃ­a por sitio, magnetizaciÃ³n, calor especÃ­fico y susceptibilidad magnÃ©tica. Hemos logrado reproducir con este modelo sencillo, muchos de los comportamientos obtenidos por otros autores con el modelo de Heisenberg. En el caso de la nanopartÃ­cula de menor tamaÃ±o, encontramos cambios importantes en el comportamiento de las cantidades termodinÃ¡micas estudiadas. Encontramos anomalÃ­as en las curvas de magnetizaciÃ³n y susceptibilidad magnÃ©tica caracterÃ­sticas de sistemas nanoscÃ³picos, las cuales se atribuyen al bajo nÃºmero de coordinaciÃ³n y la falta de compensaciÃ³n de los espines de superficie. AsÃ­ mismo, mostramos que el ordenamiento ferromagnÃ©tico o paramagnÃ©tico del sistema depende del la relaciÃ³n entre entre la anisotropÃ­a superficial y la interacciÃ³n de intercambio. Encontramos que en el rango donde KS<<--Jnn se observan cambios en la temperatura crÃ­tica (TC) del sistema, mientras que para KS>>--Jnn, TC aumenta de manera no lineal.','2010-07-19','NanopartÃ­culas FerromagnÃ©ticas, Monte Carlo, AnisotropÃ­a de superficie.',3,1,1,1,1,'2013-09-17 08:33:16','2013-09-17 08:33:16','Documento_413.pdf','application/pdf',0,'2013-09-17 08:33:16',19,0,0,'INCOMPLETO'),(412,'AnÃ¡lisis e ImplementaciÃ³nn de un Esquema BÃ¡sico de Seguridad Usando Software Libre','Actualmente las redes de Ã¡rea local son tan habituales que casi no hay oficina que no la posea; incluso gran parte de hogares la tienen. La mayorÃ­a de estas redes estÃ¡n conectadas a Internet, hecho que las hace vulnerables a los peligros latentes en el Internet, por ese motivo es necesario proporcionar a estas redes algÃºn nivel de seguridad. En este trabajo se analizaron en forma detallada cada una de las recomendaciones propuestas por el documento ISO/IEC 27002; con el objeto de buscar un esquema bÃ¡sico de seguridad para las redes de Ã¡rea local y proponer un conjunto mÃ­nimo de recomendaciones al respecto, asÃ­ como tambiÃ©n su implementaciÃ³n usando software libre. El esquema bÃ¡sico de seguridad encontrado estÃ¡ compuesto por un conjunto mÃ­nimo de recomendaciones (clÃ¡usulas) cuyo cumplimiento proporciona un nivel de seguridad aceptable en redes no crÃ­ticas; es decir en redes de organizaciones con pocos enemigos potenciales, redes que no pertenecen a grupos de espionaje, ni agencias de investigaciÃ³n, ni centros de seguridad gubernamental, ni bancos, ni otras organizaciones del estilo. Adicionalmente, se recomienda abaratar costos de implementaciÃ³n, incrementar la independencia y mantenerse actualizado. Para lograrlo se propone usar software libre, el cual con costos bajos y alta confiabilidad permite implementar el conjunto mÃ­nimo de recomendaciones extraÃ­do del documento ISO/IEC 27002.Las recomendaciones del esquema bÃ¡sico propuesto se implementaron en un caso de estudio, usando herramientas de software libre, demostrando asÃ­ la efectividad de la propuesta.','2010-06-15','Internet,, intranet,, seguridad,, software libre,, ISO//IEC 2277000022..',2,1,1,1,1,'2013-09-17 08:33:17','2013-09-17 08:33:17','Documento_414.pdf','application/pdf',1000395,'2013-09-17 08:33:17',16,0,57,'COMPLETO'),(413,'Modelaje FÃ­Ã­sico--MatemÃ¡Ã¡tico del transporte del iÃ³Ã³nn Ca22++ en el citosol de cÃ©Ã©lulas de mÃºÃºssculo liso vascular mediante el uso de una ecuaciÃ³Ã³nn de difusiÃ³Ã³nn--reacciÃ³Ã³nn','Se sabe con precisiÃ³n que la contracciÃ³n de las cÃ©lulas musculares lisas, al igual que en las cÃ©lulas de mÃºsculo estriado, estÃ¡ regulada por un aumento de la concentraciÃ³n del iÃ³n Ca2+ en el citosol, aunque en la actualidad no se conocen exactamente los mecanismos de liberaciÃ³n de calcio en el mÃºsculo liso.En este trabajo se ha construido un modelo fÃ­sico-matemÃ¡tico unidimensional que representa a una cÃ©lula de mÃºsculo liso, mediante el uso del paquete computacional COMSOL Multiphysics 3.4Ã¢ (basado en el mÃ©todo numÃ©rico de elementos finitos) el cual resuelve numÃ©ricamente una ecuaciÃ³n de difusiÃ³n- reacciÃ³n (ecuaciÃ³n en derivadas parciales) obtenida a partir de la descripciÃ³n de la dinÃ¡mica del iÃ³n Ca2+ en el citosol de la cÃ©lula muscular lisa. Se diseÃ±aron experimentos computacionales \"in silico\" de difusiÃ³n-reacciÃ³n para el disparo de 1, 2 y 3 canales de rianodina (RyR) y la acciÃ³n de Jserca, (acciÃ³n de la bomba ATP-Ã¡sica del retÃ­culo sarcoplÃ¡smico) donde se analizÃ³ el comportamiento de la concentraciÃ³n citosÃ³lica de Ca2+ (sparks) en funciÃ³n del tiempo para distintos puntos del dominio y diferentes tiempos de disparos. Se determinÃ³ que sÃ³lo la acciÃ³n de Jserca(modelada por la fÃ³rmula de Michaelis- Menten) no garantiza el regreso de la concentraciÃ³n al nivel basal durante la relajaciÃ³n, razÃ³n por la cual se considerÃ³ la acciÃ³n de una segunda reacciÃ³n llamada Jfuga(la acciÃ³n simultÃ¡nea de ambas simula el efecto del fosfolambano sobre Jserca). TambiÃ©n se demostrÃ³ que la difusiÃ³n del Ca2+ sin considerar la acciÃ³n de los buffer alcanza su estado estacionario cerca de 50 veces mÃ¡s rÃ¡pido que cuando se considera la acciÃ³n del buffer Calmodulina (CaM). Como consecuencia de la liberaciÃ³n impulsiva de Ca2+ su concentraciÃ³n mÃ¡xima en el citosol es diecisiete (17) veces mayor que la basal. Los cambios transitorios de concentraciÃ³n en puntos cerca del lugar de la liberaciÃ³n ocurren diez (10) veces mÃ¡s rÃ¡pido que los cambios transitorios en puntos localizados cerca de los extremos del dominio. Se observaron oscilaciones en la concentraciÃ³n del iÃ³n Ca2+ en puntos del dominio cuando se disparan mÃ¡s de 1 canal de RyR. Los tiempos obtenidos para alcanzar el estado estacionario (relajaciÃ³n) estÃ¡n acorde con los descritos en la literatura para una cÃ©lula de musculo liso. Estos experimentos \"in silico\" representan una aproximaciÃ³n a la comprensiÃ³n de los mecanismos locales que operan en la difusiÃ³n citosÃ³lica del iÃ³n calcio cuando se consideran liberaciones a travÃ©s de pocos canales de RyR.','2010-09-09','MÃºsculo liso, IÃ³n calcio, DifusiÃ³n-reacciÃ³n, Comsol 3.4Ã¢, Elemento finito',3,1,1,1,1,'2013-09-17 08:33:20','2013-09-17 08:33:20','Documento_415.pdf','application/pdf',3742947,'2013-09-17 08:33:20',20,0,102,'COMPLETO'),(414,'DESARROLLO DE UN SISTEMA DE INFORMACIÃ“N COLABORATIVO PARA EL CONTROL DE VISITAS MÃ‰DICAS','En este Trabajo Especial de Grado se presenta el desarrollo de un Sistema de InformaciÃ³n Colaborativo para facilitar el control y la administraciÃ³n de la informaciÃ³n de organizaciones de mercadeo de productos farmacÃ©uticos. Para el desarrollo del mismo se utilizan diversas tecnologÃ­as de programaciÃ³n, organizadas en el modelo multi-capa, entre las que podemos nombrar: PHP Hypertext Processor y su librerÃ­a de funcionalidades Zend Framework para la capa lÃ³gica de negocio, Base de Datos MySql para la capa de persistencia de datos y JavaScript y su librerÃ­a de funcionalidades Jquery. La arquitectura que se utiliza para construir el Sistema de InformaciÃ³n es la llamada Modelo Vista Controlador. Todo el desarrollo se apoya en la metodologÃ­a de desarrollo Scrum tomando las historias de usuario de la ProgramaciÃ³n Extrema (XP). Con el desarrollo de este Sistema, se logra la disminuciÃ³n de los tiempos de respuesta en las operaciones de la empresa, asÃ­ como la automatizaciÃ³n de diversas tareas, el control de las actividades y centralizaciÃ³n de la informaciÃ³n.','2010-06-11','Sistemas de InformaciÃƒÂ³n, aplicaciones de trabajo colaborativo, Control de visitas, controles de eventos, Lenguajes de ProgramaciÃƒÂ³n, Servidor Web, Base de Datos, ProgramaciÃƒÂ³n Extrema, Scrum, MySql, PHP, Zend Framework, Jquery, JavaScript, AJAX, CS',2,1,1,1,1,'2013-09-17 08:33:21','2013-09-17 08:33:21','Documento_416.pdf','application/pdf',1744030,'2013-09-17 08:33:21',20,0,79,'COMPLETO'),(415,'REGISTRO Y ANÃLISIS DE LA VARIABILIDAD DEL RITMO CARDÃACO EN EMBRIONES DE POLLO CON CORTO PERIODO DE GESTACIÃ“N','Los estudios sobre el sistema cardiovascular de las aves se han visto fortalecidos con la aplicaciÃ³n de registros en seÃ±ales cardÃ­acas. En el presente trabajo se utilizÃ³ tres registros definido como: Electrocardiograma (ECG) y Acustocardiograma (ACG) y uno Ã“ptico, reforzado con su respectivo anÃ¡lisis en las seÃ±ales cardÃ­acas obtenidas de los embriones de pollo con 8, 9, 14 y 15 dÃ­as de gestaciÃ³n. A fines de aplicar las tÃ©cnicas de anÃ¡lisis de la variabilidad de la frecuencia cardÃ­aca (VFC). Los resultados mostraron un aumento en la Frecuencia CardÃ­aca Promedio (FCP), calculada en pulsaciones por minutos (lat/min), a travÃ©s de la mediciÃ³n en los intervalos entre los puntos mÃ¡ximos del registro del ECG. Este aumento estÃ¡ vinculado a los cambios que van ocurriendo en la formaciÃ³n del embriÃ³n, el rango obtenido de FCP esta entre 196-243 latidos por minuto. El tacograma fue mostrado en funciÃ³n del tiempo y los Ã­ndices de VFC son determinados encontrÃ¡ndose algunas diferencias entre las diferentes edades del embriÃ³n. Por otra, la densidad espectral del registro ECG presenta diferentes picos correspondientes a la FCP con sus armÃ³nicos, para obtener frecuencias bajas (LF) alrededor de 0,2 - 0,72 Hz y frecuencias altas (HF) entre 1,9 - 2,5Hz. Con respecto al Acustocardiograma la FCP esta en el rango de 169-192 latidos por minuto sÃ³lo para embriones de 8 y 9 dÃ­as de gestaciÃ³n. Con respecto a los Ã­ndices VFC existen algunas diferencias al comparar el ACG con el ECG. Con todo esto se demostrÃ³ que puede ser claramente analizada el modelo cardÃ­aco del embriÃ³n de pollo en corto perÃ­odo de gestaciÃ³n, fortalecido con los mÃ©todos de registros como el ACG y ECG. Y por Ãºltimo, se aplicÃ³ un registro Ã³ptico el cual no arrojÃ³ ningÃºn resultado satisfactorio ya que no se conto con los aparatos Ã³pticos necesarios.','2010-09-08','EmbriÃƒÂ³n de pollo- electrocardiograma-acustocardiograma-variabilidad de la frecuencia cardÃƒÂ­aca-desarrollo embrionario.',3,1,1,1,1,'2013-09-17 08:33:23','2013-09-17 08:33:23','Documento_417.pdf','application/pdf',4692447,'2013-09-17 08:33:23',18,0,124,'COMPLETO'),(416,'CARACTERIZACIÃ“N DE UNA COMUNIDAD MICROBIANA EN SUELOS AFECTADOS POR LA ACTIVIDAD PETROLERA EN EL ÃREA DE INFLUENCIA DE LA FOSA BARED-9, UBICADA EN EL EDO. ANZOÃTEGUI.','En Venezuela existen unas 12.000 fosas petroleras, donde se han almacenado por dÃ©cadas desechos de las actividades de explotaciÃ³n y producciÃ³n de hidrocarburos. El presente estudio se realizÃ³ en la fosa Bared-9, ubicada geogrÃ¡ficamente a una latitud 8Âº 55Â´46,2Â¨ N y longitud 64Âº 7Â´44,8Â¨ W (coordenadas UTM 948033 N 379742 E), en el Distrito San TomÃ©, Estado AnzoÃ¡tegui -Venezuela. Considerando el papel que juegan los microorganismos en el ciclaje de nutrientes y su potencial para ser utilizados en recuperaciÃ³n de Ã¡reas impactadas por la actividad petrolera, se caracterizÃ³ la comunidad microbiana (bacteriana y fÃºngica) en el Ã¡rea de influencia de esta fosa. Para la toma de muestras se levantaron transectas en 3 puntos diferentes alrededor de la fosa y en cada una de estas se ubicaron 3 parcelas de dimensiones: 10 m x 5 m. que representaban Ã¡reas con diferente grado de impacto (desde el borde hasta Ã¡reas alejadas de la fosa), de cada parcela se tomaron 4 submuestras de suelo, con las cuales se formÃ³ una muestra compuesta. Los anÃ¡lisis microbiolÃ³gicos incluyeron: aislamiento de cepas bacterianas y fÃºngicas cultivables, caracterizaciÃ³n macro, micromorfolÃ³gica y bioquÃ­mica. En las tres parcelas estudiadas predominaron bacterias Gram positivas y en las poblaciones fÃºngicas fueron las levaduras las que se expresaron en mayor proporciÃ³n, en el caso de los hongos filamentosos solo se aislaron en las segundas y terceras parcelas. Las comunidades microbianas no mostraron diferencias en su estructura funcional a lo largo del gradiente estudiado, revelando un gran porcentaje de cepas con actividad degradativa frente a sustratos simples (glucosa y lactosa) y complejos, como: celulosa, lignina, pectina, quitina, baja capacidad para desdoblar urea y gran actividad lipolÃ­tica, infiriendo la capacidad de estas comunidades microbianas para degradar productos derivados del petrÃ³leo, utilizÃ¡ndolos como fuente de carbono y energÃ­a. Con los resultados del espectro bioquÃ­mico y aplicando anÃ¡lisis multivariado de clÃºster se determinÃ³ la estructura funcional de la comunidad microbiana, permitiendo evidenciar que las poblaciones fÃºngicas eran mÃ¡s diversas funcionalmente que las poblaciones bacterianas. En los anÃ¡lisis de clÃºster que integraban ambas poblaciones se formaron Grupos de Identidad Funcional (GIF), infiriendo que en la degradaciÃ³n de diferentes sustratos participan ambas poblaciones de microorganismos, lo cual evidencia que cepas taxonÃ³micamente diferentes, presentan equivalencias funcionales en el ecosistema. El espectro bioquÃ­mico mostrado por las comunidades microbianas revela un gran potencial para ser utilizadas en procesos de biorremediaciÃ³n.','2010-06-22','Fosa Bared-9, Hongos, Bacterias, caracterizaciÃƒÂ³n bioquÃƒÂ­mica, caracterizaciÃƒÂ³n funcional',1,1,1,1,1,'2013-09-17 08:33:24','2013-09-17 08:33:24','Documento_418.pdf','application/pdf',2485989,'2013-09-17 08:33:24',18,0,156,'COMPLETO'),(417,'Esquemas de sincronizaciÃ³n en autÃ³matas celulares','En este trabajo se estudian esquemas de sincronizaciÃ³n estocÃ¡stica yse desarrolla un esquema de sincronizaciÃ³n determinista aplicable a autÃ³mataselementales caÃ³ticos y de comportamiento complejo. Para el desarrollo de esteesquema, se utilizÃ³ una de niciÃ³n del Jacobiano Booleano para construir unafunciÃ³n de acople, con la cual se logra sincronizar dos sistemas perturbandoun conjunto pequeÃ±o de sitios.','2010-07-13','Automatas, caos, sincronizacion',3,1,1,1,1,'2013-09-17 08:33:26','2013-09-17 08:33:26','Documento_419.pdf','application/pdf',1673443,'2013-09-17 08:33:26',20,0,107,'COMPLETO'),(418,'\"\"EvaluaciÃ³Ã³nn de los niveles de mercurio total y mercurio orgÃ¡Ã¡nico en muestras de suelos procedentes de Instituciones Educativas del pueblo \"\"El Callao\"\",, Estado BolÃ­Ã­var,, Venezuela..\"\"','El presente trabajo de investigaciÃ³n, tuvo como finalidad evaluar los niveles de mercurio total y mercurio orgÃ¡nico en los suelos de las Instituciones Educativas ubicadas en el pueblo El Callao. La tÃ©cnica empleada fue la espectrometrÃ­a de fluorescencia atÃ³mica con vapor frÃ­o (CV-AFS), que posee una alta sensibilidad para el estudio de mercurio. Entre los meses de Febrero y Marzo del aÃ±o 2010, se recogieron un total de 43 muestras, a una profundidad de 15 cm aproximadamente. Para la determinaciÃ³n de mercurio total se empleÃ³ una soluciÃ³n de agua regia y posteriormente se le agregÃ³ permanganato de potasio y perÃ³xido de hidrÃ³geno para garantizar que todas las especies de mercurio estuvieran bajo la forma de iÃ³n mercÃºrico (Hg2+). Una vez medidas en el equipo, las concentraciones obtenidas estuvieron en un rango de (77 - 740) mg Hg / Kg suelo seco, las cuales superan los valores mÃ¡ximos permitidos por el Programa de las Naciones Unidas para el Medio Ambiente (PNUMA), (70 - 300) mg Hg / Kg suelo. Por otro lado, se extrajo mercurio inorgÃ¡nico empleando una soluciÃ³n de sulfato de cobre (II) y bromuro de potasio y al medirlas en el equipo se obtuvo concentraciones entre (52 - 555) mg Hg / Kg suelo. Por diferencia entre el mercurio total e inorgÃ¡nico, se obtuvieron las concentraciones del mercurio orgÃ¡nico, en un rango de (20 - 255) mg Hg / Kg suelo. Estos valores fueron bajos quizÃ¡s por la poca humedad de los suelos y la baja presencia de bacterias anaerÃ³bicas, las cuales son las responsables de la formaciÃ³n del enlace mercurio - carbono. Se concluye que las altas concentraciones de mercurio en los suelos de las escuelas fueron quizÃ¡s debido a la presencia de molinos y minas en sus alrededores y a la existencia de mayores especies de azufre, materia orgÃ¡nica y arcillas, que conforman la capa superficial de los suelos y que retienen las especies de mercurio.','2010-07-12','mercurio, suelos, vapor frÃ­o',6,1,1,1,1,'2013-09-17 08:33:27','2013-09-17 08:33:27','Documento_420.pdf','application/pdf',1313484,'2013-09-17 08:33:27',20,0,94,'COMPLETO'),(419,'Dieta de las especies y composiciÃ³Ã³nn de la comunidad de murciÃ©Ã©lagos en el bosque ribereÃ±Ã±oo del Bloque de ProducciÃ³Ã³nn PetrocedeÃ±Ã±oo--PDVSA,, en el sector sur--oriental del estado AnzoÃ¡Ã¡tegui\"\"..',' Con este trabajo se pretende conocer la composiciÃ³n y estructura de una comunidad de murciÃ©lagos ubicada al suroeste del estado AnzoÃ¡tegui, en la Faja PetrolÃ­fera del Orinoco. El Ã¡rea de estudio se encuentra dentro de las inmediaciones del Bloque de ProducciÃ³n PDVSA-PetrocedeÃ±o, y los muestreos se realizaron en el bosque ribereÃ±o que bordea los rÃ­os Cangilones, Negro y Claro. La identificaciÃ³n de algunas especies y el anÃ¡lisis de las muestras fecales para el estudio de la composiciÃ³n de la dieta se llevaron a cabo en la EstaciÃ³n BiolÃ³gica PDVSA- PetrocedeÃ±o (8Âº 49\' 47,6\"N, 64Âº 42`55,7\"W). Los muestreos se realizaron en la Ã©poca de sequÃ­a y durante 6 dÃ­as consecutivos en el bosque ribereÃ±o en RÃ­o Cangilones en febrero, en la localidad de RÃ­o Negro en el mes de marzo y en el bosque de RÃ­o Claro en abril del 2009. Se utilizaron tres mallas de neblina de 6, 12 y 20 metros de largo y 2,5 metros de altura como tÃ©cnica de captura durante 4 horas (18:00-22:00 horas), colocadas a nivel del sotobosque durante la fase de luna nueva. Se realizÃ³ la identificaciÃ³n taxonÃ³mica de las especies capturadas, se tomaron las medidas corporales, el sexo, la edad, el estado reproductivo y el peso. Algunos individuos se sacrificaron para obtener una muestra representativa de la quiropterofauna del Ã¡rea de estudio, mientras que el resto fue identificado y marcado antes de su liberaciÃ³n, depilando parte del pelaje dorsal. TambiÃ©n se recolectaron las heces fecales y estÃ³magos de algunos individuos para el anÃ¡lisis de la composiciÃ³n de la dieta de cada especie. En total se colectaron y se registraron 323 individuos de 28 especies pertenecientes a 5 Familias y 9 Subfamilias. La Familia Phyllostomidae fue la mejor representada en cuanto a abundancia (94,70%) y a la diversidad (18 especies), le siguen las Familias Emballonuridae (2,20%, 4 especies), Vespertilionidae (1,50%, 3 especies), Noctilionidae (1,30%, 2 especies) y Molossidae (0,31%, 1 especie). Las especies mÃ¡s comunes fueron Carollia perspicillata (27,20%), Trachops cirrhosus (15,80%), Glossophaga longirostris (14,20%), Carollia brevicauda(9,09%), Desmodus rotundus (5,30%) ySturnira lilium (4,70%) Se registraron los siguientes 10 gremios trÃ³ficos en el bosque ribereÃ±o del Bloque de ProducciÃ³n PDVSA-PetrocedeÃ±o: insectÃ­voro aÃ©reo sobre el dosel (IASD), piscÃ­voro insectÃ­voro (PIIN), insectÃ­voro de follaje (INFO), insectÃ­voro aÃ©reo de bajo dosel (IABD) insectÃ­voro carnÃ­voro (INCA), omnÃ­voro (OMNI), nectarÃ­voro-omnÃ­voro (NEOM) frugÃ­voro de sotobosque (FRSO), frugÃ­voro de dosel (FRSO) y HematÃ³fago (HEMA). Los gremios representados con un mayor nÃºmero de especies tanto en el Ã¡rea de estudio como en las 3 localidades estudiadas fueron el de los insectÃ­voros seguidos por frugÃ­voros. En relaciÃ³n a la abundancia, el patrÃ³n varÃ­a entre las localidades y las especies dominantes pertenecen a los gremios: FRSO, NEOM, INCA yHEMA. En el anÃ¡lisis de la composiciÃ³n de la dieta, se identificaron 5 Ã³rdenes de Insecta, 16 morfotipos de semillas y restos de sangre, huesos y tejido blando. La composiciÃ³n de la comunidad de murciÃ©lagos del Ã¡rea de estudio es similar a las observadas en Ã¡reas boscosas de la regiÃ³n neotropical con diversos grados de perturbaciÃ³n antrÃ³pica, en donde pocas especies estÃ¡n representadas por un alto nÃºmero de individuos que se alimentan de plantas pioneras de gran importancia en los procesos de mantenimiento y regeneraciÃ³n del bosque ribereÃ±o siempre verde y de sucesiÃ³n secundaria.','2010-07-19','MurciÃ©lagos PetrocedeÃ±o-PDVSA BiologÃ­a poblaciÃ³n diversidad dieta',1,1,1,1,1,'2013-09-17 08:33:29','2013-09-17 08:33:29','Documento_421.pdf','application/pdf',1446667,'2013-09-17 08:33:29',19,0,132,'COMPLETO'),(420,'EVALUACIÃ“Ã“NN DE LOS NIVELES MERCURIALES EN EL AIRE DE AULAS EN UNIDADES EDUCATIVAS DE EL CALLAO,, ESTADO BOLÃÃVVAR','El Mercurio es un metal sin funciÃ³n biolÃ³gica conocida, al cual se le atribuyen diversos efectos tÃ³xicos en sistemas vivos. Se utiliza en algunas tÃ©cnicas artesanales de la minerÃ­a extractiva de metales tales como la extracciÃ³n de oro artesanal, debido a su capacidad de formar amalgamas con ellos. En este procedimiento, se emiten vapores y productos (Ã³xidos) de la quema al medio ambiente a travÃ©s del aire. En la poblaciÃ³n de El Callao, Estado BolÃ­var, se practica la minerÃ­a extractiva artesanal en gran escala y se presumen elevados niveles de Mercurio en el aire de la regiÃ³n, siendo de gran interÃ©s los Ã¡mbitos de las Unidades Educativas Bolivarianas debido a que los niÃ±os permanecen gran parte del dÃ­a en sus instalaciones expuestos al producto aÃ©reo de la actividad minera. Para este estudio, se evaluÃ³ la exposiciÃ³n de niÃ±os de edades comprendidas entre 6 y 13 aÃ±os, debido al riesgo de toxicidad reportado para la exposiciÃ³n a mercurio y sus especies inorgÃ¡nicas por la vÃ­a inhalatoria. Estos efectos han sido especificados a nivel del Sistema Nervioso Central lo cual hace que esta poblaciÃ³n sea sumamente vulnerable ya que se encuentran en desarrollo de sus funciones motoras. Las muestras de aire fueron recolectadas segÃºn la Norma del Instituto Nacional de Salud y Seguridad Ocupacional (NIOSH), NÂº 6009 con una variaciÃ³n del mÃ©todo de digestiÃ³n y cuantificaciÃ³n por EspectroscopÃ­a de Fluorescencia AtÃ³mica con generaciÃ³n de vapor frio (CV-AFS). Se muestrearon un total de 11 Unidades Educativas Bolivarianas de diferentes zonas de la poblaciÃ³n de El Callao, encontrando valores entre 0,09 y 0,9 ÂµgHg/ m3, algunos de estos valores se encuentran por encima del valor de Nivel de Riesgo MÃ­nimo (MRL por sus siglas en inglÃ©s) de 0,2 ÂµgHg/m3, propuesto por la Agencia para Sustancias TÃ³xicas y Registro de Enfermedades (ATSDR).','2010-07-09','Mercurio,ATSDR,NIOSH,MRL',6,1,1,1,1,'2013-09-17 08:33:30','2013-09-17 08:33:30','Documento_422.pdf','application/pdf',3226527,'2013-09-17 08:33:30',18,0,99,'COMPLETO'),(421,'PROTOTIPO DE UN SISTEMA PORTÃTIL DE REGISTRO DIGITAL DE LA VARIACIÃ“N DE VOLUMEN SANGUÃNEO UTILIZANDO LA TÃ‰CNICA DE FOTOPLETISMOGRAFÃA DE TRANSMISIÃ“N','El trabajo presenta un sistema portÃ¡til de registro digital de la variaciÃ³n de volumen sanguÃ­neo utilizando la tÃ©cnica de fotopletismografÃ­a de transmisiÃ³n. Se desarrollÃ³ un sensor para obtener la seÃ±al fotopletismogrÃ¡fica. Dicha seÃ±al se acondiciona en etapas de amplificaciÃ³n y filtrado, con un circuito basado en amplificadores operacionales, y se digitaliza utilizando el mÃ³dulo de conversiÃ³n analÃ³gico/digital de un microcontrolador PIC. Los datos obtenidos son almacenados en una memoria Secure Digital (SD).Se creÃ³ un software en lenguaje ensamblador en el PIC para controlar el proceso de digitalizaciÃ³n de la seÃ±al PPG y para establecer el protocolo de comunicaciÃ³n con la memoria SD. La resoluciÃ³n del conversor utilizado es de 10 bits y la tasa de muestreo se fijÃ³ a $256 muestras/s$. Para poder realizar registros de 24 horas, a Ã©sta tasa de muestreo, se requieren por lo menos 42 Mb, sin embargo, las memorias SD mÃ¡s pequeÃ±as superan por mucho este valor. Las memorias SD no solo satisfacen los requerimientos de almacenamiento, tambiÃ©n facilitan la transferencia de informaciÃ³n a un computador.El objetivo de crear este prototipo es dar paso a la investigaciÃ³n de la seÃ±al PPG, ya que es una variable hemodinÃ¡mica importante en el diagnÃ³stico de enfermedades cardiovasculares, y al desarrollo de un equipo mÃ¡s sofisticado, que pueda monitorear la presiÃ³n arterial latido a latido.','2010-09-06','{}',3,1,1,1,1,'2013-09-17 08:33:31','2013-09-17 08:33:31','Documento_423.pdf','application/pdf',3526627,'2013-09-17 08:33:31',20,0,100,'COMPLETO'),(422,'DIGESTIBILIDAD IN VITRO Y APROVECHAMIENTO POR EL GORGOJO DE ARROZ DE ALMIDONES DE PLÃÃTTANO,, VARIEDADES HARTÃ“Ã“NN COMÃšÃšNN,, CAMBUR NEGRO,, TOPOCHO CENIZO,, HH--1122 Y CAMBUR 001122','Resumen El almidÃ³n es un polisacÃ¡rido de origen vegetal y representa una fuente de alimento importante en animales. Los estudios de digestibilidad in vitroe in vivo del almidÃ³n han sido de interÃ©s al evaluar aspectos relacionados con su biodisponibilidad. En Venezuela, el plÃ¡tano se presenta como fuente alternativa de almidÃ³n dada su importancia tanto a nivel agronÃ³mico como de consumo por parte de la poblaciÃ³n. En este estudio, se evaluÃ³ la digestibilidad de almidones de plÃ¡tano, variedades: hartÃ³n comÃºn, cambur negro, topocho cenizo, HH-12 y cambur 012; utilizando almidÃ³n de maÃ­z como referencia. La digestibilidad in vitro fue analizada mediante la determinaciÃ³n de los parÃ¡metros: almidÃ³n potencialmente disponible, almidÃ³n resistente total y tasa de aÃ¢Â€Â‘amilÃ³lisis in vitro, mientras que la digestibilidad in vivo de los almidones de plÃ¡tano fue evaluada mediante el uso del bioensayo del gorgojo de arroz, Sitophilus oryzae (L.).Se encontrÃ³ que todos los almidones de plÃ¡tano poseen un 93 - 99% de almidÃ³n potencialmente disponible, a excepciÃ³n de la variedad HH-12 (82%). El contenido de almidÃ³n resistente total se encontrÃ³ entre 55 y 64% para todas las variedades; de las cuales hartÃ³n comÃºn y topocho cenizo presentaron los mayores niveles, mientras que cambur 012 y cambur negro, presentaron los menores. En cuanto a la tasa de aÃ¢Â€Â‘amilÃ³lisis in vitro, se encontrÃ³ que todos los almidones crudos de plÃ¡tano poseen velocidades iniciales menores que 2%, las cuales aumentaron cuando fueron gelatinizados (56 - 61%). Las magnitudes finales de hidrÃ³lisis de los almidones crudos fueron menores a 4%, y aumentaron al gelatinizarlos (71 - 81%).Los biomarcadores supervivencia, variaciÃ³n de peso, agua corporal, nitrÃ³geno proteico, nitrÃ³geno cuticular y excreciÃ³n de Ã¡cido Ãºrico, no mostraron diferencias relacionadas con la digestibilidad in vitro de los almidones. No obstante, los biomarcadores grasa corporal y actividad similar a aÃ¢Â€Â‘amilasa, presentaron diferencias que correlacionaron con el contenido de almidÃ³n resistente presente en los almidones. A partir de los anÃ¡lisis de correlaciÃ³n realizados, se encontrÃ³ que el almidÃ³n resistente total, fue el mejor estimador de las respuestas encontradas in vivo; correlacionÃ¡ndose negativamente con la grasa corporal (R2 = 0,43; p = 0,008) y positivamente con la actividad similar a a-amilasa (R2 = 0,33; p = 0,03).En cuanto a la digestibilidad in vivo de los almidones de plÃ¡tano, las variedades hartÃ³n comÃºn y HH-12 fueron los menos biodisponibles, mientras que el almidÃ³n de cambur 012 presentÃ³ la mayor biodisponibilidad y no presentÃ³ diferencias significativas con respecto al almidÃ³n de maÃ­z (considerado de alta biodisponibilidad). Los almidones de plÃ¡tano de las variedades cambur negro y topocho cenizo presentaron una biodisponibilidad intermedia.En base a los resultados encontrados en este estudio, los almidones crudos de plÃ¡tano se perfilan como buenas fuentes de almidÃ³n para la formulaciÃ³n de alimentos dirigidos a consumidores con necesidades nutricionales especiales, tales como personas diabÃ©ticas y obesas. AdemÃ¡s, los biomarcadores grasa corporal y actividad similar a aÃ¢Â€Â‘amilasa, del bioensayo del gorgojo de arroz, resultaron ser Ãºtiles y eficaces en la caracterizaciÃ³n de la digestibilidad in vivo de almidones de plÃ¡tano.','2010-09-10','Digestibilidad, almidÃ³n de plÃ¡tano, gorgojo de arroz',1,1,1,1,1,'2013-09-17 08:33:32','2013-09-17 08:33:32','Documento_424.pdf','application/pdf',1682475,'2013-09-17 08:33:32',20,0,110,'COMPLETO'),(423,'AnÃ¡lisis e ImplementaciÃ³Ã³nn de un Esquema BÃ¡sico de Seguridad Usando Software Libre','Actualmente las redes de Ã¡rea local son tan habituales que casi no hay oficina que no la posea; incluso gran parte de hogares la tienen. La mayorÃ­a de estas redes estÃ¡n conectadas a Internet, hecho que las hace vulnerables a los peligros latentes en el Internet, por ese motivo es necesario proporcionar a estas redes algÃºn nivel de seguridad. En este trabajo se analizaron en forma detallada cada una de las recomendaciones propuestas por el documento ISO/IEC 27002; con el objeto de buscar un esquema bÃ¡sico de seguridad para las redes de Ã¡rea local y proponer un conjunto mÃ­nimo de recomendaciones al respecto, asÃ­ como tambiÃ©n su implementaciÃ³n usando software libre. El esquema bÃ¡sico de seguridad encontrado estÃ¡ compuesto por un conjunto mÃ­nimo de recomendaciones (clÃ¡usulas) cuyo cumplimiento proporciona un nivel de seguridad aceptable en redes no crÃ­ticas; es decir en redes de organizaciones con pocos enemigos potenciales, redes que no pertenecen a grupos de espionaje, ni agencias de investigaciÃ³n, ni centros de seguridad gubernamental, ni bancos, ni otras organizaciones del estilo. Adicionalmente, se recomienda abaratar costos de implementaciÃ³n, incrementar la independencia y mantenerse actualizado. Para lograrlo se propone usar software libre, el cual con costos bajos y alta confiabilidad permite implementar el conjunto mÃ­nimo de recomendaciones extraÃ­do del documento ISO/IEC 27002.Las recomendaciones del esquema bÃ¡sico propuesto se implementaron en un caso de estudio, usando herramientas de software libre, demostrando asÃ­ la efectividad de la propuesta.','2010-06-15','Internet, intranet, seguridad, software libre, ISO/IEC 27002.',2,1,1,1,1,'2013-09-17 08:33:33','2013-09-17 08:33:33','Documento_425.pdf','application/pdf',2606222,'2013-09-17 08:33:33',16,0,130,'COMPLETO'),(424,'\"\"DETERMINACIÃ“Ã“NN DE LOS NIVELES DE MERCURIO EN SANGRE DE LOS NIÃ‘Ã‘OOS EN EDAD ESCOLAR DE LA POBLACIÃ“Ã“NN DE EL CALLAO,, ESTADO BOLIVAR\"\"','El mercurio es un metal muy toxico y es frecuentemente usado en la minerÃ­a artesanal para la extracciÃ³n de oro y plata y en Venezuela existen varios yacimientos de oro, que se encuentran en el Estado BolÃ­var destacÃ¡ndose 4 Ã¡reas de gran importancia econÃ³mica: las zonas aurÃ­feras de Tumeremo, El Callao, El Dorado y El Manteco, donde existe como principal profesiÃ³n la minerÃ­a artesanal. Debido a que el mercurio afecta al ser un humano y principalmente a los niÃ±os, se realizaron anÃ¡lisis de mercurio en sangre a 112 niÃ±os en edades comprendidas entre 5 y 13 aÃ±os en la poblaciÃ³n de El Callao, dichos niÃ±os fueron seleccionados de manera aleatoria en trece escuelas de dicha poblaciÃ³n manteniendo la representatividad de sexo y edad. La determinaciÃ³n de mercurio en sangre se realizo mediante la tÃ©cnica de Espectroscopia de Fluorescencia AtÃ³mica con generaciÃ³n de vapor (CV-AFS). Los resultados obtenidos oscilaron entre 0,15 y 27 Âµg/L obteniÃ©ndose una gran diversidad de resultados en ese rango, donde el 28 % de la poblaciÃ³n muestreada tenÃ­an los niveles de mercurio en sangre por encima de los lÃ­mites tolerables por el organismo infantil. Se pudo notar que los niÃ±os que tuvieron los niveles mÃ¡s altos estaban relacionados con la minerÃ­a artesanal, debido al lugar de la vivienda o del colegio y a la profesiÃ³n de los padres.','2010-07-09','mercurio, sangre, niÃƒÂ±os, poblaciÃƒÂ³n',6,1,1,1,1,'2013-09-17 08:33:34','2013-09-17 08:33:34','Documento_426.pdf','application/pdf',1197780,'2013-09-17 08:33:34',20,0,75,'COMPLETO'),(425,'Desarrollo de una Herramienta de Software Libre que Permita el DiseÃ±o de Centros de Datos','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0in 5.4pt 0in 5.4pt; mso-para-margin-top:0in; mso-para-margin-right:0in; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0in; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin;} El presente Trabajo Especial de Grado consiste en el anÃ¡lisis, diseÃ±o y desarrollo de una herramienta de software libre que permita el diseÃ±o de centros de datos, para asÃ­ poder llevar un inventario de los equipos, reflejar las interconexiones de los mismos y visualizar las aplicaciones que en Ã©stos se ejecutan. Normalmente en un centro de datos no se tiene un inventario actualizado de los recursos de hardware y software, es decir, que la mayorÃ­a de los centros de datos operan sin llevar un control especÃ­fico de los componentes, perfil del uso de los equipos, estado de uso y obsolencia en que se encuentran y aplicaciones que se encuentran en las instalaciones. Esto acarrea que la solicitud de nuevos equipos, mantenimiento y producciÃ³n se vean limitados. El objetivo del presente Trabajo Especial de Grado resolver los problemas antes mencionados y optimizar las tareas de los operadores y administradores de centros de datos, y por ende el rendimiento del mismo. El sistema desarrollado proporciona interfaces de diseÃ±o y carga de datos que permiten a los usuarios incorporar al sistema toda la informaciÃ³n relacionada con el centro de datos a diseÃ±ar, asÃ­ como el posicionamiento e interconexiones de los elementos e igualmente el software que en ellos se ejecuta. De la misma manera, el sistema proporciona interfaces que permiten al usuario visualizar el centro de datos una vez diseÃ±ado, o incluso parcialmente diseÃ±ado. Una vez que se guarda un estado del centro de datos en el diseÃ±ador, inmediatamente se encuentra disponible para su visualizaciÃ³n. Las tecnologÃ­as y herramientas utilizadas mÃ¡s relevantes que contribuyeron al desarrollo exitoso de la aplicaciÃ³n fueron las siguientes: Ruby on Rails, framework para el desarrollo de aplicaciones Web bajo el esquema MVC; ActionScript 3, lenguaje de programaciÃ³n de Adobe que cuenta con una amplia librerÃ­a de funciones grÃ¡ficas; Action Message Format 3, formato de intercambio de mensajes que permite una comunicaciÃ³n eficiente entre un servidor de aplicaciones y ActionScript; AJAX, enfoque de desarrollo basado en un conjunto de tecnologÃ­as ya existentes, agrupadas para presentar informaciÃ³n e interactuar dinÃ¡micamente, de manera asÃ­ncrona, con un servidor Web; Prototype, librerÃ­a de JavaScript que provee de mÃºltiples funcionalidades y utilidades tales como interacciÃ³n con AJAX, efectos grÃ¡ficos, entre otros; Swift3D, suite de diseÃ±o de elementos 3D con capacidades de exportaciÃ³n al formato SWF de Flash; Suite Adobe Flash CS4, entorno de desarrollo que provee mÃºltiples herramientas que facilitan e incrementan el tiempo de desarrollo; Distributed ruby, tecnologÃ­a de comunicaciones distribuidas para el lenguaje ruby.','2010-10-15','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:33:35','2013-09-17 08:33:35','Documento_427.pdf','application/pdf',1487750,'2013-09-17 08:33:35',20,0,122,'COMPLETO'),(426,'MediciÃ³Ã³nn con detectores de estado solido de la dosis absorbida en maniquÃ­Ã­ abdominal utilizando tÃ©Ã©cnicas de radioterapia 44D e hipofraccionamiento.. AplicaciÃ³Ã³nn a tratamientos de MT hepÃ¡Ã¡ticas..','En el presente trabajo se diseÃ±aron y evaluaron protocolos de tratamiento de metÃ¡stasis hepÃ¡ticas, para ello, se realizaron mediciones con detectores de estado sÃ³lido de la dosis absorbida en un maniquÃ­ abdominal, haciendo uso de tÃ©cnicas de radioterapia 4D e hipofraccionamiento. Durante la realizaciÃ³n del trabajo, se construyÃ³ un maniquÃ­ abdominal, cuya funciÃ³n principal es servir de sustituto del tejido. De esta manera, se usÃ³ un material que se comporta de manera similar al tejido humano al estar en presencia de la radiaciÃ³n ionizante. Debido a que la zona de irradiaciÃ³n es el abdomen, fue necesario tomar en cuenta el movimiento del blanco debido a la respiraciÃ³n del paciente. De esta manera, se construyÃ³ una base para simulaciÃ³n con desplazamiento horizontal, con nueve posiciones que definen nueve posibles desplazamientos. La posibilidad de variar el desplazamiento de una sesiÃ³n a otra, permitiÃ³ recrear situaciones en las que el paciente mantiene un patrÃ³n respiratorio regular, asÃ­ como el caso contrario donde, durante la irradiaciÃ³n cambian las condiciones presentadas en la simulaciÃ³n de tratamiento. La aplicaciÃ³n de tratamiento al sistema base de simulaciÃ³n - maniquÃ­, y posterior comparaciÃ³n entre la dosis medida y la planificada, mostrÃ³ que con dicha tÃ©cnica se concentran altas dosis en el volumen tumoral, recibiendo una dosis total de 6000 cGy en tres sesiones de tratamiento, mientras se disminuye la dosis absorbida en Ã³rganos a riesgo como mÃ©dula y estÃ³mago, estas se mantienen por debajo del punto de dosis mÃ¡xima, 1800 cGy y 3000 cGy respectivamente.','2010-09-09','Radioterapia 4D, Hipofraccionamiento, Detectores de estado sÃƒÂ³lido, MT HepÃƒÂ¡ticas',3,1,1,1,1,'2013-09-17 08:33:37','2013-09-17 08:33:37','Documento_428.pdf','application/pdf',2936681,'2013-09-17 08:33:37',20,0,67,'COMPLETO'),(427,'ConstrucciÃ³n de una cepa mutante de Mycobacterium smegmatis que contenga el epÃ­tope FLAG en el gen mfpA','Las fluoroquinolonas (FQs) son antibiÃ³ticos que se utilizan para el tratamiento de la enfermedad tuberculosis debido a su capacidad de inhibir la ADN girasa. Sin embargo, existen reservas acerca de su uso como drogas anti-tuberculosas, debido a que se seleccionan mutantes resistentes rÃ¡pidamente. Los mecanismos involucrados en la resistencia a estos antibiÃ³ticos son bombas de eflujo, mutaciones en el blanco y un mecanismo descrito recientemente que involucra una proteÃ­na perteneciente a la Familia de PentapÃ©ptidos Repetidos, llamada MfpA (\"Mycobacterial Fluoroquinolone Resistance Protein\"). Esta proteÃ­na es codificada por el gen mfpA de Mycobacterium smegmatis, tiene 192 aminoÃ¡cidos, consiste en 32 pentapÃ©ptidos repetidos en tanda y es capaz de conferir bajos niveles de resistencia a ciprofloxacina y esparfloxacina. Hacia el extremo 5\' del gen mfpA, hay 4 genes que estÃ¡n altamente conservados en las micobacterias que se expresan como parte de la misma unidad transcripcional. Existe evidencia de que la organizaciÃ³n de los genes que forman parte del presunto operÃ³n es similar tanto en M.. tuberculosiscomo en M.. smegmatis, es por ello que esta Ãºltima es un modelo apropiado para llevar a cabo el etiquetamiento gen mfpA. Este trabajo tiene como objetivo la construcciÃ³n de una cepa mutante de M.smegmatis que contenga el epÃ­tope FLAG en el extremo 5\' del gen mfpA, empleando tÃ©cnicas bÃ¡sicas de genÃ©tica molecular. Con la primera estrategia utilizada, se lograron clonar los dos fragmentos correspondientes a las regiones 5\' y 3\' del gen mfpA en el vector pYUB854, una vez obtenida esta construcciÃ³n se utilizÃ³ como sistema la recombinaciÃ³n homÃ³loga, para introducir el epÃ­tope a nivel cromosomal en la micobacteria, pero esto no se logrÃ³,,porlo tanto se considerÃ³ emplear una nueva metodologÃ­a que consistiÃ³ en la extensiÃ³n por solapamiento mediante PCR de los genes mfpEB y mfpA, para intentar etiquetar la proteÃ­na MfpA hacia su extremo N-terminal y lograr que esta se expresara en el genoma de M.. smegmatis a partir de su propio promotor, ubicado en el extremo 5\' del gen mfpE. Se logrÃ³ incorporar el epÃ­tope FLAG en la secuencia del operÃ³n mmfpEA, al cual pertenece el gen de interÃ©s. Pero por limitaciones de tiempo esta construcciÃ³n no se pudo introducir en el genoma de la micobacteria. Con la construcciÃ³n de esta cepa se pretenden evaluar a posteriori, los niveles de expresiÃ³n de la proteÃ­na a travÃ©s de la tÃ©cnica de Western Blot.','2010-07-16','Mycobacterium, rcombinaciÃ³n homÃ³loga, fluoroquinolonas.',1,1,1,1,1,'2013-09-17 08:33:38','2013-09-17 08:33:38','Documento_429.pdf','application/pdf',2003389,'2013-09-17 08:33:38',19,0,79,'COMPLETO'),(428,'Uso del hongo entomopatÃ³Ã³ggenoMetarhizium anisopliae ((Clase Hyphomycetes))en el control de Musca domesticaLinneaus ((Diptera:: Muscidae)) en galpones avÃ­Ã­colas..','Musca domestica Linneaus es una de las plagas mÃ¡s comunes asociada a las actividades avÃ­colas. Una de las estrategias de control mÃ¡s estudiadas en la actualidad es la basada en la utilizaciÃ³n de hongos entomopatÃ³genos. La capacidad de infecciÃ³n del hongo Metarhizium anisopliae sobre M.. domesticaes bastante conocida, sin embargo son pocos los trabajos realizados directamente en las granjas avÃ­colas. Este trabajo tiene como objetivo general, desarrollar y evaluar una metodologÃ­a para el control de M.. domestica en los galpones avÃ­colas, basada en la colocaciÃ³n de telas impregnadas con conidias del hongo M.. anisopliae. Se estableciÃ³ una crÃ­a de M.. domestica en condiciones de laboratorio y se evalÃºo a M.. anisopliae como agente de infecciÃ³n sobre adultos de la mosca, utilizando para el contagio una superficie de tela, obteniÃ©ndose como mejor atrayente el color amarillo. Luego, se estimÃ³ la cantidad de conidias capaces de fijarse a la tela amarilla preparÃ¡ndose cuatro montajes con las siguientes densidades: 3,89 x105 (DMa1), 2,72 x106 (DMa2), 6,33 x106 (DMa3) y 1,45 x107 (DMa4) conidias por cm2 de tela amarilla y se colocaron en el interior de recipientes de vidrio con cincuenta individuos adultos de la mosca. Una vez el lienzo tratado produjo el 100% de mortalidad Ã©ste fue colocado en un recipiente nuevo con un nuevo grupo de moscas adultas y se procediÃ³ a evaluar la mortalidad diaria. Los tratamientos DMa3 y DMa4 fueron capaces de conseguir el 100% de mortalidad luego de cinco semanas de aplicados en la tela, siendo seleccionado para el trabajo en campo el tratamiento DMa3. Para determinar la patogenicidad de M.. anisopliae sobre diferentes grupos etarios de M.. domestica, se realizaron ensayos con edades de 0 (reciÃ©n eclosionados), 5, 10, 15, 20, 25 y 30 dÃ­as post-eclosiÃ³n. Los tiempos letales estimados con el anÃ¡lisis de Probit, indicaron que la patogenicidad del hongo no se veÃ­a alterada en los grupos de 5, 10, 15 y 20 dÃ­as (grupos B, C, D y E, respectivamente). En el grupo A, por tratarse de jÃ³venes reciÃ©n eclosionados se presentÃ³ un retraso en producirse el 100% de mortalidad y en cuanto a los grupos Fy G (25 y 30 dÃ­as) se encontraron descensos debido a causas naturales, lo que redujo el nÃºmero de individuos capaces de ser infectados por M.. anisopliae.. Sin embargo, segÃºn Keiding (1986) los grupos A, F y G no se encuentran representados de manera importante en la poblaciÃ³n presente en los galpones avÃ­colas. El trabajo en campo se realizÃ³ en dos galpones avÃ­colas. Se realizaron dos aplicaciones del hongo M.. anisopliae, mediante la colocaciÃ³n de los montajes de tela amarilla impregnados con conidias. En el centro de cada galpÃ³n y a 3 m de altura aprox., se colocaron cuatro montajes, siendo restituidos cada tres semanas. Con la rejilla de Scudder (Scudder, 1947) se estimÃ³ la poblaciÃ³n de mosca domÃ©stica pre y post-tratamiento y tambiÃ©n se realizaron pases con malla entomolÃ³gica para evidenciar la infecciÃ³n fÃºngica en la poblaciÃ³n. Las aplicaciones realizadas condujeron a una reducciÃ³n del 99% en la poblaciÃ³n de la mosca para ambos galpones y luego de nueve semanas a partir del inicio del tratamiento. Estos resultados indican que la metodologÃ­a implementada constituye una alternativa viable para el control de M.. domestica.','2010-10-14','Normal 0 21 false false false PT X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabela normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso',1,1,1,1,1,'2013-09-17 08:33:40','2013-09-17 08:33:40','Documento_430.pdf','application/pdf',1684571,'2013-09-17 08:33:40',20,0,184,'COMPLETO'),(429,'OBTENCIÃ“Ã“NN Y CARACTERIZACIÃ“Ã“NN DE HARINA DE PLÃÃTTANO DE 1188 CLONES DE BANANOS PROVENIENTES ((INIA)) Y SU APLICACIÃ“Ã“NN EN LA ELABORACIÃ“Ã“NN DE UN PRODUCTO HORNEADO..','El plÃ¡tano es uno de los cultivos de plantas que se producen para el consumo local y la exportaciÃ³n y son de gran importancia econÃ³mica para las regiones tropicales y subtropicales de Ãfrica, AmÃ©rica Central, AmÃ©rica del Sur, Asia y las Ã¡reas del PacÃ­fico (Noyer y col., 2005). La OrganizaciÃ³n para la Agricultura y la AlimentaciÃ³n (FAO) considera al plÃ¡tano como el cuarto alimento importante en el mundo, despuÃ©s del arroz, del trigo y del maÃ­z. Los plÃ¡tanos son conocidos por tener grandes fuentes de vitaminas A, B1, B2, B3 y B6 y minerales, tales como, potasio, fÃ³sforo y calcio. En el presente trabajo se plantearon como objetivos la obtenciÃ³n y la caracterizaciÃ³n de harina de 18 clones de bananos provenientes del Banco de Germoplasma de Instituto Nacional de Investigaciones AgrÃ­colas (INIA)- Maracay, estado Aragua, Venezuela y su aplicaciÃ³n en la elaboraciÃ³n de un producto horneado.. Para el logro de los objetivos,, se determinaron la composiciÃ³Ã³nn proximal,, las caracterÃ­Ã­sticas,, fÃ­Ã­sicas,, fisicoquÃ­Ã­micas y funcionales de las harinas elaboradas y del productos formulado,, siguiendo la metodologÃ­Ã­as oficiales descritas en la AACC,, ((22000033)) y Normas COVENIN.. Los resultados indican que existe una relaciÃ³n entre el contenido de proteÃ­na y el origen genÃ³mico de los clones. A nivel nutricional, el banano, sus harinas y el producto elaborado con el mismo, son fuentes importantes de fibra dietaria, en mayor proporciÃ³n que la que puede suministrar la harina de trigo. Asimismo, se demostrÃ³, mediante esta investigaciÃ³n, la factibilidad de elaborar harinas de banano de diferentes clones con propiedades que varÃ­an en funciÃ³n a su origen genÃ³mico. TambiÃ©n se revelaron diferencias en cuanto a sus propiedades funcionales y la morfometrÃ­a de sus almidones que les da versatilidad de usos. El panquÃ© que se elaborÃ³ con harina compuesta (cambur y trigo) tuvo mayor aceptaciÃ³n que el panquÃ© de harina de trigo.','2010-10-04','{}',1,1,1,1,1,'2013-09-17 08:33:41','2013-09-17 08:33:41','Documento_431.pdf','application/pdf',831356,'2013-09-17 08:33:41',19,0,95,'COMPLETO'),(430,'Estudio de la Brecha de EnergÃ­a en el BaPtSi3 utilizando la Longitud de PenetraciÃ³n MagnÃ©tica.','En este trabajo especial de grado se realizaron medidas de longitud de penetraciÃ³n magnÃ©tica en el superconductor no centrosimÃ©trico BaPtSi3 en el rango de temperatura de 40 mK hasta 2, 42 K (temperatura crÃ­tica). Los resultados muestran un comportamiento exponencial de la longitud de penetraciÃ³n magnÃ©tica en el lÃ­mite de temperaturas bajas. Esto nos indica una estructura de la brecha de energÃ­a superconductora isotrÃ³pica sin nodos, lo que es caracterÃ­stico de un superconductor tipo BCS.','2010-10-08','Superconductividad, Brecha de energÃƒÂ­a, Longitud de penetraciÃƒÂ³n magnÃƒÂ©tica, no centrosimetrÃƒÂ­a, bajas temperaturas, BaPtSi3, teorÃƒÂ­a BCS.',3,1,1,1,1,'2013-09-17 08:33:42','2013-09-17 08:33:42','Documento_432.pdf','application/pdf',1583656,'2013-09-17 08:33:42',19,0,96,'COMPLETO'),(431,'ESTIMAR LA REACTIVIDAD CATALÃÃTTICA HACIA REACCIONES DE HIDROTRATAMIENTO EMPLEANDO CATALIZADORES V--Ni--Mo // ALÃšÃšMMINA','RESUMEN El mejoramiento de crudos pesados se ha vuelto una necesidad cada vez mÃ¡s imperiosa para la industria petrolera a nivel mundial. En este Ã¡mbito el hidrotratamiento ha figurado como uno de los procesos catalÃ­ticos mÃ¡s eficientes para la eliminaciÃ³n de compuestos orgÃ¡nicos sulfurados, nitrogenados y aromÃ¡ticos de las corrientes dentro de las refinerÃ­as. La revalorizaciÃ³n de la corriente de LCO, que es un subproducto que proviene de las unidades de craqueo catalÃ­tico y que posee un alto contenido de aromÃ¡ticos y de azufre, es particularmente importante para ser incluido dentro del pool de diesel. El proceso de hidrotratamiento para lograr el mejoramiento del LCO se llevÃ³ a cabo sobre molÃ©culas modelo, en un reactor operado en flujo continuo a alta presiÃ³n, y temperatura constante (T=350 ÂºC), donde se trataron soluciones de tiofeno (10%p/p), tolueno (30%p/p) y piridina (10%p/p) para ensayar las reacciones de HDS, HYD y HDN. A tal fin se sintetizÃ³ un catalizador bimetÃ¡lico de NÃ­quel- Molibdeno (3% y 11% respectivamente) y 4 catalizadores de Vanadio-NiMo, todos soportados sobre g-alÃºmina, variando los porcentajes de vanadio (0.5, 1.0, 1.5 y 2.0%) en el catalizador. Los mismos fueron presulfurados (CS2) in situantes de dar inicio a la reacciÃ³n a T= 350 ÂºC y presiÃ³n atmosfÃ©rica de hidrÃ³geno. Los catalizadores fueron caracterizados por tÃ©cnicas texturales y de superficie, Ã¡rea especÃ­fica BET (AE-BET) y tamaÃ±o de poro, difracciÃ³n de rayos X (DRX) y anÃ¡lisis elemental (ICP-AEE). Los productos de reacciÃ³n fueron analizados por cromatografÃ­a de gases (GC-FID). Los resultados de la caracterizaciÃ³n de los catalizadores mostraron una buena dispersiÃ³n de los metales sobre el soporte. La conversiÃ³n mÃ¡xima alcanzada durante la reacciÃ³n de HDS de tiofeno fue de 100% lograda con el catalizador con 1,5% de vanadio. En las reacciones de hidrogenaciÃ³n de tolueno la conversiÃ³n mÃ¡xima obtenida fue de 43,1% con el catalizador con 1,0% de V. Mientras que para las reacciones de HDN de piridina se obtuvo conversiones de 100% con todos los catalizadores ensayados. La tendencia en la actividad de los catalizadores hacia las reacciones de hidrotratamiento mostrÃ³ un aumento en las conversiones con el incremento del contenido de vanadio, y luego una disminuciÃ³n de las mismas para los catalizadores con mayor contenido del metal. Sin embargo los valores mÃ¡ximos alcanzados siempre fueron comparables e inclusive mayores que aquellos logrados con el catalizador comercial usado (TK-437), por lo que se puede indicar que los catalizadores estudiados en el proceso de hidrotratamiento catalÃ­tico podrÃ­an ser eficientes para el mejoramiento de la corriente de LCO.','2010-10-18','HIDROTRATAMIENTO, CATALIZADORES, VANADIO, NIQUEL, MOLIBDENO',6,1,1,1,1,'2013-09-17 08:33:44','2013-09-17 08:33:44','Documento_433.pdf','application/pdf',0,'2013-09-17 08:33:44',19,0,0,'INCOMPLETO'),(432,'EXTRACCIÃ“Ã“NN,, PURIFICACIÃ“Ã“NN Y CARACTERIZACIÃ“Ã“NN DEL ALMIDÃ“Ã“NN DE 2211 CLONES DEL BANCO DE GERMOPLASMA DE MUSÃÃCCEASDEL INIA.. ELABORACIÃ“Ã“NN DE UN PRODUCTO TIPO PUDIN..','La planta de banano surgiÃ³ de dos especies diploides, la Musa acuminata (AA) y la Musa balbisiana (BB), encontrando especies o hÃ­bridos diploides, triploides y tetraploides provenientes de estas dos subespecies. En Venezuela, se usan los tÃ©rminos plÃ¡tano y cambur; nombres usuales para designar la especie de cocciÃ³n y de consumo fresco, respectivamente. El almidÃ³n es el principal componente de los bananos en estado verde. Desde hace mucho tiempo el almidÃ³n nativo se ha utilizado como materia prima para la preparaciÃ³n de productos, sin embargo, poco se conoce sobre los aspectos funcionales de los almidones de las diferentes variedades de bananos. Por lo antes expuesto se planteÃ³. Extraer, purificar y caracterizar almidones extraÃ­do de 21 clones de bananos del Banco de Germoplasma de MusÃ¡ceas INIA. Mediante su composiciÃ³n proximal y caracterÃ­sticas quÃ­mica y fÃ­sicas se determinÃ³ cual o cuales almidones es o son los mÃ¡s idÃ³neo para formular un producto alimenticio tipo pudÃ­n. Los resultados indican que existen diferencias estadÃ­sticamente significativas (p<<==00,,0055) en cuanto, a la composiciÃ³n proximal, caracterÃ­sticas