cÃ¡nica','Presentamos el estudio estructural y magnÃ©tico de la cinÃ©tica de formaciÃ³n de laaleaciÃ³n nanomÃ©trica Fe80 Cr20 . La sÃ­ntesis se realizÃ³ por molienda mecÃ¡nica usandoun molino vibratorio Spex 8000 mill. Para observar la cinÃ©tica se elaboraron mues-tras a distintos tiempos de molienda las cuales fueron especÃ­Ã¯Â¬Âcamente 2, 5, 10, 20 y30 horas. El tamaÃ±o de grano se determinÃ³ empleando difracciÃ³n de Rayos X reve-lando un tamaÃ±o de aproximadamente 12 nanÃ³metros para 30 horas de molienda. Losestudios mÃ¡gneticos efectuados fueron mediante espectroscopÃ­a MÃ¶ssbauer y medi-das de histÃ©resis magnÃ©tica. La espectroscopÃ­a MÃ¶ssbauer fue realizada a temperaturaambiente, y tambiÃ©n a 77 K para la muestra de 30 horas, observÃ¡ndose en general lavariaciÃ³n del campo magnÃ©tico hiperÃ¯Â¬Âno, con respecto al hierro puro, al aumentar eltiempo de molienda y a su vez la apariciÃ³n del estado estacionario de molienda a las 20horas. Las medidas de histÃ©resis magnÃ©tica se obtuvieron utilizando un magnÃ©tometrode muestra vibrante, en donde los resultados mostraron una tendencia a saturar rÃ¡pidoy aÃºn asÃ­, una disminuciÃ³n de la magnetizaciÃ³n de saturaciÃ³n, con respecto al hierropuro. El campo coercitivo aumentÃ³ a 77 gauss para 5 horas de molienda manteniÃ©ndoseconstante hasta las 30 horas','2010-07-13','aleaciÃ³n Fe80Cr20 molienda mecÃ¡nica',3,1,1,1,1,'2013-09-17 08:33:54','2013-09-17 08:33:54','Documento_437.pdf','application/pdf',1118918,'2013-09-17 08:33:54',19,0,65,'COMPLETO'),(436,'Una prueba elemental de la desigualdad de Hilbert','La desigualdad de Hilbert, tiene muchas aplicaciones en la teoria de funciones analiticasy a la teoria de funciones de variable real. Algunas de ellas se pueden hallar en el CapituloIX y en el Apendice 3 del libro inequalities. La demostracion original de la desigualdad, debido a Hilbert,tambien se puede ver en ese mismo libro.','2010-10-26','Hilbert',5,1,1,1,1,'2013-09-17 08:33:56','2013-09-17 08:33:56','Documento_438.pdf','application/pdf',1757530,'2013-09-17 08:33:56',20,0,222,'COMPLETO'),(437,'ElaboraciÃ³n de pelÃ­culas antimicrobianas a partir de recursos sub-utilizados: quitosano de conchas de camarÃ³n (Penaeus vannamei) y almidÃ³n de ocumo chino (Colocasia esculenta).',' Actualmente los materiales de empaque que utilizan la mayorÃ­a de las industrias de alimentos no son amigables con el ambiente lo que trae como consecuencia que su degradaciÃ³n demore aÃ±os, esto ha hecho que surjan investigaciones para desarrollar materiales de empaque que sean biodegradables y que ofrezcan otros beneficios como que sean activos, es decir que sirvan de transporte de agentes antimicrobianos, para garantizar productos inocuos para el consumidor sin ocasionar impactos negativos al ambiente. En el presente estudio se elaboraron pelÃ­culas comestibles con propiedades antimicrobianas a partir de quitosano y almidÃ³n extraÃ­dos de materiales subutilizados como conchas de camarones (Penaeus vannamei) y ocumo chino (Colocasia esculenta), evaluando ademÃ¡s sus propiedades de barrera, estructurales, mecÃ¡nicas y funcionales. Para ello se procediÃ³ a realizar la extracciÃ³n y caracterizaciÃ³n de la materia prima; los resultados demostraron que los mÃ©todos empleados para la extracciÃ³n de los polÃ­meros son eficientes obteniÃ©ndose almidÃ³n con 99,14% de pureza y quitosano con un grado de desacetilaciÃ³n del 72,45%. Por otra parte la aplicaciÃ³n de un diseÃ±o factorial de mÃºltiples niveles permitiÃ³ encontrar las formulaciones Ã³ptimas para pelÃ­culas a base de almidÃ³n o quitosano conteniendo aceites esenciales de orÃ©gano y ajo como sustancias antimicrobianas contra microorganismos patÃ³genos como Salmonella entÃ©Ã©rica Ser. Enteritidis y Listeria monocytogenes,,encontrÃ¡ndose que 7% de almidÃ³n, 2% de glicerol y 0,5% de aceite esencial de orÃ©gano y 0,25% aceite esencial de ajo fue la combinaciÃ³n ideal para pelÃ­culas de almidÃ³n, mientras que 4,485% de quitosano, 2% de glicerol y 0,82% de aceite esencial de orÃ©gano y 0,5% aceite esencial de ajo fue la combinaciÃ³n ideal para pelÃ­culas de quitosano. AdemÃ¡s, los resultados demostraron que la concentraciÃ³n de polÃ­mero (almidÃ³n o quitosano) y aceites esenciales utilizada afecta significativamente (p<0,05) las propiedades de barrera, estructurales, mecÃ¡nicas y funcionales de las pelÃ­culas. En conclusiÃ³n, el desarrollo de pelÃ­culas antimicrobianas a partir de productos subutilizados como las conchas de camarones y ocumo chino es totalmente factible y representa una alternativa novedosa para aprovechar estos materiales, ofreciendo a la industria de alimentos materiales biodegradables para empaques que garantizarÃ­an la calidad e inocuidad de los alimentos.','2010-10-22','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',1,1,1,1,1,'2013-09-17 08:33:57','2013-09-17 08:33:57','Documento_439.pdf','application/pdf',516262,'2013-09-17 08:33:57',20,0,54,'COMPLETO'),(438,'COMPUESTOS CON POTENCIAL ACTIVIDAD ANTIMITÃ“TICA Y ANTIANGIOGÃ‰NICA. SÃNTESIS DE 5, 6, 7-TRIMETOXIISOQUINOLINAS, SUSTITUIDAS EN LA POSICIÃ“N 1 CON ANILLOS FENILICOS DISUSTITUIDOS','Se hizo el estudio sobre la sÃ­ntesis de 1-fenilisoquinolinas, las cuales presentan en comÃºn un anillo trimetÃ³xibenceno y dos sustituyentes oxigenados en el anillo fenÃ­lico. Dichas caracterÃ­sticas le podrÃ­an conferir actividad antimitÃ³tica y / o antigiogÃ©nica, pues estudios previos asÃ­ lo sugieren.La vÃ­a sintÃ©tica escogida consistiÃ³ en primer lugar en la sÃ­ntesis de la 2,3,4- trimetÃ³xifenetilamina a partir de la reducciÃ³n del nitroestireno correspondiente, obtenido por una condensaciÃ³n nitroaldÃ³lica entre el 2,3,4- trimetÃ³xibenzaldehido y nitrometano. Seguidamente se procediÃ³ a activar la fenetilamina empleando cloruro de tosilo en trietilamina para luego hacerla reaccionar con los benzaldehÃ­dos disustituidos basada en la reacciÃ³n Pictet- Spengler y asÃ­ obtener luego de la remociÃ³n del grupo activante las tetrahidroisoquinolinas correspondiente. En Ã©ste Ãºltimo paso se utilizÃ³ KOH en DMSO. Al elucidar los productos obtenidos mediante Ã©ste ensayo se observÃ³ que no correspondÃ­an a las tetrahidroisoquinolinas sino a las isoquinolinas.Los productos obtenidos en Ã©ste trabajo de investigaciÃ³n fueron:Ã¯ÂƒÂ˜ 5,6,7- trimetÃ³xi-1-(3,Â´4Â´-dimetÃ³xifenil)-isoquinolina.Ã¯ÂƒÂ˜ 5,6,7-trimetÃ³xi-1-(3Â´,4Â´- metilendioxifenil)-isoquinolina.Ã¯ÂƒÂ˜ 5,6,7-trimetÃ³xi-1-(3Â´-hidrÃ³xi-4Â´- metÃ³xifenil)-2-p-toluensulfonil-1,2,3,4-tetrahidroisoquinolina.','2010-10-21','SÃ­ntesis, Isoquinolinas, AntimitÃ³sis, AntigiogÃ©nicos',6,1,1,1,1,'2013-09-17 08:33:59','2013-09-17 08:33:59','Documento_440.pdf','application/pdf',3002765,'2013-09-17 08:33:59',19,0,119,'COMPLETO'),(439,'Un Esquema MimÃ©Ã©tico de Diferencias Finitas para la EcuaciÃ³Ã³nn de Onda BiarmÃ³Ã³nnica','En el siguiente trabajo se presenta un esquema mimÃ©tico para la resoluciÃ³n de la ecuaciÃ³n de onda BiarmÃ³nica. Se demuestra que dicho esquema es consistente con la ecuaciÃ³n diferencial, es condicionalmente estable y por lo tanto es convergente. Un estudio numÃ©rico comparativo evidencia la superioridad del esquema mimÃ©tico, ya que estÃ© produce errores menores que el esquema de diferencias finitas tradicional, este Ãºltimo esta basado en el uso de nodos imaginarios o fantasmas para las condiciones de borde. A pesar de que el esquema de diferencias finitas es bastante sencillo y de fÃ¡cil implementaciÃ³n, los resultados obtenidos muestran que el esquema mimÃ©tico es mÃ¡s eficiente y estable, ya que requiere de menos cuentas y cÃ¡lculos computacionales para resolver la ecuaciÃ³n de onda BiarmÃ³nica.','2010-10-26','EcuaciÃƒÂ³n de Onda BiarmÃƒÂ³nica, Esquemas MimÃƒÂ©ticos, Convergencia, Estabilidad, Consistencia',5,1,1,1,1,'2013-09-17 08:34:00','2013-09-17 08:34:00','Documento_441.pdf','application/pdf',4047738,'2013-09-17 08:34:00',20,0,147,'COMPLETO'),(440,'Acciones de Grupos de Lie en Pseudovariedades.','En la tesis de grado del Prof. Tomas Guardia ([2]), se probÃ³ que el espacio de Ã³rbita deuna acciÃ³n libre de un grupo de Lie compacto en una variedad diferenciable es una variedaddiferenciable. La condiciÃ³n de libre es de vital importancia pues en general, este resultadono es cierto para acciones no libres; es el caso de la acciÃ³n por rotaciones de la circunferenciaen el plano, donde el espacio de Ã³rbitas es el intervalo [0;1) quiÃ©n obviamente no es unavariedad.Esta tesis consiste en introducir una nueva categorÃ­a de objetos que generaliza la nociÃ³nde variedad y donde los espacios de Ã³rbita son objetos de esta categorÃ­a; esta categorÃ­a esLa CategorÃ­a de las G-pseudovariedades Estratificadas, siendo G un grupo de Lie compacto.Obtendremos como resultado nal que si X es una G-pseudovariedad estratificada y K esun subgrupo cerrado de G; entonces X/K es una G-pseudovariedad estratificada.','2010-10-11','Variedades, Slices, Espacios de Ã“rbitas, Espacios Estratificados, Pseudovariedades estratificadas, G- Pseudovariedades estratificadas',5,1,1,1,1,'2013-09-17 08:34:04','2013-09-17 08:34:04','Documento_442.pdf','application/pdf',3483533,'2013-09-17 08:34:04',20,0,98,'COMPLETO'),(441,'Sobre el colapso gravitacional de nubes protoestelares enfriadas por radiaciÃ³Ã³nn','Se estudia el problema del colapso de una esfera considerando el efecto gravitacional y difusivo.. Para modelar mÃ¡Ã¡s adecuadamenteel efecto difusivo en el problema se hace la suposiciÃ³Ã³nn mÃ¡Ã¡s general en cuanto al coeficiente de difusiÃ³Ã³nn,, es decir,, Ã©Ã©ste depende de la densidad y temperatura.. Por otra parte,, se emplea un grupo de transformaciones autosimilares para lograr transformar un problema de ecuaciones diferenciales en derivadas parciales,, a un problema en ecuaciones diferenciales en derivadas ordinarias.. AdemÃ¡Ã¡s,, dada