ndo mensajero y/ o regular diversos procesos biolÃ³gicos. En astrocitos, la [Ca2+]i puede cambiar en respuesta a estÃ­mulos como un \"shock\" hipo-osmÃ³tico (similar al generado durante patologÃ­as como isquemia e hiponatremia), responsable de inducir la liberaciÃ³n de Ca2+ a partir de reservorios intracelulares como el retÃ­culo endoplasmÃ¡tico (ER), que generan un incremento en la seÃ±al de Ca2+ citosÃ³lica controlada por la actividad en modo directo del intercambiador Na+/ Ca2+ (NCX); que es el principal mecanismo regulador de la [Ca2+]i en astrocitos t-1. Adicionalmente, el NCX puede actuar en modo reverso frente a un desbalance del flujo de Na+, encontrando que este modo de operaciÃ³n es considerablemente incrementado si ademÃ¡s se encuentra en presencia de un medio hipo-osmÃ³tico libre de Na+externo (Na+e). I Los resultados del presente trabajo, ponen en evidencia el posible mecanismo por el cual se produce un aumento en la [Ca2+]i frente a un shock hipo-tÃ³nico libre de Na+e, indicando que las alteraciones que se producen en el citoesqueleto frente a este medio inducen un incremento en la actividad en modo reverso del NCX. Estas alteraciones corresponden a la disrupciÃ³n o despolimerizaciÃ³n de los F-actina, de forma similar a la generada por toxinas de actina como Citocalasina D (CD) y Latrunculina B (Lat B). El incremento en la actividad del NCX se evidenciÃ³ frente a los medios iso-osmÃ³tico e hipo-osmÃ³tico, luego de la despolimerizaciÃ³n de los F-actina; observando en ambos casos un incremento en la seÃ±al de Ca2+i medida mediante microespectrofluorometria y perfusiÃ³n. Otro hallazgo observado, fue el aumento en la fluorescencia asociada a la identificaciÃ³n del NCX y en el coeficiente de correlaciÃ³n entre el NCX y los F-actina, frente a un medio iso- osmÃ³tico y en condiciones de despolimerizaciÃ³n, lo que sugiere una interacciÃ³n directa entre ambas estructuras y en consecuencia un posible aumento en la expresiÃ³n del NCX. En este trabajo se presentan