aen ambientes contrastantes respecto al impacto antrÃ³Ã³ppico','Dra. Estrella Villamizar, Tutora La intensificaciÃ³n de las actividades antrÃ³picas, con el inicio de la RevoluciÃ³n Industrial, produjo impactos notorios sobre los ecosistemas marinos, ya que Ã©stos son sitios primordiales de recepciÃ³n de efluentes industriales y domÃ©sticos, asÃ­ como asiento de diferentes actividades productivas como pesquerÃ­a, transporte de bienes y personas, y turismo. Los ecosistemas marinos estÃ¡n sujetos a una gran cantidad de perturbaciones. Actualmente los estudios de impacto ambiental consideran sus anÃ¡lisis desde el nivel molecular hasta ecosistemico, incluyendo la amplia gama de especies que representan diferentes niveles trÃ³ficos y hÃ¡bitats, para dar una visiÃ³n en conjunto de las presiones que se mantienen sobre estos (Cebrian, y col. 2006). Los metales pesados son elementos que se encuentran entre los contaminantes mÃ¡s frecuentes resultantes de las actividades antrÃ³picas; sin embargo, la determinaciÃ³n e interpretaciÃ³n del comportamiento de estos elementos en el medio marino es compleja, debido a la naturaleza y caracterÃ­sticas del medio. En todo caso, la calidad quÃ­mica de las aguas, sedimentos y de la biota marina pueden ser reflejo de la contaminaciÃ³n a la cual ha estado sometida un Ã¡rea especÃ­fica. Esta investigaciÃ³n llevÃ³ a cabo una evaluaciÃ³n comparativa de las concentraciones de metales pesados en dos especies de esponjas marinas en diferentes localidades de la costa venezolana, con el objetivo de evaluar su posible capacidad para reflejar las condiciones del entorno marino en cuanto a la contaminaciÃ³n con estos elementos. La selecciÃ³n de esponjas se debe a que son organismos sÃ©siles, exclusivamente filtradores y desarrollan su ciclo de vida en un mismo lugar. Estos rasgos los hacen potencialmente Ãºtiles como biomonitores, bioindicadores o \"vigilantes\" biolÃ³gicos. Para ello se determinaron las concentraciones de Pb, Cd, Ni, Cr y Cu en las esponjas marinas,Amphimedon viridis y Niphates erecta y en los sedimentos de dos ambientes arrecifales contrastantes respecto a su impacto antrÃ³pico, uno ubicado en el Parque Nacional ArchipiÃ©lago de Los Roques especÃ­ficamente en la zona de Dos Mosquises, sin ninguna influencia de industrias pesadas, aunque si del trÃ¡nsito turÃ­stico de embarcaciones y otro en la BahÃ­a de BergantÃ­n, estado AnzoÃ¡tegui, ubicada frente a una refinerÃ­a petrolera, con un trÃ¡nsito pesado de buques y recepciÃ³n de descargas domÃ©sticas e industriales. Las esponjas fueron procesadas a travÃ©s de una digestiÃ³n Ã¡cida en horno microondas, en tanto que para los sedimentos se llevÃ³ a cabo un protocolo de extracciÃ³n secuencial BCR-701 que incluyo hasta sus etapas 1 y 2 (total de metales biodisponibles). Las concentraciones totales de los elementos traza en ambos tipos de muestras se determinaron por EspectrometrÃ­a de AbsorciÃ³n AtÃ³mica ElectrotÃ©rmica (ETAAS) y adicionalmente se hizo la determinaciÃ³n de materia orgÃ¡nica total (MOT) y granulometrÃ­a de los sedimentos. A travÃ©s de los anÃ¡lisis estadÃ­sticos, se determinÃ³ que existen interacciones significativas para las concentraciones de nÃ­quel (Ni), cromo (Cr) y cobre (Cu) entre las dos especies y las dos localidades, siendo los niveles promedio de la concentraciÃ³n de nÃ­quel para Niphates erecta significativamente mayores en el P. N. A. Los Roques, en comparaciÃ³n a las concentraciones de cromo (Cr) que presentaron diferencias significativas para las dos localidades, siendo las concentraciones de ambas especies mayores en BahÃ­a de BergantÃ­n que en el P. N. A. Los Roques. La concentraciÃ³n de cobre (Cu) fue significativamente mayor para la especie N.. erecta en la BahÃ­a de BergantÃ­n respecto a la media de la misma especie en el P. N. A. Los Roques y las concentraciones de A.. viridis en ambas localidades estudiadas. Las concentraciones de plomo (Pb) y cadmio (Cd) se analizaron por pruebas unifactoriales dando diferencias significativas entre los valores promedio de localidades (el Pb resultÃ³ mayor en la BahÃ­a de BergantÃ­n y el cadmio en el P. N. A. de Los Roques), mas no entre las especies. Por otro lado, se determinaron las concentraciones en los sedimentos para las dos primeras etapas de la extracciÃ³n secuencial y se encontrÃ³ que las mismas fueron significativamente mayores para el Pb, Cr y Cu en el P. N. A. Los Roques que para la BahÃ­a de BergantÃ­n, pero no se observaron diferencias significativas entre las dos localidades para el Cd y el Ni. Las concentraciones de cobre y nÃ­quel son las mÃ¡s altas entre los metales analizados en los sedimentos de ambas localidades y estos son tambiÃ©n los metales mÃ¡s acumulados por ambas especies de porÃ­feros; sin embargo no hay una estricta proporcionalidad entre Ã©stas. Las inconsistencias de los contenidos de metales pesados entre las esponjas y los sedimentos, la podemos atribuir principalmente a las diferencias en las caracterÃ­sticas mineralÃ³gicas de los sedimentos de cada zona de estudio (mayoritariamente carbonatos para P. N. A. de Los Roques en contraste con mayoritariamente terrÃ­genos alumino-silicatos para la BahÃ­a de BergantÃ­n), asÃ­ como tambiÃ©n a las diferencias en la hidrodinÃ¡mica de los sitios. Como conclusiones de este trabajo podemos decir que existe bioacumulaciÃ³n de los metales pesados en ambas especies de esponjas, N.. erecta y A.. viridis., Niphates erecta en general fue la especie que acumulÃ³ mÃ¡s metales pesados (Pb= 0,55-2,6mg g-1; Ni= 3,3-23mg g-1; Cu= 11-19mg g-1) comparada con A.. viridis (Cd= 0,79-2,31mg g-1 Cr= 0,33-2,8mg g-1; Cu=10,4-10,6mg g-1). El metal que fue bioacumulado en mayor concentraciÃ³n para las dos especies de esponjas en ambas localidades fue el cobre (Cu), lo que sugiere que pueden existir en estos organismos mecanismos especÃ­ficos de incorporaciÃ³n y retenciÃ³n de este elemento.','2010-10-25','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',1,1,1,1,1,'2013-09-17 08:34:32','2013-09-17 08:34:32','Documento_454.pdf','application/pdf',1775451,'2013-09-17 08:34:32',19,0,96,'COMPLETO'),(453,'Funciones de VariaciÃ³n Acotada geeralizada y un Teorema de RepresentaciÃ³n de Chistyakov.','En este trabjo especial de grado se expone de manera explÃ­cita la nociÃ³n de VariaciÃ³n Acotada, dando la definiciÃ³n, ejemplos, propiedades tanto para un itnervalo cerrado [a,b] como para un sub conjunto E de los nÃºmeros Reales. Se demuestra que la clase BV[a,b] posea una estructura de espacio vectorial, espacio de Banach y un Ã¡lgebra de Banach.TambiÃ©n se demuestra la generalizacion de esta nociÃ³n de VariaciÃ³n Acotada en el sentid de Wiener. y se dota a la clase BV [a,b] en el sentido de Wiener de espacio vactorial, espacio de Banach y Ã¡lgebra de Banach.Se hace la representaciÃ³n de la nociÃ³n de variaciÃ³n acotada mediante el famoso Teorema de representaciÃ³n de Jordan y el Teorema de RepresemtaciÃ³n de Chistyakov estas son otras caracterizaciones de la nociÃ³n de VariaciÃ³n Acotada.','2010-10-18','nociÃƒÂ³n de variaciÃƒÂ³n acotada. generalizacion y caracterizaciÃƒÂ³n de tres maneras diferentes de la nociÃƒÂ³n de variaciÃƒÂ³n acotada.',5,1,1,1,1,'2013-09-17 08:34:33','2013-09-17 08:34:33','Documento_455.pdf','application/pdf',1417511,'2013-09-17 08:34:33',20,0,93,'COMPLETO'),(454,'Efecto CitotÃ³Ã³xxico de seco--ent--kauranos de Croton micans en cÃ©Ã©lulas PC--33 ((cÃ¡Ã¡ncer de prÃ³Ã³sstata)) y HeLa ((cÃ¡Ã¡ncer de ÃºÃºttero)):: CombinaciÃ³Ã³nn con compuestos seco-- ent--kauranos y fÃ¡Ã¡rmacos antitumorales','El cÃ¡ncer de prÃ³stata es uno de los cÃ¡nceres mÃ¡s frecuentes en el mundo, al igual que el cÃ¡ncer de cÃ©rvix. Los tratamientos clÃ¡sicos para el cÃ¡ncer se enmarcan en el campo de la cirugÃ­a, quimioterapia y radioterapia. Sin embargo se ha observado que algunos tumores no responden a los fÃ¡rmacos, mientras que otros pueden desarrollar resistencia a medida que el tratamiento es aplicado al paciente. Por esta razÃ³n se ha mostrado un gran interÃ©s por el uso de plantas como agentes antitumorales. El objetivo del presente trabajo es estudiar la actividad citotÃ³xica de productos naturales aislados de la especie Croton micans,, pertenecientes al grupo seco-ent- kauranos, en cÃ©lulas de cÃ¡ncer de prÃ³stata y cÃ¡ncer de Ãºtero, asÃ­ como la combinaciÃ³n de estos productos, y con fÃ¡rmacos antitumorales que son utilizados en los tratamientos quimioterapÃ©uticos contra el cÃ¡ncer. Para ello se realizaron ensayos de citotoxicidad con lÃ­neas tumorales PC3 (prÃ³stata), HeLa (Ãºtero) y fibroblastos dÃ©rmicos. El ensayo empleado, MTT, (Mosmann, 1983), luego de las 72 horas de incubaciÃ³n permite calcular los valores de concentraciÃ³n inhibitoria (CI50) especÃ­fica para cada uno de los productos naturales sobre las lÃ­neas celulares. AdemÃ¡s se obtuvieron los Ã­ndices de selectividad, asÃ­ como las relaciones dosis- respuesta y las combinaciones entre los productos naturales y los fÃ¡rmacos antitumorales Adriamicina y Mitomicina C. Los resultados obtenidos en este estudio reflejan que el grupo de seco-ent-kauranos evaluados presenta una marcada citotoxicidad sobre las lÃ­neas tumorales PC3 y HeLa con respecto a las cÃ©lulas control, siendo el EMCM 125 en PC3 y HeLa, y el EMCM 128 y EMCM 145 los que poseen mayor efecto sobre las PC3. En relaciÃ³n a las combinaciones, los resultados reflejan un sinergismo en los compuestos evaluados cuando son combinados entre sÃ­, contrario a esto, cuando los kauranos son combinados con los fÃ¡rmacos antitumorales, se observa un antagonismo fuerte en los diferentes tipos celulares. En base a los resultados de este trabajo se puede inferir que los compuestos pertenecientes al grupo seco-ent- kauranos aislados de Croton micans muestran una inhibiciÃ³n sobre la viabilidad celular en las lÃ­neas tumorales PC-3 y HeLa, a medida que aumenta la dosis administrada de los compuestos, del mismo modo el efecto citotÃ³xico de las combinaciones entre los compuestos es mÃ¡s potente sobre las cÃ©lulas en comparaciÃ³n con la acciÃ³n de cada uno individualmente.','2010-06-18','citotÃ³xicidd, Croton micans, cÃ©ncer de prÃ³stata, cÃ¡ncer de Ãºtero.',1,1,1,1,1,'2013-09-17 08:34:35','2013-09-17 08:34:35','Documento_456.pdf','application/pdf',38765509,'2013-09-17 08:34:35',20,0,132,'COMPLETO'),(455,'Patrones de Accesibilidad Web para la construcciÃ³n de interfaces de usuario: Un medio de inclusiÃ³n para personas con discapacidades visuales','En la actualidad y de manera general, existe una gran cantidad de desarrolladores de software que estÃ¡n acostumbrados a crear aplicaciones Web para las masas, sin tomar en cuenta a las personas con discapacidades dando como resultado aplicaciones muy poco o nada accesibles a Ã©stas y en particular a las que poseen discapacidades visuales. Actualmente existen diversos grupos de investigaciÃ³n e iniciativas promoviendo la creaciÃ³n de pÃ¡ginas Web accesibles. La WAI (Web Accessibility Iniciative) es una de ellas. Perteneciente a la W3C (Wold Wide Web Consortium), la WAI se ha abocado a la creaciÃ³n de un extenso compendio de guÃ­as de accesibilidad. El objetivo principal de este Trabajo Especial de Grado es proporcionar una soluciÃ³n a los desarrolladores, que ayude a minimizar el problema que presentan las personas con discapacidades, especÃ­ficamente con discapacidades visuales al momento de acceder la Web. La soluciÃ³n se logrÃ³ mediante Patrones de Accesibilidad Web, creados y validados a travÃ©s de la ejecuciÃ³n de las siguientes cuatro (4) etapas: 1.- SelecciÃ³n de un conjunto de sitios Web a fin de evaluar su accesibilidad; 2.- RealizaciÃ³n de una serie de pruebas de accesibilidad a los sitios seleccionados para determinar los problemas existentes; 3.- CreaciÃ³n de un conjunto de patrones de accesibilidad que faciliten el desarrollo de sitios Web accesibles a las personas con discapacidades visuales; 4.- AplicaciÃ³n de los Patrones de Accesibilidad a un caso de estudio. Incluyendo en el desarrollo de un caso de estudio los Patrones de Accesibilidad Web, se logra generar una aplicaciÃ³n Web accesible a las personas con discapacidades visuales.','2010-10-25','accesibilidad, accesibilidad Web, discapacidades, discapacidad visual, patrones de accesibilidad.',2,1,1,1,1,'2013-09-17 08:34:38','2013-09-17 08:34:38','Documento_457.pdf','application/pdf',4454729,'2013-09-17 08:34:38',20,0,113,'COMPLETO'),(456,'ESTUDIOS DE FORMACIÃ“NN DE COMPLEJOS DE NÃQQUEL((II)) CON LOS AMINOÃCCIDOS:: PROLINA,, GLICINA,, a--ALANINA Y b--ALANINA,, MEDIANTE MEDIDAS DE EMF((H)) EN NaCl 11,,00 M A 2255Â°Â°C','La investigaciÃ³n llevada en Ã©ste Trabajo Especial de Grado versÃ³, sobre el estudio de la formaciÃ³n de los complejos formados entre el nÃ­quel divalente y los ligandos a- alanina, b-alanina, glicina y prolina. En el presente trabajo se estudiaron los sistemas: H+ - a-alanina H+ - Ni (II) - a-alanina H+ - b-alanina H+ - Ni(II) - b-alanina H+ - glicina H+ - Ni(II) - glicina H+ - prolina H+ - Ni(II) - prolina por medio de medidas de fuerza electromotriz emf(H) a 25ÂºC y en NaCl 1,0 M como medio iÃ³nico inerte. El anÃ¡lisis de los datos experimentales de cada sistema se realizÃ³ mediante el programa de mÃ­nimos cuadrados LETAGROP y LETAGROP/FONDO, obteniÃ©ndose los valores de pKa para los ligandos y sus constantes de estabilidad bPqr. Las siguientes tablas muestran los resultados obtenidos. Tabla I..Valores de pKa obtenidos para cada uno de los ligandos, medidos en NaCl 1,0 M a 25Â°C. Especies H++-- a--alanina pKa H++--b--alanina pKa H++-- glicina pKa H++-- prolina pKa [H2C]+/[HC] 2,53(3) 3,70(4) 2,54(4) 2,10(2) [HC]/[C]- 9,68 (3) 9,98(4) 9,44(4) 10,42(3) DispersiÃ³n s(ZC) 0,023 0,031 0,033 0,019 Tabla II.. Complejos obtenidos con sus constantes de formaciÃ³n, log bpqr para los sistemas: H+ - Ni(II)- a-alanin