s de los proyectos gestionados por el PSGP. Una vez seleccionadas todas las herramientas y tÃ©cnicas se lleva a cabo la implementaciÃ³n de las mismas y las pruebas necesarias para comprobar su correcto funcionamiento. El objetivo principal de este Trabajo Especial de Grado consiste en el anÃ¡lisis, selecciÃ³n e implementaciÃ³n de un conjunto de herramientas y tÃ©cnicas de la GestiÃ³n de las Comunicaciones basadas en las descritas en el PMBOK, el desarrollo de las interfaces de usuario y modelos de datos correspondientes, ademÃ¡s del conjunto de manuales de usuario y sistema necesarios; permitiendo asÃ­ el desarrollo de un Prototipo de Software de seguimiento y control para la GestiÃ³n de las Comunicaciones de Proyectos.','2010-10-28','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:34:40','2013-09-17 08:34:40','Documento_459.pdf','application/pdf',1557432,'2013-09-17 08:34:40',20,0,92,'COMPLETO'),(458,'Desarrollo de una AplicaciÃ³Ã³nn Web para la Biblioteca Alonso Gamero que permita el almacenamiento,, gestiÃ³Ã³nn y bÃºÃºssqueda de la ProducciÃ³Ã³nn Intelectual de la Facultad de Ciencias de la Universidad Central de Venezuela','El siguiente Trabajo Especial de Grado aborda la localizaciÃ³n y el difÃ­cil acceso que tiene la ProducciÃ³n Intelectual de la Facultad de Ciencias de la Universidad Central de Venezuela, mÃ¡s especÃ­ficamente de los Trabajos Especiales de Grado (T.E.G.) de pregrado. En el marco teÃ³rico se explican los conceptos asociados a la gestiÃ³n del conocimiento y su relaciÃ³n con las aplicaciones Web, el formato de documento electrÃ³nico mÃ¡s comÃºn y los motores de bÃºsqueda que manipulan estos documentos electrÃ³nicos. En el marco aplicativo se muestran las etapas del desarrollo de una aplicaciÃ³n Web con un motor de