macenar fÃ³sforo como fuente de energÃ­a para las plantas. Posee la capacidad de establecer fuertes interacciones con minerales esenciales de nuestra nutriciÃ³n, comprometiendo los niveles de Ã©stos en el organismo. Motivados por esta particularidad antinutricional, se han desarrollado numerosos mÃ©todos para cuantificar el Ã¡cido fÃ­tico, siendo los procedimientos cromatogrÃ¡ficos los mÃ¡s comÃºnmente empleados. Sin embargo, cuando las muestras contienen un alto contenido de metales, como es el caso de los cereales infantiles, se reportan valores de Ã¡cido fÃ­tico por defecto, atribuidos al procedimiento del tratamiento de muestra, en especial, a la etapa de extracciÃ³n fase sÃ³lida.Con la finalidad de estudiar el efecto de los metales en esta etapa de tratamiento de muestra, se realizÃ³ un estudio de la recuperaciÃ³n del Ã¡cido fÃ­tico para muestras sintÃ©ticas con y sin metales (Fe y Ca), las cuales se midieron por espectrometrÃ­a de absorciÃ³n molecular UV- Visible. Para las muestras sin metales el porcentaje de recuperaciÃ³n estuvo en el orden del 75 %, y la pÃ©rdida se atribuyÃ³ fundamentalmente a la etapa de eliminaciÃ³n del HCl. En cuanto a las muestras preparadas con calcio y hierro, se observÃ³ una disminuciÃ³n de los porcentajes de recuperaciÃ³n, obteniÃ©ndose valores entre 57 y 69 %, que resultÃ³ mÃ¡s evidente al estudiar el efecto combinado de ambos metales (38 %).Para corregir el efecto de los metales, se propuso emplear Ã¡cido tricloroacÃ©tico en vez de HCl, para simular la matriz de la muestra. Los resultados demostraron una mejora en los porcentajes de recuperaciÃ³n (71 %), concluyendo entonces, que para el estudio de cereales, en especial los de consumo infantil, es recomendable extraer el Ã¡cido fÃ­tico con Ã¡cido tricloroacÃ©tico, planteando una concentraciÃ³n Ã³ptima de 0,3 M de dicho Ã¡cido.','2010-10-19','Ã¡cido fÃ­tico, metales, extracciÃ³n en fase sÃ³lida, bajos porcentajes de recuperaciÃ³n',6,1,1,1,1,'2013-09-17 08:34:58','2013-09-17 08:34:58','Documento_468.pdf','application/pdf',1613832,'2013-09-17 08:34:58',20,0,120,'COMPLETO'),(466,'AnÃ¡lisis numÃ©rico del efecto de la AnisotropÃ­a de Superficie en NanopartÃ­culas FerromagnÃ©ticas','En este trabajo hacemos un estudio numÃ©rico de los efectos de la anisotropÃ­a superficial en cantidades termodinÃ¡micas de nanopartÃ­culas ferromagnÃ©ticas cÃºbicas, representadas mediante un modelo mixto de Ising de espines S=0, Â±1. Se consideran interacciones de intercambio a primeros vecinos entre los espines, asÃ­ como los efectos producidos por la anisotropÃ­a de superficie (KS) y de volumen (KV). Variamos el tamaÃ±o de los nanocubos desde un Lo=4 espines por arista, donde la relaciÃ³n superficie-volumen es mayor a uno (S//V>1), hasta Lmax=20 espines con S//V~=0.4, incluyendo un tamaÃ±o intermedio Lu=10 espines, cuya relaciÃ³n SS//V~=1. Usando el mÃ©todo de Monte Carlo se generan configuraciones de importancia, para calcular la energÃ­a por sitio, magnetizaciÃ³n, calor especÃ­fico y susceptibilidad magnÃ©tica. Hemos logrado reproducir con este modelo sencillo, muchos de los comportamientos obtenidos por otros autores con el modelo de Heisenberg. En el caso de la nanopartÃ­cula de menor tamaÃ±o, encontramos cambios importantes en el comportamiento de las cantidades termodinÃ¡micas estudiadas. Encontramos anomalÃ­as en las curvas de magnetizaciÃ³n y susceptibilidad magnÃ©tica caracterÃ­sticas de sistemas nanoscÃ³picos, las cuales se atribuyen al bajo nÃºmero de coordinaciÃ³n y la falta de compensaciÃ³n de los espines de superficie. AsÃ­ mismo, mostramos que el ordenamiento ferromagnÃ©tico o paramagnÃ©tico del sistema depende del la relaciÃ³n entre entre la anisotropÃ­a superficial y la interacciÃ³n de intercambio (Jnn). Encontramos que en el rango donde KS<<--Jnn se observan cambios en la temperatura crÃ­tica (Tc) del sistema, mientras que para KS>>--Jnn, Tc aumenta de manera no lineal.','2010-07-19','AnisotropÃ­a, NanopartÃ­culas ferromagnÃ©ticas, Monte Carlo',3,