ta el momento se harÃ¡ uso de SQL Server como Sistema Manejador de Base de Datos. De igual manera se utilizarÃ¡ como herramienta tecnolÃ³gica para el desarrollo de las interfaces web el lenguaje de programaciÃ³n PHP 5. Por ultimo La aplicaciÃ³n serÃ¡ soportada bajo el servidor web APACHE.','2010-10-28','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:35:15','2013-09-17 08:35:15','Documento_472.pdf','application/pdf',2794077,'2013-09-17 08:35:15',18,0,77,'COMPLETO'),(470,'\"\"DeterminaciÃ³Ã³nn de los Niveles de Mercurio en la Orina de niÃ±Ã±oos en edad escolar de la PoblaciÃ³Ã³nn de El Callao,, en La Zona Minera del Estado BolÃ­Ã­var Venezuela','El mercurio y sus compuestos presentan una alta toxicidad para los humanos y los efectos perjudiciales a la salud pueden ser de mayor magnitud para la poblaciÃ³n infantil. En Venezuela la informaciÃ³n sobre los niveles de mercurio en las zonas mineras es limitada y es importante para evaluar los posibles riesgos de la salud de estos niÃ±os, sobre todo en zonas de alta actividad minera como lo es la poblaciÃ³n de El callao. En este estudio se seleccionaron niÃ±os en edades de 6 a 13 aÃ±os, los cuales habitan en zonas aledaÃ±as al pueblo de El Callao. Se encontraron valores de mercurio en la orina desde no detectable (menor a 0.2 Âµg Hg/L, limite de detenciÃ³n) hasta 167 Âµg Hg/L y con respecto a la creatinina los valores estÃ¡n comprendidos desde valores menores a 3.6 Âµg Hg/g creatinina hasta valores 147 Âµg Hg/g creatinina. Un 38% de Los valores de mercurio encontrados en las muestras de orina, son mayores que los valores referenciales para personas normales (no expuestas) dados por la OMS.','2010-07-09','MERCURIO',6,1,1,1,1,'2013-09-17 08:35:17','2013-09-17 08:35:17','Documento_473.pdf','application/pdf',664804,'2013-09-17 08:35:17',18,0,88,'COMPLETO'),(471,'EMPLEO DE LA TÃ‰Ã‰CCNICA DE DISPERSIÃ“Ã“NN DE LUZ PARA ESTUDIAR LAS PROPIEDADES ESTRUCTURALES DE LOS AGREGADOS DE ASFALTENOS..','Los asfaltenos son una parte del crudo que tiene especial importancia debido a los problemas que ocasionan en todos los procesos de extracciÃ³n y refinaciÃ³n del petrÃ³leo. A partir de mediciones de la intensidad dispersada por agregados de asfaltenos de crudos Furrial y Carabobo se pueden obtener las propiedades estructurales que sirvan para caracterizar y por ende ayudar a predecir el mecanismo de precipitaciÃ³n de las partÃ­culas de asfaltenos durante todas las fases asociadas a la producciÃ³n del petrÃ³leo. El presente trabajo estÃ¡ orientado al estudio de las propiedades estructurales de dichos crudos, en soluciones tolueno-n-heptano, a partir de medidas realizadas mediante la tÃ©cnica de dispersiÃ³n de luz. Las diferencias obtenidas con respectos a cada uno de los crudos sirven para comparar las caracterÃ­sticas de crudos inestables, que tienden a precipitar, como Furrial, con crudos estables, como es el caso de Carabobo. Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle- rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style- priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para- margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Se encontraron diferencias en las medidas de intensidad de luz realizadas para las distintas soluciones de cada asfalteno. En Carabobo se observa que la intensidad medida es independiente de la concentraciÃ³n de la soluciÃ³n. Caso contrario se observa en Furrial, donde al comparar las medidas de intensidad para varias soluciones de distinta concentraciÃ³n, se observan un decaimiento conforme disminuye la concentraciÃ³n. Para ambos tipos de asfaltenos se observa un decaimiento de la intensidad medida conforme aumenta el vector q, el cual estÃ¡ directamente relacionado con el Ã¡ngulo de dispersiÃ³n. La dimensiÃ³n fractal fue estimada para ambos, dando para Carabobo df>2 y para Furrial df<2, lo que corresponde a mecanismos de agregaciÃ³n limitados por reacciÃ³n RLCA y por difusiÃ³n DLCA respectivamente. El mecanismo RLCA que rige la formaciÃ³n de los agregados de asfalteno Carabobo explica la estabilidad de Ã©ste crudo. Lo contrario aplica para asfaltenos Furrial, donde el mecanismo DLCA explica la inestabilidad de Ã©ste crudo. AdemÃ¡s de esto, la dimensiÃ³n fractal en el caso de Carabobo sugiere una estructura densa y mÃ¡s ordenada que para los agregados de Furrial, cuya dimensiÃ³n fractal indica agregados de superficie y menos compactos. En cuanto a los radios de giro calculados para los agregados formados en cada caso, se observa que para Carabobo se tienen estructuras de un tamaÃ±o menor que para el caso de Furrial. En ambos casos los agregados estÃ¡n alrededor de los 2000nm, pero en Furrial se observan tamaÃ±os mayores debidos posiblemente a que el mecanismo RLCA permite la incorporaciÃ³n de un mayor nÃºmero de partÃ­culas al agregado y por lo tanto la extensiÃ³n de Ã©ste aumenta con respecto a los agregados de Carabobo. Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle- rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style- priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para- margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Si bien, el diagrama de Zimm fue realizado, no pudo estimarse del peso molecular de los agregados por problemas asociados al equipo. Sin embargo, de los datos obtenidos se infiere que para Furrial el peso molecular de los agregados es mayor que para los agregados de Carabobo, lo que sugiere que la estructura de los agregados inestables se encuentra formada por un mayor nÃºmero de partÃ­culas. Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;}','2010-10-25','asfaltenos, estructura, crudo inestable, crudo estable, factor de estructura, radio de giro, dimensiÃ³n fractal, diagrama de Zimm',6,1,1,1,1,'2013-09-17 08:35:18','2013-09-17 08:35:18','Documento_474.pdf','application/pdf',3510648,'2013-09-17 08:35:18',18,0,145,'COMPLETO'),(472,'EscÃ¡Ã¡ner 33D de Bajo Costo empleando Webcams','En este trabajo se aplican conceptos y mÃ©todos relativos al procesamiento digital de imÃ¡genes y la computaciÃ³n grÃ¡fica en la construcciÃ³n de un escÃ¡ner 3D de bajo costo que emplea 2 webcams, y que sea capaz de realizar la reconstrucciÃ³n 3D de la geometrÃ­a de un objeto. Para ello, se aplican tÃ©cnicas para la obtenciÃ³n de puntos caracterÃ­sticos que definan la estructura del objeto y se realiza la calibraciÃ³n de las cÃ¡maras empleadas, con el fin de obtener los parÃ¡metros que definen las propiedades de ellas y su ubicaciÃ³n con respecto a un sistema de coordenadas global.La reconstrucciÃ³n de un objeto se realiza utilizando dos cÃ¡maras web, separadas una cierta distancia horizontal entre sÃ­, con las cuales se obtienen dos fotos de una misma escena desde puntos de vista diferentes. A partir de estas imÃ¡genes, y de los parÃ¡metros obtenidos en la calibraciÃ³n, es posible determinar las coordenadas X,Y,Z de cada uno de los puntos que definan la estructura del objeto en cuestiÃ³n. Este trabajo pretende crear un prototipo de software y hardware que permita obtener la reconstrucciÃ³n tridimensional de un objeto, esta informaciÃ³n puede ser empleada, posteriormente, para construir modelos de estudios, con fines recreativos, culturales, mÃ©dicos, entre otros.','2010-10-19','reconstrucciÃ³n 3D, visiÃ³n estereoscÃ³pica, calibraciÃ³n de cÃ¡maras, triangulaciÃ³n de delaunay',2,1,1,1,1,'2013-09-17 08:35:21','2013-09-17 08:35:21','Documento_475.pdf','application/pdf',6156531,'2013-09-17 08:35:21',20,0,126,'COMPLETO'),(473,'MODELO FISICOQUÃÃMMICO EN DOS DIMENSIONES DE LA DIFUSIÃ“Ã“NN DEL IÃ“Ã“NN Ca 22++ EN UN MIOCITO ESQUELÃ‰Ã‰TTICO..','Resumen Cuando una cÃ©lula de mÃºsculo esquelÃ©tico (ME) estÃ¡ expuesta a un determinado estÃ­mulo externo (fÃ­sico, quÃ­mico o elÃ©ctrico) ocurre a una elevaciÃ³n transitorial del nivel de Ca2+ en el citosol y ello origina el acortamiento de la cÃ©lula contrÃ¡ctil y luego, la recaptaciÃ³n del iÃ³n produce la relajaciÃ³n celular. Diversos mecanismos participan en el proceso: canales de calcio dependientes de voltaje (canales de dihidropiridina, DHPR) que permiten la entrada de calcio extracelular cuando se produce despolarizaciÃ³n del sarcolema (SL), canales del tipo \"sensor voltaje\", canales de Ryanodina (RyR) ubicados en la membrana del retÃ­culo sarcoplÃ¡smico (RS) que liberan Ca2+ hacia el citosol por diversos mecanismos, proteÃ­nas buffers que se unen al calcio quelÃ¡ndolo transitoriamente y haciendo su difusiÃ³n mÃ¡s lenta, bombas que sacan Ca2+ del citosol, bien hacia depÃ³sitos intracelulares como el RS (SERCA) o hacia el medio extracelular (PMCA), intercambiadores del SL y de la membrana mitocondrial, entre otros. El RS es el principal almacÃ©n de calcio intracelular en el mÃºsculo estriado y participa de forma determinante en la regulaciÃ³n del proceso acoplamiento-excitaciÃ³n-contracciÃ³n (AEC), regulando las concentraciones intracelulares de calcio durante la contracciÃ³n y la relajaciÃ³n muscular. En este trabajo se modelÃ³ la dinÃ¡mica correspondiente a la evoluciÃ³n de la concentraciÃ³n c(x,y,t) del iÃ³n calcio en el espacio confinado que existe entre las membranas del RS y el sarcolema (\"junctional space\", \"cleft space\") de una cÃ©lula de mÃºsculo esquelÃ©tico, el modelaje se hizo en dos dimensiones y se fundamentÃ³ en la ecuaciÃ³n de difusiÃ³n-reacciÃ³n (D-R) considerando diversas fuentes (liberaciÃ³n impulsiva a travÃ©s de pocos receptores de RyR y flujos de fuga compensatorios) y sumideros (SERCA, PMCA) y la amortiguaciÃ³n del Ca2+ por la parvoalbÃºmina. Al resolver numÃ©ricamente (ya que no tiene soluciÃ³n analÃ­tica) la ecuaciÃ³n de D-R (a la cual se le se le impuso la condiciÃ³n de borde homogÃ©nea de Neumann) mediante el paquete computacional COMSOL Multiphysics3.4 Â® basado en Elementos Finitos se obtuvo la c(x,y,t) en funciÃ³n de la posiciÃ³n para diversos instantes de tiempo y c(x,y,t) en funciÃ³n del tiempo para diversas locaciones del dominio, con liberaciones simultÃ¡neas o no de tres receptores de RyR .','2010-10-28','palabras claves:: mÃºsculo esquelÃ©tico, miocito, iÃ³n calcio, difusiÃ³n-reacciÃ³n, elementos finitos, COMSOL, receptores de RyR.',6,1,1,1,1,'2013-09-17 08:35:34','2013-09-17 08:35:34','Documento_476.pdf','application/pdf',1801166,'2013-09-17 08:35:34',20,0,125,'COMPLETO'),(474,'Desarrollo de adsorbentes de carbÃ³n para purificaciÃ³n de corrientes de refinerÃ­a','PreparaciÃ³n de carbÃ³n a partir de coque de petrÃ³leo con el obejtivo de eliminar molÃ©culas de azufre y nitrÃ³geno, que son consideradas contaminantes, las cuales se encuentran presentes en corrientes de refinerÃ­a provenientes del proceso de craqueo catalitico de lecho fluidizado.','2010-10-07','Adsorbentes, carbÃ³n activado, coque de petrÃ³leo, craqueo catalÃ­tico en lecho fluidizado, regulaciones ambientales (TIER II y Euro 5 y 6).',6,1,1,1,1,'2013-09-17 08:35:35','2013-09-17 08:35:35','Documento_479.pdf','application/pdf',5917410,'2013-09-17 08:35:35',20,0,53,'COMPLETO');
INSERT INTO `documento` VALUES (475,'optimizaciÃ³Ã³nn de los componentes de una formulaciÃ³Ã³nn Ã¡Ã¡lcali,, surfactante y polÃ­Ã­mero ((asp)) con potencial empleo en recuperaciÃ³Ã³nn mejorada de un crudo del occidente del paÃ­Ã­s','Este trabajo contiene los resultados obtenidos en las pruebas de emulsificaciÃ³n espontÃ¡nea de los sistemas ASP. El objetivo de esta investigaciÃ³n, es definir la concentraciÃ³n Ã³ptima de Ã¡lcali, surfactante y polÃ­mero, con potencial empleo en la recuperaciÃ³n mejorada de crudo en un yacimiento al occidente del paÃ­s. Para dar cumplimiento al objetivo planteado, se realizaron pruebas de comportamiento de fase a 55Â°C, temperatura de yacimiento, de sistemas crudo, Ã¡lcali, surfactante, y polÃ­mero, observando el intervalo de concentraciÃ³n donde se produce la zona de emulsificaciÃ³n espontÃ¡nea de la fase acuosa. Los resultados evidenciaron que la concentraciÃ³n Ã³ptima de Ã¡lcali fue 10000 ppm, surfactante 696 ppm y polÃ­mero 2100 ppm, con valores de tensiÃ³n interfacial crudo/agua de 0,002 mN/m, un valor ultra bajo ideal para establecer condiciones propicias que contribuyan al incremento del recobro de petrÃ³leo por el aumento de la evidencia de barrido de crudo en el medio poroso. Para validar las propiedades de esta formulaciÃ³n ASP, se realizaron pruebas de desplazamiento con nÃºcleos de berea bajo condiciones sucedÃ¡neas de yacimiento (temperatura, presiÃ³n, permeabilidad, porosidad y fluidos acuosos y oleico). La recuperaciÃ³n total de crudo promedio fue de 72,32% con respecto al POES, lo que evidenciÃ³ una adecuada eficiencia para la recuperaciÃ³n de petrÃ³leo, logrando disminuir la saturaciÃ³n de petrÃ³leo residual en el medio poroso. Este comportamiento fue debido a la sinergia fisicoquÃ­mica de los componentes de la mezcla ASP, las tensiones interfaciales ultra bajas del agua - petrÃ³leo y por la favorable relaciÃ³n de movilidad causada con el incremento de la viscosidad de la fase acuosa desplazante. Finalmente, se evaluÃ³ la adsorciÃ³n de los componentes de la fÃ³rmula en el medio poroso en las pruebas de desplazamiento analizando los efluentes obtenidos. Se obtuvieron valores de retenciÃ³n de los componentes ASP en la roca y no se evidenciÃ³ problemas de incompatibilidad en los fluidos inyectados en la roca, esto contribuyÃ³ a definir la proporciÃ³n final de los componentes de la formulaciÃ³n ASP. Las pruebas de adsorciÃ³n de los componentes de la fÃ³rmula en el medio poroso mostraron que un 33,45 %m/m de Ã¡lcali, 34,98 %m/m del polÃ­mero y 20,86 %m/m se adsorbieron en la berea. Por otra parte, el 61,16 %m/m del surfactante migrÃ³ hacia el seno del crudo.','2010-10-28','RecuperaciÃ²n mejorada de crudo.Surfactante, Ã lcali y polÃ¬mero (ASP). Factor de recobro de crudo',6,1,1,1,1,'2013-09-17 08:35:37','2013-09-17 08:35:37','Documento_481.pdf','application/pdf',544776,'2013-09-17 08:35:37',19,0,87,'COMPLETO'),(476,'DISTRIBUCIÃ“Ã“NN ESPACIAL Y VARIACIÃ“Ã“NN ESTACIONAL DEL CONTENIDO DE LOS METALES PESADOS:: Cd,, Cr,, Cu,, Hg,, Ni,, Y Pb EN AGUAS Y PECES DEL LAGO DE VALENCIA','El Lago de Valencia, situado en Venezuela entre los estados Aragua y Carabobo, se encuentra entre las ciudades de Valencia y Maracay, importantes centros urbanos e industriales de elevado crecimiento en las Ãºltimas dÃ©cadas. Las aguas residuales y desechos provenientes de las actividades domÃ©sticas, industriales y agrÃ­colas de la zona, llegan al lago mediante sus efluentes y las escorrentÃ­as y atentan contra la calidad de las aguas del lago y la biota que contiene. Los estudios mÃ¡s importantes realizados en la zona, que datan de finales de los aÃ±os 80\'s (MogollÃ³n [28]), seÃ±alaron el enriquecimiento de los sedimentos de fondo del lago con los metales Zn, Cu, Pb y Cr, y pocos estudios aportan informaciÃ³n sobre el contenido de trazas de metales pesados, disueltos en sus aguas y presentes en la biota, debido a limitaciones de la sensibilidad de las tÃ©cnicas analÃ­ticas empleadas. En este trabajo se analizÃ³ el contenido de trazas metÃ¡licas de Cd, Cr, Cu, Ni Hg y Pb disueltas en las aguas y tejido de peces capturados en el Lago de Valencia, durante el semestre noviembre 2009-mayo 2010. Asimismo,se estudiaron las variaciones espaciales y estacionales en la composiciÃ³n de dichas muestras durante el aÃ±o 2009-2010, dando continuidad al trabajo de Palma [11], y al proyecto CDCH-PG-03-00-6495-2006. El anÃ¡lisis quÃ­mico se realizÃ³ mediante ETAAS y CV-AFS, y la data obtenida fue analizada empleando anÃ¡lisis de agrupamiento y de correlaciones mÃºltiples Los resultados mostraron que el contenido de los metales disueltos en las aguas, no supera los valores mÃ¡ximos especificados en la norma EPA [8] para aguas dulces, y en los decretos nacionales 3.219 [24]y 883 [40], por lo que son aptas para el uso de riego y recreaciÃ³n contemplados en estas normativas, que las clasifican como aguas Tipo 2, Sub-tipo 2B. Por otra parte, la concentraciÃ³n de los metales mostrÃ³ variaciones estacionales, observÃ¡ndose una disminuciÃ³n de la concentraciÃ³n de todos los elementos desde el mes de junio 2009, atribuyÃ©ndose al incremento del pH que ocurre en la Ã©poca de lluvias. TambiÃ©n se determinÃ³ que la concentraciÃ³n de los metales disueltos en las aguas del lago, muestra homogeneidad espacial, entre estaciones de muestreo y dentro de la columna de agua, a consecuencia del continuo mezclado de las aguas. Este mezclado es casi total para el mes de enero. El promedio anual de las concentraciones de los metales disueltos en las aguas del Lago de Valencia fueron las siguientes: Cd 0,06 mg L-1, Cr 0,86 mg L-1, Cu 0,57 mg L-1, Hg 0,08 mg L-1, Ni 1,96 mg L-1y Pb 1,18 mg L-1. Las correlaciones significativas obtenidas entre el Pb con el Cd, Cu, Ni y Hg, indicarÃ­an su introducciÃ³n conjunta al cuerpo de agua mediante una fuente y vehÃ­culo comÃºn. Las principales actividades antrÃ³picas que aportan estos metales son de tipo agrÃ­cola (empleo de fertilizantes y pesticidas) e industriales (metalÃºrgicas, baterÃ­as y uso de gasolinas) las cuales se desarrollan en la zona y cuyos desechos llegan al lago mediante los principales tributarios: rÃ­os CaÃ±o Central y Los Guayos al oeste, GÃ¼igÃ¼e al sur, Guey y Tipitapa al este, y Guacara y Mariara al norte. Por otra parte, la concentraciÃ³n de los metales en el hÃ­gado de peces fue superior que en el mÃºsculo, donde las concentraciones de Cd y Cu no superaron los valores mÃ¡ximos permitidos contenidos en las normas COVENIN 1087 [25] y 1766 [26] y en el Codex Alimentarius [27], y las de Cr y Ni no pudieron compararse, ya que no estÃ¡n especificadas en dichas normas. Sin embargo, las concentraciones de Hg obtenidas en mÃºsculo (0,25-0,39 mg Kg-1), sobrepasaron el valor mÃ¡ximo permitido por la norma COVENIN 1087 (0,10 mg Kg-1), y las de Pb (1,1-1,7 mg Kg- 1) sobrepasaron el valor mÃ¡ximo establecido en el Codex Alimentarius (0,3 mg Kg-1), asÃ­ como los indicios de bioacumulaciÃ³n de Hg y Cr, determinados en algunos ejemplares de peces, de acuerdo al factor de bioacumulaciÃ³n (FBC), muestran que el consumo de los peces del Lago de Valencia representa un riesgo para la salud humana. Las diferencias entre los patrones de agrupamiento y correlaciones obtenidas en el mÃºsculo e hÃ­gado de peces, y en el agua, sugiere que el principal aporte de los elementos en la dieta de estos peces depredadores, no es el agua, sino el zooplancton y los sedimentos suspendidos en el agua.','2010-10-28','Lago de Valencia, Metales Pesados, Quimica ambiental, QuÃ­mica de aguas, metales pesados en aguas y peces',6,1,1,1,1,'2013-09-17 08:35:39','2013-09-17 08:35:39','Documento_482.pdf','application/pdf',14557304,'2013-09-17 08:35:39',19,0,207,'COMPLETO'),(477,'CAMBIOS EN EL CARBONO DEL SUELO LUEGO DE LA AFORESTACIÃ“Ã“NN CONAcacia mangium,, EN UNA SABANA VENEZOLANA..','Con la finalidad de incrementar las tasas de circulaciÃ³n del CO2 desde la atmÃ³sfera hasta los sumideros terrestres, en el protocolo de Kyoto se sugieren tres lÃ­neas estratÃ©gicas de mitigaciÃ³n: 1) Incremento y mantenimiento de los niveles de carbono en los sistemas terrestres, mediante el manejo de tierras, la fertilizaciÃ³n y evasiÃ³n de la degradaciÃ³n, 2) Incremento de las cantidades de carbono en Ã¡reas bajo agricultura, con la creaciÃ³n de sistemas agroforestales y 3) Mantenimiento e incremento de las Ã¡reas boscosas, empleando tÃ©cnicas de reforestaciÃ³n y aforestaciÃ³n. El presente trabajo constituye una evaluaciÃ³n a la puesta en prÃ¡ctica de la aforestaciÃ³n como estrategia para la creaciÃ³n de nuevos sumideros de carbono y aumento del potencial de secuestro de carbono en sabanas venezolanas. En el Edo. Anzoategui, la empresa Petropiar iniciÃ³ ensayos pilotos de bosques compensatorios de CO2 con el Ã¡rbol leguminosa de origen australiano, Acacia mangium. El establecimiento de esta especie se ha hecho en Ã¡reas de sabanas de Trachypogon spicatus y Aristida longifolia. Con el objetivo de determinar si las plantaciones de A. mangium han incrementado las cantidades de carbono presentes en un suelo de sabana, se evaluÃ³ la contribuciÃ³n de las fracciones de la materia orgÃ¡nica del suelo al carbono total, la variaciÃ³n en la actividad metabÃ³lica de los suelos y la profundidad a la cual se registran cambios. Para ello se contrastÃ³ una sabana de T.. spicatus con un rodal de A.. mangium de 10 aÃ±os de edad, ubicados adyacentes y separados entre sÃ­ unos 200m. Se identificaron en cada zona tres estratos en el perfil del suelo (E1, E2 y E3) correspondientes a horizontes A, Bt1 y Bt2 de un Haplustox. Se tomaron 6 muestras compuestas en cada horizonte, para un total de 36 muestras (18 muestras por zona).Se encontrÃ³ un aumento promedio de 43,01% del CT en el bosque correspondiente a una diferencia neta de 0,22 tonCOÂ·Kg- 1Â·ha-1. AsÃ­ mismo la cantidad de MOS presentÃ³ un promedio general (media Â±ES) para el bosque de 3,60 Â±0,34% y para la sabana de 2,60 Â±0,41%, lo que representa un aumento de 38,46%. La biomasa de hojarasca en el bosque superÃ³ en un 763,95% a la de la sabana (214,75gÂ·m-2 y 1855,34 gÂ·m-2, respectivamente).En cuanto a la contribuciÃ³n de las diferentes formas del carbono al CT se encontrÃ³ que el Cmic presentÃ³ la mayor variaciÃ³n, con un 163,84%, seguido del CFP con un 50,39% de variaciÃ³n siendo mayor en el bosque, mientras que las diferencias encontradas entre tipos de vegetaciÃ³n en el CFL y el Csol, no fueron significativas. El flujo de CO2 medido como RE resultÃ³ mayor para la sabana (183,05 mgCO2Â·m-2Â·h-1) situando al bosque como menor emisor de este gas con efecto invernadero (123 mgCO2Â·m-2Â·h-1). La contribuciÃ³n del metabolismo microbiano a este hecho fue descartada al no encontrar diferencias significativas entre la RB de las zonas. Por su parte, el qCO2 fue menor para el bosque sugiriendo mayor eficiencia en la mineralizaciÃ³n del carbono y menores condiciones de estrÃ©s para los microorganismos.Los cambios a nivel nutricional se registraron en la concentraciÃ³n de N (0,02%) equivalente a un aumento del 39,27% en el bosque, y Pdis (1,32 mgÂ·g-1) el cual es menor en el bosque en un 65,25%. De los parÃ¡metros fÃ­sicos, el cambio mÃ¡s importante fue en el pH, con una disminuciÃ³n promedio de 0,60 unidades en el bosque (de 4,46 en la sabana a 3,86 en el bosque).De los resultados se extrae que la aforestaciÃ³n con Acacia mangium ha significado el aumento del potencial del secuestro de carbono, favoreciÃ©ndose a su vez la biomasa microbiana y el enriquecimiento de los suelos con nitrÃ³geno, producto de la interacciÃ³n simbiÃ³tica de esta leguminosa. Estos cambios han ocurrido sin que ello suponga un aumento en la emisiÃ³n de CO2 del suelo y sugieren una mayor diferenciaciÃ³n entre la sabana y el bosque en comparaciÃ³n a la Ãºltima evaluaciÃ³n hecha al rodal en el 2006 por Petropiar. Por otra parte, la diminuciÃ³n del pH y el aumento de la materia orgÃ¡nica sugieren limitaciones en la disponibilidad de nutrientes, en especial del fÃ³sforo. Finalmente, los valores de MOS, CT y biomasa de la hojarasca presentados por la sabana testigo son superiores a la mayorÃ­a de las sabanas de Trachypogon sp, en Venezuela, lo que sugiere que con la protecciÃ³n del fuego de estas sabanas, puede tambiÃ©n aumentar su potencial de secuestro de carbono.','2010-06-29','aforestaciÃƒÂ³n, sabanas, Acacia mangium, carbono del suelo, fracciones de la materia orgÃƒÂ¡nica.',1,1,1,1,1,'2013-09-17 08:35:43','2013-09-17 08:35:43','Documento_483.pdf','application/pdf',905841,'2013-09-17 08:35:43',19,0,81,'COMPLETO'),(478,'Desarrollo de un Sistema de Monitoreo de Eletrocardiograma','En este trabajo se elaborÃ³ un dispositivo para monitorear seÃ±ales cardiacas mediante un circuito, una tarjeta de adquisiciÃ³n y una computadora. Se empleÃ³ LabVIEW para visualizar y procesar la seÃ±al obtenida obteniendo los intervalos RR.','2010-09-08','LabVIEW Ritmo Cardiaco Tarjeta de AdquisiciÃ³n',3,1,1,1,1,'2013-09-17 08:35:45','2013-09-17 08:35:45','Documento_484.pdf','application/pdf',9806415,'2013-09-17 08:35:45',20,0,99,'COMPLETO'),(479,'Estudio de los Protocolos de Enrutamiento para Redes Malladas con Restricciones de Ancho de Banda en el Borde','La siguiente investigaciÃ³n se basÃ³ en diseÃ±ar un testbed para estudiar distintos protocolos de enrutamiento para redes malladas, y asÃ­ poder determinar cuÃ¡l de ellos podrÃ­a ofrecer las mejores prestaciones para una red con diferentes nÃºmeros de dispositivos y especificando diversos valores de ancho de banda, al brindarle a la misma acceso a Internet a travÃ©s de un cliente de la red que alcance la seÃ±al de un enrutador inalÃ¡mbrico que se encuentre en una zona cercana y que cuente con dicho servicio. Dicha investigaciÃ³n surge por la idea de utilizar la seÃ±al de enrutadores inalÃ¡mbricos que se encuentren en urbanizaciones de Caracas para brindarle acceso a Internet a barrios aledaÃ±os, ya que muchos hogares en estas urbanizaciones, cuentan con este servicio y muchas veces sucede que la seÃ±al de los enrutadores inalÃ¡mbricos es propagada mÃ¡s allÃ¡ de la frontera del hogar de la persona que cuenta con este servicio y por lo tanto puede ser utilizada para brindar acceso a Internet a los usuarios en los barrrios aledaÃ±os via una red mallada. El desarrollo de una soluciÃ³n como la descrita anteriormente debe comenzar por conocer que protocolo de enrutamiento podrÃ­a ser el mÃ¡s adecuado para este diseÃ±o de red, de otra forma podrÃ­a conllevar a una red con un pobre rendimiento que no cumplirÃ­a con los objetivos deseados. Para dicha investigaciÃ³n se diseÃ±Ã³ un testbed implementando la estructura de la red descrita anteriormente, donde todos los dispositivos trabajaban sobre una plataforma Linux (distribuciÃ³n Ubuntu 10.04) y se hizo uso de diferentes protocolos de enrutamiento como OLSR, BATMAN y Babel (protocolos de enrutamiento proactivos para redes malladas) y herramientas como D-ITG (generador de trÃ¡fico). Se plantearon diferentes escenarios donde variaban aspectos como nÃºmeros de clientes y el ancho de banda disponible para la red mallada, y sobre ellos se realizaron diversas pruebas con el fin de determinar cuÃ¡l es el protocolo de enrutamiento que puede ofrecer las mejores prestaciones para el funcionamiento de una red mallada en las condiciones planteadas. Al analizar los resultados de las diversas mÃ©tricas de desempeÃ±o obtenidas se pudo determinar que el protocolo que mejor se adapta a las condiciones planteadas fue Babel.','2010-10-28','Redes malladas, Protocolos de enrutamiento, OLSR, Babel, BATMAN',2,1,1,1,1,'2013-09-17 08:35:50','2013-09-17 08:35:50','Documento_485.pdf','application/pdf',42232006,'2013-09-17 08:35:50',20,0,155,'COMPLETO'),(480,'Estudio de los Protocolos de Enrutamiento para Redes Malladas con Restricciones de Ancho de Banda','Mariana Colombo 14.00 Normal 0 21 false false false ES-VE X-NONE X-NONE / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes;