de todos los dispositivos trabajaban sobre una plataforma Linux (distribuciÃ³n Ubuntu 10.04) y se hizo uso de diferentes protocolos de enrutamiento como OLSR, BATMAN y Babel (protocolos de enrutamiento proactivos para redes malladas) y herramientas como D-ITG (generador de trÃ¡fico). Se plantearon diferentes escenarios donde variaban aspectos como nÃºmeros de clientes y el ancho de banda disponible para la red mallada, y sobre ellos se realizaron diversas pruebas con el fin de determinar cuÃ¡l es el protocolo de enrutamiento que puede ofrecer las mejores prestaciones para el funcionamiento de una red mallada en las condiciones planteadas. Al analizar los resultados de las diversas mÃ©tricas de desempeÃ±o obtenidas se pudo determinar que el protocolo que mejor se adapta a las condiciones planteadas fue Babel.','2010-10-28','Redes Malladas, Protocolos de Enrutamiento, OLSR, Babel, BATMAN.',2,1,1,1,1,'2013-09-17 08:35:56','2013-09-17 08:35:56','Documento_486.pdf','application/pdf',5092738,'2013-09-17 08:35:56',20,0,74,'COMPLETO'),(481,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((IV)) Y ARGININA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES ((KCl 33..00 M,, 2255 ÂºÂºC))','Se estudiÃ³ mediante medidas de fuerzas electromotrices emf(H), la determinaciÃ³n de las constantes de acidez del aminoÃ¡cido Arginina y la formaciÃ³n de los complejos de vanadio (IV) con la arginina en soluciÃ³n acuosa a 25 ÂºC y en KCl 3,0 M como medio iÃ³nico inerte. En el anÃ¡lisis de los datos potenciomÃ©tricos mediante el programa computacional LETAGROP, se obtuvieron los siguientes resultados de los valores de las constantes de acidez para la Arginina, pKa11 == 22,,3366 ((22)),, pKa22== 99,,7744 ((22)) y pKa33== 1122,,5566 ((22)) , e igualmente la formaciÃ³n de cantidades significativas de los complejos con sus respectivas constantes de formaciÃ³n: EspeciespqrLog bpqr ((33s))[H22VOC]++332 1 125.00 (3)[((OH))22VO((HC))]-1 1 110.3 <10.6[H44VOC22]44++4 1 2 48.7 (2)[H33VOC22]33++3 1 245.96 (3)[((OH))VO((HC))22]++1 1 236.06 (6)','2010-10-27','COMPLEJOS - VANADIO (IV) - ARGININA - AMINOACIDOS',6,1,1,1,1,'2013-09-17 08:35:57','2013-09-17 08:35:57','Documento_487.pdf','application/pdf',12060559,'2013-09-17 08:35:57',19,0,71,'COMPLETO'),(482,'EVALUACION DE NIVELES DE MERCURIO EN AGUAS,, SEDIMENTOS,, Y PECES EN EL RIO YURUARI,, EN LAS CERCANIAS DE EL CALLAO,, ESTADO BOLIVAR..','Dado que en la poblaciÃ³n de El Callao se lleva a cabo la minerÃ­a artesanal, para lo cual se utiliza el mercurio en el proceso de concentraciÃ³n del oro, en este trabajo se planteÃ³ como objetivo realizar una evaluaciÃ³n de los niveles de mercurio en el sector del rÃ­o Yuruari cercano a la poblaciÃ³n de El Callao; debido a que este rÃ­o es la principal fuente de abastecimiento de agua potable para Ã©sta poblaciÃ³n. Se evaluÃ³ la concentraciÃ³n de mercurio en aguas, sedimentos y peces muestreados en Febrero y Marzo del 2010. La concentraciÃ³n de mercurio en agua y sedimentos fue determinada por espectrometrÃ­a de fluorescencia atÃ³mica con generaciÃ³n de vapor y para las muestras de peces se utilizÃ³ la espectrometrÃ­a absorciÃ³n atÃ³mica por vaporizaciÃ³n tÃ©rmica. Se obtuvieron lÃ­mites de detecciÃ³n de 0,004 ng/mL, 0,01Âµg/Kg Y 0,005 Âµg/Kg, para agua, sedimentos y peces respectivamente. Los resultados de los factores de recuperaciÃ³n del mercurio para las muestras de agua, y sedimentos estuvieron dentro del rango aceptado, lo cual indica una buena exactitud de los mÃ©todos utilizados. Para las muestras de agua se obtuvo una mediana de concentraciÃ³n de 0,76 Â± 0,7 ng/mL de mercurio en un intervalo de 0,03 y 2,26 ng/mL, el valor de la mediana se encuentra por debajo de la concentraciÃ³n permitida por los organismos nacionales e internacionales para aguas de consumo humano, la cual es de 1 ng/mL, para las muestras de sedimentos se obtuvo una mediana de concentraciÃ³n de mercurio de 215 Âµg/Kg, con un intervalo de concentraciones entre 74 y 691 Âµg/Kg, cuyo valor se encuentra por encima de los valores de concentraciÃ³n de fondo para la zona de El Callao que se encuentran entre 170 y 200 Âµg/Kg. Para las muestras de peces, la mediana de la concentraciÃ³n fue de 360 Âµg/Kg, con intervalo de concentraciones entre 67 y 574 Âµg/Kg, donde se observÃ³ que algunas muestras sobrepasaron el lÃ­mite de concentraciÃ³n permitida para el consumo humano segÃºn la EPA de 500 Âµg/Kg.','2010-10-21','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',6,1,1,1,1,'2013-09-17 08:35:59','2013-09-17 08:35:59','Documento_488.pdf','application/pdf',3786672,'2013-09-17 08:35:59',20,0,93,'COMPLETO'),(483,'AplicaciÃ³Ã³nn de tÃ©Ã©cnicas nucleares sobre acuÃ­Ã­feros contaminados con gas natural','Integrantes del laboratorio de FÃ­sica Nuclear de la Universidad SimÃ³n BolÃ­var, Caracas, Venezuela, han aplicado tÃ©cnicas nucleares para determinar las posibles causas de contaminaciÃ³n por gases naturales en aguas de pozos pertenecientes a la localidad de TascabaÃ±a, comunidad indÃ­gena ubicada en el Estado AnzoÃ¡tegui. Es importante destacar que bajo estos suelos se encuentra una de las mayores reservas de agua subterranea de AmÃ©rica Latina, por esto el grado de importancia que implica el identificar las posibles fuentes de contaminaciÃ³n de estos pozos, para asÃ­, evitar daÃ±os mayores a Ã©ste acuÃ­fero. A travÃ©s de medicionesin situ se obtuvieron mapas de la distribuciÃ³n superficial de la radiactividad Gamma y de la concentraciÃ³n de RadÃ³n en los gases del suelo. Para el anÃ¡lisis Gamma espectromÃ©trico se utilizÃ³ un espectrÃ³metro Gamma de baja resoluciÃ³n energÃ©tica con detector BGO. Para evaluar las concentraciones de RadÃ³n en los poros del suelo se realizaron mediciones instantÃ¡neas utilizando Celdas Lucas acopladas al equipo Paylon AB-5. El caso que se describe forma parte de un conjunto de resultados experimentales que relacionan las anomalÃ­as superficiales del Potasio, Uranio y RadÃ³n con microfiltraciones desde los depÃ³sitos de hidrocarburos. El RadÃ³n-222 se utilizÃ³ como trazador natural radiactivo en el transporte de gases naturales a travÃ©s del suelo y para evaluar su posible particiÃ³n en las aguas por la presencia de fases liquidas no acuosas (NAPLs), mientras que la espectrometrÃ­a Gamma sirviÃ³ como indicador de cambios geoquÃ­micos superficiales inducidos por la migraciÃ³n de hidrocarburos hasta la superficie. Los resultados obtenidos muestran zonas con comportamientos anÃ³malos de las variables estudiadas indicando la(s) posible(s) fuente(s) de contaminaciÃ³n. Se destacan dos zonas anÃ³malas, una desde el pozo petrolero y otra desde un sitio prÃ³ximo a las emanaciones en el rÃ­o, que se orientan con valores decrecientes en las variables medidas hacÃ­a los sitios donde estÃ¡n los pozos de agua contaminados, pareciendo indicar la pluma contaminante. No obstante, para una mejor interpretaciÃ³n los resultados deben integrarse a la informaciÃ³n regional, que comprende datos como la geologÃ­a, topografÃ­a, hidrologÃ­a superficial y el sistema de fracturas y fallas','2010-10-27','Potasio, Uranio, RadÃ³n, radiactividad, espectrometrÃ­a gamma, geofÃ­sica, geoquÃ­mica, gas natural, hidrocarburos, acuÃ­feros.',3,1,1,1,1,'2013-09-17 08:36:00','2013-09-17 08:36:00','Documento_489.pdf','application/pdf',876861,'2013-09-17 08:36:00',19,0,51,'COMPLETO'),(484,'CONTROL DE MICROORGANISMOS PATÃ“GENOS Y DETERIORATIVOS EN NARANJA (Citrus sinensis L.) Y MANGO (Mangifera indica L.) FRESCOS CORTADOS USANDO SUSTANCIAS ANTIMICROBIANAS NATURALES.','La demanda de alimentos sanos como las frutas y hortalizas frescas cortadas por parte del consumidor es cada vez mayor, debido a un aumento en la promociÃ³n del consumo de estos alimentos como parte de una dieta sana. La industria de alimentos ha respondido a dicha demanda elaborando productos frescos sometidos a un mÃ­nimo proceso que limite el crecimiento de los microorganismos y que mantenga los atributos nutricionales y sensoriales. No obstante, un manejo inadecuado de estos alimentos durante su procesamiento podrÃ­a traer como consecuencia la presencia de microorganismos patÃ³genos como Salmonella y E.. coli.. Por tal motivo el objetivo principal de esta investigaciÃ³n fue evaluar la efectividad de sustancias antimicrobianas de origen de plantas como una alternativa para reducir los niveles de Salmonella entÃ©Ã©rica serv. Saintpaul y Escherichia coliO157:H7 en naranja variedad \"Valencia\" y mango variedad \"Haden\" frescos cortados. Para esto, se determinaron las concentraciones mÃ­nimas inhibitorias (CMI) de Ginseng, Ginkgo biloba, Extracto de semillas y cÃ¡scaras de uvas roja y Aloe vera por el mÃ©todo de discos de papel de filtro. De estas sustancias seleccionamos Ginseng por su mayor efectividad y lo aplicamos solo o en combinaciÃ³n con Ã¡cidos orgÃ¡nicos (cÃ­trico o mÃ¡lico), una sal (sorbato de potasio) y lactato de calcio mediante un diseÃ±o factorial de mÃºltiples niveles (2 x 2 x 2 x 4 x 2 x 2) a naranjas y mangos de madurez intermedia mediante tratamientos de inmersiÃ³n por 1 a 2 minutos. La aplicaciÃ³n de una combinaciÃ³n de todos los compuestos tuvo un efecto sinÃ©rgico en la reducciÃ³n de la poblaciÃ³n de los patÃ³genos en ambas frutas, siendo las combinaciones ideales en naranja (mÃ¡ximas reducciones de 2,99 Log UFC/g Salmonella y 1,56 Log UFC/g E.. coli): Ginseng 3%, Ã¡c. MÃ¡lico 1% y sin la adiciÃ³n de sorbato y lactato, mientras que en mango (mÃ¡ximas reducciones de 2,1 Log UFC/g Salmonella y 2,0 Log UFC/g E.. coli) fue Ginseng 3%, Ã¡c. MÃ¡lico 1%, sorbato 0,05% y lactato 0,75%. AdemÃ¡s estas combinaciones de sustancias causaron una disminuciÃ³n en el crecimiento de la flora nativa, extendiendo la vida Ãºtil desde un punto de vista microbiolÃ³gico. Sin embargo, algunas caracterÃ­sticas fÃ­sicas, quÃ­micas y sensoriales de las frutas fueron afectadas levemente. Con los resultados obtenidos se puede considerar que el uso de compuestos de origen vegetal solos o combinados resulta efectivo para reducir los niveles de microorganismos patÃ³genos y deteriorativos en frutas frescas cortadas, logrando extender su vida Ãºtil.','2010-10-27','Frutas frescas cortadas, Salmonella, Escherichia coliO157:H7, antimicrobianos',1,1,1,1,1,'2013-09-17 08:36:01','2013-09-17 08:36:01','Documento_490.pdf','application/pdf',1228462,'2013-09-17 08:36:01',20,0,119,'COMPLETO'),(485,'Propuesta para la ImplementaciÃ³Ã³nn de un Servicio de Hilos Musicales utilizando IPv66 Multicast','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} El objetivo del presente Trabajo Especial de Grado consiste en investigar los requerimientos necesarios para habilitar un Servicio de Hilos Musicales sobre IPv6 Multicast para la Universidad Central de Venezuela. Esta investigaciÃ³n se basa en el estudio de la tecnologÃ­a Multicast, la infraestructura y configuraciÃ³n necesaria para este tipo de servicios en un entorno IPv6. El trabajo empieza con un proceso de investigaciÃ³n de la tecnologÃ­a Multicast, que contempla su origen, evoluciÃ³n e interacciÃ³n con los nuevos estÃ¡ndares de comunicaciÃ³n IP. Posteriormente, en base a dicha investigaciÃ³n, se propone una infraestructura de red que abarca protocolos, estÃ¡ndares, tecnologÃ­as y equipos necesarios para implementar un servicio de Hilos Musicales sobre IPv6 Multicast. El protocolo de enrutamiento multicast ha utilizar es PIM-SM, debido a que es uno de los protocolos mÃ¡s utilizados en este tipo de ambientes, definido formalmente en un RFC y adoptado por las principales compaÃ±Ã­as fabricantes de dispositivos de red. Por otra parte, para el servicio de difusiÃ³n de los hilos musicales, y tras una investigaciÃ³n de las aplicaciones disponibles, se utilizÃ³ Microsoft Windows Media Service 9 como servidor de streaming debido a un conjunto de caracterÃ­sticas importantes, tales como soporte de formatos de audio ampliamente desplegados en Internet, fÃ¡cil instalaciÃ³n y administraciÃ³n, soporte IPv6 y Multicast, entre otros. Finalmente, este trabajo provee, ademÃ¡s de una propuesta para un Servicio de Hilos Musicales para la UCV, una implementaciÃ³n del servicio para la Facultad de Ciencias.','2010-07-07','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:36:04','2013-09-17 08:36:04','Documento_491.pdf','application/pdf',0,'2013-09-17 08:36:04',20,0,0,'INCOMPLETO'),(486,'\"\"DETERMINACIÃ“Ã“NN DE LOS NIVELES DE HIERRO,, ZINC Y COBRE EN NIÃ‘Ã‘OOS EN EDAD ESCOLAR,, EN LA POBLACIÃ“Ã“NN DE EL CALLAO,, EDO.. BOLÃÃVVAR\"\"','El Fe, el Cu y el Zn son los oligoelementos mÃ¡s abundantes en el organismo, se encuentran en concentraciones menores a 1 mg/mL en los tejidos corporales. Ellos son esenciales para el crecimiento Ã³ptimo y el desarrollo de los seres humanos. La carencia de los mismos es un criterio para el diagnostico de la desnutriciÃ³n. La OMS menciona que la desnutriciÃ³n puede ser un factor que intensifique los efectos tÃ³xicos del mercurio, el cual es un elemento no esencia y absolutamente ajeno a cualquier funciÃ³n fisiolÃ³gica del ser humano, pero no reportan datos que los comprueben. El objetivo de este trabajo fue estudiar los niveles de Fe, Zn, Cu en el suero sanguÃ­neo de los niÃ±os la poblaciÃ³n de El Callao Estado BolÃ­var, con la finalidad de evaluar su estado nutricional y estudiar su correlaciÃ³n con los niveles de mercurio en sangre y orina. Para este propÃ³sito se utilizaron las tÃ©cnicas de espectrometrÃ­a de emisiÃ³n atÃ³mica con plasma inductivamente acoplado yespectrometrÃ­Ã­a de absorciÃ³Ã³nn atÃ³Ã³mmica con llama.. Del mismo modo con la finalidad de caracterizar la poblaciÃ³n en estudio se elaborÃ³ y realizÃ³ una encuesta epidemiolÃ³gica, para recolectar informaciÃ³n referente a la vida del niÃ±o, edad, sexo, hÃ¡bitos alimenticios, profesiÃ³n de los padres, entre otros. En este estudio se seleccionaron niÃ±os en edades de 6 a 13 aÃ±os y se tomaron las escuelas como elemento central para la recolecciÃ³n de las muestras. Se encontraron valores de Fe, Cu y Zn, en un rango de (0,48-1,19) mg/L, (0,67-1,15) mg/L, (0,84-1,19) mg/L respectivamente, los cuales se encuentran entre los valores reportados en la bibliografÃ­a. Del mismo modo se encontrÃ³ que no existen correlaciÃ³n estadÃ­sticamente significativa entre la concentraciÃ³n de Fe, Cu y Zn la concentraciÃ³n Hg en sangre y orina, para un nivel de confianza del 90%. En general se encontrÃ³ que la poblaciÃ³n infantil estudiada, la cual es una muestra representativa de la poblaciÃ³n infantil del pueblo de El Callao, tiene una alimentaciÃ³n balanceada, presenta talla y pesos normales para su edad y presentan caracterÃ­sticas de una poblaciÃ³n sana.','2010-07-12','Hierro, zinc, cobre, mercurio, nutriciÃƒÂ³n',6,1,1,1,1,'2013-09-17 08:36:05','2013-09-17 08:36:05','Documento_492.pdf','application/pdf',2190524,'2013-09-17 08:36:05',19,0,94,'COMPLETO'),(487,'EvaluaciÃ³n de un cultivo de fresa (Fragaria x ananassaDuch.) afectado por manchas foliares ocasionadas porMycosphaerella fragariae ((Tul..)) Lindau ((anamorfo::Ramularia brunnea Peck..))','El cultivo de fresa se ha expandido por todo el mundo por su adaptabilidad y escasas exigencias; sin embargo, es afectado por variadas enfermedades de origen fÃºngico. La mÃ¡s frecuente es la mancha foliar comÃºn o mancha pÃºrpura causada por Mycosphaerella fragariae(Ramularia brunnea) que produce manchas redondeadas de color pÃºrpura y centro necrÃ³tico en todos los Ã³rganos vegetativos de la planta. El objetivo del presente estudio fue registrar el avance de la mancha foliar comÃºn y la presencia de compuestos fenÃ³licos en un cultivo de fresa. Para esto se recolectaron muestras de fresa, cultivar Camino Real, en la Colonia Tovar y se determinÃ³ la incidencia y severidad de la mancha pÃºrpura. Se prepararon cÃ¡maras hÃºmedas y se extrajeron los compuestos fenÃ³licos por medio de un macerado en metanol. Estos se analizaron por cromatografÃ­a en capa fina de sÃ­lica gel y se cuantificaron por el mÃ©todo de Folin-Ciocalteau. Se presentaron los primeros sÃ­ntomas en la 5o semana del cultivo alcanzando la mÃ¡xima incidencia (50-60%) en la 14oy manteniÃ©ndose asÃ­ hasta el final del estudio. La severidad promedio presentÃ³ valores entre 2,55 y 5,21% lo que clasifica al cultivar como de baja susceptibilidad. Ademas de R.. brunnease encontraron otros 9 patÃ³genos foliares, destacÃ¡ndose por su frecuencia Phyllosticta fragariicola, Alternaria alternatay Colletotrichumspp. La concentraciÃ³n de fenoles aumentÃ³ con la severidad de la enfermedad, siendo significativamente mayor en hojas con severidades mayores al 5% con respecto a hojas sanas, sin embargo no se hallaron compuestos nuevos en la cromatografÃ­a como respuesta a la infecciÃ³n.','2010-06-22','FitopatologÃ­a, fresa, Fragaria x ananassa, mancha pÃºrpura, Mycosphaerella fragariae, fenoles',1,1,1,1,1,'2013-09-17 08:36:09','2013-09-17 08:36:09','Documento_493.pdf','application/pdf',1622475,'2013-09-17 