 mso-hansi-theme-font: minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor- bidi;} El granitoÃ­de de Timotes conforma un cuerpo granÃ­tico ubicado en los Andes de MÃ©rida, el cual es intrusivo en rocas de edad Neoproterozoica y Paleozoica Temprano, principalmente. Mediante el presente trabajo, el granitoÃ­de de Timotes fue estudiado geoquÃ­micamente con la finalidad de caracterizarlo, clasificarlo e inferir su ambiente tectÃ³nico de formaciÃ³n. Un total de 20 muestras fueron tomadas a lo largo del cuerpo granÃ­tico, para la determinaciÃ³n de los elementos quÃ­micos mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE). Los elementos quÃ­micos mayoritarios y los elementos trazas, incluyendo a los REE, fueron determinados por EspectrometrÃ­a de EmisiÃ³n Ã“ptico con Plasma Inductivamente Acoplado (ICP-- OES) y EspectrometrÃ­a de Masas con Plasma Inductivamente Acoplado (ICP--MS) respectivamente, despuÃ©s de una fusiÃ³n alcalina. Los anÃ¡lisis quÃ­micos fueron realizados mediante el apoyo irrestricto del Instituto Nacional de GeologÃ­a y MinerÃ­a (INGEOMIN). Los resultados obtenidos mediante el anÃ¡lisis quÃ­mico permitieron caracterizar geoquÃ­micamente el granitoÃ­de de Timotes, encontrÃ¡ndose que este cuerpo estÃ¡ integrado por granitos (sensu estricto) y granodioritas, de naturaleza calcoalcalina, altas en potasio; son rocas peralumÃ­nicas posiblemente generadas por anatexis de rocas sedimentarias (metagrauvacas y ortogneises cuarzo-feldespÃ¡ticos) en ambientes de convergencia de placas (zona de subducciÃ³n). Los granitoÃ­des de Valera- La Puerta y Timotes estÃ¡n en contacto de falla con rocas del Complejo Iglesias (Proterozoico TardÃ­o-NeoProterozoico) en los Andes de MÃ©rida. La gran similitud entre las caracterÃ­sticas geoquÃ­micas de ambos cuerpos, tanto en los componentes mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE), asÃ­ como su naturaleza calcoalcalina y peralumÃ­nica sugiere una relaciÃ³n comagmÃ¡tica; no obstante, las edades determinadas por el mÃ©todo U-Pb, segÃºn Burkley (1976), son significativamente diferentes (593 Â± 16 millones de aÃ±os (Ma) para el granitoÃ­de de Valera- La Puerta y 434 Â± 7 Ma para el de Timotes). Con los adelantos actuales en el mÃ©todo U-Pb para realizar geocronologÃ­a merece que dichas edades sean revisadas.','2010-09-09','Granitoide; Zona de convergencia de placas; caracterizaciÃ³n geoquÃ­mica; clasificaciÃ³n geoquÃ­mica; EspectrometrÃ­a Ã³ptica; EspectrometrÃ­a de masas.',4,1,1,1,1,'2013-09-17 08:36:11','2013-09-17 08:36:11','Documento_495.pdf','application/pdf',1425198,'2013-09-17 08:36:11',18,0,98,'COMPLETO'),(490,'ESTUDIO GEOQUÃÃMMICO DEL GRANITOIDE DE TIMOTES,, ESTADO MÃ‰Ã‰RRIDA','El granitoÃ­de de Timotes conforma un cuerpo granÃ­tico ubicado en los Andes de MÃ©rida, el cual es intrusivo en rocas de edad Neoproterozoica y Paleozoica Temprano, principalmente. Mediante el presente trabajo, el granitoÃ­de de Timotes fue estudiado geoquÃ­micamente con la finalidad de caracterizarlo, clasificarlo e inferir su ambiente tectÃ³nico de formaciÃ³n. Un total de 20 muestras fueron tomadas a lo largo del cuerpo granÃ­tico, para la determinaciÃ³n de los elementos quÃ­micos mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE). Los elementos quÃ­micos mayoritarios y los elementos trazas, incluyendo a los REE, fueron determinados por EspectrometrÃ­a de EmisiÃ³n Ã“ptico con Plasma Inductivamente Acoplado (ICP-- OES) y EspectrometrÃ­a de Masas con Plasma Inductivamente Acoplado (ICP--MS) respectivamente, despuÃ©s de una fusiÃ³n alcalina. Los anÃ¡lisis quÃ­micos fueron realizados mediante el apoyo irrestricto del Instituto Nacional de GeologÃ­a y MinerÃ­a (INGEOMIN). Los resultados obtenidos mediante el anÃ¡lisis quÃ­mico permitieron caracterizar geoquÃ­micamente el granitoÃ­de de Timotes, encontrÃ¡ndose que este cuerpo estÃ¡ integrado por granitos (sensu estricto) y granodioritas, de naturaleza calcoalcalina, altas en potasio; son rocas peralumÃ­nicas posiblemente generadas por anatexis de rocas sedimentarias (metagrauvacas y ortogneises cuarzo-feldespÃ¡ticos) en ambientes de convergencia de placas (zona de subducciÃ³n). Los granitoÃ­des de Valera- La Puerta y Timotes estÃ¡n en contacto de falla con rocas del Complejo Iglesias (Proterozoico TardÃ­o-NeoProterozoico) en los Andes de MÃ©rida. La gran similitud entre las caracterÃ­sticas geoquÃ­micas de ambos cuerpos, tanto en los componentes mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE), asÃ­ como su naturaleza calcoalcalina y peralumÃ­nica sugiere una relaciÃ³n comagmÃ¡tica; no obstante, las edades determinadas por el mÃ©todo U-Pb, segÃºn Burkley (1976), son significativamente diferentes (593 Â± 16 millones de aÃ±os (Ma) para el granitoÃ­de de Valera- La Puerta y 434 Â± 7 Ma para el de Timotes). Con los adelantos actuales en el mÃ©todo U-Pb para realizar geocronologÃ­a merece que dichas edades sean revisadas.','2010-09-09','Granitoide; zona de convergencia de placas; CaracterizaciÃ³n geoquÃ­mica; clasificaciÃ³n geoquÃ­mica; EspectrometrÃ­a Ã³ptica; EspectrometrÃ­a de masas.',4,1,1,1,1,'2013-09-17 08:36:12','2013-09-17 08:36:12','Documento_496.pdf','application/pdf',9804055,'2013-09-17 08:36:12',18,0,98,'COMPLETO'),(491,'EVALUAR LA ACTIVIDAD CATALÃÃTTICA HACIA REACCIONES DE HIDROTRATAMIENTO DE LCO EMPLEANDO CATALIZADORES SULFURADOS DE Ni--V','RESUMEN El consumo de los combustibles fÃ³siles ha producido la disminuciÃ³n de las reservas de crudos livianos y medianos, lo que ha llevado a un aumento en la extracciÃ³n y refinaciÃ³n de crudos pesados y extrapesados. Sin embargo, este tipo de crudos posee altos contenidos de elementos potencialmente contaminantes como el azufre, lo cual genera problemas de Ã­ndole ambiental por lo que es necesario desarrollar procesos eficientes que eliminen dichos contaminantes dada las restricciones ambientales que en los Ãºltimos tiempos se han vuelto mÃ¡s estrictas. El hidrotratamiento es el proceso catalÃ­tico mÃ¡s apropiado para la eliminaciÃ³n de dichos elementos, pero hay que tomar en cuenta que al tratar crudos pesados y extrapesados con este tipo de proceso se debe utilizar catalizadores que puedan soportar las severas condiciones de reacciÃ³n requeridas al tratar este tipo de cargas. Se ha prestado considerable atenciÃ³n al desarrollo de catalizadores y procesos para mejorar LCO ya que este por sus caracterÃ­sticas fÃ­sicas se puede procesar a travÃ©s de la reacciones de hidrotratamiento para la obtenciÃ³n de diesel que cumpla con las regulaciones de tipo ambiental; para eso se busca desarrollar nuevos catalizadores mucho mÃ¡s activos y menos susceptibles al envenenamiento de los sitios activos, lo que conllevarÃ­a a la eventual venta del mismo en los paÃ­ses consumidores de combustible. En este trabajo los sÃ³lidos se sintetizaron por el mÃ©todo de precipitaciÃ³n en medio homogÃ©neo (HPS) bajo atmosfera de nitrÃ³geno. Las relaciones nominales Ni/Ni+V fueron 0; 0,25; 0,50; 0,75 y 1. Luego de agitaciÃ³n por 6 horas se conservaron en una caja seca. La caracterizaciÃ³n de los catalizadores se realizÃ³ por medio de difracciÃ³n de rayos X (DRX), Ã¡rea especÃ­fica (BET) y volumen de poro.Por medio del anÃ¡lisis quÃ­mico elemental se constatÃ³ que las relaciones Ni/(Ni+V) obtenidas son bastantes diferentes de los valores nominales en los casos de los catalizadores NiV-0,50 (0.36) y NiV-0,75 (0.46) pero no para el NiV-0.25 cuyo valor real es NiV-0,22. Se realizÃ³ DRX antes y despuÃ©s de reacciÃ³n y se detectaron en ambos casos mezclas de las fases NiV2S4y NiV4S8. Se determinÃ³ el Ã¡rea especÃ­fica y el volumen de poro por adsorciÃ³n de N2 y Ar. Los cuales son bastante bajos, tÃ­picos de catalizadores no soportados. Una vez hecha la caracterizaciÃ³n se evaluÃ³ la actividad catalÃ­tica para las reacciones de HDS, HDN y HYD de LCO en un equipo diseÃ±ado para operar a alta presiÃ³n a una temperatura de 375 ÃŒÂŠC y a 30 atm. La presulfuraciÃ³n se realizÃ³ a presiÃ³n atmosfÃ©rica y 300Â°C por 2 horas empleando CS2. En todos los casos el catalizador que presentÃ³ la mayor actividad fue el NiV-0,25. Los valores de gravedad API demuestra que los catalizadores mantienen el carÃ¡cter ligero del LCO mientras que con el NiMo desmejora esta propiedad y por Ãºltimo la destilaciÃ³n simulada refleja que el catalizador NiV-0,25 presenta la capacidad de hidrogenar y asÃ­ generar productos livianos.','2010-10-25','Catalizadores Ni-VLCOHidrotratamientohidrodesulfuracionHidrodesnitrogenacion',6,1,1,1,1,'2013-09-17 08:36:16','2013-09-17 08:36:16','Documento_497.pdf','application/pdf',2158525,'2013-09-17 08:36:16',19,0,111,'COMPLETO'),(492,'CONTENIDO DE LÃPIDOS, COLESTEROL Y PERFIL DE PROTEÃNAS EN EL CURITO (Hoplosternum littorale) (HANCOCK, 1828) EN DOS DIFERENTES Ã‰POCAS DEL AÃ‘O','Los curitos o bucos (Hoplosternum littorale), se encuentra en toda AmÃ©rica del Sur, especÃ­ficamente desde Venezuela hasta Argentina. Son peces suramericanos pertenecientes a la familia Callichthyidae y se encuentran ampliamente distribuidos en los llanos de Venezuela. Se caracterizan por tener un cuerpo olivÃ¡ceo oscuro, cubierto por dos series de placas Ã³seas, boca terminal y sin dientes en los adultos y tallas pequeÃ±as que oscilan entre 150 a 200 mm de largo estÃ¡ndar. Durante la estaciÃ³n seca se mantienen en charcas aisladas, las que pueden habitar debido a la posesiÃ³n de adaptaciones fisiolÃ³gicas y anatÃ³micas, tal como la posibilidad de respirar aire, gracias a una modificaciÃ³n del tracto digestivo. Esta respiraciÃ³n accesoria los torna aptos para vivir en Ã¡reas pantanosas pobres en oxigeno. Se observa ademÃ¡s en la especie un dimorfismo sexual caracterizado por un macho mÃ¡s grande y con la aleta pectoral modificada armada de un proceso espinoso fuerte ademÃ¡s de la construcciÃ³n de un nido flotante a base de restos vegetales y burbujas y un cuido tenaz de la crÃ­a por parte del macho. La especie H. littorale es considerada como omnÃ­vora, ya que consume algas asociadas al fondo pero principalmente micro crustÃ¡ceos y larvas de insectos. Por tratarse de una especie poco aprovechada en nuestro paÃ­s y de gran potencial comercial en los mercados de Trinidad hasta la UniÃ³n Europea donde es considerada una exquisitez, el objetivo de evaluar la variaciÃ³n de los lÃ­pidos y las proteÃ­nas del curito (Hoplosternum littorale) Hancock, 1828 en dos diferentes Ã©pocas del aÃ±o. Se observaron diferencias significativas (P<0,05) en cuanto a la variaciÃ³n entre las dos etapas evaluadas de la grasa , la proteÃ­na y la cenizas aumentando tanto la grasa como la proteÃ­na en la etapa 2 y disminuyendo la cenizas; la humedad se mantuvo invariable. El contenido de grasas en la etapa 2 aumenta, notÃ¡ndose tambiÃ©n un incremento en el contenido de testosterona y estradiol mientras que para el colesterol la se observa unadisminuciÃ³n lo que refleja una relaciÃ³n inversamente proporcional del colesterol con las dos hormonas dado que la disminuciÃ³n de colesterol coincide con aumentos de testosterona y estradiol.','2010-07-14','LÃPIDOS COLESTEROL',1,1,1,1,1,'2013-09-17 08:36:18','2013-09-17 08:36:18','Documento_498.pdf','application/pdf',1696497,'2013-09-17 08:36:18',17,0,127,'COMPLETO'),(493,'DESARROLLO DE UN METODO ANALITICO PARA LA DETERMINACION DE ACETAMINOFEN,, FENILEFRINA Y SUS PRODUCTOS DE DEGRADACION EN FORMULACIONES FARMACEUTICAS PARA EL RESFRIADO COMUN','En este trabajo de investigaciÃ³n, se desarrollÃ³ un mÃ©todo de cromatografÃ­a lÃ­quida en fase reversa para la separaciÃ³n simultÃ¡nea de acetaminofÃ©n, fenilefrina, clorfeniramina y los posibles productos de degradaciÃ³n del acetaminofÃ©n (Dimeros) y la fenilefrina (o-pc, ciclaciÃ³n en la posiciÃ³n \"orto\" del anillo fenÃ³lico) y (p-pc, ciclaciÃ³n en la posiciÃ³n \"para\" del anillo fenÃ³lico), mediante el uso de un software especializado (OptichromLC) en el modelado de la cromatografÃ­a lÃ­quida en fase reversa a travÃ©s de la construcciÃ³n y evaluaciÃ³n de los perfiles de retenciÃ³n (log k Vs %B) de los analitos de interÃ©s. La instrumentaciÃ³n empleada para la separaciÃ³n cromatogrÃ¡fica de estos siete (7) compuestos fue una columna Waters Xbridge de 150 mm de longitud, 4,6 mm de diÃ¡metro interno y 3,5 mm de tamaÃ±o de partÃ­cula. AdemÃ¡s, se utilizÃ³ un flujo de fase de mÃ³vil de 1 mL min -1 con un gradiente de solvente constituido por metanol/soluciÃ³n de tetraborato de sodio (10 mM) a pH 9,38. Adicionalmente, se evaluÃ³ figuras de mÃ©rito como la especificidad, linealidad, intervalo lineal de respuesta, lÃ­mite de cuantificaciÃ³n, lÃ­mite de detecciÃ³n, exactitud y precisiÃ³n del mÃ©todo cromatogrÃ¡fico. Finalmente, se aplicÃ³ el mÃ©todo cromatogrÃ¡fico para el monitoreo de los analitos de interÃ©s en un producto farmacÃ©utico comercial. Encontrando que el mÃ©todo cromatogrÃ¡fico desarrollado y optimizado con el uso de OptichromLC, es adecuado para el anÃ¡lisis simultÃ¡neo de acetaminofÃ©n, fenilefrina, clorfeniramina y los productos de degradaciÃ³n propuestos en este trabajo (dimeros del acetaminofÃ©n, o-pc y p-pc).','2010-10-28','ACETAMINOFEN,, FENILEFRINA,, PRODUCTOS DE DEGRADACION,, MODELADO Y OPTIMIZACION VIA SOFTWARE,, OPTICHROMLC',6,1,1,1,1,'2013-09-17 08:36:19','2013-09-17 08:36:19','Documento_499.pdf','application/pdf',2633242,'2013-09-17 08:36:19',20,0,97,'COMPLETO'),(494,'ColonoscopÃ­a virtual usando tÃ©cnicas de optimizaciÃ³n de Ray Casting','Realizar el render por software de una colonoscopÃ­a obtenida a travÃ©s de una resonancia magnÃ©tica que permita navegar dentro del colon y visualizarlo usando solo recursos bÃ¡sicos. OptimizaciÃ³n del render por software del volume rendering y uso de hilos para acelerarlo. Resaltado de zonas de importancia.','2010-07-06','Volume Rendering, ColonoscopÃƒÂ­a Virtual, Ray Casting, Optimizaciones rendering, render multihilos, Software render, Importance Driven Volume Rendering',2,1,1,1,1,'2013-09-17 08:36:20','2013-09-17 08:36:20','Documento_500.pdf','application/pdf',3204646,'2013-09-17 08:36:20',18,0,160,'COMPLETO'),(495,'DETERMINACIÃ“Ã“NN DE LOS MÃÃRRGENES DE LA ENFERMEDAD SUB-- CLÃÃNNICA TUMORAL POR MEDIO DE LA CLASIFICACIÃ“Ã“NN DE LOS PATRONES EN LOS VALORES DE LA ESCALA DE GRISES DE UNA IMAGEN MULTICANAL','En el presente trabajo se propone un procedimiento de segmentaciÃ³n para imÃ¡genes que presenten tumores a nivel del sistema nervioso central, basado en la morfologÃ­a matemÃ¡tica. Este procedimiento considera el uso de imÃ¡genes de resonancia magnÃ©tica multimodalidad, de manera que cada pÃ­xel representativo de la imagen esta descrito por un vector n- dimensionalidad, donde n dependerÃ¡ del numero de modalidades de IRM que hayan sido adquiridas y las componentes de estos vectores vendrÃ¡n dadas por el nivel de gris correspondiente a cada modalidad de IRM. Las imÃ¡genes son analizadas por medio de un filtro morfolÃ³gico n-dimensional denominado filtro de excentricidad, el cual no es mas que una extensiÃ³n de los operadores bÃ¡sicos de la morfologÃ­a matemÃ¡tica adaptado para imÃ¡genes multicanal. Este filtro fue utilizado para obtener imÃ¡genes, donde se resaltaran en unas las zonas oscuras y en otras las zonas claras, esto reemplazando cada pÃ­xel por el pÃ­xel mas representativo dentro de su elemento estructurante, por ejemplo el que presentara la mÃ­nima distancia total hacia el resto de los pixeles en el elemento estructurante. Sobre el gradiente morfolÃ³gico resultante de estas imÃ¡genes se aplico la transformada de \"watershed\" (TW) (divisiÃ³n de cuencas), obteniendo asÃ­ imÃ¡genes segmentadas, siendo los sectores de estas homogenizados por el pÃ­xel mas representativo de la regiÃ³n y a continuaciÃ³n analizados por un algoritmo de agrupamiento, con el fin de reducir la cantidad de zonas obtenidas en un principio por el operador TW. Por ultimo se hizo el reconocimiento de las zonas de carÃ¡cter tumoral y de aquellas que pudieran representar la extensiÃ³n de la lesiÃ³n, siendo estas zonas resaltadas en las imÃ¡genes originales suprimiendo bien sea una o dos de las coordenadas del cÃ³digo RGB que comprenden estas imÃ¡genes.','2010-11-02','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',3,1,1,1,1,'2013-09-17 08:36:21','2013-09-17 08:36:21','Documento_501.pdf','application/pdf',3337211,'2013-09-17 08:36:21',20,0,115,'COMPLETO'),(496,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((IV,,V)) VALENCIA MIXTA CON AMINOACIDOS..SISTEMA H++ -- V((IV,, V)) -- VALINA ((KCl 33,,00 M,, 2255 Â°Â°C))','Este trabajo especial de grado se baso en la determinacion de las constantes de acidez(pka) y las costantes de formacion para diferentes relaciones(R=2, R=4 y R=9), de un sistema de valencia mixta vanadio(IV/V) con el aminoacido Valina .','2010-10-28','Vanadio(IV/V) valencia mixta con valina',6,1,1,1,1,'2013-09-17 08:36:22','2013-09-17 08:36:22','Documento_502.pdf','application/pdf',2197504,'2013-09-17 08:36:22',19,0,0,'INCOMPLETO'),(497,'DiseÃ±o de la Red de Ãrea Local InalÃ¡mbrica para el Edificio de Aulas de la Facultad de Ciencias de la UCV','El presente trabajo especial de grado tiene como objetivo elaborar y proponer el diseÃ±o de una soluciÃ³n inalÃ¡mbrica basada en el estÃ¡ndar IEEE 802.11 para la conectividad del Edificio de Aulas de la Facultad de Ciencias de la UCV con su red de datos existente.','2010-11-01','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:36:23','2013-09-17 08:36:23','Documento_503.pdf','application/pdf',0,'2013-09-17 08:36:23',20,0,0,'INCOMPLETO'),(498,'Efectos de hongos aislados de yuca y sus metabolitos sobre el crecimiento in vitrode esta planta','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; text-align:justify; line- height:200%; mso-pagination:widow-orphan; font-size:11.0pt; font-family: \"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font: minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor- latin;} El objetivo de este trabajo es conocer el efecto que tienen hongos aislados de la yuca (Manihot esculenta)) y sus metabolitos sobre el crecimiento in vitro de estas plantas. Para esto se tomaron muestras de plantas de yuca con sÃ­ntomas de sÃºper-alargamiento en Masparro, Municipio Cruz Buredes, Edo. Barinas, Venezuela. Las hojas, tallos y peciolos de estas plantas fueron esterilizadas superficialmente con hipoclorito de sodio al 3% y etanol al 70%. Los microorganismos que crecieron del material vegetal fueron transferidos a agar zanahoria suplementado con ampicilina y carbenicilina a una concentraciÃ³n final de 0,1 mg/mL. Posteriormente se realizÃ³ un cultivo monospÃ³rico por diluciones seriadas, para lo cual se adicionaron 100 mL de una suspensiÃ³n de conidios a una concentraciÃ³n de 100 conidios/mL en tween 2200 al 0,005%, a agar agua. Los cultivos axÃ©nicos de los 18 hongos aislados se conservaron de dos formas, utilizando el mÃ©todo de Castellani y sumergidos en glicerol al 30%. Los experimentos se realizaron con las variedades 35 y 98 de plÃ¡ntulas de yuca, proporcionadas por la Agricultura y SoberanÃ­a Alimentaria de la FundaciÃ³n IDEA. Para conocer el efecto de los hongos aislados sobre las plantas de yuca, se utilizaron dos estrategias. Primero, para conocer el efecto de los metabolitos producidos por los hongos, sobre el crecimiento in vitro de plantas de yuca, se incubÃ³ cada hongo, durante una semana, en un medio de crecimiento rico en carbono y limitado en nitrÃ³geno con una proporciÃ³n 1:19 C: N. Por cuantificaciÃ³n del consumo de nitrÃ³geno y carbono se determinÃ³ la fase del metabolismo alcanzada por los hongos. Posteriormente, el sobrenadante de los hongos incubados se infiltrÃ³ en hojas de yuca. Comparando los efectos producidos con un control de Ã¡cido acetil salicÃ­lico, se observÃ³ que algunos hongos mimetizaban la respuesta de hipersensibilidad en las hojas. Segundo, se infectaron plÃ¡ntulas de yuca, crecidas in vitro, con micelio en crecimiento de los hongos aislados. Los cambios inducidos por los hongos y sus metabolitos fueron analizados realizando un ANOVA donde la variable en estudio fue la longitud de los entrenudos de las plÃ¡ntulas infectadas y de los controles, los cuales fueron plÃ¡ntulas de yuca sin infectar. Los resultados del ANOVA no fueron significativos con respecto a las plÃ¡ntulas control. En el experimento de infecciÃ³n no se observÃ³ los sÃ­ntomas caracterÃ­sticos de la enfermedad de sÃºper-alargamiento, sin embargo, cuatro hongos fueron patÃ³genos, causando la muerte de la planta, donde la variedad 35 mostrÃ³ ser mÃ¡s susceptible que la 98.','2010-10-27','yuca, hongos, superalargamiento, metabolitos primarios, metabolitos secundarios, metabolitos, respuesta hipersensible, resistencia sistÃ©mica adquirida.',1,1,1,1,1,'2013-09-17 08:36:24','2013-09-17 08:36:24','Documento_504.pdf','application/pdf',25858698,'2013-09-17 08:36:24',20,0,57,'COMPLETO'),(499,'Sistema de InformaciÃ³n para la GestiÃ³n de Calidad y Riesgos de los Proyectos.','La gerencia de proyectos brinda los conocimientos, habilidades, tÃ©cnicas y herramientas a las actividades de un proyecto, para asÃ­ satisfacer los requisitos del mismo. Desde el aÃ±o 2008, estudiantes de la Escuela de ComputaciÃ³n, de la Universidad Central de Venezuela, han estado desarrollando, en software libre, el Prototipo de Software de GestiÃ³n de Proyectos (SGP), basado en los estÃ¡ndares establecidos en la guÃ­a del PMBOK (Project Management Body of Knowledge, GuÃ­a de Fundamentos de la GestiÃ³n de Proyectos) del PMI (Project Management Institute, Instituto de GestiÃ³n de Proyectos). El presente Trabajo Especial de Grado (TEG), consistiÃ³ en el desarrollo de un Sistema de InformaciÃ³n para la GestiÃ³n de la Calidad y de los Riesgos de los Proyectos. Se utilizÃ³ el mÃ©todo de investigaciÃ³n de tipo proyectiva, permitiendo analizar y seleccionar las tÃ©cnicas y herramientas necesarias para la gestiÃ³n de calidad y riesgos, presentadas en la guÃ­a del PMBOK. Como mÃ©todo de desarrollo se empleÃ³ la entrega por etapas, facilitando el anÃ¡lisis, diseÃ±o e implementaciÃ³n del sistema a desarrollar, y el mÃ©todo de programaciÃ³n, consistiÃ³ en un estÃ¡ndar que permitiÃ³ organizar la estructura del cÃ³digo del sistema, facilitando su entendimiento. Como resultado, se obtuvo un Sistema de InformaciÃ³n para la GestiÃ³n de Calidad y Riesgos de los Proyectos, basado en las Ã¡reas del conocimiento de Calidad y Riesgos planteadas en la guÃ­a del PMBOK, integrado al Prototipo de Software de GestiÃ³n de Proyectos (SGP), que hasta el momento contaba con las Ã¡reas de alcance, tiempo, costes y recursos humanos, y que ahora permite analizar, planificar y llevar un seguimiento de la calidad y de los riesgos presentes en un proyecto.','2010-10-28','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:36:27','2013-09-17 08:36:27','Documento_505.pdf','application/pdf',1112736,'2013-09-17 08:36:27',19,0,71,'COMPLETO'),(500,'EVALUACIÃ“Ã“NN DEL CONTENIDO DE METALES EN ALGAS MARINAS VENEZOLANAS Y SU POSIBLE USO COMO BIOINDICADOR AMBIENTAL','En este trabajo se realizÃ³ un estudio preliminar para establecer el contenido de los metales Ca, Mg, Zn, Fe, Cu, Cr, Ni, Pb, Cd y Hg en diferentes muestras de especies de algas marinas, localizadas en zonas de la costa central y de la isla de Margarita, Venezuela, con la finalidad de establecer posibles especies bioindicadoras y localidades con exposiciÃ³n contrastante. El anÃ¡lisis quÃ­mico de las muestras se realizÃ³ mediante FAAS, ETAAS y CV-AFS luego de llevarlas a soluciÃ³n, mediante su digestiÃ³n en un microondas. En total se analizaron veintisÃ©is muestras correspondientes a nueve especies de algas colectadas en once localidades. La colecta de las muestras fue realizada por el Prof. Gerard Haiek de la Facultad de Farmacia, UCV. Los datos fueron analizados empleando diferentes herramientas estadÃ­sticas (ANOVA de una y dos vÃ­as, Cluster AnÃ¡lisis, Correlaciones MÃºltiples y AnÃ¡lisis de Componentes Principales). Los resultados obtenidos en este trabajo mostraron concentraciones elevadas de Pb, Cu, Cr, Fe en la especie colectada en la localidad de la Marina Carrasco en Higuerote, la cual se diferenciÃ³ significativamente del resto de las localidades, seguida de Taguao donde se encontraron concentraciones elevadas y diferentes significativamente de Ni. Las localidades menos expuestas correspondieron a las Playas de Cepe Edo Aragua, Playa Caribe en Chuspa y algunas Playas del Edo Nueva Esparta como Punta Arenas y Manzanillo. Se encontraron dos posibles fuentes de origen de la entrada de los elementos a las aguas. Uno debido a los derrames de crudo que introducen los elementos Ni, y Cr que afectan principalmente la zona de Taguao, donde el crudo regularmente es descargado para su consumo en la planta elÃ©ctrica Ricardo Zuloaga. La herrumbre de los tanqueros que traen el crudo introducirÃ­a al Fe. La segunda fuente serÃ­a el empleo de gasolina y combustibles por las embarcaciones en zonas turÃ­sticas, lo cual domina la concentraciÃ³n de Pb en las algas en las zonas como la Marina Carrasco de Higuerote, el Muelle de Puerto Cabello y Chichiriviche de la Costa. Aunque no se encontraron diferencias entre las especies de algas, en cuanto a su capacidad para su empleo como especies bioindicadoras, el amplio intervalo de concentraciones de los diferentes metales tÃ³xicos encontrados en Padina gymnospora y Ulva lactuca, junto a su abundancia y presencia en varias de las zonas muestreadas, podrÃ­a ser elementos para seleccionarlas para prÃ³ximos estudios. Este trabajo fue financiado por el proyecto CDCH UCV PG-06-7155- 2008/1','2010-10-28','Algas, Bioindicadores, contaminacion acuatica',6,1,1,1,1,'2013-09-17 08:36:28','2013-09-17 08:36:28','Documento_506.pdf','application/pdf',2498296,'2013-09-17 08:36:28',20,0,130,'COMPLETO'),(501,'Uso de la dispersion de Hiper Rayleigh para el estudio y caracterizacion de nanoparticulas de oro','Las NanopartÃ­culas (Nps) de oro manifiestan propiedades elÃ©ctricas y Ã³pticasinteresantes, Ãºtiles y Ãºnicas. AsÃ­ mismo, las Nps de oro presentan efectos Ã³pticos nolineales (ONL) de segundo orden. Por lo general, el comportamiento ONL desegundo orden de las Nps de oro es cuantificado en tÃ©rminos de la primerahiperpolarizabilidad, tensor ÃŸ. Por su parte, la dispersiÃ³n de Hiper Rayleigh (HRS)ha surgido como una tÃ©cnica eficaz para medir los valores de ÃŸ de Nps metÃ¡licas ensoluciones tanto acuosas como orgÃ¡nicas. Sin embargo, mientras que laspropiedades Ã³pticas lineales de las Nps de oro han sido ampliamente investigadas;el potencial de estos materiales para aplicaciones Ã³pticas no lineales de segundoorden, por ejemplo, anÃ¡lisis biolÃ³gico, telecomunicaciones, optoelectrÃ³nica,incluyendo aplicaciones fotÃ³nicas de segundo orden (hiper-fotÃ³nicos), etc., no se haestudiado del todo.Esta investigaciÃ³n fue enfocada en la caracterizaciÃ³n y estudio de Nps de oroa travÃ©s de la tÃ©cnica de HRS. Inicialmente, las Nps de oro fueron generadas porablaciÃ³n lÃ¡ser a partir de una placa de oro sumergida en soluciÃ³n acuosa de unsurfactante aniÃ³nico, Dodecil Sulfato de Sodio (SDS). Posteriormente, se realizÃ³ unestudio para determinar el alcance e influencia de ciertas variables experimentalesde la ablaciÃ³n lÃ¡ser, sobre los espectros de absorciÃ³n, distribuciÃ³n de tamaÃ±os ypropiedades Ã³pticas no lineales (ONL) de las Nps de oro generadas. Las variablesexperimentales que se modificaron fueron: concentraciÃ³n del surfactante [SDS],irradiancia del lÃ¡ser y tiempo de ablaciÃ³n. Durante el proceso de ablaciÃ³n, se trabajÃ³a la longitud de onda fundamental (1064 nm) y a una frecuencia fija de 10 Hz. LacaracterizaciÃ³n de dichas Nps de oro no funcionalizadas se llevÃ³ a cabo medianteEspectroscopÃ­a UV-Vis, DispersiÃ³n DinÃ¡mica de Luz (DLS) y DispersiÃ³n de HiperRayleigh (HRS).Se observÃ³ que incrementos en el tiempo de ablaciÃ³n (15 minutos) generanaltas concentraciones de nanopartÃ­culas en el medio. AsÃ­ mismo, se encontrÃ³ quefenÃ³menos de fragmentaciÃ³n se manifiestan cuando se emplean irradianciassignificativamente grandes; esta tendencia fue observada hasta un valor limite deirradiancia de 1.34 GW/cmÂ², despuÃ©s del cual el diÃ¡metro medio aumentabanuevamente ocasionado por la agregaciÃ³n inducida por la gran cantidad de Npspresentes en el medio. Igualmente, se comprobÃ³, para tres diferentes valores deirradiancia, que 4.5x10-02 M es la concentraciÃ³n mÃ¡s apropiada de SDS para obtenermayor cantidad de Nps de oro de menor diÃ¡metro y de mayor estabilidad en eltiempo. Por otro lado, se encontrÃ³ una dependencia de la seÃ±al de HRS con lacantidad de Nps de oro no funcionalizadas presentes en el medio; cuanto mayor esla cantidad de Nps, mayor es la seÃ±al de HRS.Posteriormente, las Nps de oro fueron generadas y funcionalizadas \"in-situ\"por ablaciÃ³n lÃ¡ser a partir de una placa de oro sumergida en una mezcla desoluciones de SDS y fluorÃ³foro, es decir, SDS-Disodiofluoresceina (DSF) o SDSRodaminaB (RB). Igualmente, la caracterizaciÃ³n de dichas Nps de orofuncionalizadas se llevÃ³ a cabo mediante EspectroscopÃ­a UV-Vis, EspectroscopÃ­ade Fluorescencia, DispersiÃ³n DinÃ¡mica de Luz (DLS) y DispersiÃ³n de Hiper Rayleigh(HRS).Comparando los agentes funcionalizadores, RB y DSF, se observÃ³ queambos por igual producen importantes cambios espectrales UV-Vis. Se notÃ³ que amedida que la concentraciÃ³n de ambos fluorÃ³foros aumenta, la absorbancia de lasNps tambiÃ©n se ve incrementada. AdemÃ¡s de la banda de PS, que se observÃ³ a 520nm para los complejos Nps de oro-RB-SDS, una segunda banda de absorciÃ³napareciÃ³ a 400-425 nm. Se cree que estos resultados se deban a pequeÃ±osaumentos en la constante dielÃ©ctrica del medio ambiente en el cual se hallan lasNps y a la agregaciÃ³n que experimentan las partÃ­culas por la adiciÃ³n de RB.Por otro lado, la seÃ±al de HRS de las Nps funcionalizadas mejorÃ³considerablemente con respecto a la seÃ±al proveniente de las partÃ­culas nofuncionalizadas. Se determinÃ³ que el valor de la primera hiperpolarizabilidad de unananopartÃ­cula de oro solitaria y sin modificaciÃ³n fue alrededor de 1.9Â±2.5x10-23 esu.Igualmente, se encontrÃ³ que el valor del tensor ÃŸ para los complejos Nps de oro-DSF-SDS y Nps de oro-RB-SDS fue 5.5Â±2.2x10-22 y 13.3Â±1.6x10-23 esu,respectivamente. Es notorio, que las Nps de oro funcionalizadas con Rodamina Bposeen un mayor valor de hiperpolarizabilidad que aquellas partÃ­culas que fueronmodificadas con Disodiofluoresceina. La Rodamina B realzÃ³ e incrementÃ³ mÃ¡sefectiva y eficientemente, en un orden de magnitud, las propiedades ONL de lasNps de oro.AsÃ­ mismo, se realizaron varios estudios del quenching de la emisiÃ³n defluorescencia del agente funcionalizador como consecuencia del contacto con unquencher (Nps). Se notÃ³ un fuerte decaimiento de la emisiÃ³n de fluorescencia paraambos fluorÃ³foros, RB y DSF, debido a la gran cercanÃ­a entre las molÃ©culas deestos y los nÃºcleos metÃ¡licos de las Nps de oro. Las desviaciones encontradas enlas grÃ¡ficas de Stern-Volmer, para los complejos Nps de oro-DSF-SDS y Nps deoro-RB-SDS, sugieren que el quenching observado no fue enteramente dinÃ¡mico oestÃ¡tico, sino mÃ¡s bien una combinaciÃ³n de ambos.La funcionalizaciÃ³n, tal como se tenÃ­a previsto incrementÃ³ significativamentela seÃ±al de HRS de las Nps de oro bajo una marcada dependencia de la seÃ±al deHRS con la concentraciÃ³n del agente funcionalizador, es decir, a medida que laconcentraciÃ³n del fluorÃ³foro aumenta, la seÃ±al de HRS se ve incrementada. Sepiensa que este fenÃ³meno se deba a: (i) como es lÃ³gico, a medida que aumenta laconcentraciÃ³n del funcionalizador tambiÃ©n, en la misma medida, las interaccioneselectrostÃ¡ticas que se establecen entre las molÃ©culas del fluorÃ³foro y la superficie dela Nps incrementan, (ii) aumentos de la concentraciÃ³n del fluorÃ³foro crean nuevascondiciones no- centrosimÃ©tricas en el sistema (iii) altas intensidades de las seÃ±alesde HRS proveniente de las Nps de oro modificadas se pueden atribuir a procesos deagregaciÃ³n de las partÃ­culas.Por Ãºltimo, la intensidad de HRS proveniente de los complejos Nps de oro-RB-SDS fue significativamente mayor que la seÃ±al de HRS proveniente de loscomplejos Nps de oro-DSF-SDS. Las molÃ©culas de RB y la superficie de lasnanopartÃ­culas establecen una mejor y mayor interacciÃ³n electrostÃ¡tica, lo que a suvez, se ve reflejado en el realzamiento de la respuesta Ã³ptica no lineal de segundoorden de las Nps de oro.','2010-10-04','dispersion de hiper rayleigh, nanoparticulas de oro, propiedades opticas no lineales, ablacion laser.',6,1,1,1,1,'2013-09-17 08:36:30','2013-09-17 08:36:30','Documento_507.pdf','application/pdf',5989263,'2013-09-17 08:36:30',20,0,111,'COMPLETO'),(502,'DistribuciÃ³Ã³nn espacial de fÃ³Ã³ssforo en sedimentos superficiales del Lago de Valencia','El objetivo del siguiente trabajo fue establecer la distribuciÃ³n espacial del fÃ³sforo en los sedimentos superficiales del Lago de Valencia. Para lograr dicho objetivo fueron recolectadas 41 muestras de sedimentos superficiales en el Lago de Valencia. Estas muestras fueron fraccionadas por tamaÃ±o de grano (grava, arena, limo y arcilla) y cada una de las distintas fracciones granulomÃ©tricas obtenidas fueron sometidas a calentamiento por 2h a diferentes temperaturas (105Â°C, 450Â°C, 550Â°C y 750Â°C) y finalmente fueron extraÃ­das con HCl 1M. El extracto Ã¡cido fue usado para determinar fÃ³sforo por fotocolorimetrÃ­a segÃºn la metodologÃ­a de Murphy & Rilley (1962). Los resultados obtenidos indican que la pÃ©rdida a 450Â°C estÃ¡ distribuida hacia el centro del lago, mientras que la pÃ©rdida a 550Â°C estÃ¡ en la periferia del lago, en las zonas de menor profundidad. La pÃ©rdida a 750Â°C presentÃ³ mayores porcentajes (>10%) en las estaciones 4, 15, 26 y 39, con porcentajes intermedios (4-10%) hacia el centro del lago y los menores valores (<4%) hacia la periferia. Esto sugiere que la depositaciÃ³n de carbonatos ocurre preferentemente en las estaciones 4, 15, 26 y 39. Los menores valores de residuo insoluble fueron encontrados en aquellas estaciones que presentaron los mayores valores de pÃ©rdida a 750Â°C y los mÃ¡ximos valores estuvieron distribuidos hacia la parte sur del lago, indicando una mayor fuente de sedimentos siliciclÃ¡sticos. Por Ãºltimo, se logrÃ³ diferenciar que la fijaciÃ³n del fÃ³sforo en los sedimentos ocurre por medio de dos procesos, uno asociado a la materia orgÃ¡nica y los oxihidrÃ³xidos de hierro y aluminio, el cual tiene una fuerte influencia en la mayor parte del sistema; y otro asociado a los carbonatos, que domina en las estaciones 4, 15, 26, 37, 38 y 39. Las concentraciones obtenidas para fÃ³sforo oscilaron entre 500 y 15000 mg/Kg para todas las fracciones granulomÃ©tricas y entre 1000 y 4800 mg/Kg para la muestra total. Los mayores valores de concentraciÃ³n de fÃ³sforo fueron obtenidos en las fracciones de arena, especialmente en las estaciones con mayor pÃ©rdida a 750Â°C. Finalmente, la correlaciÃ³n lineal encontrada entre las concentraciones de fÃ³sforo y la pÃ©rdida a 450Â°C sugiere que la materia orgÃ¡nica tiene un aporte significativo de fÃ³sforo orgÃ¡nico.','2010-10-29','FÃ³sforo, Lago de Valencia, Sedimentos',4,1,1,1,1,'2013-09-17 08:36:32','2013-09-17 08:36:32','Documento_508.pdf','application/pdf',544469,'2013-09-17 08:36:32',18,0,87,'COMPLETO'),(503,'EvaluaciÃ³n de la contaminaciÃ³n atmosfÃ©rica por hidrocarburos aromÃ¡ticos policÃ­clicos, empleando el liquen Parmotrema sancti-angelii y aplicando un muestreo de tipo activo en la ciudad de Caracas','El objetivo de este trabajo fue determinar la concentraciÃ³n de los hidrocarburos aromÃ¡ticos policÃ­clicos (HAP), empleando el liquen Parmotremasancti--angelii y un muestreo de tipo activo, en la ciudad de Caracas. Para ello fueron transplantados lÃ­quenes de una zona suburbana a seis localidades de la ciudad de Caracas, en las cuales estuvieron expuestos a la atmÃ³sfera urbana por un periodo de cuatro meses. El mÃ©todo de extracciÃ³n empleado fue un baÃ±o de ultrasonido, usando como solvente una mezcla hexano: diclorometano (3:2, v/v). La separaciÃ³n de la fracciÃ³n de compuestos aromÃ¡ticos fue lograda mediante el uso de una columna cromatogrÃ¡fica con sÃ­lica gel y la eluciÃ³n con una mezcla hexano-diclorometano (3:2, v/v). Los anÃ¡lisis fueron realizados mediante cromatografÃ­a de gases acoplada a espectrometrÃ­a de masas (CG/EM) y cromatografÃ­a lÃ­quida de alta eficiencia (HPLC/UV/FL). Fueron identificados 16 HAP: naftaleno, acenaftileno, acenafteno, fluoreno, fenantreno, antraceno, fluoranteno, pireno, criseno, benzo[a]antraceno, benzo [b]fluoranteno, benzo[k]fluoranteno, benzo[a]pireno, dibenzo[a,h]antraceno, benzo[g,h,i]perileno e indeno[1,2,3-cd]pireno. La concentraciÃ³n de HAP totales obtenida en esta investigaciÃ³n estuvo en el rango de 6,47 Â± 3,80 Âµg/g a 2,30 Â± 0,49 Âµg/g. Los lÃ­quenes mostraron un enriquecimiento en compuestos de 6 y 5 anillos (6>5>3>4 para LCM; 6>3>5>4 para LCF, LBC, LSC y LC5; 6>3>4>5 para LRC) asociados a las partÃ­culas atmosfÃ©ricas comÃºnmente generadas en procesos de combustiÃ³n. La relaciÃ³n Ind/(Ind+B[g,h,i]P) seÃ±ala la presencia de HAP provenientes de la quema de vegetaciÃ³n en todas las localidades, y la relaciÃ³n B[g,h,i]P/B[a]P un fuerte aporte de las emisiones provenientes especÃ­ficamente de la quema de gasolina en El Cafetal, lo cual indica una fuerte incidencia del trÃ¡fico vehicular.','2010-10-27','Hidrocarburos aromÃƒÂ¡ticos policÃƒÂ­clicos, contaminaciÃƒÂ³n atmosfÃƒÂ©rica, biomonitoreo, relaciones diagnÃƒÂ³sticas, muestreo activo.',4,1,1,1,1,'2013-09-17 08:36:34','2013-09-17 08:36:34','Documento_509.pdf','application/pdf',10584852,'2013-09-17 08:36:34',19,0,82,'COMPLETO'),(504,'EVALUACIÃ“Ã“NN DEL EFECTO DE LA DENSIDAD DE POBLACIÃ“Ã“NN Y LA FASE DE CRECIMIENTO SOBRE LA LETALIDAD POR PULSOS DE LUZ EN MICROORGANISMOS ASOCIADOS A ALIMENTOS','Dentro de las nuevas tecnologÃ­as no tÃ©rmicas ni quÃ­micas para procesar alimentos se encuentra el tratamiento con pulsos de luz, que se ha usado para la desinfecciÃ³n de superficies, aguas y podrÃ­a ser aplicado para la obtenciÃ³n de alimentos o productos alimenticios, mÃ­nimamente procesados pero mÃ¡s seguros, ya que se ha demostrado que tienen efectos bactericidas. La caracterÃ­stica mÃ¡s importante de la tecnologÃ­a de pulsos de luz es que, aparte del nÃºmero y la duraciÃ³n, la energÃ­a proporcionada es mayor que la obtenida por una radiaciÃ³n de luz continua. Mientras mÃ¡s corta es la duraciÃ³n de cada pulso, mÃ¡s alta es su intensidad, aumentando su capacidad de inactivaciÃ³n microbiana. Sin embargo, poco se sabe de su efecto de esta tecnologÃ­a sobre la densidad de poblaciÃ³n y en diferentes etapas de crecimiento de un cultivo microbiano. En este estudio se evaluÃ³, el efecto de un pulso de luz a una intensidad de 0,35 J/cm2, sobre la inactivaciÃ³n de un cultivo de Pseudomona fluorescens a diferentes densidades de poblaciÃ³n (109, 108, 106, 104 y 102UFC/mL) y sobre las fases de crecimiento (Fase de latencia, exponencial y estacionaria) de Pseudomona fluorescens, Salmonella spp., Listeria monocytogenes,, Bacillus cereus y Saccharomyces cerevisiae..Para ello, estos microorganismos fueron incubados a 30Â° y 35-37 Â°C segÃºn su temperatura de crecimiento, durante 24 horas. Los resultados fueron evaluados mediante el contaje de UFC y se realizo un anÃ¡lisis estadÃ­stico. Se determinÃ³ que a diferentes densidades de poblaciÃ³n y en las diferentes fases de crecimiento existe variaciÃ³n en su susceptibilidad por la inactivaciÃ³n con pulsos de luz.','2010-11-01','Pulsos de luz',1,1,1,1,2,'2013-09-17 08:36:35','2013-09-17 08:36:35','Documento_510.pdf','application/pdf',1140523,'2013-09-17 08:36:35',20,0,34,'COMPLETO'),(505,'Caracterizacion Fisicoquimica y Reactividad de Coques de Petroleo','El estudio de las reactividades en modo TPO y gasificacion en Ar saturado con agua de distintos materiales carbonosos de bajo valor agregado que se obtienen en el circuito refinador de Venezuela. El coque de petroleo es uno de los materiales carbonosos estudiados, en particular se seleccionaron el coque Petrozuata y Amuay, asi como el flexicoque de alto vanadio. En particular, para el caso de flexicoque se trato quimicamente para remover selectivamente el Va y el Ni, discriminando de esta manera el papel catalitico de estos metales. Antes de examinar la reactividad de estas muestras, fueron estudiadas mediante la tecnica de analisis elemental de carbono por combustion, analisis textural, y por XPS, de estas tecnicas, se obtuvo la composicion de carbono y azufre de las muestras, el area superficial de microporo, volumen de poro y la distribucion de los metales en la superficie. La interpretacion de estos resultados analiticos permitio alcanzar una correlacion fisicoquimica entre la composicion de los materiales carbonosos y la reactividad. El analisis de la reactividad se realizo en una termobalanza acoplada a un cuadrupolo de masas, con la finalidad de monitorear la evolucion de los gases que intervienen en las reacciones de combustion y gasificacion. Ademas de los coques y los flexicoques, se estudio la reactividad de una muestra de residuo de vacio mezclado mecanicamente con metales para estudiar el posible efecto catalitico de los mismos.','2010-07-09','coque retardado, flexicoque, residuo de vacio, TPO, gasificacion, catalisis, vapor de agua, vanadio, niquel, potasio, termobalanza, cuadrupolo de masas',6,1,1,1,1,'2013-09-17 08:36:37','2013-09-17 08:36:37','Documento_511.pdf','application/pdf',3545253,'2013-09-17 08:36:37',20,0,137,'COMPLETO'),(506,'ESTUDIO DE LA MICROEXTRACCIÃ“Ã“NN EN FASE SÃ“Ã“LLIDA DE LOS HAPs EN MUESTRAS DE CEREALES Y SU ANÃÃLLISIS POR CROMATOGRAFÃÃAA DE GASES','En el presente trabajo se estudiÃ³ la MicroextracciÃ³n en Fase SÃ³lida de los Hidrocarburos AromÃ¡ticos PolicÃ­clicos (HAPs), empleando las tÃ©cnicas de Espacio confinado (EC-MEFS) e InmersiÃ³n Directa (ID-MEFS), empleando como sistema de sorciÃ³n un baÃ±o de glicerina, con una fibra de Polidimetilsiloxano-Divinilbenceno (PDMS-DVB) de 65 Âµm de espesor y como sistema de desorciÃ³n y detecciÃ³n un CromatÃ³grafo de Gases con un Detector de IonizaciÃ³n a la llama (GC-FID). Entre las variables optimizadas tenemos la fibra empleada en la cual se compararon las de 30 Âµm (PDMS) y la de 65 Âµm (PDMS-DVB), siendo Ã©sta Ãºltima la que arrojo mejores resultados. Para el caso de la etapa de sorciÃ³n de la tÃ©cnica de ID-MEFS se optimizÃ³ la temperatura del baÃ±o de glicerina y el tiempo de sorciÃ³n de la fibra, siendo 65 Â°C y 40 min respectivamente los valores Ã³ptimos obtenidos. Se estudiÃ³ ademÃ¡s el multipatrÃ³n de referencia (CUS-9735, Ultra Scientific), el cual posee 25 HAPs de ellos los 16 seleccionados por la Agencia Federal para la ProtecciÃ³n del Medio Amiente (EPA) de los Estados Unidos, encontrÃ¡ndose que las condiciones empleadas son capaces de detectar hasta 11 de ellos: naftaleno, acenaftileno, acenafteno, fluoreno, fenantreno, antraceno, fluoranteno, pireno, criseno, benzo [b]fluoranteno y benzo[k]fluoranteno, asimismo la tÃ©cnica de EC-MEFS puede detectar los 9 primeros si estos se encuentran en una cantidad adecuada para ser sorbidos por la fibra. Se evaluaron 4 tipos de muestras las cuales fueron 2 tipos de trigo: TSRW y HRW asÃ­ como 2 tipos de maÃ­z: Amarillo y blanco; encontrÃ¡ndose que para estas Ãºltimas se lograron identificar los siguientes HAPs: Naftaleno, Fluoreno, Antraceno y Pireno, por ambas tÃ©cnicas empleadas, en cambio para las primeras muestras sÃ³lo se logro detectar la presencia de estos hidrocarburos por la tÃ©cnica de EC-MEFS.','2010-10-29','{}',6,1,1,1,1,'2013-09-17 08:36:41','2013-09-17 08:36:41','Documento_512.pdf','application/pdf',0,'2013-09-17 08:36:41',17,0,0,'INCOMPLETO'),(507,'AnÃ¡lisis de InterferometrÃ­a de EspÃ­n Mediante la AproximaciÃ³n Tight-Binding en Gases de Electrones Bidimensionales','Se presentan resultados de aplicar la aproximaciÃ³n Tight-Binding a gases de elec- trones bidimensionales (2DEG) para un arreglo de interferometrÃ­a de espÃ­n Mach- Zender (MZI) considerando interacciÃ³n espÃ­n-Ã³rbita (EO) [1]. Se hallan condiciones de filtraje efectivo de espÃ­n para los dispositivos propuestos siguiendo el arreglo MZI mediante la definiciÃ³n de la asimetrÃ­a de transmisiÃ³n. Adicionalmente, discutimos y comparamos nuestros resultados con propuestas realizadas anteriormente en la lite- ratura [28, 31], que manipulan los efectos Aharonov-Bohm y Aharonov-Casher para desarrollar un filtro de espÃ­n. Encontramos que el mÃ©todo de las asimetrÃ­as de trans- misiÃ³n es igual de eficiente pero mÃ¡s sencillo para analizar el filtrado, por lo que puede resultar conveniente para implementaciones en sistemas de mayor complejidad','2010-09-09','InterferometrÃƒÂ­a EspÃƒÂ­n Tight-Binding Gases Electrones Bidimensionales',3,1,1,1,1,'2013-09-17 08:36:42','2013-09-17 08:36:42','Documento_513.pdf','application/pdf',4487655,'2013-09-17 08:36:42',20,0,184,'COMPLETO'),(508,'DeterminaciÃ³Ã³nn de secciones eficaces de producciÃ³Ã³nn de rayos X caracterÃ­Ã­sticos tipo L y M generados mediante impacto electrÃ³Ã³nnico','Se determinaron las secciones eficaces de producciÃ³n de rayos X tipo L y M de los elementos Au, Ta y Mo, para un rango de energÃ­as del haz electrÃ³nico entre un valor cercano al umbral de ionizaciÃ³n correspondiente y una energÃ­a mÃ¡xima de 30 keV. Para ello se midiÃ³ mediante un espectrÃ³metro EDX, el nÃºmero de fotones X caracterÃ­sticos NL(E), NM(E), emitidos por el espÃ©cimen bombardeado con Ne electrones de energÃ­a E. Luego, estos datos fueron convertidos en secciones eficaces de producciÃ³n de rayos X caracterÃ­sticos, al tomar en cuenta el espesor de las pelÃ­culas delgadas que se utilizaron como muestras experimentales, la concentraciÃ³n atÃ³mica, el nÃºmero de electrones impactantes, la eficiencia del detector y el Ã¡ngulo sÃ³lido de detecciÃ³n. En procura de minimizar la proporciÃ³n de electrones retrodispersados, las muestras experimentales se elaboraron depositando, mediante la tÃ©cnica de pulverizaciÃ³n catÃ³dica, pelÃ­culas delgadas de los elementos mencionados sobre pelÃ­culas delgadas de carbÃ³n, utilizando rejillas de cobre de las usadas en TEM como soportes para el conjunto. Los espesores de las pelÃ­culas se determinaron mediante un microscopio de fuerza atÃ³mica, al medir la altura de \"escalones\" de material depositado, creados mediante la colocaciÃ³n de mÃ¡scaras sobre pastillas de silicio durante la pulverizaciÃ³n. Se determinaron las secciones eficaces de producciÃ³n de rayos X por impacto electrÃ³nico Au--La, Au--Lb, Au--Ma, Ta--Ma y Mo-- L, encontrÃ¡ndose una tendencia polinomial de segundo grado en dichas medidas.','2010-05-21','SecciÃ³n eficaz, producciÃ³n de rayos X caracterÃ­sticos, espectrÃ³metro EDX, pelÃ­culas delgadas.',3,1,1,1,1,'2013-09-17 08:36:45','2013-09-17 08:36:45','Documento_514.pdf','application/pdf',2117562,'2013-09-17 08:36:45',18,0,107,'COMPLETO'),(509,'CARACTERIZACIÃ“Ã“NN DE LA DISPERSIÃ“Ã“NN POST--NATAL DEL PERIQUITO MASTRANTERO ((Forpus passerinus)) EN LOS LLANOS OCCIDENTALES DEL ESTADO GUÃÃRRICO','Los movimientos que realizan los individuos juveniles desde el lugar de nacimiento al sitio donde se reproducen por primera vez, se conoce como dispersiÃ³n post-natal. En aves, estos movimientos pueden variar con el sexo. La relaciÃ³n de sexos en la poblaciÃ³n adulta de Periquitos Mastranteros en el Hato Masaguaral, Estado GuÃ¡rico, pudiera estar influenciada por diferencias en la dispersiÃ³n post-natal y/o mortalidad diferencial entre sexos. Al momento del vuelo, presenta una proporciÃ³n sexual 1:1, pero en la etapa adulta el cociente es 1,7 machos por hembra. Con el objetivo de evaluar si hay diferencias en la dispersiÃ³n entre machos y hembras, 13 juveniles (seis pares de hermanos macho y hembra, y una hembra adicional) fueron monitoreados a diario, usando radio- telemetrÃ­a, desde el dÃ­a que abandonaron el nido hasta alrededor de 50 dÃ­as despuÃ©s del vuelo. Adicionalmente, se registraron otros juveniles nacidos en el aÃ±o 2008, observados durante la bÃºsqueda de los individuos radio-marcados. Los juveniles aumentaron las distancias de dispersiÃ³n hasta los 45 dÃ­as de vuelo, luego, algunos machos se acercaron a los nidos, mientras que las hembras permanecieron superando los 1000 metros. Del total de juveniles nacidos en 2008, se observÃ³ el 53%, incluyendo el 69% del total de machos y el 38% del total de hembras. Sin embargo, los datos obtenidos con telemetrÃ­a muestran que machos y hembras tuvieron una supervivencia elevada y similar durante los dos primeros meses de vida. Estos resultados apoyan la hipÃ³tesis de que las hembras presentan mayores niveles de dispersiÃ³n, en lugar de mayor mortalidad, en comparaciÃ³n con los machos, quienes tienden a quedarse cerca del Ã¡rea natal. En general, los juveniles fueron vistos mÃ¡s en sabana arbolada (44%) que en bosque seco (39%) y sabana abierta (17%); con una tendencia a incrementar los tamaÃ±os de grupo a medida que se acentuÃ³ la estaciÃ³n de sequÃ­a.','2010-05-25','Forpus passerinus, dispersiÃ³n post-natal, telemetrÃ­a',1,1,1,1,1,'2013-09-17 08:36:46','2013-09-17 08:36:46','Documento_515.pdf','application/pdf',794757,'2013-09-17 08:36:46',19,0,58,'COMPLETO'),(510,'MODELO FISICOQUÃÃMMICO EN DOS DIMENSIONES DE LA DIFUSIÃ“Ã“NN DEL IÃ“Ã“NNCa 22++ EN UN MIOCITO ESQUELÃ‰Ã‰TTICO..','Resumen Cuando una cÃ©lula de mÃºsculo esquelÃ©tico (ME) estÃ¡ expuesta a un determinado estÃ­mulo externo (fÃ­sico, quÃ­mico o elÃ©ctrico) ocurre a una elevaciÃ³n transitorial del nivel de Ca2+ en el citosol y ello origina el acortamiento de la cÃ©lula contrÃ¡ctil y luego, la recaptaciÃ³n del iÃ³n produce la relajaciÃ³n celular. Diversos mecanismos participan en el proceso: canales de calcio dependientes de voltaje (canales de dihidropiridina, DHPR) que permiten la entrada de calcio extracelular cuando se produce despolarizaciÃ³n del sarcolema (SL), canales del tipo \"sensor voltaje\", canales de Ryanodina (RyR) ubicados en la membrana del retÃ­culo sarcoplÃ¡smico (RS) que liberan Ca2+ hacia el citosol por diversos mecanismos, proteÃ­nas buffers que se unen al calcio quelÃ¡ndolo transitoriamente y haciendo su difusiÃ³n mÃ¡s lenta, bombas que sacan Ca2+ del citosol, bien hacia depÃ³sitos intracelulares como el RS (SERCA) o hacia el medio extracelular (PMCA), intercambiadores del SL y de la membrana mitocondrial, entre otros. El RS es el principal almacÃ©n de calcio intracelular en el mÃºsculo estriado y participa de forma determinante en la regulaciÃ³n del proceso acoplamiento-excitaciÃ³n-contracciÃ³n (AEC), regulando las concentraciones intracelulares de calcio durante la contracciÃ³n y la relajaciÃ³n muscular. En este trabajo se modelÃ³ la dinÃ¡mica correspondiente a la evoluciÃ³n de la concentraciÃ³n c(x,y,t) del iÃ³n calcio en el espacio confinado que existe entre las membranas del RS y el sarcolema (\"junctional space\", \"cleft space\") de una cÃ©lula de mÃºsculo esquelÃ©tico, el modelaje se hizo en dos dimensiones y se fundamentÃ³ en la ecuaciÃ³n de difusiÃ³n-reacciÃ³n (D-R) considerando diversas fuentes (liberaciÃ³n impulsiva a travÃ©s de pocos receptores de RyR y flujos de fuga compensatorios) y sumideros (SERCA, PMCA) y la amortiguaciÃ³n del Ca2+ por la parvoalbÃºmina. Al resolver numÃ©ricamente (ya que no tiene soluciÃ³n analÃ­tica) la ecuaciÃ³n de D-R (a la cual se le se le impuso la condiciÃ³n de borde homogÃ©nea de Neumann) mediante el paquete computacional COMSOL Multiphysics3.4 Â® basado en Elementos Finitos se obtuvo la c(x,y,t) en funciÃ³n de la posiciÃ³n para diversos instantes de tiempo y c(x,y,t) en funciÃ³n del tiempo para diversas locaciones del dominio, con liberaciones simultÃ¡neas o no de tres receptores de RyR .','2010-10-28','palabras claves:: mÃºsculo esquelÃ©tico, miocito, iÃ³n calcio, difusiÃ³n-reacciÃ³n, elementos finitos, COMSOL, receptores de RyR.',6,1,1,1,1,'2013-09-17 08:36:47','2013-09-17 08:36:47','Documento_516.pdf','application/pdf',1673833,'2013-09-17 08:36:47',20,0,95,'COMPLETO'),(511,' Desarrollo de una AplicaciÃ³Ã³nn Web para la GestiÃ³Ã³nn de Historias ClÃ­Ã­nicas Digitales','El objetivo de este Trabajo Especial de Grado consistiÃ³ en desarrollar una aplicaciÃ³n web para la creaciÃ³n y manipulaciÃ³n de las historias clÃ­nicas digitales, en la que se realizÃ³ el manejo y diseÃ±o de interfaz, brindando un mayor control y gestiÃ³n de las historias clÃ­nicas de los profesionales de la medicina, configuraciÃ³n y administraciÃ³n de informes y rÃ©cipes mÃ©dicos y gestiÃ³n de citas. Esta aplicaciÃ³n web fue desarrollada utilizando como lenguaje de programaciÃ³n Ruby On Rails, tecnologÃ­as del lado del cliente como HTML, HTML5, CSS y JavaScript especÃ­ficamente la librerÃ­a JQuery, a travÃ©s del mÃ©todo de desarrollo Ã¡gil de software ProgramaciÃ³n Extrema (XP). Para este Trabajo Especial de Grado se realizÃ³ una fase de investigaciÃ³n en la cual se efectuÃ³ un estudio de las necesidades de mayor importancia con respecto a las historias clÃ­nicas manejadas por distintos tipos de mÃ©dicos especialistas. Luego de una recolecciÃ³n de historias clÃ­nicas tradicionales, se logrÃ³ determinar las caracterÃ­sticas comunes de las mismas en cuanto a formato, proporcionando informaciÃ³n relevante para el desarrollo del trabajo. Como producto final se obtuvo una aplicaciÃ³n web que permite registrar al personal mÃ©dico, crear, configurar y modificar el formato de las historias clÃ­nicas, como tambiÃ©n de informes y rÃ©cipes mÃ©dicos, ademÃ¡s de proveer la posibilidad de gestionar citas mÃ©dicas.','2010-10-22','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:36:49','2013-09-17 08:36:49','Documento_517.pdf','application/pdf',1832334,'2013-09-17 08:36:49',18,0,131,'COMPLETO'),(512,'COMPOSICIÃ“Ã“NN QUÃÃMMICA Y DISPONIBILIDAD AMBIENTAL DE LOS ELEMENTOS EN LOS SEDIMENTOS DEL LAGO DE VALENCIA,, EDO.. ARAGUA y EDO.. CARABOBO','En Ã©ste trabajo se presentan los resultados correspondientes al estudio de los sedimentos de fondo del Lago de Valencia, Venezuela, con el objetivo de evaluar su estado ambiental, de acuerdo a su concentraciÃ³n de metales. Este estudio surge como consecuencia de la importancia del elevado desarrollo urbano e industrial observado en la zona en los Ãºltimos 20 aÃ±os, asÃ¬ como por su impacto sobre las aguas del lago cuyo destino principal es el de riego de las zonas agrÃ­colas aledaÃ±as. Los Ãºltimos estudios realizados datan de 1988 [7]. En el estudio se consideraron los sedimentos recolectados entre junio-octubre de 2009, de manera bimensual en cinco estaciones (Ei) seleccionadas de acuerdo a las principales influencias industriales, urbanas, domÃ©sticas y agrÃ­colas que se desarrollan en los alrededores del lago. Los sedimentos fueron analizados para determinar la composiciÃ³n total de los elementos Cd, Cr, Cu, Ni, Pb, Zn, Co, V, Fe, Ti, Mn Ca, Mg, Al, Si y Hg, asÃ­ como carbono orgÃ¡nico e inorgÃ¡nico, y su fraccionamiento quÃ­mico. Las metodologÃ­as aplicadas fueron validadas empleando los estÃ¡ndar de referencia LKSD-4 y BCR-701. De acuerdo al Factor de Enriquecimiento (FE) y al Ãndice de GeoacumulaciÃ³n (Igeo) obtenidos empleando los valores de lÃ­nea base determinados para el Lago de Valencia por MogollÃ³n [7], los sedimentos de fondo del lago se encuentran enriquecidos con Pb>Zn>Cu>Cr y se clasifican de no contaminados a moderadamente contaminados. Adicionalmente, la concentraciÃ³n de Corg es elevada lo que sugiere una fuerte intervenciÃ³n antrÃ³pica. Los anÃ¡lisis de agrupamiento realizados indicaron que la composiciÃ³n quÃ­mica de los sedimentos presenta pequeÃ±as variaciones temporales que ocurren en la Ã©poca de lluvias, especÃ­ficamente para las especies Cinorg, Ca, Mg, Mn, Al y Ni, para las que, a excepciÃ³n del Al y Ni, su variaciÃ³n fue atribuida a su precipitaciÃ³n en forma de carbonatos, que ocurre en todo el lago durante la Ã©poca de lluvias. Por otra parte, la composiciÃ³n de los sedimentos presentÃ³ variaciones espaciales en las concentraciones de Corg, Cu, Zn, Pb y Hg. Excepto para el Hg, la concentraciÃ³n de los elementos aumenta con la del Corg en las estaciones mÃ¡s profundas debido a sus condiciones anÃ³xicas y reductoras (E1 y E5) y es incrementada por el aporte antrÃ³pico domÃ©stico-industrial introducido mediante los rios CaÃ±o Central y Los Guayos (E3) y domestico-industrial-agrÃ­cola por los rios Guey y Tipitapa (E5). Para el resto de los elementos, los resultados indican que su concentraciÃ³n en los sedimentos es resultante del aporte litogeoquÃ­mico de la zona y su variaciÃ³n en el espacio y en el tiempo es pequeÃ±a. Los resultados del fraccionamiento quÃ­mico indican que el riesgo que presentan los sedimentos tambiÃ©n varÃ­a espacialmente: los sedimentos de la E4 (norte del lago) no presentan riesgo alguno; las estaciones E2 y E5 (sur y este del lago) se parecen en el riesgo medio de sus sedimentos de Zn, Ni y Co, y la E3 (Oeste) riesgo alto en Cr y bajo en Co. En el centro del lago (E1), los sedimentos tienen una composiciÃ³n mixta, presentando un riesgo medio de Co y Zn. Adicionalmente, los sedimentos de las estaciones presentan un riesgo bajo de Cd, Pb y Cu. Estos resultados concuerdan con los obtenidos por MogollÃ³n (1988) [7] quien obtuvo enriquecimiento de los sedimentos con Pb, Zn, Cu, Cr y Ni, el cual estarÃ­a localizado en el eje de los rios Los Guayos y Guey. El riesgo determinado para los sedimentos es potencial y solo se observarÃ­a bajo condiciones fisicoquÃ­micas de las aguas que favorezcan el intercambio, lo cual se espera que no ocurra ya que las aguas del embalse son bÃ¡sicas debido a la naturaleza carbonÃ¡tica de la litogÃ­a de la zona. Este trabajo forma parte del proyecto del CDCH de la UCV PG 03-00-6495-2006.','2010-10-27','{}',6,1,1,1,1,'2013-09-17 08:36:51','2013-09-17 08:36:51','Documento_518.pdf','application/pdf',2655956,'2013-09-17 08:36:51',20,0,91,'COMPLETO'),(513,'DETERMINACIÃ’N DE LA DIFUSIÃ’N EFECTIVA DE 222Rn y N2O EN UNSUELO AGRÃŒCOLA DEL ESTADO PORTUGUESA A PARTIR DEMEDIDAS DE EMISIÃ’N SUPERFICIAL Y CONCENTRACIÃ’N DE 222Rn ADISTINTAS PROFUNDIDADES','En el presente trabajo fue determinada la difusiÃ³n efectiva del 222Rn y N2O en unsuelo agrÃ­cola del Estado Portuguesa bajo siembra directa, en dos zonas con distintashistorias de uso, a fin de cuantificar la contribuciÃ³n del transporte fÃ­sico en la emisiÃ³nsuperficial del N2O, gases de interÃ©s atmosfÃ©rico, a partir del anÃ¡lisis de 222Rn enmuestras de aire intersticial de los suelos, hasta una profundidad de 100 cm, y de laemisiÃ³n superficial o flujo, mediante la tÃ©cnica de detecciÃ³n de centelleo de partÃ­culasalfa con sulfuro de zinc, activado con plata, en celdas de Lucas.El anÃ¡lisis de 222Rn en aire intersticial de los suelos a diferentes profundidadesindicÃ³ que no existen diferencias significativas en la concentraciÃ³n de 222Rn encontradaen las dos zonas estudiadas, con una posibilidad de 92% que sean igualesdemostrando que la diferencia en la historia de uso no generÃ³ mayor variaciÃ³n en estacondiciÃ³n. El perfil del suelo presento concentraciones de 222Rn que variaron entre4.500 y 40.000 Bq m-3 durante el muestreo de este suelo. Las emisiones superficialesmonitoreadas en las dos zonas estudiadas si demostraron estar relacionadas con lashistorias de uso y ademÃ¡s presentaron una marcada relaciÃ³n lineal con la humedad delos suelos. La emisiÃ³n superficial tiende a ser mayor en la zona de labranzaconvencional que en la zona de siembre directa. El flujo promedio registrado en ambaszonas estudiadas en este trabajo es de 128 Â± 46 Bq m2 h-1. A partir del anÃ¡lisis de laconcentraciÃ³n de 222Rn en el perfil de suelo fue posible determinar los valores dedifusiÃ³n efectiva de 222Rn a distintas profundidades, los cuales corroboran lasdiferencias encontradas en los flujos superficiales de las zonas estudiadas, ya que lautilizaciÃ³n de la tÃ©cnica de labranza convencional, en donde la tierra fue aradarepetidas veces, genera una mayor perturbaciÃ³n de los primeros 25 cm del suelo ypromueve un aumento en la difusiÃ³n efectiva en comparaciÃ³n con zona donde latÃ©cnica utilizada fue la siembra directa, donde prÃ¡cticamente la siembra fue realizadasobre el suelo sin arar.','2010-06-22','Emision supercial de Radon 222.Flujo Superficial del N2O. Radon en suelos agricolas.',6,1,1,1,1,'2013-09-17 08:36:54','2013-09-17 08:36:54','Documento_519.pdf','application/pdf',485596,'2013-09-17 08:36:54',19,0,18,'COMPLETO'),(514,'PRECONCENTRACIÃ“Ã“NN Y ANALISIS MULTIELEMENTAL DE METALES PESADOS EN ACEITES COMESTIBLES -- APLICACIÃ“Ã“NN A ACEITES COMERCIALES VENEZOLANOS','La presencia de metales pesados en los aceites comestibles, se debe a varios factores entre los cuales, el enriquecimiento de los suelos donde se cultivan las semillas oleaginosas, el proceso de refinaciÃ³n y almacenamiento son las causas mÃ¡s evidentes. El contenido de metales pesados en los aceites comestibles estÃ¡ limitado, debido al efecto que muchos de ellos tienen sobre la salud humana. A nivel nacional, contamos con las Normas Covenin, las cuales indican los niveles mÃ¡ximos de concentraciÃ³n de Pb, As, Fe y Cu permitidos en los aceites comestibles comerciales en Venezuela. Estas normas son un reflejo de las normas internaciones expresadas en el Codex Alimentarius.En este trabajo se optimizaron las metodologÃ­as de extracciÃ³n en el punto de niebla empleando DDTP y APDC como agentes acomplejantes, la extracciÃ³n Ã¡cida y la digestiÃ³n Ã¡cida y se compararon en base a sus figuras de mÃ©rito: factor de enriquecimiento, LODm, %Rm, y reproducibilidad. La metodologÃ­a de extracciÃ³n acida resultÃ³ la opciÃ³n idÃ³nea para la determinaciÃ³n simultÃ¡nea de Cd, Cu, Cr, Ni y Pb en aceites comestibles, puesto que es una metodologÃ­a sencilla, que permite realizar un elevado nÃºmero de extracciones en poco tiempo, y minimiza los posibles factores de contaminaciÃ³n debido al empleo de pocos reactivos. Esta metodologÃ­a se caracterizÃ³ por presentar los mejores lÃ­mites de detecciÃ³n para todos los analitos (LODm entre 1,5 y 4,75 veces mejor que los obtenidos por extracciÃ³n por CPE) y una reproducibilidad superior a la obtenida con los otros mÃ©todos estudiados. La exactitud del mÃ©todo analÃ­tico, determinada mediante el estudio de recuperaciÃ³n efectuado en distintos aceites vegetales, estuvo entre 86% y 103%, a excepciÃ³n del Cr para el cual se presentaron problemas de contaminaciÃ³n en algunos aceites. Para el caso de la digestiÃ³n acida se observaron bajos lÃ­mites de detecciÃ³n que limitan su aplicaciÃ³n al anÃ¡lisis deseado, y para la metodologÃ­a de extracciÃ³n por CPE, aunque presentÃ³ lÃ­mites de detecciÃ³n apropiados, su procedimiento se viÃ³ severamente afectado por la contaminaciÃ³n, bien proveniente del ambiente y/o debido a la cantidad de pasos y reactivos que involucra, lo cual afecta tanto la exactitud como la reproducibilidad de los resultados.La metodologÃ­a de extracciÃ³n Ã¡cida y anÃ¡lisis simultÃ¡neo mediante ETAAS fue aplicado para la determinaciÃ³n simultÃ¡nea de Cd, Cu, Cr, Ni y Pb en una gran cantidad de aceites comerciales venezolanos, de diferentes tipos y marcas, para los cuales se obtuvieron niveles inferiores a los mÃ¡ximos permitidos en las normativas nacionales (que coinciden con los del Codex Internacional), y por lo tanto resultan adecuados para el consumo humano. Este trabajo fue financiado por el proyecto UCV-CDCH- PI-03-7534-2009/1.','2010-10-07','Aceites, aceites comestibles, metales pesados, analisis multielemental, aceites comerciales venezolanos',6,1,1,1,1,'2013-09-17 08:36:55','2013-09-17 08:36:55','Documento_520.pdf','application/pdf',2329944,'2013-09-17 08:36:55',20,0,86,'COMPLETO'),(515,'Teorema de Ramsey para una Clase de CategorÃ­as.','En este trabajo presentaremos el Teorema de Ramsey para ciertas clases de categorÃ­as, basado en el trabajo de R.L. Graham, K. Leeb y B.L. Rothschild, tÃ­tulado \"Ramsey\'s Theorem for a Class of Categories\" publicado en 1972. El teorema de Ramsey que presentaremos en este trabajo es lo suficientemente general como para incluir el caso especial al anÃ¡logo del teorema de Ramsey para espacios vectoriales de dimensiÃ³n finita, mejor conocido como la Conjetura de Gian-Carlo Rota. La TeorÃ­a de Ramsey es una teorÃ­a matemÃ¡tica que pretende justificar que \"el desorden absoluto es imposible\". La TeorÃ­a de Ramsey afirma que, en sistemas suficientemente grandes siempre existen subsistemas no pequeÃ±os con estructura y orden.','2010-07-06','CategorÃƒÂ­a, grafos, producto tensorial, coproducto, funtor, espacio vectorial, conjuntos, coloraciÃƒÂ³n.',5,1,1,1,1,'2013-09-17 08:36:57','2013-09-17 08:36:57','Documento_521.pdf','application/pdf',215954,'2013-09-17 08:36:57',20,0,3,'COMPLETO'),(516,'Estudio de ParÃ¡metros ElÃ¡sticos y GeotÃ©cnicos en la Transecta Guarenas - Guatire mediante MÃ©todos SÃ­smicos','En el presente trabajo se llevaron a cabo tendidos de Refraccion por Microtremores y Estudios de pozo mediante el metodo Downhole, con la finalidad de obtener cantidades fisicas como son las velocidades de propagacion de ondas de corte (Vs) y de ondas compresionales (Vp) en las cuatro estaciones del transporte colectivo Metro Guarenas-Guatire, necesarias para la caracterizacion de sitio y ytiles para determinar los parametros Elasticos y Geotecnicos.','2010-10-28','Metodos Sismicos, Refraccion por Microtremores, Downhole',3,1,1,1,1,'2013-09-17 08:36:58','2013-09-17 08:36:58','Documento_522.pdf','application/pdf',959002,'2013-09-17 08:36:58',19,0,71,'COMPLETO'),(517,'EVALUACIÃ“N DE LA CALIDAD DEL AIRE EN LOS ALREDEDORES DE LA POBLACIÃ“N MINERA DE TIARA EMPLEANDO LÃQUENES COMO BIOMONITORES DE METALES','En este estudio han sido empleados los lÃ­quenes para evaluar contaminaciÃ³n por fuentes fijas (industrias), enfocÃ¡ndonos en la empresa Minera Loma de NÃ­quel C.A., la cual estÃ¡ encargada de explotar a cielo abierto las rocas mÃ¡ficas- ultramÃ¡ficas de esta zona, siendo de mayor interÃ©s el mineral silicatado de Garnierita (Ni,Mg)3Si2O5(OH)4 (mena de nÃ­quel); alterando asÃ­ la atmÃ³sfera local y generando, posiblemente, problemas de salud en las poblaciones adyacentes como Tiara asociados a la presencia de metales en el aire. Para llevar a cabo esta investigaciÃ³n fue realizado un monitoreo de tipo activo: fueron trasplantados lÃ­quenes Parmotrema sancti angelii (Lynge) Hale desde la Universidad SimÃ³n BolÃ­var hasta los alrededores de la poblaciÃ³n minera de Tiara (5 puntos en una transecta). Adicionalmente fueron tomadas muestras de suelo superficial en la zona mÃ¡s distante y cercana a la minera con la finalidad de realizar estudios sobre el factor de enriquecimiento de los metales. La metodologÃ­a empleada para analizar las muestras de liquen consistiÃ³ en la pulverizaciÃ³n inicial con nitrÃ³geno lÃ­quido en un mortero de Ã¡gata. Posteriormente fueron secados en una estufa por 2 horas y subsiguientemente pesados 350 mg de cada muestra para disolverlas en HNO3 concentrado de grado p.a y bidestilado, empleando para ello un bloque digestor a una temperatura de 120Â°C durante 8 horas. La soluciÃ³n resultante fue filtrada y enrasada en 25 ml con agua deionizada para determinar los metales (Al, As, Ba, Cd, Co, Cr, Cu, Fe, Hg, Mg, Mn, Ni, Pb, V, Zn y Ti) mediante el uso de espectrometrÃ­a de absorciÃ³n atÃ³mica de llama (AAS), EspectrometrÃ­a de EmisiÃ³n Ã“ptica por Plasma Inductivamente Acoplado (ICP-AES) y el Analizador Directo de Mercurio MA-80. Las muestras de suelo superficial fueron disueltas segÃºn la misma metodologÃ­a descrita anteriormente, pero esta vez empleando 500 mg para cada alÃ­cuota. Los resultados obtenidos evidencian que existe acumulaciÃ³n para todos los metales, a excepciÃ³n del Cd y As que no fueron detectados, en las muestras trasplantadas. La concentraciÃ³n en estas muestras refleja muy buena correlaciÃ³n entre los metales Al, Co, Hg, Fe, Mg, Mn, Ni y Ti a lo largo de la transecta; todos ellos asociados a la litologÃ­a explotada por la minera. Otra buena correlaciÃ³n en los puntos muestreados es observada entre los metales Pb y Zn, ambos comÃºnmente provenientes de fuentes antropogÃ©nicas (quema de combustibles fÃ³siles). El estudio del factor de enriquecimiento permitiÃ³ establecer que las concentraciones de los metales Pb y Zn principalmente, no provienen del suelo local de la zona y que su fuente de emisiÃ³n puede ser atribuida a fenÃ³menos de transporte que actÃºan sobre otras fuentes naturales y/o por fuentes antropogÃ©nicas.','2010-10-26','LÃ­quenes, Biomonitoreo, Loma de NÃ­quel, ContaminaciÃ³n del aire, Metales, Parmotrema sancti--angelii, Tiara',4,1,1,1,1,'2013-09-17 08:36:59','2013-09-17 08:36:59','Documento_523.pdf','application/pdf',1665069,'2013-09-17 08:36:59',19,0,79,'COMPLETO'),(518,'DeterminaciÃ³Ã³nn de los Niveles de Mercurio Orina en los NiÃ±Ã±oos de la PoblaciÃ³Ã³nn de El Callao,, Estado BolÃ­Ã­var,, Venezuela..\"\"','El mercurio es un metal tÃ³xico bajo cualquiera de sus formas: mercurio elemental (Hg0), mercurio inorgÃ¡nico (I-Hg) o mercurio orgÃ¡nico (O-Hg). Los efectos del mercurio sobre la salud van a depender de la magnitud de la exposiciÃ³n que es dependiente del tiempo y la dosis, especie mercurial, la vÃ­a de entrada al organismo y de la sensibilidad propia de cada individuo, sin embargo los niÃ±os son los individuos en los cuales, se pueden manifestar un mayor efecto en vista de que se encuentran en etapas de crecimiento. El mercurio independientemente de la forma en que entre en contacto con el organismo puede causar nefrotoxicidad y neurotoxicidad. El nivel de exposiciÃ³n a largo plazo se evidencia en la orina, ya que el mercurio es excretado del cuerpo alrededor de 10 dÃ­as despuÃ©s de su absorciÃ³n o acumulaciÃ³n en los riÃ±ones y otros tejidos. Entre las actividades humanas que propician una exposiciÃ³n a largo plazo se encuentra la minerÃ­a artesanal del oro, en la cual se libera elevadas cantidades de mercurio al medio ambiente. Esta tipo de minerÃ­a es comÃºn en poblaciones cercanas a las zonas donde se explota el oro con fines comerciales, como la poblaciÃ³n de El Callao, en el Estado BolÃ­var, Venezuela. Por esta razÃ³n en el presente trabajo nos hemos propuesto, evaluar el impacto que esta actividad puede tener en la poblaciÃ³n infantil de El Callao, Edo. BolÃ­var. Para ello, se realizÃ³ una encuesta epidemiolÃ³gica para conocer los grados de exposiciÃ³n de los niÃ±os tanto a las fuentes primarias de exposiciÃ³n al mercurio, asÃ­ como aquellas que son producto del consumo de alimentos y medicamentos. Por otra parte, se determinaron los niveles de concentraciÃ³n de Hg por gramo de creatinina en muestras de orina de 24 horas en niÃ±os que estudian en 4 instituciones educativas pertenecientes al casco histÃ³rico de El Callao, en el estado BolÃ­var en Venezuela. Se encontraron un valores promedio de 8,21 mg Hg/g creat, un valor de mediana de 1,86 mg Hg/g creat y una desviaciÃ³n estÃ¡ndar de 16,66 mg Hg/g creat, el rango obtenido de valores de concentraciÃ³n de las muestras fue de (0,08-90,80) mg Hg/g creat. Las pruebas estadÃ­sticas indicaron que existen diferencias significativas al 95% de confianza entre el valor de la mediana de concentraciÃ³n de Hg y el valor del promedio de concentraciÃ³n de Hg, lo cual indica que no existiÃ³ una distribuciÃ³n normal de los valores. No se encontraron diferencias significativas cuando se relacionaron las medianas de las concentraciones de Hg con variables como la edad, el sexo y el tiempo de residencia en El Callao. Se encontrÃ³ una tendencia a la disminuciÃ³n de la concentraciÃ³n de Hg por gramo de creatinina a medida que aumentaban las distancias entre la vivienda de habitaciÃ³n de los niÃ±os y las posibles fuentes de exposiciÃ³n como son los molinos, minas, joyerÃ­as y talleres. TambiÃ©n se encontrÃ³ que los niÃ±os con padres cuya profesiÃ³n es \"joyeros\" , presentan mayores niveles de concentraciÃ³n de Hg que los niÃ±os que tienen padres molineros y estos a su vez tienen valores mayores de concentraciÃ³n que los niÃ±os que tienen padres mineros. Por Ãºltimo se encontraron mayores concentraciones de mercurio en aquellos niÃ±os cuyos hogares son utilizados por sus padres para la quema de amalgamas, y niÃ±os que acompaÃ±an a sus padres a los molinos.','2010-07-09','mercurio, creatinina, orina, niÃ±os, El Callao',6,1,1,1,1,'2013-09-17 08:37:01','2013-09-17 08:37:01','Documento_524.pdf','application/pdf',411110,'2013-09-17 08:37:01',20,0,73,'COMPLETO'),(519,'Desarrollo de una AplicaciÃ³n Web para la GestiÃ³n de Historias ClÃ­nicas Digitales','El objetivo de este Trabajo Especial de Grado consistiÃ³ en desarrollar una aplicaciÃ³n web para la creaciÃ³n y manipulaciÃ³n de las historias clÃ­nicas digitales, en la que se realizÃ³ el manejo y diseÃ±o de interfaz, brindando un mayor control y gestiÃ³n de las historias clÃ­nicas de los profesionales de la medicina, configuraciÃ³n y administraciÃ³n de informes y rÃ©cipes mÃ©dicos y gestiÃ³n de citas.Esta aplicaciÃ³n web fue desarrollada utilizando como lenguaje de programaciÃ³n Ruby On Rails, tecnologÃ­as del lado del cliente como HTML, HTML5, CSS y JavaScript especÃ­ficamente la librerÃ­a JQuery, a travÃ©s del mÃ©todo de desarrollo Ã¡gil de software ProgramaciÃ³n Extrema (XP). Para este Trabajo Especial de Grado se realizÃ³ una fase de investigaciÃ³n en la cual se efectuÃ³ un estudio de las necesidades de mayor importancia con respecto a las historias clÃ­nicas manejadas por distintos tipos de mÃ©dicos especialistas. Luego de una recolecciÃ³n de historias clÃ­nicas tradicionales, se logrÃ³ determinar las caracterÃ­sticas comunes de las mismas en cuanto a formato, proporcionando informaciÃ³n relevante para el desarrollo del trabajo. Como producto final se obtuvo una aplicaciÃ³n web que permite registrar al personal mÃ©dico, crear, configurar y modificar el formato de las historias clÃ­nicas, como tambiÃ©n de informes y rÃ©cipes mÃ©dicos, ademÃ¡s de proveer la posibilidad de gestionar citas mÃ©dicas.','2010-10-22','Historia clÃ­nica, Historia clÃ­nica digital, informe, rÃ©cipe, cita, ProgramaciÃ³n Extrema (XP), base de datos, tecnologÃ­as.',2,1,1,1,1,'2013-09-17 08:37:02','2013-09-17 08:37:02','Documento_525.pdf','application/pdf',4657372,'2013-09-17 08:37:02',18,0,115,'COMPLETO'),(520,'SIMULACIÃ’Ã’NN EN COMPUTADORA DEL CRECIMIENTO TUMORAL DE GLIOMAS MEDIANTE ECUACIONES DE REACCIÃ’Ã’NN--DIFUSIÃ’Ã’NN','En este trabajo se crearon dos programas con la finalidad de simular el crecimiento de gliomas usando ecuaciones de reacciÃ³n-difusiÃ³n. Para ello fue necesario crear una imagen segmentada que indicara la distribuciÃ³n de materia blanca y gris en el cerebro. Luego se definiÃ³ el tensor de difusiÃ³n tomando en cuenta que los gliomas difunden mÃ¡s rÃ¡pido en materia blanca que en materia gris. AsÃ­ mismo en el programa uno se uso un tÃ©rmino de proliferaciÃ³n exponencial (Swanson y Clartz) y para el segundo programa se utilizo un tÃ©rmino de proliferaciÃ³n logÃ­stico.A continuaciÃ³n se escogiÃ³ un par ordenado (x,y) como punto de inicio del tumor; para generar luego: grÃ¡ficas de curvas de nivel de nivel de densidades, grÃ¡ficas de crecimiento del tumor en el cerebro, asÃ­ como perfiles mes a mes y valores de concentraciÃ³n promedio, diÃ¡metro y concentraciÃ³n en el punto de origen. Como resultado se obtuvo que el programa 1 no se ajusta a la realidad, ya que su crecimiento supone que el tumor crece y difunde como si hubiese nutrientes y espacio ilimitado; mientras que el programa dos es mÃ¡s cercano a lo observable clÃ­nicamente en crecimiento de tumores. AdemÃ¡s las imÃ¡genes que se generaron corroboran el hecho clÃ­nico de que el tumor difunde mÃ¡s allÃ¡ del volumen microscÃ³pico.','2010-10-29','Simulacion, glioma, diferencia finitas.',3,1,1,1,1,'2013-09-17 08:37:04','2013-09-17 08:37:04','Documento_526.pdf','application/pdf',1212194,'2013-09-17 08:37:04',17,0,109,'COMPLETO'),(521,'Plataforma para el estudio y desarrollo de mÃ©todos de continuaciÃ³n','Los mÃ©todos de continuaciÃ³n son una herramienta Ãºtil para el estudio de algunas aplicaciones de la industria y las ciencias, son utilizados para resolver sistemas de ecuaciones no lineales que dependen de uno o mÃ¡s parÃ¡metros.Este trabajo presenta una plataforma para el anÃ¡lisis y desarrollo de mÃ©todos de continuaciÃ³n, que consiste en un software elaborado en Matlab con una interfaz grÃ¡fica de usuario diseÃ±ada para facilitar el trabajo de desarrollo, estudio, anÃ¡lisis y enseÃ±anza del tÃ³pico.El entorno propuesto sirve de soporte para realizar diversas actividades; permite a los desarrolladores la creaciÃ³n y anÃ¡lisis de mÃ©todos de continuaciÃ³n al mismo tiempo que facilita la comprensiÃ³n y la didÃ¡ctica del tema a estudiantes y docentes.La interfaz de usuario, como parte fundamental del software desarrollado, toma encuenta conceptos importantes de usabilidad.','2010-06-15','mÃ©todos de continuaciÃ³n, sistemas de ecuaciones no lineales, bifurcaciÃ³n, diagrama de bifurcaciÃ³n, corrector, predictor, usabilidad, orden uno, oden cero, pseudo-comprimiento de arco, intefaz de usuario, matlab',2,1,1,1,1,'2013-09-17 08:37:08','2013-09-17 08:37:08','Documento_527.pdf','application/pdf',2328051,'2013-09-17 08:37:08',18,0,100,'COMPLETO'),(522,'Topologias sobre conjuntos numerables','En Ã©ste trabajo estudiamos la caracterizaciÃ³n de topologÃ­as definidas sobre conjuntosnumerables que S. Todorcevic y C. UzcÃ¡tegui dan a los conjuntos numerables , estableciendo conexiones entrelas propiedades de la teorÃ­a descriptiva de conjuntos y propiedades puramente topolÃ³gicas.En el capÃ­tulo 1 presentamos algunos preliminares de topologÃ­a que serÃ¡n de utilidada lo largo del trabajo.','2010-07-07','Topologia, Topologia sobre Conjuntos Numerables, conjuntos sigma-deltas, delta- sigma, Topologia descriptiva de conjuntos',5,1,1,1,1,'2013-09-17 08:37:12','2013-09-17 08:37:12','Documento_528.pdf','application/pdf',421105,'2013-09-17 08:37:12',20,0,83,'COMPLETO'),(523,'CohomologÃ­a Invariante por acciones libres de S1','La cohomologÃ­a de De Rham es un funtor de la categorÃ­a de las variedades diferenciablesen los espacios vectoriales y detecta estructuras geomÃ©tricas en variedades, cuando lavariedad esta afectada por la acciÃ³n de un grupo de Lie compacto podemos determinarla cohomologÃ­a de invariante de De Rham, dada por las formas invariantes por la acciÃ³n.En [2] se demuestra que ambas cohomologÃ­as coinciden para cualquier acciÃ³n. En estetrabajo probaremos este mismo resultado para acciones libres de S1 para ello haremosuso del truco de Bredon.','2010-07-02','Variedades Diferenciales, Fibrados, Fibrado de formas, Cohomologia de De Rham, Sucesion de Mayer-Vietoris, acciones libres,',5,1,1,1,1,'2013-09-17 08:37:13','2013-09-17 08:37:13','Documento_529.pdf','application/pdf',2903035,'2013-09-17 08:37:13',19,0,124,'COMPLETO'),(524,'EN UNA ENCRUCIJADA ENTRE EL ANALISIS DE COMPONENTES PRINCIPALES (ACP) Y EL ANALISIS ENVOLVENTE DE DATOS (AED)','Se realiza un estudio comparativo de dos tÃ©cnicas de clasificaciÃ³n de unidades de producciÃ³n, tambiÃ©n llamadas Unidades de Toma de DecisiÃ³n (UTD). Las UTD utilizan un conjunto de recursos (Entradas) para generar un conjunto de resultados (Salidas). Las tÃ©cnicas antes mencionadas son: El AnÃ¡lisis de Componentes Principales (ACP), que es una tÃ©cnica estadÃ­stica de reducciÃ³n de dimensiÃ³n y de clasificaciÃ³n para las UTD; y El AnÃ¡lisis Envolvente de Datos (AED), metodologÃ­a de ProgramaciÃ³n Lineal para medir la eficiencia de las UTD, considerando eficiente una UTD, cuando con una cantidad determinada de Entradas genera mÃ¡s Salidas o cuando utilizando menos Entradas se generan un mÃ¡ximo de Salidas. AdemÃ¡s de aplicar el ACP y el AED, se aplica un mÃ©todo que los integra, con el fin de clasificar 45 paÃ­ses de acuerdo con la proporciÃ³n de supervivencia al cancer de piel (melanoma)entre hombres y mujeres, teniendo en cuenta la acciÃ³n de los rayos ultravioletas A y B, la Capa de Ozono y la Latitud de cada paÃ­s.','2010-06-10','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',5,1,1,1,1,'2013-09-17 08:37:15','2013-09-17 08:37:15','Documento_530.pdf','application/pdf',22340418,'2013-09-17 08:37:15',20,0,200,'COMPLETO'),(525,'Estructuras Combinatorias y AnÃ¡lisis AsintÃ³tico','El Trabajo tiene como propÃ³sito el empleo de tÃ©cnicas operacionales de la teorÃ­a de variable compleja en espacios discretos que son el ambito natural del anÃ¡lisis combinatorio. Se hacen estimaciones asintÃ³ticas de los coeficientes de series formales que aproximan objetos combinatorios en procesos enumerativos.','2010-06-23','Estructuras Combinatorias',5,1,1,1,1,'2013-09-17 08:37:17','2013-09-17 08:37:17','Documento_531.pdf','application/pdf',2061727,'2013-09-17 08:37:17',20,0,119,'COMPLETO'),(526,'Principio Generalizado de la VersiÃ³n HomolÃ³gica de la SimetrÃ­a Espejo','La simetrÃ­a espejo, es una conjetura que proviene de la fÃ­sica, especÃ­ficamente de laidenticaciÃ³n de modelos relacionados con la teorÃ­a de cuerdas. Esta conjetura no era deltodo bien entendida, pues se suponÃ­a que dos tipos de teorÃ­as (de tipo A y de tipo B) dabanorigen a invariantes equivalentes, pero en principio la naturaleza de estas teorÃ­as era distinta,luego, no estaba clara es quÃ© sentido se considerba la equivalencia.En 1994, Maxim Kontsevich propuso un acercamiento matemÃ¡tico a la conjetura de lasimetrÃ­a espejo, el propuso que la simetrÃ­a espejo consistÃ­a en una equivalencia de categorÃ­astrianguladas construÃ­das desde diferentes aspectos de la geometrÃ­a de variedades Calabi- Yaudonde se definen las teorÃ­as de tipo A y B, Ã©stas se denominan variedades espejos. La mÃ©tricade Calabi-Yau estÃ¡ determinada por una forma simplÃ©ctica y una estructura compleja, cadapieza es una rama distinta de las matemÃ¡ticas. En teorÃ­as de tipo A, sÃ³lo nos preocupamos dela estructura compleja y nos trasladaremos a la geometrÃ­a algebraica, y en las teorÃ­as de tipoB, sÃ³lo discutimos geometrÃ­a simplÃ©ctica. Luego, que ambas teorÃ­as sean equivalentes quieredecir, que las teorÃ­as de deformaciÃ³n de ambas estructuras, las cuales estÃ¡n controladas porcategorÃ­as trianguladas, son equivalentes.Nuestro objetivo es seguir esta construcciÂ¶on, a Â¯n de establecer un principio anÂ¶alogo parael caso de un objeto que posea dos estructuras.','2010-07-06','CategorÃ­a,Complejos,Variedades,DeformaciÃ³n,SimetrÃ­a,Espejo,HomologÃ­a,Operad,MÃ³dulos',5,1,1,1,1,'2013-