a de P(OPh)3, bajo presiÃ³n de gas de sÃ­ntesis (CO/H21:1) utilizando tolueno como solvente. Los productos de reacciÃ³n observados fueron: heptanal y 2-metil-hexanal provenientes de la reacciÃ³n de hidroformilaciÃ³n y 2- hexeno proveniente de la reacciÃ³n de isomerizaciÃ³n. Con el propÃ³sito de optimizar las condiciones de reacciÃ³n; pudiÃ©ndose constituir un aporte al diseÃ±o de sistemas catalÃ­ticos eficientes y estables enfocados al mejoramiento de gasolinas, se estudiaron diferentes parÃ¡metros que implican la variaciÃ³n de presiÃ³n de gas (CO/H2), temperatura, relaciÃ³n molar sustrato/catalizador ([S/ C]) y variaciÃ³n de la cantidad de catalizador ([mM]). Los estudios cinÃ©ticos involucraron la variaciÃ³n de presiÃ³n en el intervalo 100 psi (7atm) - 500 psi (34atm), temperatura comprendida entre60 ÂºC (333 K) - 90 ÂºC (363 K), la relaciÃ³n molar sustrato/catalizador en el intervalo 300 - 800 y concentraciÃ³n del catalizador comprendida entre (1,67 - 5,05)mM.Las condiciones Ã³ptimas de reacciÃ³n son: presiÃ³n de CO/H2 (500 psi/34 atm), temperatura (79ÂºC/352K), relaciÃ³n molar [1-hexeno ]/[Rh] en (772) y la [Rh] en 1,68mM.','2010-07-13','CatÃ¡lisis HomogÃ©nea, HidroformilaciÃ³n, Rodio, gem-ditiolato, Complejo de Rodio, Gas de SÃ­ntesis, Estudios CinÃ©ticos.',6,1,1,1,1,'2013-09-17 08:37:23','2013-09-17 08:37:23','Documento_534.pdf','application/pdf',2037313,'2013-09-17 08:37:23',17,0,96,'COMPLETO'),(529,'Caractizacion del HÃ¡bitat y ComposiciÃ³n de la Dieta del Babo Morichalero (Paleosuchus palpebrosus) en los Llanos Orientales, Estado AnzoÃ¡tegui','El propÃ³sito de este trabajo fue caracterizar el hÃ¡bitat y la composiciÃ³n de la dieta de Paleosuchus palpebrosus. El estudio se realizÃ³ en los llanos orientales, al suroeste del Estado AnzoÃ¡tegui. El clima es biestacional con seis meses de sequÃ­a (Noviembre-Abril) y seis meses de lluvia (Mayo-Octubre). La temperatura media anual es 26.2 Ã‹ÂšC, y la precipitaciÃ³n total media anual es 890 mm. Las capturas de los animales se realizaron en tres rÃ­os con bosque ribereÃ±o siempre verde. El hÃ¡bitat se caracterizÃ³ utilizando variables como: altura del dosel del bosque, densidad de cobertura del dosel del bosque, profundidad de la lÃ¡mina de agua, velocidad de la corriente de agua, y ancho del lecho del rÃ­o. Los tres rÃ­os muestreados fueron muy similares entre sÃ­, aunque se encontraron diferencias estadÃ­sticamente significativas en cuanto a la altura de dosel entre los rÃ­os Negro y Cangilones (Hc = 12,01; gl = 1; P < 0,05), al igual que con las variables \"ancho del cauce del rÃ­o\" (Hc = 12,26; gl = 1; P < 0,05) y \"velocidad de la corriente\" (Hc = 9,35; gl = 2; P < 0,05). Se registrÃ³ la presencia de babos morichaleros en todos los micro hÃ¡bitats evaluados. Sin embargo, la distribuciÃ³n espacial de los animales detectados sugiere que Ã©stos tienden a utilizar con mayor frecuencia el micro hÃ¡bitat \"Solapa\". 76,79 % de los animales detectados se encontraron en el micro hÃ¡bitat \"Solapa\". La composiciÃ³n de la dieta anual estuvo mayormente representada por crustÃ¡ceos (cangrejos, 25 % y camarones, 6,2 %), insectos (OrtÃ³pteros, 24,9%), mamÃ­feros (Roedores, 19,4%), peces (caraciformes, 13,8%), y reptiles (serpientes, 2,5%), en tÃ©rminos de abundancia. En tÃ©rminos de frecuencia de apariciÃ³n, los renglones alimentarios consumidos mÃ¡s importantes fueron insectos (46,2 %) y cangrejos (35,9 %) y los menos frecuentes araÃ±as (10,3 %) y reptiles (2,6 %). La composiciÃ³n de la dieta fue similar entre sexos (U = 32; P = 0,0636; a = 0,05). La diversidad de la dieta (Ãndice de Shannon- Wiener) fue similar entre juveniles y sub-adultos (tp = 1,4183 < tc = 1,71; gl = 23; a = 0,05) y diferente entre sub-adultos y adultos (tp = 0,7933 < tc = 1,67; gl = 52; a = 0,05). Los resultados sugieren que P.. palpebrosus es un depredador oportunista que consume principalmente invertebrados terrestres y acuÃ¡ticos.','2010-07-06','Paleosuchus palpebrosus, hÃ¡bitat, dieta.',1,1,1,1,1,'2013-0