iÃ³n de protocolo de control de calidad basado en las pruebas de aceptaciÃ³n y comisionamiento propuestas.','2010-12-10','colimador micro multilÃƒÂ¡minas, cÃƒÂ¡mara de ionizaciÃƒÂ³n lÃƒÂ­quida',3,1,1,1,1,'2013-09-17 08:37:26','2013-09-17 08:37:26','Documento_537.pdf','application/pdf',1252579,'2013-09-17 08:37:26',20,0,88,'COMPLETO'),(532,'COMPARACIÃ“N EN GEOMETRÃA DE HAZ ESTRECHO DE LA RESPUESTA DEL DETECTOR DE DIAMANTE Y LA CÃMARA DE IONIZACIÃ“N LÃQUIDA DE 0.002 cc','Tratamientos con radiaciones ionizantes como la radiocirugÃ­a utilizan haces de fotones estrechos. En este tipo de campos las cÃ¡maras de ionizaciÃ³n con medio de detecciÃ³n gaseoso han sido hasta los momentos usadas para realizar la calibraciÃ³n fÃ­sica del equipo. Estas cÃ¡maras pueden presentar problemas, debidos a la falta de equilibrio de partÃ­culas cargadas (CPE). Los procedimientos de control de calidad asociados a este tipo de tratamientos demandan dosÃ­metros de alta resoluciÃ³n espacial. Es por ello que existe en el mercado una cÃ¡mara nueva, la cual consta de un medio de detecciÃ³n lÃ­quido, esta cÃ¡mara de ionizaciÃ³n la MicroLion 31018 posee un volumen sensible a la radiaciÃ³n de 0,002 cc, el objetivo principal de este Trabajo Especial de grado (T.E.G) fue el caracterizar la cÃ¡mara de ionizaciÃ³n liquida MicroLion, comparando las medidas obtenidas con ella contra las medidas obtenidas por el detector de diamante para campos pequeÃ±os, desde 5 cm2 hasta 0.5 cm2 para potenciales aceleradores de 6 MV y 18 MV.','2011-02-04','camara de ionizacion liquida, detector de diamantes, haz estrecho, factores de salida, isooctano',3,1,1,1,1,'2013-09-17 08:37:28','2013-09-17 08:37:28','Documento_538.pdf','application/pdf',21702248,'2013-09-17 08:37:28',20,0,68,'COMPLETO'),(533,'Algoritmo trazador de rayos sÃ­smicos en medios heterogÃ©neos estratificados isÃ³tropos usando tÃ©cnicas nÃºmericas.','En la prospecciÃ³n sÃ­smica, especialmente en la exploraciÃ³n petrolera, se necesita saber el camino que siguen los rayos sÃ­smicos en el subsuelo, tomando en cuenta las diferentes capas geolÃ³gicas presentes. Como cada capa tiene su impedancia caracterÃ­stica, la velocidad de propagaciÃ³n de las ondas varÃ­a con la regiÃ³n del subsuelo en el cual se desplazan. El trazado de rayos sÃ­smico ha sido ampliamente usado como una tÃ©cnica de exploraciÃ³n del subsuelo, produciendo con una explosiÃ³n (fuente) una onda que luego es recibida por varios sensores repartidos apropiadamente de acuerdo a la mejor configuraciÃ³n utilizada sobre la superficie del terreno (receptores).Las aplicaciones de esta tÃ©cnica van desde la exploraciÃ³n petrolera y en general toda la minerÃ­a, asÃ­ como en sismologÃ­a donde se ha usado para el estudio de la corteza, el manto y el nÃºcleo terrestre usando como fuentes el hipocentro de terremotos, hasta otros campos del conocimiento como la IngenierÃ­a Civil, para esclarecer los tipos de suelos donde se van a construir estructuras, en la arqueologÃ­a, en estudios de sonares, en la detecciÃ³n de objetos tridimensionales con ondas sÃ³nicas o electromagnÃ©ticas (GPR), en el diseÃ±o de equipos Ã³pticos, y en el diseÃ±o de redes WAN entre otras.Siendo el problema del trazado de rayo extraordinariamente complejo, su soluciÃ³n solo puede obtenerse usando tÃ©cnicas numÃ©ricas computacionales. En este sentido, en el presente trabajo, se emularon satisfactoriamente los resultados obtenidos y propuestospor Andrej BÃ³na, Michael Slawinski y Peter Smith en el artÃ­culo [5] presentado en el aÃ±o 2009, titulado Ray tracing by simulated annealing: Bending method. AdemÃ¡s, se comprobÃ³ que el mÃ©todo fuÃ© capaz de trazar rayos bastantes precisos y se propusieronmejoras para dicho algoritmo.Debido a la fuerte no linealidad del problema de optimizaciÃ³n descrito, fuÃ© necesario buscar la soluciÃ³n en forma iterativa. Con el fin de evitar posibles mÃ­nimos locales y una convergencia prematura, se utilizÃ³ el mÃ©todo de optimizacion global conocido como Recocido Simulado y se utilizaron modelos sintÃ©ticos.Para emular y comprobar el correcto funcionamiento y eficiencia del presente algoritmo, se utilizaron modelos de velocidades existentes en la literatura, como fueron el modelo exponencial linealmente heterogÂ´eneo y el modelo de Marmousi. Dicho algoritmo se programÃ³ en Octave, el cual proporcionÃ³ una interfaz de lÃ­nea de comandos para resolver nÃºmericamente los problemas no lineales encontrados.','2011-01-27','800x600 Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-parent:\"\";',3,1,1,1,1,'2013-09-17 08:37:29','2013-09-17 08:37:29','Documento_539.pdf','application/pdf',3244326,'2013-09-17 08:37:29',20,0,66,'COMPLETO'),(534,'Desarrollo de una metodologÃ­Ã­a de ensayo mecÃ¡Ã¡nico para la determinaciÃ³Ã³nn de los parÃ¡Ã¡metros elÃ¡Ã¡sticos en muestras de lutita de nÃºÃºccleos de pozos petroleros','El siguiente trabajo se realizÃ³ diferentes ensayos para determinar las propiedades mecÃ¡nicas en nÃºcleos de lutita. Vale destacar que la lutita es una roca sedimentaria resultante de la compactaciÃ³n de los sedimentos ricos en arcilla y constituyen el tipo mÃ¡s frecuente de las rocas encontradas durante la perforaciÃ³n de petrÃ³leo y gas. Para las muestras sometidas a estudios, mediante anÃ¡lisis de difracciÃ³n de rayos \"X\", se aprecia que el contenido de arcilla es lo suficientemente alto y con alto grado de compactaciÃ³n, correspondiendo a arcillas gravosas compactadas con minerales como caolinita y siderita.Los ensayos mecÃ¡nicos en muestras de muy baja permeabilidad como la lutita, ademÃ¡s de ser tan complejas desde el punto de vista de estabilidad de hoyo (por su inestabilidad quÃ­mica y fÃ­sica), se presenta que la variaciÃ³n de presiÃ³n de poros (PP) es mucho mayor a la variaciÃ³n de las presiones externas a la que estÃ¡ sometida la muestra, causando que el rompimiento de la muestra no sea inducido por la carga axial, sino por la variaciÃ³n de la presiÃ³n efectiva, ya sea axial Ã°ÂÂÂˆÂ´Ã°ÂÂ’Â‚Ã°ÂÂ’Â™= Ã°ÂÂÂˆÃ°ÂÂ’Â‚Ã°ÂÂ’Â™-Ã°ÂÂ‘Â·Ã°ÂÂ‘Â· o radialÃ°ÂÂÂˆÂ´Ã°ÂÂ’Â“Ã°ÂÂ’Â‚Ã°ÂÂ’Â…= Ã°ÂÂÂˆÃ°ÂÂ’Â“Ã°ÂÂ’Â‚Ã°ÂÂ’Â…-Ã°ÂÂ‘Â·Ã°ÂÂ‘Â· , trayendo como consecuencia medidas errÃ³neas en la obtenciÃ³n de los mÃ³dulos elÃ¡sticos y largos tiempos de ensayo.Los ensayos mecÃ¡nicos a los que se sometieron las muestras de lutita fueron de dos tipos: Ã¯Â‚Â· Ensayos dinÃ¡micos de propagaciÃ³n acÃºstica donde se realiza estudios del comportamiento de las velocidades de ondas \"P\", \"S1\" y \"S2\" cuando se propagan a travÃ©s de las muestras a distintas presiones de confinamiento. De estos ensayos se obtiene que las velocidades muestran una poca variaciÃ³n con el aumento del confinamiento, ademÃ¡s de las bajas variaciones de los mÃ³dulos elÃ¡sticos debido a la poca porosidad y alta compactaciÃ³n de la muestra. TambiÃ©n se tiene que para muestras verticales y horizontales existe una diferencia en los mÃ³dulos elÃ¡sticos, donde las muestras horizontales arrojan valores de mÃ³dulo de Young (44.81 GPa en promedio) mayores 1.7 veces a los valores de mÃ³dulo de Young en muestras verticales (26.35 GPa en promedio). Estos resultados se atribuyen a la disposiciÃ³n de la laminaciÃ³n al momento del corte de los tapones, donde en muestras horizontales con laminaciÃ³n vertical, las llegadas de las ondas son mucho mÃ¡s rÃ¡pidas que en las muestras verticales cuya laminaciÃ³n es horizontal. Las relaciones de Poisson para muestras horizontales estuvieron comprendidas entre 0.24 y 0.26 mientras que para muestras verticales la relaciÃ³n de Poisson estuvo entre los 0.28 y 0.30.Ensayos estÃ¡ticos triaxiales con presiÃ³n de poros para determinar las propiedades mecÃ¡nicas estÃ¡ticas de los nÃºcleos de lutita. En estos se utilizaron los protocolos propuestos por la ASTM (American Society for Testing & Materials) para el acondicionamiento y ensayo de las muestras, donde se persigue controlar la presiÃ³n de posos (PP) simultÃ¡neamente con las variaciones de las presiones externas (axial y confinante), y asÃ­ determinar los mÃ³dulos elÃ¡sticos y los parÃ¡metros \"B\" y \"A\" de la Ley de Skempton:DÃ°ÂÂ’Â–=Ã°ÂÂ‘Â© DÃ°ÂÂÂˆÃ°ÂÂŸÂ‘+Ã°ÂÂ‘Â¨ DÃ°ÂÂÂˆÃ°ÂÂŸÂ- DÃ°ÂÂÂˆÃ°ÂÂŸÂ‘ mediante las curvas de Esfuerzo Vs. DeformaciÃ³n. Cada ensayo triaxial consto de dos fases, una fase de saturaciÃ³n, donde la muestras fueron sometidas a confinamiento Ãºnicamente para medir la respuesta de la presiÃ³n de poros con los cambios de las presiones de confinamiento empleando un sistema de drenaje lateral para acelerar las fases de la saturaciÃ³n, estabilizar la presiÃ³n de poros y garantizar que no haya una respuesta violenta durante la aplicaciÃ³n de carga axial; y una fase de fracturamiento donde, mediante presiÃ³n axial, se procede al fracturamiento de las muestras y la respectiva mediciÃ³n a travÃ©s de las curvas de Esfuerzo Vs. DeformaciÃ³n de los mÃ³dulos de Young y relaciÃ³n de Poisson. De este ensayo se estimÃ³ (en promedio) mÃ³dulos de Young medio, tangente y secante de 7.88, 9.17 y 3.34 GPa respectivamente, mientras que para muestras verticales se tienen mÃ³dulos de Young medio, tangente y secante de 4.12, 2.22 y 3.00 GPa respectivamente (casi 1.7 menor que las muestras horizontales). Estas diferencias, al igual que en los ensayos acÃºsticos, son atribuidas a la disposiciÃ³n de la laminaciÃ³n en las muestras. En cuanto a la relaciÃ³n de Poisson, los valores medidos en estos ensayos no fueron muy representativos debido a que el enchaquetado utilizado absorbÃ­a parte de la deformaciÃ³n radial que se inducia en la muestra, arrojando calores en promedio de 0.1 aproximadamente tanto para muestras verticales como horizontales.Todos estos ensayos a los que fueron sometidos las muestras de lutita se realizaron en las instalaciones del Laboratorio de GeomecÃ¡nica de la empresa PDVSA- INTEVEP, el cual cuenta con equipos de alta tecnologÃ­a entre los cuales se encuentra el equipo AutoLab2000, cuyo diseÃ±o es el apropiado para medir propiedades acÃºsticas, mecÃ¡nicas y elÃ©ctricas en rocas de yacimientos petrolÃ­feros.','2011-02-18','Lutita, triaxiales, PresiÃ³n de poros, Presion confinante, propiedades mecÃ¡nicas, modulos elÃ¡sticos.',3,1,1,1,1,'2013-09-17 08:37:31','2013-09-17 08:37:31','Documento_540.pdf','application/pdf',2943455,'2013-09-17 08:37:31',18,0,109,'COMPLETO'),(535,'EMPACADO AL VACIO DEL LOMO DE ATÃšÃšNN ALETA AZUL ((Thunnus sp..))COMO ALTERNATIVA PARA AUMENTAR LA VIDA ÃšÃšTTIL EN EL ALMACENAMIENTO CONGELADO A --2200 Â°Â°C','En Venezuela el producto de la pesca del atÃºn (TThunnus sp.) estÃ¡ dirigido principalmente como materia prima para la industria conservera, a la cual se destina el 35 % de la producciÃ³n nacional de hojalata. Sin embargo, el proceso de globalizaciÃ³n ha introducido en Venezuela la modalidad del consumo de pescado crudo, entre ellos el atÃºn, destacÃ¡ndose los atunes aleta azul y ojo grande, los cuales son utilizados principalmente para elaborar sashimi, el cual es un plato de origen japonÃ©s que consiste en consumir pescados y mariscos crudos. La conservaciÃ³n del pescado crudo destinado a la preparaciÃ³n de sashimi consiste en mantenerlo refrigerado de 0 a 5 ÂºC o congelado a -40 ÂºC para conservar los atributos que definen la calidad del pescado fresco. Esto Ãºltimo ha impulsado a la industria a desarrollar procesos y tecnologÃ­as que permitan conservar los atributos que definen la calidad del atÃºn fresco por un perÃ­odo de tiempo que favorezca su comercializaciÃ³n. De ahÃ­ proviene el interÃ©s de conservar el atÃºn fresco, empacado al vacÃ­o y congelado a -20 ÂºC, usando un laminado polimÃ©rico con propiedades de barrera como la impermeabilidad al oxÃ­geno para evitar o minimizar la rancidez de los Ã¡cidos grasos y la oxidaciÃ³n de la mioglobina; la impermeabilidad al vapor de agua para evitar o minimizar las pÃ©rdidas de humedad y compuestos volÃ¡tiles aromÃ¡ticos; y la opacidad a la luz. AdemÃ¡s deberÃ¡ poseer resistencia mecÃ¡nica a -20 ÂºC. Por todo esto se estableciÃ³ como objetivo evaluar la estabilidad fÃ­sica y quÃ­mica de trozos de atÃºn aleta azul (Thunnus sp..))empacados al vacÃ­o y a presiÃ³n atmosfÃ©rica, congelados y almacenados a -20 ÂºC. Se encontrÃ³ que el empacado al vacÃ­o del atÃºn fresco y su posterior congelaciÃ³n a -20 Â°C ofrece mayor protecciÃ³n a los trozos de lomo de atÃºn y conservÃ³ sus atributos de calidad durante los 90 dÃ­as de almacenamiento a -20 Â°C. En promedio, este tratamiento mostrÃ³ los valores mÃ¡s bajos de BVT, TBA, PS, asÃ­ como los indicadores microbiolÃ³gicos y el tejido muscular mantuvo su color rojo caracterÃ­stico durante el almacenamiento; seguido por el tratamiento de empacado postproceso de congelaciÃ³n, el cual ofrece la desventaja de la manipulaciÃ³n del producto congelado.','2011-02-21','atÃºn, congelaciÃ³n, empacado, vacÃ­o',1,1,1,1,1,'2013-09-17 08:37:35','2013-09-17 08:37:35','Documento_541.pdf','application/pdf',2689715,'2013-09-17 08:37:35',20,0,141,'COMPLETO'),(536,'CreaciÃ³n de un Plugin para NetBeans que Agilice el Desarrollo de Aplicaciones Web Utilizando el Framework DinÃ¡mica','El presente Trabajo Especial de Grado (T.E.G.) comprende la creaciÃ³n de una herramienta para agilizar el desarrollo de aplicaciones Web usando como base el framework DinÃ¡mica. Este framework venezolano posee un repositorio de plantillas que constituyen soluciones pre-construidas para resolver problemas comunes presentes en el desarrollo de aplicaciones web. El objetivo principal de este T.E.G es minimizar la carga de trabajo de los programadores al automatizar las tareas que comprenden el proceso de reutilizaciÃ³n que trae consigo el uso del framework DinÃ¡mica, aumentando asÃ­ la productividad.La herramienta desarrollada consiste en un plugin para NetBeans IDE formado por diversos mÃ³dulos para cubrir cada una de las funcionalidades. Desde la creaciÃ³n y configuraciÃ³n de un proyecto base hasta la creaciÃ³n y configuraciÃ³n de las plantillas mÃ¡s importantes, asÃ­ como una plantilla general y un mÃ³dulo para el manejo de la seguridad.Para el desarrollo del plugin se utilizaron diversas tecnologÃ­as como son el framework DinÃ¡mica, que es la base de la propuesta, NetBeans IDE 6.9 que constituye el entorno integrado de desarrollo (IDE por sus siglas en inglÃ©s -Integrated Development Environment-) para el cual se creÃ³ la herramienta, Java como lenguaje de programaciÃ³n y Apache Tomcat versiÃ³n 6.0.26 como contenedor Web.Se cumpliÃ³ con los objetivos planteados y se evaluaron los resultados, determinando que la herramienta desarrollada constituye un gran aporte en el incremento de la productividad de los programadores, usuarios del framework DinÃ¡mica.','2011-02-17','Aplicaciones Web, framework, framework DinÃ¡mica, programaciÃ³n extrema, plugin, NetBeans',2,1,1,1,1,'2013-09-17 08:37:38','2013-09-17 08:37:38','Documento_542.pdf','application/pdf',2370162,'2013-09-17 08:37:38',20,0,178,'COMPLETO'),(537,'\"\"HIDRODESMETALIZACIÃ“Ã“NN,, ASISTIDA ELECTROQUÃÃMMICAMENTE VÃÃAA PERMEACIÃ“Ã“NN DE HIDRÃ“Ã“GGENO,, DE MOLÃ‰Ã‰CCULAS MODELO Y EXTRACTOS PORFIRÃ­Ã­NICOS CONTENIDOS EN CRUDOS\"\"','Se estudiÃ³ la reactividad del hidrÃ³geno atÃ³mico (HÃ¢Â—Â), electroquÃ­micamente adsorbido sobre superficies de negro de Pd, en la conversiÃ³n de metaloporfirÃ­nas modelo (VOTPP y NiTPP) y extractos porfirÃ­nicos provenientes de un crudo venezolano; bajo condiciones de reacciÃ³n Ã³ptimas establecidas: densidad de corriente catÃ³dica de -1,92 mA.cm-2, presiÃ³n atmosfÃ©rica y 25 Â°C. Estas reacciones se realizaron usando dos (2) medios de reacciÃ³n: (i) un medio de reacciÃ³n simple o no emulsificado; donde el sustrato a convertir (molÃ©culas modelo de vanadilo y nÃ­quel, y extracto porfirÃ­nico proveniente de un crudo venezolano) se disuelve en cloroformo (CHCl3) como solvente y (ii) un medio de reacciÃ³n emulsificado (O/W; emulsiÃ³n aceite en agua, tipo normal), donde se evaluaron cuatro (4) condiciones diferentes para la fase dispersante (W), favoreciendo asÃ­ la transferencia de fase del metal liberado durante la reacciÃ³n con el HÃ¢Â—Â. Los medios emulsificados (O/W) evaluados son: sustrato+CHCl3/agua desionizada, sustrato+CHCl3/HCl 1x10-5 M, sustrato+CHCl3/ HCl 1x10-5 M+EDTA 4x10-4 M y sustrato+CHCl3/EDTA 4x10-4 M. Una vez que Ã©ste fue formulado y caracterizado se estudia el efecto del medio emulsificado en las reacciones de desmetalizaciÃ³n. Los porcentajes de conversiÃ³n para las metaloporfirÃ­nas modelo y el extracto porfirÃ­nico fueron mucho mayores al reaccionar empleando un medio emulsificado (mÃ¡ximos de 38% y 24% respectivamente) que un medio de reacciÃ³n simple (8,7% y 0% respectivamente). El emplear un medio emulsificado permite fomentar y cuantificar la reacciÃ³n de desmetalizaciÃ³n del complejo porfirÃ­nico en el tiempo. Al cuantificar la cantidad de metal libre en la fase dispersante (W), al final de la reacciÃ³n, se demostrÃ³ que la ruptura o clivaje de las metaloporfirÃ­nas fue efectivo. Para las molÃ©culas modelos evaluadas y el extracto del crudo se reportan porcentajes de desmetalizaciÃ³n de 73% y 6% respectivamente, para un tiempo mÃ¡ximo de reacciÃ³n de seis (6) horas.','2011-02-15','HidrÃ³geno atÃ³mico, reacciones asistidas electroquÃ­micamente, hidrotratamiento, porfirÃ­nas',6,1,1,1,1,'2013-09-17 08:37:38','2013-09-17 08:37:38','Documento_543.pdf','application/pdf',1427170,'2013-09-17 08:37:38',20,0,115,'COMPLETO'),(538,'SÃ­Ã­ntesis y caracterizaciÃ³Ã³nn de la sÃ­Ã­lice mesoporosa SBA--1155 y compuestos relacionados tipoMO..Fe22O33//SBA--1155','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5