mo son el framework DinÃ¡mica, que es la base de la propuesta, NetBeans IDE 6.9 que constituye el entorno integrado de desarrollo para el cual se creÃ³ la herramienta, Java como lenguaje de programaciÃ³n y Apache Tomcat versiÃ³n 6.0.26 como contenedor Web. Se cumpliÃ³ con los objetivos planteados y se evaluaron los resultados, determinando que la herramienta desarrollada constituye un gran aporte en el incremento de la productividad de los programadores, usuarios del framework DinÃ¡mica. Autores: Eduardo A. Carrasquero B. Daniela C. Marfil G. Tutores: Prof. RhadamÃ©s Carmona Lic. Armando Vieira','2011-02-17','Normal 0 21 false false false ES-TRAD X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso',2,1,1,1,1,'2013-09-17 08:37:45','2013-09-17 08:37:45','Documento_548.pdf','application/pdf',2036126,'2013-09-17 08:37:45',20,0,117,'COMPLETO'),(543,'EVALUACIÃ“N FITOQUÃMICA DE LOS EXTRACTOS APOLARES DE CROTON PUNGENS','En un primer estudio fitoquÃ­mico de los extractos apolares de los tallos y las hojas de Croton pungens se aislarony caracterizaron nueve compuestos, de los cuales cuatro fueron caracterizados como: b-sitosterol (I), fitol (II),nor-ent- kaurano (III) y un ester de cadena larga del b-sitosterol (IV); se identificaron igualmente por CG/EMmezclas complejas de alcoholes y compuestos alifÃ¡ticos de cadenas largas. La evaluaciÃ³n toxicolÃ³gica delextracto acuoso de las hojas de Croton pungens determinÃ³ que la planta es segura de acuerdo a la OMS para eluso de este extracto en otras pruebas in vivo y el extracto no presentÃ³ actividad analgÃ©sica para la dosis de0.5113 g/Kg (1/2 DT50).','2011-02-28','Croton pungens, b-sitosterol, fitol, nor-ent-kaurano, ester de cadena larga del b-sitosterol, evaluaciÃ³ntoxicolÃ³gica',6,1,1,1,1,'2013-09-17 08:37:47','2013-09-17 08:37:47','Documento_549.pdf','application/pdf',1792767,'2013-09-17 08:37:47',20,0,99,'COMPLETO'),(544,'ANÃLISIS COMPARATIVO DE LOS PERFILES PROTEICOS DE UNA VARIEDAD RESISTENTE Y UNA SUSCEPTIBLE DE ZEA MAYSSIN INFECTAR EINFECTADAS CON ASPERGILLUS FLAVUS.','El ataque de patÃ³genos en plantas resulta en numerosas respuestas bioquÃ­micas y la activaciÃ³n de algunas de ellas determina la habilidad de la planta de combatir enfermedades. El maÃ­z es uno de los principales alimentos producidos y consumidos en nuestro paÃ­s, y el mejoramiento de este rubro requiere de un manejo agronÃ³mico para el cual es importante el desarrollo de diferentes investigaciones. Las investigaciones sobre el ataque de patÃ³genos a este cultivo se han enfocado en el estudio de diversos genes y proteÃ­nas que posiblemente actÃºen en la resistencia de los granos contra el ataque de los mismos. Sin embargo, la informaciÃ³n concerniente a las proteÃ­nas que se encuentran constantemente presentes en estos granos sin alterar su expresiÃ³n, podrÃ­a complementar el rol de las rutas metabÃ³licas necesarias en este rubro y ser utilizada para futuras investigaciones. En este trabajo se utilizaron herramientas proteÃ³micas para identificar proteÃ­nas constantemente presentes en los perfiles proteicos de granos de una lÃ­nea resistente y una susceptible de Zea mays sin inocular e inoculadas con el hongoAspergillus flavus. Los spotsseleccionados fueron sometidos a una digestiÃ³n iin situ con tripsina seguida de su posterior identificaciÃ³n por espectrometrÃ­a de masas de tipo MALDI-TOF. En el presente trabajo se seleccionaron un total de 20 proteÃ­nas y tras su identificaciÃ³n la mayor parte de las proteÃ­nas estÃ¡n asociadas con el metabolismo (50%) entre las que se encuentran las involucradas con la sÃ­ntesis de isoprenoides, ruta del mevalonato y el ciclo celular, otra buena parte con condiciones de estrÃ©s (40%) como la producciÃ³n de especies reactivas de oxÃ­geno, estrÃ©s hÃ­drico y patogenicidad, y por Ãºltimo una pequeÃ±a parte de proteÃ­nas hipotÃ©ticas (10%) cuya funciÃ³n no ha sido reportada aÃºn.','2011-01-28','zea mays, proteomica, aspergillus flavus, respuestas bioquimicas, proteinas',1,1,1,1,1,'2013-09-17 08:37:49','2013-09-17 08:37:49','Documento_550.pdf','application/pdf',5423386,'2013-09-17 08:37:49',20,0,118,'COMPLETO'),(545,'DiagnÃ³stico serolÃ³gico deferencial de la fase aguda y crÃ³nica de la Esquistosomiasis: estudio de las glicoproteÃ­nas del glicocalix de la cercaria','La Esquistosomiasis o Bilharziosis es una de las enfermedades parasitarias mÃ¡s difundida en el mundo que afecta a mÃ¡s de 200 millones de personas en las zonas tropicales e intertropicales. Es causada por algunas de las especies de gusanos planos del gÃ©nero Schistosoma y consiste en una dolencia fundamentalmente crÃ³nica, que debilita severamente a quienes la padecen, reduce su capacidad productiva, los incapacita y limita sus perspectivas de progreso econÃ³mico y social. DespuÃ©s de la malaria, esta parasitosis ocupa el segundo lugar en importancia desde un punto de vista socioeconÃ³mico y de salud pÃºblica. En Venezuela, la Ãºnica especie que infecta al hombre es Schistosoma mansoni el cual se encuentra diseminado en una superficie de 15.000 Km2 de la zona centro- costera del paÃ­s (estados Aragua, Carabobo, el norte de GuÃ¡rico, Miranda y Vargas). Las cercarias del Schistosoma mansoni son estadios larvales constituidos por un cuerpo y una cola bifurcada, los cuales estÃ¡n recubiertos por un tegumento con un Ã¡rea de 20.000 mm2. En su parte mÃ¡s externa, el tegumento estÃ¡ cubierto por una membrana trilaminada limitada por un denso glicocalix altamente antigÃ©nico que parece jugar un papel importante en la respuesta innata y adaptativa del hospedador y es el responsable de la reacciÃ³n antÃ­geno-anticuerpo que ocurre en presencia de sueros de pacientes. Una serie de mÃ©todos parasitolÃ³gicos, bioquÃ­micos e inmunoquÃ­micos fueron utilizados para llevar a cabo este estudio. Su aplicaciÃ³n permitiÃ³ investigar desde la cercario-reacciÃ³n mÃ¡s sencilla hasta lo mÃ¡s complejo como la identificaciÃ³n, aislamiento y caracterizaciÃ³n de los polipÃ©ptidos antigÃ©nicos y sus epÃ­topes en el glicocalix de la cercaria. Un mÃ©todo mecÃ¡nico sencillo fue diseÃ±ado para separar las cercarias en cuerpos y colas sin producir pÃ©rdida del glicocalix y sin afectar su morfologÃ­a externa, ni su antigenicidad. La cercario-reacciÃ³n fue de utilidad para monitorear la presencia del glicocalix durante la separaciÃ³n de cercarias en cuerpos y colas. Nuevos antÃ­genos aparecieron en ambas regiones como consecuencia de la separaciÃ³n. Los antÃ­genos identificados en una u otra regiÃ³n como consecuencia de la separaciÃ³n (58,2 y 64 kDa en cuerpos y 35 y 53,6 kDa en cuerpos y colas). Los antÃ­genos identificados en los extractos de cuerpos y de colas no resultaron ser la suma de los identificados en el extracto de cercarias completas. AntÃ­genos de peso molecular entre 16,5- 84,3 kDa fueron reconocidos durante las primeras seis semanas de infecciÃ³n (fase aguda) y a las 16 semanas (fase crÃ³nica), antÃ­genos adicionales de alto peso molecular fueron detectados (104-109,8 kDa). Esto podrÃ­a ser consecuencia de eventos inmunitarios producidos durante el progreso de la fase crÃ³nica de la infecciÃ³n. La oxidaciÃ³n-reducciÃ³n con metaperiodato de sodio/borohidrato de sodio de la glicoproteÃ­na antigÃ©nica dominante de 65 kDa, no alterÃ³ su reconocimiento por el suero de infecciÃ³n aguda y crÃ³nica, mientras que las de 97,5-100 y 108,2 kDa fueron reconocidas antes y despuÃ©s del tratamiento Ãºnicamente por el suero de infecciÃ³n crÃ³nica. Esto sugiere que los anticuerpos producidos durante la infecciÃ³n crÃ³nica estÃ¡n dirigidos contra epÃ­topes glicosÃ­dicos y peptÃ­dicos de estas glicoproteÃ­nas, lo que puede explicar la reducciÃ³n en intensidad de las bandas del doblete de 97,5-100 kDa reconocidas por el suero de infecciÃ³n crÃ³nica despuÃ©s del tratamiento. El hecho de que en la infecciÃ³n aguda se produzcan anticuerpos que reconocen epÃ­topes polipeptÃ­dicos en la glicoproteÃ­na de 65 kDa y en la fase crÃ³nica contra otros tres (97,5-100 y 108,2 kDa), podrÃ­a ser Ãºtil para la identificaciÃ³n de su secuencia polipeptÃ­dica conducente a la sÃ­ntesis quÃ­mica de epÃ­topes lineales destinados a la discriminaciÃ³n de estas dos fases de la enfermedad. La evaluaciÃ³n de reactividad cruzada con otros parÃ¡sitos relacionados es requerida para determinar la especificidad de estos epÃ­topes de antÃ­genos glicoprotÃ©icos.','2011-02-16','Esquistosomiasis,Schistosoma mansoni, GlicoproteÃ­nas, DiagnÃ³stico',1,1,1,1,1,'2013-09-17 08:37:51','2013-09-17 08:37:51','Documento_551.pdf','application/pdf',12473836,'2013-09-17 08:37:51',19,0,269,'COMPLETO'),(546,'Prototipo de sistema automatizado de triaje para la emergencia hospitalaria','El triaje de emergencia persigue desarrollar el proceso de valorizaciÃ³n clÃ­nica preliminar para ordenar los pacientes segÃºn el nivel de urgencia o gravedad, antes de la atenciÃ³n mÃ©dica, de forma que, en una condiciÃ³n de saturaciÃ³n del servicio o disminuciÃ³n de recursos, los pacientes mÃ¡s graves sean tratados con prioridad. Un proceso de triaje presenta un alto grado de imprecisiÃ³n o incertidumbre al momento de expresar el estado de salud de un paciente, en consecuencia puede haber dificultad y riesgo en la clasificaciÃ³n de las urgencias. En los servicios de emergencias de los hospitales pÃºblicos venezolanos, en especial el servicio de emergencia del Hospital Universitario de Caracas (HUC), se ha evidenciado un incremento en el nÃºmero de casos que se atienden, siendo una constante la saturaciÃ³n del servicio, lo cual imposibilita que los pacientes con prioridad de atenciÃ³n, sean tratados mÃ¡s rÃ¡pidamente de forma oportuna y eficaz. En este Trabajo Especial de Grado se construyo un prototipo Web de triaje sustentado en el modelo conceptual de datos difuso de triaje para el sector salud venezolano, basado en el proceso de triaje hospitalario de la Sociedad Venezolana de Medicina de Emergencia y Desastres (SVMED), ya que Ã©ste darÃ­a un empuje a la implementaciÃ³n de un Sistema ClÃ­nico de soporte a la toma de decisiones para triaje a nivel nacional tomando como eje el HUC. El sistema consta de cuatro (04) mÃ³dulos: el primero es la implementaciÃ³n del esquema relacional difuso, el segundo es el mÃ³dulo Cliente FSQL, el tercero ejecuta las consultas tanto difusas como no difusas y por Ãºltimo, se tiene un mÃ³dulo que implementa la captura de los datos de entrada y emite el resultado de la clasificaciÃ³n de triaje obtenido mediante el mÃ³dulo Cliente FSQL.','2010-11-02','Triaje, Base de Datos Difusas, Sistema ClÃƒÂ­nico de soporte a la toma de decisiones',2,1,1,1,1,'2013-09-17 08:37:54','2013-09-17 08:37:54','Documento_552.pdf','application/pdf',11293721,'2013-09-17 08:37:54',17,0,108,'COMPLETO'),(547,'EstimaciÃ³Ã³nn de Cuantiles en la MediciÃ³Ã³nn de Riesgo Financiero..','Se desarrollÃ³ el artÃ­culo titulado \"On quantile estimation by bootstrap\" realizado por Erik Brodin que presenta un mÃ©todo alternativo para estimar cuantiles, que a su vez es un mÃ©todo alternativo para estimar la medida de riesgo denominada Valor en Riesgo, VaR por sus siglas en inglÃ©s.Se presentan algunas aplicaciones.','2011-04-14','Cuantiles, Valor en Riesgo (VaR), Bootstrap, Bootstrap exacto',5,1,1,1,1,'2013-09-17 08:37:56','2013-09-17 08:37:56','Documento_553.pdf','application/pdf',0,'2013-09-17 08:37:56',20,0,0,'INCOMPLETO'),(548,'ESTUDIO DE LAS PROPIEDADES MAGNÃ‰Ã‰TTICAS Y CRISTALOGRÃÃFFICAS DEL SULFURO MIXTO DE HIERRO Y TITANIO Fe22TiS44','En el presente Trabajo Especial de Grado se sintetizÃ³ el compuesto de Sulfuro Mixto de Hierro y Titanio Fe2TiS4 por medio de la fusiÃ³n directa de los elementos en proporciones estequiomÃ©tricas. Posteriormente, se realizaron los estudios de caracterizaciÃ³n cristalogrÃ¡fica y magnÃ©tica de la muestra a travÃ©s de DifracciÃ³n de Rayos X y EspectroscopÃ­a MÃ¶ssbauer. Las medid