tilizando un reactor tubular operando en flujo continuo a fin de comparar con los resultados obtenidos en un reactor batch. Estos resultados arrojaron que el reactor tubular de flujo continuo es el mÃ¡s efectivo entre ambos reactores; habiendo ajustado los parÃ¡metros cinÃ©ticos de la degradaciÃ³n, se siguiÃ³ la fotocatÃ¡lisis midiendo la demanda quÃ­mica de oxÃ­geno, a partir del cual se obtuvo la constante cinÃ©tica de pseudo-primer orden de la mineralizaciÃ³n (formaciÃ³n de CO2, H2O y amonÃ­aco), cuyo valor es menor que la correspondiente a la degradaciÃ³n (desapariciÃ³n de la nicotina), lo que sugiere la formaciÃ³n de un intermediario estable en el proceso de mineralizaciÃ³n, el cual no se logrÃ³ identificar por cromatografÃ­a de gases debido a la baja solubilidad del posible intermediario en el solvente orgÃ¡nico que se utilizÃ³ para la extracciÃ³n. Para evaluar la toxicidad de las fracciones de nicotina obtenidas durante la degradaciÃ³n, se realizÃ³ una prueba de toxicidad empleando semillas de lechuga (Lactuca Sativa L), de la cual se obtuvo como resultado que estas fracciones no son tÃ³xicas, dado que en uno de los parÃ¡metros estudiados (elongaciÃ³n de la radÃ­cula y del hipocotilo) se presentÃ³ un aumento en la longitud y en el otro una pequeÃ±a disminuciÃ³n, la cual no es indicativo de la toxicidad.','2011-05-13','{}',6,1,1,1,1,'2013-09-17 08:37:58','2013-09-17 08:37:58','Documento_555.pdf','application/pdf',11293721,'2013-09-17 08:37:58',18,0,108,'COMPLETO'),(550,'\"\"CaracterizaciÃ³n MorfolÃ³gica y QuÃ­mica del residuo insoluble asociado al MÃ¡rmol DolomÃ­tico de Guacuripia, estado BolÃ­var, mediantes tÃ©cnicas de DifracciÃ³n de rayos X y MicroscopÃ­a ElectrÃ³nica de Barrido\"','En el presente trabajo de investigaciÃ³n se llevÃ³ a cabo un estudio sobre la caracterizaciÃ³n morfolÃ³gica y quÃ­mica del residuo insoluble asociado al mÃ¡rmol dolomÃ­tico de Guacuripia edo. BolÃ­var, mediante tÃ©cnicas de DifracciÃ³n de Rayos X (DRX) y MicroscopÃ­a ElectrÃ³nica de Barrido (MEB).Para ello fueron seleccionadas seis muestras de rocas con la ayuda de 4 criterios de selecciÃ³n, a partir de dichas rocas se elaboraron secciones finas de las mismas. El tratamiento quÃ­mico de las rocas consistiÃ³ en el ataque Ã¡cido con HCl 12 M para la disoluciÃ³n de los componentes carbonaticos y asÃ­ obtener el residuo no carbonÃ¡tico el cual es el objeto de este estudio. Cabe destacar que este ataque se realizÃ³ de dos maneras diferentes, la primera fue una digestiÃ³n por pasos y el segundo ataque fue una digestiÃ³n en un solo paso, con la finalidad de evaluar la alteraciÃ³n del residuo no carbonÃ¡tico por ambas digestiones.Se tomaron fragmentos de las distintas rocas para realizarle un anÃ¡lisis mineralÃ³gico por (DRX), encontrÃ¡ndose en su mayorÃ­a minerales como calcita y dolomita y en menor proporciÃ³n cuarzo, brucita, clinocloro, grafito, tremolita, olivino, cordierita, todorokita, moscovita y montmorillonita.El porcentaje de residuo no carbonÃ¡tico obtenido para las rocas estudiadas varÃ­a desde 6% hasta un 64 %, y en cuanto a su anÃ¡lisis mineralÃ³gico por DRX se encontrÃ³ en su mayorÃ­a minerales Ã­ndices de metamorfismo como se muestran a continuaciÃ³n: forsterita, diÃ³psido, pirita, cordierita, vesuvianita, clinocrisotilo, grafito, tremolita, moscovita, olivino, cuarzo y tridimita.Los resultados obtenidos por MicroscopÃ­a ElectrÃ³nica de Barrido indican que la morfologÃ­a presente en los granos minerales estudiados del residuo, presentan caras bien definidas indicando que estos se formaroninsitu producto del metamorfismo, ademÃ¡s se realizaron anÃ¡lisis quÃ­micos puntuales a dichos granos para identificar a que fase mineral pertenecÃ­an apoyÃ¡ndonos en los resultados obtenidos por DRX.','2011-03-02','Morfologia, Minerales Metamorficos, MicroscopÃ­a Electronica de Barrido',4,1,1,1,1,'2013-09-17 08:37:59','2013-09-17 08:37:59','Documento_556.pdf','application/pdf',1254959,'2013-09-17 08:37:59',20,0,84,'COMPLETO'),(551,'UtilizaciÃ³n d