¡s de 2 muestras de agua superficiales pertenecientes al relleno sanitario La Bonanza, ubicado en el Estado Miranda. La caracterizaciÃ³n fue realizada mediante la determinaciÃ³n de los parÃ¡metros fisicoquÃ­micos pH, conductividad, temperatura, alcalinidad y contenido de materia orgÃ¡nica. Asimismo, se determinaron las concentraciones de las especies mayoritarias Na+, K+, Ca2+, Mg2+, Cl-, NO3- y NO2- mediante el empleo de las tÃ©cnicas de absorciÃ³n y emisiÃ³n atÃ³mica de llamas y cromatografÃ­a iÃ³nica. Seguidamente, los resultados fueron validados a travÃ©s de un balance iÃ³nico. Igualmente, se llevÃ³ a cabo la determinaciÃ³n de Si y de los elementos traza As, Cd, Cr, Cu, Fe, Mn, Mo, Ni, Pb, Se, Ti, V, Zn, Co, Sr y Sb; mediante la tÃ©cnica de emisiÃ³n atÃ³mica con fuente de plasma inductivamente acoplado (ICP-OES). Para el Si expresado como SiO2 se obtuvo un intervalo de concentraciÃ³n entre 4,0 y 30,0 mg/L; mientras que, los elementos As, Se, Cd y Pb se encontraron por debajo del lÃ­mite de detecciÃ³n; a su vez el resto de los elementos presentaron concentraciones que oscilaron entre 0,08 y 6,0 mg/L. En general, las mayores concentraciones de los elementos traza fueron detectados en el lixiviado que es sometido a evaporaciÃ³n y en el lixiviado con mayor edad del relleno. Los resultados indican que los lixiviados del relleno sanitario \"La Bonanza\" que son sometidos a evaporaciÃ³n resultan con altas concentraciones de Na+ y K+, asÃ­ como en de Cl- y NO3-, que superan los valores permitidos segÃºn el Decreto 883 del MARN (Gaceta oficial NÂº E-5021). Igualmente, se llevÃ³ a cabo la identificaciÃ³n de los compuestos orgÃ¡nicos volÃ¡tiles presentes en los lixiviados, mediante la aplicaciÃ³n de la tÃ©cnica de cromatografÃ­a gaseosa (GC- MS). Esto permitiÃ³ identificar 32 compuestos, ademÃ¡s, de los llamados BTEX, compuestos comÃºnmente encontrados en rellenos sanitarios. Los compuestos orgÃ¡nicos volÃ¡tiles identificados comprenden: p.cresol, alcanfor, terpineol, fenol, 3-metilindol, difenÃ­leter, DEET, difenÃ­lsulfona, 7-Acetil-2-hidroxi-2- metÃ­l-5-iso-propilbiciclononano, bisfenol A, DEHP, heptacosano, trietilfosfato, pirazina, tiofenol, nicotina, propÃ­lfenazona, n-pentano, Ã¡cido hexanoico, Ã¡cido dihidroxibutÃ­rico, Ã¡cido ciclohexano dicarboxÃ­lico, Ã¡cido valÃ©rico, Ã¡cido palmÃ­tico, Ã¡cido fenÃ­lbutÃ­rico, Ã¡cido heptanoico, Ã¡cido octanoico, Ã¡cido linoleÃ­co, Ã¡cido ftÃ¡lico, Ã¡cido butÃ­rico, Ã¡cido adÃ­pico, Ã¡cido 2-metÃ­l-4- clorofenoxipropiÃ³nico (MCPP), ibuprofeno y el 2,4-diclorobenceno. Se concluye que es prioritario utilizar un mÃ©todo adecuado para el tratamiento de los lixiviados, con la finalidad de disminuir las concentraciones de los metales alcalinos, Cl-, NO3-. Esto debido a que durante la evaporaciÃ³n de los lixiviados se genera un residuo con una mayor concentraciÃ³n de especies contaminantes que los lixiviados originales.','2011-04-29','{}',6,1,1,1,1,'2013-09-17 08:38:11','2013-09-17 08:38:11','Documento_561.pdf','application/pdf',4107489,'2013-09-17 08:38:11',20,0,109,'COMPLETO'),(556,'Ambientes CuÃ¡Ã¡nticos','En este trabajo se estudia la definiciÃ³n de ambiente cuÃ¡ntico y el funtor de teorÃ­a de campos cuÃ¡nticos QFT sobre ambientes cuÃ¡nticos, introducida por J. Park, J. Terilla y T. Tradler en su artÃ­culo \"Quantum backgrounds and QFT\", es decir, dado un ambiente cuÃ¡ntico se define una teorÃ­a de campos sobre este ambiente, y se demuestra que este funtor es un funtor de deformaciÃ³n, en el sentido de M. Schlessinger. AdemÃ¡s vamos a revisar ejemplos de teorÃ­as de campos cuÃ¡nticos, y plantear la posible relaciÃ³n entre estas teorÃ­as y las teorÃ­as homolÃ³gicas de campos cuÃ¡nticos definidas en el artÃ­culo \"Homological Quantum Field Theory\" por E. Castillo y R. DÃ­az, con el fin de proponer la construcciÃ³n de un ambiente cuÃ¡ntico homolÃ³gico.','2011-05-18','Ambientes cuÃƒÂ¡nticos, teorÃƒÂ­as de campos cuÃƒÂ¡nticos (QFT), teorÃƒÂ­as topolÃƒÂ³gicas de campos cuÃƒÂ¡nticos (TQFT), funtores de deformaciÃƒÂ³n.',5,1,1,1,1,'2013-09-17 08:38:13','2013-09-17 08:38:13','Documento_562.pdf','application/pdf',4991608,'2013-09-17 08:38:13',20,0,71,'COMPLETO'),(557,'DISEÃ‘O, IMPLEMENTACIÃ“N Y ADECUACIÃ“N DE UNA HERRAMIENTA EDUCATIVA BASADA EN MINIX PARA CURSOS DE SISTEMAS OPERATIVOS','En el siguiente Trabajo Especial de Grado se plantea la inserciÃ³n del sistema operativo Minix 3 al curso ofertado por la Escuela de ComputaciÃ³n de la UCV con el objetivo de solventar la poca sincronizaciÃ³n entre la planificaciÃ³n teÃ³rica- prÃ¡ctica existente. Es decir, no existe ninguna metodologÃ­a que permita reforzar ambas dinÃ¡micas durante la ejecuciÃ³n del mismo. La soluciÃ³n propuesta es adecuar el sistema operativo Minix 3 a partir de un conjunto de siete laboratorios que abarcan tÃ³picos asociados a los temas impartidos por el curso de Sistemas Operativos actual. Los laboratorios tienen los siguientes tÃ­tulos: InstalaciÃ³n de Minix y entorno de desarrollo, IntroducciÃ³n a Minix 3, Estudio del proceso de arranque, ImplementaciÃ³n de un intÃ©rprete de comandos, ImplementaciÃ³n de llamadas al sistema, ImplementaciÃ³n de semÃ¡foros y ModificaciÃ³n del planificador de procesos. De cada laboratorio se desarrollo la estructura y soluciÃ³n, dejando una sÃ³lida documentaciÃ³n en distintos medios (documentos, implementaciÃ³n del cÃ³digo necesario y videos tutoriales). Por Ãºltimo, se adecuo una aplicaciÃ³n para el manejo de proyectos (wiki) la cual apoya al curso y permite integrar toda la informaciÃ³n recopilada, tanto para el grupo docente como para los estudiantes. Al culminar este Trabajo Especial de Grado se logrÃ³ completar los objetivos planteados desde el inicio a travÃ©s de las soluciones anteriormente descritas, es por ello que se desea que el trabajo realizado sea tomado en consideraciÃ³n por la Escuela de ComputaciÃ³n para impartir cursos futuros; dÃ¡ndole a mismo la didÃ¡ctica de los cursos de las principales universidades a nivel mundial.','2011-04-08','Palabras