plantilla general y un mÃ³dulo para el manejo de la seguridad.','2011-02-17','framework, DinÃ¡mica, open source, Netbeans, plugin, aplicaciones web, IDE',2,1,1,1,1,'2013-09-17 08:38:14','2013-09-17 08:38:14','Documento_564.pdf','application/pdf',3553441,'2013-09-17 08:38:14',20,0,124,'COMPLETO'),(559,'USO DE LA ESPECTROSCOPÃA DE FLUORESCENCIA EN LA DETERMINACIÃ“Ã“NN DE CAMBIOS CONFORMACIONALES DE LA RODOPSINA BOVINA','La rodopsina es la proteÃ­na fotorreceptora de los bastoncillos de la retina. Esta, en presencia de luz, experimenta cambios conformacionales que se traducen en una serie de fotointermediarios, uno de los cuales es el responsable de transmitir la seÃ±al luminosa al resto de las proteÃ­nas de la cascada visual. De forma interesante, la fosforilaciÃ³n de la rodopsina fotoactivada constituye parte esencial en el mecanismo de inactivaciÃ³n o desensibilizaciÃ³n de la rodopsina. El objetivo del presente trabajo es aplicar la espectroscopÃ­a de fluorescencia extrÃ­nseca para la detecciÃ³n de cambios conformacionales en la rodopsina. Para lograr tal cometido, se procediÃ³ en primera instancia, a aislar segmentos externos de los bastoncillos (SEB) a partir de retinas bovinas; los cuales contenÃ­an rodopsina con un alto grado de pureza de acuerdo al cociente de absorbancia A280nm/ A500nm. La rodopsina bovina fue purificada mediante cromatografÃ­a de afinidad a travÃ©s de Concanavalina A sefarosa, evidenciÃ¡ndose asÃ­ que el detergente n- dodecil-b-D- maltÃ³sido solubilizaba a esta proteÃ­na de los SEB. Las cisteÃ­nas expuestas de la rodopsina fueron entonces marcadas con el fluorÃ³foro monobromobimano (mBBr), bajo condiciones de oscuridad o luz, en presencia o ausencia de Mg+2-ATP y rodopsina quinasa. Las muestras resultantes del marcaje, fueron aisladas y analizadas fluorimetricamente. Se pudo evidenciar que el cambio de conformaciÃ³n que se produce en la rodopsina fotoactivada no ejerciÃ³ ningÃºn tipo de impedimento para que las cisteÃ­nas en la regiÃ³n citoplasmÃ¡tica quedasen disponibles para el marcaje con mBBr. Adicionalmente, se comprobÃ³ que los sitios de fosforilaciÃ³n de la rodopsina se encuentran prÃ³ximos a las cisteÃ­nas modificadas con mBBr, puesto que la seÃ±al de la fluorescencia, se vio significativamente disminuida en las muestras que contenÃ­an rodopsina fosforilada.','2011-05-13','Rodopsina, Pigmento visual, Fotointermediarios, Fluorescencia, FosforilaciÃ³n de la rodopsina',6,1,1,1,1,'2013-09-17 08:38:17','2013-09-17 08:38:17','Documento_565.pdf','application/pdf',3551621,'2013-09-17 08:38:17',20,0,124,'COMPLETO'),(560,'CaracterizaciÃ³n funcional de la comunidad bacteriana cultivable aislada del suelo de la zona de descarga de la fosa petrolera Bare--99.. San TomÃ©.. Edo.. AnzoÃ¡tegui','Mediante el presente estudio enmarcado dentro del proyecto MisiÃ³n Ciencia \"Desarrollo y ValidaciÃ³n de Nuevas TecnologÃ­as para el Saneamiento Ambiental de Pasivos Generados por la Actividad Petrolera\", dentro del subproyecto \"CaracterizaciÃ³n del Medio FÃ­sico Natural en Ãreas Impactadas con Hidrocarburos\" se pretende caracterizar funcionalmente la comunidad bacteriana del suelo de la zona de descarga de la fosa petrolera (Bare-9) y asÃ­ determinar la estructura funcional de la comunidad y grupos funcionales con capacidad de degradar sustratos complejos, crecer sobre hidrocarburos y producir biosurfactantes. Para el estudio se evaluaron dos cuadratas (B9I y B9D) dentro de la zona de descarga, caracterizados por presentar derrame petrolero y la zona con vegetaciÃ³n (B9V), donde se encontraron valores de abundancia del orden de 109UFC/gr. de suelo en las zonas impactadas, hasta 1012UFC/gr. de suelo en la zona sin impacto. El estudio incluye la caracterizaciÃ³n fenotÃ­pica (macro y micromorfologÃ­a de las cepas) y bioquÃ­micamente por su crecimiento en diferentes sustratos, usando una fuente Ãºnica de carbono, encontrÃ¡ndose un gran numero de cepas capaces de degradar azucares simples como glucosa (80%), de utilizar fuentes nitrogenadas el nitrato y de hidrolizar la urea y proteÃ­nas (80%) y un bajo numero de cepas capaces de degradar sustratos complejos como celulosa, lignina, pectina con valores cercanos o menores al 20%. Con los resultados obtenidos y utilizando como herramienta el anÃ¡lisis multivariado de Cluster se conformaran grupos de cepas con caracterÃ­sticas similares en sus respuestas frente a diferentes sustratos que conforman los denominados grupos funcionales. Se determinÃ³ que la diversidad funcional era mayor en la zona impactada (B9I) que en la zona con vegetaciÃ³n donde se espera, a pesar de encontrar similar numero de grupos funcionales (GF) entre las diferentes comunidades. Los grupos funcionales agruparon en mayor medida a cepas proteolÃ­ticas, urea, reductoras de nitrato y con capacidad de utilizar el acetato como Ãºnica fuente de carbono, caracterÃ­sticas presentes en todas las localidades evaluadas. Se encontrÃ³ una mayor similitud entre la comunidad impactada B9D y la zona con vegetaciÃ³n (B9V). Se destacaron las cepas de interÃ©s por su potencial biotecnolÃ³gico a ser utilizado en procesos de biorremediaciÃ³n a los que se les realizaron bioensayos para determinar la producciÃ³n de compuestos tenso-activos','2011-02-18','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',1,1,1,1,1,'2013-09-17 08:38:21','2013-09-17 08:38:21','Documento_566.pdf','application/pdf',1241668,'2013-09-17 08:38:21',17,0,82,'COMPLETO'),(561,'ElaboraciÃ³n de un producto tipo colado a partir de almidones modificados y harinas de Arracacia xanthorrhiza Bancroft','Los objetivos de este trabajo fueron: aislar, purificar el almidÃ³n y elaborar harinas de la parte comestible de apio (Arracacia xanthorrhiza Bancroft) y formular un producto tipo colado a partir de sus harinas y almidones tratados con pulsos de luz U.V. Para ello se extrajeron almidones y elaboraron harinas segÃºn metodologÃ­as descritas por PÃ©rez 1994 y 2000. La caracterizaciÃ³n de ambas materias primas (almidÃ³n y harina) fuÃ© realizada por mÃ©todos oficiales de AACC (2003) y AOAC (1999) y la caracterizaciÃ³n de los parÃ¡metros de calidad de los colados se realizÃ³ por mÃ©todos de AOAC (1999). Los resultados seÃ±alan alto rendimiento y pureza en el almidÃ³n extraÃ­do. Los almidones tratados con pulsos de luz U.V solo mostraron diferencias estadÃ­sticamente significativas (p <= 0,05) en el color y en los Ã­ndices de absorciÃ³n de agua, solubilidad y poder de hinchamiento al compararse con el almidÃ³n nativo. Por su parte, la harina de apio criollo elaborada se caracterizÃ³ por mostrar un alto rendimiento y eficiencia en el proceso; asÃ­ como, un alto contenido en carbohidratos totales y fibra dietÃ©tica en los anÃ¡lisis realizados. Los colados elaborados a partir de harinas y almidones requirieron la adiciÃ³n de pulpa de apio para acentuar el sabor de los mismos debido a que la harina pierde ciertos elementos que otorgan sabor y aroma al aplicar el mÃ©todo de deshidrataciÃ³n. Por otra parte, para incrementar las propiedades nutricionales de los colados elaborados, se contÃ³ con la adiciÃ³n de glicomacropeptido (GMP) comercial de suero de leche, el cual permitiÃ³ obtener un incremento en el contenido de proteÃ­nas del producto. AdemÃ¡s, esta oligoproteÃ­na se caracteriza por presentar niveles muy bajos de fenilalanina, que al ser adicionado en el producto aumenta sus beneficios, el cual podrÃ­an ser provechosos para niÃ±os que padecen de fenilcetonuria. Por Ãºltimo, la evaluaciÃ³n sensorial aplicada a un panel semi-entrenado, mostrÃ³ muy buena aceptaciÃ³n en sus parÃ¡metros de color, aroma, sabor y consistencia, siendo mayormente aceptados el color, segudo del sabor y consistencia y por Ãºltimo el aroma.','2011-05-10','AlmidÃ³n, harinas, colado, Arracacia xanthorrhiza Bancroft, pulsos de luz U.V',1,1,1,1,1,'2013-09-17 08:38:22','2013-09-17 08:38:22','Documento_567.pdf','application/pdf',1361385,'2013-09-17 08:38:22',20,0,79,'COMPLETO'),(562,'DISEÃ‘O DESARROLLO Y EVALUACIÃ“N DE UN SISTEMA DE ABLACIÃ“N LÃSER PARA EL MICROANÃLISIS DE MUESTRAS SÃ“LIDAS..','La espectroscopÃ­a de plasma inducido por lÃ¡ser o como se conoce por sus siglas en inglÃ©s LIBS (Laser induced breakdown spectroscopy) se ha convertido en una herramienta importante para el anÃ¡lisis quÃ­mico de una gran variedad de materiales. Como un resultado del avance continuo de espectrÃ³grafos, componentes Ã³pticos y lÃ¡seres, se ha permitido el desarrollo de nuevas tÃ©cnicas analÃ­ticas basadas en la espectroscopÃ­a de ablaciÃ³n lÃ¡ser, es por ello que en este trabajo se tiene como objetivo principal el diseÃ±o, construcciÃ³n y evaluaciÃ³n de un sistema de micro- ablaciÃ³n lÃ¡ser para el anÃ¡lisis de muestras sÃ³lidas, reforzando de esta manera su caracterÃ­stica como tÃ©cnica de anÃ¡lisis no destructiva y con potencial para el anÃ¡lisis superficial de materiales compuestos. El sistema de micro-LIBS consistiÃ³ en un microscopio acoplado con un lÃ¡ser Nd-YAG en su radiaciÃ³n fundamental (1064 nm) y una cÃ¡mara ICCD. CrÃ¡teres entre 33-68 Âµm de diÃ¡metro fueron obtenidos con pulsos de energÃ­a lÃ¡ser entre 7,72-46,40 mJ. Con el fin de crear estos crÃ¡teres se utilizÃ³ una lente objetiva de 20X y 0,45 de apertura numÃ©rica. En un principio, se estudiÃ³ la influencia de la intensidad de radiaciÃ³n del lÃ¡ser con respecto al diÃ¡metro del crÃ¡ter producido sobre la muestra, apreciÃ¡ndose una correlaciÃ³n lineal positiva entre el diÃ¡metro del crÃ¡ter y la intensidad de radiaciÃ³n. AdemÃ¡s, se analizÃ³ la influencia de la cantidad de material removido con respecto a la intensidad de emisiÃ³n, donde se encontrÃ³ que mientras mayor es el crÃ¡ter mayor es la intensidad de las lÃ­neas de emisiÃ³n arrojando una grÃ¡fica con una correlaciÃ³n positiva. Seguidamente, se estudiaron las figuras de mÃ©ritos como se menciona a continuaciÃ³n: sensibilidad, reproducibilidad, exactitud, lÃ­mites de detecciÃ³n y de cuantificaciÃ³n de los elementos Plomo y Hierro a travÃ©s de las curvas de calibraciÃ³n correspondiente donde se observÃ³ una diferencia en la sensibilidad de las curvas de calibraciÃ³n de ambos elementos de, 65,3 y 59,08 respectivamente; una respuesta para este hecho se debe a la probabilidad de transiciÃ³n para una emisiÃ³n espontanea, ya que, si se compara este valor en ambos elementos ,el plomo tiene una mayor probabilidad de transiciÃ³n que la que tiene el hierro para las respectivas longitudes de ondas de emisiÃ³n. Los lÃ­mites de detecciÃ³n obtenidos para el Plomo y el Hierro fueron de 0,21 y 0,13 % respectivamente, lo que nos indica que la tÃ©cnica utilizada es capaz de detectar dichos elementos a los niveles de concentraciÃ³n antes mencionados. Finalmente, es importante acotar que MÃ¡s adelante se presentarÃ¡ de manera mÃ¡s amplia y detallada las discusiones de los resultados obtenidos en este trabajo de investigaciÃ³n.','2011-05-06','EspectroscopÃ­a de plasma inducido por lÃ¡ser; micro-LIBS, Probabilidad de transiciÃ³n espontÃ¡nea.',6,1,1,1,1,'2013-09-17 08:38:24','2013-09-17 08:38:24','Documento_568.pdf','application/pdf',6679786,'2013-09-17 08:38:24',19,0,130,'COMPLETO'),(563,'ASOCIACIONES ENTRE EPIBIONTES Y LOS OCTOCORALES PLEXAURA FLEXUOSA Y PLEXAURA HOMOMALLA (CNIDARIA, OCTOCORALLIA) EN DOS LOCALIDADES DEL LITORAL CENTRAL VENEZOLANO','La colonizaciÃ³n de nuevos sustratos es un fenÃ³meno muy comÃºn en los ambientes marinos. De este proceso se deriva la epibiosis, que se define como la asociaciÃ³n predominantemente facultativa entre basibionte y epibionte. Las colonias de la mayorÃ­a de los octocorales desarrollan una superficie tridimensional, en ocasiones muy compleja, que favorece el reclutamiento de larvas presentes en la columna de agua, por lo cual pueden ser potencialmente colonizados por una alta diversidad de organismos epibiontes. La estructura de las comunidades epibiÃ³ticas asociadas a octocorales es prÃ¡cticamente desconocida y tampoco se sabe si estas comunidades varÃ­an con respecto a la especie de octocoral o la localidad. Por esto el objetivo de este trabajo fue evaluar la estructura y distribuciÃ³n de las comunidades de epibiontes asociados a los octocorales Plexaura homomalla y P. flexuosa en dos localidades del Litoral Central Venezolano (Ensenada Manare y Playa Los Indios). Se evaluaron un total de 1190 colonias, 422 de Plexaura flexuosa y 5 P. homomalla en Playa Los Indios y 424 colonias de P. homomalla y 339 de P. flexuosa en la Ensenada de Manare. Predominaron colonias con tamaÃ±os intermedios en ambas localidades y especies. De las 1185 colonias evaluadas, 776 colonias (65.5%) poseÃ­an epibiontes los cuales totalizaron 1808 entre individuos y aglomerados de epibiontes. Las colonias de P. flexuosa en Playa Los Indios presentaron una prevalencia de epibiontes del 72% (302 colonias) y de una forma muy similar en la Ensenada Manare el 70% (237 colonias) presentÃ³ epibiontes. P. homomalla presentÃ³ una proporciÃ³n de colonias con epibiontes del 55 % (234 colonias), bastante inferior a las de P. flexuosa. Se registrÃ³ un total de 34 especies de epibiontes pertenecientes a 7 Phyla (Porifera, Cnidaria, Mollusca, Annelida, Arthropoda, Echinodermata y Chordata), de los cuales el 63.9% corresponde a especies sÃ©siles y el 36.1% a especies mÃ³viles, ademÃ¡s de 3 grupos funcionales de algas (calcÃ¡reas, filamentosas y macroalgas). El grupo mÃ¡s diverso fue el de los porÃ­feros con 9 especies y el mÃ¡s abundante fue el de los moluscos con 836 individuos, correspondiendo al 52.6% de todos los individuos registrados. MÃ¡s del 44 % de los epibiontes se ubicaron en la zona media de las colonias, seguido por la zona basal con mÃ¡s del 17% y la zona apical con mÃ¡s del 10%. TambiÃ©n fueron registrados sobre las colonias de octocorales aglomerados o agregados de epibiontes, conformados mayoritariamente por los bivalvos Dendrostrea frons y Pteria colymbus, a los cuales se asocian a su vez una alta diversidad de otros organismos. Los aglomerados se encontraron predominantemente ubicados en la zona media de las colonias de octocoral, en una frecuencia por encima del 73 % para ambas especies y localidades. Conformando los aglomerados se encontraron 39 taxas divididos en 9 Phyla, y constituidos por 5 especies de porÃ­feros, 2 cnidarios, varios grupos de moluscos, 6 grupos de crustÃ¡ceos, algunos poliquetos, sipuncÃºlidos, equinodermos, briozoarios y tunicados. Se realizÃ³ un experimento para determinar si las lesiones en las que el eje del octocoral queda expuesto favorecen a la colonizacion. Se registrÃ³ una alta variabilidad en la colonizaciÃ³n de lesiones entre colonias. El tiempo mÃ­nimo de recuperaciÃ³n fue de 3 a 4 semanas en ambas especies y localidades, mientras que el mÃ¡ximo variÃ³. Se observÃ³ que el establecimiento de algunas especies de epibiontes sobre los ejes de gorgonina retrasaba o impedÃ­a de algÃºn modo la regeneraciÃ³n del cenÃ©nquima del octocoral. Los organismos que colonizaron el eje de gorgonina denudado de los octocorales fueron en su mayorÃ­a algas, hidrozoarios y cirripedios. Se puede concluir que la comunidad de epibiontes es muy diversa, dominada por organismos filtradores y no presenta especificidad con las dos especies de octocoral.','2011-02-14','EPIBIONTES, OCTOCORALES, LITORAL CENTRAL, AGLOMERADOS, REGENERACIÃƒÂ“N, COLONIZACIÃƒÂ“N',1,1,1,1,1,'2013-09-17 08:38:25','2013-09-17 08:38:25','Documento_569.pdf','application/pdf',1589344,'2013-09-17 08:38:25',20,0,87,'COMPLETO'),(564,'DETERMINACION DE ELEMENTOS TRAZA EN CABELLO Y SUERO SANGUINEO DE NIÃ‘Ã‘OOS CON SINDROME DE ESPECTRO AUTISTA','Se determinÃ³Ã³ la concentraciÃ³Ã³nn de Zn,, Cu,, Ca,, Mg,, Pb y Hg en muestras de cabello y suero sanguÃ­Ã­neo en niÃ±Ã±oos con sÃ­Ã­ndrome de Espectro Autista en edades comprendidas entre los 22 y 1100 aÃ±Ã±oos,, pertenecientes al Centro de AtenciÃ³Ã³nn Integral para Autistas ((CAIPA)) ubicado en Los Teques Edo -- Miranda.. La determinaciÃ³Ã³nn de Zn,, Cu,, Ca,, Mg y Pb se realizÃ³Ã³ mediante espectrometrÃ­Ã­a de emisiÃ³Ã³nn atÃ³Ã³mmica con plasma inductivamente acoplado ((ICP--OES)) y la determinaciÃ³Ã³nn de Hg total se realizÃ³Ã³ mediante espectrometrÃ­Ã­a de fluorescencia atÃ³Ã³mmica ((AFS)).. Los resultados obtenidos fueron tratados estadÃ­Ã­sticamente empleando el programa Statgraphic Plus versiÃ³Ã³nn 55..00.. Los resultados obtenidos de los niÃ±Ã±oos fueron comparados con intervalos de referencia [4477,,4488].. Para las muestras de cabello,, las concentraciones de Ca y Mg de niÃ±Ã±oos autistas estuvieron dentro del intervalo de las concentraciones de referencia.. Sin embargo,, el Cu y Zn presentaron niveles por debajo de los valores de referencia.. El anÃ¡Ã¡lisis de los elementos tÃ³Ã³xxicos Pb y Hg muestran que el primero se encuentra por encima de los valores de referencia [4477] y el segundo dentro de los valores normales.. Por otro lado,, el anÃ¡Ã¡lisis de suero sanguÃ­Ã­neo indican que los valores de Ca y Mg se encuentran dentro del intervalo de referencia,, mientras que las concentraciones de Zn se ubicaron por encima y la de Cu por debajo de los mismos.. Los elementos tÃ³Ã³xxicos Pb y Hg se ubican dentro del intervalo de referencia.. Finalmente un estudio de la relaciÃ³Ã³nn Cu//Zn en cabello,, suero sanguÃ­Ã­neo y orina 2244 horas arrojÃ³Ã³ que no existen diferencias significativas entre el grupo autista y el grupo control en el cabello y la orina;; Sin embargo,, las muestras de suero sanguÃ­Ã­neo si presentan diferencias significativas entre ambos grupos..','2011-03-25','NiÃƒÂ±os de espectro autista, metales pesados, Muestras clÃƒÂ­nicas.',6,1,1,1,1,'2013-09-17 08:38:28','2013-09-17 08:38:28','Documento_570.pdf','application/pdf',3547650,'2013-09-17 08:38:28',19,0,134,'COMPLETO'),(565,'Prototipo de Herramienta para el desarrollo de aplicaciones basadas en LÃ³gica Difusa','La creciente popularidad de la lÃ³gica difusa se debe a su buena adaptaciÃ³n a problemas donde existen valores numÃ©ricos difÃ­ciles de medir, incertidumbre, o excesiva complejidad, asÃ­ como tambiÃ©n a su capacidad de resolver problemas de forma potente y precisa y a la variedad de sus aplicaciones. Actualmente, existen numerosas herramientas para el desarrollo de aplicaciones basadas en lÃ³gica difusa, sin embargo, aquellas que cuentan con un mayor nÃºmero de funcionalidades y mejor usabilidad no son de libre distribuciÃ³n. En este Trabajo Especial de Grado se presenta un prototipo de herramienta que cumple con las funcionalidades necesarias para el desarrollo de sistemas basados en reglas difusas, bajo un ambiente grÃ¡fico que facilita el trabajo del usuario, con una interfaz agradable e intuitiva que permite guiarlo a travÃ©s de todos los pasos necesarios para desarrollar su aplicaciÃ³n, ademÃ¡s de ser de libre distribuciÃ³n.','2011-04-05','LÃƒÂ³gica difusa, Sistemas basados en reglas difusas, variables lingÃƒÂ¼ÃƒÂ­sticas, conjuntos difusos, reglas difusas, inferencia difusa, aplicaciones.',2,1,1,1,1,'2013-09-17 08:38:29','2013-09-17 08:38:29','Documento_571.pdf','application/pdf',1989901,'2013-09-17 08:38:29',18,0,125,'COMPLETO'),(566,'Estudio comparativo entre dos tÃ©cnicas (Captura de HÃ­bridos y RCP) para la detecciÃ³n de Virus de Papiloma Humano (VPH) en Ã¡reas genitales de jÃ³venes con diagnÃ³stico clÃ­nico sugestivo de infecciÃ³n viral.','El Virus de Papiloma Humano (VPH) pertenece a la familia Papillomaviridae. El genoma viral estÃ¡ compuesto por una molÃ©cula circular de Ã¡cido desoxirribonucleico (ADN) de doble cadena, que contiene aproximadamente 7.900 pb. Hasta el momento se han logrado identificar mÃ¡s de doscientos tipos virales, clasificados de la siguiente forma: bajo riesgo oncogÃ©nico, como los tipos 6, 11, 32, 42 y 43 y alto riesgo oncogÃ©nico, que incluye los tipos 16, 18, 31, 33, 34, 35, 39, 45, 56, 59, 66, 68 y 70. Los productos proteicos de los genes E6 y E7 de los tipos de VPH de alto riesgo, son capaces de inactivar las proteÃ­nas p53 y pRb, desencadenando un proceso que conlleva a la progresiÃ³n de las lesiones a cÃ¡ncer cÃ©rvicouterino. La infecciÃ³n por VPH es considerada actualmente como la enfermedad de transmisiÃ³n sexual mÃ¡s frecuente en el mundo y como el principal factor etiolÃ³gico de lesiones intraepiteliales y de cÃ¡ncer cervicouterino. En Venezuela, cada aÃ±o 4.116 mujeres son diagnosticadas con cÃ¡ncer cervical y 1853 mueren a causa del cÃ¡ncer cÃ©rvicouterino, segÃºn la OrganizaciÃ³n Mundial para la Salud. Por este motivo y debido al reciente desarrollo de las vacunas preventivas contra el VPH es de gran importancia el estudio y la comparaciÃ³n de tÃ©cnicas de biologÃ­a molecular que permitan el diagnÃ³stico y tipificaciÃ³n de los diferentes tipos virales en la poblaciÃ³n. En tal sentido, en el presente trabajo se evaluaron muestras citolÃ³gicas, tomadas en el Ã¡rea genital, de 80 mujeres jÃ³venes con diagnÃ³stico clÃ­nico sugestivo de infecciÃ³n por VPH y 20 con diagnÃ³stico clÃ­nico normal, como pacientes control; con edades promedio de 24,78 Â± 5,27 y 21,30 Â± 3,96, respectivamente, que acudieron a la consulta de ginecologÃ­a de la OrganizaciÃ³n de Bienestar Estudiantil de la Universidad Central de Venezuela (OBE-UCV). La detecciÃ³n y tipificaciÃ³n del VPH se llevÃ³ a cabo mediante RCP mÃºltiple con el estuche comercial SeeplexÂ® HPV4A ACE Sreening de Seegene Inc., y el mÃ©todo de Captura de HÃ­bridos 2 (Digene). Las muestras positivas para VPH fueron: 52,5% con la RCP SeeplexÂ® y 58,75% con la CH2. Los controles positivos para VPH correspondieron a: un 55% con RCP SeeplexÂ® y 60% con CH2. El tipo de VPH, mÃ¡s comÃºn, encontrado en las muestras y controles fue el de alto riesgo oncogÃ©nico. Se encontrÃ³ un 68,75% de correlaciÃ³n entre los resultados positivos y negativos de RCP SeeplexÂ® y CH2 en las muestras y un 75% en los controles, con asociaciÃ³n entre estos resultados (p<0,05) y grado de acuerdo moderado k. En cuanto a la tipificaciÃ³n, se obtuvo un 51,25% de coincidencia en las muestras y un 70% en los controles, con asociaciÃ³n entre los resultados (p<0,05) y grado de acuerdo moderado k. El mÃ©todo CH2 presentÃ³ mayor sensibilidad que la RCP SeeplexÂ® (80% y 79,2%, respectivamente) y la especificidad de la RCP SeeplexÂ® fue menor que la de CH2 (19,2% y 20% respectivamente). No se encontrÃ³ asociaciÃ³n entre las variables: RCP/DC, CH2/DC, Factores de riesgo/VPH+ y Carga viral/DC. En conclusiÃ³n, se encontrÃ³ relaciÃ³n entre los mÃ©todos estudiados y las pacientes presentaron un alto porcentaje de infecciÃ³n por VPH de alto riesgo, diferente a los tipos mÃ¡s comunes (16 y 18) incluidos en las vacunas. Se sugiere que las pacientes control positivas, se encuentran en una fase latente de la infecciÃ³n viral, por presentar diagnÃ³stico clÃ­nico normal y estar infectadas (en su mayorÃ­a), por VPH de alto riesgo oncogÃ©nico.','2011-02-21','VPH, Captura de HÃƒÂ­bridos, RCP',1,1,1,1,1,'2013-09-17 08:38:34','2013-09-17 08:38:34','Documento_572.pdf','application/pdf',2137225,'2013-09-17 08:38:34',20,0,54,'COMPLETO'),(567,'DETECCIÃ“Ã“NN DEL POLIMORFISMO g..1100997766G>>A DEL GEN DEL FACTOR VII DE LA COAGULACIÃ“Ã“NN SANGUÃÃNNEA Y SU RELACIÃ“Ã“NN CON DISTINTAS PATOLOGÃÃAAS TROMBÃ“Ã“TTICAS..','Las enfermedades trombÃ³ticas son la primera causa de morbilidad y mortalidad en el mundo, dentro de las cuales las mÃ¡s frecuentes son el infarto agudo al miocardio (IAM), el accidente cerebro vascular (ACV) y la trombosis venosa profunda (TVP), lo que representa un problema de salud pÃºblica y pÃ©rdidas humanas. Existen factores tanto ambientales como genÃ©ticos que predisponen a estados hipercoagulabilidad, lo cual puede generar la activaciÃ³n de un conjunto de mecanismos que promueven la formaciÃ³n de una barrera o coÃ¡gulo. Diversos estudios han sugerido que la presencia de polimorfismos genÃ©ticos en los genes que codifican para algunos factores de coagulaciÃ³n pudiera estar relacionada con la ocurrencia de trombosis arterial o venosa. Una de las proteÃ­nas de la coagulaciÃ³n que ha sido involucrada con el riesgo de padecer patologÃ­as trombÃ³ticas es el factor VII. Se han detectado distintos polimorfismos asociados a este gen, uno de los cuales es el polimorfismo g.10976 G>A, el cual se ha relacionado con la variaciÃ³n de los niveles plasmÃ¡ticos de la proteÃ­na de forma activa. En consecuencia, se ha tratado de relacionar el polimorfismo con distintas patologÃ­as trombÃ³ticas. El objetivo de este trabajo fue determinar el genotipio del polimorfismo g.10976 G>A, en el gen que codifica para el factor VII de la coagulaciÃ³n, en pacientes que han sufrido infarto agudo al miocardio (IAM), trombosis venosa profunda (TVP) y accidente cerebro vascular (ACV) y establecer sÃ­ existe una relaciÃ³n con el desarrollo de estas patologÃ­as. El anÃ¡lisis de genotipos fue realizado mediante la tÃ©cnica PCR-RFLP a partir del ADN genÃ³mico de 103 pacientes que han sufrido IAM, 101 pacientes que han padecido de TVP y 69 pacientes que han sufrido ACV. SÃ³lo se encontrÃ³ asociaciÃ³n entre el alelo de riesgo A del polimorfismo y la presencia de IAM (OR=1,92 1,02-3,61,p valor<< 00,,0055). AdemÃ¡s mediante un modelo de regresiÃ³n de curva logÃ­stica, se obtuvo que los factores de riesgo principalmente asociados al IAM fueron el hÃ¡bito tabÃ¡quico, la edad y el sexo masculino, mientras que para el desarrollo de TVP, uno de los factores de riesgo mÃ¡s significativo fue el sexo femenino. SegÃºn los resultados obtenidos en este trabajo, la presencia del alelo A del polimorfismo g.10976 G<A en conjunto de los factores ambientales tales como edad, sexo, hipertensiÃ³n arterial, en el gen que codifica para el factor VII de la coagulaciÃ³n sanguÃ­nea, puede ser considerado como un factor predictivo para la presencia de IAM.','2011-02-24','polimorfismo G>A10976, Gen del factor Vii de la coagulaciÃƒÂ³n, trombosis.',1,1,1,1,1,'2013-09-17 08:38:35','2013-09-17 08:38:35','Documento_573.pdf','application/pdf',5079126,'2013-09-17 08:38:35',20,0,170,'COMPLETO'),(568,'IntegraciÃ³n del Repositorio de Objetos de Aprendizaje de AMBAR con la plataforma MOODLE','AMBAR es un proyecto de investigaciÃ³n de la Universidad Central de Venezuela, que busca proporcionar herramientas de software que apoyen el proceso de enseÃ±anza y aprendizaje. Actualmente, uno de sus principales componentes es el Repositorio de Objetos de Aprendizaje (ROA) de AMBAR, el cual se encuentra integrado con un Repositorio de Metadata, a travÃ©s de la Capa de Servicios Web. El objetivo general del presente trabajo fue integrar el ROA de AMBAR con la plataforma MOODLE, el Sistema de GestiÃ³n de Aprendizaje (LMS) utilizado por la Universidad Central de Venezuela como plataforma de EducaciÃ³n a Distancia, a travÃ©s de la Capa de Servicios Web. Entre el ROA de AMBAR y MOODLE no existÃ­a una conexiÃ³n transparente para el usuario final, lo que resultaba ineficiente y complicaba el proceso de construcciÃ³n de un curso particular si se deseaba utilizar Objetos de Aprendizaje (OA) alojados en dicho repositorio. Para ello se empleÃ³ el Modelado Ãgil (MA) como MÃ©todo de Desarrollo de Software, en el cual a travÃ©s de cuatro iteraciones se creÃ³ el tipo de recurso \"Objeto de Aprendizaje (OA) BÃ¡sico\", el mÃ³dulo de actividades \"Objeto de Aprendizaje (OA) Estandarizado\" y el bloque \"ROA de AMBAR\" en la plataforma MOODLE; y se rediseÃ±Ã³ el ROA de AMBAR en cuanto a su interfaz grÃ¡fica de usuario y sus mÃ©todos internos. Con este trabajo, se estÃ¡ facilitando la gestiÃ³n de los OA almacenados en el repositorio, desde el mismo entorno de trabajo de MOODLE, lo cual resulta en grandes beneficios para los usuarios de dicha plataforma, debido a que pueden incorporar los OA directamente en su curso y hacerlos disponibles para su uso general. AdemÃ¡s, permite hacer del ROA de AMBAR y de MOODLE sistemas mucho mÃ¡s completos al incrementar sus usuarios, retroalimentaciÃ³n, funcionalidades y recursos, respectivamente.','2011-02-18','Objetos de Aprendizaje (OA), AMBAR, MOODLE, Repositorio de Objetos de Aprendizaje (ROA), Servicios Web, e-Learning, LMS.',2,1,1,1,1,'2013-09-17 08:38:57','2013-09-17 08:38:57','Documento_574.pdf','application/pdf',1327087,'2013-09-17 08:38:57',20,0,93,'COMPLETO'),(569,'GestiÃ³n Sostenible de Recursos Forestales desde el punto de vista del Control Ã“ptimo.','Las Ãºltimas respuestas que nos ha dado la naturaleza en relacion al uso que hemos dado a sus recursos, ha obligado a las ciencias tanto EconÃ³micas, Sociales y puras como La Biologia y en este caso las MatemÃ¡ticas, a encarar con urgencia el problema de su comprensiÃ³n y ulterior representaciÃ³n por medio de modelos abstractos para el comportamiento natural de las poblaciones de seres vivos. En el caso de la Biomasa Boscosa se puede representar por modelos logÃ­sticos dinÃ¡micos y su tratamiento se enmarca en la teorÃ­a de Control Ã“ptimo dentro de la cual se describe un marco teorÃ­co econÃ³metrico apropiado, usando elementos del Calculo de Variaciones y potentes teoremas para la optimizacion como el Principio del MÃ¡ximo de Lev Pontryagin y Euler entre otros. De estos se derivan importantes resultados de alta validez cientÃ­fica que pueden ayudar a la planeaciÃ³n de politicas del MÃ¡ximo aprovechamiento natural sin poner en riesgo la capacidad propia de regeneraciÃ³n del medio.','2011-02-23','Bosque, Calculo de Variaciones, GestiÃ³n Sostenible, Formula de Faustmann, Principio del MÃ¡ximo de Lev Pontryagin, Regla de Hotelling, Sistemas Dinamicos, Teoria de Control Ã“ptimo y Turno de RotaciÃ³n.',5,1,1,1,1,'2013-09-17 08:39:00','2013-09-17 08:39:00','Documento_576.pdf','application/pdf',830298,'2013-09-17 08:39:00',19,0,81,'COMPLETO'),(570,'DESARROLLO DE LÃMINAS FLEXIBLES DE PARCHITA (Passiflora edulis f. flavicarpa Degener), CON ZANAHORIA (Daucus carota var. Sativus L.), Y PARCHITA CON REMOLACHA (Beta vulgaris L.), ENRIQUECIDAS CON CALCIO.','Las lÃ¡minas flexibles de frutas constituyen una forma de conservaciÃ³n de alimentos donde el producto es fabricado por deshidrataciÃ³n de pulpa acondicionada. En el presente trabajo se desarrollaron lÃ¡minas de parchita (Passiflora edulis f. flavicarpa Degener) enriquecidas con calcio a partirde combinaciones de azÃºcares,,y mezclas de parchita con zanahoria (Daucus carota var. SativusL..), y parchita con remolacha (Beta vulgaris L..). Ensayando distintas mezclas de azÃºcares se realizaron pruebas para obtener una formulaciÃ³n base de parchita de 20 Â°Brix, logrÃ¡ndose con 50% de sacarosa y 50% de fructosa muy buenos resultados. Posteriormente se probaron dos formulaciones para elaborar lÃ¡minas de parchita con zanahoria y dos formulaciones para parchita con remolacha. Las pulpas acondicionadas fueron deshidratadas a 60 Â°C durante 4 horas en funciÃ³n de los resultados de las curvas de secado. Las lÃ¡minas se caracterizaron de forma fÃ­sica, quÃ­mica, microbiolÃ³gica y sensorial. SegÃºn los resultados obtenidos, utilizando pulpa de parchita combinada con 3% de zanahoria y pulpa de parchita con 3% de remolacha, es posible elaborar lÃ¡minas flexibles enriquecidas con calcio de alrededor de 20,00% de humedad, de bajo pH y baja actividad de agua, ademÃ¡s de bajo contaje de mohos y levaduras, y muy buena aceptaciÃ³n. Una lÃ¡mina de parchita con zanahoria de 14 cm de largo por 4 cm de ancho, suministrarÃ­a del requerimiento diario de calcio (1000 mg/dÃ­a) el 20,67% y la de parchita con remolacha el 24,38%.','2011-05-23','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',1,1,1,1,1,'2013-09-17 08:39:00','2013-09-17 08:39:00','Documento_577.pdf','application/pdf',493263,'2013-09-17 08:39:00',19,0,61,'COMPLETO'),(571,'FormaciÃ³n de PartÃ­culas mediante el MÃ©todo de Descarga Pulsada en Alambres','Si por un alambre no pasa un pulso de alta corriente puede ocasionarse una rÃ¡pida transiciÃ³n de fase de estado sÃ³lido a plasma. Dos efectos principales causan la transiciÃ³n, el calentamiento por efecto Joule y la presiÃ³n ejercida por el campo magnÃ©tico originado por el mismo pulso de corriente (efecto Z- pinch). Al enfriarse el plasma, mediante colisiones con un ambiente gaseoso, los Ã¡tomos se asocian y pueden formarse partÃ­culas finas. En este trabajo se realizaron descargas de pulsos de alta corriente a travÃ©s de alambres de hierro puro. Para generar los pulsos de corriente se utilizÃ³ un generador Marx. BÃ¡sicamente el experimento consiste en realizar una descarga, mediante explosores (interruptores de chispa), de una serie de condensadores conectados en paralelo cargados a una diferencia de potencial inicial V0 Se realizÃ³ una estimaciÃ³n de la diferencia de potencial V0 mÃ­nima del generador Marx, requerida para separar los Ã¡tomos del alambre haciendo uso de la energÃ­a de cohesiÃ³n. Fue necesario diseÃ±ar una bobina que detectara la corriente en las descargas mediante inducciÃ³nmagnÃ©tica; tal bobina es conocida como bobina de Rogowski. Para el diseÃ±o de esta bobina se establecieron parÃ¡metros segÃºn un ecuaciÃ³n de propagaciÃ³n para la onda de voltaje y corriente en la bobina, utilizando un modelo de parÃ¡metros distribuidos. Como un pulso tiene un amplio espectro de frecuencia debiÃ³ diseÃ±arse la bobina de forma que su ancho de banda fuese amplio tambiÃ©n. Los pulsos detectados se midieron con un osciloscopio digital. Las descargas se realizaron en ambiente de aire,en una cÃ¡mara a presiÃ³n atmosfÃ©rica y tambiÃ©n en vacÃ­o grueso. Para cada prueba realizada se colocÃ³ como sustrato una lÃ¡mina de silicio en el interior de la cÃ¡mara, para recoger las partÃ­culas formadas. Las partÃ­culas recogidas en el sustrato fueron analizadas mediante MicroscopÃ­a ElectrÃ³nica de Barrido (SEM), EspectroscopÃ­a de Electrones Auger (AES) y MicroscopÃ­a de Fuerza AtÃ³mica (AFM). Se obtuvieron micropartÃ­culas con forma esfÃ©rica y nanopartÃ­culas con forma elipsoidal, observando una dependencia entre el tamaÃ±o y dispersiÃ³n de las partÃ­culas formadas con la presiÃ³n y energÃ­a de la descarga.','2011-03-09','Rogowski, Z-Pinch, NanopartÃ­culas, Descarga Pulsada',3,1,1,1,1,'2013-09-17 08:39:02','2013-09-17 08:39:02','Documento_578.pdf','application/pdf',4370773,'2013-09-17 08:39:02',19,0,82,'COMPLETO'),(572,'DISEÃ±Ã±OO Y EVALUACIÃ“Ã“NN DE UN SISTEMA COLORIMÃ©Ã©TRICO PARA ANÃÃLLISIS CLÃÃNNICO BASADO EN UNA CÃÃMMARA DIGITAL Y UNA FUENTE DE ILUMINACIÃ“Ã“NN DIFUSA','En el presente trabajo se diseÃ±Ã³ y evaluÃ³ un prototipo de lector de absorbancia usando como sistema de detecciÃ³n una cÃ¡mara digital, para el anÃ¡lisis cuantitativo simultÃ¡neo de un nÃºmero elevado de muestras sintÃ©ticas y biolÃ³gicas como futura aplicaciÃ³n al anÃ¡lisis clÃ­nico. Para el sistema de lector de absorbancia se empleÃ³ una fuente de iluminaciÃ³n difusa como lÃ¡mparas fluorescente e incandescente, una cubeta de plÃ¡stico como compartimiento de muestra y una cÃ¡mara digital CCD como registrador de la imagen, que permitiÃ³ digitalizarla, separarla en sus componentes RGB e intensidad. Las imÃ¡genes se transformaron en superficies de respuesta de intensidades para cada color al que responde los filtros de la cÃ¡mara CCD, de esta manera al compararla con una referencia, se pudo calcular la absorbancia de un punto en particular de la imagen y mediante una curva de calibraciÃ³n se obtuvo la concentraciÃ³n de una determinada sustancia en ese punto. El sistema diseÃ±ado se utilizÃ³ para medir concentraciones de una soluciÃ³n sintÃ©tica de azul de bromofenol preparada a distintas concentraciones y luego se trabajÃ³ con un grupo de muestras de suero sanguÃ­neo humano midiendo concentraciones de glucosa, cuyos valores oscilaron de 25 a 250 mg/dl. Obteniendo una alta linealidad y sensibilidad, comparado con equipos comerciales, lo que per