r de mama, prÃ³tesis mamarias, silicona, polidimetilsiloxano, reconstrucciÃ³n de mama',3,1,1,1,1,'2013-09-17 08:39:06','2013-09-17 08:39:06','Documento_583.pdf','application/pdf',4201315,'2013-09-17 08:39:06',20,0,108,'COMPLETO'),(577,'EstimaciÃ³n del porcentaje de variaciÃ³n obtenido en ACP usando Bootstrap.','El objetivo del presente trabajo es explicar cÃ³mo la combinaciÃ³n de la tÃ©cnica del ACP y la tÃ©cnica del Bootstrap resulta util para determinar la precisiÃ³n del ACP cuando se trabaja con un conjunto pequeÃ±o de datos, con lo cual es posible determinar cuan fiables son los resultados obtenidos en el mismo. En particular, se estimarÃ¡ el porcentaje de variaciÃ³n explicado por la primera componente principal, puesto que Ã©sta variable posee la propiedad de minimizar la suma de los cuadrados de las distancias euclÃ­deas entre ella y los datos representados en el nuevo espacio de variables componentes principales. Se aplicarÃ¡ la tÃ©cnica del ACP a un conjunto de datos y se calcularÃ¡ el porcentaje de variaciÃ³n explicado por la primera componente principal. Se aplicarÃ¡ la tÃ©cnica del bootstrap para estimar este porcentaje mediante la utilizaciÃ³n de doscientas rÃ©plicas bootstrap y se calcularÃ¡ el promedio de estas doscientas rÃ©plicas para ser comparado con el porcentaje de variaciÃ³n observado.','2011-02-25','AnÃ¡lisis de Componentes Principales, autovalores, autovectores, matriz de covarianzas, Bootstrap, funciÃ³n de distribuciÃ³n empÃ­rica, muestra Bootstrap, rÃ©plica Bootstrap, principio Plug-in, estimaciÃ³n.',5,1,1,1,1,'2013-09-17 08:39:09','2013-09-17 08:39:09','Documento_584.pdf','application/pdf',18401982,'2013-09-17 08:39:09',20,0,131,'COMPLETO'),(578,'Actvidad de catalizadores en base a CoMo y NiMo soportados por oxidos inorganicos modificados con compuestos organicos','En la actualidad los destilados pesados del petrÃ³leo presentan un alto contenido de hidrocarburos que poseen heteroÃ¡tomos en su estructura, como azufre, nitrÃ³geno, oxÃ­geno y 