izadores NiMo. Los catalizadores sintetizados ademÃ¡s mejoraron notablemente algunas de las propiedades fÃ­sicas de los gasÃ³leos, obteniÃ©ndose una disminuciÃ³n en la viscosidad y densidad, mayor gravedad API y un aumento del porcentaje de destilado para la producciÃ³n de nafta, diesel, kerosÃ©n y gasÃ³leo.','2011-05-16','CatÃƒÂ¡lisis',6,1,1,1,1,'2013-09-17 08:39:11','2013-09-17 08:39:11','Documento_585.pdf','application/pdf',2601835,'2013-09-17 08:39:11',20,0,144,'COMPLETO'),(579,'ACTIVIDAD DE CATALIZADORES EN BASE A Co--Mo y Ni--Mo SOPORTADOS POR OXIDOS INORGANICOS MODIFICADOS CON COMPUESTOS ORGANICOS','En la actualidad los destilados pesados del petrÃ³leo presentan un alto contenido de hidrocarburos que poseen heteroÃ¡tomos en su estructura, como azufre, nitrÃ³geno, oxÃ­geno y metales los cuales constituyen agentes contaminantes, principalmente para el medio ambiente, debido a esta problemÃ¡tica la industria del refino a nivel internacional requiere de tecnologÃ­as mÃ¡s eficientes para eliminar gran parte de estos contaminantes, lo que ha generado un creciente interÃ©s en el diseÃ±o de catalizadores mÃ¡s selectivos y activos para procesos de hidrotratamiento (HDT) de crudos. En el presente trabajo de grado se sintetizaron catalizadores en base a Mo, NiMo y CoMo mediante un mÃ©todo de intercambio iÃ³nico, soportado sobre alÃºmina modificada con g-aminopropiltrietoxisilano. Los precursores catalÃ­ticos fueron activados empleando como agente sulfurante disulfuro de carbono (CS2) con una composiciÃ³n definida de H2/CS2. El material carbÃ³nico generado in situ, proveniente de la descomposiciÃ³n tÃ©rmica del agente modificante, actuÃ³ como soporte, mejorando la dispersiÃ³n de la fase metÃ¡lica y minimizÃ³ la interacciÃ³n directa entre el metal y la g- alÃºmina. La modificaciÃ³n del soporte permitiÃ³ que aproximadamente un 4% de fase metÃ¡lica fuera depositada en el soporte, siendo este valor 3 veces menor a la carga metÃ¡lica que poseen los catalizadores industriales utilizados actualmente por la industria de refinaciÃ³n. La caracterizaciÃ³n del soporte y los catalizadores sintetizados fueron realizadas mediante el uso de Ã¡rea especÃ­fica, espectroscopÃ­a de infrarrojo y anÃ¡lisis termogravimetrico. Se determinÃ³ la conversiÃ³n de los catalizadores sintetizados en el proceso de hidrotratamiento de gasÃ³leos de vacio (HVGO y VGO). Los productos de la reacciÃ³n de HDT del HVGO y VGO fueron caracterizados mediante las siguientes tÃ©cnicas: densidad, viscosidad, anÃ¡lisis elemental de azufre y destilaciÃ³n simulada. Los catalizadores NiMo y CoMo mostraron una mayor actividad por gramo de fase metÃ¡lica en comparaciÃ³n con el catalizador comercial. Los catalizadores CoMo mostraron ser mas eficientes y activos para la HDS del HVGO y VGO que los catalizadores NiMo. Los catalizadores sintetizados ademÃ¡s mejoraron notablemente algunas de las propiedades fÃ­sicas de los gasÃ³leos, obteniÃ©ndose una disminuciÃ³n en la viscosidad y densidad, mayor gravedad API y un aumento del porcentaje de destilado para la producciÃ³n de nafta, diesel, kerosÃ©n y gasÃ³leo.','2011-05-16','Catalisis',6,1,1,1,1,'2013-09-17 08:39:12','2013-09-17 08:39:12','Documento_586.pdf','application/pdf',0,'2013-09-17 08:39:12',20,0,0,'INCOMPLETO'),(580,'\"\"OptimizaciÃ³Ã³nn de mÃ©Ã©todos analÃ­Ã­ticos que determinan los parÃ¡Ã¡metros de calidad de una toalla sanitaria\"\"..','En este trabajo especial de grado se optimizaron mÃ©todos de laboratorio, para medir parÃ¡metros de calidad de una toalla sanitaria. Debido a que las toallas en estudio son de cubierta hidrofÃ³bica, para la evaluaciÃ³n de su desempeÃ±o se requiriÃ³ de un fluido artificial con propiedades fÃ­sicas acorde con la naturaleza de la misma. Por lo tanto, se desarrollÃ³ de un fluido menstrual artificial afÃ­n con las necesidades de este nuevo producto. Se desarrollaron una serie de fluidos menstruales artificiales, partiendo de un fluido menstrual original como fluido estÃ¡ndar e incorporÃ¡ndole ciertas cantidades de tensoactivos (AlbÃºmina y Triton X - 100). Dichos fluidos se evaluaron mediante la medida de cuatro parÃ¡metros relacionados con el proceso de absorciÃ³n por capilaridad de una toalla sanitaria, los cuales fueron: Porcentaje de fluido no absorbido sobre un plano inclinado. Velocidad de absorciÃ³n. Retorno de fluido. Gradiente de velocidad del fluido sobre la toalla sanitaria. Los anÃ¡lisis arrojaron que el fluido que ofreciÃ³ el mejor comportamiento para este tipo de toalla sanitaria, fue el formado por el fluido menstrual original (sangre de ovejo con moco sintÃ©tico) y con una mezcla de tensoactivos (AlbÃºmina y Triton X - 100) en proporciones conocida. Posteriormente se realizo la caracterizaciÃ³n de los fluidos y se determinÃ³ mediante un anÃ¡lisis de correlaciÃ³n multivariante la relaciÃ³n existente entre los parÃ¡metros medidos (velocidad de absorciÃ³n y retorno de fluido) y las propiedades fÃ­sicas de los fluidos afectadas por la adiciÃ³n de los tensoactivos (tensiÃ³n superficial y viscosidad). Por ultimo para establecer una relaciÃ³n de los resultados de laboratorio con la opiniÃ³n del consumidor, se aplico una regresiÃ³n no lineal mÃºltiple, donde la variable dependiente fue la opiniÃ³n del consumidor y las variables independientes velocidad de absorciÃ³n y retorno de fluido. AsÃ­ se obtuvo una ecuaciÃ³n general con la cual en el futuro se puede predecir la opiniÃ³n del consumidor.','2011-01-28','{}',6,1,1,1,1,'2013-09-17 08:39:12','2013-09-17 08:39:12','Documento_587.pdf','application/pdf',2097081,'2013-09-17 08:39:12',20,0,84,'COMPLETO'),(581,'ConstrucciÃ³n del movimiento Browniano, la hoja Browniana y su representaciÃ³n en Matlab.','El movimiento Browniano o proceso de Wiener es el nombre dado al movimiento irregular que realizan las partÃ­culas de polen suspendidas en un lÃ­quido. Este movimiento fue observado por el botÃ¡nico inglÃ©s Robert Brown en 1827, cuando investigaba el polen de diversas plantas.A partir de aquÃ­ aparecen distintos investigadores, que trataron de explicar Ã©ste fenÃ³meno, entre los mÃ¡s recientes tenemos a: Louis Bachelier quiÃ©n en 1900 utilizÃ³ Ã©ste modelo para la descripciÃ³n del cambio de los precios de las bolsas de valores. Albert Einstein en 1905 estudiÃ³ la teorÃ­a fÃ­sica que explicaba Ã©ste movimiento, entre otros. Sin embargo. Sin embargo fue en 1923 cuando Nobert Wiener logra dar una construcciÃ³n matemÃ¡tica de dicho proceso, sentando las bases del movimiento Browniano, razÃ³n por la cual Ã©ste proceso se denomina frecuentemente proceso de Wiener. A partir de la formalizaciÃ³n matemÃ¡tica dada por Wiener en 1923 al movimiento Browniano, Ã©ste convirtiÃ³ en un Ã¡rea de investigaciÃ³n muy activa. Desde entonces, se han generado y se siguen generando elegantes e importantes descubrimientos relacionados con Ã©ste proceso estocÃ¡stico, no solo en la matemÃ¡tica, sino en otras Ã¡reas como la fÃ­sica, quÃ­mica, entre otras.Luego de dicha formalizaciÃ³n, muchos investigadores a nivel mundial se concentraron en extender el movimiento Browniano a una medida en varias variables surgiendo asÃ­ la llamada hoja Browniana, que fue introducida por el estadÃ­stico Kitagawa en 1951, para realizar anÃ¡lisis de varianza en tiempo continuo.Un conjunto separado de ideas motivan el estudio de la hoja Browniana algunas de ellas provienen del hecho de que es central para la teorÃ­a de integrales estocÃ¡sticas multiparamÃ©tricas y es el ejemplo bÃ¡sico de una soluciÃ³n de una ecuaciÃ³n diferencial parcial estocÃ¡stica de tipo hiperbÃ³lica perturbada por un ruido blanco. La hoja Browniana tambiÃ©n estÃ¡ conectada con el cÃ¡lculo de Malliavin. Este proceso tambiÃ©n permite una representaciÃ³n simple del proceso de Ornstein- Uhlenbeck sobre el espacio de Wiener. AdemÃ¡s la hoja Browniana abre un amplio terreno de estudio en la teorÃ­a de potenciales.Grandes investigadores como Pruit, Orey, Walsh, entre otros, se encargaron de estudiar el comportamiento de las trayectorias de Ã©ste proceso, asÃ­ como de establecer un mÃ³dulo de continuidad y una ley de logaritmo iterado las cuales permiten medir las oscilaciones de las trayectorias de la hoja.','2011-05-20','Procesos estocÃƒÂ¡sticos, procesos gaussianos, movimiento Browniano, hoja Browniana, Wiener, mÃƒÂ³dulo de continuidad, Incremento doble.',5,1,1,1,1,'2013-09-17 08:39:14','2013-09-17 08:39:14','Documento_588.pdf','application/pdf',0,'2013-09-17 08:39:14',20,0,0,'INCOMPLETO'),(582,'COMPARACIÃ“Ã“NN DE LA EFICIENCIA DE EXTRACCIÃ“Ã“NN CON SOLVENTES DE DIFERENTE POLARIDAD,, PARA UN CRUDO MEDIANO A DOS CONCENTRACIONES EN UN SUELO SOMETIDO A BIORREMEDIACIÃ“Ã“NN','Las actividades que estÃ¡n envueltas en la exploraciÃ³n y producciÃ³n del petrÃ³leo producen impactos potencialmente negativos sobre los ecosistemas naturales; en vista de lo cual el hombre ha desarrollado tÃ©cnicas como la biorremediaciÃ³n. Un aspecto clave dentro del proceso de biorremediaciÃ³n es conocer los lÃ­mites permisibles que deben alcanzarse mediante la aplicaciÃ³n del tratamiento, siendo el valor lÃ­mite permisible de aceites y grasas en suelos, establecido por la legislaciÃ³n venezolana, de 1% (m/m). Cuando se realizan estudios de biorremediaciÃ³n de suelos contaminados con crudo es importante considerar el solvente de extracciÃ³n, el cual no es especificado en la legislaciÃ³n. En la presente investigaciÃ³n se compara la eficiencia de extracciÃ³n de dos solventes (n-hexano y diclorometano) para la remociÃ³n de un crudo mediano, a concentraciones de 5% y 9%, de un suelo arenoso que estÃ¡ siendo sometido a un proceso de biorremediaciÃ³n. Se realizÃ³ en laboratorio el proceso de contaminaciÃ³n de un suelo arenoso con concentraciones de 5% y 9% (m/m) del crudo mediano Guafita 10X, obteniÃ©ndose dos tratamientos: A (5%) y B (9%). Se llevÃ³ a cabo la extracciÃ³n del crudo presente en cada tratamiento a los 1, 15, 30, 45 y 90 dÃ­as del avance de la biodegradaciÃ³n, empleando el mÃ©todo de extracciÃ³n soxhlet y usando los dos solventes. Luego de la extracciÃ³n del crudo, se determinÃ³ la concentraciÃ³n de COT en cada residuo de suelo. Los extractos de crudo fueron separados y cuantificados en sus fracciones constituyentes, saturados, aromÃ¡ticos, resinas y asfaltenos y se realizÃ³ el anÃ¡lisis de biomarcadores de la fracciÃ³n de hidrocarburos saturados. Los resultados obtenidos en el estudio muestran una disminuciÃ³n progresiva de la eficiencia de extracciÃ³n para ambos solventes, La eficiencia de extracciÃ³n del diclorometano resultÃ³ ser mayor que la del n-hexano cuando la concentraciÃ³n inicial de crudo era de 5%, no obstante, a mayores concentraciones de crudo (9%), las eficiencias de extracciÃ³n obtenidas para ambos solventes no presentan diferencias significativas. La variaciÃ³n en la composiciÃ³n SARA durante el experimento indica que la remociÃ³n de la fracciÃ³n de hidrocarburos saturados ocurre mÃ¡s rÃ¡pidamente para el tratamiento A, lo cual sugiere que el proceso de biodegradaciÃ³n en Ã©ste resultÃ³ ser mÃ¡s eficiente. El anÃ¡lisis de biomarcadores, tambiÃ©n sugiere que la biodegradaciÃ³n en el tratamiento A avanza mÃ¡s rÃ¡pidamente.','2011-03-01','biorremediaciÃƒÂ³n, eficiencia de extracciÃƒÂ³n, crudo, concentraciÃƒÂ³n.',4,1,1,1,1,'2013-09-17 08:39:16','2013-09-17 08:39:16','Documento_589.pdf','application/pdf',35714113,'2013-09-17 08:39:16',19,0,212,'COMPLETO'),(583,'Algoritmo trazador de rayos sÃ­smicos en medios heterogÃ©neos estratificados isÃ³tropos usando tÃ©cnicas nÃºmericas.','En la prospecciÃ³n sÃ­smica, especialmente en la exploraciÃ³n petrolera, se necesita saber el camino que siguen los rayos sÃ­smicos en el subsuelo, tomando en cuenta las diferentes capas geolÃ³gicas presentes. Como cada capa tiene su impedancia caracterÃ­stica, la velocidad de propagaciÃ³n de las ondas varÃ­a con la profundidad.El trazado de rayos sÃ­smico ha sido amplia mente usado como una tÃ©cnica de exploraciÃ³n del subsuelo, produciendo con una explosiÃ³n (fuente) una onda que luego es recibida por varios sensores repartidos apropiadamente de acuerdo a la mejor configuraciÃ³n utilizada sobre la superficie del terreno.','2011-01-27','Trazado sÃƒÂ­smico, anisÃƒÂ³tropos, isÃƒÂ³tropos, estratificado, algoritmo, heterogÃƒÂ©neo, homogÃƒÂ©neo, etc.',3,1,1,1,1,'2013-09-17 08:39:18','2013-09-17 08:39:18','Documento_590.pdf','application/pdf',2185695,'2013-09-17 08:39:18',20,0,80,'COMPLETO'),(584,'ESTUDIO GEOQUÃMICO DE LOS SÃ“LIDOS DISUELTOS DE LA CUENCA DEL RÃO TUY','En este trabajo fue llevado a cabo un estudio geoquÃ­mico en las muestras de agua de la Cuenca del RÃ­o Tuy, con el propÃ³sito de determinar el grado de contaminaciÃ³n que presenta este importante cuerpo de agua. Fueron realizadas mediciones en campo de los parÃ¡metros fisicoquÃ­micos pH, conductividad, temperatura, alcalinidad y Eh; asÃ­ como las determinaciones en el laboratorio de las concentraciones de Na, K, Ca, Mg, Cl-, SO42- y NO3-;ademÃ¡s de los metales traza Al, Fe, Mn, Co, Ni, Cu, Zn y Pb; y los elementos Si y P. Las muestras recolectadas en campo fueron filtradas a travÃ©s de un filtro con tamaÃ±o de poro de 0,45 Âµm para trabajar con la fracciÃ³n de sÃ³lidos disueltos. Los resultados obtenidos indican que las zonas que presentan mayor contaminaciÃ³n corresponden a Guayas, Ocumare, Lagartijo y Boca de Cagua, y asÃ­ como los afluentes pertenecientes a la Quebrada CÃºa, Quebrada Charallave y Quebrada Guayas, y los rÃ­os Caucagua y Guaire, evidenciado por los altos valores de conductividad y los mayores valores de concentraciones de las especies Na, K, Ca, Mg, Cl-, SO42- y HCO3-, no obstante que en las zonas aguas arriba en el rÃ­o desde la Colonia Tovar hasta El Consejo, las concentraciones fueron similares a las de afluentes considerados como no contaminados. En cuanto a los aniones, el NO3- presentÃ³ sus mÃ¡ximos en Boca de Paparo, Hacienda Buen Paso Hacienda Santa Teresa y TÃ¡cata, atribuido este a las actividades agropecuarias. El P resaltÃ³ en Araguita, Taguacita-Tuy, Guayas y Ocumare y en los afl