cadena lateral, tomando en cuenta los compuestos sintetizados anteriormente, 22,26 azasterol (AZA 1) [13][14], AZA 2 y AZA 3 [12]. Las modificaciones realizadas se basaron en la elongaciÃ³n de la cadena lateral en un Ã¡tomo de carbono, para ello las estrategias sintÃ©ticas de estos productos se fundamentaron en reacciones de sustituciÃ³n nucleofÃ­lica del tipo SN2 y reacciones de eliminaciÃ³n principalmente.','2011-05-20','Azasterol, Esterol Metil Transferasa, olefinaciÃ³n de Peterson',6,1,1,1,1,'2013-09-17 08:39:22','2013-09-17 08:39:22','Documento_592.pdf','application/pdf',711484,'2013-09-17 08:39:22',20,0,91,'COMPLETO'),(586,'\"\"ESTUDIO DEL EFECTO DE LA TEMPERATURA Y TIEMPO DE CRISTALIZACIÃ“Ã“NN SOBRE LA FORMACIÃ“Ã“NN DE LA MESOESTRUCTURA Al--MCM--4411\"\"','El presente trabajo estÃ¡ enfocado en la obtenciÃ³n de un material mesoporoso tipo Al-MCM-41 variando las condiciones de sÃ­ntesis; temperatura, tiempo de cristalizaciÃ³n y fuente de silicio, con la finalidad de estudiar el efecto de estos parÃ¡metros sobre la formaciÃ³n de la mesoestructura.En este estudio se sintetizaron 48 sÃ³lidos con una relaciÃ³n fija de SiO2/Al2O3= 70, a temperaturas entre 150 y 190ÂºC y tiempos de cristalizaciÃ³n entre 6 y 72 horas con tetraetilortosilicato (TEOS) y silicato de sodio como fuentes de silicio. La obtenciÃ³n de los mismos de realizÃ³ empleando un reactor tipo Parr bajo presiÃ³n autÃ³gena siguiendo la metodologÃ­a experimental propuesta en Ã©ste trabajo. Los sÃ³lidos fueron caracterizados por distintas tÃ©cnicas: DifracciÃ³n de rayos X (DRX), fisisorciÃ³n de nitrÃ³geno, TGA-DTA y microscopÃ­a electrÃ³nica de transmisiÃ³n.Para las fuentes de silicio estudiadas se observa que los difractogramas de rayos X a bajo Ã¡ngulo del Al-MCM-41 sin calcinar, obtenidos a 150 y 170ÂºC y tiempos cortos de cristalizaciÃ³n, revelan la presencia del pico principal a Ã¡ngulos 2th = 2 caracterÃ­stico de Ã©ste de sÃ³lido mesoporoso. En los difractogramas de rayos X a alto Ã¡ngulo del Al-MCM-41 sin calcinar, obtenidos a 190ÂºC y tiempos largos de cristalizaciÃ³n se observa un patrÃ³n de difracciÃ³n correspondientes a sÃ³lidos cristalinos con ambas fuentes de silicio.Los patrones de difracciÃ³n de rayos X a bajo Ã¡ngulo de los sÃ³lidos calcinados muestran que a temperaturas bajas se evidencia una disminuciÃ³n notable en el pico principal a Ã¡ngulos 2th=2 de Ã©stos materiales con TEOS, sin embargo con silicato de sodio el patrÃ³n de DRX no muestra la presencia de un ordenamiento hexagonal; el efecto de la calcinaciÃ³n sobre el ordenamiento del sÃ³lido es mÃ¡s drÃ¡stico cuando la fuente de silicio fuÃ© silicato de sodio. A Ã¡ngulos altos a partir de 2th = 5 y temperaturas de 150 y 170ÂºC se observa un patrÃ³n de difracciÃ³n correspondiente a una fase amorfa, en cambio a 190ÂºC se obtiene un patrÃ³n de difracciÃ³n correspondiente a una combinaciÃ³n de fases.Los resultados de estabilidad hidrotÃ©rmica muestran que los sÃ³lidos obtenidos no mantienen el ordenamiento hexagonal luego del tratamiento.Las isotermas de adsorciÃ³n de nitrÃ³geno para los sÃ³lidos sintetizados entre 150 y 190ÂºC y tiempos cortos de cristalizaciÃ³n son tÃ­picas de materiales mesoporosos (isotermas de tipo IV). A tiempos intermedios de cristalizaciÃ³n se observan unas isotermas que combinan la tipo I y tipo IV y a tiempos largos se observa unas isotermas tÃ­picas de materiales microporosos (tipo I). Una distribuciÃ³n de poros estrecha es observada para bajos tiempos de cristalizaciÃ³n, que luego se hace mÃ¡s heterogÃ©nea y se pierde a medida que aumenta la temperatura y el tiempo de cristalizaciÃ³n con ambas fuentes de silicio.Con respecto al Ã¡rea superficial de estos sÃ³lidos, los materiales sintetizados con silicato de sodio presentaron Ã¡reas superiores (1253 m2/g) a los sintetizados con TEOS como fuente de silicio (941 m2/g), todos los valores tienden a disminuir con el aumento en la temperatura y tiempo de cristalizaciÃ³n.Al emplear silicato de sodio como fuente de silicio se obtienen sÃ³lidos mÃ¡s hidrofÃ­licos en comparaciÃ³n con TEOS. Adicionalmente, las imÃ¡genes obtenidas mediante microscopÃ­a electrÃ³nica de transmisiÃ³n confirman la obtenciÃ³n de un material mesoporoso y se observa una transiciÃ³n de fase: mezcla de fase hexagonal- laminar a una fase netamente hexagonal. La temperatura Ã³ptima que se eligiÃ³ fue 150ÂºC y tiempos de cristalizaciÃ³n entre 12 y 72 horas empleando Silicato de Sodio como fuente de silicio ya que era la fuente de interÃ©s por su economÃ­a.Se logrÃ³ observar y verificar que ocurren las transiciones de fase con el incremento de la temperatura y tiempo de cristalizaciÃ³n para las dos fuentes de silicio ademÃ¡s de identificarlas mediante la tÃ©cnica de MicroscopÃ­a electrÃ³nica de transmisiÃ³n.','2011-02-01','EFECTO DE LA TEMPERATURA Y TIEMPO DE CRISTALIZACIÃ“Ã“NN SOBRE LA FORMACIÃ“Ã“NN DE LA MESOESTRUCTURA Al--MCM--4411\"\"',6,1,1,1,1,'2013-09-17 08:39:23','2013-09-17 08:39:23','Documento_593.pdf','application/pdf',1476102,'2013-09-17 08:39:23',20,0,93,'COMPLETO'),(587,'ModificaciÃ³Ã³nn del almidÃ³Ã³nn de yuca ((Manihot esculenta Crantz)) por metilaciÃ³Ã³nn para aplicaciones en alimentos y biomedicina..','El objetivo de este trabajo fue modificar el almidÃ³n de yuca quÃ­micamente (metilaciÃ³n) para su uso en un empaque tipo comercial y con aplicaciones biomÃ©dicas. La metodologÃ­a empleada permitiÃ³ la caracterizaciÃ³n fÃ­sica, quÃ­mica, funcional y reolÃ³gica del almidÃ³n nativo y modificado. Se realizÃ³ un estudio de biocompatibilidad in vitrodel almidÃ³n modificado, asÃ­ como la identificaciÃ³n por microscopia (MLP) de los grÃ¡nulos de ambos almidones. Los almidones modificados mostraron marcadas diferencias (p<<==00,,0055)) con el nativo, respecto a los anÃ¡lisis proximales, fÃ­sicos y fisicoquÃ­micos evaluados. El tratamiento de estos almidones con dimetil sulfato (DMSO4) resultÃ³ ser una tÃ©cnica con potencial para la obtenciÃ³n de material de empaque orgÃ¡nico. Los resultados indican que la formulaciÃ³n de 6g almidÃ³n nativo/1mL de DMSO4/3,3g hidrÃ³xido de bario Ba (OH)2 fue efectiva para la elaboraciÃ³n de pelÃ­culas rÃ­gidas; y la incorporaciÃ³n de glicerol les confiriÃ³ un carÃ¡cter flexible. Se puede tambiÃ©n indicar en funciÃ³n a los resultados obtenidos en los experimentos antes mencionados, y ademÃ¡s de las pruebas de citotoxicidad (MTT), que puede ser empleado como material de empaque terciario. Por otra parte, este estudio tiende a representar un aporte innovador en el empleo de almidones modificados para la producciÃ³n o formulaciÃ³n de material de empaques (rÃ­gidos, y flexibles con glicerol) biodegradables de impacto en el Ã¡rea de alimentos y de la biomedicina debido a que se pueden obtener hidrogeles, a base de este polÃ­mero con quitosano y glutaraldehido (agente entrecruzante) que mostraron ser excelente material de soporte que permite la adhesiÃ³n, proliferaciÃ³n y estimulaciÃ³n considerable de la actividad celular.','2011-02-17','MetilaciÃ²n,Yuca, Dimetil sulfato.',1,1,1,1,1,'2013-09-17 08:39:26','2013-09-17 08:39:26','Documento_594.pdf','application/pdf',2909979,'2013-09-17 08:39:26',20,0,180,'COMPLETO'),(588,'CARACTERIZACIÃ“N DE BIOMARCADORES EN CRUDOS Y EN RESINAS TIPO I, CO-PRECIPITADAS CON LA FRACCIÃ“N DE ASFALTENOS','Este trabajo de investigaciÃ³n tuvo como objetivo general caracterizar y comparar los biomarcadores que se encuentran en la fracciÃ³n de maltenos y aquellos asociados a la fracciÃ³n denominada resinas tipo I, en seis muestras de crudo provenientes de los campos BoscÃ¡n y Alturitas (Cuenca de Maracaibo), Guafita y Silvestre (Cuenca Barinas-Apure), y JunÃ­n y Ayacucho (Cuenca oriental de Venezuela), estas dos Ãºltimas muestras correspondientes a crudos biodegradados. La fracciÃ³n de resinas I comprende a aquellas resinas que co- precipitan con los asfaltenos y que son obtenidas mediante extracciÃ³n soxhlet con n-heptano; la retenciÃ³n de estos compuestos y de otras molÃ©culas orgÃ¡nicas como hidrocarburos saturados y aromÃ¡ticos es posible debido a la existencia de estructuras de microporos en los asfaltenos. Para extraer la fracciÃ³n de hidrocarburos saturados de maltenos y de resinas I, se aplicÃ³ la metodologÃ­a de separaciÃ³n SARA; posteriormente se obtuvo la distribuciÃ³n de n-alcanos e isoprenoides mediante CromatografÃ­a de Gases con Detector de IonizaciÃ³n a la Llama (CG-FID), en tanto que los compuestos del tipo terpanos y esteranos se analizaron empleando CromatografÃ­a de Gases - EspectrometrÃ­a de Masas (CG-EM), adquiriÃ©ndose los iones m/z 191 (terpanos), m/z 177 (25-norhopanos) y m/z 217 y 218 (esteranos). Los cromatogramas y fragmentogramas de la fracciÃ³n de hidrocarburos saturados en resinas I, mostraron como caracterÃ­stica general tanto para crudos no biodegradados como para crudos con biodegradaciÃ³n, una respuesta o abundancia relativa menor a la generada por los hidrocarburos saturados de la fracciÃ³n de maltenos, como reflejo de la menor concentraciÃ³n de estos compuestos en la fracciÃ³n de resinas I. Se observÃ³ tambiÃ©n que los n- alcanos retenidos en la estructura de los asfaltenos poseen una distribuciÃ³n en el rango de n-C14 a n-C34 con un predominio de los n-alcanos de mayor masa molecular y que se tiene una retenciÃ³n preferencial del isoprenoide fitano sobre el isoprenoide pristano. En los cromatogramas de saturados de la fracciÃ³n de resinas I para los crudos biodegradados, se evidenciÃ³ la distribuciÃ³n de n- alcanos del tipo unimodal desde n-C16 hasta n-C34con una tendencia hacia los n- alcanos > a n-C25. La forma, distribuciÃ³n y relaciones de las seÃ±ales de los fragmentogramas de terpanos se conserva tanto para la fracciÃ³n de hidrocarburos saturados de maltenos como para la de resinas I en todas las muestras. En las muestras sin biodegradaciÃ³n se mantuvo la proporciÃ³n de los isÃ³meros abb y aaa y de los isÃ³meros S y R del esterano C29 en la fracciÃ³n de hidrocarburos saturados de maltenos y en la fracciÃ³n de hidrocarburos saturados de resinas I, mientras que para las muestras de crudos biodegradados no fue posible establecer un comportamiento o tendencia general de los esteranos en la fracciÃ³n de resinas I.','2011-03-01','biomarcadores, asfaltenos, resinas I, biodegradaciÃƒÂ³n.',4,1,1,1,1,'2013-09-17 08:39:29','2013-09-17 08:39:29','Documento_595.pdf','application/pdf',5031810,'2013-09-17 08:39:29',20,0,116,'COMPLETO'),(589,'CARACTERIZACIÃ“Ã“NN GEOQUÃÃMMICA Y RADIOACTIVA DE LA FORMACIÃ“Ã“NN SAN ANTONIO,, ESTADO ANZOÃÃTTEGUI,, VENEZUELA','En el presente trabajo se estudiaron las relaciones existentes entre las medidas de radioactividad natural total (GRtotal) y discriminada por elementos (U, Th y K) y los resultados de los anÃ¡lisis geoquÃ­micos (Ctotal, CinorgÃ¡nico, COT y concentraciÃ³n de bitumen) realizados en las muestras de la secciÃ³n tipo de la FormaciÃ³n San Antonio ubicada en el RÃ­o Querecual, AnzoÃ¡tegui, Venezuela, con objeto de conocer su utilidad en la determinaciÃ³n de las variaciones ocurridas en las condiciones redox del ambiente de sedimentaciÃ³n de la formaciÃ³n, y para el determinar su efectividad en la identificaciÃ³n de rocas madres. Los resultados obtenidos en la FormaciÃ³n San Antonio, demuestran que sÃ­ existe una relaciÃ³n entre los resultados geoquÃ­micos y los radioactivos, ya que aquellas muestran que presentan altas concentraciones de COT, presentan altos valores de GRtotal y de los elementos (especialmente U). A su vez, ambas variables estÃ¡n relacionadas con la litologÃ­a, quedando que la mayorÃ­a de las lutitas, lutitas calcÃ¡reas, margas, calizas y calizas margosas (rocas madre), se encuentran en el intervalo alto de GRtotal (1000 - 2000cps), bajos - medios de U (25 - 75cps), medios - excelentes de COT (1,5 - 5,4) y altos de bitumen (140 - 405ppm); mientras que las areniscas calcÃ¡reas en su mayorÃ­a presentan valores bajos de GRtotal (<700cps), muy bajos - bajos de U (<50cps), bajos de COT (~1,7%) y bajos de bitumen (~64ppm), pudiendo relacionarse con la baja eficiencia de expulsiÃ³n de hidrocarburos en la formaciÃ³n. Lo que demuestra la efectividad de la tÃ©cnica en la determinaciÃ³n de materia orgÃ¡nica y por tanto en la identificaciÃ³n de rocas madre.La relaciÃ³n Th/U permitiÃ³ determinar que si bien las condiciones redox de sedimentaciÃ³n del Grupo Guayuta (Fm. Querecual y San Antonio) fueron anÃ³xicas, existen diferencias entre ellas, ya que las de San Antonio fueron anÃ³xicas en los sedimentos, donde esta presenta una interfase O2-H2S, mientras que las de Querecual fueron anÃ³xicas euxÃ­nicas. Con la relaciÃ³n Th/K y los valores tan altos de torio se pudo determinar que durante la sedimentaciÃ³n de la FormaciÃ³n San Antonio, el aporte de clastos a la cuenca fue mayor al ocurrido durante la sedimentaciÃ³n de Querecual, razÃ³n por la cual existe tanta diferencia entre ambas en cuanto a los valores de GRtotal y la litolÃ³gica.','2011-03-01','FormaciÃƒÂ³n San Antonio, Uranio, Torio, Potasio, Radioactividad, Rayos Gamma, COT, Bitumen.',4,1,1,1,1,'2013-09-17 08:39:30','2013-09-17 08:39:30','Documento_596.pdf','application/pdf',1333537,'2013-09-17 08:39:30',20,0,82,'COMPLETO'),(590,'CARACTERIZACIÃ“N GEOQUÃMICA DE LOS SUELOS ASOCIADOS A DISTINTAS ESPECIES DE MANGLE DE LA ZONA OESTE DEL GOLFETE DE CORO Y NORESTE DE LA PENÃNSULA DE PARAGUANÃ, ESTADO FALCÃ“N','Fue realizado un estudio de los suelos asociados a distintas especies de mangle en Laguna de Boca de CaÃ±o (mangles de 3 a 8 metros de altura), al noreste de la PenÃ­nsula de ParaguanÃ¡, y en Punta CaimÃ¡n (mangles no superan los 2 metros de altura), al Oeste del Golfete de Coro, estado FalcÃ³n, determinando la concentraciÃ³n de Fe, Al, Ni, Mn, Ca, Cu, Pb, Hg, Zn, Cr, Cd, C, N y P, ademÃ¡s de los parÃ¡metros fisicoquÃ­micos pH, Eh y salinidad. Para ello, fueron captadas muestras de suelo en 13 puntos de muestreo a profundidades de 30 cm, 60 cm y 90 cm, a las cuales le fue realizada una extracciÃ³n secuencial con HCl 1 M y HNO3 concentrado, para determinar los elementos Fe, Al, Ni, Mn, Ca, Cu, Pb, Zn, Cr y Cd por espectroscopia de emisiÃ³n atÃ³mica acoplado a fuente de plasma (ICP), y P por fotocolorimetrÃ­a (Murphy y Riley). AdemÃ¡s, el C total fue determinado por medio de un analizador directo de carbono (LECO) y por el mÃ©todo Walkley-Black para determinar C orgÃ¡nico. Por otra parte, el N se determinÃ³ por el mÃ©todo de Kjeldahl modificado de Jackson, y el Hg fue determinado mediante un equipo analizador directo de mercurio (DMA-80). Los resultados indican que en ambas zonas el Eh tiende a disminuir con la profundidad, y que los suelos de Boca de CaÃ±o son mÃ¡s Ã¡cidos que los presentados en Punta CaimÃ¡n. Por otra parte, la principal diferencia entre la zonaciÃ³n de las especies es la salinidad, pues suelos dominados por Avicennia germinans presentan mayor salinidad que los dominados por Rizophora mangle. TambiÃ©n se encontrÃ³ que en los suelos asociados a los manglares de las zonas de la Laguna de Boca de CaÃ±o existe mayor acumulaciÃ³n de materia orgÃ¡nica en comparaciÃ³n con los suelos de manglar de Punta CaimÃ¡n, debido a que en este Ãºltimo existe una removilizaciÃ³n de materia orgÃ¡nica por efecto de las mareas y como consecuencia el nitrÃ³geno queda fijado en el suelo. Entre las diferencias mÃ¡s importantes encontradas entre las dos zonas estudiadas fueron que las concentraciones de Al, Fe, Mn, Ni, Cu, Cr, Zn, P y Pb asociado al extracto de HNO3(c), las concentraciones de Cu, Zn, Pb y Cd asociado al extracto HCl 1M, y la concentraciÃ³n de Hg son mayores en los suelos de manglar de Punta CaimÃ¡n que en los suelos de manglar de Boca de CaÃ±o, debido a un aporte litolÃ³gico principalmente. Por otra parte, los mangles de Punta CaimÃ¡n son enanos debido a una deficiencia de P biodisponible.','2011-03-04','Suelos, Manglares, GeoquÃƒÂ­mica Ambiental, EcologÃƒÂ­a, Metales pesados y nutrientes.',4,1,1,1,1,'2013-09-17 08:39:31','2013-09-17 08:39:31','Documento_597.pdf','application/pdf',3763781,'2013-09-17 08:39:31',20,0,87,'COMPLETO'),(591,'ESTUDIO GEOFISICO INTEGRADO CON FINES DE EXPLORACION DIAMANTIFERA EN LA ZONA DE SANTA ELENA DE UAIREN, EDO. BOLIVAR','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} A nivel mundial se ha encontrado que las pipas kimberlitas pueden generar anomalÃ­as magnÃ©ticas y/o electromagnÃ©ticas siendo posible la utilizaciÃ³n de estos mÃ©todos geofÃ­sicos para la detecciÃ³n de su ubicaciÃ³n. En este trabajo se realizÃ³ el levantamiento y verificaciÃ³n en tierra de 12 perfiles obtenidos en un levantamiento aerogeofÃ­sico (magnÃ©tico, electromagnÃ©tico y radiomÃ©trico) realizado por INGEOMIN entre los aÃ±os 2007 y 2008, con la finalidad de determinar posible presencia de pipas kimberliticas. De estos doce perfiles verificados en tierra se pudo evidenciar la anomalÃ­a (magnÃ©tica, electromagnÃ©tica y/o radiomÃ©trica) en siete de ellos. Estos fueron propuestos para realizarles perfiles paralelos o cruzados a fin de delimitar la anomalÃ­a en forma y tamaÃ±o. De los siete perfiles seleccionados, se realizÃ³ el modelaje directo de pipas kimberlitas a tres perfiles con anomalÃ­as magnÃ©ticas negativas. Las pipas kimberlitas obtenidas en estos modelos se encuentran a profundidades superiores a 150m con respecto a la superficie, con diÃ¡metros cercanos a los 300m y una extensiÃ³n en profundidad mayor a los 450m. A partir del modelaje directo se determinÃ³ el espesor de la Provincia de Roraima al Nor- Este de la zona de estudio, el espesor mÃ¡ximo obtenido fue de 277m el cual disminuye en forma de cuÃ±a hacia el Sur-Oeste hasta llegar al borde del dique, ya que a partir del dique solo se afloran rocas de la Provincia GeolÃ³gica de Cuchivero.','2011-05-18','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',3,1,1,1,1,'2013-09-17 08:39:36','2013-09-17 08:39:36','Documento_598.pdf','application/pdf',12554441,'2013-09-17 08:39:36',20,0,268,'COMPLETO'),(592,'AnÃ¡lisis de los Procesos Electorales de Venezuela entrelos aÃ±os 1830 a 1860 y MÃ©todos MatemÃ¡ticosElectorales.','El objetivo principal de esta tesis de grado es el estudio y aplicaciÃ³n de mÃ©todos de reparto que permita convertir los votos en una decisiÃ³n final que sea mÃ¡s justa y coherente con los deseos del electorado y asÃ­ minimizar la injusticia electoral.Se da una breve reseÃ±a histÃ³rica de la evoluciÃ³n del Sistema Electoral Venezolano en la Ã©poca de 1830 - 1860, y una descripciÃ³n general del Sistema Electoral y el Sistema Electoral venezolano usando conceptos elementales, proporcionando defniciones claras.Para conocer los escaÃ±os que corresponden a cada uno de los distintos partidos o movimientos polÃ­ticos existen varios mÃ©todos de reparto que se han ido modificando a medida que se han conocido sus ventajas y sus inconvenientes en la prÃ¡ctica polÃ­tica.Se hace una descripciÃ³n matemÃ¡tica de los mÃ©todos de reparto mÃ¡s utilizados: El mÃ©todo de Hamilton, la regla de D\'Hontd, el mÃ©todo de Hare/ Niemeyer los cuales se ilustran con varios ejemplos que ayuda a comprender su funcionamiento y a seÃ±alar, al mismo tiempo, los diversos problemas que les son inherentes y los resultados paradÃ³jicos que pueden producir. Posteriormente, en la bÃºsqueda de un criterio para decidir cuÃ¡l de estos mÃ©todos es mÃ¡s adecuado, se propone la definiciÃ³n del concepto de injusticia introducida por Huntington. Se describen las principales caracterÃ­sticas del sistema electoral venezolano en los aÃ±os de 1830 y 1860 y se analizan los resultados obtenidos por estos mÃ©todos para esa fecha.Se estudia el problema de la construcciÃ³n de la funciÃ³n de decisiÃ³n social, se enuncian teoremas y definiciones necesarias para esta construcciÃ³n.','2011-05-19','MÃ©todo matemÃ¡ticos electorales.Sistema electoral',5,1,1,1,1,'2013-09-17 08:39:37','2013-09-17 08:39:37','Documento_599.pdf','application/pdf',2880983,'2013-09-17 08:39:37',20,0,97,'COMPLETO'),(593,'AnÃ¡lisis AnÃ¡lisis de los Procesos Electorales Entre los AÃ±os1870 a 1935, Caso Venezuela y MÃ©todosMatemÃ¡ticos Aplicados a Sistemas Electorales','En este trabajo especial de grado tenemos dos grandes vertientes en la parte metodolÃ³gica, como lo es parte histÃ³rica y la moderaciÃ³n electoral matemÃ¡tica. Como el proceso histÃ³rico estudiado corresponde a finales del siglo XIX y principios del siglo XX, la data estadÃ­stica de los participantes en los eventos electorales, asÃ­ como los resultados de este proceso no son de fÃ¡cil obtenciÃ³n, es por ello que en este trabajo no hacemos uso del modelo matemÃ¡tico electoral para comprender el proceso histÃ³rico estudiado. Sin embargo en particular en este trabajo se puede hacer una investigaciÃ³n minuciosa de estos datos y aplicarlo a los modelos correspondientes y obtener algunas informaciones relevantes. Otra observaciÃ³n es que hay algunas mÃ©todos electorales o herramientas electorales que se crean a mediado del siglo XX, como por ejemplo el teorema de Arrow, la nociÃ³n de injusticia electoral y la Ã©poca histÃ³rica estudiada es la del siglo anterior.','2011-05-19','MÃ©todos MatemÃ¡ticos Aplicados a Sistemas Electorales (1870 a 1935)',5,1,1,1,1,'2013-09-17 08:39:38','2013-09-17 08:39:38','Documento_600.pdf','application/pdf',2291953,'2013-09-17 08:39:38',20,0,150,'COMPLETO'),(594,'Interacciones Puntuales: Condiciones de Frontera o Potenciales Singulares que Usan la delta de Dirac','Estudiamos el problema de una partÃ­cula cuÃ¡ntica no-relativista sobre la lÃ­nea real conuna interacciÃ³n puntual en x= 0. Este tipo de sistema se puede describir de dos formas:quitando explÃ­citamente el punto x= 0; en cuyo caso la interacciÃ³n puntual queda determinada exclusivamente por condiciones de frontera, o bien, considerando explÃ­citamente lainteracciÃ³n singular por medio de un potencial singular distribucional. Determinamos lascondiciones de frontera que caracterizan a cada una de las interacciones puntuales e identificamoslos respectivos potenciales singulares que las definen. Nos concentramos en algunosejemplos representativos de interacciones puntuales y estudiamos sus correspondientes estadosligados.','2011-05-25','Interacciones Puntuales, MecÃ¡nica CuÃ¡ntica No-relativista, Condiciones de Frontera, Delta de Dirac, Potencial Singular Distribucional, Estados Ligados.',3,1,1,1,1,'2013-09-17 08:39:45','2013-09-17 08:39:45','Documento_601.pdf','application/pdf',0,'2013-09-17 08:39:45',20,0,0,'INCOMPLETO'),(595,'Funciones de H-VariaciÃ³n Acotada en un intervalo y un Teorema de RepresentaciÃ³n de Korenblum.','Este trabajo de grado consiste en presentar el uso de las Funciones de VariaciÃ³n Acotada al igual que ciertas propiedades de este espacio de funciones, las cuales permiten presentar y definir de manera explÃ­cita las Funciones de H-VariaciÃ³n Acotada en un intervalo y desarrollar de manera explÃ­cita el Teorema de RepresentaciÃ³n de Korenblum.','2011-05-19','H-VariaciÃ³n Acotada, Teorema de RepresentaciÃ³n de Korenblum',5,1,1,1,1,'2013-09-17 08:39:46','2013-09-17 08:39:46','Documento_602.pdf','application/pdf',1351088,'2013-09-17 08:39:46',20,0,150,'COMPLETO'),(596,'CARACTERIZACIÃ“Ã“NN GEOQUÃÃMMICA DE LOS SEDIMENTOS DISTALES HOLOCENOS D