nto del tamaÃ±o de grano en esa secciÃ³n e intercalaciones de sedimentos.','2011-05-05','GeoquÃƒÂ­mica, quimioestratigrafÃƒÂ­a, paleoclimatologÃƒÂ­a, paleosismoloÃƒÂ­a, Andes Venezolanos.',4,1,1,1,1,'2013-09-17 08:39:47','2013-09-17 08:39:47','Documento_603.pdf','application/pdf',565620,'2013-09-17 08:39:47',20,0,101,'COMPLETO'),(597,'DescripciÃ³Ã³nn ultraestructural y molecular del proceso de la muerte celular en Trypanosoma evansi','La tripanosomosis equina produce importantes pÃ©rdidas econÃ³micas en Venezuela por cuanto los caballos son ampliamente utilizados en las actividades de la ganaderÃ­a bovina extensiva. Esta afecciÃ³n estÃ¡ asociada a la presencia de Trypanosoma evansi en equinos y es denominada derrengadera en los llanos de nuestro paÃ­s. Las alteraciones ultraestructurales que sufren diferentes tejidos (corazÃ³n, hÃ­gado, medula espinal, musculo esquelÃ©tico, pÃ¡ncreas entre otros) asociados a la patologÃ­a de esta enfermedad han sido descritos en la Ãºltima dÃ©cada, no obstante la descripciÃ³n de los eventuales cambios que pudieran sufrir los tripomastigotes sanguÃ­neos de Trypanosoma evansi durante el proceso de muerte celular se desconocen tanto ultraestructuralmente como molecularmente. En los tejidos de mamÃ­feros se han descrito con bastante exactitud los procesos de necrosis y/o muerte celular programa, sin embargo es difÃ­cil discernir entre estos procesos en el caso de organismos unicelulares. Por ello el objetivo de este trabajo es describir a nivel ultraestructural y molecular los procesos de muerte celular que sufren estos microorganismos durante infecciones experimentales de murinos. Para ello se inoculÃ³ 1 tripomastigote/gr de peso corporal por vÃ­a intradÃ©rmica proveniente de una infecciÃ³n natural en Equus cabalus(Estado GuÃ¡rico)en ratones NMRI, Ã­nterdiariamente y hasta la muerte de los ratones se extrajo sangre de la vena caudal. Se proceso mediante tÃ©cnicas rutinarias de microscopÃ­a electrÃ³nica de transmisiÃ³n, los cortes se obtuvieron en un ultramicrotomo Porter-Blum MT2-B y se contrastaron con sales pesadas. Posteriormente Ã©stos fueron examinados con un microscopio electrÃ³nico de transmisiÃ³n Philips CM-10 (80 kV) y registrados permanente en negativos Kodak (8,3Â´10,2 cm; # 4489). La sangre colectada, ademÃ¡s, se procesÃ³ para obtener la respuesta parasitolÃ³gica de la infecciÃ³n, por medio de una adaptaciÃ³n del mÃ©todo original de Brener, y tambiÃ©n se determinaron las variables morfolÃ³gicas de los tripomastigotes por medio del protocolo de extendidos de sangre. Adicionalmente de los tripomastigotes fueron purificados por una columna de DEAE-celulosa y su ADN genÃ³mico fue aislado mediante la utilizaciÃ³n de un estuche comercial. Por Ãºltimo tanto el ADN genÃ³mico fue separados en geles de agarosa y visualizados a travÃ©s de un analizador de geles. Los resultados mostraron una heterogeneidad de alteraciones en los tripomastigotes que evidenciaban procesos de muerte celular activos, tanto a nivel morfolÃ³gico como genÃ©tico los tratamientos con droga y altas densidades poblacionales resultaron en daÃ±os asociables a diferentes tipos de muerte celular.','2011-05-20','Muerte celular, Trypanosoma evansi',1,1,1,1,1,'2013-09-17 08:39:49','2013-09-17 08:39:49','Documento_604.pdf','application/pdf',349553,'2013-09-17 08:39:49',20,0,51,'COMPLETO'),(598,'\"\"Ultraestructura del mÃºÃºssculo esquelÃ©Ã©tico en pacientes con Tiroiditis\"\"','La presente investigaciÃ³n evaluÃ³ la relaciÃ³n entre patologÃ­as de tipo autoinmune, como lo es la tiroiditis y analizar los efectos ultraestructurales de esta enfermedad sobre la musculatura esquelÃ©tica de humanos. Para ello se estudiaron diez pacientes con diagnÃ³stico de Tiroiditis LinfocÃ­tica CrÃ³nica, diagnosticada previamente por biopsia de la glÃ¡ndula tiroidea. A estos pacientes a nivel mÃ©dico se les efectuaron distintos estudios, haciendo Ã©nfasis en la bÃºsqueda de los sÃ­ntomas y signos de afecciÃ³n muscular; asÃ­ mismo se explorarÃ¡ la condic