a, quimioestratigrafÃƒÂ­a, paleoclimatologÃƒÂ­a, paleosismologÃƒÂ­a, Andes Venezolanos.',4,1,1,1,1,'2013-09-17 08:39:54','2013-09-17 08:39:54','Documento_607.pdf','application/pdf',1746485,'2013-09-17 08:39:54',20,0,129,'COMPLETO'),(601,'AnÃ¡lisis y procesos electorales entre los aÃ±os 1935 a2009, caso Venezuela y mÃ©todos matemÃ¡ticos aplicadosa sistemas electorales.','En democracia, se realizan procesos de elecciÃ³n de diversos puestos de representaciÃ³n pÃºblica,tales como presidente, gobernadores, alcaldes, diputados, concejales, entre otros. Estos procesos sonconocidos como procesos electorales. En ellos intervienen diferentes actores como lo son: los electores,los candidatos, los partidos, los medios de comunicaciÃ³n y las autoridades que organizan el proceso.Teniendo un rol de gran magnitud las autoridades, ya que ellos deben regir los procedimientos parala conformaciÃ³n de la lista de electores, las normas para la realizaciÃ³n de las campaÃ±as, la instalaciÃ³nde los lugares de votaciÃ³n, la emisiÃ³n y conteo de los sufragios, la resoluciÃ³n de los conflictos quese presenten antes y despuÃ©s del acto electoral. Cuando se efectÃºan elecciones para la reparticiÃ³nde uno o mÃ¡s cargos, la conversiÃ³n de votos en escaÃ±os se puede hacer utilizando un mÃ©todo dereparto. Dicho mÃ©todo se encargarÃ­a de distribuir un nÃºmero de escaÃ±os a cada partido de maneraproporcional, es decir, a cada partido se le asignarÃ­a un porcentaje de los cargos dependiendo de lacantidad de votos que haya obtenido en el acto.','2011-05-19','MÃƒÂ©tododos electorales',5,1,1,1,1,'2013-09-17 08:39:56','2013-09-17 08:39:56','Documento_608.pdf','application/pdf',3692576,'2013-09-17 08:39:56',20,0,98,'COMPLETO'),(602,'Estudio geoquÃ­mico exploratorio de los sedimentos superficiales del delta del rÃ­o Mitare, estado FalcÃ³n','El presente trabajo se realizÃ³ con el objetivo de conocer las caracterÃ­sticas geoquÃ­micas de los sedimentos superficiales del delta del rÃ­o Mitare. El mismo se define como un estudio exploratorio que permitiÃ³, de manera general, conocer los procesos geoquÃ­micos que condicionan la abundancia, distribuciÃ³n y migraciÃ³n de distintos elementos en este ambiente, dar un aporte a la interpretaciÃ³n de la evoluciÃ³n geolÃ³gica reciente del Ã¡rea y obtener una visiÃ³n del posible efecto que tienen las actividades humanas sobre el sistema. Para lograr el objetivo propuesto se le aplicÃ³ un tratamiento fÃ­sico (secado y tamizado en seco) y quÃ­mico a un conjunto de 30 muestras de sedimentos tamaÃ±o lodo (<62,5Âµm), que consistiÃ³ en: fusiÃ³n alcalina con boratos y extracciÃ³n secuencial Ã¡cida en dos etapas (HCl 1M y HNO3concentrado). Se determinaron fases quÃ­micas (Al, Ca, Fe, Mg, Si, Na, K, Ti, Mn, Ba, Pb, Zr, Co y Cr) a travÃ©s de las tÃ©cnicas EEO-IAP y EEA-Llama, fases mineralÃ³gicas por medio de DRX y la concentraciÃ³n de mercurio total. Mediante el empleo de herramientas de la estadÃ­stica paramÃ©trica (bivariada y multivariada), se obtuvo que los procesos clÃ¡sticos, carbonÃ¡ticos y evaporÃ­ticos son los que controlan la distribuciÃ³n geoquÃ­mica global en el sistema, y que existen diferencias estadÃ­sticamente significativas entre el Ã¡rea de influencia del delta (planicie costera) y el ambiente fluviodeltaico, enmarcadas por el efecto dominante de los procesos evaporÃ­ticos en el Ã¡rea de influencia. A partir de la interpretaciÃ³n de resultados y grÃ¡ficos relacionados con la geoquÃ­mica sedimentaria, se propone que los principales procesos sedimentolÃ³gicos, que determinan las propiedades tanto granulomÃ©tricas como geoquÃ­micas de este sistema son los fluviales y eÃ³licos y se obtuvo que las secciones de grano fino de la Cuenca Central de FalcÃ³n (material candidato a referencia MCAF) reÃºnen las mismas caracterÃ­sticas composicionales que las muestras de estudio. Adicionalmente se obtuvo que las concentraciones de la mayorÃ­a de los metales estudiados, se encuentran por debajo de las correspondientes a sistemas poco contaminados, muy contaminados y materiales de referencia internacional, sin embargo, las concentraciones de mercurio se presentan en una relaciÃ³n tres veces superior a la correspondiente a MCAF, como referencia de la fuente de sedimentos, por lo que se plantea como recomendaciones hacer un estudio detallado de la distribuciÃ³n de mercurio en esta zona, que involucre un muestreo sistemÃ¡tico y que se considere la escala temporal y por otro lado, que se evalÃºe el efecto que tienen sobre el sistema las actividades industriales que se desarrollan en zonas aledaÃ±as.','2011-03-02','GeoquÃƒÂ­mica, sedimentos, geoquÃƒÂ­mica sedimentaria, geoquÃƒÂ­mica ambiental, delta del rÃƒÂ­o Mitare, FalcÃƒÂ³n',4,1,1,1,1,'2013-09-17 08:39:58','2013-09-17 08:39:58','Documento_609.pdf','application/pdf',5221680,'2013-09-17 08:39:58',19,0,91,'COMPLETO'),(603,'CaracterizaciÃ³n estructural y magnÃ©tica del sistema Nd((11-- y))SmyMn((11--x))FexO33 sintetizado por el mÃ©todo Sol--Gel','Se sintetizaron muestras nanocristalinas del tipo perovskita pertenecientes al sistema Nd(1-y)SmyMn(1- x)FexO3 por medio del mÃ©todo sol-gel de polimeraciÃ³n de nitratos-Ã¡cido cÃ­trico para las siguientes concentraciones (x=0; y=0), (x=1; y=1), (x=0; y=1), (x=1; y=0), (x=0,25; y=0,5), calcinadas en un horno tubular convencional a temperaturas de 600 oC, 900 oC y 1200 oC. La caracterizaciÃ³n estructural, en las diferentes muestras, fue realizada a travÃ©s de la tÃ©cnica de difracciÃ³n de Rayos X (DRX) en polvo, encontrÃ¡ndose que el compuesto Nd0,75Sm0,25Mn0,5Fe0,5O3 presentÃ³ una mezcla de fases de las especies precursoras en forma de ferritas y manganitas aproximÃ¡ndose a una estructura ortorrÃ³mbica tipo Pbnm. Mientras que en el resto de las concentraciones crecidas a temperaturas de 900 oC y 1200 oC se encontrÃ³ una Ãºnica fase correspondiente a una estructura ortorrÃ³mbica. MicrografÃ­as realizadas al sistema Nd(1-y)SmyMn(1-x)FexO3por medio de la microscopÃ­a electrÃ³nica de transmisiÃ³n (MET), presentaron la formaciÃ³n de nanopartÃ­culas de dimensiones menores a 80nm, especialmente en ferritas calcinadas a altas temperaturas (900 oC y 1200 oC), ademÃ¡s de presentar una morfologÃ­a bien definida y homogÃ©nea. Las medidas de resonancia paramagnÃ©tica electrÃ³nica (RPE) mostraron que el sistema Nd(1-y)SmyMn(1-x)FexO3 en todas las concentraciones presenta un factor giromagnÃ©tico alrededor de 2 a temperatura ambiente. Los anÃ¡lisis realizados del comportamiento del ancho de linea DHpp en los espectros de RPE como funciÃ³n de la temperatura se determinÃ³ el parÃ¡metro de la temperatura de Curie-Weiss y de la temperatura de congelamiento de transiciones de fase paramagnÃ©tica a la fase de vidrio espÃ­n. Los resultados de la magnetometrÃ­a de muestra vibrante (MMV) realizados a temperatura ambiente mostraron que el sistema Nd(1-y)SmyMn(1-x)FexO3 en todas las concentraciones presenta un campo coercitivo bajo y poca magnetizaciÃ³n remanente lo cual es caracterÃ­stico de sistemas nanomÃ©tricos .','2010-12-08','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',3,1,1,1,1,'2013-09-17 08:40:00','2013-09-17 08:40:00','Documento_610.pdf','application/pdf',1758411,'2013-09-17 08:40:00',19,0,48,'COMPLETO'),(604,'ESTUDIO DE MICOBACTERIAS ATÃPICAS Y SU RELACIÃ“N CON LA SUSCEPTIBILIDAD A LOS DESINFECTANTES DE AMONIO CUATERNARIO','Las micobacterias atÃ­picas son todas aquellas que no pertenecen al Complejo M.. tuberculosis o M.. leprae. Estas micobacterias se encuentran ampliamente distribuidas en el medio ambiente, fundamentalmente en el agua y la tierra, por lo tanto pueden llegar a ser causantes de infecciones oportunistas asociados principalmente a pacientes inmunocompetentes e inmunocomprometidos. Las micobacterias son reconocidas por su alta resistencia a la desinfecciÃ³n, siendo esta propiedad consecuencia de la presencia de una pared celular compuesta por un alto contenido lipÃ­dico y de Ã¡cidos micÃ³licos que actÃºan como barrera de protecciÃ³n frente a agentes quÃ­micos. Diferentes publicaciones indican que una desinfecciÃ³n inefectiva o el uso de desinfectantes inadecuados pueden ser una posible explicaciÃ³n para infecciones producidas por micobacterias en procedimientos quirÃºrgicos o cosmÃ©ticos, debido al uso comÃºn de estos en hospitales y consultorios en Venezuela para la desinfecciÃ³n de materiales, ya que se encuentran registrados como productos esterilizantes y/ o tuberculicidas.Debido a que las micobacterias ocasionan un verdadero problema de salud pÃºblica, este trabajo tuvo como objetivos la confirmaciÃ³n de las identidades de las micobacterias atÃ­picas: M.. simiae,, M.. abscessus C,, M.. chelonae,, M.. fortuitum,, M.. kansasii,, M.. gordonae,, M.. mucogenicum,, M.. cosmeticum,, M.. scrofulaceum,, M.. peregrinum,, M.. phlei,, M.. lentiflavum,, M.. flavescens,, M.. massiliense,, M.. intracellulare,, M.. sherrisii,, M.. marinum, M.. bovis BCG y M.. abscessus, mediante la tÃ©cnica de PRA hsp6655. Los resultados obtenidos indican que con esta tÃ©cnica de identificaciÃ³n no fue posible confirmar las identidades de las muestras suministradas por el Laboratorio de Tuberculosis de Biomedicina, debido a las diferencias entre los patrones de restricciÃ³n obtenidos y los asignados a esas especies en la base de datos del PRAsite, razÃ³n por la cual se procediÃ³ a la secuenciaciÃ³n de los genes 16S ARNr y rpoB..Por otro lado, se determinÃ³ la frecuencia de selecciÃ³n de sobrevivientes a dos compuestos de amonio cuaternario (BLDBA y CTAB) a travÃ©s del mÃ©todo de diluciÃ³n - neutralizaciÃ³n. Los resultados indican que las especies pertenecientes al complejo M.. abscessus - chelonae,resultaron tener una alta frecuencia de selecciÃ³n de sobrevivientes al estar en contacto con estos compuestos. TambiÃ©n se obtuvo una alta frecuencia de selecciÃ³n de sobrevivientes en las siguientes especies de micobacterias: M.. timonense (colonia resistente 1 y 2), M.. senegalense, M.. abscessus C, M.. massiliense, M.. marinum, M.. abscessus (colonia resistente 1 y 2), M.. bovis BCG, a los 20 minutos y a las 1 hora de exposiciÃ³n, sin encontrar algÃºn sobreviviente despuÃ©s de 24 horas de exposiciÃ³n a excepciÃ³n de M.. bovis BCG. Estos resultados seÃ±alan que la susceptibilidad de las micobacterias atÃ­picas a los compuestos de amonio cuaternario BLDBA y CTAP varÃ­a entre especies, asÃ­ como tambiÃ©n dentro de la misma especie.','2011-05-25','Micobacteria atÃ­picas, compuestos de amonio cuaternario, identificaciÃ³n de micobacterias atÃ­picas, resistencia.',1,1,1,1,1,'2013-09-17 08:40:01','2013-09-17 08:40:01','Documento_611.pdf','application/pdf',756767,'2013-09-17 08:40:01',19,0,68,'COMPLETO'),(605,'Sistema de Gestion de Incidentes y de Problemas para los servicios prestados por la Corporacion Suiche 77B','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} El presente trabajo expone fundamentos conceptuales, metodolÃ³gicos y de implementaciÃ³n que resumen la investigaciÃ³n del Trabajo Especial de Grado realizado con el objetivo de desarrollar una aplicaciÃ³n Web para la CorporaciÃ³n Suiche 7B C.A. que permita a las diferentes instituciones bancarias registrar cualquier tipo de incidente o problema que se haya presentado en algunos de los servicios prestados por la corporaciÃ³n. El sistema en cuestiÃ³n permitirÃ¡ el registro y manejo de incidentes y problemas, todo bajo la filosofÃ­a de registro de eventos y tickets respectivamente, pero a parte de ello tambiÃ©n se tendrÃ¡ la posibilidad de crear una base de conocimientos de incidentes y problemas recurrentes, lo cual es primordial para casos futuros con las mismas caracterÃ­sticas. Por otra parte se ayudara a tener estadÃ­sticas de todos los problemas e incidencias presentadas, asÃ­ como tambiÃ©n indicadores acerca de la eficacia con respecto al tiempo de atenciÃ³n de los problemas. Para alcanzar estos objetivos se aplicÃ³ un mÃ©todo basado en el MA (Modelado Ãgil), detallando las etapas de problema o especificaciÃ³n de requerimientos, anÃ¡lisis, diseÃ±o, implementaciÃ³n y verificaciÃ³n / pruebas. Se obtuvo como resultado una aplicaciÃ³n Web para el manejo del personal de las diferentes bancos clientes, para el personal de la Gerencia de Operaciones de la CorporaciÃ³n Suiche 7B, y para los operadores de IBM; convirtiÃ©ndose asÃ­, en la aplicaciÃ³n fundamental para determinar los niveles de eficiencia de los servicios prestados por la empresa.','2011-05-26','v:* {behavior:url(#default#VML);} o:* {behavior:url(#default#VML);} w:* {behavior:url(#default#VML);} .shape {behavior:url(#default#VML);} Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-nam',2,1,1,1,1,'2013-09-17 08:40:02','2013-09-17 08:40:02','Documento_612.pdf','application/pdf',744058,'2013-09-17 08:40:02',20,0,50,'COMPLETO'),(606,'DistribuciÃ³n y acumulaciÃ³n de carbono en clases de tamaÃ±os contrastantes de partÃ­culas de sedimentos provenientes del Glaciar Collins, Isla Rey Jorge, continente AntÃ¡rtico','El presente trabajo plantea como objetivo general, estudiar la distribuciÃ³n y acumulaciÃ³n de carbono en clases de tamaÃ±os de partÃ­culas de sedimentos provenientes del glaciar Collins, Isla Rey Jorge en el continente AntÃ¡rtico. Para esto fueron recolectadas 12 muestras de sedimentos, separadas posteriormente en 9 clases de tamaÃ±os de partÃ­culas: grava, arena muy gruesa, arena gruesa, arena media, arena fina, arena muy fina, limo grueso, limo fino y arcilla.Cada una de las clases de tamaÃ±os de partÃ­culas fueron sometidas a un anÃ¡lisis termogravimÃ©trico (105 Â°, 450Â°, 550Â° y 750Â°) y luego se procediÃ³ a realizar la determinaciÃ³n de carbono orgÃ¡nico mediante el mÃ©todo de titulaciÃ³n de Walkley-Black.Los resultados obtenidos indican que existen diferencias en cuanto a la granulometrÃ­a de cada una de las muestras por lo cual se observan dos tendencias claras: una con un tamaÃ±o promedio de partÃ­culas correspondiente a arenas (6 muestras) y otro con tamaÃ±o promedio de gravas (6 muestras). Al comparar las clases de tamaÃ±os contrastantes de partÃ­culas para cada una de las muestras, se observa un mayor contenido de carbono en las fracciones mÃ¡s finas.En general para la zona de estudio, se tiene una concentraciÃ³n mÃ¡xima de carbono orgÃ¡nico de 0,61%, de carbono inorgÃ¡nico de 0,22% y de carbono total de 0,78%. Estos valores pertenecen a la muestra AM7, la cual fue recolectada en la parte superior de la morrena adyacente al glaciar Collins.','2011-05-23','Glaciar Collins, AntÃ¡rtida, carbono, clases de tamaÃ±os contrastantes de partÃ­culas',6,1,1,1,1,'2013-09-17 08:40:03','2013-09-17 08:40:03','Documento_613.pdf','application/pdf',736185,'2013-09-17 08:40:03',20,0,56,'COMPLETO'),(607,'AutomatizaciÃ³n de un Sistema de Control de Temperatura para un Horno de Microondas','Se diseÃ±Ã³ un sistema electrÃ³nico-computacional, para el control del calentamiento de muestras dentro de un horno de microondas domÃ©stico. El sistema consta de un circuito electrÃ³nico que cumple la funciÃ³n de un control de acciÃ³n ON-OFF en lazo cerrado. Al aplicarle el programa diseÃ±ado para su automatizaciÃ³n, se le agregÃ³ un control de acciÃ³n proporcional derivativo, mejorando asÃ­ el control sobre la temperatura. Se creÃ³ una interfaz grÃ¡fica que permite la interacciÃ³n entre el usuario y el sistema electrÃ³nico, facilitando el registro de la temperatura en el tiempo, asÃ­ como el trabajo al operador del equipo. Este programa tambiÃ©n es capaz de crear una curva teÃ³rica de calentamiento y visualizar grÃ¡ficamente las temperaturas medidas durante el transcurso de un experimento. El sistema de control automatizado, fue sometido a diferentes pruebas en dos tipos de sistema fÃ­sico diferentes, en las cuales se muestra que efectivamente el sistema desarrollado cumple la funciÃ³n de controlar la temperatura. Observando, grÃ¡ficamente el comportamiento de la temperatura en el tiempo hallamos que, tanto la inercia tÃ©rmica de las muestras como la del sistema fÃ­sico, son factores que deben tomarse en cuenta para poder diseÃ±ar una curva teÃ³rica que pueda ser seguida por el control del sistema fÃ­sico, lo cual ayuda a obtener los resultados que se espera, en cada experimento.','2011-05-24','Horno de Microondas, Sistema de Control de Temperatura.',3,1,1,1,1,'2013-09-17 08:40:04','2013-09-17 08:40:04','Documento_614.pdf','application/pdf',493064,'2013-09-17 08:40:04',18,0,98,'COMPLETO'),(608,'Sobre perspectiva y homologÃ­a de imÃ¡genes','Estudio y aplicaciones de la perspectiva lineal y la homologÃ­a sobre imÃ¡genes digitales.','2010-12-09','HomolÃ³gia, perspectiva lineal, imÃ¡genes digitales',5,1,1,1,1,'2013-09-17 08:40:05','2013-09-17 08:40:05','Documento_615.pdf','application/pdf',421486,'2013-09-17 08:40:05',19,0,57,'COMPLETO'),(609,'Cuantizacion a la Dirac de una Teoria Topologica Abeliana','Partiendo de una teoria topologica Abeliana se estudia sus propiedades (ecuaciones de movimiento , invariancia de calibre , invariantes de nudos generados). Se introduce una accion de tipo B-F para eliminar la no-localidad existente en la accion inicial y se realiza la cuantizacion canonica siguiendo el metodo de Dirac para la cuantizacion de lagrangianos singulares.Se procede a cuantizar la teoria B-F. Se introducen ciertas corrientes geometricas asociadas a los campos y se calcula el Hamiltoniano on-shell de manera de obtener ciertos invariantes de curvas que son interpretados geometricamente.','2011-05-26','Cuantizacion de Dirac, lagrangianos Singulares, Invariantes de Nudo, teorias de Chern-Simons, Modelos tipo B-F.',3,1,1,1,1,'2013-09-17 08:40:07','2013-09-17 08:40:07','Documento_616.pdf','application/pdf',8075144,'2013-09-17 08:40:07',19,0,62,'COMPLETO'),(610,'Estudio in vitro de la actividad anti-inflamatoria y citotÃ³xica de fracciones derivadas de hojas de Jacaranda copaia.','El cÃ¡ncer es una enfermedad fundamentalmente caracterizada por el crecimiento incontrolado de las cÃ©lulas debido a varios factores. Su fisiopatologÃ­a bÃ¡sica comprende aberraciones en cualquier punto de la maquinaria molecular que gobierna el ciclo celular, causando mutaciones que les confieren a la cÃ©lula ciertas caracterÃ­sticas como ser autosuficientes en seÃ±ales de crecimiento, ser insensibles a seÃ±ales inhibitorias de crecimiento, evadir la apoptosis, replicarse ilimitadamente, generar angiogÃ©nesis y ser capaz de invadir otros Ã³rganos generando metÃ¡stasis. Hoy dÃ­a se sabe que existe una relaciÃ³n funcional entre la inflamaciÃ³n crÃ³nica y el cÃ¡ncer, ya que ciertas cÃ©lulas del sistema inmunitario tales como macrÃ³fagos, cÃ©lulas NK, linfocitos T, granulocitos y mastocitos, son componentes prominentes del tejido maligno y contribuyen funcionalmente al desarrollo del cÃ¡ncer debido a la producciÃ³n de potentes mediadores solubles que regulan la proliferaciÃ³n, migraciÃ³n celular, angiogÃ©nesis, etc. Se ha demostrado que drogas anti- inflamatorias pueden ejercer un efecto anti-tumoral, y estas drogas pueden ser derivadas de plantas naturales. Por esta razÃ³n, nos hemos planteado el objetivo de evaluar la actividad citotÃ³xica y anti-inflamatoria del extracto crudo, fracciones, subfracciones y compuestos derivados de hojas de Jacaranda copaia. Existen resultados que indican que un extracto de J.. copaia puede inhibir el crecimiento tumoral en un modelo de cÃ¡ncer en ratÃ³n. Se realizaron ensayos in vitro de citotoxicidad mediante la tÃ©cnica de Sulforodamina B y por MTS/PMS. Debido a la posibilidad de que la planta pueda ejercer un efecto anti-tumoral a travÃ©s de un efecto anti-inflamatorio, se midieron mediante ensayos in vitro el efecto de J.. copaia sobre dos mediadores pro-inflamatorios como los son el Ã“xido NÃ­trico (NO) y el Factor de Necrosis Tumoral alfa (TNF-a), y tambiÃ©n sobre el Factor Nuclear kappa Beta (NF-kB). Los resultados obtenidos en este estudio reflejan que la fracciÃ³n E2 derivada de hojas de J.. copaia fue citotÃ³xica a altas concentraciones en las lÃ­neas celulares tumorales HT-29, 4T1, y en cÃ©lulas macrofÃ¡gicas RAW 264.7. No obstante, el extracto crudo, la fracciÃ³n E2 y los compuestos aislados de hojas de J.. copaia mostraron efecto citostÃ¡tico sobre las cÃ©lulas HT-29, 4T1, HeLa y RAW. En cuanto al estudio de la actividad anti-inflamatoria de J.. copia, se observÃ³ que el extracto crudo, la fracciÃ³n E2, la subfracciÃ³n E2II y el compuesto A aislado de hojas de J.. copaia mostraron un ligero efecto inhibitorio sobre la producciÃ³n de la citocina TNF-a en macrÃ³fagos RAW 264.7. Por otro lado, J.. copaia mostrÃ³ un mayor efecto inhibitorio dosis dependiente a partir de 0,3 Âµg/mL sobre la producciÃ³n de NO en presencia del extracto crudo, fracciÃ³n E2, subfracciÃ³n E2II y compuesto A. Sin embargo, sÃ³lo se observÃ³ efecto inhibitorio de la activaciÃ³n de NF-kB en presencia del extracto crudo y la fracciÃ³n E2 a partir de 30 Âµg/mL. Estos resultados no son atribuibles a un efecto citotÃ³xico directo sobre las cÃ©lulas macrofÃ¡gicas. AdemÃ¡s de evaluar el efecto citotÃ³xico y anti- inflamatorio de J.. copaia se determinÃ³ que los compuestos aislados en este estudio son derivados de Ã¡cido cafeico, y se ha demostrado en diferentes investigaciones que el Ã¡cido cafeico y sus derivados poseen actividad anti- inflamatoria entre otras. Los resultados sugieren que compuestos activos de la planta J.. copaia pudieran ejercer un efecto anti-tumoral, no directamente sobre las cÃ©lulas tumorales, sino indirectamente a travÃ©s de un efecto inhibitorio sobre el componente inflamatorio que apoya el crecimiento tumoral.','2011-05-19','Jacaranda copaia, anti-inflamatorio, citotÃ³xico, TNF-a, NO, NF-kB',1,1,1,1,1,'2013-09-17 08:40:08','2013-09-17 08:40:08','Documento_617.pdf','application/pdf',971638,'2013-09-17 08:40:08',19,0,94,'COMPLETO'),(611,'Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin;} ComparaciÃ³n de mÃ©todos para el aislamiento de Micobacterias No Tuberculosas (MNT) a partir de muestras de agua de Venezuela.','Normal 0 21 false false false ES-VE X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin;} Las micobacterias (del gÃ©nero Mycobacterium) son un grupo de organismos muy heterogÃ©neos en tÃ©rminos de metabolismo, tiempo de crecimiento, nicho ambiental, epidemiologÃ­a, patogenicidad y distribuciÃ³n geogrÃ¡fica. Son bacterias Ã¡cido resistentes que presentan una pared celular rica en lÃ­pidos y Ã¡cidos micÃ³licos que les otorgan gran hidrofobicidad, adherencia superficial, capacidad de formar biopelÃ­culas, adherencia superficial, asÃ­ como resistencia a ciertos desinfectantes y antibiÃ³ticos. Desde el punto de vista clÃ­nico las micobacterias se dividen en patÃ³genos estrictos, patÃ³genos oportunistas y saprÃ³fitas. Actualmente se han descrito mÃ¡s de 140 especies de micobacterias de las cuales la mayorÃ­a pertenecen al grupo de las denominadas Micobacterias No Tuberculosas (MNT) o micobacterias atÃ­picas, tÃ©rmino que fue propuesto para hacer referencia a aquellas micobacterias que no pertenecen al complejo M.. tuberculosis o M.. leprae. Las MNT han sido reportadas en los Ãºltimos aÃ±os como patÃ³genos emergentes y causantes de cuadros clÃ­nicos diferentes en sÃ­ntomas y tratamiento a la tuberculosis (TB) que en conjunto se denominan \"micobacteriosis\" y que en la gran mayorÃ­a se encuentran condicionadas al virus del SIDA y asociadas a pacientes inmunocomprometidos. Se ha aceptado que la fuente de transmisiÃ³n es el ambiente (fundamentalmente el agua y el suelo) debido a que la transmisiÃ³n persona persona es rara. El aislamiento de MNT requiere del uso de mÃ©todos de descontaminaciÃ³n y de medios selectivos que por lo general derivan de los empleados en el diagnÃ³stico de la TB. En este sentido comparamos un grupo de agentes quÃ­micos descontaminantes (Cloruro de Hexadecil Piridinium Ã³ HPC al 0.05% y 0.75%, NaOH al 2% y 4%, Ã¡cido oxÃ¡lico al 5% y Ã¡cido sulfÃºrico 6%) para evaluar el porcentaje de recuperaciÃ³n frente a aislados clÃ­nicos de especies representativas de MNT (M.. abscessus,, M.. fortuitum,, M.. mucogenicum,, M.. kansasii,, M.. marinum.. M..avium y M.. simiae) y asÃ­ determinar el mejor mÃ©todo de descontaminaciÃ³n que luego se empleÃ³ en el procesamiento de muestras de agua recolectadas en diversas regiones de Venezuela. Posteriormente los aislados fueron identificados con la tÃ©cnica molecular PRA-hsp6655. Los resultados obtenidos en nuestro estudio demuestran que existe una variable sensibilidad de las MNT utilizadas ante los agentes quÃ­micos descontaminantes y que al parecer depende del tiempo de crecimiento (rÃ¡pido o lento) de las especies. Sin embargo HPC al 0.05% demostrÃ³ ser el que obtuvo un mayor porcentaje de recuperaciÃ³n para todas las especies evaluadas; mientras que NaOH al 2% y 4% y Ã¡cido sulfÃºrico al 6% demostraron ser los agentes con menores porcentajes de recuperaciÃ³n comprometiendo seriamente la viabilidad de las MNT ensayadas. En cuanto al procesamiento de las muestras de agua se obtuvo una mayor tasa de muestras positivas, menor tasa de contaminaciÃ³n y mayor diversidad de especies de MNT cuando se empleo el mÃ©todo de HPC al 0.05% que cuando se uso el mÃ©todo de Ã¡cido oxÃ¡lico al 5% lo cual fue demostrado significativamente mediante un anÃ¡lisis de Chi-Cuadrado (c2). Sin embargo con el mÃ©todo de Ã¡cido oxÃ¡lico al 5% se obtuvo en promedio un mayor nÃºmero de unidades formadoras de colonias (UFC) que con HPC al 0.05%. Con la tÃ©cnica de PRA-hsp6655se identificaron correctamente a nivel de especie todos los aislados obtenidos de las muestras de agua a excepciÃ³n de uno que probablemente se trate de una nueva especie. De igual forma encontramos una gran diversidad de especies de MNT en nuestro estudio siendo M.. fortuitum,, M.. peregrinum y M..abscessuslas mÃ¡s abundantes. Nosotros concluimos que este trabajo aporta valiosa informaciÃ³n de aspecto clÃ­nico que puede ser utilizada para determinar la fuente de infecciÃ³n de micobacteriosis cuyos casos han aumentado en la poblaci