Ã±o Escolar, Personal, Materias, Inscripciones, Secciones, Notas, PersonalizaciÃ³n, Grados y Menciones y Reportes. AdemÃ¡s de la autenticaciÃ³n de diferentes tipos de usuario. El Sistema fue desarrollado en Microsoft Visual Studio 2010 en lenguaje ASP .NET 4.0, con una Base de Datos desarrollada en Microsoft SQL SERVER 2008, un Web Role desarrollado en Microsoft Visual Studio que permite la traducciÃ³n del proyecto para poder ser migrado a la plataforma Windows Azure.','2011-05-30','Ã¢Â€Â¢ Cloud Computing Ã¢Â€Â¢ Windows Azure Ã¢Â€Â¢ SCEA Ã¢Â€Â¢ SQL Azure Ã¢Â€Â¢ Microsoft Visual Studio 2010 Ã¢Â€Â¢ ASP .NET Ã¢Â€Â¢ Web Role Ã¢Â€Â¢ SQL Server 2008 Ã¢Â€Â¢ IIS 7.0 Ã¢Â€Â¢ EducaciÃƒÂ³n BÃƒÂ¡sica Ã¢Â€Â¢ EducaciÃƒÂ³n Media Ã¢Â€Â¢ InstituciÃƒÂ³',2,1,1,1,1,'2013-09-17 08:40:14','2013-09-17 08:40:14','Documento_620.pdf','application/pdf',3543972,'2013-09-17 08:40:14',20,0,0,'INCOMPLETO'),(614,'DiseÃ±o y Desarrollo de una Fuente de Corriente de Alta TensiÃ³n para fines GeoelÃ©tricos','En este trabajo se desarrollo una fuente de corriente continua de alto voltaje para fines geoelÃ©ctricos. Ã‰sta es capaz de suministrar una corriente mÃ¡xima de 1,1A y un voltaje de salida variable, que depende de la corriente, pudiendo llegar hasta 1100V. Para el diseÃ±o del prototipo, se realizÃ³ un estudio detallado de la fuente desarrollada por el profesor Alfonso Benavides, la cual presentaba algunas deficiencias referentes a seguridad y a la mediciÃ³n de la corriente de salida. Con la finalidad de mejorar estas deficiencias se desarrollÃ³ un sistema de encendido/apagado y cambio de polaridad controlado de manera remota desde un computador y un sistema de descarga de los condensadores de la etapa de filtrado evitando asÃ­ posibles descargas elÃ©ctricas al usuario, de manera que su manipulaciÃ³n es realizada en un ambiente seguridad. En relaciÃ³n a la mediciÃ³n, se desorrollÃ³ un sistema de adquisiciÃ³n de datos digitales y se sustituyo el sensor inductivo utilizado para medir la corriente de salida de la fuente, por un sensor de basado en el Efecto Hall, cuyo comportamiento es lineal y que facilita el proceso de calibraciÃ³n del sistema. Se incorporÃ³ ademÃ¡s un sistema limitador de corriente, que funciona como protecciÃ³n de la fuente y evita el ajuste manual del voltaje de salida.','2011-05-26','Fuente, metodos geoelÃ©ctricos, instrumentaciÃ³n',3,1,1,1,1,'2013-09-17 08:40:18','2013-09-17 08:40:18','Documento_621.pdf','application/pdf',2280480,'2013-09-17 08:40:18',18,0,128,'COMPLETO'),(615,'Leishmaniasis CutÃ¡nea Experimental: Efecto del AntibiÃ³tico CatiÃ³nico Esteroideo CSA-13 sobre la evoluciÃ³n de las lesiones.','La Leishmaniasis es una enfermedad parasitaria de alta incidencia en los paÃ­ses tropicales. En los Ãºltimos aÃ±os se ha evidenciado una disminuciÃ³n en la eficacia de las drogas empleadas para su tratamiento, debido al desarrollo de resistencia por parte del parÃ¡sito a estas drogas y a la elevada toxicidad que estas inducen en el paciente. Por lo tanto, es necesario trabajar en la bÃºsqueda de nuevos agentes terapÃ©uticos con actividad leishmanicida, contra los cuales el parÃ¡sito no desarrolle resistencia, que sean de bajo costo y que no produzcan efectos secundarios severos en el paciente. En este sentido, se planteÃ³ evaluar en un modelo mÃºrido experimental susceptible a la leishmaniasis cutÃ¡nea, el efecto del CSA-13 sobre la evoluciÃ³n de las lesiones. Para ello se procediÃ³ a infectar ratones hembras BALB/c de 6 semanas de edad con 103 amastigotes de Leishmania (L.) mexicana (MHOM/BZ/BEL21) aislados de lesiones cutÃ¡neas de hÃ¡mster. A la semana 3 post-infecciÃ³n se aplicÃ³ el CSA-13 (4, 8, 16, 32, 54, 72, 5x103 y 10x103ng/gr peso/dÃ­a) subcutÃ¡neamente, intralesional. Se empleÃ³ como tratamiento control Miltefosina (2x104 ng/gr peso/dÃ­a) durante 21 dÃ­as consecutivos. La respuesta al tratamiento se evaluÃ³ midiendo semanalmente el tamaÃ±o de la lesiÃ³n cutÃ¡nea mediante morfometrÃ­a digital y estimaciÃ³n de la carga parasitaria a travÃ©s de la tÃ©cnica de diluciones limitantes, adicionalmente se evaluÃ³ la Influencia de los tratamientos sobre el peso de los ratones BALB/c infectados con L..(L..) mexicana y se realizaron anÃ¡lisis de quÃ­mica sanguÃ­nea. Se observÃ³ disminuciÃ³n en el tamaÃ±o de las lesiones cutÃ¡neas en el grupo de ratones infectados y tratados con 4, 8, 16 y 32 ng/gr peso/dÃ­a; mientras que en los grupos infectados y tratados con 54, 72, 5x103 y 10x103ng/gr peso/dÃ­a, se observÃ³ incremento en el tamaÃ±o de las lesiones. El CSA-13 incrementÃ³ el tamaÃ±o de la almohadilla plantar en los ratones no infectados. Los efectos observados del CSA-13 a 54 y 5x103ng/gr peso/dÃ­a, sobre el tamaÃ±o de la lesiÃ³n y la carga parasitaria, en los ratones infectados con L..(L.)mexicana son debido al DMSO. El DMSO no incrementÃ³ el tamaÃ±o de la almohadilla plantar de los ratones no infectados con L.. (L..)mexicana..El CSA-13 no tiene influencia sobre el peso de los ratones BALB/ c y altera los niveles sanguÃ­neos de transaminasas, amilasa y glicemia de los ratones BALB/c, lo que compromete la funciÃ³n hepÃ¡tica y pancreÃ¡tica de estos animales experimentales.','2011-05-26','Leishmaniasis CutÃ¡nea, CSA-13',1,1,1,1,1,'2013-09-17 08:40:21','2013-09-17 08:40:21','Documento_622.pdf','application/pdf',1093166,'2013-09-17 08:40:21',20,0,128,'COMPLETO'),(616,'ALTERACIONES ULTRAESTRUCTURALES DE PULMÃ“N EN RATONES INFECTADOS EXPERIMENTALMENTE CON DOS AISLADOS VENEZOLANOS DE T.. evansi','Trypanosoma evansi,,es un protozoario hemoflagelado, causante de la tripanosomosis equina. El parÃ¡sito es transmitido mecÃ¡nicamente por dÃ­pteros hematÃ³fagos de un mamÃ­fero a otro a travÃ©s de su picadura. Una vez en el vertebrado, el tripanosoma se reproduce por fisiÃ³n binaria, entrando al torrente sanguÃ­neo. Ha sido descrito en Asia, Ãfrica y SuramÃ©rica. En Venezuela, incide principalmente en los llanos, teniendo cierto impacto en las actividades agropecuarias. Se sabe, que la patogenicidad del parÃ¡sito varÃ­a de un Ã¡rea geogrÃ¡fica a otra. En este sentido, se han realizado investigaciones con aislados venezolanos, reportando alteraciones ultraestructurales en riÃ±Ã³n e hÃ­gado a travÃ©s de infecciones experimentales de modelos murinos, con el fin de ahondar en la patologÃ­a de la enfermedad. Sin embargo, no se encuentran registros de investigaciones realizadas en pulmÃ³n, siendo este un Ã³rgano tan vinculado al sistema vascular, cabe preguntarse acerca de los cambios submicroscÃ³picos de este tejido debido al T.. evansi. Por esta razÃ³n, se plantea como objetivo, describir las alteraciones ultraestructurales del pulmÃ³n en ratones infectados experimentalmente con dos aislados venezolanos de T.. evansi. Para ello, lotes de ratones hembras de 20 gramos de peso corporal fueron infectados con 1 tripomastigote/gramo de peso corporal correspondientes a dos aislados diferentes de T.. evansi, los animales fueron sacrificados interdiariamente para extraer muestras del pulmÃ³n, por ablaciÃ³n quirÃºrgica, las muestras se procesaron por Microscopia ElectrÃ³nica de TransmisiÃ³n. Los cortes finos (60-90nm) se obtuvieron en un ultramicrotomo Porter-Blum MT2-B. Las secciones obtenidas se contrastaron con acetato de uranilo y citrato de plomo. Finalmente las rejillas se examinaron en un Microscopio marca JEOL JEM-1011, efectuando registro permanente en negativos de 8,3 x 10,2cm para su posterior revelado y anÃ¡lisis. Los resultados obtenidos evidencian, para ambos aislados daÃ±os capilares como el engrosamiento de la membrana basal, prolongaciones endoteliales hacia la luz y disminuciÃ³n de caveolas. Asimismo se observa un aumento en el infiltrado celular, vinculado a un proceso inflamatorio causado por la presencia del parÃ¡sito, que conlleva a la ruptura de los espacios alveolares. Los estudios morfomÃ©tricos confirman cambios significativos en el grosor de la membrana basal en el transcurso de la infecciÃ³n experimental para ambos aislados (p=0,002) y un aumento en los espacios alveolares (p=0,000). Estos hallazgos sugieren efectos de T.. evansi en el lecho capilar pulmonar y colapso alveolar debido a desarrollo inflamatorio, causando lesiones en el pulmÃ³n.','2011-05-24','Ultraestructura, PulmÃƒÂ³n, Trypanosoma',1,1,1,1,1,'2013-09-17 08:40:21','2013-09-17 08:40:21','Documento_623.pdf','application/pdf',4773302,'2013-09-17 08:40:21',17,0,152,'COMPLETO'),(617,'Efectos de la contaminaciÃ³n por petrÃ³leo pesado en el suelo sobre la germinaciÃ³n de semillas y sobrevivencia de plÃ¡ntulas en Mauritia flexuosa','Los individuos adultos de Mauritia flexuosa, conforman el elemento mÃ¡s representativo de las comunidades de morichal. La distribuciÃ³n de gran parte de los morichales, en la Faja del Orinoco, regiÃ³n con importantes reservas de petrÃ³leo, y su ubicaciÃ³n en el relieve mas bajo del paisaje de valle, en intima asociaciÃ³n con los ejes fluviales, los hace potencialmente susceptibles a ser afectados por derrames de crudo. RazÃ³n por la cual el presente estudio tiene como objetivo determinar el efecto de diferentes concentraciones de petrÃ³leo pesado en el suelo, sobre la germinaciÃ³n de semillas y sobrevivencia de plÃ¡ntulas en Mauritia flexuosa, con la finalidad de establecer el intervalo de contaminaciÃ³n del suelo, que permita una propagaciÃ³n efectiva del moriche en actividades de repoblaciÃ³n vegetal, como estrategia de restauraciÃ³n ecolÃ³gica, en morichales degradados por derrames de petrÃ³leo, considerando ademÃ¡s diversos tratamientos y condiciones para favorecer la germinaciÃ³n y establecimiento del moriche, que permitan aumentar las probabilidades de Ã©xito en los procesos de reforestaciÃ³n. Para llevar a cabo este estudio, se realizaron ensayos de toxicidad aguda, establecidos en microcosmos, que permitieron simular \"a escala\" e \"in situ\" la descarga de petrÃ³leo sobre suelos de morichal en condiciones naturales. AdemÃ¡s fueron evaluados diversos tratamientos destinados a mejorar la germinaciÃ³n, considerando los requerimientos e inconvenientes asociados al establecimiento y desarrollo de Mauritia flexuosa. Los resultados demuestran que Mauritia flexuosa, mantuvo su capacidad germinativa en suelos contaminados con petrÃ³leo pesado en dosis de 0% a 8% y la concentraciÃ³n que generÃ³ el 50% de inhibiciÃ³n sobre la germinaciÃ³n (CE50) fue de 5,01%. Las dosis empleadas no repercutieron significativamente sobre el tiempo de germinaciÃ³n. La dosis letal (CE50) en plÃ¡ntulas fue de 39,81% de petrÃ³leo pesado. La contaminaciÃ³n no afectÃ³ la longitud y biomasa radical, sin embargo, la longitud del vÃ¡stago fue afectada a partir de 16% de crudo en el suelo. Respecto a los tratamientos en semillas, la escarificaciÃ³n en la zona del opÃ©rculo, favoreciÃ³ significativamente la germinaciÃ³n. La escarificaciÃ³n por abrasiÃ³n en toda la testa mejorÃ³ significativamente el tiempo de germinaciÃ³n pero promoviÃ³ el ataque por fitopatÃ³genos, generando una mayor mortalidad de brotes, con relaciÃ³n al resto de los tratamientos. La escarificaciÃ³n quÃ­mica con H2SO4 concentrado provocÃ³ la perforaciÃ³n de semillas y destrucciÃ³n del embriÃ³n, con un incremento progresivo de incidencia en relaciÃ³n al tiempo de exposiciÃ³n. Las condiciones de siembra demuestran la importancia de la temperatura en la germinaciÃ³n de las semillas de moriche, donde altas temperaturas con amplias fluctuaciones periÃ³dicas, favorecieron la germinaciÃ³n. A temperatura constante de 35Â°C ocurriÃ³ el mÃ¡s alto porcentaje de abortos entre tratamientos y condiciones. Por su parte en semillas sembradas directamente en el suelo, las limitaciones hÃ­dricas propiciaron un aumento de la mortalidad de vÃ¡stagos.Los resultados obtenidos permitieron establecer un conjunto de recomendaciones para la repoblaciÃ³n de Mauritia flexuosa en morichales afectados por derrame de crudo.','2011-05-23','Mauritia flexuosa;;Moriche; Morichales; RestauracÃ­on ecolÃ³gica; Fitotoxicidad; Hidrocarburos; PetrÃ³leo pesado.',1,1,1,1,1,'2013-09-17 08:40:23','2013-