constituye la hipÃ³tesis alternativa de este estudio y por lo tanto, deberÃ¡ ser sometida a prueba en futuros estudios. Para ellos, se recomienda considerar un tamaÃ±o muestral mayor al utilizado por nosotros, incluir la variabilidad ontogenÃ©tica, e identificar y analizar por separados grupos de diferentes regiones geogrÃ¡ficas.','2011-05-30','Dimorfismo sexual, Tayassuidae',1,1,1,1,1,'2013-09-17 08:40:25','2013-09-17 08:40:25','Documento_625.pdf','application/pdf',18268740,'2013-09-17 08:40:25',19,0,214,'COMPLETO'),(619,'Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} ESTRUCTURA POBLACIONAL DE LAS ESPECIES PLANCTÃ“Ã“NNICAS DE OSTRÃÃCCODOS Y CLADÃ“Ã“CCEROS ((CRUSTACEA)) EN LA COSTA NOROESTE DE PARAGUANÃÃ ((FALCÃ“Ã“NN,, VENEZUELA))','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\