dancia de los cladÃ³ceros, juveniles de Euconchoecia aspicula y la biomasa de ambos grupos, mostraron diferencias significativas entre las estaciones cercanas y lejanas de la costa. En 10 especies de ostrÃ¡codos se determinÃ³ la presencia de adultos, determinado valores de edad media poblacional altos en la mayorÃ­a de estas (SÃŒÂ… >= 6), mientras que la proporciÃ³n de sexos se encontrÃ³ desviada hacia las hembras y sÃ³lo para dos especies el porcentaje de hembras grÃ¡vidas fue mayor de 50%. En los cladÃ³ceros todos los ejemplares hallados fueron hembras correspondientes a clases de tallas adultas y sÃ³lo en una especie el nÃºmero de hembras no reproductivas superaron a las grÃ¡vidas. Estas poblaciones estuvieron compuestas casi exclusivamente por hembras partenogenÃ©ticas. Adicionalmente, se destaca el primer registro para aguas venezolanas del huevo de resistencia en Penilia avirostris. Estos resultados confirman la elevada importancia de los ostrÃ¡codos en el ambiente e indican que las poblaciones de las especies de cladÃ³ceros se encontraban deprimidas durante el perÃ­odo de estudio.','2011-05-27','OstrÃ¡codos, Euconchoecia chierchiae, CladÃ³ceros, Penilia avirostris, Estructura poblacional, Biomasa, PenÃ­nsula de ParaguanÃ¡',1,1,1,1,1,'2013-09-17 08:40:27','2013-09-17 08:40:27','Documento_626.pdf','application/pdf',3459261,'2013-09-17 08:40:27',20,0,104,'COMPLETO'),(620,'EstimaciÃ³n de los niveles de AlbÃºmina en la orina y correlaciÃ³n con los niveles de mercurio.','El riÃ±Ã³n es uno de los Ã³rganos susceptibles a la intoxicaciÃ³n con el mercurio. La principal manifestaciÃ³n de una nefropatÃ­a mercurial crÃ³nica es la presencia de albuminurÃ­a. Para la determinaciÃ³n de los niveles de albÃºmina se empleÃ³ como tÃ©cnica analÃ­tica la CromatografÃ­a Liquida de Alta Eficiencia. Se probaron dos mÃ©todos de separaciÃ³n de la albÃºmina para su posterior cuantificaciÃ³n. El primer mÃ©todo de separaciÃ³n, fue un cartucho de extracciÃ³n en fase sÃ³lida de Azul de Sefarosa. El segundo procedimiento de separaciÃ³n consistÃ­a en la precipitaciÃ³n de las proteÃ­nas empleando el Ã¡cido tricloroacÃ©tico. Con ambos procedimientos no se obtuvieron resultados satisfactorios, por lo tanto, se procediÃ³ a determinar los niveles de proteÃ­nas totales empleando el procedimiento descrito por Pesce y col, el cual utiliza la EspectroscopÃ­a de AbsorciÃ³n Molecular UV-Visible, como tÃ©cnica de anÃ¡lisis. Con Ã©sta tÃ©cnica se obtuvo un lÃ­mite de detecciÃ³n de 19mg/L, una precisiÃ³n de 1,7% y un porcentaje de recuperaciÃ³n de 92-99%. Se analizaron un total de 95 muestras de orina de niÃ±os que estudian en diferentes centros educativos en El Callao, Estado BolÃ­var, de los cuales, solo el 5 % presentaron proteÃ­nas en la orina, en un rango de concentraciÃ³n de 6 - 66 mg/dÃ­a, inferior al lÃ­mite de referencia (>150mg/dÃ­a), para diagnosticar proteinuria, sin embargo, la presencia de proteÃ­na en la orina, es un indicador de la apariciÃ³n de daÃ±o a nivel renal.','2011-05-24','ProteÃƒÂ­nas, AlbÃƒÂºmina, Orina, Mercurio, RiÃƒÂ±ÃƒÂ³n, Espectroscopia.',6,1,1,1,1,'2013-09-17 08:40:28','2013-09-17 08:40:28','Documento_627.pdf','application/pdf',7735745,'2013-09-17 08:40:28',20,0,94,'COMPLETO'),(621,'EstimaciÃ³n de los niveles AlbÃºmina en la orina y su correlaciÃ³n con los niveles de mercurio.','El riÃ±Ã³n es uno de los Ã³rganos susceptibles a la intoxicaciÃ³n con el mercurio. La principal manifestaciÃ³n de una nefropatÃ­a mercurial crÃ³nica es la presencia de albuminurÃ­a. Para la determinaciÃ³n de los niveles de albÃºmina se empleÃ³ como tÃ©cnica analÃ­tica la CromatografÃ­a Liquida de Alta Eficiencia. Se probaron dos mÃ©todos de separaciÃ³n de la albÃºmina para su posterior cuantificaciÃ³n. El primer mÃ©todo de separaciÃ³n, fue un cartucho de extracciÃ³n en fase sÃ³lida de Azul de Sefarosa. El segundo procedimiento de separaciÃ³n consistÃ­a en la precipitaciÃ³n de las proteÃ­nas empleando el Ã¡cido tricloroacÃ©tico. Con ambos procedimientos no se obtuvieron resultados satisfactorios, por lo tanto, se procediÃ³ a determinar los niveles de proteÃ­nas totales empleando el procedimiento descrito por Pesce y col, el cual utiliza la EspectroscopÃ­a de AbsorciÃ³n Molecular UV-Visible, como tÃ©cnica de anÃ¡lisis. Con Ã©sta tÃ©cnica se obtuvo un lÃ­mite de detecciÃ³n de 19mg/L, una precisiÃ³n de 1,7% y un porcentaje de recuperaciÃ³n de 92-99%. Se analizaron un total de 95 muestras de orina de niÃ±os que estudian en diferentes centros educativos en el Callao, Estado BolÃ­var, de los cuales, solo el 5% presentaron proteÃ­nas en la orina, en un rango de concentraciÃ³n de 6-66mg/dÃ­a, inferior al lÃ­mite de referencia (>150mg/dÃ­a), para diagnosticar protenuria, sin embargo, la presencia de proteÃ­na en la orina, es un indicador de la apariciÃ³n de daÃ±o a nivel renal.','2011-05-24','ProteÃƒÂ­nas, albÃƒÂºmina, orina, riÃƒÂ±ÃƒÂ³n, mercurio, espectroscopia.',6,1,1,1,1,'2013-09-17 08:40:29','2013-09-17 08:40:29','Documento_628.pdf','application/pdf',6154980,'2013-09-17 08:40:29',20,0,203,'COMPLETO'),(622,'DeterminaciÃ³n de factores de riesgo para la transmisiÃ³n de dengue en zonas altas mediante anÃ¡lisis geoespaciales. Estado MÃ©rida, Venezuela, 2001-2009','El dengue es la enfermedad viral transmitida por artrÃ³podos mÃ¡s comÃºn a nivel mundial; cada aÃ±o, presenta una morbilidad de 50 millones de personas, 500.000 deben ser hospitalizadas, el 60% de ellos son niÃ±os y la tasa de mortalidad anual es del 2,5 %. En una estadÃ­stica realizada por la OMS en el 2001, en 100 paÃ­ses fallecen mÃ¡s de 24.000 personas por esta enfermedad que es endÃ©mica en amplios territorios. El objetivo general de este trabajo es determinar los factores de riesgo para la transmisiÃ³n del dengue en el Edo. MÃ©rida, Venezuela, mediante anÃ¡lisis espacial retrospectivo de la transmisiÃ³n de dengue, anÃ¡lisis de series de tiempo entre las variables climÃ¡ticas y la epidemiolÃ³gica, anÃ¡lisis de regresiÃ³n lineal mÃºltiple entre las variables socioeconÃ³mica y la variables epidemiolÃ³gica y finalmente utilizando anÃ¡lisis de correlaciÃ³n lineal simple entre la variable epidemiolÃ³gica y la entomolÃ³gica. Los anÃ¡lisis temporales muestran que existe una transmisiÃ³n endÃ©mica establecida con un nÃºmero de casos de 19 por semana, mientras que se muestran tres picos epidÃ©micos de importancia en 2005, todo 2007 y 2009. Los anÃ¡lisis de regresiÃ³n mÃºltiple muestran la asociaciÃ³n entre el dengue y la densidad poblacional evidenciando focos constantes (mayor prevalencia) en el tiempo en las principales zonas urbanas (El VigÃ­a, Ejido y Ciudad de MÃ©rida). Se concluye que la variaciÃ³n de la precipitaciÃ³n (aumento en 200mm), temperatura media (aumento en 7 Â°C) e intervalo diario de temperatura (disminuciÃ³n en 8 Â°C) representan los factores a considerar como valores predictivos en posibles prÃ³ximas epidemias.','2011-05-27','Dengue, Prevalencia, Incidencia, Modelado retrospectivo, Edo. MÃƒÂ©rida',1,1,1,1,1,'2013-09-17 08:40:31','2013-09-17 08:40:31','Documento_629.pdf','application/pdf',6154980,'2013-09-17 08:40:31',20,0,203,'COMPLETO'),(623,'Avalanchas de actividad en redes neuronales de Morris-Lecar','En este trabajo de tesis se busca estudiar la aparicion de un comportamiento caracterizado por leyes de potencia en redes de neuronas que obedecen las ecuaciones de Morris-Lecar y su relacion con la topologia de la red. Se introducen varias maneras de cuantificar la actividad de la red, emulando el proceso de medicion experimental. Identificamos que para un tipo especifico de topologia, el mundo pequeno economico, el sistema se ubica en un estado critico en el cual las distribuciones de tamano de avalancha y de tiempo de vida de avalancha obedecen leyes de potencias. En esta situacion se observa una mayor aproximacion de la tasa de ramificacion s al valor critico. Estos resultados sugieren que la topologia es un factor determinante para la aparicion de condiciones de operatividad critica en la red neuronal.','2011-05-27','Mundo pequeno, comportamiento critico, leyes de potencias, redes neuronales',3,1,1,1,1,'2013-09-17 08:40:33','2013-09-17 08:40:33','Documento_630.pdf','application/pdf',4610499,'2013-09-17 08:40:33',20,0,103,'COMPLETO'),(624,'Estudio de los niveles de isoleucina en orina como un biomarcador de cÃ¡Ã¡ncer de prÃ³Ã³sstata','El cÃ¡ncer de prÃ³stata se considera un problema de salud a nivel mundial y representa la segunda causa de muerte por cÃ¡ncer en hombres. Actualmente, en un esfuerzo por reducir estas cifras, se han realizado trabajos de investigaciÃ³n enfocados en el estudio de los niveles de aminoÃ¡cidos como potenciales biomarcadores para el diagnÃ³stico precoz del carcinoma prostÃ¡tico. En este sentido, se planteÃ³ como objetivo, determinar los niveles del aminoÃ¡cido Isoleucina (ILE) en orina de pacientes con cÃ¡ncer de prÃ³stata y sujetos sanos. Las muestras de orina fueron donadas por pacientes voluntarios del servicio de UrologÃ­a del Hospital Universitario de Caracas (HUC) de la Universidad Central de Venezuela (UCV), antes de realizarse la biopsia prostÃ¡tica. El grupo de sujetos sanos o grupo control, corresponde a individuos con un valor sÃ©rico de AntÃ­geno ProstÃ¡tico Especifico (PSA) menor a 4,0 ng/ml, y con un diagnÃ³stico de prÃ³stata sana de acuerdo con el examen de tacto rectal. Se analizaron treinta y cinco (35) muestras de orina: once (11) pacientes con cÃ¡ncer (Grupo 1), diecisiete (17) pacientes sin cÃ¡ncer y que pueden presentar alguna patologÃ­a en la prÃ³stata (hiperplasia prostÃ¡tica o prostatitis), por lo cual se deben realizar una nueva biopsia en un perÃ­odo de seis meses (Grupo 2) y siete (7) individuos sanos o grupo control (Grupo 3). Para la determinaciÃ³n de ILE en la orina, se empleÃ³ como tÃ©cnica de anÃ¡lisis la CromatografÃ­a de lÃ­quidos de Alta Eficiencia (HPLC), con detecciÃ³n UV y derivaciÃ³n precolumna con o- ftaldialdehido (OPA) -Ã¡cido-2-mercaptoetanonico. El mÃ©todo resultÃ³ sensible para un lÃ­mite de detecciÃ³n y cuantificaciÃ³n de 17 y 57 Âµmol/L, respectivamente. El porcentaje de recuperaciÃ³n obtenido fue de 97 Â± 1%, y se considera aceptable para el rango establecido en muestras de fluidos biolÃ³gicos (80-120) %. La curva de calibraciÃ³n empleada para la determinaciÃ³n del aminoÃ¡cido ILE fue lineal para un rango de 101,8 - 600,8 ÂµM, obteniÃ©ndose que ILE es excretado en orina por el 57,1 % de los pacientes sometidos a la biopsia prostÃ¡tica, en un rango de 17 - 1541 Âµmol/L. Mientras que en el grupo de pacientes sin afecciones en la prÃ³stata, no se detectÃ³ ILE en la orina.','2011-05-24','Isoleucina, prÃƒÂ³stata, cÃƒÂ¡ncer, orina, HPLC',6,1,1,1,1,'2013-09-17 08:40:34','2013-09-17 08:40:34','Documento_631.pdf','application/pdf',33991939,'2013-09-17 08:40:34',19,0,214,'COMPLETO'),(625,'Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} DistribuciÃ³Ã³nn espacial de Carbono y NitrÃ³Ã³ggeno en los sedimentos superficiales del Lago de Valencia,, Venezuela','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-