superficiales, lago de valencia, distribucion espacial.',4,1,1,1,1,'2013-09-17 08:40:39','2013-09-17 08:40:39','Documento_632.pdf','application/pdf',113864,'2013-09-17 08:40:39',20,0,2,'COMPLETO'),(626,'Avalanchas de actividad en redes neuronales de Morris-Lecar','En este trabajo de tesis se busca estudiar la aparicion de un comportamiento caracterizado por leyes de potencia en redes de neuronas que obedecen las ecuaciones de Morris-Lecar y su relacion con la topologia de la red. Se introducen varias maneras de cuantificar la actividad de la red, emulando el proceso de medicion experimental. Identificamos que para un tipo especifico de topologia, el mundo pequeno economico, el sistema se ubica en un estado critico en el cual las distribuciones de tamano de avalancha y de tiempo de vida de avalancha obedecen leyes de potencias. En esta situacion se observa una mayor aproximacion de la tasa de ramificacion s al valor critico. Estos resultados sugieren que la topologia es un factor determinante para la aparicion de condiciones de operatividad critica en la red neuronal.','2011-05-27','comportamiento critico, redes de neuronas, mundo pequeno',3,1,1,1,1,'2013-09-17 08:40:39','2013-09-17 08:40:39','Documento_633.pdf','application/pdf',1787306,'2013-09-17 08:40:39',20,0,68,'COMPLETO'),(627,'Normal 0 21 false false false /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination: widow-orphan; font-size:10.0pt; font-family:\"Times New Roman\"; mso-ansi- language:#0400; mso-fareast-language:#0400; mso-bidi-language:#0400;} Estudio de los lixiviados del lodo rojo usando yeso para su neutralizaciÃ³Ã³nn y la evaluaciÃ³Ã³nn de su toxicidad mediante la germinaciÃ³Ã³nn de la semillaLycopersicon esculentum ((Tomate))','Normal 0 21 false false false /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination: widow-orphan; font-size:10.0pt; font-family:\"Times New Roman\"; mso-ansi- language:#0400; mso-fareast-language:#0400; mso-bidi-language:#0400;} El proceso de obtenciÃ³n de alÃºmina genera un desecho conocido como lodo rojo, este residuo es almacenado en grandes extensiones de terreno generando un problema ambiental. Para obtener una mejora de estos remanentes y disminuir el impacto que generan en el ecosistema, se evaluÃ³ la enmienda del lodo rojo con yeso determinando el grado de modificaciÃ³n de las condiciones de pH, conductividad, la concentraciones de cationes, y como influencian el crecimiento de la semilla Lycopersicon esculentum (tomate). Para este trabajo se utilizÃ³ un 10 % de lodo rojo y yeso en proporciones variables y 90% de arena, simulando un proceso de pluviosidad para obtener los lixiviados de las distintas mezclas; seguidamente se analizaron las variaciones de las propiedades quÃ­micas de los lixiviados para determinar los factores inhibidores de la germinaciÃ³n de las semillas y el desarrollo de las plÃ¡ntulas. El lodo rojo sin modificaciones se caracteriza por tener alto pH, sodicidad y salinidad. Estas caracterÃ­sticas afectaron negativamente la germinaciÃ³n y elongaciÃ³n de las semillas. En los casos que se modificÃ³ el lodo rojo con yeso se observÃ³ un cambio en las propiedades quÃ­micas, caracterizado principalmente por la disminuciÃ³n del pH, y sodicidad, y aumento en los niveles de calcio, lo cual favoreciÃ³ el crecimiento y germinaciÃ³n de las semillas de tomate. En los casos donde solo se utilizÃ³ yeso se obtuvo un alto contenido de calcio, sin presencia de sodio teniendo una germinaciÃ³n regular; pero se determinÃ³ que el exceso de sulfato es tÃ³xico para el crecimiento de las semillas. Las mezclas de 75% lodo rojo con 25%yeso y 50%lodo rojo y 50% yeso resultaron ser las mÃ¡s adecuadas para el crecimiento de las semillas de tomate.','2011-05-25','lodo rojo; yeso;lixiviacion; Indice de GerminaciÃ²n; Lycopersicon esculentum',4,1,1,1,1,'2013-09-17 08:40:41','2013-09-17 08:40:41','Documento_634.pdf','application/pdf',2075414,'2013-09-17 08:40:41',19,0,109,'COMPLETO'),(628,'DiseÃ±o e implementaciÃ³n de un datawarehouse para la consolidaciÃ³n y consulta de eventos sismolÃ³gicos y desastres naturales','La FundaciÃ³n Venezolana de Investigaciones SismolÃ³gicas (FUNVISIS), maneja varios departamentos donde los datos son cargados de diversas formas mediante el uso de aplicaciones: desde archivos de texto, Microsoft Excel e incluso sistemas, lo cual conlleva a que la fundaciÃ³n no posea los datos integrados en un solo repositorio.El presente Trabajo Especial de Grado se realizÃ³ con la finalidad de desarrollar un repositorio de datos para FUNVISIS, ademÃ¡s de realizar un middleware que permita comunicar las aplicaciones ya existentes con dicho repositorio para unificar de esta manera la informaciÃ³n; para luego proponer una aplicaciÃ³n web orientada hacia un administrador de base de datos, en la cual los usuarios puedan visualizar las consultas que se deseen hacer sobre la base de datos. El desarrollo del sistema fue guiado por el mÃ©todo Ã¡gil \"ProgramaciÃ³n Extrema\" (XP), el cual se enfoca en reforzar la simplicidad, comunicaciÃ³n, retroalimentaciÃ³n y refactorizaciÃ³n de cÃ³digo. Entre las tecnologÃ­as usadas se destaca el lenguaje de programaciÃ³n Ruby 1.9.2, su framework de desarrollo web Rails 3.0.6 y el sistema manejador de base de datos columnares Monet DB.El resultado es el desarrollo del repositorio de datos para FUNVISIS, donde se encuentra unificada la informaciÃ³n generada por la aplicaciÃ³n SEISAN (Seismic Analysis System), asÃ­ como tambiÃ©n de los datos correspondientes con la aplicaciÃ³n estudios y desastres. De igual forma se obtuvo un mÃ³dulo de carga de datos, el cual permite llevar los archivos en formato SEISAN y los datos de la aplicaciÃ³n de estudios y desastres al repositorio de datos, representando dicho modulo el proceso de extracciÃ³n, transformaciÃ³n y carga de los datos (ETL). Finalmente el Ãºltimo producto obtenido es una aplicaciÃ³n web, mediante la cual los usuarios de FUNVISIS pueden realizar consultas sobre el repositorio desarrollado.La creaciÃ³n de este repositorio y demÃ¡s aplicaciones aporta un agregado significativo al manejo de la informaciÃ³n, tanto tÃ©cnica como social dentro de FUNVISIS al unificar los datos y permitir la consulta sobre la misma.El presente trabajo estÃ¡ enmarcado dentro del proyecto de investigaciÃ³n \"programa integral de capacitaciÃ³n y adiestramiento de talento humano de Funvisis y actualizaciÃ³n tecnologÃ­a\".','2011-05-27','datawarehouse, FUNVISIS, SEISAN, Eventos sismolÃ³gicos, Estudios y Desastre.',2,1,1,1,1,'2013-09-17 08:40:43','2013-09-17 08:40:43','Documento_635.pdf','application/pdf',1476577,'2013-09-17 08:40:43',20,0,86,'COMPLETO'),(629,'Sistema de recolecciÃ³n de datos estadÃ­sticos en el Servicio de PediatrÃ­a Integral \"NiÃ±o Sano\" del Hospital de NiÃ±os \"J. M. de los RÃ­os\" de Caracas','En el Servicio de PediatrÃ­a Integral \"NiÃ±o Sano\" del Hospital de NiÃ±os \"J. M. de los RÃ­os\" la situaciÃ³n actual de los procesos de control de vacunas y generaciÃ³n de estadÃ­sticas, sumado a la complejidad de la informaciÃ³n que estos manejan, afectan en forma directa la realizaciÃ³n efectiva de los diversos trÃ¡mites internos y externos relacionados con este servicio de salud. Este Trabajo Especial de Grado tiene como objetivo desarrollar una aplicaciÃ³n que permita sistematizar los procesos anteriormente mencionados, disminuyendo las indeterminaciones y tiempos de respuesta en los reportes que deben ser entregados a los entes a los que se encuentra adscrito el Servicio. Por esa razÃ³n debe estar enfocada en adaptarse a las necesidades y dar soporte a las rotaciones continuas del personal. El proceso de desarrollo utilizado para la gestiÃ³n de esta aplicaciÃ³n se basÃ³ en una adaptaciÃ³n de la proceso de desarrollo Scrum, facilitando la realizaciÃ³n de la parte prÃ¡ctica del presente trabajo de investigaciÃ³n de manera rÃ¡pida, sencilla, eficiente y documentada. Dentro de los requerimientos contemplados en la aplicaciÃ³n se tienen los siguientes: gestiÃ³n de los procesos de registro, asistencia y vacunaciÃ³n de pacientes, creaciÃ³n y mantenimiento del inventario de vacunas, generaciÃ³n de reportes destinados a los entes a los que se encuentra adscrito al Servicio. La investigaciÃ³n contemplÃ³ el estudio del proceso manual que se lleva a cabo en el Servicio para el registro y atenciÃ³n de pacientes, la administraciÃ³n de vacunas, el estudio de esquemas de inmunizaciÃ³n y tÃ©rminos asociados a las Ã¡rea de pediatrÃ­a y puericultura, todo ello con el objetivo de familiarizarnos con los esquemas de trabajo y requerimientos del Servicio de PediatrÃ­a. A partir del estudio de estos procesos manuales, se diseÃ±Ã³ el modelo de datos y los lineamientos generales a considerar en el anÃ¡lisis y diseÃ±o del sistema propuesto como soluciÃ³n en este Trabajo Especial de Grado.','2011-05-27','Servicio de NiÃƒÂ±o Sano, Hospital J. M. de los RÃƒÂ­os, estadÃƒÂ­sticas de morbilidad, estadÃƒÂ­sticas de salud, sistema de control de vacunas, informÃƒÂ¡tica mÃƒÂ©dica.',2,1,1,1,1,'2013-09-17 08:40:45','2013-09-17 08:40:45','Documento_636.pdf','application/pdf',3380597,'2013-09-17 08:40:45',19,0,84,'COMPLETO'),(630,'ComparaciÃ³n de difrentes agentes descontaminantes para la recuperaciÃ³n de micobacterias previamente aisladas de muestras clÃ­nicas','En el diagnÃ³stico de las infecciones producidas por micobacterias, el cultivo de las muestras es necesario, ya que permite identificar la especie que estÃ¡ causando el cuadro clÃ­nico; por esta razÃ³n el agente descontaminante empleado es fundamental en la eliminaciÃ³n de la flora bacteriana asociada a las micobacterias. Tradicionalmente, la susceptibilidad de las micobacterias a desinfectantes y antisÃ©pticos ha sido objeto de estudio con base en su estructura celular, composiciÃ³n y fisiologÃ­a, caracterizÃ¡ndose principalmente por su resistencia a compuestos de amonio cuaternario. Hoy en dÃ­a se conoce que algunos agentes descontaminantes tienen efectos tÃ³xicos sobre las micobacterias por lo que puede verse alterada su recuperaciÃ³n. Es por ello que en el presente trabajo se evaluaron diferentes descontaminantes con el fin de estimar cual agente proporciona el mayor porcentaje de recuperaciÃ³n (HPC al 0.75%, NaOH al 2% y 4%, Ã¡cido oxÃ¡lico al 5% y Ã¡cido sulfÃºrico 6%), comparando un grupo de aislados clÃ­nicos de especies representativas del gÃ©nero Mycobacterium (M.. fortuitum,, M.. chelonae,, M.. tuberculosis H3377Ra..,, M..abscessus)).. Para tal fin fueron comparadas la metodologÃ­a de siembra en placas de agar, citometrÃ­a de flujo y fluorimetrÃ­a, estas dos Ãºltimas tÃ©cnicas se fundamentaron en la hidrÃ³lisis del FDA a fluoresceÃ­na. Los resultados obtenidos por la metodologÃ­a de siembra en placas de agar demuestran que existe una variable sensibilidad de las micobacterias estudiadas ante los agentes quÃ­micos descontaminantes, siendo el HPC al 0.75% el agente quÃ­mico que mostrÃ³ un mayor porcentaje de recuperaciÃ³n para todas las especies evaluadas; mientras que el NaOH 2% y 4%, y el Ã¡cido sulfÃºrico al 6% demostraron ser los agentes con menores porcentajes de recuperaciÃ³n, comprometiendo seriamente la viabilidad de las micobacterias ensayadas. Por otra parte, la metodologÃ­a de fluorimetrÃ­a sumado a la tinciÃ³n con FDA se presenta como una alternativa rÃ¡pida para la estimaciÃ³n de la viabilidad celular en micobacterias, ya que permite reducir el tiempo de diagnÃ³stico a tan solo 4 horas, no siendo estadÃ­sticamente significativo la diferencia entre los valores obtenidos por siembra en placas de agar y anÃ¡lisis de fluorimetrÃ­a, lo que constituye un gran avance sobre la investigaciÃ³n de estos microorganismos. En contraste, la citometrÃ­a de flujo revelo grandes discrepancias con la metodologÃ­a de siembra en placas de agar, por tanto el uso de esta tÃ©cnica no se presenta como una herramienta Ãºtil para la estimaciÃ³n de viabilidad celular.','2011-05-26','agentes descontaminantes, micobacterias',1,1,1,1,1,'2013-09-17 08:40:46','2013-09-17 08:40:46','Documento_637.pdf','application/pdf',5211032,'2013-09-17 08:40:46',19,0,88,'COMPLETO'),(631,'Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} HIDRODESMETALIZACIÃ“Ã“NN,, ASISTIDA ELECTROQUÃÃMMICAMENTE VÃÃAA PERMEACIÃ“Ã“NN DE HIDRÃ“Ã“GGENO,, DE MOLÃ‰Ã‰CCULAS MODELO Y EXTRACTOS PORFIRÃ­Ã­NICOS CONTENIDOS EN CRUDOS','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; 