 en la fase dispersante (W), al final de la reacciÃ³n, se demostrÃ³ que la ruptura o clivaje de las metaloporfirÃ­nas fue efectivo. Para las molÃ©culas modelos evaluadas y el extracto del crudo se reportan porcentajes de desmetalizaciÃ³n de 73% y 6% respectivamente, para un tiempo mÃ¡ximo de reacciÃ³n de seis (6) horas.','2011-02-15','Hidrotratamiento, hidrodesmetalizaciÃ³n, hidrÃ³geno atÃ³mico, reacciones asistidas electroquÃ­micamente',6,1,1,1,1,'2013-09-17 08:40:47','2013-09-17 08:40:47','Documento_638.pdf','application/pdf',1960868,'2013-09-17 08:40:47',20,0,85,'COMPLETO'),(632,'AnÃ¡lisis de los Procesos Electorales de Venezuela entrelos aÃ±os 1830 a 1860 y MÃ©todos MatemÃ¡ticosElectorales.','El objetivo principal de esta tesis de grado es el estudio y aplicaciÃ³n de mÃ©todos de reparto quepermita convertir los votos en una decisiÃ³n final que sea mÃ¡s justa y coherente con los deseos delelectorado y asÃ­ minimizar la injusticia electoral.Se da una breve reseÃ±a histÃ³rica de la evoluciÃ³n del Sistema Electoral Venezolano en la Ã©poca de1830 - 1860, y una descripciÂ¶on general del Sistema Electoral y el Sistema Electoral venezolano usandoconceptos elementales, proporcionando deÂ¯niciones claras.Para conocer los escaÃ±os que corresponden a cada uno de los distintos partidos o movimientospolÃ­ticos existen varios mÃ©todos de reparto que se han ido modificando a medida que se han conocidosus ventajas y sus inconvenientes en la prÃ¡ctica polÃ­tica.Se hace una descripciÃ³n matemÃ¡tica de los mÃ©todos de reparto mÃ¡s utilizados: El mÃ©todo deHamilton, la regla de D\'Hontd, el mÃ©todo de Hare/Niemeyer los cuales se ilustran con varios ejem-plos que ayudan a comprender su funcionamiento y a se~nalar, al mismo tiempo, los diversos proble-mas que les son inherentes y los resultados paradÃ³jicos que pueden producir. Posteriormente, en labÃºsqueda de un criterio para decidir cuÃ¡l de estos mÃ©todos es mÃ¡s adecuado, se propone la definiciÃ³ndel concepto de injusticia introducida por Huntington. Se describen las principales caracterÃ­sticasdel sistema electoral venezolano en los aÃ±os de 1830 y 1860 y se analizan los resultados obtenidos porestos mÃ©todos para esa fecha.Se estudia el problema de la construcciÃ³n de la funciÃ³n de decisiÃ³n social, se enuncian teoremasy definiciones necesarias para esta construcciÃ³n.','2011-05-19','MÃƒÂ©todos electorales',5,1,1,1,1,'2013-09-17 08:40:49','2013-09-17 08:40:49','Documento_639.pdf','application/pdf',2802365,'2013-09-17 08:40:49',20,0,101,'COMPLETO'),(633,'Desarrollo de un Sistema de InformaciÃ³n GeogrÃ¡fica (SIG) para la DirecciÃ³n de Catastro de la AlcaldÃ­a del Municipio Bolivariano Libertador','En el presente Trabajo Especial de Grado se determinÃ³ que en la DirecciÃ³n de Catastro de la AlcaldÃ­a del Municipio Bolivariano Libertador intervienen un determinado nÃºmero de procesos; que implican una complejidad en el flujo constante de informaciÃ³n, afectando el tiempo de respuesta de los trÃ¡mites allÃ­ demandados. Y como soluciÃ³n, se propuso y desarrollÃ³ un Sistema de InformaciÃ³n GeogrÃ¡fica (SIG) que facilita y optimiza el registro, control y administraciÃ³n de la informaciÃ³n catastral (datos del solicitante, ocupante o/y propietario, documentos consignados, registro pÃºblico, direcciÃ³n, cÃ³digo catastral, linderos, inspecciÃ³n y avalÃºo del inmueble) asociada a los diferentes tipos de solicitudes que puede realizar un ciudadano (CÃ©dula Catastral, Certificado de Empadronamiento, Desglose de la Propiedad Horizontal, Titularidad de Terreno, CertificaciÃ³n de Linderos, Valor Metro Cuadrado). Para lograrlo se aplicÃ³ una metodologÃ­a de desarrollo de software probada RUP (RationalUnifiedProcess) y se utilizaronherramientas de software libre (Servidor Web Apache, Base de Datos MySQL, Lenguaje de ProgramaciÃ³n PHP y Navegador Web Mozilla Firefox). Esto genera importantes beneficios: facilita el mantenimiento de la informaciÃ³n catastral, la distribuciÃ³n de actividades y la comunicaciÃ³