r una visiÃ³n acerca de los procesos que controlan la composiciÃ³n quÃ­mica de los cuerpos de aguas superficiales. Para ello fue llevada a cabo la determinaciÃ³n de las concentraciones de las especies mayoritarias NaÃ¢ÂÂº, KÃ¢ÂÂº, CaÂ²Ã¢ÂÂº, MgÂ²Ã¢ÂÂº, HCOÃ¢Â‚ÂƒÃ¢ÂÂ», ClÃ¢ÂÂ», SOÃ¢Â‚Â„Â²Ã¢ÂÂ» y Si y P; asÃ­ como tambiÃ©n la mediciÃ³n de los parÃ¡metros fisicoquÃ­micos pH, conductividad elÃ©ctrica y temperatura. Igualmente fue llevada a cabo la estimaciÃ³n de la tasa de meteorizaciÃ³n y el grado de contaminaciÃ³n en dicha cuenca. El plan de muestreo comprendiÃ³ 16 puntos en total, 6 correspondientes al canal principal del rÃ­o Caucagua y 10 a lo largo de los afluentes mÃ¡s importantes. Las determinaciones realizadas involucraron la alcalinidad mediante titulaciÃ³n Ã¡cido-base. Posteriormente, las muestras fueron filtradas en el laboratorio a travÃ©s de un sistema Millipore, empleando un papel de filtro de 0,45mm para luego determinar las especies Si y P por fotocolorimetrÃ­a empleando un equipo Spectronic 20. Por su parte, la concentraciÃ³n de los cationes fueron conocidas mediante la tÃ©cnica de ICP-AES y la concentraciÃ³n de sulfato y cloruro por cromatografÃ­a iÃ³nica. Los resultados obtenidos indican que las concentraciones mÃ¡s elevadas de las especies mayoritarias analizadas estÃ¡n ubicadas en los afluentes no contaminados del noreste de la cuenca, tal es el caso de Araira, Cupo y Chuspita por drenar en mayor proporciÃ³n la FormaciÃ³n Las Mercedes; mientras que las menores concentraciones son ubicadas al noroeste de la misma, especÃ­ficamente en Izcaragua, Curupao, Ingenio y Churca por drenar la FormaciÃ³n Las Brisas. Por otra parte, fue posible asociar que las variaciones de las tasas de disoluciÃ³n encontradas en este estudio hacia el noroeste de la cuenca son debidas principalmente a la distribuciÃ³n de precipitaciÃ³n-escorrentÃ­a; mientras que en los afluentes del noreste son producto de la combinaciÃ³n precipitaciÃ³n-escorrentÃ­a y litologÃ­a. Por Ã