te en el talento humano. Este proceso tiene por definiciÃ³n el nombre de \"Time Report\", Ã©ste tiene como objetivo principal mejorar la productividad de la organizaciÃ³n, desarrollando una excelente gestiÃ³n a travÃ©s de la automatizaciÃ³n de la actividad manual. El \"Time Report\", tiene como finalidad controlar el tiempo invertido por parte del talento humano de la organizaciÃ³n, en los proyectos asignados por Ã©sta. Para desarrollar el Proceso de GestiÃ³n Empresarial \"Time Report\", utilizamos la MetodologÃ­a de GestiÃ³n de los Procesos del Negocio sustentada en el uso de Patrones.','2011-05-30','Proceso, GestiÃ³n, GestiÃ³n Empresarial, Time Report, BPM.',2,1,1,1,1,'2013-09-17 08:41:21','2013-09-17 08:41:21','Documento_653.pdf','application/pdf',1296575,'2013-09-17 08:41:21',18,0,102,'COMPLETO'),(647,'Estudio del fenomeno de sorcion de fenol por la turba de la Laguna Paso Real localizada en el Estado MÃ¨rida.','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Como aporte para la eliminaciÃ³n o depuraciÃ³n de agentes contaminantes en medios acuÃ¡ticos, el presente estudio tiene como objetivo principal evaluar la capacidad de adsorciÃ³n y desorciÃ³n de fenol por la turba de la Laguna Paso Real, estado MÃ©rida, con variaciÃ³n de temperatura y pH, mediante isotermas de adsorcion. Los ensayos de adsorciÃ³n se realizaron a pH 4,6 y 8 con temperatura de 25ÂºC constante; y a temperaturas 15,25 y 60ÂºC con pH=6 constante, para esto se prepararon soluciones de diferentes concentraciones conocidas de fenol y se colocaron en agitaciÃ³n con la turba. Una vez culminadas las adsorciones se realizaron ensayos de desorciÃ³n al sÃ³lido remanente, llevÃ¡ndose a cabo el mismo proceso que en los ensayos de adsorciÃ³n. La mayorÃ­a de los datos obtenidos experimentalmente, se ajustaron al modelo propuesto por Langmuir, sugiriendo la adsorciÃ³n en monocapa. Para pH=4 y T=15ÂºC los resultados se ajustaron mejor al modelo de Freundlich, indicando un posible cambio en el mecanismo de adsorciÃ³n, sugiriendo adsorciÃ³n en multicapa. Se observÃ³ mayor capacidad de adsorciÃ³n con el incremento de pH, de igual forma con el incremento de temperatura. La fisicoquÃ­mica del proceso indica interacciones de tipo fÃ­sica; la energÃ­a de activaciÃ³n del orden de 22 KJ/mol confirma enlaces de hidrogeno y que la reacciÃ³n es endotÃ©rmica De acuerdo a los resultados obtenidos, se confirma la gran capacidad de adsorciÃ³n que tiene la turba, lo que implica que juega un papel importante como bioflitro en los sistemas naturales para la remociÃ³n de especies orgÃ¡nicas que se consideran contaminantes.','2011-05-27','AdsorciÃ²n, fisisorciÃ²n, quimisorciÃ²n, fenol, contaminacion, turba.',6,1,1,1,1,'2013-09-17 08:41:23','2013-09-17 08:41:23','Documento_654.pdf','application/pdf',2525056,'2013-09-17 08:41:23',19,0,100,'COMPLETO'),(648,'\"\"ESTUDIO DE LA INFLUENCIA DEL ACIDO CITRICO EN LA REACCION DE ENTRECRUZAMIENTO DE POLIACRILAMIDA,, PARCIALMENTE HIDROLIZADA,, CON FENOL--FORMALDEHÃÃDDO\"\"','Los geles de poliacrilamida son de gran importancia en diversos sectores de la industria, como es el caso de la industria petrolera en donde son empleados para control de agua en pozos tanto productores como inyectores. Esto hace que la industria Ã©ste en una constante bÃºsqueda de sistemas mÃ¡s eficientes que los actualmente empleados para el control de agua. Es por ellos que se propuso la sÃ­ntesis de geles de poliacrilamida por entrecruzamiento con mezcla fenol- formaldehÃ­do (MFF) incorporando Ã¡cido cÃ­trico (AC) a pH 7, 8 y 9, a una temperatura de 80Â°C, determinando la influencia del Ã¡cido cÃ­trico en la modificaciÃ³n de las propiedades mecÃ¡nicas, tÃ©rmicas y de hinchamiento de los geles sintetizados. La determinaciÃ³n de las propiedades mecÃ¡nicas de estos sistemas se efectuÃ³ en el rango de viscoelasticidad lineal empleando una frecuencia de 5 Hz ante una deformaciÃ³n constante de 10%, determinando que el mÃ³dulo elÃ¡stico (GÂ´) de los geles sintetizados disminuÃ­a a medida que aumentaba la concentraciÃ³n de Ã¡cido cÃ­trico. TambiÃ©n se pudo determinar que al incorporar Ã¡cido cÃ­trico, no se generaron cambios significativos en cuanto a la estabilidad tÃ©rmica de los geles. En cuanto a la morfologÃ­a se pudo constatar que los sistemas sin Ã¡cido cÃ­trico presentan una textura rugosa la cual se va perdiendo a medida que se incorpora este aditivo. Se comprobÃ³ que el Ã¡cido cÃ­trico para estos sistemas no actÃºa como un agente entrecruzador, su funciÃ³n es permitir la obtenciÃ³n de geles hÃ­bridos ya que este se dispone sobre la superficie del gel formando aglomerados de citrato los cuales contribuyen a la modificaciÃ³n de las propiedades mecÃ¡nicas y de hinchamiento de estos geles. En cuanto al grado de hinchamiento se constatÃ³ que a medida que incrementa la concentraciÃ³n de Ã¡cido cÃ­trico disminuÃ­a la capacidad de hinchamiento de los geles con respecto a los que fueron sintetizados sin el aditivo, esto se debe a las variaciones de los potenciales quÃ­micos dentro y fuera del gel luego de que este se ha hinchado, ademÃ¡s de la presencia de aglomerados de Ã¡cido cÃ­trico los cuales posiblemente puedan estar apantallando los grupos ionizables presentes en el gel por lo que disminuye el nÃºmero de interacciones con el disolvente y en consecuencia disminuye el grado de hinchamiento. Por otro lado se estudiÃ³ la cinÃ©tica de hinchamiento de los geles sintetizados a pH 8 en agua desionizada obteniendo resultados que se ajustan satisfactoriamente al modelo propuesto por Schott (segundo orden) lo que permitiÃ³ determinar los parÃ¡metros cinÃ©ticos K y Woo los cuales corresponden a la constante de difusiÃ³n de hinchamiento y al hinchamiento mÃ¡ximo en el equilibrio.','2011-05-18','ReacciÃ³n de entrecruzamiento, Poliacrilamida, Geles, Ãcido CÃ­trico, Grado de hinchamiento, CinÃ©tica de Hinchamiento.',6,1,1,1,1,'2013-09-17 08:41:25','2013-09-17 08:41:25','Documento_655.pdf','application/pdf',1507193,'2013-09-17 08:41:25',20,0,125,'COMPLETO'),(649,'Desarrollo del Proceso de GestiÃ³n Empresarial \"Time Report\" mediante la implementaciÃ³n de metodologÃ­a BPM y la utilizaciÃ³n de Oracle BPM Studio','El siguiente trabajo especial de grado consiste en la creaciÃ³n de un proceso de gestiÃ³n empresarial automatizado, que facilite la vigilancia de todos los departamentos de la organizaciÃ³n , controlando las actividades y las horas laboradas por parte del talento humano de la misma. Dicho proceso funcionara sobre la herramienta Oracle BPM Studio, para aprovechar las ventajas de las nuevas metodologÃ­as empresariales que dotan a este proceso de interactividad entre los recursos involucardos, y nutre del control del departamento y el desempeÃ±o del talento humano de la organizaciÃ³n.','2011-05-30','GestiÃƒÂ³n, GestiÃƒÂ³n Empresarial, Time Report, BPM, Proceso',2,1,1,1,1,'2013-09-17 08:41:27','2013-09-17 08:41:27','Documento_656.pdf','application/pdf',1703116,'2013-09-17 08:41:27',18,0,96,'COMPLETO'),(650,'ESTUDIO DE LA FORMACIÃ“Ã“NN DE LOS Complejos de Vanadio ((V)) CON AMINOÃÃCCIDOS..SISTEMA H++--VO22++--LEUCINA ((KCl 33..00 M a 2255ÂºÂº C))..','RESUMEN En el presente trabajo experimental, se estudiaron los siguientes sistemas: H+- Leu H+ - V(v) - Leu mediante medidas de fuerzas electromotrices emf (H), empleando como medio iÃ³nico KCl 3,0M a una temperatura de 25,0(5) ÂºC, a fin de determinar las constantes de acidez (pKa) del ligando leucina y las constantes de equilibrio bpqr de los complejos formados. Los datos experimentales [H, B, C, Eo, 