 caÃ±a de azÃºcar presentÃ³ una capacidad de sorciÃ³n superior a los demÃ¡s biomateriales e igual o superior en algunos casos a los materiales sintÃ©ticos con los cuales fueron comparados; se encontrÃ³ que la capacidad de sorciÃ³n depende del tamaÃ±o de partÃ­cula, la viscosidad y la volatilidad del hidrocarburo. Finalmente todas las muestras fueron evaluadas mediante microcopia electrÃ³nica de barrido.','2011-05-26','Sorbentes, biomateriales, capacidad de sorciÃƒÂ³n, hidrocarburos, derrames de hicrocarburos',6,1,1,1,1,'2013-09-17 08:41:30','2013-09-17 08:41:30','Documento_659.pdf','application/pdf',1121221,'2013-09-17 08:41:30',20,0,171,'COMPLETO'),(652,'Aportes taxonÃ³micos al conocimiento del gÃ©nero HypneaJ. V. Lamouroux (Cyatocloniaceae, Rhodophyta) en la Costa de Venezuela','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} El gÃ©nero HypneaJ.V. Lamouroux se caracteriza principalmente por presentar talos teretes o comprimidos, ramas determinadas generalmente espiniformes, estructura interna compacta y uniaxial, tetrasporangios zonados, formando soros en las ramas determinadas y por la producciÃ³n de k-carragenina. A nivel mundial existen 54 especies. Estudios florÃ­sticos previos realizados en Venezuela informaban de la presencia de cuatro especies: Hypneacornuta (KÃ¼tzing) J. Agardh, Hypneamusciformis (Wulfen) J.V. Lamouroux, Hypneaspinella (C. Agardh) KÃ¼tzing y Hypneavalentiae (Turner) Montagne. El objetivo de este estudio es dar un primer aporte al conocimiento taxonÃ³mico del gÃ©nero Hypnea para la costa de Venezuela, sobre la base de caracteres morfoanatÃ³micos y reproductivos. Las colecciones de muestras botÃ¡nicas fueron realizadas en localidades representativas de cinco entidades federales y considerando diferentes ambientes y sustratos: Litorales rocosos, arrecifes coralinos, raÃ­ces de Rhizophora mangle, y praderas de angiospermas marinas, hasta una profundidad de 4 m. Adicionalmente se realizÃ³ la revisiÃ³n de exsiccatae en tres herbarios nacionales. Los resultados obtenidos determinan la presencia de siete especies, de las cuales tres son nuevos registros para la ficoflora marina de Venezuela, estas son: H..charoides J.V. Lamouroux, H..flexicaulis Yamagishi & Masuda y H..pannosa J. Agardh, las mismas fueron identificadas con base en los siguientes caracteres diagnÃ³stico: hÃ¡bito, forma del talo, forma y tamaÃ±o de las ramas determinadas y forma de la cÃ©lula axial. Se espera a futuro comparar dichos resultados con estudios moleculares.','2011-05-27','Cystocloniaceae, Rhodophyta, Hypnea, TaxÃ³nomia',1,1,1,1,1,'2013-09-17 08:41:31','2013-09-17 08:41:31','Documento_660.pdf','application/pdf',1982302,'2013-09-17 08:41:31',19,0,91,'COMPLETO'),(653,'PROTOTIPO PARA LA GESTIÃ“Ã“NN Y CLASIFICACIÃ“Ã“NN DE COLECCIONES DE DOCUMENTOS DIGITALES','El objetivo del presente Trabajo Especial de Grado consiste en el desarrollo de una aplicaciÃ³n Web que permita apoyar los procesos de digitalizaciÃ³n de documentos, clasificaciÃ³n y visualizaciÃ³n de documentos digitales basados en una taxonomÃ­a. Dentro de las necesidades contempladas en la aplicaciÃ³n se tiene lo siguiente: contar con una aplicaciÃ³n generalizada que le permita a los usuarios de forma rÃ¡pida y eficiente realizar una estructura jerÃ¡rquica de los documentos digitalizados y asÃ­ mismo se pueda manejar la data de los mismos de una forma eficiente. Para cumplir con los objetivos de la aplicaciÃ³n se utilizÃ³ el mÃ©todo Ã¡gil XP (ProgramaciÃ³n Extrema), la cual se basa fundamentalmente, en la construcciÃ³n progresiva del software sin hacer Ã©nfasis en la etapa de diseÃ±o.','2011-05-27','DigitalizaciÃƒÂ³n, documentos digitales, clasificaciÃƒÂ³n, taxonomÃƒÂ­as',2,1,1,1,1,'2013-09-17 08:41:33','2013-09-17 08:41:33','Documento_661.pdf','application/pdf',16045164,'2013-09-17 08:41:33',20,0,101,'COMPLETO'),(654,'Desarrollo de una aplicaciÃ³Ã³nn Web para manejar los procesos administrativos de reservaciÃ³Ã³nn de las Salas de Ensayo y Estudios de GrabaciÃ³Ã³nn.. Caso de Estudio:: Rock && Folk','Los estudios de ensayo y grabaciÃ³n se enfrentan a diario con una alta concurrencia de clientes, en especial la empresa Rock & Folk por su gran popularidad. La gestiÃ³n de la mayorÃ­a de sus actividades se lleva a cabo sobre una simple agenda o block de papel, lo que convierte a sus procesos ineficientes y poco confiables, siendo la reserva de salas de ensayo la mÃ¡s afectada. El presente Trabajo Especial de Grado tiene como objetivo desarrollar un sistema que permita mejorar la atenciÃ³n de los clientes del estudio Rock & Folk, brindÃ¡ndoles la oportunidad de consultar la disponibilidad de las salas desde sus hogares, ahorrando tiempo y otorgando confiabilidad en los procesos de reservaciÃ³n. AdemÃ¡s de automatizar las actividades de los empleados que son realizadas de forma manual, como el registro de clientes, reservaciones de salas, y la gestiÃ³n administrativa de estos procesos. El mÃ©todo Ã¡gil de desarrollo utilizado para la construcciÃ³n de esta aplicaciÃ³n fue una adaptaciÃ³n de la ProgramaciÃ³n Extrema (XP), la cual permite guiar la elaboraciÃ³n de la parte prÃ¡ctica del presente trabajo de investigaciÃ³n. Dentro de las necesidades contempladas en la aplicaciÃ³n se encuentra lo siguiente: Mantener informado a los actores involucrados del flujo de trabajo con la informaciÃ³n pertinente dependiente del tipo de proceso que se estuviese llevando a cabo en determinado momento.','2011-05-27','Estudios de GrabaciÃƒÂ³n, Salas de Ensayo, AutomatizaciÃƒÂ³n, Reservaciones, Ruby On Rails, Rock & Folk',2,1,1,1,1,'2013-09-17 08:41:34','2013-09-17 08:41:34','Documento_662.pdf','application/pdf',1075771,'2013-09-17 08:41:34',20,0,68,'COMPLETO'),(655,'ESTUDIOS DE FORMACIÃ“Ã“NN DE COMPLEJOS TERNARIOS ENTRE EL SISTEMA VANADIO ((III)) -- CISTEÃŒÃŒNNA Y LOS AMINOÃÃCCIDOS HISTIDINA,, Ã€Ã€CCIDO ASPÃÃRRTICO Y ÃÃCCIDO GLUTÃ€Ã€MMICO MEDIANTE MEDIDAS DE EMF ((H)) EN KCl 33,,00M A 2255Â°Â°C..','Se estudiÃ³ la formaciÃ³n de complejos ternarios entre el sistema vanadio (III)-cisteÃ­na y los aminoÃ¡cidos: Ã¡cido aspÃ¡rtico, Ã¡cido glutÃ¡mico e histidina en medio acuoso, a 25Â°C y utilizando KCl 3,0M como medio iÃ³nico, con la finalidad de conocer las diferentes especies que coexisten en el equilibrio a las distintas relaciones molares. El anÃ¡lisis de los datos experimentales de cada sistema se realizÃ³ mediante el programa de mÃ­nimos cuadrados LETAGROP y LETAGROP/FONDO obteniÃ©ndose los siguientes valores de pKa para los ligandos y las constantes de estabilidad log b de los complejos segÃºn las siguientes reacciones generales: Tabla a..Valores de log bp0r, para el sistema H+ - Ã¡cido aspÃ¡rtico, en KCl 3,0 M a 25ÂºC. REACCIÃ“N log b H2C + H+ H3C+ 2,60(4) H2C HC- + H+ -4,08(2) H2C C2- + 2H+ -13,86(3) Dispersion (s) 0,022 Tabla b..Valores de log bp0r, para el sistema H+ - Ã¡cido glutÃ¡mico, en KCl 3,0 M a 25ÂºC. REACCIÃ“N log b H2C + H+ H3C+ 2,72(4) H2C HC- + H+ -4,58(2) H2C C2- + 2H+ -14,23(3) Dispersion (s) 0,028 Tabla c..Valores de log bp0r, para el sistema H+ - cisteÃ­na, en KCl 3,0 M a 25ÂºC. REACCIÃ“N log b H2C + H+ H3C+ 2,56(4) H2C HC- + H+ -8,22(3) H2C C2- + 2H+ -17,94(4) Dispersion (s) 0,024 Tabla d..Valores de log bp0r, para el sistema H+ - histidina, en KCl 3,0 M a 25ÂºC. REACCIÃ“N log b HC + H+ H2C+ 6,67(4) HC + 2H+ H3C+2 9,32(7) HC C- + H+ -9,40(5) Dispersion (s) 0,035 Tabla e. Valores de log bpqrs, para el sistema ternario V(III)-cisteÃ­na- Ã¡cido aspÃ¡rtico estudiados en KCl 3,0M como medio iÃ³nico a 25 ÂºC. ReacciÃ³n log bpqrs ZB log bpqrs ZC log bpqrs ZB fondo log bpqrs ZC f ondo V3+ + H2Cis + H2Asp [V(H2Cis)(HAsp)]2+ +H+ 14,41(9) 14,43(9) 14,40(9) 14,41(9) V3+ + H2Cis + H2Asp [V(Hcis)(Hasp)]+ + 2H+ 11,7(2) 11,6(2) 11,7 (2) 11,6(2) V3+ + H2Cis + H2Asp [V(Hcis)(Asp)] + 3H+ 9,03(8) 9,04(9) 9,03(8) 9,06(9) V3+ + H2Cis + H2Asp [V(Cis)(Asp)]- + 4H+ 5,1(1) 5,2(1) 5,1(1) 5,2(2) V3+ + H2Cis + H2Asp [V(Cis)(Asp) (OH)]2- + 5 H+ 0,7(1) 0,9(1) 0,7(1) 0,9(1) DispersiÃ³n (s) 0,094 0,059 0,094 0,068 Tabla f. Valores de log bpqrs, para el sistema ternario V (III)-cisteÃ­na -Ã¡cido glutÃ¡mico estudiados en KCl 3,0M a 25 ÂºC. ReacciÃ³n log bpqrs ZB log bpqrs ZC V3+ + H2Cis + H2Glu [V(H2Cis)(HGlu)]2+ + H+ 14,55(6) 14,59(6) V3+ + H2Cis + H2Glu [ V(HCis)(HGlu)]+ + 2H+ 11,79(8) 11,78(9) V3+ + H2Cis + H2Glu [V(Cis)(HGlu)] + 3H+ 8,49(6) 8,58 (6) V3+ + H2Cis + H2Glu [V(Cis)(HGlu)(OH)]- + 4H+ 3,96(7) 4,11(7) DispersiÃ³n (s) 0,090 0,058 Tabla g. Valores de log bpqrs, para el sistema ternario V (III)-cisteÃ­na -histidina estudiados en KCl 3,0M a 25 ÂºC. ReacciÃ³n log bpqrs ZB log bpqrs ZC log bpqrs ZB fondo log bpqrs ZC fondo V3+ + H2Cis + HHis [V(HCis)(HHis)]2+ + H+ 17,87(7) 17,93(6) 17,87(7) 17,88(7) V3+ + H2Cis + HHis [V(HCis)(His)]+ + 2H+ 14,44(5) 14,39(5) 14,44(5) 14,39(6) V3+ + H2Cis + HHis [V(Cis)(His)] + 3H+ 9,87(8) 9,88(7) 9,88(8) 9,86(8) V3+ + H2Cis + HHis [V(Cis) (His)(OH)]- + 4H+ 5,05(6) 5,03(5) 5,05(6) 5,04(6) DispersiÃ³n (s) 0,090 0,055 0,089 0,061','2011-05-27','COMPLEJOS TERNARIOS AMINOÃÃCCIDOS MEDIANTE MEDIDAS DE EMF CONSTANTE DE ACIDEZ',6,1,1,1,1,'2013-09-17 08:41:37','2013-09-17 08:41:37','Documento_663.pdf','application/pdf',41436343,'2013-09-17 08:41:37',18,0,106,'COMPLETO'),(656,'EvaluaciÃ³n de la presencia de cuasiespecies del virus de hepatitis C en suero, saliva y fluido crevicular gingival de pacientes infectados.','El virus de la hepatitis C (VHC) es el agente etiolÃ³gico de la hepatitis C, una enfermedad viral que afecta principalmente al hÃ­gado en humanos y chimpancÃ©s. Aproximadamente el 3% de la poblaciÃ³n mundial humana, estÃ¡ infectada con este virus. Es un virus que contiene ARN como material genÃ©tico. Su genoma es de cadena lineal, y contiene unos 9500 nucleÃ³tidos. Posee una alta tasa de error en la incorporaciÃ³n de nucleÃ³tidos al momento de la replicaciÃ³n, ya que su ARN polimerasa dependiente de ARN carece de un sistema de actividad correctora, se dan mutaciones al azar constantemente, que influyen directamente en el genotipo y fenotipo del viriÃ³n, y se seleccionan mutantes (variantes) de resistencia a distintas presiones selectivas, como la que ejercen los fÃ¡rmacos antivirales, o la presiÃ³n del sistema inmune del hospedador. Las distintas variantes genÃ³micas de este virus, que infectan a un mismo individuo, se denominan cuasiespecies. El objetivo principal de este estudio, fue determinar la presencia de cuasiespecies en suero y saliva de pacientes infectados en la fase crÃ³nica de la hepatitis C. La amplificaciÃ³n de dos regiones del genoma del VHC (5\'-NC y NS5B), la secuenciaciÃ³n de los amplicones, y la clonaciÃ³n, junto con el uso de programas de bioinformÃ¡tica para su anÃ¡lisis, permitiÃ³ caracterizar al virus molecularmente, tanto en genotipo, como en subtipos, a nivel poblacional. A nivel individual, se determinÃ³ la presencia de cuasiespecies en las distintas regiones del VHC en muestras de suero y saliva de pacientes infectados en fase crÃ³nica de la hepatitis C. La carga viral que circula en suero con respecto a saliva, es mayor, y esto le da mayor probabilidad de amplificaciÃ³n en el primero. AdemÃ¡s, la regiÃ³n 5\'-NC es mÃ¡s sensible a la amplificaciÃ³n, por ser mÃ¡s conservada que la NS5B. La regiÃ³n 5\'- NC es suficiente para la asignaciÃ³n de genotipos. Sin embargo, la regiÃ³n NS5B da una mayor discriminaciÃ³n, y permite asignar subtipos y genotipos. El alineamiento de secuencias consenso de las regiones del VHC que circula en suero y saliva, mostrÃ³ un alto grado de identidad, lo cual indicÃ³ que tanto la muestra de saliva como la de suero, pueden ser usadas para caracterizaciÃ³n molecular. A nivel poblacional, la caracterizaciÃ³n molecular mostrÃ³ que los genotipos predominantes en Venezuela, siguen siendo el genotipo 1 y el genotipo 2, con una prevalencia del 67% (10/15) y 33% (5/15), respectivamente. Por otro lado, la caracterizaciÃ³n molecular a nivel individual, demostrÃ³ la presencia de cuasiespecies del VHC en las muestras de suero y saliva de dos pacientes, en el cual no se observÃ³ mayor distancia genÃ©tica entre las variantes de la cuasiespecie que circula en suero, con respecto a las variantes de la cuasiespecie que circula en saliva, puesto que no formaron clados distintos entre ellas. El realizar estudios de cuasiespecies es de suma importancia para la vigilancia, patogenicidad, epidemiologÃ­a y evoluciÃ³n del virus en un individuo, y muchas veces es pasado por alto.Aunque se han llevado a cabo numerosos trabajos de distribuciÃ³n de cuasiespecies en distintos Ã³rganos, tejidos y/o fluidos corporales, como suero, PBMCs, tejido hepÃ¡tico, entre otros; este es el primer trabajo que pone en evidencia la presencia de cuasiespecies del VHC en la saliva de pacientes infectados, a pesar de que ya ha sido reportada la presencia del VHC en este fluido.','2011-02-18','cuasiespecies, virus, virus de hepatitis C, virus de ARN, evoluciÃƒÂ³n viral.',1,1,1,1,1,'2013-09-17 08:41:40','2013-09-17 08:41:40','Documento_664.pdf','application/pdf',4860669,'2013-09-17 08:41:40',19,0,138,'COMPLETO'),(657,'FormaciÃ³n de nanotubos de carbono mediante microondas.','En este Trabajo Especial de Grado se sintetizaron estructuras de carbono mediante la exposiciÃ³n de muestras de grafito con platino (catalizador) a las microondas de un horno domÃ©stico comercial cuya potencia es de 600 Watts y su frecuencia es 2,45GHz. Se variaron las condiciones de presiÃ³n y tipo de gas contenido en el reactor de cristal de cuarzo donde se realizÃ³ el experimento, el tiempo de exposiciÃ³n a las microondas y la cantidad de grafito en la muestra. Se caracteriz\'o morfolÃ³gicamente las muestras obtenidas, en el Laboratorio de Nanomateriales del Departamento de IngenierÃ­a y Ciencias de los Materiales del Instituto Venezolano de Investigaciones CientÃ­ficas (IVIC) con un equipo AFM Agilent 5500 (AFM, STM) con modulo Mac III. Se observaron distintas morfologÃ­as asociadas a carbono. Estas morfolÃ³gicas dependieron de las condiciones experimentales bajo las cuales se produjeron las muestras. El efecto de las condiciones estudiadas sobre las muestras es el siguiente: Alto vacio (10-6 atm), pelÃ­cula Pt/C, pelÃ­cula extra de grafito: favorece la formaciÃ³n de anillos de carbono. Alto vacio (10-6 atm), pelÃ­cula Pt/C: favorece la formaciÃ³n de nanotubos de carbono en bundles pequeÃ±os. Gas Helio (0,5 atm), pelÃ­cula Pt/C, pelÃ­cula extra de grafito: favorece la formaciÃ³n de bundles nanotubos de carbono en forma de araÃ±as.','2011-05-30','SÃƒÂ­ntesis, Microondas, Nanotubos, Carbono, AFM, Bundles.',3,1,1,1,1,'2013-09-17 08:41:41','2013-09-17 08:41:41','Documento_665.pdf','application/pdf',2673561,'2013-09-17 08:41:41',20,0,181,'COMPLETO'),(658,'AnÃ¡lisis de Espectros UV de Estrellas O en las Nubes de Magallanes obtenidos con FUSE','En este trabajo hemos extendido el atlas espectral de estrellas gigantes y supergigantes O de las Nubes de Magallanes observadas con el satÃ©lite Far Ultraviolet Spectrosocopic Explorer (FUSE) en el rango de 900-1200 Ã… (Walborn et al. 2002, ApJS 141, 443), incorporando los espectros de 20 estrellas muy tempranas de la secuencia principal. Estos espectros han sido procesados y organizados por tipo espectral y clase de luminosidad, recuperando las correlaciones entre los vientos estelares y los parÃ¡metros fundamentales delas estrellas O encontradas por Walborn et al. EspecÃ­ficamente, hemos analizado las lÃ­neas espectrales de los iones OVI (ll 1032, 1038 Ã…)y CIII (l 1176 Ã…). AdemÃ¡s, hemos confirmado las anomalÃ­as en la abundancia de CNO en las estrellas de mayor masa y luminosidad (O2) y cuantificado las relaciones encontradas mediante Ã­ndices espectrales definidos para caracterizar los perfiles P Cygni en el doblete OVI y la absorciÃ³n de CIII','2011-01-10','Estrellas, estrellas tipo temprano, espectros UV, FUSE',3,1,1,1,1,'2013-09-17 08:41:44','2013-09-17 08:41:44','Documento_666.pdf','application/pdf',41436343,'2013-09-17 08:41:44',19,0,106,'COMPLETO'),(659,'Portal Web para el Repositorio de Objetos de Aprendizaje de AMBAR','AMBAR es un proyecto de investigaciÃ³n de la Universidad Central de Venezuela (UCV), que busca proporcionar herramientas de software que apoyen el proceso de enseÃ±anza y aprendizaje. Actualmente posee un Repositorio de Objetos de Aprendizaje (ROA), el cual se encuentra relacionado con un Repositorio de Metadata; Ã©stos a su vez pueden ser utilizados desde la plataforma Moodle , todo integrado a travÃ©s de la Capa de Servicios Web. El Objetivo general del presente trabajo fue la realizaciÃ³n de un Portal Web que permitiera la entrada a las diferentes Aplicaciones de AMBAR, haciÃ©ndolo transparente al usuario para su utilizaciÃ³n, ya que el mismo proporciona la reuniÃ³n entre el ROA y el Moodle de AMBAR, a travÃ©s del uso de tecnologÃ­as como Joomla un sistema de administraciÃ³n de contenidos, por sus siglas en ingles C.M.S o Content ManagementSystem, Joomdle un paquete de componentes, mÃ³dulos y plugins para integrar Joomla! y Moodle y los servicios web para la comunicaciÃ³n con el ROA de AMBAR. Para ello se empleÃ³ el Modelado Ãgil (MA) como MÃ©todo de Desarrollo del Software, en el cual a travÃ©s de cuatro iteraciones se instalÃ³ el CMS y Joomdle, tanto desde la aplicaciÃ³n de Joomla como desde Moodle, se modificaron las interfaces del ROA de AMBAR para que se vieran desde el portal, y se llenÃ³ el mismo de informaciÃ³n relacionada con el proyecto AMBAR, tambiÃ©n se realizÃ³ el visualizador SCORM del ROA. Con este trabajo, se estÃ¡ facilitando la integraciÃ³n y la entrada a los recursos de AMBAR ayudando a la gestiÃ³n de los OA almacenados en el ROA, potenciando asÃ­ la posibilidad de incrementar el nÃºmero de usuarios, la retroalimentaciÃ³n, las funcionalidades del sistema completo y los recursos puestos a disposiciÃ³n de los usuarios.','2011-05-27','Objetos de Aprendizaje (OA), Repositorio de Objetos de Aprendizaje (ROA), AMBAR, Moodle, Joomla!, Portal Web, SCORM.',2,1,1,1,1,'2013-09-17 08:41:46','2013-09-17 08:41:46','Documento_667.pdf','application/pdf',620705,'2013-09-17 08:41:46',20,0,54,'COMPLETO'),(660,'MÃ©todos Iterativos Precondicionados para Resolver Problemas de MÃ­nimos Cuadrados Lineales','En este trabajo se estudian y comparan diferentes tÃ©cnicas de precondicionamientopara resolver problemas de mÃ­nimos cuadrados lineales grandes y dispersos mediantemÃ©todos iterativos como LSQR (least square with QR factorization) y CGLS (conjugategradient for least square). Las tÃ©cnicas de precondicionamiento usadas son basadasen factorizaciones incompletas de Cholesky, LU, LQ, entre otras. Se presentan tablasy grÃ¡ficos que muestran los resultados obtenidos de aplicar estas tÃ©cnicas de precondicionamientopara resolver diversos problemas de mÃ­nimos cuadrados lineales provenientesdel arte de medir tierras y de discretizar la ecuaciÃ³n de difusiÃ³n-convecciÃ³n notransistoria mediante el mÃ©todo de Reciprocidad Dual en Multi-Dominios (DRM- MD).','2011-05-23','MÃ­nimos cuadrados, MÃ©todos iterativos, Precondicionamiento, Matrices dispersas',5,1,1,1,1,'2013-09-17 08:41:46','2013-09-17 08:41:46','Documento_668.pdf','application/pdf',1610881,'2013-09-17 08:41:46',20,0,107,'COMPLETO'),(661,'PROTOTIPO PARA UN ARCHIVO DE DOCUMENTOS DIGITALES PROVENIENTES DE LA WEB.MODULO DE CONTROL, ALMACENAMIENTO ESTRUCTURADO, SPIDERS Y PLATAFORMA CLOUD COMPUTING','Un documento digital o impreso tienen ambos un origen comÃºn: son el resultado directa o indirectamente del intelecto humano. Varios son los esfuerzos para preservar documentos, libros, entre otros, para su consulta pÃºblica y para las generaciones futuras. Cada dÃ­a mas la informaciÃ³n se encuentra en formato digital, las noticias se generan y se publican en la World Wide Web. Preservar este tipo de informaciÃ³n es una necesidad para la Venezuela de hoy.El proyecto cubre el desarrollo de un prototipo para la construcciÃ³n del Archivo de Documentos Digitales provenientes de la Web. El proyecto consta de los siguientes componentes: Portal, Panel de Control (Cpanel), el Modulo de Control, Manejador de Trabajos en Background (Robot); Analizador de Documentos, GeneraciÃ³n de Vistas Previas en varios formatos y Spiders, estos tres Ãºltimos soportados por una plataforma de Cloud Computing. Finalmente los componentes para el almacenamiento y gestiÃ³n dedatos soportado por un repositorio de documentos siguiendo el enfoque no-sql, y un Datawarehouse para la consulta y gestiÃ³n de versiones histÃ³ricas.Nuestro trabajo tiene como objetivo aportar al proyecto lo siguiente: 1) Desarrollo del modulo de control, 2) InstalaciÃ³n y desarrollo de interfaces para el uso del repositorio no-sql. 3) Desarrollo de interfaces para el uso de una plataforma de Cloud Computing. 4) LibrerÃ­a para implementar las polÃ­ticas de uso de los URI (Uniform Resource Indentifier) requeridas para el proyecto. 5) ProgramaciÃ³n en la \"nube\" de los spiders y exportaciÃ³n de documentos a varios formatos (Ej: PDF)','2011-05-27','Cloud Computing, Web Archiving, Datawarehouse, Almacenamiento Estructurado',2,1,1,1,1,'2013-09-17 08:41:47','2013-09-17 08:41:47','Documento_669.pdf','application/pdf',1610881,'2013-09-17 08:41:47',20,0,107,'COMPLETO'),(662,'\"\"SÃÃNNTESIS DE LA POLIACRILAMIDA,, VÃÃAA RADICAL LIBRE Y ESTUDIO DE SU APLICACIÃ“Ã“NN COMO AGENTE DE INVERSIÃ“Ã“NN EN EMULSIONES DE AGUA EN CRUDO,, PROVENIENTES DE FOSAS PETROLERAS\"\"','RESUMENEn el siguiente trabajo se procediÃ³ a realizar la sÃ­ntesis de la poliacrilamida vÃ­a radical libre, partiendo del monÃ³mero acrilamida y el iniciador persulfato de sodio, a fin de probar su aplicaciÃ³n como agente de inversiÃ³n en emulsiones de agua en crudo (W/O) proveniente de fosas petroleras. Para ello se sintetizÃ³ tres poliacrilamidas, variando la relaciÃ³n de masa iniciador/monÃ³mero (PAA 0,2%, PAA 0,5% y PAA 1%), con el fin de obtener polÃ­meros con diferentes pesos moleculares, los cuales fueron determinados por viscosimetrÃ­a, comprobando que un aumento en la relaciÃ³n de masa iniciador/ monÃ³mero causa una disminuciÃ³n en el peso molecular del polÃ­mero. Los tres polÃ­meros sintetizados fueron caracterizados por espectroscopia de IR, DCS y TGA, observando que los resultados obtenidos por estas tÃ©cnicas no arrojaron diferencias significativas para cada polÃ­mero. En los espectros de IR se observÃ³ la ausencia de las bandas caracterÃ­sticas de las olefinas (C=C), asÃ­ como la presencia de las bandas caracterÃ­sticas de los alcanos (Csp3) y de los enlaces NH2, C=O y C-N. TambiÃ©n se pudo determinar que las poliacrilamidas sintetizadas son polÃ­meros con gran estabilidad a temperatura ambiente y altamente amorfos, segÃºn los resultados obtenidos por TGA y DSC respectivamente. Una vez caracterizados las poliacrilamidas sintetizadas, se procediÃ³ a realizar los ensayos de inversiÃ³n de fase de la emulsiÃ³n W/ O proveniente de las fosas petroleras, variando algunas condiciones de formaciÃ³n como: relaciÃ³n de volumen entre las fases, tipo de surfactante, concentraciÃ³n de surfactante, peso molecular del polÃ­mero, pH y temperatura; observando que al emplear dicho polÃ­mero como surfactante si se logrÃ³ invertir la emulsiÃ³n de W/O a O/W, alcanzando la mayor estabilidad segÃºn las condiciones trabajadas, cuando se utiliza una concentraciÃ³n de 1,5%m/V de poliacrilamida en soluciÃ³n acuosa, a pH neutro y temperatura ambiente. TambiÃ©n se pudo evidenciar que el peso del molecular de las poliacrilamidas sintetizadas no es un factor que genere una variaciÃ³n importante en la estabilidad de la emulsiÃ³n formada. A fines comparativos y utilizando las mismas condiciones experimentales establecidas para los ensayos de inversiÃ³n con la poliacrilamida, se empleo otro surfactante formado por una mezcla de polÃ­meros (PAA-PVA), observando que dicha mezcla tambiÃ©n logra mantener la emulsiÃ³n O/W, alcanzando la mayor estabilidad (segÃºn las condiciones trabajadas) cuando se utiliza una mezcla del 10%m/m de PVA/PAA, a una concentraciÃ³n de 1,5%m/V en soluciÃ³n acuosa, a pH neutro y temperatura ambiente. TambiÃ©n, se pudo observar que la emulsiÃ³n estabilizada con la mezcla es mÃ¡s estable que la estabilizada con poliacrilamida, lo cual se pudo comprobar por el tamaÃ±o de las gotas de la fase dispersa y el tiempo que transcurre para que ocurra la coalescencia de las mismas. Por lo que se puede asegurar que la mezcla PAA-PVA actÃºa como mejor surfactante que la PAA para estabilizar emulsiones de crudo en agua, en las condiciones trabajadas.','2011-05-31','poliacrilamida, emulsiÃ³n de agua en crudo, inversiÃ³n',6,1,1,1,1,'2013-09-17 08:41:48','2013-09-17 08:41:48','Documento_670.pdf','application/pdf',5350902,'2013-09-17 08:41:48',20,0,85,'COMPLETO'),(663,'ESTUDIOS DE FORMACION DE COMPLEJOS TERNARIOS DE Ni(II),CON EL ACIDO DIPICOLINICO Y LOS AMINOACIDOS a-ALANINA,b-ALANINA,PROLINA Y GLICINA MEDIANTE MEDIDAS DE EMF(H) EN NaCl 1,0M A 25C','En el siguiente trabajo mediante medidas de Fuerza Electromotriz emf (H),empleando como medio iÃ³nico NaCl 1,0 M, y a una temperatura de 25,0 ÂºC sedeterminaron las constantes de acidez (pKa) y las constantes de equilibrio de loscomplejos formados (log b) del acido dipicolinico y los aminoÃ¡cidos: a- alanina, b-alanina,prolina y glicinaLos datos experimentales [H, B, C, Eo, J, (v, E) np]ns fueron tratados mediante elprogr