:50','2013-09-17 08:41:50','Documento_672.pdf','application/pdf',2126970,'2013-09-17 08:41:50',19,0,96,'COMPLETO'),(665,'DESARROLLO DE UN MÃ‰Ã‰TTODO PARA DETERMINACIÃ“Ã“NN DE MELAMINAEN LECHE MEDIANTE LA TÃ‰Ã‰CCNICA HPLC--UVDESARROLLO DE UN MÃ‰Ã‰TTODO PARA DETERMINACIÃ“Ã“NN DE MELAMINAEN LECHE MEDIANTE LA TÃ‰Ã‰CCNICA HPLC--UV','Enel presente trabajo experimental, se desarrollÃ³ una metodologÃ­a para ladeterminaciÃ³n de melamina en leche en polvo, en el contexto de establecer sidicho compuesto habÃ­a sido empleado en la adulteraciÃ³n del contenido proteicode la misma. Dicha metodologÃ­a, deberÃ­a ser simple en el tratamiento de lamuestra y posterior anÃ¡lisis, con la finalidad de obtener una respuesta rÃ¡piday concluyente, al ser aplicado a productos comercializados por los proveedoresnacionales. LatÃ©cnica utilizada fue la cromatografÃ­a lÃ­quida de alta eficiencia, condetecciÃ³n por espectroscopÃ­a molecular UV y por el modo de separaciÃ³n \"relativamente nuevo\", de InteracciÃ³n HidrofÃ­lica.El cual es un mÃ©todo de separaciÃ³n para compuestos altamente polares ehidrofÃ­licos, y por otra parte, no se requiere de tratamientos previos muyextensivos, ideal para este tipo de muestras. Las condicionescromatogrÃ¡ficas encontradas, fueron realizadas mediante una columnaSec-Quant ZIC-HILIC (150 x 4,6 mm, 4 Âµm/200 Ao), fase mÃ³vil:Acetronitrilo-agua 85/15 (25,0 mM de acetato de amonio), flujo: 0,5 mL/min, l: 220nm y un Vol. InyecciÃ³n de inyecciÃ³n: 50 mL. El tiempo total de anÃ¡lisis fue de30 min por muestra. El tratamiento de lamuestra fue simple y rÃ¡pido, mediante las etapas de extracciÃ³n, centrifugaciÃ³n,decantaciÃ³n y ultra- centrifugaciÃ³n respectivamente. La banda de melamina presentÃ³un ligero solapamiento con respecto a una banda de la matriz de leche, peropara efectos de estudios de contaminaciÃ³n, fue suficientemente satisfactoria.El valor mÃ­nimo reportado de contaminaciÃ³n corresponde a 139 mg/kg, sin embargopor esta metodologÃ­a es posible determinar hasta 30 mg/Kg en la leche cruda. Las muestras de leche deproveedores locales no arrojaron concentraciones considerables de melamina, locual sugiere que al menos para las muestras en estudio, no presentaronadulteraciÃ³n, con el fin de aumentar el contenido proteico.','2011-05-27','Melamina Esun compuesto orgÃ¡nico que se obtiene de la urea, con fÃ³rmula quÃ­mica C3H6N6y cuyo nombre IUPAC es 2,4,6-triamino-1,3,5-triazina, vÃ©ase figura 2. Es un trÃ­mero(estÃ¡ constituida por tres molÃ©culas iguales) de cianamida,formando un heteroci',6,1,1,1,1,'2013-09-17 08:41:52','2013-09-17 08:41:52','Documento_673.pdf','application/pdf',1093166,'2013-09-17 08:41:52',18,0,128,'COMPLETO'),(666,'Estudio de la formaciÃ³Ã³nn de los complejos de Vanadio ((IV))..Sistema VO22++ -- TriptÃ³Ã³ffano ((Trp))((KCl 33..00 M,, 2255Â°Â°C))','En el presente trabajo se estudiaron los sistemas: H+ - triptÃ³fano (Trp, HC) H+ - VO2+ - HC por medio de medidas de fuerzas electromotrices emf(H) a 25ÂºC y en KCl 3.0 M como medio iÃ³nico inerte. El anÃ¡lisis de los datos experimentales de cada sistema se realizÃ³ mediante el programa de mÃ­nimos cuadrados LETAGROP, obteniÃ©ndose los siguientes valores de pKa para el triptÃ³fano y las constantes de estabilidad bpqr de los complejos , segÃºn las siguientes reacciones generales:Â· Sistema H++ -- triptÃ³Ã³ffano H+ + HC H2C+ HC C-+ H+ EspeciespKa Log bp00rH2C+2.71(2)2.71(2)HC9.57(2)-9.57(2)s (thc)0.0200.010 Â· Sistema H++ -- VO22++ -- triptÃ³Ã³ffanop H++ q VO2++ r C- Hp(VO)q (C)rp+2q-r Especies Log bpqr [HVOC]2+11.73(4)[VOC]+ 7.74(3)s(thc)0.010','2011-05-27','Estudio de la formaciÃ³Ã³nn de los complejos de Vanadio ((IV))..Sistema VO22++ -- TriptÃ³Ã³ffano ((Trp))((KCl 33..00 M,, 2255Â°Â°C))',6,1,1,1,1,'2013-09-17 08:41:52','2013-09-17 08:41:52','Documento_674.pdf','application/pdf',3069644,'2013-09-17 08:41:52',20,0,133,'COMPLETO'),(667,'SimulaciÃ³n microscÃ³pica de trÃ¡fico vehicular basada en agentes inteligentes','La demanda de transporte, movida principalmente por las necesidades y deseos de movilizaciÃ³n de las personas, y la oferta requerida para poder suplir esa demanda es un tema importante de estudio en ingenierÃ­a civil y planificaciÃ³n urbanÃ­stica. El presente Trabajo Especial de Grado propone la utilizaciÃ³n de un conjunto de herramientas para la construcciÃ³n de estudios de trÃ¡fico sobre desarrollos urbanÃ­sticos actuales y a futuro apoyados en el toolkitMATSim, un simulador microscÃ³pico de trÃ¡fico basado en agentes inteligentes. Para probar la eficacia de este toolkitse realizaron un conjunto de pruebas con datos reales de la zona de Caracas de Los Cortijos de Lourdes y Los Ruices. Los resultados obtenidos develan que esta herramienta provee resultados utilizables y adaptables a las necesidades del analista de trÃ¡fico, generando resultados realistas con respecto a la dinÃ¡mica vehicular de una zona particular.','2011-05-30','simulaciÃƒÂ³n, agentes inteligentes, trÃƒÂ¡fico vehicular, anÃƒÂ¡lisis de demanda de transporte',2,1,1,1,1,'2013-09-17 08:41:54','2013-09-17 08:41:54','Documento_675.pdf','application/pdf',2159134,'2013-09-17 08:41:54',20,0,94,'COMPLETO'),(668,'Normal 0 21 false false false ES-VE X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi; mso-fareast-language:EN-US;} DOSIMETRÃÃAA CON CÃÃMMARA DE IONIZACIÃ“Ã“NN EN CAMPOS DE MEGAVOL