3 (Start: 235.0, Stop:270.0).','2010-12-16','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',3,1,1,1,1,'2013-09-17 08:41:55','2013-09-17 08:41:55','Documento_677.pdf','application/pdf',2156214,'2013-09-17 08:41:55',20,0,156,'COMPLETO'),(669,'Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin- bottom:.0001pt; mso-pagination:widow-orphan; font-size:10.0pt; font-family: \"Times New Roman\"; mso-ansi-language:#0400; mso-fareast-language:#0400; mso- bidi-language:#0400;} Evaluar algunos MÃ©Ã©todos de extracciÃ³Ã³nn que se emplean en la determinaciÃ³Ã³nn del FÃ³Ã³ssforo en muestras de sedimentos con las tÃ©Ã©cnicas de ICP-- AES y ColorimetrÃ­Ã­a..','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Este trabajo de investigaciÃ³n consistiÃ³ en la determinaciÃ³n y cuantificaciÃ³n de FÃ³sforo en muestras de referencia y de sedimento. Para la extracciÃ³n se emplearon los mÃ©todos Ã¡cido- base, secuencial e igniciÃ³n y para el anÃ¡lisis se usaron las tÃ©cnicas de ICP y ColorimetrÃ­a. Los mÃ©todos propuestos estuvieron basados en la digestiÃ³n Ã¡cido-base empleando HNO3. Para la extracciÃ³n secuencial se empleÃ³ con HCl 1M, seguido de HNO3 concentrado en caliente y el mÃ©todo por igniciÃ³n, se calcinÃ³ la muestra a 550 ÂºC por dos horas, seguido de HCl 1M. La exactitud de los anÃ¡lisis fue alta, ya que la concentraciÃ³n de P total determinada en la muestra con concentraciÃ³n de P conocida es de 0,16 Â± 0,01 % P2O5; intervalo en el cual se encuentra el valor real. La cantidad de fÃ³sforo extraÃ­do con las tres digestiones fue considerada del 100 %. De acuerdo a estos resultados fue posible establecer que el mÃ©todo que incluye la tercera digestiÃ³n con HF(c)/HNO3(c) es mÃ¡s efectivo que aquel que solo utilizÃ³ HCl 1 M y HNO3(c) para la extracciÃ³n.','2011-05-26','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',6,1,1,1,1,'2013-09-17 08:41:56','2013-09-17 08:41:56','Documento_678.pdf','application/pdf',3121406,'2013-09-17 08:41:56',19,0,100,'COMPLETO'),(670,'DESARROLLO DE UN SISTEMA DE ALQUILER DE CANCHAS DE TENIS USANDO ELEMENTOS DE APLICACIONES WEB ENRIQUECIDAS','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Para el desarrollo del Sistema de alquiler de canchas de Tenis de la F.V.T es indispensable el uso de herramientas que ayuden de manera versÃ¡til y eficaz en la construcciÃ³n de esta aplicaciÃ³n. Adicionalmente, se quiere que esta aplicaciÃ³n