ulo de control, 2) InstalaciÃ³n y desarrollo de interfaces para el uso del repositorio no-sql. 3) Desarrollo de interfaces para el uso de una plataforma de Cloud Computing. 4) LibrerÃ­a para implementar las polÃ­ticas de uso de los URI (Uniform Resource Indentifier) requeridas para el proyecto. 5) ProgramaciÃ³n en la \"nube\" de los spiders y exportaciÃ³n de documentos a varios formatos (Ej: PDF)','2011-06-10','Cloud Computing, Web Archiving, Datawarehouse, Almacenamiento Estructurado',2,1,1,1,1,'2013-09-17 08:41:59','2013-09-17 08:41:59','Documento_680.pdf','application/pdf',3484267,'2013-09-17 08:41:59',20,0,132,'COMPLETO'),(672,'ALTERACIONES ULTRAESTRUCTURALES DE PULMÃ“N EN RATONES INFECTADOS EXPERIMENTALMENTE CON DOS AISLADOS DE T.. evansi DE VENEZUELA','Trypanosoma evansi,,es un protozoario hemoflagelado, causante de la tripanosomosis equina. El parÃ¡sito es transmitido mecÃ¡nicamente por dÃ­pteros hematÃ³fagos de un mamÃ­fero a otro a travÃ©s de su picadura. Una vez en el vertebrado, el tripanosoma se reproduce por fisiÃ³n binaria, entrando al torrente sanguÃ­neo. Ha sido descrito en Asia, Ãfrica y SuramÃ©rica. En Venezuela, incide principalmente en los llanos, teniendo cierto impacto en las actividades agropecuarias. Se sabe, que la patogenicidad del parÃ¡sito varÃ­a de un Ã¡rea geogrÃ¡fica a otra. En este sentido, se han realizado investigaciones con aislados venezolanos, reportando alteraciones ultraestructurales en riÃ±Ã³n e hÃ­gado a travÃ©s de infecciones experimentales de modelos murinos, con el fin de ahondar en la patologÃ­a de la enfermedad. Sin embargo, no se encuentran registros de investigaciones realizadas en pulmÃ³n, siendo este un Ã³rgano tan vinculado al sistema vascular, cabe preguntarse acerca de los cambios submicroscÃ³picos de este tejido debido al T.. evansi. Por esta razÃ³n, se plantea como objetivo, describir las alteraciones ultraestructurales del pulmÃ³n en ratones infectados experimentalmente. Para ello, lotes de ratones hembras de 20 gramos de peso corporal fueron infectados con 1 tripomastigote/gramo de peso corporal con dos aislado de T.. evanside Venezuela; al alcanzar una parasitemia del orden de 107, los animales fueron sacrificados interdiariamente para extraer muestras del pulmÃ³n, por ablaciÃ³n quirÃºrgica, las muestras se fraccionaron en porciones de 2 mm3 que se fijaron en soluciÃ³n Karnovsky (glutaraldehido al 2,5% y formaldehido al 37% en buffer fosfato de Millonig a pH 7, 4 y 320 mOsm), seguidamente fueron lavados en buffer Millonig y post- fijadas con tetrÃ³xido de osmio al 1%. Luego, se deshidrataron en una baterÃ­a de etanol de concentraciones crecientes, dos cambios con Ã³xido de propileno y otro en Ã³xido de propileno-epÃ³n (1:1). Finalmente, las muestras fueron incluidas en resina epÃ³xica (48 horas; 60ÂºC). Los cortes finos (60-90nm) se obtuvieron en un ultramicrotomo Porter-Blum MT2-B. Las secciones obtenidas se contrastaron con acetato de uranilo y citrato de plomo. Finalmente las rejillas fueron examinadas en un Microscopio marca JEOL JEM-1011, efectuando registro permanente en negativos de 8,3 x 10,2cm para su posterior revelado y anÃ¡lisis. Los resultados revelan daÃ±os en la microvasculatura que incluyen engrosamiento de la membrana basal de los capilares, disminuciÃ³n del numero de caveolas y prolongaciones endoteliales; asi mismo se presenta un aumento en el infiltrado celular, esto sugiere un daÃ±o importante causado por la presencia del parasito en el lecho capilar pulmonar.','2011-05-24','pulmÃƒÂ³n, Trypanosoma, ultraestructura',1,1,1,1,1,'2013-09-17 08:42:01','2013-09-17 08:42:01','Documento_681.pdf','application/pdf',11247315,'2013-09-17 08:42:01',17,0,162,'COMPLETO'),(673,'DiagnÃ³stico serolÃ³gico diferencial de la fase aguda y crÃ³nica de la Esquistosomiasis: estudio de las glicoproteÃ­nas del glicocalix de la cercaria.','La Esquistosomiasis o Bilharziosis es una de las enfermedades parasitarias mÃ¡s difundida en el mundo que afecta a mÃ¡s de 200 millones de