separaciÃ³n. Los antÃ­genos identificados en una u otra regiÃ³n como consecuencia de la separaciÃ³n (58,2 y 64 kDa en cuerpos y 35 y 53,6 kDa en cuerpos y colas). Los antÃ­genos identificados en los extractos de cuerpos y de colas no resultaron ser la suma de los identificados en el extracto de cercarias completas. AntÃ­genos de peso molecular entre 16,5- 84,3 kDa fueron reconocidos durante las primeras seis semanas de infecciÃ³n (fase aguda) y a las 16 semanas (fase crÃ³nica), antÃ­genos adicionales de alto peso molecular fueron detectados (104-109,8 kDa). Esto podrÃ­a ser consecuencia de eventos inmunitarios producidos durante el progreso de la fase crÃ³nica de la infecciÃ³n. La oxidaciÃ³n-reducciÃ³n con metaperiodato de sodio/borohidrato de sodio de la glicoproteÃ­na antigÃ©nica dominante de 65 kDa, no alterÃ³ su reconocimiento por el suero de infecciÃ³n aguda y crÃ³nica, mientras que las de 97,5-100 y 108,2 kDa fueron reconocidas antes y despuÃ©s del tratamiento Ãºnicamente por el suero de infecciÃ³n crÃ³nica. Esto sugiere que los anticuerpos producidos durante la infecciÃ³n crÃ³nica estÃ¡n dirigidos contra epÃ­topes glicosÃ­dicos y peptÃ­dicos de estas glicoproteÃ­nas, lo que puede explicar la reducciÃ³n en intensidad de las bandas del doblete de 97,5-100 kDa reconocidas por el suero de infecciÃ³n crÃ³nica despuÃ©s del tratamiento. El hecho de que en la infecciÃ³n aguda se produzcan anticuerpos que reconocen epÃ­topes polipeptÃ­dicos en la glicoproteÃ­na de 65 kDa y en la fase crÃ³nica contra otros tres (97,5-100 y 108,2 kDa), podrÃ­a ser Ãºtil para la identificaciÃ³n de su secuencia polipeptÃ­dica conducente a la sÃ­ntesis quÃ­mica de epÃ­topes lineales destinados a la discriminaciÃ³n de estas dos fases de la enfermedad. La evaluaciÃ³n de reactividad cruzada con otros parÃ¡sitos relacionados es requerida para determinar la especificidad de estos epÃ­topes de antÃ­genos glicoprotÃ©icos.','2011-02-16','Esquistosomiasis, Schistosoma mansoni, Cercarias, Glicocalix, GlicoproteÃ­nas, DiagnÃ³stico',1,1,1,1,1,'2013-09-17 08:42:02','2013-09-17 08:42:02','Documento_682.pdf','application/pdf',405758,'2013-09-17 08:42:02',19,0,99,'COMPLETO'),(674,'Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Blattella germanicaLINNAEUS,, 11776677 ((BLATTARIA:: BLATTELLIDAE)),, BASES PARA UN MODELO EXPERIMENTAL DE ANÃÃLLISIS DEL CRECIMIENTO POBLACIONAL DE PLAGAS:: SU RELACIÃ“Ã“NN CON LA EDAD Y EL VALOR REPRODUCTIVO..','Normal 0 21 false false false ES X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Las cucarachas constituyen tanto a nivel de salud pÃºblica como para la industria agroalimentaria, un elemento de gran importancia debido a que estas contaminan a los alimentos y el agua de consumo con sus excretas, restos de exoesqueleto, mal olor y organismos patÃ³genos causantes de enfermedades al hombre. Las cucarachas desarrollan resistencia a los insecticidas quÃ­micos con rapidez, por lo que se dificulta su control. Blatella germanicaes conocida mundialmente como \"cucaracha alemana\", en nuestro paÃ­s se le llama \"chiripa\" y entre las cucarachas que son plagas domÃ©sticas es la mÃ¡s importante debido a su amplia distribuciÃ³n geogrÃ¡fica. El conocimiento de los aspectos de la biologÃ­a de Blattella germanicay su relaciÃ³n con las variables ambientales en los cuales habita, su desarrollo embrionario y su fecundidad, son de elevado interÃ©s en el momento de planificar y ejecutar acciones de control. En esta investigaciÃ³n analizamos en condiciones de laboratorio la relaciÃ³n entre la edad de los progenitores, la reproducciÃ³n de Blattella germanica y el ciclo de vida ninfal, asÃ­ como estas caracterÃ­sticas afectan el crecimiento poblacional de este blÃ¡tido. Para ello utilizamos una colonia de Blattella germanica criada en el laboratorio y originaria de la Urb. La Candelaria, Maracay, estado Aragua. Ninfas de esta colonia se desarrollaron de manera individual hasta adultos, en frascos de vidrio de 500 ml de capacidad, con soporte de cartulina plegada a temperatura y humedad ambiental del laboratorio (23,79 Â± 0,98ÂºC y 65,12 Â± 8,81% de HR). A partir, de los adultos resultantes, se conformaron 45 parejas distribuidas equitativamente en 9 tratamientos. En estos, variamos las edades de la hembra y del macho, pudiendo ser Ã³ no similares entre sÃ­. Se realizaron observaciones diarias con el propÃ³sito de determinar el nÃºmero de dÃ­as previos a la observaciÃ³n de las ootecas en la abertura genital, nÃºmero de dÃ­as transcurridos entre la observaciÃ³n y la liberaciÃ³n de las ootecas, nÃºmero de dÃ­as que le tomÃ³ a las ninfas emerger, nÃºmero de ootecas viables y nÃºmero de ninfas emergidas por cada ooteca de Blattella germanica..Se realizaron observaciones semanales sobre las ninfas obtenidas de cada ooteca viable, para asÃ­ estimar el tiempo de desarrollo ninfal, el nÃºmero de individuos promedio emergidos por ooteca Ã³ fertilidad (Fx), supervivencia de las ninfas (lx) y la proporciÃ³n de sexos. Con estos datos se elaboraron tablas de vida dinÃ¡micas considerando como unidad de tiempo, el tiempo promedio de la duraciÃ³n del ciclo ootecal, siendo este determinado por dos fases, la primera que corresponde al nÃºmero de dÃ­as transcurridos hasta la observaciÃ³n de una ooteca en la abertura genital y la segunda fase que corresponde al nÃºmero de dÃ­as que transcurren luego que la ooteca se observÃ³ en la abertura genital hasta que es liberada. El ciclo ootecal tiene una duraciÃ³n promedio de 35,46 Â± 5,03 dÃ­as, donde la primera fase abarca 9,24 Â± 2,23 dÃ­as y la segunda fase 26,78 Â± 2,66 dÃ­as. B.. germanicacolocÃ³ un mÃ¡ximo de 6 ootecas viables (OV), estas se observaron durante los 7 primeros ciclos ootecales. El nÃºmero de ootecas viables variÃ³ segÃºn los tratamientos, relacionÃ¡ndose muy probablemente con las caracterÃ­sticas del macho, de allÃ­ que se proponen: machos Tipo I Ã³ los reciÃ©n emergidos y los machos Tipo II de edad similar a la hembra. Tanto la supervivencia (lx) como la fecundidad (mx) se vieron reducidos en las secuencias ootecales sucesivas y no fueron independientes de la estructuraciÃ³n de los tratamientos; en consecuencia, estos afectaron a los parÃ¡metros poblacionales relacionados: valor reproductivo (Vx), tasa neta de reproducciÃ³n (Ro), la tasa intrÃ­nseca de crecimiento (r), tiempo generacional (T) y tasa finita de multiplicaciÃ³n (l). El nÃºmero promedio de septos que se observÃ³ en las ootecas fue de 34,48, y el nÃºmero promedio de ninfas que emergieron por ooteca fue de 31,42 individuos. La proporciÃ³n de sexos fue de 1,06 hembras por cada macho. El mÃ¡ximo valor reproductivo (vx) se obtuvo en aquellas edades donde se produjo la primera ooteca viable (OV) de cada tratamiento. La reproducciÃ³n en B.. germanica se ve afectada principalmente por las caracterÃ­sticas del macho al momento de la copula y por la edad de la hembra lo cual guarda una relaciÃ³n con la viabilidad de la ooteca. El mÃ¡ximo valor reproductivo (vx) se observÃ³ asociado a la producciÃ³n de la primera ooteca viable, particularmente en los casos donde las hembras y los machos tenÃ­an edades similares, disminuyendo en las ootecas subsiguientes.','2011-05-18','Blattella germanica, Ciclo Ootecal, Tablas de vida, Blattaria, Blattellidae, anÃ¡lisis de crecimiento poblacional de plagas.',1,1,1,1,1,'2013-09-17 08:42:03','2013-09-17 08:42:03','Documento_683.pdf','application/pdf',539514,'2013-09-17 08:42:03',17,0,114,'COMPLETO'),(675,'Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Blattella germanicaLINNAEUS,, 11776677 ((BLATTARIA:: BLATTELLIDAE)),, BASES PARA UN MODELO EXPERIMENTAL DE ANÃÃLLISIS DEL CRECIMIENTO POBLACIONAL DE PLAGAS:: SU RELACIÃ“Ã“NN CON LA EDAD Y EL VALOR REPRODUCTIVO..','Normal 0 21 false false false ES X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso