³n geoquÃ­mica de los sedimentos de fondo de la cuenca del RÃ­o Tuy, con el propÃ³sito de establecer la composiciÃ³n granulomÃ©trica de los sedimentos de fondo, la distribuciÃ³n de los metales pesados analizados en las distintas fracciones granulomÃ©tricas del sedimento y al mismo tiempo determinar la concentraciÃ³n de metales pesados en los puntos de muestreo establecidos en la fracciÃ³n <230 mallas. Desde el punto de vista quÃ­mico, los sedimentos fueron sometidos a un proceso de extracciÃ³n Ã¡cida secuencial, empleando HCl (1M) en frÃ­o y HNO3concentrado en caliente, para posteriormente realizar la determinaciÃ³n de todos los elementos de interÃ©s mediante la tÃ©cnica de espectroscopia de emisiÃ³n atÃ³mica con fuente de plasma inductivamente acoplado, a excepciÃ³n del Hg, el cual fue determinado por un equipo DMA-80. Los resultados indicaron que aguas arriba del RÃ­o Tuy predominan las fracciones mÃ¡s gruesas del sedimento atribuida a la morfologÃ­a de la pendiente la cual es abrupta, ademÃ¡s de la alta energÃ­a del rÃ­o, mientras que aguas abajo de la cuenca predominan las fracciones de arenas medias a finas del sedimento, atribuyÃ©ndolo a la poca energÃ­a del RÃ­o y a las menores pendientes, lo que trae como consecuencia, que dominen procesos de floculaciÃ³n y sedimentaciÃ³n. Por otro lado los elementos analizados fueron extraÃ­dos mayormente con el HNO3concentrado, que con el HCl diluido. Esto indicÃ³ que los elementos estÃ¡n mÃ¡s asociados a la materia orgÃ¡nica, arcillas y oxihidrÃ³xidos cristalinos; a excepciÃ³n del Cd y Mn que no presentan diferencia en la concentraciÃ³n obtenida con ambos Ã¡cidos, A su vez, lo elementos Al, Cr, Ni, Hg, Cu, Pb, Mn, Fe y Zn, tienden a acumularse preferiblemente en la fracciÃ³n <230 mallas, corroborando la escogencia de este tamaÃ±o de grano para el anÃ¡lisis de estos elementos, mientras que en los elementos As y Cd, no existe una fracciÃ³n del sedimento preferencial en la que tiendan a acumularse. Adicional a esto, la distribuciÃ³n geoquÃ­mica de los elementos Al, Mn, Fe y Co son atribuidos principalmente a factores litolÃ³gicos, mientras que la concentraciÃ³n de los elementos Zn, Cu, Pb, Cr, Ni, As, Hg y Cd estÃ¡n asociados a las actividades domÃ©sticas, agropecuarias e industriales. Las zonas de mayor alteraciÃ³n ambiental en el RÃ­o Tuy fueron Guayas, Santa Teresa, Los Galpones, Araguita y Panaquire, por su parte, los rÃ­os SÃºcuta, Taguaza, Tarma, Qda Yaguapo, Qda Sapo, RÃ­o Panaquirito y Qda Urba, son afluentes que no presentan alteraciÃ³n ambiental y que mejoran la calidad del RÃ­o Tuy, mientras que los rÃ­os Guaire y Caucagua, son afluentes de mayor alteraciÃ³n ambiental que desestabilizan y deterioran al RÃ­o Tuy.','2011-05-25','RÃo Tuy, Metales Pesados, Sedimentos de fondo, Alteracion ambiental',4,1,1,1,1,'2013-09-17 08:42:09','2013-09-17 08:42:09','Documento_687.pdf','application/pdf',9520721,'2013-09-17 08:42:09',20,0,124,'COMPLETO'),(679,'ParalelizaciÃ³Ã³nn del modelo hiodrodinÃ¡Ã¡mico y de transporte de sedimentos Shal22D..','El Modelo Shal2D es un modelo hidrodinÃ¡mico y de transporte de sedimentosbidimensional desarrollado por los ingenieros del Instituto de MecÃ¡nica de Fluidos dela facultad de IngenierÃ­a de la Universidad Central de Venezuela. Este modelo se encargade estudiar la dinÃ¡mica de fluidos incompresibles y el transporte de sedimentosen esos fluidos. El software permite obtener ciertas caracterÃ­sticas de los rÃ­os comovelocidades, profundidad y elevaciÃ³n de varios puntos sobre un caudal. AdemÃ¡s deesto, dependiendo de la cantidad de sedimentos y el tipo de material, se estudia comoestas son trasladadas, segÃºn la velocidad horizontal en ese punto.Para reducir los tiempos de ejecuciÃ³n de este modelo secuencial en este trabajo sepresenta el desarrollo de una aplicaciÃ³n Shal2D paralela que permite dar resultados enun tiempo menor, y un refinamiento de la malla de entrada como preprocesamientode datos utilizando el software triangle para la generaciÃ³n de 