o-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Este trabajo tiene como objetivo el desarrollo de un prototipo basado en minerÃ­a de textos para la asignaciÃ³n automÃ¡tica de jurados a Trabajos Especiales de Grado (TEG), a travÃ©s de la clasificaciÃ³n de los documentos dentro de las Ã¡reas profesionales de la Escuela de ComputaciÃ³n. Para la creaciÃ³n del clasificador se aplicÃ³ el proceso de minerÃ­a de textos sobre una recopilaciÃ³n de documentos de TEG, lo cuales fueron preprocesados, eliminando signos de puntuaciÃ³n, palabras no informativas y aplicando word stemming, y representados mediante el modelo de espacio vectorial con diferentes tÃ©cnicas de indexaciÃ³n. Asimismo, se probaron diferentes medidas de relevancia para la reducciÃ³n de la dimensionalidad del espacio de atributos. Para la estimaciÃ³n del modelo de clasificaciÃ³n se realizaron pruebas aplicando el algoritmo k vecinos mÃ¡s cercanos con diferentes parÃ¡metros, alcanzando un 82% de clasificaciones correctas. A travÃ©s de la recomendaciÃ³n de hasta dos Ã¡reas, se logrÃ³ incrementar el porcentaje de clasificaciones correctas a 95%. Este mÃ³dulo de recomendaciÃ³n de Ã¡reas se integrÃ³ con el mÃ³dulo de asignaciÃ³n, con el fin de realizar la asignaciÃ³n de los jurados, considerando a los profesores pertenecientes al o las Ã¡reas recomendadas, en base a criterios de elecciÃ³n previamente definidos. En conclusiÃ³n, fue posible obtener un buen rendimiento de clasificaciÃ³n de documentos de TEG aplicando minerÃ­a de textos y se logrÃ³ automatizar el proceso de asignaciÃ³n de jurados a TEG, lo que a su vez permite llevar un registro histÃ³rico de las asignaciones, contribuyendo ademÃ¡s con la automatizaciÃ³n de procesos de la Escuela de ComputaciÃ³n.','2011-06-03','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:42:17','2013-09-17 08:42:17','Documento_691.pdf','application/pdf',770590,'2013-09-17 08:42:17',20,0,111,'COMPLETO'),(683,'Desarrollo de una soluciÃ³Ã³nn analÃ­Ã­tica para la administraciÃ³Ã³nn de las relaciones con los clientes','Es importante para las organizaciones generar relaciones rentables con los clientes. La AdministraciÃ³n de las Relaciones con los Clientes (CRM, por sus siglas en inglÃ©s) es una estrategia que busca entender y anticipar las necesidades de los clientes, es decir, es una estrategia de negocio basada en el negocio. Los sistemas CRM, se dividen en tres tipos segÃºn sus funciones, el primero es el operacional que cumple con la automatizaciÃ³n de las ventas, servicios y mercadeo; el segundo es el colaborativo que administra una comunicaciÃ³n mÃ¡s directa y de retroalimentaciÃ³n con los clientes y por Ãºltimo el analÃ­tico que hace un estudio del comportamiento del cliente segÃºn los datos generados por los dos tipos de CRM anteriores. El presente trabajo especial de grado (TEG) consiste en el desarrollo de una soluciÃ³n analÃ­tica para la administraciÃ³n de las relaciones con los clientes, es decir un Sistema CRM AnalÃ­tico, usando la metodologÃ­a Lifecyclepropuesta por Ralph Kimball (Kimball, Ross, Thornthwaite, Mundy, Becker 2008) para la implementaciÃ³n de soluciones de inteligencia de negocios. El sistema se sustenta de los datos de la soluciÃ³n AADempiere, la cual cuenta con un proceso de CRM operacional basado en software libre y desarrollado bajo la licencia pÃºblica general de GNU. Para el desarrollo del CRM AnalÃ­tico se utiliza una plataforma de inteligencia de negocio Pentaho, tambiÃ©n software libre. Con ella se construyen funcionalidades para el estudio y comportamiento del cliente, empezando por su segmentaciÃ³n geogrÃ¡fica y demogrÃ¡fica, descubriendo sus preferencias entre los diferentes productos, los representantes de ventas mÃ¡s destacados y el efecto que tienen las campaÃ±as en su comportamiento. Todo esto haciendo un estudio de las ventas de una empresa de venta al detal cargada en el sistema transaccional.','2011-07-22','Palabras Claves: AdministraciÃƒÂ³n de Relaciones con los Clientes, PlanificaciÃƒÂ³n de Recursos Empresariales, Inteligencia de Negocio, Software Libre.',2,1,1,1,1,'2013-09-17 08:42:18','2013-09-17 08:42:18','Documento_692.pdf','application/pdf',4067585,'2013-09-17 08:42:18',18,0,128,'COMPLETO'),(684,'AdecuaciÃ³n de la modelaciÃ³n Ã¡gil reutilizando componentes en construcciÃ³n de interfaces de usuario. Caso de estudio: Registro de publicaciones periÃ³dicas.','Una de las problemÃ¡ticas abordada por la IngenierÃ­a de software es el incumplimiento en los tiempos de entrega de los productos de software, algunos esfuerzos estÃ¡n dirigidos a introducir en el desarrollo el reuso de componentes que, en experiencias previas, han resultado exitosos. Estos componentes estÃ¡n expresados como patrones (diseÃ±o, arquitectura, interacciÃ³n, entre otros) o como piezas de software disponibles en librerÃ­as y/o la web (repositorios y/ o pÃ¡ginas especializadas). El presente Trabajo Especial de Grado muestra una experiencia de desarrollo de software, donde se incorpora el reuso de componentes en la construcciÃ³n y puesta en marcha de una interfaz para el \"Registro Digital de Publicaciones PeriÃ³dicas\" del Banco Central de Venezuela. El objetivo del Trabajo Especial de Grado es desarrollar la interfaz de usuario, adecuando el modelado Ã¡gil con tÃ©cnicas de usabilidad, que faciliten la reutilizaciÃ³n de componentes tanto a nivel de especificaciÃ³n como de cÃ³digo en el dominio de las bibliotecas virtuales, a fin de obtener un producto usable.En la experiencia se obtuvo como producto desde la perspectiva metodolÃ³gica, la adecuaciÃ³n del mÃ©todo de desarrollo Ã¡gil propuesto por Ambler (2002) y el lenguaje de patrones de interacciÃ³n propuesto por Acosta (2004), identificando el patrÃ³n de dominio y de algunas tareas cuyas especificaciones y cÃ³digo fueron reusadas en el desarrollo. Algunas adaptaciones entre los elementos fueron realizadas a fin de lograr la coherencia y consistencia en la interfaz de usuario. Las entregas fueron realizadas en tiempos aceptables para el cliente. Desde la perspectiva del producto software, se logra migrar el modelo conceptual del usuario de las aplicaciones exitosas al nuevo producto, garantizando que los aspectos de usabilidad tambiÃ©n fueran migrados. Para constatar la usabilidad lograda y en concordancia con el modelado Ã¡gil, se aplicaron inspecciones y evaluaciones heurÃ­sticas al final de cada una de las iteraciones propuestas.','2011-07-15','ReutilizaciÃ³n, Usabilidad, MÃ©todo Ãgil, Lenguaje de Patrones, Pruebas de Usabilidad',2,1,1,1,1,'2013-09-17 08:42:23','2013-09-17 08:42:23','Documento_693.pdf','application/pdf',11019838,'2013-09-17 08:42:23',20,0,100,'COMPLETO'),(685,'{}','{}','2011-09-26','{}',6,1,1,1,1,'2013-09-17 08:42:24','2013-09-17 08:42:24','Documento_694.pdf','application/pdf',6341234,'2013-09-17 08:42:24',18,0,138,'COMPLETO'),(686,'{}','{}','2011-09-22','{}',1,1,1,1,1,'2013-09-17 08:42:29','2013-09-17 08:42:29','Documento_695.pdf','application/pdf',2918001,'2013-09-17 08:42:29',20,0,112,'COMPLETO'),(687,'{}','{}','2011-10-27','{}',5,1,1,1,1,'2013-09-17 08:42:30','2013-09-17 08:42:30','Documento_696.pdf','application/pdf',2476272,'2013-09-17 08:42:30',20,0,89,'COMPLETO'),(688,'{}','{}','2011-10-27','{}',5,1,1,1,1,'2013-09-17 08:42:34','2013-09-17 08:42:34','Documento_697.pdf','application/pdf',1877626,'2013-09-17 08:42:34',20,0,103,'COMPLETO'),(689,'{}','{}','2011-09-22','{}',2,1,1,1,1,'2013-09-17 08:42:35','2013-09-17 08:42:35','Documento_698.pdf','application/pdf',2228172,'2013-09-17 08:42:35',19,0,111,'COMPLETO'),(690,'{}','{}','2011-10-27','{}',5,1,1,1,1,'2013-09-17 08:42:36','2013-09-17 08:42:36','Documento_699.pdf','application/pdf',1348424,'2013-09-17 08:42:36',20,0,77,'COMPLETO'),(691,'{}','{}','2011-08-04','{}',1